INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 1, 1, 1, 0, 100101, 1, 0, "ここに困ってる人は\nいないよね…？\nよかった♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2, 2, 1, 1, 0, 100101, 1, 0, "冒険の準備準備…\nうん、忘れ物はなし！\n…あっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3, 3, 1, 1, 0, 100101, 1, 0, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 4, 1, 1, 0, 100101, 1, 0, "ここで特訓していい？\n物は壊さないように\n気をつけるね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5, 5, 1, 1, 0, 100101, 1, 0, "なんか落ち着かないや\nもしかして、\n困ってる人が\n近くにいるのかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6, 101, 1, 4, 0, 100101, 1, 0, "えへへ…いつも\n一緒にいてくれて\nありがとねっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7, 102, 1, 8, 0, 100101, 1, 0, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 1, 2, 1, 0, 100101, 1, 0, "あははっ！\nやったなー！\nお返しだー！\nこちょこちょこちょ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9, 2, 2, 1, 0, 100101, 1, 0, "どうしたの？\nもしかして困ってる？\nあたしにまかせて！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (10, 3, 2, 1, 0, 100101, 1, 0, "えっとね…しっぽは\n触っちゃダメだよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (11, 4, 2, 1, 0, 100101, 1, 0, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (12, 101, 2, 4, 0, 100101, 1, 0, "ふぁふぃ？\nやられた～！　ほっぺ\nぷにぷにしないでぇ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (13, 102, 2, 8, 0, 100101, 1, 0, "えへへ…\n騎士くんの手だ…\nあったかいな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (14, 1, 2, 1, 0, 100101, 1, 1, "おはよー！\n今日も元気に\nいっちゃうよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (15, 2, 2, 1, 0, 100101, 1, 2, "ユイちゃんに\nおやつ作って\nもらおうかな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (16, 3, 2, 1, 0, 100101, 1, 3, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (17, 1, 3, 1, 0, 100101, 1, 0, "ちゃんとケアして\n傷が残らないように\nしないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (18, 2, 3, 1, 0, 100101, 1, 0, "一回休むと\nこのままずるずる\nいきそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (19, 3, 3, 1, 0, 100101, 1, 0, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (20, 4, 3, 1, 0, 100101, 1, 0, "落ち着くなぁ～\n心だけじゃなくて\n体もほぐれそう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (21, 5, 3, 1, 0, 100101, 1, 0, "あったかい所に\nいると体が丸く\nなっちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (22, 6, 3, 1, 0, 100101, 1, 0, "いつ何が起きるか\n分からないし、\nもっと力をつけないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (23, 7, 3, 1, 0, 100101, 1, 0, "美味しいけど、\n食べ過ぎないように\nしないと…！！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (24, 8, 3, 1, 0, 100101, 1, 0, "文字が多いと\n眠くなっちゃう…\n危ない危ない！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (26, 1, 1, 1, 0, 100102, 1, 0, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (27, 2, 1, 1, 0, 100102, 1, 0, "のんびりするのって\n退屈かも…\n何かして遊ばない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (28, 3, 1, 1, 0, 100102, 1, 0, "留守番はちょっと\n苦手かも…\nなんか寂しいんだもん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (29, 4, 1, 1, 0, 100102, 1, 0, "あたしのお友達も\n呼んできていい？\nきっと楽しいよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (30, 5, 1, 1, 0, 100102, 1, 0, "誰も困ってないよね？\n…何をすれば\nいいのか分かんないや");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (31, 101, 1, 8, 0, 100102, 1, 0, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (32, 102, 1, 8, 0, 100102, 1, 0, "…なんであたし\n騎士くんばっかり\n見てるんだろ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (33, 1, 2, 1, 0, 100102, 1, 0, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (34, 2, 2, 1, 0, 100102, 1, 0, "触るのって楽しい？\n…そっか\n少しだけだよ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (35, 3, 2, 1, 0, 100102, 1, 0, "あたしの元気を\nわけてあげるね！\nフレー！　フレー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (36, 4, 2, 1, 0, 100102, 1, 0, "何かムズムズする！？\nって騎士くんかぁー\nどしたの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (37, 101, 2, 8, 0, 100102, 1, 0, "ひゃうっ！　もう…\nしっぽはだめだってば\n次やったらデコピン！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (38, 102, 2, 8, 0, 100102, 1, 0, "えへへ…\n騎士くんの手だ…\nあったかいな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (39, 1, 2, 1, 0, 100102, 1, 1, "朝ごはんと運動！\nこれがあたしの\n元気の素だよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (40, 2, 2, 1, 0, 100102, 1, 2, "ユイちゃんに\nおやつ作って\nもらおうかな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (41, 3, 2, 1, 0, 100102, 1, 3, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (42, 1, 3, 1, 0, 100102, 1, 0, "これでよし♪\n騎士くん\n気づくかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (43, 2, 3, 1, 0, 100102, 1, 0, "一回休むと\nこのままずるずる\nいきそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (44, 3, 3, 1, 0, 100102, 1, 0, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (45, 4, 3, 1, 0, 100102, 1, 0, "こういうの\nなんか気になって\nじーって見ちゃうんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (46, 5, 3, 1, 0, 100102, 1, 0, "あったかい所に\nいると体が丸く\nなっちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (47, 6, 3, 1, 0, 100102, 1, 0, "いつ何が起きるか\n分からないし\nもっと力をつけないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (48, 7, 3, 1, 0, 100102, 1, 0, "お腹が減ると\nなんか力が\n出ないんだよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (49, 8, 3, 1, 0, 100102, 1, 0, "色んなことを\n知っておくのは\n大事だよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (51, 1, 1, 1, 0, 100201, 1, 0, "お片付けも済んだし\n今度は洗濯ものを\nたたもうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (52, 2, 1, 1, 0, 100201, 1, 0, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (53, 3, 1, 1, 0, 100201, 1, 0, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (54, 4, 1, 1, 0, 100201, 1, 0, "戦いは\n得意じゃないけど\nお料理なら…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (55, 5, 1, 1, 0, 100201, 1, 0, "こういう平和な\n時間が、もっと\n続くといいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (56, 101, 1, 4, 0, 100201, 1, 0, "わたし…\nもうちょっとだけ勇気\n出してみようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (57, 102, 1, 8, 0, 100201, 1, 0, "みんなのことが大好き\nも、もちろん、\n騎士クンのことも…\nな、仲間として！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (58, 1, 2, 1, 0, 100201, 1, 0, "ひゃうっ！\nな、なに？\nびっくりしたぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (59, 2, 2, 1, 0, 100201, 1, 0, "男の子って、\nやっぱりおっきいね。\nその…手とか\n他にもいろいろ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (60, 3, 2, 1, 0, 100201, 1, 0, "困ったことが\nあったら\nいつでも話してね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (61, 4, 2, 1, 0, 100201, 1, 0, "え！　む、虫っ！？\n取って取って！\nはやく～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (62, 101, 2, 4, 0, 100201, 1, 0, "あのね…\n一緒におでかけ\nしたいんだけど…\nダメかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (63, 102, 2, 8, 0, 100201, 1, 0, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (64, 1, 2, 1, 0, 100201, 1, 1, "お、おはよう！\nあの…朝ごはんは\nもう食べちゃった？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (65, 2, 2, 1, 0, 100201, 1, 2, "お昼休みだね\nあの…良かったら\nお弁当…食べない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (66, 3, 2, 1, 0, 100201, 1, 3, "遅くまでお疲れ様\n明日も頑張ろうね\nふわぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (67, 1, 3, 1, 0, 100201, 1, 0, "よし…\nこれなら\n褒めてもらえるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (68, 2, 3, 1, 0, 100201, 1, 0, "がんばることも\n必要だけど、\nお休みも大切だよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (69, 3, 3, 1, 0, 100201, 1, 0, "かわいいなぁ…\nわたしも今度\n作ってみよう。\nえっと、材料は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (70, 4, 3, 1, 0, 100201, 1, 0, "戦う前にもこうやって\n落ち着けたら\nいいのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (71, 5, 3, 1, 0, 100201, 1, 0, "…はへっ？\nも、もしかして今\n寝ちゃってた…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (72, 6, 3, 1, 0, 100201, 1, 0, "騎士クンと一緒に\n冒険するなら\n体力がないと…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (73, 7, 3, 1, 0, 100201, 1, 0, "おいしいものって\n食べ過ぎちゃうけど…\nしょうがない…よね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (74, 8, 3, 1, 0, 100201, 1, 0, "…そっか\nこうすれば魔法が\nもっと強くなるんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (76, 1, 1, 1, 0, 100202, 1, 0, "洗濯と掃除\nどっちから\nはじめよう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (77, 2, 1, 1, 0, 100202, 1, 0, "新しい魔道書を\n買いに行かなくちゃ\nもっとたくさん\n魔法を覚えたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (78, 3, 1, 1, 0, 100202, 1, 0, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (79, 4, 1, 1, 0, 100202, 1, 0, "今日はどんな料理に\n挑戦しよう…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (80, 5, 1, 1, 0, 100202, 1, 0, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (81, 101, 1, 8, 0, 100202, 1, 0, "みんなのことが大好き\nも、もちろん\n騎士クンのことも…\nな、仲間として！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (82, 102, 1, 8, 0, 100202, 1, 0, "騎士クンのそばに\nいられるだけで\n幸せだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (83, 1, 2, 1, 0, 100202, 1, 0, "えっと、その…\nこんな所で\nこういうことされると\n恥ずかしいよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (84, 2, 2, 1, 0, 100202, 1, 0, "え！　む、虫っ！？\n取って取って！\nはやく～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (85, 3, 2, 1, 0, 100202, 1, 0, "あ、あの…実は\n騎士クンのこと…\nううん、やっぱり\nなんでもない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (86, 4, 2, 1, 0, 100202, 1, 0, "男の子って\nやっぱりおっきいね\nその…手とか\n他にもいろいろ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (87, 101, 2, 8, 0, 100202, 1, 0, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (88, 102, 2, 8, 0, 100202, 1, 0, "ふふふっ…そんなとこ\nツンツンしないで\nくすぐったいよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (89, 1, 2, 1, 0, 100202, 1, 1, "おはよう\nよく眠れた？　今日も\n一日、頑張ろうね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (90, 2, 2, 1, 0, 100202, 1, 2, "お腹空いちゃった…\nそうだ。騎士クンも\n一緒にお昼食べない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (91, 3, 2, 1, 0, 100202, 1, 3, "もうこんな時間…\nそろそろ寝なくちゃ\nおやすみなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (92, 1, 3, 1, 0, 100202, 1, 0, "よし…\nこれなら\n褒めてもらえるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (93, 2, 3, 1, 0, 100202, 1, 0, "がんばることも\n必要だけど\nお休みも大切だよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (94, 3, 3, 1, 0, 100202, 1, 0, "かわいい～♪\n騎士クンは\nこういうのって好き？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (95, 4, 3, 1, 0, 100202, 1, 0, "戦う前にもこうやって\n落ち着けたら\nいいのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (96, 5, 3, 1, 0, 100202, 1, 0, "あの…！\nよ、良かったら\n一緒に…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (97, 6, 3, 1, 0, 100202, 1, 0, "騎士クンと一緒に\n冒険するなら\n体力がないと…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (98, 7, 3, 1, 0, 100202, 1, 0, "最近服のサイズが\n合わないんだけど…\n食べ過ぎなのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (99, 8, 3, 1, 0, 100202, 1, 0, "…やっぱり\n月刊恋愛指南は\nためになる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (101, 1, 1, 1, 0, 100301, 1, 0, "装備の手入れでも\nしようかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (102, 2, 1, 1, 0, 100301, 1, 0, "次に鍛えるべきは\n肉体面か精神面か\nどちらにしよう…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (103, 3, 1, 1, 0, 100301, 1, 0, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (104, 4, 1, 1, 0, 100301, 1, 0, "仲間なんていらない\nそう思ってた頃も\nあったな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (105, 5, 1, 1, 0, 100301, 1, 0, "考えごとをしていると\nつい部屋中を\n歩いてしまうな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (106, 101, 1, 4, 0, 100301, 1, 0, "彼は\nどこまで強くなるのか\n私も負けられないな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (107, 102, 1, 8, 0, 100301, 1, 0, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (108, 1, 2, 1, 0, 100301, 1, 0, "ああ、キミだったのか\n人の気配がしたから\n誰かと思ったよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (109, 2, 2, 1, 0, 100301, 1, 0, "斬りかかるつもりなら\nちゃんとかかってきて\n…呼んだだけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (110, 3, 2, 1, 0, 100301, 1, 0, "なに？　私に相談？\n戦いについてなら\n喜んで");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (111, 4, 2, 1, 0, 100301, 1, 0, "今のが突き？\n軽い！　もっと鋭く！\nさあ、もう一回！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (112, 101, 2, 4, 0, 100301, 1, 0, "ひゃっ！　ど、どこを\n触ってるの！？\n…油断した");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (113, 102, 2, 8, 0, 100301, 1, 0, "キミにはこれからも\n私のそばに…\nいや、なんでもない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (114, 1, 2, 1, 0, 100301, 1, 1, "おはよう\n今日も充実した\n一日にしていこう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (115, 2, 2, 1, 0, 100301, 1, 2, "そろそろ\nお茶の時間か\nキミも一緒にどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (116, 3, 2, 1, 0, 100301, 1, 3, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (117, 1, 3, 1, 0, 100301, 1, 0, "戦いを経てもなお\n美しくあるように…\nこれでよし♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (118, 2, 3, 1, 0, 100301, 1, 0, "戦ってばかりで\n休まないと、また\nユイに怒られるな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (119, 3, 3, 1, 0, 100301, 1, 0, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (120, 4, 3, 1, 0, 100301, 1, 0, "これはいい…\n戦いの前の精神統一に\nもってこいじゃないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (121, 5, 3, 1, 0, 100301, 1, 0, "時々は落ち着いた\n時間を過ごすのも\n悪くない…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (122, 6, 3, 1, 0, 100301, 1, 0, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (123, 7, 3, 1, 0, 100301, 1, 0, "食事は大切だけど\n食べ過ぎには\n注意しておこう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (124, 8, 3, 1, 0, 100301, 1, 0, "ユイ…！\nこ、こんな本を\n読んでいたのか…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (126, 1, 1, 1, 0, 100302, 1, 0, "海だけじゃなくて\n川でも釣りがしたいな\n道具も新調しよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (127, 2, 1, 1, 0, 100302, 1, 0, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (128, 3, 1, 1, 0, 100302, 1, 0, "彼は\nどこまで強くなるのか\n私も負けられないな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (129, 4, 1, 1, 0, 100302, 1, 0, "そろそろ修行の\n内容を新しくしよう\nより厳しいものにね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (130, 5, 1, 1, 0, 100302, 1, 0, "強くなって…誰にも\n妨げられない自由な\n生き方がしたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (131, 101, 1, 8, 0, 100302, 1, 0, "まさか風邪を引くとは\n彼の看病のおかげで\nすっかり良く\nなったけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (132, 102, 1, 8, 0, 100302, 1, 0, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (133, 1, 2, 1, 0, 100302, 1, 0, "どうしたの？\nなんでもない？\nそれなら良かった");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (134, 2, 2, 1, 0, 100302, 1, 0, "あんまり突っつくと\nお返しするよ？\n覚悟は出来てる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (135, 3, 2, 1, 0, 100302, 1, 0, "ねぇ、今度また\n釣りに行かない？\n大きいのを狙おう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (136, 4, 2, 1, 0, 100302, 1, 0, "修行がしたいの？\nそれを早く言ってよ\nすぐに出発しよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (137, 101, 2, 8, 0, 100302, 1, 0, "ひょっとして\n今のも一本だなんて\n言わないよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (138, 102, 2, 8, 0, 100302, 1, 0, "キミにはこれからも\n私のそばに…\nいや、なんでもない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (139, 1, 2, 1, 0, 100302, 1, 1, "今日は仕事？\nそれとも修行？\n良ければ付き合うよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (140, 2, 2, 1, 0, 100302, 1, 2, "休息も時には\n必要だと、仲間から\n教わったよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (141, 3, 2, 1, 0, 100302, 1, 3, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (142, 1, 3, 1, 0, 100302, 1, 0, "髪の長さを少し\n変えてみようかな…\nわ、私は何を…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (143, 2, 3, 1, 0, 100302, 1, 0, "休息があってこそ\n万全な状態で\n戦えるんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (144, 3, 3, 1, 0, 100302, 1, 0, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (145, 4, 3, 1, 0, 100302, 1, 0, "体と同様に\n心もほぐれるね…\nはぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (146, 5, 3, 1, 0, 100302, 1, 0, "休む時は休む\nヒヨリもそろそろ\n覚えて欲しいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (147, 6, 3, 1, 0, 100302, 1, 0, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (148, 7, 3, 1, 0, 100302, 1, 0, "修行のせいか\n最近食べる量が\n増えてきたような…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (149, 8, 3, 1, 0, 100302, 1, 0, "ユイ…！\nこ、こんな本を\n読んでいたのか…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (151, 1, 1, 1, 0, 100401, 1, 0, "お宝の予感！\n部屋中を\n探検しちゃうぞ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (152, 2, 1, 1, 0, 100401, 1, 0, "落とし穴…どこに\n作ったんだっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (153, 3, 1, 1, 0, 100401, 1, 0, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (154, 4, 1, 1, 0, 100401, 1, 0, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (155, 5, 1, 1, 0, 100401, 1, 0, "かくれんぼする人\nこの指、と～まれ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (156, 101, 1, 4, 0, 100401, 1, 0, "ミソギ以外の人に\nイタズラされちゃ\nダメだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (157, 102, 1, 8, 0, 100401, 1, 0, "ミソギと遊ぶ？\nミソギに遊ばれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (158, 1, 2, 1, 0, 100401, 1, 0, "いいこと思いついた！\nい、イタズラとかじゃ\nないよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (159, 2, 2, 1, 0, 100401, 1, 0, "うわっ！？\n　にいちゃんが、\nミソギにイタズラ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (160, 3, 2, 1, 0, 100401, 1, 0, "にいちゃんの\n通りそうなところに\nバナナの皮を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (161, 4, 2, 1, 0, 100401, 1, 0, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (162, 101, 2, 4, 0, 100401, 1, 0, "ここ、ミソギ探検隊の\n基地にしようよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (163, 102, 2, 8, 0, 100401, 1, 0, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (164, 1, 2, 1, 0, 100401, 1, 1, "にいちゃん、おはよ！\n目覚まし時計を\n止めておいたのに、\nよく起きられたね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (165, 2, 2, 1, 0, 100401, 1, 2, "にいちゃんが\n昼寝したら、\nイタズラし放題♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (166, 3, 2, 1, 0, 100401, 1, 3, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (167, 1, 3, 1, 0, 100401, 1, 0, "イタズラには\nお色気も必要…\nうん、完璧！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (168, 2, 3, 1, 0, 100401, 1, 0, "座ったら、ブーッって\nいう音が出たら、\nおもしろいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (169, 3, 3, 1, 0, 100401, 1, 0, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (170, 4, 3, 1, 0, 100401, 1, 0, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (171, 5, 3, 1, 0, 100401, 1, 0, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (172, 6, 3, 1, 0, 100401, 1, 0, "探検家は\n体力勝負だよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (173, 7, 3, 1, 0, 100401, 1, 0, "みんなに分けて\nあげようかな～\n激辛ソースも\n入れちゃうけどね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (174, 8, 3, 1, 0, 100401, 1, 0, "こういう所に\n宝の地図が\n隠れてるんだよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (176, 1, 1, 1, 0, 100402, 1, 0, "お宝の予感！\n部屋中を\n探検しちゃうぞ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (177, 2, 1, 1, 0, 100402, 1, 0, "うぅ、探検に出たい！\nじっとしてなんか\nいられないよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (178, 3, 1, 1, 0, 100402, 1, 0, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (179, 4, 1, 1, 0, 100402, 1, 0, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (180, 5, 1, 1, 0, 100402, 1, 0, "かくれんぼする人\nこの指、と～まれ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (181, 101, 1, 8, 0, 100402, 1, 0, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (182, 102, 1, 8, 0, 100402, 1, 0, "にいちゃんが喜ぶ\nイタズラ、何かない\nかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (183, 1, 2, 1, 0, 100402, 1, 0, "ミソギがしかけた\nイタズラ\n見つけられるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (184, 2, 2, 1, 0, 100402, 1, 0, "探検する？\n冒険する？\nそれとも…\nイタズラされる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (185, 3, 2, 1, 0, 100402, 1, 0, "将来の夢は探検家！\n探したい物はないけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (186, 4, 2, 1, 0, 100402, 1, 0, "にいちゃんに宿題！\n落とし穴を10個\n掘ること！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (187, 101, 2, 8, 0, 100402, 1, 0, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (188, 102, 2, 8, 0, 100402, 1, 0, "ここ、ミソギ探検隊の\n基地にしようよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (189, 1, 2, 1, 0, 100402, 1, 1, "にいちゃん\n探検に行こうよ！\n今からなら遭難しても\n夜には帰れるよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (190, 2, 2, 1, 0, 100402, 1, 2, "にいちゃんが昼寝したら\nイタズラし放題♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (191, 3, 2, 1, 0, 100402, 1, 3, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (192, 1, 3, 1, 0, 100402, 1, 0, "イタズラには\nお色気も必要…\nうん、完璧！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (193, 2, 3, 1, 0, 100402, 1, 0, "ゆっくりまったりして\n次のイタズラを\n考えよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (194, 3, 3, 1, 0, 100402, 1, 0, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (195, 4, 3, 1, 0, 100402, 1, 0, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (196, 5, 3, 1, 0, 100402, 1, 0, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (197, 6, 3, 1, 0, 100402, 1, 0, "探検家は\n体力勝負だよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (198, 7, 3, 1, 0, 100402, 1, 0, "探検のおやつに\nぴったりかも～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (199, 8, 3, 1, 0, 100402, 1, 0, "こういう所に\n宝の地図が\n隠れてるんだよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (201, 1, 1, 1, 0, 100601, 1, 0, "音楽は全部好きだけど\n一番好きなのは\nやっぱりジャズかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (202, 2, 1, 1, 0, 100601, 1, 0, "はぁ、はぁ…\n一人でもいっぱい\nしないと…\n特訓…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (203, 3, 1, 1, 0, 100601, 1, 0, "お姉ちゃんには\nもっと自信を\n持ってほしいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (204, 4, 1, 1, 0, 100601, 1, 0, "お姉ちゃんのマネ\nしちゃおうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (205, 5, 1, 1, 0, 100601, 1, 0, "双子って、\n好みのタイプも\n似ちゃうのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (206, 101, 1, 4, 0, 100601, 1, 0, "お兄ちゃんと私は\n相性抜群です♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (207, 102, 1, 8, 0, 100601, 1, 0, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (208, 1, 2, 1, 0, 100601, 1, 0, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (209, 2, 2, 1, 0, 100601, 1, 0, "うふふ、お兄ちゃん！\n今日は何を\nするんですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (210, 3, 2, 1, 0, 100601, 1, 0, "そんなところ\n触っちゃダメ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (211, 4, 2, 1, 0, 100601, 1, 0, "お兄ちゃん、イジワル\nしないでください…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (212, 101, 2, 4, 0, 100601, 1, 0, "お兄ちゃん、もっと\n上級編のテクニック、\n教えてくださいね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (213, 102, 2, 8, 0, 100601, 1, 0, "コーチ、\n今日も特訓\nお願いします！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (214, 1, 2, 1, 0, 100601, 1, 1, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (215, 2, 2, 1, 0, 100601, 1, 2, "こんな明るい時間から\nす、するんですか…\n二人っきりの特訓…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (216, 3, 2, 1, 0, 100601, 1, 3, "夜はこれからですよ\nお兄ちゃん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (217, 1, 3, 1, 0, 100601, 1, 0, "世界一、かわいく\nなるんだから♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (218, 2, 3, 1, 0, 100601, 1, 0, "気持ちいい♪\nもう立てないよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (219, 3, 3, 1, 0, 100601, 1, 0, "かわいい♪\nアカリのライバル\nだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (220, 4, 3, 1, 0, 100601, 1, 0, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (221, 5, 3, 1, 0, 100601, 1, 0, "はぁ…アカリ、\nとろけちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (222, 6, 3, 1, 0, 100601, 1, 0, "はぁ…はぁはぁ、\n私…もう…ダメ\n限界です…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (223, 7, 3, 1, 0, 100601, 1, 0, "わぁ、おいしい～\nけど食べ過ぎは美容に\nよくないですよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (224, 8, 3, 1, 0, 100601, 1, 0, "この楽譜、\nサックスで吹いて\nみたいなぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (226, 1, 1, 1, 0, 100602, 1, 0, "このごろ一人でいると\nお兄ちゃんのこと\nばかり考えちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (227, 2, 1, 1, 0, 100602, 1, 0, "はぁ、はぁ…もっと\nいっぱいしなくちゃ\n…練習");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (228, 3, 1, 1, 0, 100602, 1, 0, "このお部屋、なんだか\n落ち着きます…\nお兄ちゃんが\nいるから？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (229, 4, 1, 1, 0, 100602, 1, 0, "みんなかわいいな～\n世界一かわいくなる\nのは、難しいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (230, 5, 1, 1, 0, 100602, 1, 0, "双子って、\n好みのタイプも\n似ちゃうのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (231, 101, 1, 8, 0, 100602, 1, 0, "いつか世界でいちばん\nかわいくなって\nお兄ちゃんと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (232, 102, 1, 8, 0, 100602, 1, 0, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (233, 1, 2, 1, 0, 100602, 1, 0, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (234, 2, 2, 1, 0, 100602, 1, 0, "二人きりの秘密の特訓\n今度はいつですか？\n待ち遠しいです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (235, 3, 2, 1, 0, 100602, 1, 0, "え？　ここでするの？\nみんなの前で恥ずか\nしいな…筋トレ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (236, 4, 2, 1, 0, 100602, 1, 0, "お兄ちゃん、イジワル\nしないでください…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (237, 101, 2, 8, 0, 100602, 1, 0, "お兄ちゃんといると\nわ、私…ドキドキ\nしてきちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (238, 102, 2, 8, 0, 100602, 1, 0, "コーチ、\n今日も特訓\nお願いします！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (239, 1, 2, 1, 0, 100602, 1, 1, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (240, 2, 2, 1, 0, 100602, 1, 2, "お兄ちゃんに\n食べてもらいたいなぁ\n手作りのお昼ごはん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (241, 3, 2, 1, 0, 100602, 1, 3, "お風呂入ってきますね\nそのあとは…\n二人でい～っぱい\n遊びましょうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (242, 1, 3, 1, 0, 100602, 1, 0, "お姉ちゃんのマネ\nしちゃおうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (243, 2, 3, 1, 0, 100602, 1, 0, "気持ちいい♪\nもう立てないよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (244, 3, 3, 1, 0, 100602, 1, 0, "かわいい♪\nアカリのライバル\nだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (245, 4, 3, 1, 0, 100602, 1, 0, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (246, 5, 3, 1, 0, 100602, 1, 0, "あったか～い…\nまるでお兄ちゃんが\n隣にいる時みたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (247, 6, 3, 1, 0, 100602, 1, 0, "汗をかくと\n気持ちいいですよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (248, 7, 3, 1, 0, 100602, 1, 0, "お兄ちゃんの特訓に\n付き合うために\nたっぷり\n食べておかないと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (249, 8, 3, 1, 0, 100602, 1, 0, "この楽譜\nサックスで吹いて\nみたいなぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (251, 1, 1, 1, 0, 100701, 1, 0, "プリン、プリン、\nプリン、プリン、\nプリン、プリン～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (252, 2, 1, 1, 0, 100701, 1, 0, "う～ら～め～し～や～\nなの～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (253, 3, 1, 1, 0, 100701, 1, 0, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (254, 4, 1, 1, 0, 100701, 1, 0, "幽霊の正体見たり、\nミヤコなの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (255, 5, 1, 1, 0, 100701, 1, 0, "ミヤコがいきなり\n消えたら、みんな\n驚くかもなの～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (256, 101, 1, 4, 0, 100701, 1, 0, "アイツがいて、\nプリンもある。\nきっとここが天国なの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (257, 102, 1, 8, 0, 100701, 1, 0, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (258, 1, 2, 1, 0, 100701, 1, 0, "姿を消して、オマエを\n見張ってやるの～\nむふふ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (259, 2, 2, 1, 0, 100701, 1, 0, "もし成仏した先に\nプリンがなかったら\n地獄なの～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (260, 3, 2, 1, 0, 100701, 1, 0, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (261, 4, 2, 1, 0, 100701, 1, 0, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (262, 101, 2, 4, 0, 100701, 1, 0, "たくさんオマエと\n遊べて、\n成仏しそうなくらい\nうれしいの～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (263, 102, 2, 8, 0, 100701, 1, 0, "オマエのこと\n気に入ったからずっと\nとり憑いてやるの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (264, 1, 2, 1, 0, 100701, 1, 1, "う～　眠いの…\n二度目の二度寝を\nするの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (265, 2, 2, 1, 0, 100701, 1, 2, "お昼ご飯はプリンなの\n３時のおやつも、\nプリンなの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (266, 3, 2, 1, 0, 100701, 1, 3, "ディナーは豪華に、\nプリンのフルコース\nなの～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (267, 1, 3, 1, 0, 100701, 1, 0, "体が透けちゃうから\nうまく使えないの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (268, 2, 3, 1, 0, 100701, 1, 0, "まったりなの～\nあとはプリンがあれば\n完璧なの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (269, 3, 3, 1, 0, 100701, 1, 0, "む～…かわいいけど\nプリンは分けて\nあげないの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (270, 4, 3, 1, 0, 100701, 1, 0, "は～　いい気分なの…\n成仏しそうなの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (271, 5, 3, 1, 0, 100701, 1, 0, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (272, 6, 3, 1, 0, 100701, 1, 0, "幽霊には、体力も\n筋力も関係ないの～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (273, 7, 3, 1, 0, 100701, 1, 0, "ぱくぱくモグモグ…\nミヤコ、幽霊だけど、\nお腹はすくの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (274, 8, 3, 1, 0, 100701, 1, 0, "プリンの写真集が\nあればいいのに\nなの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (276, 1, 1, 1, 0, 100702, 1, 0, "うらめしや～…\n裏の飯より\nプリンがいいの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (277, 2, 1, 1, 0, 100702, 1, 0, "プリン♪　プリン♪\nプリン♪　なの～♪　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (278, 3, 1, 1, 0, 100702, 1, 0, "世界中のケーキ屋が\nプリンのおいしさを\n競い合えばいいの～！\n審査員はミヤコなの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (279, 4, 1, 1, 0, 100702, 1, 0, "買ってきたプリンには\n全部ミヤコの名前を\n書いておくの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (280, 5, 1, 1, 0, 100702, 1, 0, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (281, 101, 1, 8, 0, 100702, 1, 0, "アイツがいて\nプリンもある\nきっとここが天国なの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (282, 102, 1, 8, 0, 100702, 1, 0, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (283, 1, 2, 1, 0, 100702, 1, 0, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (284, 2, 2, 1, 0, 100702, 1, 0, "もし成仏した先に\nプリンがなかったら\n地獄なの～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (285, 3, 2, 1, 0, 100702, 1, 0, "今日はオマエと\nプリンを買いに行くの\n強制なの～　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (286, 4, 2, 1, 0, 100702, 1, 0, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (287, 101, 2, 8, 0, 100702, 1, 0, "たくさんオマエと\n遊べて\n成仏しそうなくらい\nうれしいの～！ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (288, 102, 2, 8, 0, 100702, 1, 0, "ミヤコのプリン\nオマエにだったら\n分けてあげるの～ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (289, 1, 2, 1, 0, 100702, 1, 1, "う～　眠いの…\n二度目の二度寝を\nするの… ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (290, 2, 2, 1, 0, 100702, 1, 2, "う～ら～め～し～や～\n…明るい時間だと\n驚かせないの～ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (291, 3, 2, 1, 0, 100702, 1, 3, "ひゅ～どろどろ～ん☆\n真っ暗なうちに\nいたずらしまくるの～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (292, 1, 3, 1, 0, 100702, 1, 0, "体が透けちゃうから\nうまく使えないの～ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (293, 2, 3, 1, 0, 100702, 1, 0, "落ち着くの～\nいまプリン食べたら\nきっといつもより\nおいしいの～♪ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (294, 3, 3, 1, 0, 100702, 1, 0, "む～…かわいいけど\nプリンは分けて\nあげないの～　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (295, 4, 3, 1, 0, 100702, 1, 0, "は～　いい気分なの…\n成仏しそうなの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (296, 5, 3, 1, 0, 100702, 1, 0, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (297, 6, 3, 1, 0, 100702, 1, 0, "幽霊には、体力も\n筋力も関係ないの～！　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (298, 7, 3, 1, 0, 100702, 1, 0, "おいしいの～\nプリン味だったら\nもっとおいしいの～ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (299, 8, 3, 1, 0, 100702, 1, 0, "プリンの写真集が\nあればいいのに\nなの～ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (301, 1, 1, 1, 0, 100801, 1, 0, "もし太陽が滅んでも\nボクの美しさで大地を\n照らしてあげる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (302, 2, 1, 1, 0, 100801, 1, 0, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (303, 3, 1, 1, 0, 100801, 1, 0, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (304, 4, 1, 1, 0, 100801, 1, 0, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (305, 5, 1, 1, 0, 100801, 1, 0, "うわっ昨日より可愛く\nなってる。明日は\nどうなっちゃう\nのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (306, 101, 1, 4, 0, 100801, 1, 0, "このボクがいるだけで\nあの人への\nおもてなしだよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (307, 102, 1, 8, 0, 100801, 1, 0, "ボクの可愛さは、\nふふ…あの人の\nためのものさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (308, 1, 2, 1, 0, 100801, 1, 0, "ねぇ～、ボクって\n可愛い？\nふふ、知ってる☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (309, 2, 2, 1, 0, 100801, 1, 0, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (310, 3, 2, 1, 0, 100801, 1, 0, "ふふ、ボクに触ると\nキミも美しく\nなっちゃうかもよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (311, 4, 2, 1, 0, 100801, 1, 0, "どうかな、\n今日のボク。\n美しい？　可愛い？\nねえ、どっち？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (312, 101, 2, 4, 0, 100801, 1, 0, "あの人も今、\n可愛いボクのこと\n考えてるかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (313, 102, 2, 8, 0, 100801, 1, 0, "美しい…\nキミの瞳に写るボクは\nより一層きれいだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (314, 1, 2, 1, 0, 100801, 1, 1, "美しいボクの\n美しい一日が\n始まるよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (315, 2, 2, 1, 0, 100801, 1, 2, "さーて、午後からも\n可愛く美しく\n華麗に優雅に♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (316, 3, 2, 1, 0, 100801, 1, 3, "バラの花びら\nいっぱい浮かべた\nお風呂に入ってから\n寝ようっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (317, 1, 3, 1, 0, 100801, 1, 0, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (318, 2, 3, 1, 0, 100801, 1, 0, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (319, 3, 3, 1, 0, 100801, 1, 0, "わあ、可愛い！\n…まあ、ボクほど\nじゃないけどさ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (320, 4, 3, 1, 0, 100801, 1, 0, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (321, 5, 3, 1, 0, 100801, 1, 0, "気安く触ったら\n火傷する…\n炎はボクに似ているね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (322, 6, 3, 1, 0, 100801, 1, 0, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (323, 7, 3, 1, 0, 100801, 1, 0, "ボクが食べると、\n食べ物まで\n可愛いなあ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (324, 8, 3, 1, 0, 100801, 1, 0, "ボクが触った瞬間に、\nこの本は美を\n携えてしまうんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (326, 1, 1, 1, 0, 100802, 1, 0, "ボクの美しさは\nみんなのために\nあるんだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (327, 2, 1, 1, 0, 100802, 1, 0, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (328, 3, 1, 1, 0, 100802, 1, 0, "これ以上美しくなると\nボクをめぐって\n大陸中で戦争が\n始まっちゃう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (329, 4, 1, 1, 0, 100802, 1, 0, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (330, 5, 1, 1, 0, 100802, 1, 0, "ボクの可愛さについて\nみんな話し合わない\nのかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (331, 101, 1, 8, 0, 100802, 1, 0, "このボクがいるだけで\nあの人への\nおもてなしだよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (332, 102, 1, 8, 0, 100802, 1, 0, "あの人も今\n可愛いボクのこと\n考えてるかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (333, 1, 2, 1, 0, 100802, 1, 0, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (334, 2, 2, 1, 0, 100802, 1, 0, "ボクの美しさに嫉妬\nしたって意味ないよね\n次元が違うんだから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (335, 3, 2, 1, 0, 100802, 1, 0, "ボクの化粧品使う？\n一緒に可愛くなろうよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (336, 4, 2, 1, 0, 100802, 1, 0, "ボクがいるだけで\nこの部屋は美の神殿♪\nランドソルの新たな\n観光名所になるね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (337, 101, 2, 8, 0, 100802, 1, 0, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (338, 102, 2, 8, 0, 100802, 1, 0, "美しい…\nキミの瞳に写るボクは\nより一層綺麗だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (339, 1, 2, 1, 0, 100802, 1, 1, "朝日と共に\nボクの美しさも\n周りを照らすよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (340, 2, 2, 1, 0, 100802, 1, 2, "ボクの美しさを\n維持するために\nお昼ご飯食べなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (341, 3, 2, 1, 0, 100802, 1, 3, "バラの花びらいっぱい\n浮かべたお風呂に\n入ってから\n寝ようっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (342, 1, 3, 1, 0, 100802, 1, 0, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (343, 2, 3, 1, 0, 100802, 1, 0, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (344, 3, 3, 1, 0, 100802, 1, 0, "可愛いものを\n可愛いって言える\nボクって可愛いよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (345, 4, 3, 1, 0, 100802, 1, 0, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (346, 5, 3, 1, 0, 100802, 1, 0, "冷えは美容の大敵\nなんだから！\nここ、ボクの場所ね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (347, 6, 3, 1, 0, 100802, 1, 0, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (348, 7, 3, 1, 0, 100802, 1, 0, "ボクが食べると\n食べ物まで\n可愛いなあ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (349, 8, 3, 1, 0, 100802, 1, 0, "ボクが触った瞬間に\nこの本は美を\n携えてしまうんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (351, 1, 1, 1, 0, 100901, 1, 0, "「第１０部２０章\n終焉戦争、開幕」\n…これでよし！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (352, 2, 1, 1, 0, 100901, 1, 0, "今度シグルドに\n私の魔法を一つ\n伝授してやるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (353, 3, 1, 1, 0, 100901, 1, 0, "ここでは風が\n吹いてこないな…\n換気したい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (354, 4, 1, 1, 0, 100901, 1, 0, "そうだ、ナナカに\nこの間借りた本を\n返さないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (355, 5, 1, 1, 0, 100901, 1, 0, "まずは包帯をとって\n手から龍の形の\n炎を出して…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (356, 101, 1, 4, 0, 100901, 1, 0, "シグルド…\n今頃何処で何を\nしているのだろう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (357, 102, 1, 8, 0, 100901, 1, 0, "最近、彼の姿が\nまぶしく見える…\nどうして…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (358, 1, 2, 1, 0, 100901, 1, 0, "辞書を知らないか？\n…探している\n理由は聞くな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (359, 2, 2, 1, 0, 100901, 1, 0, "そうだ！\n貴様の技にも\n名前をつけてやろう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (360, 3, 2, 1, 0, 100901, 1, 0, "私に触れても力を\n奪われないのは\n貴様くらいだぞ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (361, 4, 2, 1, 0, 100901, 1, 0, "何事だ？\nまさか我が瞳に\n魅入られたのか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (362, 101, 2, 4, 0, 100901, 1, 0, "貴様がそばにいると\nとても安心できる…\n…不思議だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (363, 102, 2, 8, 0, 100901, 1, 0, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (364, 1, 2, 1, 0, 100901, 1, 1, "「覚醒」めたか…\n行くぞ、悪を討つ\n戦いに出発だ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (365, 2, 2, 1, 0, 100901, 1, 2, "昼間は「ヤツら」も\n襲ってはこない…\n束の間の休息だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (366, 3, 2, 1, 0, 100901, 1, 3, "どうした？　夜はまだ\nこれから…ふぁ…\nね、眠くなどないぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (367, 1, 3, 1, 0, 100901, 1, 0, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (368, 2, 3, 1, 0, 100901, 1, 0, "くっ…！\n私を眠りの国へ\n誘うつもりか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (369, 3, 3, 1, 0, 100901, 1, 0, "このようなものに\n懐柔されるものか！\n…されるものか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (370, 4, 3, 1, 0, 100901, 1, 0, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (371, 5, 3, 1, 0, 100901, 1, 0, "これが我らの求めた\n安寧か…\n悪くない…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (372, 6, 3, 1, 0, 100901, 1, 0, "この程度\n前世での激闘に\n比べれば…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (373, 7, 3, 1, 0, 100901, 1, 0, "最近金欠でな…\nいやぁありがたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (374, 8, 3, 1, 0, 100901, 1, 0, "ここにも\n前世の記憶が\n眠っていたとは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (376, 1, 1, 1, 0, 100902, 1, 0, "「第１３部１章\n閃光のシグルド」\n…ついに登場だな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (377, 2, 1, 1, 0, 100902, 1, 0, "何故だ…何故\nこうもあっさり金欠に\n逆戻りするのだ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (378, 3, 1, 1, 0, 100902, 1, 0, "やはり転生者という\n設定はカッコイイ…\n天才だな、私！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (379, 4, 1, 1, 0, 100902, 1, 0, "そうだ、ナナカに\nこの間借りた本を\n返さないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (380, 5, 1, 1, 0, 100902, 1, 0, "そろそろ今日の分の\n魔力を溜めないと\nまた魔力切れが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (381, 101, 1, 1, 0, 100902, 1, 0, "最近奴がそばに\nいるだけで、鼓動が\n早くなるのは何故だ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (382, 102, 1, 8, 0, 100902, 1, 0, "シ、シグルド…！\nだめだ…妄想でも\n上手く言えない…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (383, 1, 2, 8, 0, 100902, 1, 0, "なんだ？　新たな\n賞金の情報を\n持ってきたのか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (384, 2, 2, 1, 0, 100902, 1, 0, "名乗りやポーズは\nその強度で相手を\n圧倒する技術だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (385, 3, 2, 1, 0, 100902, 1, 0, "いいか、魔法の\n詠唱中は絶対に\n声をかけるなよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (386, 4, 2, 1, 0, 100902, 1, 0, "おお、ちょうど今\n貴様専用の設定集を\n作成中だぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (387, 101, 2, 1, 0, 100902, 1, 0, "貴様がそばにいると\nとても安心できる…\n…不思議だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (388, 102, 2, 8, 0, 100902, 1, 0, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (389, 1, 2, 8, 0, 100902, 1, 1, "夜更かしのせいか\nまだ眠気が…いや！\nこれは組織の罠だ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (390, 2, 2, 1, 0, 100902, 1, 2, "平穏な時に\n出来るだけ魔力を\n溜めておかねば…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (391, 3, 2, 1, 0, 100902, 1, 3, "夜になると、力が\n増した気分になるな\n…なりませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (392, 1, 3, 1, 0, 100902, 1, 0, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (393, 2, 3, 1, 0, 100902, 1, 0, "お、おのれ\nヒュプノス…\n私は負けないぞ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (394, 3, 3, 1, 0, 100902, 1, 0, "くっくっくっ…\n貴様は特別団員に\nしてやろう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (395, 4, 3, 1, 0, 100902, 1, 0, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (396, 5, 3, 1, 0, 100902, 1, 0, "これが我らの求めた\n安寧か…\n悪くない…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (397, 6, 3, 1, 0, 100902, 1, 0, "新たな戦いに備えて\n魔力だけでなく\n体力も鍛えねば！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (398, 7, 3, 1, 0, 100902, 1, 0, "食事は魔力に\n変換する体力の\n元になるのだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (399, 8, 3, 1, 0, 100902, 1, 0, "フフフ…\nこれを覚えれば\nもっと強く…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (401, 1, 1, 1, 0, 101001, 1, 0, "王子はんほんまに\nはんなりしてて、\n王子はんって感じやわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (402, 2, 1, 1, 0, 101001, 1, 0, "この絵本の王子はん、\n王子はんみたいで\nええなぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (403, 3, 1, 1, 0, 101001, 1, 0, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (404, 4, 1, 1, 0, 101001, 1, 0, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (405, 5, 1, 1, 0, 101001, 1, 0, "王子はんのために\n糸を紡いで、\n編み物でもしまひょか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (406, 101, 1, 4, 0, 101001, 1, 0, "マホ姫と王子はん、\n絵本の世界より\nベストカップルや");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (407, 102, 1, 8, 0, 101001, 1, 0, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (408, 1, 2, 1, 0, 101001, 1, 0, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (409, 2, 2, 1, 0, 101001, 1, 0, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (410, 3, 2, 1, 0, 101001, 1, 0, "王子はんは、\n絵本から出てきた人\nみたいやね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (411, 4, 2, 1, 0, 101001, 1, 0, "うちの話し方\nのんびりしてます\nやろか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (412, 101, 2, 4, 0, 101001, 1, 0, "マホ姫の手は\nつべたいから、\n王子はんが温めて？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (413, 102, 2, 8, 0, 101001, 1, 0, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (414, 1, 2, 1, 0, 101001, 1, 1, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (415, 2, 2, 1, 0, 101001, 1, 2, "お茶請けはお大福が\nよろしおすけど\nクッキーもええなあ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (416, 3, 2, 1, 0, 101001, 1, 3, "うち、普段から\n夢見がちやけど…\nほんに眠い時間やわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (417, 1, 3, 1, 0, 101001, 1, 0, "王子はんに\n会いに行くなら、\nおめかしせな\nあかんなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (418, 2, 3, 1, 0, 101001, 1, 0, "はんなりした\nええお椅子やわぁ\nほっこりしますなあ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (419, 3, 3, 1, 0, 101001, 1, 0, "かいらしもんが\nいっぱいで、\nマホマホ王国みたい\nやわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (420, 4, 3, 1, 0, 101001, 1, 0, "心地ええどす。まるで\nお花畑にいるようやね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (421, 5, 3, 1, 0, 101001, 1, 0, "ぽかぽかどす。\n心まであったかく\nなりますわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (422, 6, 3, 1, 0, 101001, 1, 0, "はぁはぁ、お姫はんは\n激しい運動は\nしぃひんもんどす～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (423, 7, 3, 1, 0, 101001, 1, 0, "もぐもぐ…あんまり\n速う食べられへんけど\n美味しいわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (424, 8, 3, 1, 0, 101001, 1, 0, "絵本、絵本～\n幸せやわぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (426, 1, 1, 1, 0, 101002, 1, 0, "王子はんにとって\n自慢の姫になるえ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (427, 2, 1, 1, 0, 101002, 1, 0, "カボチャの馬車に\nガラスの靴…\n欲しいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (428, 3, 1, 1, 0, 101002, 1, 0, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (429, 4, 1, 1, 0, 101002, 1, 0, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (430, 5, 1, 1, 0, 101002, 1, 0, "ほんまなぁ\nこの絵本が面白いんよ\n王子はんに\n読んであげよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (431, 101, 1, 8, 0, 101002, 1, 0, "マホ姫と王子はん\n絵本の世界より\nベストカップルや");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (432, 102, 1, 8, 0, 101002, 1, 0, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (433, 1, 2, 1, 0, 101002, 1, 0, "たまには、王子はんの\n好きな絵本も\n知りたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (434, 2, 2, 1, 0, 101002, 1, 0, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (435, 3, 2, 1, 0, 101002, 1, 0, "そのうち、王子はんの\nお国にも連れてって\nもらえますやろか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (436, 4, 2, 1, 0, 101002, 1, 0, "絵本読むんも\nええなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (437, 101, 2, 8, 0, 101002, 1, 0, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (438, 102, 2, 8, 0, 101002, 1, 0, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (439, 1, 2, 1, 0, 101002, 1, 1, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (440, 2, 2, 1, 0, 101002, 1, 2, "マホマホ王国では\nこの時分は\nみんなお昼寝\nしてたんよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (441, 3, 2, 1, 0, 101002, 1, 3, "夜に飛んだり鳴いたり\nする鳥はんもおるんよ\n昼は寝てはるんかねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (442, 1, 3, 1, 0, 101002, 1, 0, "王子はんに\n会いに行くなら\nおめかしせな\nあかんなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (443, 2, 3, 1, 0, 101002, 1, 0, "王子はんも一緒に\nゆっくりしていっても\nええんよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (444, 3, 3, 1, 0, 101002, 1, 0, "かいらしい子やねぇ\nうちとお友だちに\nなってくれるん？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (445, 4, 3, 1, 0, 101002, 1, 0, "癒しアイテムって\nほんま、好っきゃわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (446, 5, 3, 1, 0, 101002, 1, 0, "うちのお城にも\nほしいわぁ。帰ったら\nさっそく準備せな\nあかんなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (447, 6, 3, 1, 0, 101002, 1, 0, "部屋の中で運動\nできるのも、なかなか\n面白いもんやわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (448, 7, 3, 1, 0, 101002, 1, 0, "おいひいわ～\nマホマホ王国には\nない味やわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (449, 8, 3, 1, 0, 101002, 1, 0, "しっかり知識を\n身につけんと\n魔法も使えへん\nからなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (451, 1, 1, 1, 0, 101101, 1, 0, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (452, 2, 1, 1, 0, 101101, 1, 0, "おやつのケーキは\n苺かチョコ…\nどっちも食べよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (453, 3, 1, 1, 0, 101101, 1, 0, "い、いけない！\n縫い針落としちゃった");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (454, 4, 1, 1, 0, 101101, 1, 0, "ケーキをクレープで\n巻いたら…\n大ヒット商品の予感！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (455, 5, 1, 1, 0, 101101, 1, 0, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (456, 101, 1, 4, 0, 101101, 1, 0, "お兄ちゃんに、\nお洋服でも\n作ろうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (457, 102, 1, 8, 0, 101101, 1, 0, "ここがお兄ちゃんの\n部屋…\nドキドキしちゃう～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (458, 1, 2, 1, 0, 101101, 1, 0, "ねぇ、おにいちゃん\n一緒に、スイーツでも\n食べにいかない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (459, 2, 2, 1, 0, 101101, 1, 0, "クリームついてた！？\nさっき食べた、\nケーキかも…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (460, 3, 2, 1, 0, 101101, 1, 0, "勉強、見てくれるん\nですか？　やった～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (461, 4, 2, 1, 0, 101101, 1, 0, "服がほつれてますよ？\n直してあげます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (462, 101, 2, 4, 0, 101101, 1, 0, "私をお嫁さんに\nしたいなら、予約は\nお早目に、ですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (463, 102, 2, 8, 0, 101101, 1, 0, "ねぇねぇお兄ちゃん！\n…えへへ、\n呼んでみただけ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (464, 1, 2, 1, 0, 101101, 1, 1, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (465, 2, 2, 1, 0, 101101, 1, 2, "お昼休憩に\n甘いものが\n食べたいです～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (466, 3, 2, 1, 0, 101101, 1, 3, "ねむいです～\nでももうちょっと\n勉強しないと～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (467, 1, 3, 1, 0, 101101, 1, 0, "この服、かわいい♪\n今度作って\nみよっと～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (468, 2, 3, 1, 0, 101101, 1, 0, "勉強で疲れたから\n休憩しよ～っと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (469, 3, 3, 1, 0, 101101, 1, 0, "かわいい♪\n私が服を作って\nあげよっか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (470, 4, 3, 1, 0, 101101, 1, 0, "リラックスできます～\nお兄ちゃんが隣に\nいるみたい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (471, 5, 3, 1, 0, 101101, 1, 0, "のんびりしたら、\nまた勉強しよっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (472, 6, 3, 1, 0, 101101, 1, 0, "運動すると勉強も\nはかどるよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (473, 7, 3, 1, 0, 101101, 1, 0, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (474, 8, 3, 1, 0, 101101, 1, 0, "お兄ちゃんの記憶を\n戻す方法、どこかに\n書いてないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (476, 1, 1, 1, 0, 101102, 1, 0, "ケーキの食べ過ぎで\nお腹が…うぅ、\n因果横暴だよー…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (477, 2, 1, 1, 0, 101102, 1, 0, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (478, 3, 1, 1, 0, 101102, 1, 0, "い、いけない！\n縫い針落としちゃった");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (479, 4, 1, 1, 0, 101102, 1, 0, "笑う時には服着ます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (480, 5, 1, 1, 0, 101102, 1, 0, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (481, 101, 1, 8, 0, 101102, 1, 0, "お兄ちゃんに、\nお洋服でも\n作ろうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (482, 102, 1, 8, 0, 101102, 1, 0, "お兄ちゃんが帰って\nきたら、何して遊ぼう\nかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (483, 1, 2, 1, 0, 101102, 1, 0, "勉強、見てくれるん\nですか？　やった～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (484, 2, 2, 1, 0, 101102, 1, 0, "クリームついてた！？\nさっき食べた、\nケーキかも…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (485, 3, 2, 1, 0, 101102, 1, 0, "おにいちゃん！\nそろそろ、おやつに\nしませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (486, 4, 2, 1, 0, 101102, 1, 0, "勉強は…\n明日にしようっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (487, 101, 2, 8, 0, 101102, 1, 0, "妹だけど、大人な\nレディですからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (488, 102, 2, 8, 0, 101102, 1, 0, "な、ナデナデとか\n恥ずかしいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (489, 1, 2, 1, 0, 101102, 1, 1, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (490, 2, 2, 1, 0, 101102, 1, 2, "お昼休憩に\n甘いものが\n食べたいです～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (491, 3, 2, 1, 0, 101102, 1, 3, "お兄ちゃんは\n夜強いんですね\n私は眠くて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (492, 1, 3, 1, 0, 101102, 1, 0, "服装や髪形が変わると\n気分も変わるよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (493, 2, 3, 1, 0, 101102, 1, 0, "ここで寝ちゃったら\n受験勉強が～…\nぐーー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (494, 3, 3, 1, 0, 101102, 1, 0, "かわいい♪\n私が服を作って\nあげよっか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (495, 4, 3, 1, 0, 101102, 1, 0, "いまならどんな試験も\n合格できそうです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (496, 5, 3, 1, 0, 101102, 1, 0, "のんびりしたら\nまた勉強しよっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (497, 6, 3, 1, 0, 101102, 1, 0, "お兄ちゃんを\n守るためには\n毎日、鍛えなくちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (498, 7, 3, 1, 0, 101102, 1, 0, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (499, 8, 3, 1, 0, 101102, 1, 0, "この本の服\nかわいいなぁ♪\n私に作れるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (501, 1, 1, 1, 0, 101201, 1, 0, "う～ん、今なら\nどこでだって\n眠れちゃいそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (502, 2, 1, 1, 0, 101201, 1, 0, "たくさん寝すぎて、\n夢の中か現実か\nわかんなく\nなっちゃうんだよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (503, 3, 1, 1, 0, 101201, 1, 0, "…はっ！？\nね、寝てないよ？\nホントだよっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (504, 4, 1, 1, 0, 101201, 1, 0, "ぐっすり眠って\nパワーを\nフルチャージっ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (505, 5, 1, 1, 0, 101201, 1, 0, "もし、超能力のことが\nバレたら…ブルブル");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (506, 101, 1, 4, 0, 101201, 1, 0, "テレパシーで\nキミの心を覗けたら\n…なんてね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (507, 102, 1, 8, 0, 101201, 1, 0, "キミを抱き枕に…\nじょ、冗談冗談！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (508, 1, 2, 1, 0, 101201, 1, 0, "ん～、なになに？\n一緒にお昼寝する？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (509, 2, 2, 1, 0, 101201, 1, 0, "忘れ物しちゃった。\nま、いっか！\nえ、ダメ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (510, 3, 2, 1, 0, 101201, 1, 0, "おおっ、相談ごと？\nなにかな\nなにかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (511, 4, 2, 1, 0, 101201, 1, 0, "う～ん、もしかして\nキミにも仲良しになる\n超能力があるのかも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (512, 101, 2, 4, 0, 101201, 1, 0, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (513, 102, 2, 8, 0, 101201, 1, 0, "えっ？　私とキミとの\n相性？　むむ～…\nうん、バッチリだよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (514, 1, 2, 1, 0, 101201, 1, 1, "まだこんな時間？\nベッドに行って、\n二度寝しなくちゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (515, 2, 2, 1, 0, 101201, 1, 2, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (516, 3, 2, 1, 0, 101201, 1, 3, "どんなにお昼寝しても\n夜は眠いんだ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (517, 1, 3, 1, 0, 101201, 1, 0, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (518, 2, 3, 1, 0, 101201, 1, 0, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (519, 3, 3, 1, 0, 101201, 1, 0, "これ…可愛い！\nシオリンに\n届けてあげたい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (520, 4, 3, 1, 0, 101201, 1, 0, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (521, 5, 3, 1, 0, 101201, 1, 0, "気持ちいい…\nはっ！　ダメダメ！\nまた寝るとこだった！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (522, 6, 3, 1, 0, 101201, 1, 0, "眠くならないように、\n運動しよっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (523, 7, 3, 1, 0, 101201, 1, 0, "お腹いっぱいになると\n眠くなるよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (524, 8, 3, 1, 0, 101201, 1, 0, "睡眠学習って\n本を読みながら\n寝るんだっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (526, 1, 1, 1, 0, 101202, 1, 0, "う～ん、今なら\nどこでだって\n眠れちゃいそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (527, 2, 1, 1, 0, 101202, 1, 0, "もっといっぱい\n超能力使えたら\nいいのにな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (528, 3, 1, 1, 0, 101202, 1, 0, "ねえねえ、\n今から人助け、\n付き合ってほしいなー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (529, 4, 1, 1, 0, 101202, 1, 0, "ぐっすり眠って\nパワーを\nフルチャージっ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (530, 5, 1, 1, 0, 101202, 1, 0, "人助け、頑張ったら\nなんだか、眠く…\n…はっ、ダメダメ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (531, 101, 1, 8, 0, 101202, 1, 0, "キミと一緒なら、\nなんだって出来る！\n間違いない！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (532, 102, 1, 8, 0, 101202, 1, 0, "キミを抱き枕に…\nじょ、冗談冗談！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (533, 1, 2, 1, 0, 101202, 1, 0, "忘れ物しちゃった\nま、いっか！\nえ、ダメ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (534, 2, 2, 1, 0, 101202, 1, 0, "なに？　困ってる？\nちょうど良かった！\n今は体力満タンだよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (535, 3, 2, 1, 0, 101202, 1, 0, "一緒に\nお出かけしたいなー\nデートしよっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (536, 4, 2, 1, 0, 101202, 1, 0, "うんうん、そうだねっ\n困ってる人がいたら\n見過ごせないよねっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (537, 101, 2, 8, 0, 101202, 1, 0, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (538, 102, 2, 8, 0, 101202, 1, 0, "う～だんだん眠く…\nねぇ一緒に寝よ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (539, 1, 2, 1, 0, 101202, 1, 1, "キミって早起きだね！\n私は寝ようかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (540, 2, 2, 1, 0, 101202, 1, 2, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (541, 3, 2, 1, 0, 101202, 1, 3, "どんなにお昼寝しても\n夜は眠いんだ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (542, 1, 3, 1, 0, 101202, 1, 0, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (543, 2, 3, 1, 0, 101202, 1, 0, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (544, 3, 3, 1, 0, 101202, 1, 0, "これ…可愛い！\nシオリンに\n届けてあげたい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (545, 4, 3, 1, 0, 101202, 1, 0, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (546, 5, 3, 1, 0, 101202, 1, 0, "うう～ん、なんだか\nいつもより眠ーく\nなってきたよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (547, 6, 3, 1, 0, 101202, 1, 0, "よーし\n困ってる人のために\nパワーアップ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (548, 7, 3, 1, 0, 101202, 1, 0, "食べてすぐ寝ると\n牛になるんだっけ？\nまぁ、いいかぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (549, 8, 3, 1, 0, 101202, 1, 0, "睡眠学習って\n本を読みながら\n寝るんだっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (551, 1, 1, 1, 0, 101601, 1, 0, "モデルは楽しいよ！\nファンの子みんな\n応援してくれるしー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (552, 2, 1, 1, 0, 101601, 1, 0, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (553, 3, 1, 1, 0, 101601, 1, 0, "んー、今日のおやつは\n何にしよう？\nやっぱアメ玉かな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (554, 4, 1, 1, 0, 101601, 1, 0, "ここで撮影会、\nしようかな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (555, 5, 1, 1, 0, 101601, 1, 0, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (556, 101, 1, 4, 0, 101601, 1, 0, "やば…\nこのままじゃ、うち\nキュン死にかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (557, 102, 1, 8, 0, 101601, 1, 0, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (558, 1, 2, 1, 0, 101601, 1, 0, "うちの写真撮るの？\nどんなポーズ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (559, 2, 2, 1, 0, 101601, 1, 0, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイにしてあげる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (560, 3, 2, 1, 0, 101601, 1, 0, "宿題見てくんない？\nひとりじゃムリ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (561, 4, 2, 1, 0, 101601, 1, 0, "みてこのネイル♪\n超エモくな～い？\nヒデサイもする～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (562, 101, 2, 4, 0, 101601, 1, 0, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (563, 102, 2, 8, 0, 101601, 1, 0, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (564, 1, 2, 1, 0, 101601, 1, 1, "早起きとか\nつらたんだよねー\n昼すぎまで寝てたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (565, 2, 2, 1, 0, 101601, 1, 2, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (566, 3, 2, 1, 0, 101601, 1, 3, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (567, 1, 3, 1, 0, 101601, 1, 0, "どんなシーンにも合う\nきれいめわがまま\nちゃんとコーデだよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (568, 2, 3, 1, 0, 101601, 1, 0, "ちょっち疲れたかも？\nガン寝しちゃおっかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (569, 3, 3, 1, 0, 101601, 1, 0, "きゃわたーん☆\n君もおしゃれしよっか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (570, 4, 3, 1, 0, 101601, 1, 0, "いいにおいじゃん！\nこれと同じにおいの\n香水ないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (571, 5, 3, 1, 0, 101601, 1, 0, "あったまるー\nこれ、サイツヨに\n癒しじゃない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (572, 6, 3, 1, 0, 101601, 1, 0, "あはは、なんか\nウォーキングの練習\nしてるみたーい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (573, 7, 3, 1, 0, 101601, 1, 0, "体形維持しないと\nいけないけど\nついつい食べちゃう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (574, 8, 3, 1, 0, 101601, 1, 0, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (576, 1, 1, 1, 0, 101602, 1, 0, "そろそろ\n仕事の時間だ～\n出かける準備\nしよっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (577, 2, 1, 1, 0, 101602, 1, 0, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (578, 3, 1, 1, 0, 101602, 1, 0, "ヒデサイを見習って\nうちも少し勉強して\nみよっかな…　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (579, 4, 1, 1, 0, 101602, 1, 0, "体形維持とか\n気にしてるんだよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (580, 5, 1, 1, 0, 101602, 1, 0, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (581, 101, 1, 8, 0, 101602, 1, 0, "やば…\nこのままじゃ、うち\nキュン死にかも…　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (582, 102, 1, 8, 0, 101602, 1, 0, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (583, 1, 2, 1, 0, 101602, 1, 0, "うちの写真撮るの？\nどんなポーズ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (584, 2, 2, 1, 0, 101602, 1, 0, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイに\nしてあげる♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (585, 3, 2, 1, 0, 101602, 1, 0, "この雑誌の服\nガチめにほしぃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (586, 4, 2, 1, 0, 101602, 1, 0, "うちのコーデで\nヒデサイをオシャンに\nしてあげるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (587, 101, 2, 8, 0, 101602, 1, 0, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (588, 102, 2, 8, 0, 101602, 1, 0, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (589, 1, 2, 1, 0, 101602, 1, 1, "今日は早起き\nできたんだー\nメイクもばっち\nきまってるっしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (590, 2, 2, 1, 0, 101602, 1, 2, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (591, 3, 2, 1, 0, 101602, 1, 3, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (592, 1, 3, 1, 0, 101602, 1, 0, "この服ね～\n今年のトレンドなんだ♪\nかわたんでしょ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (593, 2, 3, 1, 0, 101602, 1, 0, "ちょっち疲れたかも？\nガン寝しちゃおっかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (594, 3, 3, 1, 0, 101602, 1, 0, "うわー\nこのぬいぐるみ\nもきゅすぎでしょ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (595, 4, 3, 1, 0, 101602, 1, 0, "いいにおーい♪\nファンのみんなにも\n教えてあげよー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (596, 5, 3, 1, 0, 101602, 1, 0, "あったまるー\nこれ、サイツヨに\n癒しじゃない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (597, 6, 3, 1, 0, 101602, 1, 0, "食べた分は\n消費しないとね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (598, 7, 3, 1, 0, 101602, 1, 0, "体形維持しないと\nいけないけど\nついつい食べちゃう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (599, 8, 3, 1, 0, 101602, 1, 0, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (601, 1, 1, 1, 0, 101701, 1, 0, "やっさー\n踊ってると、どんどん\n楽しくなるさー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (602, 2, 1, 1, 0, 101701, 1, 0, "このお菓子、でーじ\nおいしいねー！\nキミも食べる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (603, 3, 1, 1, 0, 101701, 1, 0, "ハイターイ！　元気な\nあいさつが一番さ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (604, 4, 1, 1, 0, 101701, 1, 0, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (605, 5, 1, 1, 0, 101701, 1, 0, "さぁ、みんなで歌って\n踊るさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (606, 101, 1, 4, 0, 101701, 1, 0, "毎日、最高に幸せさ～\nキミのおかげだねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (607, 102, 1, 8, 0, 101701, 1, 0, "キミへの気持ちを\n踊りで表現\nしてみるさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (608, 1, 2, 1, 0, 101701, 1, 0, "海でひと泳ぎ\nしたいさ～\nキミもどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (609, 2, 2, 1, 0, 101701, 1, 0, "あぎひゃっ！\n急に声かけたら、\nビックリするさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (610, 3, 2, 1, 0, 101701, 1, 0, "踊りなら、\n私が手とり足とり\n教えてあげるさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (611, 4, 2, 1, 0, 101701, 1, 0, "空手の型の\n練習するさー\nキミもどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (612, 101, 2, 4, 0, 101701, 1, 0, "よ～し、手をつないで\n踊るさ～！\n恥ずかしがること\nないさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (613, 102, 2, 8, 0, 101701, 1, 0, "キミと一緒だから、\n毎日楽しいこと\nばっかりさー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (614, 1, 2, 1, 0, 101701, 1, 1, "ハイターイ！\n今日も一日、\nがんばるさー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (615, 2, 2, 1, 0, 101701, 1, 2, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (616, 3, 2, 1, 0, 101701, 1, 3, "故郷では見えない星が\n見られるんだねえ。\nなんか不思議さぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (617, 1, 3, 1, 0, 101701, 1, 0, "夢中で踊ってたら、\n髪の毛ぼさぼさに\nなってるさ～！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (618, 2, 3, 1, 0, 101701, 1, 0, "よく食べてよく踊って\nよく休む。\nそれが元気の秘訣さ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (619, 3, 3, 1, 0, 101701, 1, 0, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (620, 4, 3, 1, 0, 101701, 1, 0, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (621, 5, 3, 1, 0, 101701, 1, 0, "故郷はあんまり暖房を\n使わなかったから、\n新鮮さー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (622, 6, 3, 1, 0, 101701, 1, 0, "汗をかくのは\n気持ちいいさー！\nどんどん行くよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (623, 7, 3, 1, 0, 101701, 1, 0, "うーん、おいしいさ～\nゴーヤっぽいものを\n混ぜたいさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (624, 8, 3, 1, 0, 101701, 1, 0, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (626, 1, 1, 1, 0, 101702, 1, 0, "焦らなくても\nなんくるないさ～\nなるようになるさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (627, 2, 1, 1, 0, 101702, 1, 0, "さぁ、みんなで歌って\n踊るさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (628, 3, 1, 1, 0, 101702, 1, 0, "元気がないときは\n私のところに来るさー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (629, 4, 1, 1, 0, 101702, 1, 0, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (630, 5, 1, 1, 0, 101702, 1, 0, "ノリノリな音楽と\n踊りで、疲れを\n吹き飛ばすさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (631, 101, 1, 8, 0, 101702, 1, 0, "毎日、最高に幸せさ～\nキミのおかげだねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (632, 102, 1, 8, 0, 101702, 1, 0, "幸せすぎて踊らずには\nいられないさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (633, 1, 2, 1, 0, 101702, 1, 0, "海でひと泳ぎ\nしたいさ～\nキミもどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (634, 2, 2, 1, 0, 101702, 1, 0, "ん？　どうしたの～？\nヒマなら一緒に\n踊ろうさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (635, 3, 2, 1, 0, 101702, 1, 0, "キミと一緒だから\n毎日楽しいこと\nばっかりさー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (636, 4, 2, 1, 0, 101702, 1, 0, "ハイターイ！　元気な\nあいさつが一番さ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (637, 101, 2, 8, 0, 101702, 1, 0, "キミと踊ってる時が\n一番幸せさ～\nキミもそう思ってたら\nうれしいさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (638, 102, 2, 8, 0, 101702, 1, 0, "海に沈む夕日は\nとっても綺麗さ～！\n今度一緒に見ようね～ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (639, 1, 2, 1, 0, 101702, 1, 1, "気持ちのいい朝さー！\nひとっ走り\nしてくるさー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (640, 2, 2, 1, 0, 101702, 1, 2, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (641, 3, 2, 1, 0, 101702, 1, 3, "故郷では見えない星が\n見られるんだねえ\nなんか不思議さぁ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (642, 1, 3, 1, 0, 101702, 1, 0, "夢中で踊ってたら\n髪の毛ぼさぼさに\nなってるさ～！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (643, 2, 3, 1, 0, 101702, 1, 0, "よく食べてよく踊って\nよく休む\nそれが元気の秘訣さ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (644, 3, 3, 1, 0, 101702, 1, 0, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (645, 4, 3, 1, 0, 101702, 1, 0, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (646, 5, 3, 1, 0, 101702, 1, 0, "故郷はあんまり暖房を\n使わなかったから\n新鮮さー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (647, 6, 3, 1, 0, 101702, 1, 0, "徹夜で踊り続ける\nためにも、まずは\n体を鍛えるさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (648, 7, 3, 1, 0, 101702, 1, 0, "もぐもぐ…もっと\nおかわりがほしいさー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (649, 8, 3, 1, 0, 101702, 1, 0, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！ ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (651, 1, 1, 1, 0, 101801, 1, 0, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (652, 2, 1, 1, 0, 101801, 1, 0, "このお部屋\n女の子ばかりね。\n魔族の女子校を\n思い出しちゃう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (653, 3, 1, 1, 0, 101801, 1, 0, "次のテスト\n恋愛小説から\n出題したら\nダメかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (654, 4, 1, 1, 0, 101801, 1, 0, "キンコンカンコ～ン♪\n授業をはじめま～す");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (655, 5, 1, 1, 0, 101801, 1, 0, "はー…\nちょっと肩が\nこっちゃった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (656, 101, 1, 4, 0, 101801, 1, 0, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (657, 102, 1, 8, 0, 101801, 1, 0, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (658, 1, 2, 1, 0, 101801, 1, 0, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (659, 2, 2, 1, 0, 101801, 1, 0, "勉強勉強で\n疲れたよね？\n膝枕してあげる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (660, 3, 2, 1, 0, 101801, 1, 0, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (661, 4, 2, 1, 0, 101801, 1, 0, "学院の外でも\n私は君の先生よ\nなんでも聞いてね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (662, 101, 2, 4, 0, 101801, 1, 0, "今読んでるのは\nヒロインが年下の子と\n恋に落ちる話…あ、\n深い意味はないのよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (663, 102, 2, 8, 0, 101801, 1, 0, "生徒は全員可愛いけど\n君は少し特別…\nみんなには内緒よ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (664, 1, 2, 1, 0, 101801, 1, 1, "学校に\n遅刻しないように\n早く準備しないとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (665, 2, 2, 1, 0, 101801, 1, 2, "男の子といっしょに\nお弁当を食べるの、\n夢なんだ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (666, 3, 2, 1, 0, 101801, 1, 3, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (667, 1, 3, 1, 0, 101801, 1, 0, "もしかして…\n少し露出多いかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (668, 2, 3, 1, 0, 101801, 1, 0, "リラックスすると\nα波が出て、勉強が\nはかどるんですって");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (669, 3, 3, 1, 0, 101801, 1, 0, "かわいい♪　あなたも\n私の生徒になる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (670, 4, 3, 1, 0, 101801, 1, 0, "学院にもこういう\n安らぐ設備が\n必要かしらね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (671, 5, 3, 1, 0, 101801, 1, 0, "まだ寒いわぁ\n誰か隣に\n来てくれたら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (672, 6, 3, 1, 0, 101801, 1, 0, "運動部の顧問も\nできるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (673, 7, 3, 1, 0, 101801, 1, 0, "学校の給食でも\n食べたいわぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (674, 8, 3, 1, 0, 101801, 1, 0, "いい参考書を\n見つけちゃった♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (676, 1, 1, 1, 0, 101802, 1, 0, "私の生徒に\n不良なんていないわ\nみーんないい子♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (677, 2, 1, 1, 0, 101802, 1, 0, "このお部屋\n女の子ばかりね\n魔族の女子校を\n思い出しちゃう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (678, 3, 1, 1, 0, 101802, 1, 0, "あの子、まだかな…\n宿題も見てあげたいし\n早く来ないかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (679, 4, 1, 1, 0, 101802, 1, 0, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (680, 5, 1, 1, 0, 101802, 1, 0, "学校の図書室に\n恋愛小説を\n置いて欲しいなあ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (681, 101, 1, 8, 0, 101802, 1, 0, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (682, 102, 1, 8, 0, 101802, 1, 0, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (683, 1, 2, 1, 0, 101802, 1, 0, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (684, 2, 2, 1, 0, 101802, 1, 0, "勉強勉強で\n疲れたよね？\n膝枕してあげる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (685, 3, 2, 1, 0, 101802, 1, 0, "宿題はもうやった？\n苦手なところは\n先生が見てあげる♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (686, 4, 2, 1, 0, 101802, 1, 0, "んん？　なんだか\n元気がないみたい\n先生がぎゅぅ～って\nしてあげる…　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (687, 101, 2, 8, 0, 101802, 1, 0, "君のお勉強も\nだいぶ進んできたね～\n補習卒業も近いかな？\n少し寂しいけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (688, 102, 2, 8, 0, 101802, 1, 0, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (689, 1, 2, 1, 0, 101802, 1, 1, "朝の特別授業\nしてあげましょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (690, 2, 2, 1, 0, 101802, 1, 2, "午後の授業って\n眠いでしょう？\n気持ちは分かるけど\nがんばってね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (691, 3, 2, 1, 0, 101802, 1, 3, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (692, 1, 3, 1, 0, 101802, 1, 0, "もしかして…\n少し露出多いかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (693, 2, 3, 1, 0, 101802, 1, 0, "私の膝枕と、どっちが\nフカフカかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (694, 3, 3, 1, 0, 101802, 1, 0, "可愛いわね～\n教室に置いたら\n生徒が喜ぶかしら？　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (695, 4, 3, 1, 0, 101802, 1, 0, "は～落ち着くなぁ～\n教師には\nこういうゆとりも\n必要よね♪　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (696, 5, 3, 1, 0, 101802, 1, 0, "まだ寒いわぁ\n誰か隣に\n来てくれたら…　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (697, 6, 3, 1, 0, 101802, 1, 0, "運動部の顧問も\nできるかしら？　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (698, 7, 3, 1, 0, 101802, 1, 0, "あん！\nお胸にこぼしちゃった");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (699, 8, 3, 1, 0, 101802, 1, 0, "あぁーん♪\nこういう物語みたいな\n恋愛あこがれる～　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (701, 1, 1, 1, 0, 102001, 1, 0, "おにいちゃんは、\nにんじん食べられる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (702, 2, 1, 1, 0, 102001, 1, 0, "えへへ、\nお絵かきしよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (703, 3, 1, 1, 0, 102001, 1, 0, "あのね、ミミと\nあそんでほしいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (704, 4, 1, 1, 0, 102001, 1, 0, "さっきね、きれいな\nお花見つけたよ。\nおにいちゃんにも\n見せてあげたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (705, 5, 1, 1, 0, 102001, 1, 0, "うさぎさん、\nぴょんぴょん\nぴょーん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (706, 101, 1, 4, 0, 102001, 1, 0, "おにいちゃんの絵、\nかいてあげるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (707, 102, 1, 8, 0, 102001, 1, 0, "おっきくなったら\nおにいちゃんの\nお嫁さんになるんだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (708, 1, 2, 1, 0, 102001, 1, 0, "ふわぁ！\nおにいちゃんの手、\nおっきいね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (709, 2, 2, 1, 0, 102001, 1, 0, "やった～！\nおにいちゃんが\nほめてくれた～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (710, 3, 2, 1, 0, 102001, 1, 0, "ねえねえ\nおにいちゃん、\n一緒にあそぼっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (711, 4, 2, 1, 0, 102001, 1, 0, "おにいちゃん、\n遊んでくれるの？\n　わぁい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (712, 101, 2, 4, 0, 102001, 1, 0, "わぁい！\nおにいちゃんだ～♪\nぎゅ～っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (713, 102, 2, 8, 0, 102001, 1, 0, "あのねあのね、\nミミの頭ポンポンって\nしてほしいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (714, 1, 2, 1, 0, 102001, 1, 1, "おひさまさん、\nおはよ～！\n毎朝、早おきだね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (715, 2, 2, 1, 0, 102001, 1, 2, "うわぁ！\nお日さまがすごーく\n高いところにある～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (716, 3, 2, 1, 0, 102001, 1, 3, "おにいちゃん\nおやすみのご本\nよんで～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (717, 1, 3, 1, 0, 102001, 1, 0, "ミミも、\nうさぎさんみたいに、\nかわいくなりたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (718, 2, 3, 1, 0, 102001, 1, 0, "のんびり～♪\nゆったり～♪\nまったり～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (719, 3, 3, 1, 0, 102001, 1, 0, "わぁ～かわいい～♪\nミミ、幸せ～♪\n抱きついていいかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (720, 4, 3, 1, 0, 102001, 1, 0, "いいにおい～♪\nお鼻ピクピク♪\nうさぎさんも喜ぶよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (721, 5, 3, 1, 0, 102001, 1, 0, "あったか～♪\nぬくぬく～♪\nポカポカ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (722, 6, 3, 1, 0, 102001, 1, 0, "ふ、ふぇ～　ミミ、\n運動苦手だよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (723, 7, 3, 1, 0, 102001, 1, 0, "はむ♪　いっぱい\n食べて、はやく\nおっきくなりたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (724, 8, 3, 1, 0, 102001, 1, 0, "ミミね！\nこのお話だーい好き！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (726, 1, 1, 1, 0, 102002, 1, 0, "ぴょんぴょん\n跳ねるよ\nうっさぎっさ～ん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (727, 2, 1, 1, 0, 102002, 1, 0, "うさぎさんの\nマネだよ～\n似てるかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (728, 3, 1, 1, 0, 102002, 1, 0, "モフモフすると\nきもちい～よ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (729, 4, 1, 1, 0, 102002, 1, 0, "ミソギちゃん\nキョウカちゃん\nあ～そ～ぼっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (730, 5, 1, 1, 0, 102002, 1, 0, "おにいちゃん\nおやすみのご本\nよんで～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (731, 101, 1, 8, 0, 102002, 1, 0, "ねえ、おにいちゃん\nミミのこと、すき？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (732, 102, 1, 8, 0, 102002, 1, 0, "おっきくなったら\nおにいちゃんの\nお嫁さんになるんだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (733, 1, 2, 1, 0, 102002, 1, 0, "やった～！\nおにいちゃんが\nほめてくれた～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (734, 2, 2, 1, 0, 102002, 1, 0, "おにいちゃん\n遊んでくれるの？\nわぁい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (735, 3, 2, 1, 0, 102002, 1, 0, "おにいちゃん\nあのね…\nいいこいいこして～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (736, 4, 2, 1, 0, 102002, 1, 0, "あはは～\nくすぐったいよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (737, 101, 2, 8, 0, 102002, 1, 0, "おにいちゃんの\nおひざの上、とっても\n安心するんだ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (738, 102, 2, 8, 0, 102002, 1, 0, "わぁい♪\nおにいちゃんの\nなでなで\nうれし～な♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (739, 1, 2, 1, 0, 102002, 1, 1, "おひさまさん\nおはよ～！\n毎朝、早おきだね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (740, 2, 2, 1, 0, 102002, 1, 2, "お昼寝お昼寝～♪\nおにいちゃんと一緒に\nお昼寝～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (741, 3, 2, 1, 0, 102002, 1, 3, "眠くなっちゃった～\nおにいちゃん！\n今日は一緒に寝よ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (742, 1, 3, 1, 0, 102002, 1, 0, "ミミも\nうさぎさんみたいに\nかわいくなりたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (743, 2, 3, 1, 0, 102002, 1, 0, "ふわふわ～モコモコ～\n気持ちいい～♪\nミミもゴロゴロ～ン♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (744, 3, 3, 1, 0, 102002, 1, 0, "わぁ～かわいい～♪\nミミ、幸せ～♪\n抱きついていいかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (745, 4, 3, 1, 0, 102002, 1, 0, "いいにおい～♪\nお鼻ピクピク♪\nうさぎさんも喜ぶよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (746, 5, 3, 1, 0, 102002, 1, 0, "あったか～♪\nぬくぬく～♪\nポカポカ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (747, 6, 3, 1, 0, 102002, 1, 0, "はぁはぁ…\nふえ～ミミ\n疲れちゃうよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (748, 7, 3, 1, 0, 102002, 1, 0, "はむ♪　いっぱい\n食べて、はやく\nおっきくなりたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (749, 8, 3, 1, 0, 102002, 1, 0, "ミミね！\nこのお話だーい好き！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (751, 1, 1, 1, 0, 102101, 1, 0, "はぅぅ…\n部屋のどこにいたら\nいいんだろう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (752, 2, 1, 1, 0, 102101, 1, 0, "お外より\nお部屋の中の方が\n落ち着くな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (753, 3, 1, 1, 0, 102101, 1, 0, "クッキー焼いたら\nみんな食べてくれる\nかなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (754, 4, 1, 1, 0, 102101, 1, 0, "あ、あめんぼあかいな\nあいうえお！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (755, 5, 1, 1, 0, 102101, 1, 0, "お芝居には\n人間観察が大事…\nじーーーーーー…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (756, 101, 1, 4, 0, 102101, 1, 0, "お兄ちゃんを見ると、\n顔が赤くなっちゃうの\n…な、なんでかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (757, 102, 1, 8, 0, 102101, 1, 0, "れ、恋愛劇…\nお、お兄ちゃんと\n練習…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (758, 1, 2, 1, 0, 102101, 1, 0, "こ、この本、とっても\nおもしろいんですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (759, 2, 2, 1, 0, 102101, 1, 0, "い、一緒に遊んで\nくれるんですか？\nや、やったぁ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (760, 3, 2, 1, 0, 102101, 1, 0, "ランドソルには\n慣れましたか？\nわ、私はまだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (761, 4, 2, 1, 0, 102101, 1, 0, "お、お兄ちゃん、\nお、お話の練習に\n付き合って欲しいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (762, 101, 2, 4, 0, 102101, 1, 0, "リボンがかわいい？\nほ、ほぇぇぇ～～\nは、恥ずかしいですぅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (763, 102, 2, 8, 0, 102101, 1, 0, "お兄ちゃん…♪\nえへへ、呼んでみた\nだけです…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (764, 1, 2, 1, 0, 102101, 1, 1, "今日は一日、\n恥ずかしがらずに\n過ごせるかなあ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (765, 2, 2, 1, 0, 102101, 1, 2, "お昼ご飯、どうぞ♪\nわ、私、お料理、\nうまくなったかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (766, 3, 2, 1, 0, 102101, 1, 3, "おにいちゃんが\n帰ってくるまで、\nがんばって\n起きてました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (767, 1, 3, 1, 0, 102101, 1, 0, "可愛い女の子に変身！\n出来ますように…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (768, 2, 3, 1, 0, 102101, 1, 0, "ふかふかで\nあったかくて…\nお兄ちゃんみたい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (769, 3, 3, 1, 0, 102101, 1, 0, "この子を相手に、\n演技の練習～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (770, 4, 3, 1, 0, 102101, 1, 0, "リボンや服に\n染み込ませておこう。\nいつでもいい匂い♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (771, 5, 3, 1, 0, 102101, 1, 0, "えへへ。\nぽっかぽかです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (772, 6, 3, 1, 0, 102101, 1, 0, "はぁはぁ…\nふひぃ…\nはうぅぅぅ～～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (773, 7, 3, 1, 0, 102101, 1, 0, "もぐもぐ…えへへ、\n美味しいものを\n食べてると幸せです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (774, 8, 3, 1, 0, 102101, 1, 0, "戯曲を読んで\n自分が演じるところを\n想像するの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (776, 1, 1, 1, 0, 102102, 1, 0, "かわいいものを\nこうして並べて…\nはぁ…落ちつくぅ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (777, 2, 1, 1, 0, 102102, 1, 0, "ふぁ～、この部屋は\n時間がゆったりと\n流れてるみたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (778, 3, 1, 1, 0, 102102, 1, 0, "この台本、感動…\n涙が止まらないよぉ\nいつか演じてみたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (779, 4, 1, 1, 0, 102102, 1, 0, "お芝居には\n人間観察が大事…\nじーーーーーー…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (780, 5, 1, 1, 0, 102102, 1, 0, "あえいうえおあお\nかけきくけ、かっ…\nむ、難しいですぅぅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (781, 101, 1, 8, 0, 102102, 1, 0, "お、お腹が空いた時は\n言ってくださいね\nが、頑張って\n作ります！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (782, 102, 1, 8, 0, 102102, 1, 0, "れ、恋愛劇…\nお、お兄ちゃんと\n練習…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (783, 1, 2, 1, 0, 102102, 1, 0, "こ、この本、とっても\nおもしろいんですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (784, 2, 2, 1, 0, 102102, 1, 0, "お兄ちゃんと\nいっぱい話せた日は、\n嬉しくなっちゃいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (785, 3, 2, 1, 0, 102102, 1, 0, "何か私にできる事\n…そうだ！\nお掃除しますね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (786, 4, 2, 1, 0, 102102, 1, 0, "私、ちょっとずつ、\n自分に自信が\nついてきたかもです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (787, 101, 2, 8, 0, 102102, 1, 0, "リボンがかわいい？\nほ、ほぇぇぇ～～\nは、恥ずかしいですぅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (788, 102, 2, 8, 0, 102102, 1, 0, "お兄ちゃん…♪\nえへへ、呼んでみた\nだけです…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (789, 1, 2, 1, 0, 102102, 1, 1, "おはようございます♪\n声出しして、お芝居の\n練習しなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (790, 2, 2, 1, 0, 102102, 1, 2, "お茶にしますか？\nクッキー焼いたので、\nよかったら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (791, 3, 2, 1, 0, 102102, 1, 3, "寝る前に\n台本を読むと、\n覚えやすいんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (792, 1, 3, 1, 0, 102102, 1, 0, "可愛い女の子に変身！\n出来ますように…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (793, 2, 3, 1, 0, 102102, 1, 0, "はぅ…\nフッカフカァ…\n癒されちゃいます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (794, 3, 3, 1, 0, 102102, 1, 0, "この子を相手に\n演技の練習～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (795, 4, 3, 1, 0, 102102, 1, 0, "リボンや服に\n染み込ませておこう\nいつでもいい匂い♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (796, 5, 3, 1, 0, 102102, 1, 0, "えへへ\nぽっかぽかです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (797, 6, 3, 1, 0, 102102, 1, 0, "え、演劇には\nた、体力も重要\nだから～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (798, 7, 3, 1, 0, 102102, 1, 0, "残さず\n食べますね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (799, 8, 3, 1, 0, 102102, 1, 0, "戯曲を読んで\n自分が演じるところを\n想像するの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (801, 1, 1, 1, 0, 102201, 1, 0, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (802, 2, 1, 1, 0, 102201, 1, 0, "アカリみたいに\nかわいくなるには、\nどうすればいいのかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (803, 3, 1, 1, 0, 102201, 1, 0, "レアカードをゲット！\nねえねえ、\nすごいでしょ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (804, 4, 1, 1, 0, 102201, 1, 0, "ア、アイツと同じ\n部屋にいるのよね…\nって、だから何よ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (805, 5, 1, 1, 0, 102201, 1, 0, "楽しいゲームって\nやめどきが\n見つからないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (806, 101, 1, 4, 0, 102201, 1, 0, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (807, 102, 1, 8, 0, 102201, 1, 0, "うぅ…最近、\nアイツを見るとなんか\nドキドキするのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (808, 1, 2, 1, 0, 102201, 1, 0, "ゲームに負けた罰\nだからって、\nくすぐるのは…\nあはは…ダメだって！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (809, 2, 2, 1, 0, 102201, 1, 0, "アンタと話すのは割と\n緊張しないのよね\n…なんでかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (810, 3, 2, 1, 0, 102201, 1, 0, "待ちきれない…\n新作ゲームの発売日が\n待ちきれない…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (811, 4, 2, 1, 0, 102201, 1, 0, "アンタは人見知り\nしないタチよね？\nいいなあ～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (812, 101, 2, 4, 0, 102201, 1, 0, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (813, 102, 2, 8, 0, 102201, 1, 0, "アンタと…そ、その\nこうして話してるのも\nわわ、悪くないわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (814, 1, 2, 1, 0, 102201, 1, 1, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (815, 2, 2, 1, 0, 102201, 1, 2, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (816, 3, 2, 1, 0, 102201, 1, 3, "夜はこれからよ！\n朝まで\nゲームするからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (817, 1, 3, 1, 0, 102201, 1, 0, "アカリみたいに\n可愛くなるのは\n難しいかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (818, 2, 3, 1, 0, 102201, 1, 0, "寝っ転がりながら\nゲームができれば\n気分が良さそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (819, 3, 3, 1, 0, 102201, 1, 0, "可愛い…けど、\n私には似合わないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (820, 4, 3, 1, 0, 102201, 1, 0, "はあ、リラックスして\nゲームができるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (821, 5, 3, 1, 0, 102201, 1, 0, "ん…暖かくて、\n寝落ちしちゃいそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (822, 6, 3, 1, 0, 102201, 1, 0, "ゲーム感覚でやると、\n体動かすのも\n楽しいわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (823, 7, 3, 1, 0, 102201, 1, 0, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (824, 8, 3, 1, 0, 102201, 1, 0, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (826, 1, 1, 1, 0, 102202, 1, 0, "さあ、今日は\n何のゲームで\n遊ぼうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (827, 2, 1, 1, 0, 102202, 1, 0, "一緒にゲームができる\n人がいるっていうのも\n新鮮だな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (828, 3, 1, 1, 0, 102202, 1, 0, "レアカードをゲット！\nすごいでしょ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (829, 4, 1, 1, 0, 102202, 1, 0, "アカリってどうやって\n友達作ってるんだろ？\nコツがあるのかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (830, 5, 1, 1, 0, 102202, 1, 0, "楽しいゲームって\nやめどきが\n見つからないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (831, 101, 1, 8, 0, 102202, 1, 0, "うぅ…最近\nアイツを見るとなんか\nドキドキするのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (832, 102, 1, 8, 0, 102202, 1, 0, "ね、ねえ\nもう少しその…\n一緒にゲームしない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (833, 1, 2, 1, 0, 102202, 1, 0, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (834, 2, 2, 1, 0, 102202, 1, 0, "欲しいゲームが\n見つからなくて…\n探すの手伝って！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (835, 3, 2, 1, 0, 102202, 1, 0, "ねえ、見て！\n新しいゲームを\n買って来たの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (836, 4, 2, 1, 0, 102202, 1, 0, "ゲームに負けた罰\nだからって、くすぐる\nのは…あ、あはは！\nだ、ダメだって！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (837, 101, 2, 8, 0, 102202, 1, 0, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (838, 102, 2, 8, 0, 102202, 1, 0, "あ、あのさ…\nもう少し、そこに\nいてくれてもいいわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (839, 1, 2, 1, 0, 102202, 1, 1, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (840, 2, 2, 1, 0, 102202, 1, 2, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (841, 3, 2, 1, 0, 102202, 1, 3, "夜はこれからよ！\n朝まで\nゲームするからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (842, 1, 3, 1, 0, 102202, 1, 0, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (843, 2, 3, 1, 0, 102202, 1, 0, "ふああ…\n徹夜明けには\n辛い誘惑だな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (844, 3, 3, 1, 0, 102202, 1, 0, "可愛い…けど、\n私には似合わないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (845, 4, 3, 1, 0, 102202, 1, 0, "こういうのに詳しいと\n女の子っぽく\n見えたりするのかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (846, 5, 3, 1, 0, 102202, 1, 0, "寒い日は\nここでゲームするのが\n最高のぜいたくよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (847, 6, 3, 1, 0, 102202, 1, 0, "最近ゲームばかりだし\nたまにはいいかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (848, 7, 3, 1, 0, 102202, 1, 0, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (849, 8, 3, 1, 0, 102202, 1, 0, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (851, 1, 1, 1, 0, 102301, 1, 0, "じゃんけんぽん！\nあっち向いてほい！\nあ～ん、負けたぁ\n　『勝ったぜ！』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (852, 2, 1, 1, 0, 102301, 1, 0, "ぷうきちがいれば、\nなんでも出来ちゃうよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (853, 3, 1, 1, 0, 102301, 1, 0, "発声練習しよっと\nぷうきち\nフルスイ～ング！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (854, 4, 1, 1, 0, 102301, 1, 0, "ここで、ぷうきち\nフルスイングは、\nまずいかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (855, 5, 1, 1, 0, 102301, 1, 0, "この部屋、ぷうきちを\n置く場所はないのかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (856, 101, 1, 4, 0, 102301, 1, 0, "お兄ちゃんって…\nちょっとぷうきちに\n似てるかも♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (857, 102, 1, 8, 0, 102301, 1, 0, "お兄ちゃんにも、\nぷうきちのこと\n好きになって\nもらいたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (858, 1, 2, 1, 0, 102301, 1, 0, "おやつは、\n私とぷうきちの\n二人分用意してね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (859, 2, 2, 1, 0, 102301, 1, 0, "ぷうきちが、お腹\nペコペコだって～\n何かちょうだい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (860, 3, 2, 1, 0, 102301, 1, 0, "『アヤネに手出したら\n…坊ちゃんでも、\n分かってんな？』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (861, 4, 2, 1, 0, 102301, 1, 0, "ぷうきちとの\n連携を磨いてるの！\nもっと仲良くなるよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (862, 101, 2, 4, 0, 102301, 1, 0, "特別だからね？\nもっと触っていいよ\n…ぷうきちのこと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (863, 102, 2, 8, 0, 102301, 1, 0, "お兄ちゃんのこと、\n「ぷう兄」って\n呼ぼうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (864, 1, 2, 1, 0, 102301, 1, 1, "お兄ちゃんって\n朝早いんだね～\n私はまだ眠いよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (865, 2, 2, 1, 0, 102301, 1, 2, "ふぁ～…ぷうきちと\nお昼寝してくるね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (866, 3, 2, 1, 0, 102301, 1, 3, "ぷうきちと\nおしゃべりしてたら\nもうこんな時間…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (868, 2, 3, 1, 0, 102301, 1, 0, "『座り心地がいいな』\nぷうきちは座れない\nでしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (869, 3, 3, 1, 0, 102301, 1, 0, "かわいい～！\nぷうきちのお友達に\nしちゃおうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (870, 4, 3, 1, 0, 102301, 1, 0, "いいニオイ～♪\nぷうきちも\n気に入ったみたい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (871, 5, 3, 1, 0, 102301, 1, 0, "ぽわぽわする～\nぷうきちも\n気持ちいい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (873, 7, 3, 1, 0, 102301, 1, 0, "おいしい～\nぷうきちも\n食べてみる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (874, 8, 3, 1, 0, 102301, 1, 0, "ぷうきち！\nこの本、読んで～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (901, 1, 1, 1, 0, 102501, 1, 0, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (902, 2, 1, 1, 0, 102501, 1, 0, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (903, 3, 1, 1, 0, 102501, 1, 0, "どうしたら転ばなく\nなるんでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (904, 4, 1, 1, 0, 102501, 1, 0, "わわわわ～～っ\nふう…\nきゃ、きゃあっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (905, 5, 1, 1, 0, 102501, 1, 0, "私のドジで、\nこのお部屋を\n壊しちゃったら\nどうしましょう～～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (906, 101, 1, 4, 0, 102501, 1, 0, "おいしい料理で\nお出迎えしなくちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (907, 102, 1, 8, 0, 102501, 1, 0, "一生懸命\nご奉仕しますよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (908, 1, 2, 1, 0, 102501, 1, 0, "耳かきしましょうか？\nえ？　こわい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (909, 2, 2, 1, 0, 102501, 1, 0, "お疲れでしたら、\nお昼寝しませんか？\n膝枕もしますよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (910, 3, 2, 1, 0, 102501, 1, 0, "おかえりなさいませ\nご主人さま♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (911, 4, 2, 1, 0, 102501, 1, 0, "すみません\nすみません\nすみません～～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (912, 101, 2, 4, 0, 102501, 1, 0, "メイドの私が、\nこんな気持ちを持って\nいいんでしょうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (913, 102, 2, 8, 0, 102501, 1, 0, "私のこと、\n専属メイドと思って\n頼ってくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (914, 1, 2, 1, 0, 102501, 1, 1, "おはようございます♪\n今日も一日がんば…\nきゃ、きゃあ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (915, 2, 2, 1, 0, 102501, 1, 2, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (916, 3, 2, 1, 0, 102501, 1, 3, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (917, 1, 3, 1, 0, 102501, 1, 0, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (918, 2, 3, 1, 0, 102501, 1, 0, "休憩が終わったら\nお洗濯にお料理に\nお掃除もしないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (919, 3, 3, 1, 0, 102501, 1, 0, "かわいい♪\nあとでお洗濯\nしてあげますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (920, 4, 3, 1, 0, 102501, 1, 0, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (921, 5, 3, 1, 0, 102501, 1, 0, "ここでお洗濯ものを\n乾かしましょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (922, 6, 3, 1, 0, 102501, 1, 0, "あわわわっ…\nこ、転びそうです～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (923, 7, 3, 1, 0, 102501, 1, 0, "これくらい\nおいしいものを\n作ってみたいです～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (924, 8, 3, 1, 0, 102501, 1, 0, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (926, 1, 1, 1, 0, 102502, 1, 0, "失敗したら、この\nお部屋追い出され\nちゃうかも～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (927, 2, 1, 1, 0, 102502, 1, 0, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (928, 3, 1, 1, 0, 102502, 1, 0, "どうやったら、立派な\nメイドになれるのかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (929, 4, 1, 1, 0, 102502, 1, 0, "塩にはＳマーク\n砂糖にはＳマーク\n…あ、あれ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (930, 5, 1, 1, 0, 102502, 1, 0, "ご用があれば\nなんでも言って\nくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (931, 101, 1, 8, 0, 102502, 1, 0, "迷惑をかけすぎて…\n嫌われちゃったら\nどうしましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (932, 102, 1, 8, 0, 102502, 1, 0, "メイドの私が\nこんな気持ちを持って\nいいんでしょうか…　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (933, 1, 2, 1, 0, 102502, 1, 0, "おでかけですか？\nいってらっしゃいませ\nご主人さま♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (934, 2, 2, 1, 0, 102502, 1, 0, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (935, 3, 2, 1, 0, 102502, 1, 0, "私、またなにか\nやっちゃいましたか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (936, 4, 2, 1, 0, 102502, 1, 0, "おいしいお茶っ葉が\n手に入りました～♪\n一緒に飲みませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (937, 101, 2, 8, 0, 102502, 1, 0, "転んだふりであの人に\n…って！\nなんでもないですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (938, 102, 2, 8, 0, 102502, 1, 0, "私、できることなら\nなんでもやりますよ\nあなたのためですから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (939, 1, 2, 1, 0, 102502, 1, 1, "おはようございます♪\n今日も一日がんば…\nう、うわあ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (940, 2, 2, 1, 0, 102502, 1, 2, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (941, 3, 2, 1, 0, 102502, 1, 3, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (942, 1, 3, 1, 0, 102502, 1, 0, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (943, 2, 3, 1, 0, 102502, 1, 0, "いい座り心地です～\nこれならお嬢さまも\nゆったりできますね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (944, 3, 3, 1, 0, 102502, 1, 0, "かわいい♪\nあとでお洗濯\nしてあげますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (945, 4, 3, 1, 0, 102502, 1, 0, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (946, 5, 3, 1, 0, 102502, 1, 0, "暖かいですけど\n…私が火に近づいて\n大丈夫でしょうか！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (947, 6, 3, 1, 0, 102502, 1, 0, "運動しようとすると\nいつも怪我するん\nですよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (948, 7, 3, 1, 0, 102502, 1, 0, "こんなに美味しいもの\nメイドの私には\nもったいないです～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (949, 8, 3, 1, 0, 102502, 1, 0, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (951, 1, 1, 1, 0, 102701, 1, 0, "あの方と私だけの\n部屋にしたいですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (952, 2, 1, 1, 0, 102701, 1, 0, "あの方は私のもの…\n眼も耳も鼻も口も髪も\n首も胸も腰も手も脚も\nぬくもりも心も…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (953, 3, 1, 1, 0, 102701, 1, 0, "運命とは決して\n抗えないもの…\nクスクス…クスクス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (954, 4, 1, 1, 0, 102701, 1, 0, "部屋からあの方の\n香りが…\nああ、至福ですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (955, 5, 1, 1, 0, 102701, 1, 0, "毒にも薬にもならない\n存在なんて嫌ですわ\nどうせならとびきりの\n毒でありたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (956, 101, 1, 4, 0, 102701, 1, 0, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (957, 102, 1, 8, 0, 102701, 1, 0, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (958, 1, 2, 1, 0, 102701, 1, 0, "運命を信じますか？\nもちろん絶対当然\n信じますわよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (959, 2, 2, 1, 0, 102701, 1, 0, "この薬は起床時就寝前\n食前食後食間に、毎日\n服用してください。\n惚れ薬ですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (960, 3, 2, 1, 0, 102701, 1, 0, "お願いがあるのです。\n新しい研究の実験台に\n…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (961, 4, 2, 1, 0, 102701, 1, 0, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (962, 101, 2, 4, 0, 102701, 1, 0, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (963, 102, 2, 8, 0, 102701, 1, 0, "私の身も心も、全てが\nあなた様のもの。\nあなた様の全ても…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (964, 1, 2, 1, 0, 102701, 1, 1, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (965, 2, 2, 1, 0, 102701, 1, 2, "お昼を用意しましたの\n何も入れていませんわ\nクスクス…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (966, 3, 2, 1, 0, 102701, 1, 3, "あなた様が眠るまで\nお傍で見守りますわ。\n…あの、どうして\n眠らないのですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (967, 1, 3, 1, 0, 102701, 1, 0, "いっそ鏡の中に\n閉じ込めてしまえたら\n私だけのものに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (968, 2, 3, 1, 0, 102701, 1, 0, "はっ！\nリラックスしたら\n閃きましたわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (969, 3, 3, 1, 0, 102701, 1, 0, "あら、キメラの素体に\nぴったりですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (970, 4, 3, 1, 0, 102701, 1, 0, "このお部屋は\n良い香りがしますわ。\nはっ、あなた様の匂い\nなのでは…！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (971, 5, 3, 1, 0, 102701, 1, 0, "あたたかい…\n加熱調合にも\n使えそうですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (972, 6, 3, 1, 0, 102701, 1, 0, "この運動エネルギー\n何かにうまく\n利用できないかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (973, 7, 3, 1, 0, 102701, 1, 0, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (974, 8, 3, 1, 0, 102701, 1, 0, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (976, 1, 1, 1, 0, 102702, 1, 0, "あの方と私だけの\n部屋にしたいですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (977, 2, 1, 1, 0, 102702, 1, 0, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (978, 3, 1, 1, 0, 102702, 1, 0, "新しい薬\nどうやってあの方に\n飲ませようかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (979, 4, 1, 1, 0, 102702, 1, 0, "部屋からあの方の\n香りが…\nああ、至福ですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (980, 5, 1, 1, 0, 102702, 1, 0, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (981, 101, 1, 8, 0, 102702, 1, 0, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (982, 102, 1, 8, 0, 102702, 1, 0, "魔法も科学も錬金術も\n全て駆使して\nあの方のために…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (983, 1, 2, 1, 0, 102702, 1, 0, "この部屋には雌犬…\n失礼、女の方がとても\n沢山いますのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (984, 2, 2, 1, 0, 102702, 1, 0, "あなた様には私の伴侶\nとして高い教養を…\nあ、逃げられてしまい\nましたわ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (985, 3, 2, 1, 0, 102702, 1, 0, "お願いがあるのです\n新しい研究の\n実験台に…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (986, 4, 2, 1, 0, 102702, 1, 0, "あなた様が寝ている時\n私は…クスクス\nこれ以上は言えません");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (987, 101, 2, 8, 0, 102702, 1, 0, "想像の中のあなた様は\nすっかり私の虜なのに\n現実は…\nもどかしいですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (988, 102, 2, 8, 0, 102702, 1, 0, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (989, 1, 2, 1, 0, 102702, 1, 1, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (990, 2, 2, 1, 0, 102702, 1, 2, "さあ、お食事ですよ\n味は保証しますわ\n特製ソースで少しだけ\n体が痺れますけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (991, 3, 2, 1, 0, 102702, 1, 3, "あなた様が眠るまで\nお傍で見守りますわ\n…あの、どうして\n眠らないのですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (992, 1, 3, 1, 0, 102702, 1, 0, "私ももう少し\n外見に気を配る\nべきでしょうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (993, 2, 3, 1, 0, 102702, 1, 0, "はっ！\nリラックスしたら\n閃きましたわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (994, 3, 3, 1, 0, 102702, 1, 0, "この私を差し置いて\nあなた様に媚びるなど\n言語道断…っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (995, 4, 3, 1, 0, 102702, 1, 0, "このお部屋は\n良い香りがしますわ\nはっ、あなた様の匂い\nなのでは…！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (996, 5, 3, 1, 0, 102702, 1, 0, "素敵なぬくもり…\nまるであの方に\n抱きしめられたような");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (997, 6, 3, 1, 0, 102702, 1, 0, "この運動エネルギー\n何かにうまく\n利用できないかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (998, 7, 3, 1, 0, 102702, 1, 0, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (999, 8, 3, 1, 0, 102702, 1, 0, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1001, 1, 1, 1, 0, 102801, 1, 0, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1002, 2, 1, 1, 0, 102801, 1, 0, "使えるものは\n再利用しないと\n…あ、これとか\nまだ使えるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1003, 3, 1, 1, 0, 102801, 1, 0, "贅沢は敵！　とはいえ\n気持ちに余裕のない\n暮らしはダメよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1004, 4, 1, 1, 0, 102801, 1, 0, "お腹空いたわね、\n残り物で\n何か作ろうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1005, 5, 1, 1, 0, 102801, 1, 0, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1006, 101, 1, 4, 0, 102801, 1, 0, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1007, 102, 1, 8, 0, 102801, 1, 0, "焼きそばパンが\n食べたいな～\nあいつと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1008, 1, 2, 1, 0, 102801, 1, 0, "ねぇあんた、どこか\n安いお店知らない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1009, 2, 2, 1, 0, 102801, 1, 0, "あたし、エレガントに\n振る舞えてる？\n…そう？　嬉しい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1010, 3, 2, 1, 0, 102801, 1, 0, "いっぱい働いて遊んで\nよく休んでまた働く。\nそれが健全な生活よね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1011, 4, 2, 1, 0, 102801, 1, 0, "一緒に部屋の\n整頓でもする？\nハマると楽しいわよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1012, 101, 2, 4, 0, 102801, 1, 0, "あんたがいると\n子供たちも喜ぶわ♪\nもちろんあたしもね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1013, 102, 2, 8, 0, 102801, 1, 0, "ね、あんた今、幸せ？\n何びっくりしてるのよ\n大事なことじゃないの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1014, 1, 2, 1, 0, 102801, 1, 1, "面倒な用事は午前中に\n片づけてしまうのが、\n時間の使い方のコツよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1015, 2, 2, 1, 0, 102801, 1, 2, "午後のティータイム\nとかどう？\n良いカフェがあるの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1016, 3, 2, 1, 0, 102801, 1, 3, "さ、エレガントな夜を\n楽しみましょ。\nモダンな音楽でも\nかけましょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1017, 1, 3, 1, 0, 102801, 1, 0, "レディたるもの\n身嗜みはしっかりとね\n見本にならないと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1018, 2, 3, 1, 0, 102801, 1, 0, "これで仕事は一段落ね\nちょっと休憩…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1019, 3, 3, 1, 0, 102801, 1, 0, "うふふ、\nかわいいものを\n見るのは幸せね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1020, 4, 3, 1, 0, 102801, 1, 0, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1021, 5, 3, 1, 0, 102801, 1, 0, "風邪を引かないように\n身体を温めなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1022, 6, 3, 1, 0, 102801, 1, 0, "さっ！　家の中でも\n効率的に\nトレーニングよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1023, 7, 3, 1, 0, 102801, 1, 0, "もぐもぐ…はっ、\n口の周り、\n汚れてないわよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1024, 8, 3, 1, 0, 102801, 1, 0, "知識から過去を学んで\n未来に活かすわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1026, 1, 1, 1, 0, 102802, 1, 0, "安売りのお店の情報\n整理しないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1027, 2, 1, 1, 0, 102802, 1, 0, "どんなに苦労してても\nそう見せないのが真の\nエレガントなレディよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1028, 3, 1, 1, 0, 102802, 1, 0, "安く済んであいつが\n喜ぶ料理とか…\nないかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1029, 4, 1, 1, 0, 102802, 1, 0, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1030, 5, 1, 1, 0, 102802, 1, 0, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1031, 101, 1, 8, 0, 102802, 1, 0, "焼きそばパンが\n食べたいな～\nあいつと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1032, 102, 1, 8, 0, 102802, 1, 0, "あいつと一緒に…\n色々なところに\nいきたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1033, 1, 2, 1, 0, 102802, 1, 0, "今度買い物に\n付き合いなさい\nセールがあるのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1034, 2, 2, 1, 0, 102802, 1, 0, "あんたがいると子供\nたちも喜ぶわ♪\nもちろんあたしもね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1035, 3, 2, 1, 0, 102802, 1, 0, "いっぱい働いて遊んで\nよく休んでまた働く\nそれが健全な生活よね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1036, 4, 2, 1, 0, 102802, 1, 0, "あんたとこうして\nのんびりするのも\nいいものね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1037, 101, 2, 8, 0, 102802, 1, 0, "ねえ、今度遊びに\n行きたいな\nもちろん一緒に、よ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1038, 102, 2, 8, 0, 102802, 1, 0, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1039, 1, 2, 1, 0, 102802, 1, 1, "面倒な用事は午前中に\n片づけてしまうのが\n時間の使い方のコツよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1040, 2, 2, 1, 0, 102802, 1, 2, "ランチにして午後の\n仕事に備えましょ！\nやることは一杯よ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1041, 3, 2, 1, 0, 102802, 1, 3, "ふわあ～\nもうこんな時間\n子供たちは\nもう寝たかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1042, 1, 3, 1, 0, 102802, 1, 0, "忙しい時こそ\n身だしなみは隙なく\nぴしっとね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1043, 2, 3, 1, 0, 102802, 1, 0, "これで仕事は一段落ね\nちょっと休憩…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1044, 3, 3, 1, 0, 102802, 1, 0, "ふふふ\nずっと眺めてたく\nなっちゃうわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1045, 4, 3, 1, 0, 102802, 1, 0, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1046, 5, 3, 1, 0, 102802, 1, 0, "風邪を引かないように\n身体を温めなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1047, 6, 3, 1, 0, 102802, 1, 0, "さっ！　家の中でも\n効率的に\nトレーニングよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1048, 7, 3, 1, 0, 102802, 1, 0, "しっかり食べて\n栄養補給、栄養補給！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1049, 8, 3, 1, 0, 102802, 1, 0, "知識から過去を学んで\n未来に活かすわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1051, 1, 1, 1, 0, 102901, 1, 0, "可愛い子が\nいっぱいいるなぁ…\n誰か私とユニット\n組んでくれないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1052, 2, 1, 1, 0, 102901, 1, 0, "今度のライブ会場、\nいつもより大きいから\n楽しみなんだ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1053, 3, 1, 1, 0, 102901, 1, 0, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1054, 4, 1, 1, 0, 102901, 1, 0, "彼とデュエット\nしてみたいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1055, 5, 1, 1, 0, 102901, 1, 0, "キラキラ無病息災、\nドキドキ一日一善…\n作詞って難しい～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1056, 101, 1, 4, 0, 102901, 1, 0, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1057, 102, 1, 8, 0, 102901, 1, 0, "写真集見なくても、\n本物がここに\nいるのにな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1058, 1, 2, 1, 0, 102901, 1, 0, "握手会の練習、\n付き合ってくれない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1059, 2, 2, 1, 0, 102901, 1, 0, "写真集のポーズ\n練習中～！\nど、どうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1060, 3, 2, 1, 0, 102901, 1, 0, "何て書いてあるか\n読めないって？\nもー！\nこれは私のサイン！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1061, 4, 2, 1, 0, 102901, 1, 0, "ね、次のライブ\n観に来てくれる？\nいい席とっとくから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1062, 101, 2, 4, 0, 102901, 1, 0, "ねぇ、台本読むの\nつきあってくれる？\n恋人役に\nなってほしいんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1063, 102, 2, 8, 0, 102901, 1, 0, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ。\nどこかは秘密だけど♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1064, 1, 2, 1, 0, 102901, 1, 1, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1065, 2, 2, 1, 0, 102901, 1, 2, "この時間は\nお腹すくけど…\n水着撮影があるから\nお昼抜いてるんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1066, 3, 2, 1, 0, 102901, 1, 3, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ。");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1067, 1, 3, 1, 0, 102901, 1, 0, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1068, 2, 3, 1, 0, 102901, 1, 0, "ふぅ…\nこんな姿、ファンには\n見せられないな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1069, 3, 3, 1, 0, 102901, 1, 0, "かわいい～♪\nこれは強力な\nライバル登場かな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1070, 4, 3, 1, 0, 102901, 1, 0, "ステキな香り～♪\n歌詞のイメージが\n浮かんできそう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1071, 5, 3, 1, 0, 102901, 1, 0, "体も暖まったし！\nダンスレッスンに\n行こうかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1072, 6, 3, 1, 0, 102901, 1, 0, "ベストタイム更新！\nライブに向けて\n体力つけないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1073, 7, 3, 1, 0, 102901, 1, 0, "太っちゃったら\nどうしよう…？\nでも手が止まらない～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1074, 8, 3, 1, 0, 102901, 1, 0, "ステキなお話…\n新曲の作詞の\n参考になりそう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1076, 1, 1, 1, 0, 102902, 1, 0, "このお部屋すてき！\nファンに追われた時の\n隠れ家にピッタリね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1077, 2, 1, 1, 0, 102902, 1, 0, "そろそろイメチェン\nしてみようかな…\nそれともこの路線で\nもう少し…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1078, 3, 1, 1, 0, 102902, 1, 0, "みんながくれた\nファンレター…\n私の大事な宝物…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1079, 4, 1, 1, 0, 102902, 1, 0, "彼とデュエット\nしてみたいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1080, 5, 1, 1, 0, 102902, 1, 0, "疾風怒濤、威風堂々\n獅子奮迅、唯我独尊…\nラブソングの作詞って\n難しいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1081, 101, 1, 8, 0, 102902, 1, 0, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1082, 102, 1, 8, 0, 102902, 1, 0, "トップアイドルの\nさらに先…\n彼とならその景色も\n見られるかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1083, 1, 2, 1, 0, 102902, 1, 0, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1084, 2, 2, 1, 0, 102902, 1, 0, "アイドルノゾミだけ\nじゃなくて、私の事も\nちゃんと見てね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1085, 3, 2, 1, 0, 102902, 1, 0, "キミに響かないなら\nファンにも響くわけ\nないよ！　練習練習！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1086, 4, 2, 1, 0, 102902, 1, 0, "衣装のスカートは\n鉄壁なんだよ！\n残念でした～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1087, 101, 2, 8, 0, 102902, 1, 0, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ\nどこかは秘密だけど♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1088, 102, 2, 8, 0, 102902, 1, 0, "ねぇ、私がトップ\nアイドルになっても\nちゃんと隣にいてね\n遠くに行かないでね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1089, 1, 2, 1, 0, 102902, 1, 1, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1090, 2, 2, 1, 0, 102902, 1, 2, "お昼ごはん行かない？\n誰にも知られてない\nお店があるんだけど！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1091, 3, 2, 1, 0, 102902, 1, 3, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1092, 1, 3, 1, 0, 102902, 1, 0, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1093, 2, 3, 1, 0, 102902, 1, 0, "ふぅ…\nこんな姿、ファンには\n見せられないな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1094, 3, 3, 1, 0, 102902, 1, 0, "かわいい～♪\nこれは強力な\nライバル登場かな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1095, 4, 3, 1, 0, 102902, 1, 0, "みんなのイメージする\nアイドルの香りは\nこんな感じかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1096, 5, 3, 1, 0, 102902, 1, 0, "体も暖まったし！\nダンスレッスンに\n行こうかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1097, 6, 3, 1, 0, 102902, 1, 0, "ベストタイム更新！\nライブに向けて\n体力つけないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1098, 7, 3, 1, 0, 102902, 1, 0, "太っちゃったら\nどうしよう…？\nでも手が止まらない～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1099, 8, 3, 1, 0, 102902, 1, 0, "この恋愛小説ステキ！\n私もアイドルじゃ\nなかったら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1101, 1, 1, 1, 0, 103001, 1, 0, "手裏剣の数が\n合わないデス！\nどこかに落とした\nデスか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1102, 2, 1, 1, 0, 103001, 1, 0, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1103, 3, 1, 1, 0, 103001, 1, 0, "金は天下の\nマワリモノ！\nところで、\nどういう意味デス？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1104, 4, 1, 1, 0, 103001, 1, 0, "むむ、アクダイカンの\n気配がするデース");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1105, 5, 1, 1, 0, 103001, 1, 0, "クニトリ合戦、\n楽しみデース！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1106, 101, 1, 4, 0, 103001, 1, 0, "ショーグンと\n出会えて、\nワタシは果報者デス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1107, 102, 1, 8, 0, 103001, 1, 0, "最近、ショーグンの\nそばにいると\nドキドキするデス…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1108, 1, 2, 1, 0, 103001, 1, 0, "なんでも\n命令するデス！\nショーグンの命は\n絶対デス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1109, 2, 2, 1, 0, 103001, 1, 0, "あっ、ショーグン、\n出陣はいつで\nゴザルデス！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1110, 3, 2, 1, 0, 103001, 1, 0, "さ、さすが\nショーグンデス…\nいつの間に背後を！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1111, 4, 2, 1, 0, 103001, 1, 0, "出陣の合図に\n備えるデス！\nほら貝は\nどこデスか！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1112, 101, 2, 4, 0, 103001, 1, 0, "見つめられると\nドキドキするデス…\n新しい忍法デスか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1113, 102, 2, 8, 0, 103001, 1, 0, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1114, 1, 2, 1, 0, 103001, 1, 1, "おはようデス！\n今日も一日\n忍法日和デス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1115, 2, 2, 1, 0, 103001, 1, 2, "そろそろお腹\n空いてきたデス。\n昼ごはんにするデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1116, 3, 2, 1, 0, 103001, 1, 3, "明日もきっと\nいい日デスよ、\nショーグン！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1117, 1, 3, 1, 0, 103001, 1, 0, "ちょんまげに\nしてみるのも\n面白いかもデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1118, 2, 3, 1, 0, 103001, 1, 0, "心地よくて\n眠くなってきマス…\nもしやテキコクの\n罠デスか！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1119, 3, 3, 1, 0, 103001, 1, 0, "これを変わり身の\n術に…かわいそう\nだから止めるデス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1120, 4, 3, 1, 0, 103001, 1, 0, "ワビサビというもの\nデスね！\n素晴らしいデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1121, 5, 3, 1, 0, 103001, 1, 0, "身体を暖めて\nイクサに向かうデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1122, 6, 3, 1, 0, 103001, 1, 0, "アクロバットな忍法を\n使うには、体を\n鍛えないと危険デス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1123, 7, 3, 1, 0, 103001, 1, 0, "うーん、\n美味しいデス…\n幸せデス～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1124, 8, 3, 1, 0, 103001, 1, 0, "これは…\nＢＵＳＨＩＤＯ…\nデスか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1126, 1, 1, 1, 0, 103002, 1, 0, "ふんふんふ～ん\n武器の手入れは\n念入りにしマスよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1127, 2, 1, 1, 0, 103002, 1, 0, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1128, 3, 1, 1, 0, 103002, 1, 0, "金は天下の\nマワリモノ！\nところで\nどういう意味デス？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1129, 4, 1, 1, 0, 103002, 1, 0, "むむ、アクダイカンの\n気配がするデース");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1130, 5, 1, 1, 0, 103002, 1, 0, "クニトリ合戦\n楽しみデース！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1131, 101, 1, 8, 0, 103002, 1, 0, "最近、ショーグンの\nそばにいると\nドキドキするデス…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1132, 102, 1, 8, 0, 103002, 1, 0, "ショーグンの身は\n何があってもワタシが\n守るデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1133, 1, 2, 1, 0, 103002, 1, 0, "あっ、ショーグン\n出陣はいつで\nゴザルデス！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1134, 2, 2, 1, 0, 103002, 1, 0, "イクサの前に\nホネ休めも大事デスよ\nゆっくりするデース！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1135, 3, 2, 1, 0, 103002, 1, 0, "さ、さすがショーグン\nデス…いつの間に\n背後を！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1136, 4, 2, 1, 0, 103002, 1, 0, "一緒に忍法考える\nデス！\nショーグン用の\n忍法も必要デスね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1137, 101, 2, 8, 0, 103002, 1, 0, "見つめられると\nドキドキするデス…\n新しい忍法デスか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1138, 102, 2, 8, 0, 103002, 1, 0, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1139, 1, 2, 1, 0, 103002, 1, 1, "いい朝デス！\nトーゴク風の朝ゴハン\n作るデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1140, 2, 2, 1, 0, 103002, 1, 2, "もうお昼デス\nお昼寝するデスか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1141, 3, 2, 1, 0, 103002, 1, 3, "そろそろおネム\nデース…\n一緒に寝るデス？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1142, 1, 3, 1, 0, 103002, 1, 0, "服の乱れは心の乱れ\nデス！　きっちり\nしないといけないデス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1143, 2, 3, 1, 0, 103002, 1, 0, "心地よくて眠く\nなってきマス…\nもしやテキコクの\n罠デスか！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1144, 3, 3, 1, 0, 103002, 1, 0, "これを変わり身の\n術に…かわいそう\nだから止めるデス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1145, 4, 3, 1, 0, 103002, 1, 0, "ワビサビというもの\nデスね！\n素晴らしいデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1146, 5, 3, 1, 0, 103002, 1, 0, "身体を暖めてイクサに\n向かうデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1147, 6, 3, 1, 0, 103002, 1, 0, "ショーグンのお役に\n立つため、修行\nあるのみデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1148, 7, 3, 1, 0, 103002, 1, 0, "美味しいデス…\n酢昆布を和えて\nみたいデス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1149, 8, 3, 1, 0, 103002, 1, 0, "物事を知って\n来たるべきイクサに\n活かすデス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1151, 1, 1, 1, 0, 103101, 1, 0, "お父さん、そろそろ\n子離れを…しない？\nそうですか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1152, 2, 1, 1, 0, 103101, 1, 0, "父は、いつも男性に\nきびしいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1153, 3, 1, 1, 0, 103101, 1, 0, "占ってほしい人は、\nいつでも言って\nください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1154, 4, 1, 1, 0, 103101, 1, 0, "あなたの手相は…\nて、手を握るのって\n緊張しますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1155, 5, 1, 1, 0, 103101, 1, 0, "この部屋、風水的にも\n運気が上がりそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1156, 101, 1, 4, 0, 103101, 1, 0, "あの人とのこと占って\nみようかな…\n好き…嫌い…\n好き♪…き、嫌い");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1157, 102, 1, 8, 0, 103101, 1, 0, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1158, 1, 2, 1, 0, 103101, 1, 0, "女難の相が\n出ていますね…\n気をつけてください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1159, 2, 2, 1, 0, 103101, 1, 0, "今日のあなたの運勢は\n大きょ…\n大吉です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1160, 3, 2, 1, 0, 103101, 1, 0, "父と散歩中です。\n毎日決まったコースを\n散歩させないと、\nストレスが溜まるので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1161, 4, 2, 1, 0, 103101, 1, 0, "小僧！\nシノブに触るとは\nいい度胸じゃねぇか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1162, 101, 2, 4, 0, 103101, 1, 0, "あなたに触られると、\n動悸が早くなります\nもしかして心霊現象？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1163, 102, 2, 8, 0, 103101, 1, 0, "今日もたくさんの幽霊\nに慕われていますね。\n素敵です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1164, 1, 2, 1, 0, 103101, 1, 1, "おはようございます\n今日の運勢を\n占いましょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1165, 2, 2, 1, 0, 103101, 1, 2, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1166, 3, 2, 1, 0, 103101, 1, 3, "今日のあなたの運気は\n最高潮でした。\nもうすぐ今日は\n終わりますが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1167, 1, 3, 1, 0, 103101, 1, 0, "お父さん。\nいつも、身だしなみに\n気を使ってるけど、\nあまり変わってないよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1168, 2, 3, 1, 0, 103101, 1, 0, "一休みしましょう。\n憑かれて疲れました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1169, 3, 3, 1, 0, 103101, 1, 0, "かわいい…\n付喪神が宿らないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1170, 4, 3, 1, 0, 103101, 1, 0, "お父さん、\nリラックスし過ぎると\n成仏しちゃうよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1171, 5, 3, 1, 0, 103101, 1, 0, "気持ちいいです…\n極楽浄土みたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1172, 6, 3, 1, 0, 103101, 1, 0, "はぁはぁ…\nお、お父さん、\n代わりに運動して…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1173, 7, 3, 1, 0, 103101, 1, 0, "お父さんも\n食べたいの？\n死んでるのに？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1174, 8, 3, 1, 0, 103101, 1, 0, "この本…\nもしかして予言書？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1176, 1, 1, 1, 0, 103102, 1, 0, "ここにいる幽霊は\nみんな幸せそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1177, 2, 1, 1, 0, 103102, 1, 0, "お父さんが\n女の子ばかりに\n声をかけるので\n困っています");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1178, 3, 1, 1, 0, 103102, 1, 0, "成仏はうれしいこと\nです…でも友達が\n減るのは寂しいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1179, 4, 1, 1, 0, 103102, 1, 0, "幽霊に好かれる人は\n素敵な方です\nもちろん、あなたも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1180, 5, 1, 1, 0, 103102, 1, 0, "お父さん、そろそろ\n子離れを…しない？\nそうですか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1181, 101, 1, 8, 0, 103102, 1, 0, "生きている人に\n好かれるには、\nどうすればいい\nのでしょう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1182, 102, 1, 8, 0, 103102, 1, 0, "お父さん、どうしたら\nあの人のことを\n認めてくれますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1183, 1, 2, 1, 0, 103102, 1, 0, "この部屋、風水的にも\n運気が上がりそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1184, 2, 2, 1, 0, 103102, 1, 0, "シノブには指一本\n触れさせん！\nガブッ！！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1185, 3, 2, 1, 0, 103102, 1, 0, "あなたの手相は…\nて、手を握るのって\n緊張しますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1186, 4, 2, 1, 0, 103102, 1, 0, "ラップ音？\nいえ、父のいびきです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1187, 101, 2, 8, 0, 103102, 1, 0, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1188, 102, 2, 8, 0, 103102, 1, 0, "前世って信じますか？\n私とあなたは\nもしかすると…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1189, 1, 2, 1, 0, 103102, 1, 1, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1190, 2, 2, 1, 0, 103102, 1, 2, "明るい時間は\nあまり得意では\nないんです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1191, 3, 2, 1, 0, 103102, 1, 3, "夜のお散歩に\n行きませんか？\n知り合いの幽霊に\n挨拶して回るんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1192, 1, 3, 1, 0, 103102, 1, 0, "お父さん\nいつも、身だしなみに\n気を使ってるけど\nあまり変わってないよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1193, 2, 3, 1, 0, 103102, 1, 0, "うとうと…\nあれ…\n走馬灯が見える…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1194, 3, 3, 1, 0, 103102, 1, 0, "かわいい…\nお父さんみたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1195, 4, 3, 1, 0, 103102, 1, 0, "お父さん\nリラックスし過ぎると\n成仏しちゃうよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1196, 5, 3, 1, 0, 103102, 1, 0, "快適です…\n幽霊もどんどん\n集まってきますね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1197, 6, 3, 1, 0, 103102, 1, 0, "はぁはぁ…\nお、お父さん、\n代わりに運動して…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1198, 7, 3, 1, 0, 103102, 1, 0, "お父さんの分も、\n私が食べるね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1199, 8, 3, 1, 0, 103102, 1, 0, "この本の占い\n私の占いと違う…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1201, 1, 1, 1, 0, 103201, 1, 0, "私だって、一人で\n買い物ぐらい\nできますわ…きっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1202, 2, 1, 1, 0, 103201, 1, 0, "そろそろ新しい\n案件を始めないと\nいけませんわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1203, 3, 1, 1, 0, 103201, 1, 0, "一日も早く、\n一人前の商人に\nなりたいものです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1204, 4, 1, 1, 0, 103201, 1, 0, "平和を買うのには\nどれほどのお金が\n必要なのかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1205, 5, 1, 1, 0, 103201, 1, 0, "ここももう少し広いと\n落ち着くのですけど。\n改築しませんこと？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1206, 101, 1, 4, 0, 103201, 1, 0, "あの方はお金で雇った\nわけではないのに\n私といてくださる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1207, 102, 1, 8, 0, 103201, 1, 0, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1208, 1, 2, 1, 0, 103201, 1, 0, "私と、庶民向けの\nお店へ一緒に\n参りませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1209, 2, 2, 1, 0, 103201, 1, 0, "資産運用？\nお幾らほど\n増やしたいのです？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1210, 3, 2, 1, 0, 103201, 1, 0, "どんぶり勘定だとよく\n言われるのですが…\n例えが小さすぎます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1211, 4, 2, 1, 0, 103201, 1, 0, "お金で解決するのは\n悪いことでは\nありませんわよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1212, 101, 2, 4, 0, 103201, 1, 0, "その、よろしければ\n私とお散歩など\nいかがです？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1213, 102, 2, 8, 0, 103201, 1, 0, "もしあなたさまが\n道に迷われるなら、\n私もお供いたします！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1214, 1, 2, 1, 0, 103201, 1, 1, "早起きは三ルピの徳と\n申しますが…\nもっとお得ですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1215, 2, 2, 1, 0, 103201, 1, 2, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1216, 3, 2, 1, 0, 103201, 1, 3, "よろしければ\nお休み前のミルクを\n御一緒にいかが？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1217, 1, 3, 1, 0, 103201, 1, 0, "だらしない身なりでは\n取引相手に信用して\nいただけませんものね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1218, 2, 3, 1, 0, 103201, 1, 0, "この感触と安らぎ…\n素晴らしい\n費用対効果ですわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1219, 3, 3, 1, 0, 103201, 1, 0, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1220, 4, 3, 1, 0, 103201, 1, 0, "目に見えないものに\nお金をかけるのが\n真の贅沢ですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1221, 5, 3, 1, 0, 103201, 1, 0, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1222, 6, 3, 1, 0, 103201, 1, 0, "健康はお金では\n買えませんが\n運動器具は別ですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1223, 7, 3, 1, 0, 103201, 1, 0, "なかなか\n美味ですわ\nシェフはどちらに？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1224, 8, 3, 1, 0, 103201, 1, 0, "経済の仕組みを\nしっかりと\n学ばなくては…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1226, 1, 1, 1, 0, 103202, 1, 0, "そろそろ新しい\n案件を始めないと\nいけませんわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1227, 2, 1, 1, 0, 103202, 1, 0, "ええと、これは\nおいくらで買ったん\nでしたっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1228, 3, 1, 1, 0, 103202, 1, 0, "お金を見せたら\n態度が変わる人は\n信用できませんわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1229, 4, 1, 1, 0, 103202, 1, 0, "地図が読めずとも\n道に迷わない方って\nいらっしゃるのですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1230, 5, 1, 1, 0, 103202, 1, 0, "この狭さも\n慣れれば\n快適ですわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1231, 101, 1, 8, 0, 103202, 1, 0, "あの方はお金で雇った\nわけではないのに\n私といてくださる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1232, 102, 1, 8, 0, 103202, 1, 0, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1233, 1, 2, 1, 0, 103202, 1, 0, "一人前の商人に\n相応しい居振る舞いを\nしたいものですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1234, 2, 2, 1, 0, 103202, 1, 0, "幼い頃\nお店屋さんごっこを\nなさいましたか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1235, 3, 2, 1, 0, 103202, 1, 0, "資産運用？\nお幾らほど\n増やしたいのです？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1236, 4, 2, 1, 0, 103202, 1, 0, "今度一緒に…\nパーティにでも\n行きませんこと？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1237, 101, 2, 8, 0, 103202, 1, 0, "その、よろしければ\n私とお散歩など\nいかがです？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1238, 102, 2, 8, 0, 103202, 1, 0, "あなたさまの優しさは\nお金には\n代えられませんわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1239, 1, 2, 1, 0, 103202, 1, 1, "なぜだか\n眠り足りないような\n感じがしますわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1240, 2, 2, 1, 0, 103202, 1, 2, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1241, 3, 2, 1, 0, 103202, 1, 3, "よろしければ\nお休み前のミルクを\n御一緒にいかが？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1242, 1, 3, 1, 0, 103202, 1, 0, "ドレスは汚れていない\nようですが…やだ\n髪がほつれてますわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1243, 2, 3, 1, 0, 103202, 1, 0, "こういったものに\n腰を沈めると…\nき、気が緩んで…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1244, 3, 3, 1, 0, 103202, 1, 0, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1245, 4, 3, 1, 0, 103202, 1, 0, "香りは質のいいものと\nそうでないものが\nはっきり分かりますわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1246, 5, 3, 1, 0, 103202, 1, 0, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1247, 6, 3, 1, 0, 103202, 1, 0, "目標は遠くに\n置いた方が励みに\nなりますわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1248, 7, 3, 1, 0, 103202, 1, 0, "なかなか\n美味ですわ\nシェフはどちらに？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1249, 8, 3, 1, 0, 103202, 1, 0, "商人って、物語では\n悪役にされやすいの\nですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1251, 1, 1, 1, 0, 103301, 1, 0, "家の中のものを使って\n物ボケ、考えるべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1252, 2, 1, 1, 0, 103301, 1, 0, "毎日の日課…それは\n炊事、洗濯、大喜利\nだべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1253, 3, 1, 1, 0, 103301, 1, 0, "うちに塀ができたら、\nへー、って言いたい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1254, 4, 1, 1, 0, 103301, 1, 0, "オラが作る料理は\nこの後スタッフで\n美味しくいただくべよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1255, 5, 1, 1, 0, 103301, 1, 0, "エリザベスも\n連れてきてぇ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1256, 101, 1, 4, 0, 103301, 1, 0, "あんちゃんも、\nエリザベスと同じ位\nめんこいべ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1257, 102, 1, 8, 0, 103301, 1, 0, "オラとあんちゃん、\n息がぴったりに\nなってきたべ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1258, 1, 2, 1, 0, 103301, 1, 0, "おぉ！　そんな急に\nツッコまれたら、\nびっくらこくべやー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1259, 2, 2, 1, 0, 103301, 1, 0, "ネタはオラが書くけど\nあんちゃんが\n書きたかったら\n書いてもいいんだぞ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1260, 3, 2, 1, 0, 103301, 1, 0, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1261, 4, 2, 1, 0, 103301, 1, 0, "押すなよ、\n絶対押すなよ\n…なんて\n言ってないべさ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1262, 101, 2, 4, 0, 103301, 1, 0, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1263, 102, 2, 8, 0, 103301, 1, 0, "将来的には夫婦漫才\nってのも…あ、ひ、\nひとりごとだべさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1264, 1, 2, 1, 0, 103301, 1, 1, "おはよう！　一緒に\n牛の乳しぼりいくべ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1265, 2, 2, 1, 0, 103301, 1, 2, "お昼だ～腹が減っては\n笑いはできぬ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1266, 3, 2, 1, 0, 103301, 1, 3, "今日もよく働いたべ！\nさ、今からは\nお笑いの練習だ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1267, 1, 3, 1, 0, 103301, 1, 0, "舞台に上がる前に\n身なりは整えねぇと\nだめだべ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1268, 2, 3, 1, 0, 103301, 1, 0, "ナイスなイスに\n座りたい、\nなんちゃって！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1269, 3, 3, 1, 0, 103301, 1, 0, "めんこいのは、\nスベっても許される\nからずるいべな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1270, 4, 3, 1, 0, 103301, 1, 0, "必要以上に\n癒されちまうべや～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1271, 5, 3, 1, 0, 103301, 1, 0, "ぽかぽかだ…\nウケた会場みてぇだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1272, 6, 3, 1, 0, 103301, 1, 0, "お笑い芸人は、\n体が資本だべさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1273, 7, 3, 1, 0, 103301, 1, 0, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1274, 8, 3, 1, 0, 103301, 1, 0, "ネタ作りのヒントが\n載ってねぇか探すべ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1276, 1, 1, 1, 0, 103302, 1, 0, "さぁ今日も張り切って\n漫才の練習するべさ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1277, 2, 1, 1, 0, 103302, 1, 0, "この部屋でも、商品\n売っていいんだべか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1278, 3, 1, 1, 0, 103302, 1, 0, "眼鏡を頭の上に乗せて\n「メガネメガネ～」\nって言う練習した方が\nいいべか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1279, 4, 1, 1, 0, 103302, 1, 0, "漫才を持ち時間に\n収めるには、何度も\n練習するしかねぇべ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1280, 5, 1, 1, 0, 103302, 1, 0, "エリザベスも\n連れてきてぇ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1281, 101, 1, 8, 0, 103302, 1, 0, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1282, 102, 1, 8, 0, 103302, 1, 0, "あんちゃんに\n採れたての食材を\n食わしてやりてぇ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1283, 1, 2, 1, 0, 103302, 1, 0, "押すなよ\n絶対押すなよ\n…なんて\n言ってないべさ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1284, 2, 2, 1, 0, 103302, 1, 0, "あんちゃん、百連\nツッコミ特訓だ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1285, 3, 2, 1, 0, 103302, 1, 0, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1286, 4, 2, 1, 0, 103302, 1, 0, "「なんでだべ～！」\nって言いながら\nツッコむといいべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1287, 101, 2, 8, 0, 103302, 1, 0, "あはは～あんちゃんの\nツッコミはやっぱり\n気持ちいいなぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1288, 102, 2, 8, 0, 103302, 1, 0, "将来的には夫婦漫才\nってのも…あ、ひ\nひとりごとだべさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1289, 1, 2, 1, 0, 103302, 1, 1, "おはよう！\n今日もいい\nネタ作り日和だ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1290, 2, 2, 1, 0, 103302, 1, 2, "お昼だな\nご飯を食べたら、\nネタの練習するべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1291, 3, 2, 1, 0, 103302, 1, 3, "もうこんな時間だべ\nネタ作りは\n明日にするべ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1292, 1, 3, 1, 0, 103302, 1, 0, "うーん…衣装、\nずれてねぇべか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1293, 2, 3, 1, 0, 103302, 1, 0, "ナイスなイスに\n座りたい\nなんちゃって！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1294, 3, 3, 1, 0, 103302, 1, 0, "はう～\nなまらめんこいべや～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1295, 4, 3, 1, 0, 103302, 1, 0, "必要以上に\n癒されちまうべや～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1296, 5, 3, 1, 0, 103302, 1, 0, "笑いをとることを\n忘れるほど\nあったけぇべ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1297, 6, 3, 1, 0, 103302, 1, 0, "たくさん運動して\n動きでも笑いがとれる\nように頑張るべ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1298, 7, 3, 1, 0, 103302, 1, 0, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1299, 8, 3, 1, 0, 103302, 1, 0, "幅広く教養を\n身につけて\nいいネタ作るべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1301, 1, 1, 1, 0, 103401, 1, 0, "通りにいる\nカップル…爆発\nすればいいのに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1302, 2, 1, 1, 0, 103401, 1, 0, "う～ん、仕事なんて\nしないで、\n飲んでたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1303, 3, 1, 1, 0, 103401, 1, 0, "今日は一日、\n外に出ない！\nもう決めたわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1304, 4, 1, 1, 0, 103401, 1, 0, "お腹空いた…\nけど、外に出るのは\n面倒だなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1305, 5, 1, 1, 0, 103401, 1, 0, "うぅ…頭がガンガン\nする…昨日、\n飲み過ぎたかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1306, 101, 1, 4, 0, 103401, 1, 0, "デートとか…\n誘っても嫌がられ\nないかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1307, 102, 1, 8, 0, 103401, 1, 0, "もしかして運命の\n相手だったり…\nするのかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1308, 1, 2, 1, 0, 103401, 1, 0, "やっぱり一杯目が\n一番おいしいわ～！\n…え、見てた！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1309, 2, 2, 1, 0, 103401, 1, 0, "頼れるお姉さんだって\nところ、もっと見せて\nあげるからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1310, 3, 2, 1, 0, 103401, 1, 0, "ねえ、一緒に買い物に\n行かない？　その…\nの、飲み物とか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1311, 4, 2, 1, 0, 103401, 1, 0, "ひっく、うふふ…\nもっとお姉さんと\nお話しようよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1312, 101, 2, 4, 0, 103401, 1, 0, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1313, 102, 2, 8, 0, 103401, 1, 0, "いつか…\nキミと一緒に飲めたら\n楽しいだろうな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1314, 1, 2, 1, 0, 103401, 1, 1, "おはよう…朝は\nちょっとつらいな…\n低血圧なのよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1315, 2, 2, 1, 0, 103401, 1, 2, "おっひるー♪\nなに食べよっかな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1316, 3, 2, 1, 0, 103401, 1, 3, "ふわあ…\n眠る前にちょっと\n一杯…冗談よ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1317, 1, 3, 1, 0, 103401, 1, 0, "うう…\n髪がボサボサ…\nちゃんとしなきゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1318, 2, 3, 1, 0, 103401, 1, 0, "自然体でゴロゴロ\nするのって\n幸せだなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1319, 3, 3, 1, 0, 103401, 1, 0, "こういうの男の子に\nプレゼントして\nもらいたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1320, 4, 3, 1, 0, 103401, 1, 0, "うわあ、\nこれ、私の好きな\n香りだー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1321, 5, 3, 1, 0, 103401, 1, 0, "ぽっかぽか…\nあとは熱い一杯が\nあれば…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1322, 6, 3, 1, 0, 103401, 1, 0, "家でゴロゴロして\n付いちゃったお肉を\n落とさないと…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1323, 7, 3, 1, 0, 103401, 1, 0, "もぐもぐ…\nおーいしー！\n…太らないよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1324, 8, 3, 1, 0, 103401, 1, 0, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1326, 1, 1, 1, 0, 103402, 1, 0, "仕事終わりの一杯の\nために、今日も\n頑張らないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1327, 2, 1, 1, 0, 103402, 1, 0, "今日は\nのんびり\n過ごそうかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1328, 3, 1, 1, 0, 103402, 1, 0, "あ…\nお皿、洗って\nなかった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1329, 4, 1, 1, 0, 103402, 1, 0, "もう少し、大人の\n魅力が出せるように\nなりたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1330, 5, 1, 1, 0, 103402, 1, 0, "素敵な彼氏…\n欲しいなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1331, 101, 1, 8, 0, 103402, 1, 0, "彼と私\n釣り合うかな…\n大丈夫よね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1332, 102, 1, 8, 0, 103402, 1, 0, "今後のために\nちょっとは花嫁修業\nしてみようかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1333, 1, 2, 1, 0, 103402, 1, 0, "何事も\nお姉さんと一緒に\n楽しく頑張りましょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1334, 2, 2, 1, 0, 103402, 1, 0, "ね、ねえ！\nキミは年上と年下\nどっちが好きかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1335, 3, 2, 1, 0, 103402, 1, 0, "もう…\n構ってくれないと\n泣いちゃうぞ～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1336, 4, 2, 1, 0, 103402, 1, 0, "お姉さんが～\n可愛がって\nあげようか～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1337, 101, 2, 8, 0, 103402, 1, 0, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1338, 102, 2, 8, 0, 103402, 1, 0, "お姉さんとチュー\nする？　ふふふ～\n冗談で～す！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1339, 1, 2, 1, 0, 103402, 1, 1, "さーて、今日も\nいっちょやるぞー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1340, 2, 2, 1, 0, 103402, 1, 2, "後でのんびり\nストレッチでも\nしようっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1341, 3, 2, 1, 0, 103402, 1, 3, "一日よく働いた～！\n自分にごほうび\nあげたいなー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1342, 1, 3, 1, 0, 103402, 1, 0, "仕事の前に、髪とか\n整えないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1343, 2, 3, 1, 0, 103402, 1, 0, "自然体でゴロゴロ\nするのって\n幸せだなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1344, 3, 3, 1, 0, 103402, 1, 0, "もう大人だし…\nあんまり可愛いのは\n似合わないかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1345, 4, 3, 1, 0, 103402, 1, 0, "うわあ\nこれ、私の好きな\n香りだー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1346, 5, 3, 1, 0, 103402, 1, 0, "あったかーい…\nだ、だらけ\nちゃいそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1347, 6, 3, 1, 0, 103402, 1, 0, "地道な努力が\nリア充への\n第一歩！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1348, 7, 3, 1, 0, 103402, 1, 0, "おーいしっ♪\nこのために\n生きてるわねえ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1349, 8, 3, 1, 0, 103402, 1, 0, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1351, 1, 1, 1, 0, 103801, 1, 0, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1352, 2, 1, 1, 0, 103801, 1, 0, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1353, 3, 1, 1, 0, 103801, 1, 0, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1354, 4, 1, 1, 0, 103801, 1, 0, "ちょっと、休憩…\n本でも読もうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1355, 5, 1, 1, 0, 103801, 1, 0, "もっとたくさんの本に\n囲まれて生活したいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1356, 101, 1, 4, 0, 103801, 1, 0, "むかしむかしある所に\nシオリと\nあの人が…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1357, 102, 1, 8, 0, 103801, 1, 0, "この本の主人公、\nあの人に\n似ているかも…\nかっこいいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1358, 1, 2, 1, 0, 103801, 1, 0, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1359, 2, 2, 1, 0, 103801, 1, 0, "あ…お姉ちゃんと\n約束があったんだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1360, 3, 2, 1, 0, 103801, 1, 0, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1361, 4, 2, 1, 0, 103801, 1, 0, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1362, 101, 2, 4, 0, 103801, 1, 0, "読みたい本も\nあなたと行きたい所も\n増えるばっかりです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1363, 102, 2, 8, 0, 103801, 1, 0, "私の病気、\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1364, 1, 2, 1, 0, 103801, 1, 1, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1365, 2, 2, 1, 0, 103801, 1, 2, "ふぅ…午前中\n動いたので体力が…\nすこし休みますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1366, 3, 2, 1, 0, 103801, 1, 3, "早く寝ないと\n体に良くないですよね\nでも気になっている\n本があって…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1367, 1, 3, 1, 0, 103801, 1, 0, "寝てばかりなので、\n髪が乱れてないかな\n…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1368, 2, 3, 1, 0, 103801, 1, 0, "少し休もう\n…やっぱり\nたくさん休もう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1369, 3, 3, 1, 0, 103801, 1, 0, "かわいいものが\n枕元にあると\n安心できるんですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1370, 4, 3, 1, 0, 103801, 1, 0, "いい香り…\n病は気からと言うので\n雰囲気も大事ですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1371, 5, 3, 1, 0, 103801, 1, 0, "こうして温まって\nいると、病気も\n治る気がします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1372, 6, 3, 1, 0, 103801, 1, 0, "運動…イメージ\nトレーニングだけじゃ\nだめでしょうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1373, 7, 3, 1, 0, 103801, 1, 0, "少食ですけど\nこれならたくさん\n食べられそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1374, 8, 3, 1, 0, 103801, 1, 0, "続きが気になって\n読むのを止める\nタイミングが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1376, 1, 1, 1, 0, 103802, 1, 0, "しっかり休まないと\n早く回復するように");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1377, 2, 1, 1, 0, 103802, 1, 0, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1378, 3, 1, 1, 0, 103802, 1, 0, "病室よりも…\nずっとこの部屋に\nいたいですね…　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1379, 4, 1, 1, 0, 103802, 1, 0, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1380, 5, 1, 1, 0, 103802, 1, 0, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1381, 101, 1, 8, 0, 103802, 1, 0, "むかしむかしある所に\nシオリと\nあの人が…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1382, 102, 1, 8, 0, 103802, 1, 0, "あの人の\nためにも早く\n病気を治さないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1383, 1, 2, 1, 0, 103802, 1, 0, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1384, 2, 2, 1, 0, 103802, 1, 0, "新記録です！\n一週間連続、\n平熱を保ちました！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1385, 3, 2, 1, 0, 103802, 1, 0, "あ…お薬の時間…\n苦いけど我慢しなきゃ　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1386, 4, 2, 1, 0, 103802, 1, 0, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1387, 101, 2, 8, 0, 103802, 1, 0, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1388, 102, 2, 8, 0, 103802, 1, 0, "私の病気\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1389, 1, 2, 1, 0, 103802, 1, 1, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1390, 2, 2, 1, 0, 103802, 1, 2, "…お昼の薬？\nあ、飲み忘れてました\nありがとうございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1391, 3, 2, 1, 0, 103802, 1, 3, "この薬を飲むと\n眠くなっちゃうんです\nでもまだ、あなたと\nお話したいし～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1392, 1, 3, 1, 0, 103802, 1, 0, "寝てばかりなので、\n髪が乱れてないかな\n…？　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1393, 2, 3, 1, 0, 103802, 1, 0, "少し休もう\n…やっぱり\nたくさん休もう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1394, 3, 3, 1, 0, 103802, 1, 0, "この子がいれば\n病室に一人でも\n寂しくないですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1395, 4, 3, 1, 0, 103802, 1, 0, "いろんな効能が？\n健康になる香りも\nあるのでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1396, 5, 3, 1, 0, 103802, 1, 0, "こうして温まって\nいると、病気も\n治る気がします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1397, 6, 3, 1, 0, 103802, 1, 0, "私も、少しは\n体力をつけないと\nいけませんよね　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1398, 7, 3, 1, 0, 103802, 1, 0, "いっぱい食べて\n健康な体にならないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1399, 8, 3, 1, 0, 103802, 1, 0, "続きが気になって\n読むのを止める\nタイミングが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1401, 1, 1, 1, 0, 104001, 1, 0, "友達ができたら、\n山の上でお弁当…\n夢が広がります…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1402, 2, 1, 1, 0, 104001, 1, 0, "あ、忘れずに\nお花に水を\nあげなきゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1403, 3, 1, 1, 0, 104001, 1, 0, "お菓子を作って、\nみなさんに振る舞って\n友達作戦！　とか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1404, 4, 1, 1, 0, 104001, 1, 0, "そろそろ新しい\n草人形を作って\n友達作りの特訓を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1405, 5, 1, 1, 0, 104001, 1, 0, "植物のお世話って、\nぼっちにとっては、\n救い…なんです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1406, 101, 1, 4, 0, 104001, 1, 0, "ＢＢ団の活動日…\nまだかな…\nうふふふっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1407, 102, 1, 8, 0, 104001, 1, 0, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1408, 1, 2, 1, 0, 104001, 1, 0, "あ、こんにちは！\n今日もＢＢ団で\nお世話になります！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1409, 2, 2, 1, 0, 104001, 1, 0, "あの…私の友達作りの\n練習方法、間違って\nませんよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1410, 3, 2, 1, 0, 104001, 1, 0, "そうだ、今度、\n森に一緒に木の苗を\n植えに行きませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1411, 4, 2, 1, 0, 104001, 1, 0, "人とお話するのって、\n私、大好きです！\n友達ふやすぞ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1412, 101, 2, 4, 0, 104001, 1, 0, "あなたと話してると、\nまるで私がぼっちじゃ\nないみたいです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1413, 102, 2, 8, 0, 104001, 1, 0, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1414, 1, 2, 1, 0, 104001, 1, 1, "おはようございます！\n今日もＢＢ団、\nがんばるぞー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1415, 2, 2, 1, 0, 104001, 1, 2, "なんだか、お腹が\n空いてきました。\nお昼ごはんー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1416, 3, 2, 1, 0, 104001, 1, 3, "もう眠いかもです…\n明日は友達、\nできるといいなあ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1417, 1, 3, 1, 0, 104001, 1, 0, "私がもっと\n可愛ければ、\n友達できるかなあ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1418, 2, 3, 1, 0, 104001, 1, 0, "ふわあ…のんびり\nしすぎないように\n気を付けなきゃです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1419, 3, 3, 1, 0, 104001, 1, 0, "かわいいなあ。\nこの子とも\n友達になりたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1420, 4, 3, 1, 0, 104001, 1, 0, "いい香りです…\n精神統一して\n友達のイメトレ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1421, 5, 3, 1, 0, 104001, 1, 0, "灯りを見てると、\n心がなごみます～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1422, 6, 3, 1, 0, 104001, 1, 0, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1423, 7, 3, 1, 0, 104001, 1, 0, "おいしいです…\n私に友達がいたら、\n分けてあげたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1424, 8, 3, 1, 0, 104001, 1, 0, "友達作りの\n参考になりそうなこと\n書いてないかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1426, 1, 1, 1, 0, 104002, 1, 0, "友達作りは、焦らず\n慌てず、じっくりと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1427, 2, 1, 1, 0, 104002, 1, 0, "ひとつ屋根の下\nって感じ…\nいいですねえ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1428, 3, 1, 1, 0, 104002, 1, 0, "煮汁、煮汁が\n噴きこぼれて\nいませんか～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1429, 4, 1, 1, 0, 104002, 1, 0, "今度、みなさんと\nピクニックとか…\nいってみたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1430, 5, 1, 1, 0, 104002, 1, 0, "ぼっちでもいい\nたくましく育てば\n…なんて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1431, 101, 1, 8, 0, 104002, 1, 0, "最近、毎日あの人の\nこと考えちゃいます\nどうしてだろう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1432, 102, 1, 8, 0, 104002, 1, 0, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1433, 1, 2, 1, 0, 104002, 1, 0, "あ！　ＢＢ団の活動\nですか？　嬉しくて\n飛び跳ねちゃいます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1434, 2, 2, 1, 0, 104002, 1, 0, "あなたとのお話で友達\n作りの練習になるなら\n一石二鳥です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1435, 3, 2, 1, 0, 104002, 1, 0, "私少しは人と話しても\nテンパらなくなって\nきましたかね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1436, 4, 2, 1, 0, 104002, 1, 0, "あの、友達作りの\n新しい作戦\n考えてみたんですっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1437, 101, 2, 8, 0, 104002, 1, 0, "あなたとお話する時の\nこの気持ち、私の宝物\nなんです…えへへ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1438, 102, 2, 8, 0, 104002, 1, 0, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1439, 1, 2, 1, 0, 104002, 1, 1, "朝ですね！\nこんないい朝は\n友達作りのチャンス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1440, 2, 2, 1, 0, 104002, 1, 2, "あの…そろそろお腹\nすきませんか？\nお昼ごはんは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1441, 3, 2, 1, 0, 104002, 1, 3, "もう眠いかもです…\n明日は友達\nできるといいなあ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1442, 1, 3, 1, 0, 104002, 1, 0, "私…見た目\nそこまで変じゃ\nないですよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1443, 2, 3, 1, 0, 104002, 1, 0, "ほわあ～…\nふかふかって\nいいものですね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1444, 3, 3, 1, 0, 104002, 1, 0, "この子みたいな\nあいくるしさを\n目指したいです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1445, 4, 3, 1, 0, 104002, 1, 0, "灯りを見てると\n心がなごみます～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1446, 5, 3, 1, 0, 104002, 1, 0, "ぬくぬくで、なんだか\n眠くなっちゃいますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1447, 6, 3, 1, 0, 104002, 1, 0, "身体を鍛えて\nみなさんを\n守ります！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1448, 7, 3, 1, 0, 104002, 1, 0, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1449, 8, 3, 1, 0, 104002, 1, 0, "友達作りの\n参考になりそうなこと\n書いてないかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1451, 1, 1, 1, 0, 104201, 1, 0, "唱喚の歌は、みだりに\n歌っていいものでは\nないんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1452, 2, 1, 1, 0, 104201, 1, 0, "ここでアイドルの\n練習は、さすがに\n迷惑ですよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1453, 3, 1, 1, 0, 104201, 1, 0, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1454, 4, 1, 1, 0, 104201, 1, 0, "人々の平和を守る旅に\n同行してくれる人を\n探していて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1455, 5, 1, 1, 0, 104201, 1, 0, "あとで曲を復習して\nおかないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1456, 101, 1, 4, 0, 104201, 1, 0, "踊りを見られるのは\nまだ恥ずかしいけど\nあの人になら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1457, 102, 1, 8, 0, 104201, 1, 0, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1458, 1, 2, 1, 0, 104201, 1, 0, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1459, 2, 2, 1, 0, 104201, 1, 0, "え、もう練習の時間？\nごめんなさい\nすぐ準備します！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1460, 3, 2, 1, 0, 104201, 1, 0, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1461, 4, 2, 1, 0, 104201, 1, 0, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1462, 101, 2, 4, 0, 104201, 1, 0, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1463, 102, 2, 8, 0, 104201, 1, 0, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1464, 1, 2, 1, 0, 104201, 1, 1, "おはようございます♪\n少し歌の練習を\nしてきますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1465, 2, 2, 1, 0, 104201, 1, 2, "もうお昼なんですか？\n練習に夢中で\n気づきませんでした");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1466, 3, 2, 1, 0, 104201, 1, 3, "明日の予定は…\nアイドルはやることが\n多いみたいで…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1467, 1, 3, 1, 0, 104201, 1, 0, "見た目については\n前よりも気をつけてと\nノゾミに言われてます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1468, 2, 3, 1, 0, 104201, 1, 0, "歌の調子をよくする\nためには休息も\n必要ですよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1469, 3, 3, 1, 0, 104201, 1, 0, "この子たちを\n相手に練習して\nみようかな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1470, 4, 3, 1, 0, 104201, 1, 0, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1471, 5, 3, 1, 0, 104201, 1, 0, "ここにいると\n穏やかな旋律が\n浮かんできます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1472, 6, 3, 1, 0, 104201, 1, 0, "歌うためには\n体力づくりは\n欠かせません");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1473, 7, 3, 1, 0, 104201, 1, 0, "歌った後は\nお腹が空いて\nしまうんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1474, 8, 3, 1, 0, 104201, 1, 0, "音楽について\n理論も勉強\nしないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1476, 1, 1, 1, 0, 104202, 1, 0, "歌うことの楽しさ\n分かってきました\nもっと歌いたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1477, 2, 1, 1, 0, 104202, 1, 0, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1478, 3, 1, 1, 0, 104202, 1, 0, "精霊も強くなったし\nもっとたくさんの人を\n守りたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1479, 4, 1, 1, 0, 104202, 1, 0, "最近、よく頭の中に\n歌が浮かんできます\n不思議な感覚…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1480, 5, 1, 1, 0, 104202, 1, 0, "楽譜を買いました\n思いついた歌を\n書き留めておくために");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1481, 101, 1, 8, 0, 104202, 1, 0, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1482, 102, 1, 8, 0, 104202, 1, 0, "私の中にある\n私だけの歌…\n作ってみようかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1483, 1, 2, 1, 0, 104202, 1, 0, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1484, 2, 2, 1, 0, 104202, 1, 0, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1485, 3, 2, 1, 0, 104202, 1, 0, "魔物退治ですか！？\n…違います？\n良かった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1486, 4, 2, 1, 0, 104202, 1, 0, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1487, 101, 2, 8, 0, 104202, 1, 0, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1488, 102, 2, 8, 0, 104202, 1, 0, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1489, 1, 2, 1, 0, 104202, 1, 1, "呼吸を深く、大きく…\nこれでちゃんと\n目が覚めますよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1490, 2, 2, 1, 0, 104202, 1, 2, "少し休んだら\n午後の練習に\n行ってきますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1491, 3, 2, 1, 0, 104202, 1, 3, "曲を作っていたら\nもうこんな時間…\nおやすみなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1492, 1, 3, 1, 0, 104202, 1, 0, "見た目については\n前よりも気をつけてと\nノゾミに言われてます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1493, 2, 3, 1, 0, 104202, 1, 0, "あ～…♪\nよく体がほぐれます…\nいい歌が歌えそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1494, 3, 3, 1, 0, 104202, 1, 0, "かわいいと思う\n気持ちを、歌にしても\nいいかも知れませんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1495, 4, 3, 1, 0, 104202, 1, 0, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1496, 5, 3, 1, 0, 104202, 1, 0, "ここにいると\n穏やかな旋律が\n浮かんできます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1497, 6, 3, 1, 0, 104202, 1, 0, "もっと体力をつけて\n最高のライブを\nファンに届けます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1498, 7, 3, 1, 0, 104202, 1, 0, "これでも一応\n体形には気をつけて\n食べてるんですよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1499, 8, 3, 1, 0, 104202, 1, 0, "読書は歌に\n新しい風を\n吹き込んでくれます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1501, 1, 1, 1, 0, 104301, 1, 0, "店の新メニューでも\n考えるかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1502, 2, 1, 1, 0, 104301, 1, 0, "あたしの店から、\n出前を届けようか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1503, 3, 1, 1, 0, 104301, 1, 0, "パトロール、\nパトロール…\nここは異常なしかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1504, 4, 1, 1, 0, 104301, 1, 0, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1505, 5, 1, 1, 0, 104301, 1, 0, "のんびりし過ぎるのも\n…性に合わねぇな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1506, 101, 1, 4, 0, 104301, 1, 0, "そろそろあいつ、\n腹すかしてるん\nじゃないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1507, 102, 1, 8, 0, 104301, 1, 0, "今日の献立は…\nあいつの好きなものに\nしてやるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1508, 1, 2, 1, 0, 104301, 1, 0, "強くなりたいなら、\nあたしがビシバシ\n鍛えてやるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1509, 2, 2, 1, 0, 104301, 1, 0, "天気がいい日は\n外で運動したく\nならねぇか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1510, 3, 2, 1, 0, 104301, 1, 0, "腹減ったか？　なんか\n作ってやろうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1511, 4, 2, 1, 0, 104301, 1, 0, "ん？　なんだよ、\n相談事か？\nなんでも言ってくれ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1512, 101, 2, 4, 0, 104301, 1, 0, "お前が好きな飯って\nなんだ？\n今度、作ってやるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1513, 102, 2, 8, 0, 104301, 1, 0, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1514, 1, 2, 1, 0, 104301, 1, 1, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1515, 2, 2, 1, 0, 104301, 1, 2, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1516, 3, 2, 1, 0, 104301, 1, 3, "日中たっぷり動いたら\nそのぶん夜はしっかり\n休んどけよな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1517, 1, 3, 1, 0, 104301, 1, 0, "た、たまにはその…\nかわいい格好とか\nしても…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1518, 2, 3, 1, 0, 104301, 1, 0, "ふわぁ、\n一休みすっかなぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1519, 3, 3, 1, 0, 104301, 1, 0, "うっ！　か、かわいい\nじゃねぇか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1520, 4, 3, 1, 0, 104301, 1, 0, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1521, 5, 3, 1, 0, 104301, 1, 0, "ふわぁ〜！\n温かいと、つい\nウトウトしちまうな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1522, 6, 3, 1, 0, 104301, 1, 0, "オラオラオラーーー！\n燃えるぜーーー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1523, 7, 3, 1, 0, 104301, 1, 0, "いい味してるぜ！\nうちの店でも\n出してみたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1524, 8, 3, 1, 0, 104301, 1, 0, "文字を読んでると\nどうしても眠く\nなっちまうんだよなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1526, 1, 1, 1, 0, 104302, 1, 0, "パトロール終了～\n本日も異常なしっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1527, 2, 1, 1, 0, 104302, 1, 0, "あたしの店から\n出前を届けようか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1528, 3, 1, 1, 0, 104302, 1, 0, "あいつ、早く\n帰ってこないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1529, 4, 1, 1, 0, 104302, 1, 0, "あいつ\n腹すかせてないと\nいいんだけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1530, 5, 1, 1, 0, 104302, 1, 0, "のんびりし過ぎるのも\n…性に合わねぇな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1531, 101, 1, 8, 0, 104302, 1, 0, "あいつの事を思うと\n胸があったかくなる？\nなんだコレ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1532, 102, 1, 8, 0, 104302, 1, 0, "今日の献立は…\nあいつの好きなものに\nしてやるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1533, 1, 2, 1, 0, 104302, 1, 0, "ん？　なんだよ\n相談事か？\nなんでも言ってくれ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1534, 2, 2, 1, 0, 104302, 1, 0, "天気がいい日は\n外で運動したく\nならねぇか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1535, 3, 2, 1, 0, 104302, 1, 0, "腹減ったか？　なんか\n作ってやろうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1536, 4, 2, 1, 0, 104302, 1, 0, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1537, 101, 2, 8, 0, 104302, 1, 0, "あのさ…できれば\nもっとそばに…いや\nなんでもねぇ忘れろ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1538, 102, 2, 8, 0, 104302, 1, 0, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1539, 1, 2, 1, 0, 104302, 1, 1, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1540, 2, 2, 1, 0, 104302, 1, 2, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1541, 3, 2, 1, 0, 104302, 1, 3, "あんま夜更しすんなよ\n明日に響いたら\n大変だろ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1542, 1, 3, 1, 0, 104302, 1, 0, "た、たまにはその…\nかわいい格好とか\nしても…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1543, 2, 3, 1, 0, 104302, 1, 0, "ふぅ～♪\n疲れがとれるな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1544, 3, 3, 1, 0, 104302, 1, 0, "うっ！　か、かわいい\nじゃねぇか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1545, 4, 3, 1, 0, 104302, 1, 0, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1546, 5, 3, 1, 0, 104302, 1, 0, "ふわぁ～！\n温かいと、つい\nウトウトしちまうな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1547, 6, 3, 1, 0, 104302, 1, 0, "オラオラオラーーー！\n燃えるぜーーー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1548, 7, 3, 1, 0, 104302, 1, 0, "いい味してるぜ！\nうちの店でも\n出してみたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1549, 8, 3, 1, 0, 104302, 1, 0, "料理だけじゃなく\n経営術とかも\n学んどかねぇと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1551, 1, 1, 1, 0, 104501, 1, 0, "最近なにも\nしてくれません…\n焦らしてるんですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1552, 2, 1, 1, 0, 104501, 1, 0, "ぐふふ、じゅるり…\nい、いけない、また\nいつの間にかよだれが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1553, 3, 1, 1, 0, 104501, 1, 0, "好きな武器といえば\n剣より槍より\nやっぱり鞭…ぐふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1554, 4, 1, 1, 0, 104501, 1, 0, "「無数の触手が\nクウカの柔肌に\n食い込み」…ぐふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1555, 5, 1, 1, 0, 104501, 1, 0, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1556, 101, 1, 4, 0, 104501, 1, 0, "ドＳさんを登場\nさせるだけで、妄想に\n無限の広がりが！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1557, 102, 1, 8, 0, 104501, 1, 0, "あっ…\nジロジロ見てたの\n気づいちゃいました？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1558, 1, 2, 1, 0, 104501, 1, 0, "視線を感じると\n思ったら…やはり\nドＳさんでしたか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1559, 2, 2, 1, 0, 104501, 1, 0, "今日は\nどんなヒドイことを\nしてくれるんですか？\nぐふふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1560, 3, 2, 1, 0, 104501, 1, 0, "いつの間にそこに！？\nまさかクウカを監視\nしていたのですか！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1561, 4, 2, 1, 0, 104501, 1, 0, "クウカに触るつもり\nですか？　触るつもり\nなのですねっ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1562, 101, 2, 4, 0, 104501, 1, 0, "クウカにナニをする\nつもりですか…\n期待してしまいます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1563, 102, 2, 8, 0, 104501, 1, 0, "ドＳさんの視界に入る\nだけでドキドキが…\nこれが恋！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1564, 1, 2, 1, 0, 104501, 1, 1, "おはようございます。\n朝からお盛んですね？\nぐふふ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1565, 2, 2, 1, 0, 104501, 1, 2, "こんなにも日の高い\nうちからドＳさんは…\nじゅるり");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1566, 3, 2, 1, 0, 104501, 1, 3, "夜はこれから、\nですよ…\nぐふ、ぐふふふ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1567, 1, 3, 1, 0, 104501, 1, 0, "キレイにおめかし\nしたのに力ずくで…\nぐふふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1568, 2, 3, 1, 0, 104501, 1, 0, "ソファの背にクウカを\n押し付けて…ぐふふ\nいいですね\nソファドン");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1569, 3, 3, 1, 0, 104501, 1, 0, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1570, 4, 3, 1, 0, 104501, 1, 0, "香りを吸ったクウカの\n頬は紅潮し目はうるみ\nもはや抗う力も…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1571, 5, 3, 1, 0, 104501, 1, 0, "ああ、身体が\n火照って…\nぐふ、ぐふふ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1572, 6, 3, 1, 0, 104501, 1, 0, "はぁ、はぁ、こうして\nクウカの体力を\n奪ってから…ぐふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1573, 7, 3, 1, 0, 104501, 1, 0, "食欲が満たされたら\nつ、次はやはり…！\nそうなのですね！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1574, 8, 3, 1, 0, 104501, 1, 0, "この本の下に、\nそういう本を\nカムフラージュ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1576, 1, 1, 1, 0, 104502, 1, 0, "「ドＳさんと踊り子\n乱舞の一夜」…\n次の日記はこれで…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1577, 2, 1, 1, 0, 104502, 1, 0, "最近なにも\nしてくれません…\n焦らしてるんですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1578, 3, 1, 1, 0, 104502, 1, 0, "も、妄想が\n足りません…\n禁断症状がっ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1579, 4, 1, 1, 0, 104502, 1, 0, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1580, 5, 1, 1, 0, 104502, 1, 0, "次はどんなドＳを\nされるのか、想像する\nだけで…ぐふふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1581, 101, 1, 8, 0, 104502, 1, 0, "じっとしてると\nドＳさんのことばかり\n考えてしまいますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1582, 102, 1, 8, 0, 104502, 1, 0, "妄想が止まらなくて\nクウカどうにかなって\nしまいそうです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1583, 1, 2, 1, 0, 104502, 1, 0, "ドＳさんといると体が\n火照って…クウカは\nいやらしい子です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1584, 2, 2, 1, 0, 104502, 1, 0, "あっ…\nジロジロ見てたの\n気づいちゃいました？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1585, 3, 2, 1, 0, 104502, 1, 0, "ドＳさんのおかげで\n新しい扉が開けそう\nです…じゅるり");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1586, 4, 2, 1, 0, 104502, 1, 0, "いやー！　ドＳさんに\n襲われ…襲って\nくれないんですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1587, 101, 2, 8, 0, 104502, 1, 0, "クウカはドＳさんに\n身も心も堕とされて\nしまったのですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1588, 102, 2, 8, 0, 104502, 1, 0, "ドＳさんがお望みなら\nクウカは\nどんなことだって！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1589, 1, 2, 1, 0, 104502, 1, 1, "朝だからこそ\nできる妄想が\nあります…ぐふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1590, 2, 2, 1, 0, 104502, 1, 2, "こんな日の高いうち\nからドＳさんは…\nじゅるり");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1591, 3, 2, 1, 0, 104502, 1, 3, "今夜は一晩中…\nなんですね？\nぐふふ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1592, 1, 3, 1, 0, 104502, 1, 0, "意外と難しいんですよ\n正しい亀甲縛りと\nいうものは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1593, 2, 3, 1, 0, 104502, 1, 0, "くつろいで油断\nしているスキに何を\nされるのでしょう！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1594, 3, 3, 1, 0, 104502, 1, 0, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1595, 4, 3, 1, 0, 104502, 1, 0, "これは禁断の香り…\nああっ一段階上の\n妄想が開花するうぅ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1596, 5, 3, 1, 0, 104502, 1, 0, "ああっ、暖気がまるで\nロウソクのように\nクウカを攻めますっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1597, 6, 3, 1, 0, 104502, 1, 0, "激しい攻めを受けきる\nためには、鍛えないと\nいけないのですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1598, 7, 3, 1, 0, 104502, 1, 0, "こんなにいっぱい\n入りません…\nお腹にっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1599, 8, 3, 1, 0, 104502, 1, 0, "どんな本も\nよく見ると\nいやらしいです…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1601, 1, 1, 1, 0, 104601, 1, 0, "この前遊んだ猫、\nモッフモフ\nだったにゃあ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1602, 2, 1, 1, 0, 104601, 1, 0, "ほっぺやお腹が、\n肉球ぐらいぷにぷに…\nこれはまずいにゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1603, 3, 1, 1, 0, 104601, 1, 0, "大きな仕事が\n決まったにゃ！\n腕が鳴るにゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1604, 4, 1, 1, 0, 104601, 1, 0, "おやつのたい焼き、\nつぶあんとこしあん、\nどっちに\nしようかにゃ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1605, 5, 1, 1, 0, 104601, 1, 0, "うにゃー…\nもうちょっとお昼寝\nしたかったにゃ…\nむにゃむにゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1606, 101, 1, 4, 0, 104601, 1, 0, "キミに呼ばれると、\n猫まっしぐらな気分に\nなっちゃうにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1607, 102, 1, 8, 0, 104601, 1, 0, "キミのおかげで\nギルドの仕事も\n大成功だにゃ♪\nありがとにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1608, 1, 2, 1, 0, 104601, 1, 0, "うずうず…その指、\nじゃれついても\nいいかにゃ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1609, 2, 2, 1, 0, 104601, 1, 0, "にゃ？　あたしに何か\nご入り用かにゃ？\nお安くしとくにゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1610, 3, 2, 1, 0, 104601, 1, 0, "うーん、なんだか\n退屈にゃ～\n遊んで、遊んで～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1611, 4, 2, 1, 0, 104601, 1, 0, "素早い動きのコツ？\nタダじゃ教えて\nあげられないにゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1612, 101, 2, 4, 0, 104601, 1, 0, "そんなにあたしを\nなでたいにゃ？\nキミならなでさせて\nあげてもいいかにゃー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1613, 102, 2, 8, 0, 104601, 1, 0, "ふにゃあ、ねえねえ、\n一緒にゴロゴロ\nしようにゃあ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1614, 1, 2, 1, 0, 104601, 1, 1, "いい朝にゃ！\n顔を洗ってくるにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1615, 2, 2, 1, 0, 104601, 1, 2, "むーん、そろそろ\nお昼…猫たちにも\n猫缶を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1616, 3, 2, 1, 0, 104601, 1, 3, "ふわあ…眠いにゃ…\n猫は布団で\n丸くなるにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1617, 1, 3, 1, 0, 104601, 1, 0, "客商売では、\n外見のチェックも\n欠かせないのにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1618, 2, 3, 1, 0, 104601, 1, 0, "うにゃ～！\nお昼寝に\nぴったりにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1619, 3, 3, 1, 0, 104601, 1, 0, "これ…量産したら\n子どもにバカ売れ\nしそうだにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1620, 4, 3, 1, 0, 104601, 1, 0, "この灯り、まるで\n猫みたいな\n癒し効果にゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1621, 5, 3, 1, 0, 104601, 1, 0, "ふにゃあ、\nあったかいと猫は丸く\nなっちゃうのにゃあ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1622, 6, 3, 1, 0, 104601, 1, 0, "本当は外で\n運動したいん\nだけどにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1623, 7, 3, 1, 0, 104601, 1, 0, "むーん、\n美味しいにゃー！\nたい焼きに\n匹敵するにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1624, 8, 3, 1, 0, 104601, 1, 0, "ふむふむ…猫の\nしつけ方は、と…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1626, 1, 1, 1, 0, 104602, 1, 0, "かわいいネコの置物を\nゲットしたにゃ！\nどこに飾ろうか\nにゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1627, 2, 1, 1, 0, 104602, 1, 0, "仕事の交渉がうまく\n行ったにゃ～♪\nいい気分だにゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1628, 3, 1, 1, 0, 104602, 1, 0, "ねこじゃらしには\n食いついちゃうにゃ\nびしっ！　びしっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1629, 4, 1, 1, 0, 104602, 1, 0, "ほっぺやお腹が、肉球\nぐらいぷにぷに…\nこれはまずいにゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1630, 5, 1, 1, 0, 104602, 1, 0, "さっきのたいやき\nおいしかったにゃ♪\nごろごろごろ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1631, 101, 1, 8, 0, 104602, 1, 0, "手作りのたい焼き\nあいつは食べて\nくれるかにゃ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1632, 102, 1, 8, 0, 104602, 1, 0, "あいつには、いつか\nたっぷり恩返しが\nしたいにゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1633, 1, 2, 1, 0, 104602, 1, 0, "にゃーに？　あたしの\nことがそんなに気に\nなるのかにゃ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1634, 2, 2, 1, 0, 104602, 1, 0, "あたしのこと…\nしっかり捕まえ\nといてにゃ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1635, 3, 2, 1, 0, 104602, 1, 0, "あたしの力が\n必要かにゃ？　猫の手\n貸してあげるにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1636, 4, 2, 1, 0, 104602, 1, 0, "たいやきとクレープを\n合わせれば…\n新しい商売のニオイが\nするにゃ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1637, 101, 2, 8, 0, 104602, 1, 0, "ふにゃあ、ねえねえ\n一緒にゴロゴロ\nしようにゃあ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1638, 102, 2, 8, 0, 104602, 1, 0, "キミと一緒にいると\n楽しくなってつい\nじゃれちゃうにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1639, 1, 2, 1, 0, 104602, 1, 1, "いい朝にゃ！\n顔を洗ってくるにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1640, 2, 2, 1, 0, 104602, 1, 2, "そろそろおっひる～\nにゃーんか\n食べたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1641, 3, 2, 1, 0, 104602, 1, 3, "うーん、眠くなって\nきたにゃ。あたしは\n夜行性じゃないのにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1642, 1, 3, 1, 0, 104602, 1, 0, "にゃにゃ…\n髪が乱れてるにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1643, 2, 3, 1, 0, 104602, 1, 0, "ふっかふかにゃ～\n猫がねころん\nじゃうにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1644, 3, 3, 1, 0, 104602, 1, 0, "これ、猫と匹敵する\nぐらいかわいいにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1645, 4, 3, 1, 0, 104602, 1, 0, "猫でもこわくない\n優しい灯りにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1646, 5, 3, 1, 0, 104602, 1, 0, "ぽっかぽか\nしあわせな気分にゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1647, 6, 3, 1, 0, 104602, 1, 0, "雨の日でも運動\nできるのは、濡れ\nなくて便利だにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1648, 7, 3, 1, 0, 104602, 1, 0, "美味しいにゃ～！\nこれ、朝昼晩\n食べたいにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1649, 8, 3, 1, 0, 104602, 1, 0, "本を読んで\n猫の気持ちを\n勉強するのにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1651, 1, 1, 1, 0, 104801, 1, 0, "内職手伝える人\nいないかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1652, 2, 1, 1, 0, 104801, 1, 0, "次の依頼は、\nこういう計画で…\nうん、完璧ね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1653, 3, 1, 1, 0, 104801, 1, 0, "次の特売セールに\n向けて、しっかり\n準備しないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1654, 4, 1, 1, 0, 104801, 1, 0, "配達の後に売り子\n次に採取のバイト…\nうん、効率的ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1655, 5, 1, 1, 0, 104801, 1, 0, "一日に受ける\nバイトの数、もう少し\n増やしたいわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1656, 101, 1, 4, 0, 104801, 1, 0, "師匠として\n頼りにされたいし\nもっと頑張らなきゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1657, 102, 1, 8, 0, 104801, 1, 0, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1658, 1, 2, 1, 0, 104801, 1, 0, "あら、\nちょうどよかった\n今から一緒に\nバイトでもどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1659, 2, 2, 1, 0, 104801, 1, 0, "相談事かしら？\nそれくらいなら\n無料でいいわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1660, 3, 2, 1, 0, 104801, 1, 0, "背後の気配なら\nすぐ分かるわ\n試してみる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1661, 4, 2, 1, 0, 104801, 1, 0, "道具やお金の管理は\n大丈夫？　手伝うから\nいつでも言って");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1662, 101, 2, 4, 0, 104801, 1, 0, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1663, 102, 2, 8, 0, 104801, 1, 0, "ねえ、あの…\n私はキミにとって…\nいや、何でもないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1664, 1, 2, 1, 0, 104801, 1, 1, "おはよう！\n今日も朝から\nバイトよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1665, 2, 2, 1, 0, 104801, 1, 2, "お昼時ね。\n少し休憩したら、\nまた働くわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1666, 3, 2, 1, 0, 104801, 1, 3, "もうこんな時間！\n明日もバイトで\n朝早いのよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1667, 1, 3, 1, 0, 104801, 1, 0, "接客業の依頼が\nある時は、外見も\nキレイにしないとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1668, 2, 3, 1, 0, 104801, 1, 0, "はぁ～バイトで\n疲れたから癒される～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1669, 3, 3, 1, 0, 104801, 1, 0, "これを内職で\n作ったら\n儲かるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1670, 4, 3, 1, 0, 104801, 1, 0, "リフレッシュできたわ\nこれでまた、バリバリ\n働けるわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1671, 5, 3, 1, 0, 104801, 1, 0, "風邪を引いたら効率が\n落ちちゃうから、\n暖めないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1672, 6, 3, 1, 0, 104801, 1, 0, "働き続けるには\n健康第一！　それには\n運動が一番よ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1673, 7, 3, 1, 0, 104801, 1, 0, "もぐもぐ…\n腹が減っては\n戦ができぬ、よ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1674, 8, 3, 1, 0, 104801, 1, 0, "日々絶えず学んで、\n生活に活かすのよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1676, 1, 1, 1, 0, 104802, 1, 0, "家計簿をつけなきゃ！\n覚えている時に\nやっておかないとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1677, 2, 1, 1, 0, 104802, 1, 0, "次の依頼は\nこういう計画で…\nうん、完璧ね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1678, 3, 1, 1, 0, 104802, 1, 0, "ギルドの経費\nあとちょっとだけ\n削れそうね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1679, 4, 1, 1, 0, 104802, 1, 0, "少しでも時給のいい\nバイトがしたいけど\nなかなか\n出会えないのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1680, 5, 1, 1, 0, 104802, 1, 0, "今度のバイトも\nなかなか大変そう\nね…腕が鳴るわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1681, 101, 1, 8, 0, 104802, 1, 0, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1682, 102, 1, 8, 0, 104802, 1, 0, "私、どうしたんだろ？\n仕事中もずっと\n彼のこと考えてる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1683, 1, 2, 1, 0, 104802, 1, 0, "この間はヘルプに\n来てくれてありがとう\n頼んで正解だったわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1684, 2, 2, 1, 0, 104802, 1, 0, "見つけた！　ちょうど\n頼みたいことが\nあるんだけど、いい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1685, 3, 2, 1, 0, 104802, 1, 0, "今から\n休憩するところなの\n一緒にどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1686, 4, 2, 1, 0, 104802, 1, 0, "ん？　どうしたの？\n私のことが\n気になるの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1687, 101, 2, 8, 0, 104802, 1, 0, "…たまには甘えても\nいい？　私だって\n弱る時はあるのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1688, 102, 2, 8, 0, 104802, 1, 0, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1689, 1, 2, 1, 0, 104802, 1, 1, "おはよう！\nいい朝ね。一緒に\nランニングでもいく？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1690, 2, 2, 1, 0, 104802, 1, 2, "お昼時ね\n少し休憩したら\nまた働くわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1691, 3, 2, 1, 0, 104802, 1, 3, "もうこんな時間！\n明日もバイトで\n朝早いのよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1692, 1, 3, 1, 0, 104802, 1, 0, "女の子らしく…\nどうも忘れちゃう\nのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1693, 2, 3, 1, 0, 104802, 1, 0, "ここで少し\n休んだら\nまたバイトよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1694, 3, 3, 1, 0, 104802, 1, 0, "これを内職で\n作ったら\n儲かるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1695, 4, 3, 1, 0, 104802, 1, 0, "仕事から帰ってきて\nこういうのがあると\n素敵ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1696, 5, 3, 1, 0, 104802, 1, 0, "しっかり身体を\n温めて、血流を\nよくしなくっちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1697, 6, 3, 1, 0, 104802, 1, 0, "これで休憩中も\n無駄なく\n鍛えられるわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1698, 7, 3, 1, 0, 104802, 1, 0, "もぐもぐ…よく\n食べて、よく働く！\nそれが私のモットーよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1699, 8, 3, 1, 0, 104802, 1, 0, "日々絶えず学んで\n生活に活かすのよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1701, 1, 1, 1, 0, 104901, 1, 0, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1702, 2, 1, 1, 0, 104901, 1, 0, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1703, 3, 1, 1, 0, 104901, 1, 0, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1704, 4, 1, 1, 0, 104901, 1, 0, "くんくん、\n弟くんのにおい…\n近くにいるね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1705, 5, 1, 1, 0, 104901, 1, 0, "お姉ちゃんの痕跡を\n部屋中に\n残しちゃおっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1706, 101, 1, 4, 0, 104901, 1, 0, "この部屋を、\n私と弟くんの\n愛の巣に…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1707, 102, 1, 8, 0, 104901, 1, 0, "はぁ～…弟くん\n禁断症状だよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1708, 1, 2, 1, 0, 104901, 1, 0, "弟くんの部屋は\nお姉ちゃんの\n部屋だよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1709, 2, 2, 1, 0, 104901, 1, 0, "いいこいいこ～♪\nどう、お姉ちゃんの\nナデナデは？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1710, 3, 2, 1, 0, 104901, 1, 0, "姉と弟の外出は\nデートって\nいうのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1711, 4, 2, 1, 0, 104901, 1, 0, "もう！\nイタズラする子には\nお姉ちゃんチョップ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1712, 101, 2, 4, 0, 104901, 1, 0, "お姉ちゃんが\nぎゅ～ってして\nあげるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1713, 102, 2, 8, 0, 104901, 1, 0, "あ、あのね…\nたまにはお姉ちゃんも\n甘えていい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1714, 1, 2, 1, 0, 104901, 1, 1, "着替えは？　荷物は？\nお出かけの準備は\nお姉ちゃんが手伝うね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1715, 2, 2, 1, 0, 104901, 1, 2, "出かけるなら\n明るいうちに\n帰ってくるんだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1716, 3, 2, 1, 0, 104901, 1, 3, "まだ起きてるの？\nそれじゃあ、\nお姉ちゃんも\n夜更かししちゃお☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1717, 1, 3, 1, 0, 104901, 1, 0, "きれいなお姉ちゃん\n好きだよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1718, 2, 3, 1, 0, 104901, 1, 0, "ここにお姉ちゃんの\n匂いを、た～っぷり\n残しておこうっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1719, 3, 3, 1, 0, 104901, 1, 0, "かわいい♪\nお姉ちゃんチョップ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1720, 4, 3, 1, 0, 104901, 1, 0, "この香り、\n弟くん好きかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1721, 5, 3, 1, 0, 104901, 1, 0, "これ、弟くんみたいに\nあったかいね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1722, 6, 3, 1, 0, 104901, 1, 0, "ダイエットダイエット\nきれいなお姉ちゃんに\nならなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1723, 7, 3, 1, 0, 104901, 1, 0, "あ、これ\n弟くんが好きな\n味付けだね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1724, 8, 3, 1, 0, 104901, 1, 0, "弟くんが読んでいいか\nお姉ちゃんが先に\n中を確認しなくちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1726, 1, 1, 1, 0, 104902, 1, 0, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1727, 2, 1, 1, 0, 104902, 1, 0, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1728, 3, 1, 1, 0, 104902, 1, 0, "弟くんのお友達は\nみんな私の妹だよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1729, 4, 1, 1, 0, 104902, 1, 0, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1730, 5, 1, 1, 0, 104902, 1, 0, "はっ！\n弟くんが困ってる\n気がする！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1731, 101, 1, 8, 0, 104902, 1, 0, "はぁ～…弟くん、\n禁断症状だよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1732, 102, 1, 8, 0, 104902, 1, 0, "お姉ちゃんの痕跡を\n部屋中に\n残しちゃおっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1733, 1, 2, 1, 0, 104902, 1, 0, "お姉ちゃん\nキミのお願いなら\nなんでも聞いて\nあげちゃうぞっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1734, 2, 2, 1, 0, 104902, 1, 0, "弟くんの部屋は\nお姉ちゃんの\n部屋だよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1735, 3, 2, 1, 0, 104902, 1, 0, "お姉ちゃんの胸に\n飛び込んでおいでっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1736, 4, 2, 1, 0, 104902, 1, 0, "いいこいいこ～♪\nどう、お姉ちゃんの\nナデナデは？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1737, 101, 2, 8, 0, 104902, 1, 0, "あ、あのね…\nたまにはお姉ちゃんも\n甘えていい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1738, 102, 2, 8, 0, 104902, 1, 0, "お風呂にする？\nごはんにする？\nそれとも…うふふ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1739, 1, 2, 1, 0, 104902, 1, 1, "着替えは？　荷物は？\nお出かけの準備は\nお姉ちゃんが手伝うね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1740, 2, 2, 1, 0, 104902, 1, 2, "お姉ちゃんが\nお昼ごはん\n作ってあげようか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1741, 3, 2, 1, 0, 104902, 1, 3, "眠れないの？\nお姉ちゃんが子守歌\n歌ってあげるね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1742, 1, 3, 1, 0, 104902, 1, 0, "弟くんを\n誘惑しちゃうぞ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1743, 2, 3, 1, 0, 104902, 1, 0, "ここにお姉ちゃんの\n匂いを、た～っぷり\n残しておこうっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1744, 3, 3, 1, 0, 104902, 1, 0, "かわいい♪\nお姉ちゃんチョップ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1745, 4, 3, 1, 0, 104902, 1, 0, "お肌に潤いが\nでてきたみたい～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1746, 5, 3, 1, 0, 104902, 1, 0, "これ、弟くんみたいに\nあったかいね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1747, 6, 3, 1, 0, 104902, 1, 0, "ダイエットダイエット\nきれいなお姉ちゃんに\nならなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1748, 7, 3, 1, 0, 104902, 1, 0, "弟くんの手作りなら\nもっとおいしくなると\n思うんだけどなぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1749, 8, 3, 1, 0, 104902, 1, 0, "弟くんをきちんと\n教育するために\nお姉ちゃんは勉強を\nかかさないのだ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1751, 1, 1, 1, 0, 105001, 1, 0, "ん～、エレガントで\n大人なお部屋ね！\nアタシにぴったり！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1752, 2, 1, 1, 0, 105001, 1, 0, "身長とバスト以外は\n完璧な大人\nなのになぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1753, 3, 1, 1, 0, 105001, 1, 0, "アタシの大人コーデで\nあいつも夢中ね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1754, 4, 1, 1, 0, 105001, 1, 0, "朝顔の観察したら\n理系女子になれる\nかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1755, 5, 1, 1, 0, 105001, 1, 0, "レディは、どんな時も\nおしとやかに…って\nアタシも騒ぎたいー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1756, 101, 1, 4, 0, 105001, 1, 0, "大人っぽい子が\n多いわね…アタシも\n負けてられないわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1757, 102, 1, 8, 0, 105001, 1, 0, "アタシが待ってる\nなんて、アイツは\n幸せものよねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1758, 1, 2, 1, 0, 105001, 1, 0, "わーい、アメだー♪\n食べる食べるー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1759, 2, 2, 1, 0, 105001, 1, 0, "熱いハニーラテが\n飲みたーい！\n淹れてー淹れてー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1760, 3, 2, 1, 0, 105001, 1, 0, "なによ？　もしかして\n好きな子にイタズラ\nしたくなるってやつ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1761, 4, 2, 1, 0, 105001, 1, 0, "アタシに合う服\n雑誌で探そうっと！\nサイズじゃないわ、\nデザインとかの話よ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1762, 101, 2, 4, 0, 105001, 1, 0, "ねーねー！\nアタシ、かわいい？\nかわいいわよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1763, 102, 2, 8, 0, 105001, 1, 0, "これから出かけるの？\nしっかりアタシを\nエスコートしてね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1764, 1, 2, 1, 0, 105001, 1, 1, "朝のスキンケアは\n大事なの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1765, 2, 2, 1, 0, 105001, 1, 2, "お腹すいたー\nダイエット\nやめちゃおうかなー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1766, 3, 2, 1, 0, 105001, 1, 3, "エイジングケアを\nしないとねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1767, 1, 3, 1, 0, 105001, 1, 0, "この角度のほうが\n大人っぽく見えるかな\nそれともこっちかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1768, 2, 3, 1, 0, 105001, 1, 0, "あ！　これ雑誌で\n見たことあるわ～\nだからきっと\nオシャレなのよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1769, 3, 3, 1, 0, 105001, 1, 0, "か、かわいい♪　けど\n大人はこんなもの…\nでも、かわいいし～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1770, 4, 3, 1, 0, 105001, 1, 0, "オシャレ～♪\n大人なレディって\n感じよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1771, 5, 3, 1, 0, 105001, 1, 0, "あったかーい♪\nここで宿題\nしようかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1772, 6, 3, 1, 0, 105001, 1, 0, "運動したら成長\nしないかしら？\n背とか胸とか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1773, 7, 3, 1, 0, 105001, 1, 0, "食べすぎると\n太っちゃうな…\nでも、おいしいし～っ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1774, 8, 3, 1, 0, 105001, 1, 0, "おもしろーい！\n…でも絵本って\n子供っぽいかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1776, 1, 1, 1, 0, 105002, 1, 0, "レディは、どんな時も\nおしとやかに…って\nアタシも騒ぎたいー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1777, 2, 1, 1, 0, 105002, 1, 0, "恋人にするなら\nイケメンか\nただイケよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1778, 3, 1, 1, 0, 105002, 1, 0, "もう少し背が欲しいな\n…もっと牛乳を\n飲まなくちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1779, 4, 1, 1, 0, 105002, 1, 0, "朝顔の観察したら\n理系女子になれる\nかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1780, 5, 1, 1, 0, 105002, 1, 0, "こ、これは補習の\nお知らせプリント！\nアイツに見つかる前に\n隠さなくちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1781, 101, 1, 8, 0, 105002, 1, 0, "アイツおっそいなー\n別に会いたいわけじゃ\nないけど…\n来ないと気になる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1782, 102, 1, 8, 0, 105002, 1, 0, "アタシが待ってる\nなんて、アイツは\n幸せものよねー ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1783, 1, 2, 1, 0, 105002, 1, 0, "なーに？\nアタシに甘えたいの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1784, 2, 2, 1, 0, 105002, 1, 0, "アタシに合う服\n雑誌で探そうっと！\nサイズじゃないわ\nデザインとかの話よ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1785, 3, 2, 1, 0, 105002, 1, 0, "頭撫でないで！\nお子様みたいに\nあつかわないでって\n言ってるのに～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1786, 4, 2, 1, 0, 105002, 1, 0, "壁ドンの練習…\nあれ？　壁ドンって\n男がするんだっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1787, 101, 2, 8, 0, 105002, 1, 0, "ねーねー！\nアタシ、かわいい？\nかわいいわよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1788, 102, 2, 8, 0, 105002, 1, 0, "これから出かけるの？\nしっかりアタシを\nエスコートしてね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1789, 1, 2, 1, 0, 105002, 1, 1, "レディの朝は\n忙しいのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1790, 2, 2, 1, 0, 105002, 1, 2, "お腹すいたー\nダイエット\nやめちゃおうかなー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1791, 3, 2, 1, 0, 105002, 1, 3, "エイジングケアを\nしないとねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1792, 1, 3, 1, 0, 105002, 1, 0, "身だしなみチェック\nオッケー！　これで\nいつアイツが来ても\n大丈夫ね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1793, 2, 3, 1, 0, 105002, 1, 0, "あ！　これ雑誌で\n見たことあるわ～\nだからきっと\nオシャレなのよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1794, 3, 3, 1, 0, 105002, 1, 0, "あたしがもっと\nオシャレにかわいく\nしてあげようか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1795, 4, 3, 1, 0, 105002, 1, 0, "オシャレ～♪\n大人なレディって\n感じよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1796, 5, 3, 1, 0, 105002, 1, 0, "あったかーい♪\nここで宿題\nしようかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1797, 6, 3, 1, 0, 105002, 1, 0, "運動したら成長\nしないかしら？\n背とか胸とか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1798, 7, 3, 1, 0, 105002, 1, 0, "レディは、食べ物にも\n気を使うのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1799, 8, 3, 1, 0, 105002, 1, 0, "おもしろーい！\n…でも絵本って\n子供っぽいかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1801, 1, 1, 1, 0, 105101, 1, 0, "魔法と科学\nどっちも極めて\nみせるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1802, 2, 1, 1, 0, 105101, 1, 0, "仕事も片付いたし\n部屋で\n実験実験…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1803, 3, 1, 1, 0, 105101, 1, 0, "たまった治療代の\n請求書を\nまとめないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1804, 4, 1, 1, 0, 105101, 1, 0, "新薬が出来たし\nすぐに試したいけど…\n実験台がいないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1805, 5, 1, 1, 0, 105101, 1, 0, "部屋にこもりすぎると\n曜日の感覚が\nなくなるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1806, 101, 1, 4, 0, 105101, 1, 0, "あの子の記憶を\n取り戻せる薬…\n作れないものかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1807, 102, 1, 8, 0, 105101, 1, 0, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1808, 1, 2, 1, 0, 105101, 1, 0, "あら、ヒマなら\n薬草の整理を\n手伝って");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1809, 2, 2, 1, 0, 105101, 1, 0, "もしかして実験に\n付き合ってくれるの？\nえ？　違う？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1810, 3, 2, 1, 0, 105101, 1, 0, "具合が悪い？\nなら診てあげる\nまずは触診から…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1811, 4, 2, 1, 0, 105101, 1, 0, "植物に興味あるの？\nなら教えてあげるわ\n色々とね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1812, 101, 2, 4, 0, 105101, 1, 0, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1813, 102, 2, 8, 0, 105101, 1, 0, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1814, 1, 2, 1, 0, 105101, 1, 1, "お昼までに調合用の\n花を集めたいの\n手伝ってくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1815, 2, 2, 1, 0, 105101, 1, 2, "あら、もうお昼？\nそろそろ一息\n入れましょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1816, 3, 2, 1, 0, 105101, 1, 3, "夜も更けて来たわね\n私は朝まで実験だけど\n見学していく？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1817, 1, 3, 1, 0, 105101, 1, 0, "医者たるもの\nいつだって\n清潔に…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1818, 2, 3, 1, 0, 105101, 1, 0, "いいわねこれ\n仮眠の時に\n使わせてもらうわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1819, 3, 3, 1, 0, 105101, 1, 0, "ぬいぐるみなら\n動物も…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1820, 4, 3, 1, 0, 105101, 1, 0, "いい香り…\n仕事場にも\n置いてみようかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1821, 5, 3, 1, 0, 105101, 1, 0, "ここにいると\nついウトウト\nしちゃうわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1822, 6, 3, 1, 0, 105101, 1, 0, "座ってる時間が多いと\n運動不足になるし\nたまにはいいわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1823, 7, 3, 1, 0, 105101, 1, 0, "研究していると\nつい食べるのを\n忘れちゃうのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1824, 8, 3, 1, 0, 105101, 1, 0, "実験もいいけど\nいつか成果を\n本にしないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1826, 1, 1, 1, 0, 105102, 1, 0, "徹夜はツラいけど\n集中すると時間の\n感覚がなくなって…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1827, 2, 1, 1, 0, 105102, 1, 0, "痛みに悶える顔って\nどうしてあんなに\n興奮するのかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1828, 3, 1, 1, 0, 105102, 1, 0, "彼に罵られたら\nどんな気分かしら\n意外と快感かも？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1829, 4, 1, 1, 0, 105102, 1, 0, "毒を薄めると\n薬になるのって\n今でも不思議だわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1830, 5, 1, 1, 0, 105102, 1, 0, "綺麗なバラには\nトゲがあるけど\n魅力の一つよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1831, 101, 1, 8, 0, 105102, 1, 0, "カレをさりげなく\n惚れさせる方法を\n研究するわよ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1832, 102, 1, 8, 0, 105102, 1, 0, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1833, 1, 2, 1, 0, 105102, 1, 0, "構って欲しいの？\nじゃあ、君の体を\n調べさせて？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1834, 2, 2, 1, 0, 105102, 1, 0, "実験に付き合って\n大丈夫よ、試すのは\nただの栄養剤だから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1835, 3, 2, 1, 0, 105102, 1, 0, "欲しい薬が\nあったら言ってね\n調合してみるから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1836, 4, 2, 1, 0, 105102, 1, 0, "おしおきされたいの？\nキミにだったら\nいつでもしてあげる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1837, 101, 2, 8, 0, 105102, 1, 0, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1838, 102, 2, 8, 0, 105102, 1, 0, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1839, 1, 2, 1, 0, 105102, 1, 1, "朝しか取れない\n植物があるの\n採取しに行くわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1840, 2, 2, 1, 0, 105102, 1, 2, "お昼時ってやけに\n眠たくなるわよね\n…調べたくなるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1841, 3, 2, 1, 0, 105102, 1, 3, "今日くらいは\nゆっくり眠りたいわ\n…キミと一緒にね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1842, 1, 3, 1, 0, 105102, 1, 0, "身なりについて\n研究するのも\n楽しそうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1843, 2, 3, 1, 0, 105102, 1, 0, "休息に必要な道具は\n妥協せずに選ぶ！\nこれだけは譲れないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1844, 3, 3, 1, 0, 105102, 1, 0, "たまにはこういう\n可愛らしいものに\n触れないとね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1845, 4, 3, 1, 0, 105102, 1, 0, "いい香り…\n仕事場にも\n置いてみようかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1846, 5, 3, 1, 0, 105102, 1, 0, "仕事がなかったら\nこのまますーっと\n眠りたいのに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1847, 6, 3, 1, 0, 105102, 1, 0, "運動しないと\n体型の維持が…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1848, 7, 3, 1, 0, 105102, 1, 0, "適度な食事も\n大切よね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1849, 8, 3, 1, 0, 105102, 1, 0, "まさか私が\n恋愛読本を読む\n日が来るなんて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1851, 1, 1, 1, 0, 105201, 1, 0, "ぺっぺっ！\n…い、いけないっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1852, 2, 1, 1, 0, 105201, 1, 0, "いっけな～い！\nひづめで床に傷が！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1853, 3, 1, 1, 0, 105201, 1, 0, "太っちゃったかも～！\n伐採でダイエット\nしなくっちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1854, 4, 1, 1, 0, 105201, 1, 0, "きちんと生活すると\n毛づやが良くなる\nみたいなのよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1855, 5, 1, 1, 0, 105201, 1, 0, "みんな、体重\nどれくらいなのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1856, 101, 1, 4, 0, 105201, 1, 0, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1857, 102, 1, 8, 0, 105201, 1, 0, "いつか人間の女の子\nみたいなデート、\nしてみたいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1858, 1, 2, 1, 0, 105201, 1, 0, "私ね「どこにでもいる\n普通の女の子」って\n言葉が憧れなんだ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1859, 2, 2, 1, 0, 105201, 1, 0, "チャームポイント？\n自分では分からない\nけど…まつげかなぁ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1860, 3, 2, 1, 0, 105201, 1, 0, "リマリマ～♪\nはっ！？\nわ、私ったら今何を？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1861, 4, 2, 1, 0, 105201, 1, 0, "力仕事ならまかせて！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1862, 101, 2, 4, 0, 105201, 1, 0, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1863, 102, 2, 8, 0, 105201, 1, 0, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1864, 1, 2, 1, 0, 105201, 1, 1, "今朝は寝癖がひどいわ\nしっぽの辺りとか～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1865, 2, 2, 1, 0, 105201, 1, 2, "ランチは\nおしゃれなカフェで\nしてみたいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1866, 3, 2, 1, 0, 105201, 1, 3, "お肌のケアに\nパックしながら\n寝ようかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1867, 1, 3, 1, 0, 105201, 1, 0, "やだっ、\nまた寝ぐせついてる！\n直さないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1868, 2, 3, 1, 0, 105201, 1, 0, "ミシッっていった！\n私、重すぎるかも！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1869, 3, 3, 1, 0, 105201, 1, 0, "あ！　あなたも\n美人さんね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1870, 4, 3, 1, 0, 105201, 1, 0, "はぁ、まったり…\n四足歩行しちゃい\nそうだわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1871, 5, 3, 1, 0, 105201, 1, 0, "あったか～い♪\n…私、毛皮だから\n暑すぎるかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1872, 6, 3, 1, 0, 105201, 1, 0, "な、なんだか野生に\n帰っちゃいそう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1873, 7, 3, 1, 0, 105201, 1, 0, "ぱくぱく、もぐもぐ、\nぺっぺっ…\nやだ、はしたない！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1874, 8, 3, 1, 0, 105201, 1, 0, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1876, 1, 1, 1, 0, 105202, 1, 0, "素敵ね～、居るだけで\n女子力があがりそうな\nお部屋だわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1877, 2, 1, 1, 0, 105202, 1, 0, "私、大丈夫かしら？\n他の子に怖がられたり\nしないかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1878, 3, 1, 1, 0, 105202, 1, 0, "動物苑…って\n嫌なギルド名ね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1879, 4, 1, 1, 0, 105202, 1, 0, "好き、嫌い、好き…\nあっ！　うっかりして\n花占いのお花\n食べちゃった！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1880, 5, 1, 1, 0, 105202, 1, 0, "ここ、女の子らしい\nものでいっぱいね～！\nときめいちゃうわ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1881, 101, 1, 8, 0, 105202, 1, 0, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1882, 102, 1, 8, 0, 105202, 1, 0, "あの人が\n来てくれるまで薪割り\nでもしてよっかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1883, 1, 2, 1, 0, 105202, 1, 0, "一緒にお出かけ？\nうれしいけど…\n心の準備が！\nはわわわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1884, 2, 2, 1, 0, 105202, 1, 0, "どうしたの？\n急に抱きついてきて…\n癒されたいの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1885, 3, 2, 1, 0, 105202, 1, 0, "ぺっぺっ！\n…い、いけないっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1886, 4, 2, 1, 0, 105202, 1, 0, "メタモルアップルを\nここで食べたら、\nみんな驚くわよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1887, 101, 2, 8, 0, 105202, 1, 0, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1888, 102, 2, 8, 0, 105202, 1, 0, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1889, 1, 2, 1, 0, 105202, 1, 1, "今朝は寝癖がひどいわ\nしっぽの辺りとか～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1890, 2, 2, 1, 0, 105202, 1, 2, "ダイエット中だから\nお昼は抜いてるの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1891, 3, 2, 1, 0, 105202, 1, 3, "お肌のケアに\nパックしながら\n寝ようかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1892, 1, 3, 1, 0, 105202, 1, 0, "ちゃんとかわいく\nしてないと刈られ…\n狩られちゃうもんね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1893, 2, 3, 1, 0, 105202, 1, 0, "ミシッっていった！\n私、重すぎるかも！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1894, 3, 3, 1, 0, 105202, 1, 0, "あ！　あなたも\n美人さんね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1895, 4, 3, 1, 0, 105202, 1, 0, "いい香り～\n森の中にいるみたいに\nとっても落ち着く～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1896, 5, 3, 1, 0, 105202, 1, 0, "素敵～♪　…\nきゃっ！　私の毛が\nたいへんなことに～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1897, 6, 3, 1, 0, 105202, 1, 0, "な、なんだか野生に\n帰っちゃいそう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1898, 7, 3, 1, 0, 105202, 1, 0, "何を食べるかより\n誰と食べるかが\n大事なのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1899, 8, 3, 1, 0, 105202, 1, 0, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1901, 1, 1, 1, 0, 105301, 1, 0, "ヴァイスフリューゲル\nを盛り上げる方法、\n共に語らおう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1902, 2, 1, 1, 0, 105301, 1, 0, "私は子供ではない…！\nが、お菓子は\nいただこう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1903, 3, 1, 1, 0, 105301, 1, 0, "部屋はきちんと\n片づけておかなくては\n部屋の汚れは\n心の汚れだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1904, 4, 1, 1, 0, 105301, 1, 0, "むむむ…明日\n目が覚めたら、身長が\n伸びていないものか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1905, 5, 1, 1, 0, 105301, 1, 0, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1906, 101, 1, 4, 0, 105301, 1, 0, "あいつとの新たな\n鍛錬が\n待ち遠しいな…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1907, 102, 1, 8, 0, 105301, 1, 0, "最近、あいつと\n過ごしていて、毎日が\n充実しているな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1908, 1, 2, 1, 0, 105301, 1, 0, "軍人の本分は日々の\n研鑽にあるからな。\n今日も鍛錬に\n行かないか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1909, 2, 2, 1, 0, 105301, 1, 0, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1910, 3, 2, 1, 0, 105301, 1, 0, "貴公にも、飴をくれて\nやろうか？\nあまいぞ～！\n美味しいぞ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1911, 4, 2, 1, 0, 105301, 1, 0, "私ともっと高く、\n共に飛ぼう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1912, 101, 2, 4, 0, 105301, 1, 0, "貴公は、本当に頼りに\nなる男だな…いや、\nふとそう思っただけだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1913, 102, 2, 8, 0, 105301, 1, 0, "貴公と共にいられる\nことは私の喜びだ。\nこれからも\nよろしく頼むぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1914, 1, 2, 1, 0, 105301, 1, 1, "うむ、いい朝だ。\n本国の夜明けを\n思い出してしまうな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1915, 2, 2, 1, 0, 105301, 1, 2, "そろそろ昼食に\nするか。腹が減っては\n戦はできないからな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1916, 3, 2, 1, 0, 105301, 1, 3, "ふわああ…私は子供\nではないが…眠い時は\n眠いのだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1917, 1, 3, 1, 0, 105301, 1, 0, "身だしなみは、心の\n在りようを映すから\n気をつけなくてはな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1918, 2, 3, 1, 0, 105301, 1, 0, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1919, 3, 3, 1, 0, 105301, 1, 0, "うむ…このかわいさ…\n本国に持って\n帰りたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1920, 4, 3, 1, 0, 105301, 1, 0, "このともし火、戦いに\n明け暮れる我らの心を\n癒すものだな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1921, 5, 3, 1, 0, 105301, 1, 0, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1922, 6, 3, 1, 0, 105301, 1, 0, "うおおおおおっ！\n鍛錬、鍛錬、\n鍛錬っ！！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1923, 7, 3, 1, 0, 105301, 1, 0, "いつ戦いになっても\n困らぬように、\n腹八分目に\nしておくのだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1924, 8, 3, 1, 0, 105301, 1, 0, "これを読んで、新たな\n戦術を編み出すぞっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1926, 1, 1, 1, 0, 105302, 1, 0, "たまには掃除でも\nするか。部屋が\n綺麗になるのは\n喜ばしいことだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1927, 2, 1, 1, 0, 105302, 1, 0, "部屋の中では\n剣を振り回せないのが\n玉に瑕だな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1928, 3, 1, 1, 0, 105302, 1, 0, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1929, 4, 1, 1, 0, 105302, 1, 0, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1930, 5, 1, 1, 0, 105302, 1, 0, "家庭を守れない者が\n国を守れるはずが\nない。この部屋も\n私が守るぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1931, 101, 1, 8, 0, 105302, 1, 0, "あいつは今頃、何を\nしているのだろうな…\nふふっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1932, 102, 1, 8, 0, 105302, 1, 0, "あいつと会える日が\nこんなにも待ち遠しく\nなるとはな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1933, 1, 2, 1, 0, 105302, 1, 0, "軍人の本分は日々の\n研鑽にあるからな\n今日も鍛錬に\n行かないか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1934, 2, 2, 1, 0, 105302, 1, 0, "おお、今日も鍛錬の\n時間だったか！\nすまないな\nすぐ行く！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1935, 3, 2, 1, 0, 105302, 1, 0, "私は子供ではない！\nが…たまには童心に\n帰りたい時もある…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1936, 4, 2, 1, 0, 105302, 1, 0, "貴公にも、飴を\nくれてやろうか？\nあまいぞ～！\n美味しいぞ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1937, 101, 2, 8, 0, 105302, 1, 0, "私と歩きたいのか…？\nそうだな。二人で\n散歩でも行こうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1938, 102, 2, 8, 0, 105302, 1, 0, "貴公と共にいられる\nことは私の喜びだ\nこれからも\nよろしく頼むぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1939, 1, 2, 1, 0, 105302, 1, 1, "うむ、いい朝だ\n本国の夜明けを\n思い出してしまうな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1940, 2, 2, 1, 0, 105302, 1, 2, "そろそろ昼時だな\n鍛錬の手を緩めて\n昼食にするか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1941, 3, 2, 1, 0, 105302, 1, 3, "寝る前に…あと少し\nだけ、鍛錬を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1942, 1, 3, 1, 0, 105302, 1, 0, "ヴァイス\nフリューゲルの一員と\nして恥ずかしくないよう\n身なりを整えなくては");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1943, 2, 3, 1, 0, 105302, 1, 0, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1944, 3, 3, 1, 0, 105302, 1, 0, "うむ…このかわいさ…\n本国に持って\n帰りたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1945, 4, 3, 1, 0, 105302, 1, 0, "このともし火\n戦いに明け暮れる\n我らの心を\n癒すものだな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1946, 5, 3, 1, 0, 105302, 1, 0, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1947, 6, 3, 1, 0, 105302, 1, 0, "うおおおおおっ！\n鍛錬、鍛錬\n鍛錬っ！！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1948, 7, 3, 1, 0, 105302, 1, 0, "いつ戦いになっても\n困らぬように\n腹八分目に\nしておくのだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1949, 8, 3, 1, 0, 105302, 1, 0, "うむ…脳細胞が\n活性化してきたぞ\n読書は大事だな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1951, 1, 1, 1, 0, 105701, 1, 0, "私たちの騎空艇\nどんなデザインに\nしよう…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1952, 2, 1, 1, 0, 105701, 1, 0, "団員募集の\nポスター\n作ろうっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1953, 3, 1, 1, 0, 105701, 1, 0, "父さん…\n今頃どこで\n何してるんだろ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1954, 4, 1, 1, 0, 105701, 1, 0, "騎空艇に乗って、\n誰もいったことがない\n場所を見つけたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1955, 5, 1, 1, 0, 105701, 1, 0, "父さん以上の\n世界一の\n騎空士になりたい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1956, 101, 1, 4, 0, 105701, 1, 0, "仲間と行く空の旅…\n何度想像しても\nドキドキするなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1957, 102, 1, 8, 0, 105701, 1, 0, "父さん…\n私にもね、大切な\n仲間ができたよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1958, 1, 2, 1, 0, 105701, 1, 0, "仕事の依頼？\nすぐに支度\nしてくるね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1959, 2, 2, 1, 0, 105701, 1, 0, "ねえねえ！\n団員募集のポスター\n一緒に作ろうよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1960, 3, 2, 1, 0, 105701, 1, 0, "なーにー？\nどうしたの？\n今呼んだよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1961, 4, 2, 1, 0, 105701, 1, 0, "今は休憩中だよ？\nだからあなたも\nゆっくりしてて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1962, 101, 2, 4, 0, 105701, 1, 0, "私にとってあなたは\nとっても頼りになる、\n自慢の団員だよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1963, 102, 2, 8, 0, 105701, 1, 0, "お父さんに会えたら、\n大切な仲間として\nあなたを紹介するね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1964, 1, 2, 1, 0, 105701, 1, 1, "おはよう！\n体の調子はどう？\n今日は頑張れそう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1965, 2, 2, 1, 0, 105701, 1, 2, "ねえねえ、お昼\n食べに行こうよ！\nお腹空いちゃった");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1966, 3, 2, 1, 0, 105701, 1, 3, "…あれ？\nおしゃべりしてたら\nもうこんな時間？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1967, 1, 3, 1, 0, 105701, 1, 0, "どうせならオシャレな\n騎空士って\n呼ばれたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1968, 2, 3, 1, 0, 105701, 1, 0, "ふぅ、疲れた～…\nちょっとだけ\n休んじゃおっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1969, 3, 3, 1, 0, 105701, 1, 0, "よし！　キミは\n今から団長代理だ！\n…なんてね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1970, 4, 3, 1, 0, 105701, 1, 0, "いい香り～♪\n気持ちが\n落ち着く～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1971, 5, 3, 1, 0, 105701, 1, 0, "これって\n騎空艇に\n置けるかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1972, 6, 3, 1, 0, 105701, 1, 0, "どんな仕事でも\nこなせるような\n体力がないとね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1973, 7, 3, 1, 0, 105701, 1, 0, "あむっ…うん！\n美味しい～！\n今度作ってみよう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1974, 8, 3, 1, 0, 105701, 1, 0, "空を冒険するには\n色んなことを\n知っておかないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1976, 1, 1, 1, 0, 105702, 1, 0, "…戻らなくなったよ\nどうすれば元に\n戻る…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1977, 2, 1, 1, 0, 105702, 1, 0, "暇だよ…\nどこかに強い人は\nいないか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1978, 3, 1, 1, 0, 105702, 1, 0, "ジョブチェンジ！\n…叫んでも\n戻らないよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1979, 4, 1, 1, 0, 105702, 1, 0, "今のうちに、\n魔物退治の\n仕事に行くね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1980, 5, 1, 1, 0, 105702, 1, 0, "ハァ～…\nうん、気の巡りは\n問題ないね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1981, 101, 1, 8, 0, 105702, 1, 0, "私の力の源は\n仲間との\n絆だよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1982, 102, 1, 8, 0, 105702, 1, 0, "いつかこの拳を\n空を越えた、星まで\n届かせたいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1983, 1, 2, 1, 0, 105702, 1, 0, "功夫が足りない人は\nどうすればいいか？\nもちろん修行だよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1984, 2, 2, 1, 0, 105702, 1, 0, "私はいつも通りに\n喋ってるつもり\nだよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1985, 3, 2, 1, 0, 105702, 1, 0, "どうした？\nもしかして手合せ\nしたいか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1986, 4, 2, 1, 0, 105702, 1, 0, "騎空士としても\n拳法家としても\n目指すは世界一ね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1987, 101, 2, 8, 0, 105702, 1, 0, "背中はあなたに\n預けたよ！\nよろしくね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1988, 102, 2, 8, 0, 105702, 1, 0, "あなたと一緒なら\nきっと、今よりもっと\n強くなれるよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1989, 1, 2, 1, 0, 105702, 1, 1, "ちゃんと起きてるか？\n寝ぼけてたら\nダメよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1990, 2, 2, 1, 0, 105702, 1, 2, "腹減ったね…\nなにか食べに\n行くよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1991, 3, 2, 1, 0, 105702, 1, 3, "修行のしすぎは\n良くないよ？\n気をつけるね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1992, 1, 3, 1, 0, 105702, 1, 0, "美しい技は\n美しい体が\nあってこそ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1993, 2, 3, 1, 0, 105702, 1, 0, "よいしょっと…\nちょっとのんびり\nさせてもらうよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1994, 3, 3, 1, 0, 105702, 1, 0, "…練習に\n使うのはさすがに\n可哀そうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1995, 4, 3, 1, 0, 105702, 1, 0, "これは…\n瞑想の時にも\n使ってみたいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1996, 5, 3, 1, 0, 105702, 1, 0, "出来ればもっと\n熱いほうが\n嬉しいよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1997, 6, 3, 1, 0, 105702, 1, 0, "ここでも\n修行出来るなんて\n最高だよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1998, 7, 3, 1, 0, 105702, 1, 0, "気力の源は体力！\n体力の源は\n健康とご飯！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1999, 8, 3, 1, 0, 105702, 1, 0, "んー…\n難しいことは\nわかんないよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2001, 1, 1, 1, 0, 105801, 1, 0, "わたしたちの\nギルドハウスへ\nようこそ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2002, 2, 1, 1, 0, 105801, 1, 0, "ぐるるる～…\nあ、お腹が\n鳴っちゃいました…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2003, 3, 1, 1, 0, 105801, 1, 0, "ん？\n食べ物のにおい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2004, 4, 1, 1, 0, 105801, 1, 0, "みんなと仲良く食卓を\n囲みたいですね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2005, 5, 1, 1, 0, 105801, 1, 0, "この部屋が、わたしの\n帰る場所です♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2006, 101, 1, 4, 0, 105801, 1, 0, "あの人を見ると\n胸が満たされます～\nお腹は空いてますが！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2007, 102, 1, 8, 0, 105801, 1, 0, "あの人、\n大食いの子って\n嫌いかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2008, 1, 2, 1, 0, 105801, 1, 0, "食べもの、くれるん\nですか？　わーい！\n恋しちゃいそう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2009, 2, 2, 1, 0, 105801, 1, 0, "つ、つまみ食いなんて\nしてませんよ？\nこれは味見です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2010, 3, 2, 1, 0, 105801, 1, 0, "おやつは別腹、\nごはんも別腹、\n魔物も別腹～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2011, 4, 2, 1, 0, 105801, 1, 0, "好きなものを、\n好きな人達と食べる！\n最高の贅沢ですね☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2012, 101, 2, 4, 0, 105801, 1, 0, "あなたは、\nごはん王子ですね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2013, 102, 2, 8, 0, 105801, 1, 0, "大好きです～\n愛してます～\nえへへ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2014, 1, 2, 1, 0, 105801, 1, 1, "朝ごはんも終わったし\n早速ブランチを\n食べませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2015, 2, 2, 1, 0, 105801, 1, 2, "お昼ご飯、\nおいしかったですね～\nそれじゃあ、そろそろ\nおやつにしましょう☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2016, 3, 2, 1, 0, 105801, 1, 3, "お夕飯も、晩ごはんも\n食べたし…さぁ！\nお夜食の時間ですよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2017, 1, 3, 1, 0, 105801, 1, 0, "身だしなみ、\n身だしなみ…\nきちんとしないとね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2018, 2, 3, 1, 0, 105801, 1, 0, "ふい～\n消化中です～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2019, 3, 3, 1, 0, 105801, 1, 0, "おいしそ…\nか、かわいいです～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2020, 4, 3, 1, 0, 105801, 1, 0, "いい香りですね～\n空気までおいしそう～\nじゅるり♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2021, 5, 3, 1, 0, 105801, 1, 0, "ほっかほか～♪\n魔物の丸焼きが\n作れちゃいますね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2022, 6, 3, 1, 0, 105801, 1, 0, "走って食べて！\n走って食べて！\n\この無限ループです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2023, 7, 3, 1, 0, 105801, 1, 0, "いくつでも\n食べられますよ！\n幸せ～☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2024, 8, 3, 1, 0, 105801, 1, 0, "料理の絵を\n見ているだけで、\nよ、よだれが～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2026, 1, 1, 1, 0, 105802, 1, 0, "この部屋が、わたしの\n帰る場所です♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2027, 2, 1, 1, 0, 105802, 1, 0, "ギルドハウス\nどんどん素敵に\nなっていくな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2028, 3, 1, 1, 0, 105802, 1, 0, "「やばい」とか\n「おいっす」とか…\n民の言葉って難しい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2029, 4, 1, 1, 0, 105802, 1, 0, "お菓子の家に\n住みたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2030, 5, 1, 1, 0, 105802, 1, 0, "あ、頼んでた出前が\n届いたかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2031, 101, 1, 8, 0, 105802, 1, 0, "大切な人がいて\n大切な場所がある\nすごく幸せです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2032, 102, 1, 8, 0, 105802, 1, 0, "あの人\n大食いの子って\n嫌いかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2033, 1, 2, 1, 0, 105802, 1, 0, "ごはんに行きますか？\n作りましょうか？\n店屋物もいいですね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2034, 2, 2, 1, 0, 105802, 1, 0, "モグモグ…\nあげませんよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2035, 3, 2, 1, 0, 105802, 1, 0, "おやつは別腹\nごはんも別腹\n魔物も別腹～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2036, 4, 2, 1, 0, 105802, 1, 0, "好きなものを\n好きな人達と食べる！\n最高の贅沢ですね☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2037, 101, 2, 8, 0, 105802, 1, 0, "大好きです～\n愛してます～\nえへへ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2038, 102, 2, 8, 0, 105802, 1, 0, "わたし食べても\n太らないんです♪\nほらほら～触って\nみてくださいよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2039, 1, 2, 1, 0, 105802, 1, 1, "朝ごはんも終わったし\n早速ブランチを\n食べませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2040, 2, 2, 1, 0, 105802, 1, 2, "お昼ご飯\nおいしかったですね～\nそれじゃあ、そろそろ\nおやつにしましょう☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2041, 3, 2, 1, 0, 105802, 1, 3, "お夕飯も、晩ごはんも\n食べたし～。さぁ！\nお夜食の時間ですよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2042, 1, 3, 1, 0, 105802, 1, 0, "お姫さまみたいに\nきれいに\nならないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2043, 2, 3, 1, 0, 105802, 1, 0, "のんびりしていても\nお腹がすいちゃうん\nですよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2044, 3, 3, 1, 0, 105802, 1, 0, "おいしそ…\nか、かわいいです～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2045, 4, 3, 1, 0, 105802, 1, 0, "アップル系、ピーチ系\nオレンジ系…\n香りも色々ですね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2046, 5, 3, 1, 0, 105802, 1, 0, "ここでお魚を\n焼けたら\n最高ですね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2047, 6, 3, 1, 0, 105802, 1, 0, "身体も鍛えなきゃ～！\nお腹がすいちゃいます\nけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2048, 7, 3, 1, 0, 105802, 1, 0, "もぐもぐもぐもぐもぐ\nもぐもぐもぐもぐもぐ\nもぐもぐもぐもぐ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2049, 8, 3, 1, 0, 105802, 1, 0, "流行語発表…\nこんな言葉遣いが！\nやばいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2051, 1, 1, 1, 0, 106001, 1, 0, "いろいろ美味しいもの\n食べられるし…\nけっこう幸せかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2052, 2, 1, 1, 0, 106001, 1, 0, "んーー、あたし\nなんで、このギルドに\n入っちゃったんだろ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2053, 3, 1, 1, 0, 106001, 1, 0, "あいつが来たら、\n尾行しなくちゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2054, 4, 1, 1, 0, 106001, 1, 0, "この部屋のどこかに、\nあいつの秘密が\n隠されてるかも？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2055, 5, 1, 1, 0, 106001, 1, 0, "ま、まずいわ…\nギルド活動、\nけっこう楽しい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2056, 101, 1, 4, 0, 106001, 1, 0, "あいつを監視してる\nと…な、なんか\n変な気分");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2057, 102, 1, 8, 0, 106001, 1, 0, "主さま…\nだ、誰も聞いてない\nわよね！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2058, 1, 2, 1, 0, 106001, 1, 0, "気まぐれは\nチャームポイント\nみたいなもんよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2059, 2, 2, 1, 0, 106001, 1, 0, "うひゃっ！？\nど、どうしてあんたは\nいつも驚かせるのよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2060, 3, 2, 1, 0, 106001, 1, 0, "ぎゃー！\n虫もって近づくなー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2061, 4, 2, 1, 0, 106001, 1, 0, "この部屋って、\n野良猫を拾ってきたら\nだめかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2062, 101, 2, 4, 0, 106001, 1, 0, "遊びにいくわよ！\nあんたはあたしの\n言うとおりにすれば\nいいの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2063, 102, 2, 8, 0, 106001, 1, 0, "あんた、あたしに\n操られてみない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2064, 1, 2, 1, 0, 106001, 1, 1, "美食殿としては、\n朝食もこだわらないと\nねぇ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2065, 2, 2, 1, 0, 106001, 1, 2, "ギルド活動だもん！\n美味しいランチを\n食べましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2066, 3, 2, 1, 0, 106001, 1, 3, "ディナーに行くわよ！\nギルドの目的、\n食べ歩きだもんね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2067, 1, 3, 1, 0, 106001, 1, 0, "今日もしっぽが\nいい感じ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2068, 2, 3, 1, 0, 106001, 1, 0, "こういう所だと、\n丸くなっちゃうのよね\nうにゃぁ～～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2069, 3, 3, 1, 0, 106001, 1, 0, "これ、あたしの能力で\n操れないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2070, 4, 3, 1, 0, 106001, 1, 0, "うにゃぁ～♪\nにゃん、にゃお～ん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2071, 5, 3, 1, 0, 106001, 1, 0, "はぁ～ゴロゴロ\nしたくなるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2072, 6, 3, 1, 0, 106001, 1, 0, "特訓特訓！\nあたしは\nやればできる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2073, 7, 3, 1, 0, 106001, 1, 0, "おいしいものを\nたくさん食べる…\nギルド活動って\n楽しい～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2074, 8, 3, 1, 0, 106001, 1, 0, "魔法を使うにも、\n知識が必要だものね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2076, 1, 1, 1, 0, 106002, 1, 0, "ま、まずいわ…\nギルド活動\nけっこう楽しい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2077, 2, 1, 1, 0, 106002, 1, 0, "いろいろ美味しいもの\n食べられるし…\nけっこう幸せかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2078, 3, 1, 1, 0, 106002, 1, 0, "主さま…\nだ、誰も聞いてない\nわよね！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2079, 4, 1, 1, 0, 106002, 1, 0, "監視監視…\nうん！　あたしは\nなまけてないわよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2080, 5, 1, 1, 0, 106002, 1, 0, "へ、陛下に\nみつからないように\nしなくっちゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2081, 101, 1, 8, 0, 106002, 1, 0, "あいつが来たら、\n尾行しなくちゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2082, 102, 1, 8, 0, 106002, 1, 0, "あいつと会ってから\n調子くるったな…\n楽しいけどさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2083, 1, 2, 1, 0, 106002, 1, 0, "食わず嫌いって\nあるのよね\n食べ物もだけど\n人も…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2084, 2, 2, 1, 0, 106002, 1, 0, "うひゃっ！？\nど、どうしてあんたは\nいつも驚かせるのよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2085, 3, 2, 1, 0, 106002, 1, 0, "話し相手になって\nやるわよ…情報\n聞き出せるかもだし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2086, 4, 2, 1, 0, 106002, 1, 0, "この部屋って\n野良猫を拾ってきたら\nだめかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2087, 101, 2, 8, 0, 106002, 1, 0, "遊びにいくわよ！\nあんたはあたしの\n言うとおりにすれば\nいいの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2088, 102, 2, 8, 0, 106002, 1, 0, "あんた、あたしに\n操られてみない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2089, 1, 2, 1, 0, 106002, 1, 1, "美食殿としては\n朝食もこだわらないと\nねぇ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2090, 2, 2, 1, 0, 106002, 1, 2, "ギルド活動だもん！\n美味しいランチを\n食べましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2091, 3, 2, 1, 0, 106002, 1, 3, "ディナーに行くわよ！\nギルドの目的\n食べ歩きだもんね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2092, 1, 3, 1, 0, 106002, 1, 0, "今日もしっぽが\nいい感じ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2093, 2, 3, 1, 0, 106002, 1, 0, "うにゃ～\nどんどん眠く\nなる～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2094, 3, 3, 1, 0, 106002, 1, 0, "これ、あたしの能力で\n操れないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2095, 4, 3, 1, 0, 106002, 1, 0, "あたし、みんなや\nあいつと同じ香りを\n身に着けてるんだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2096, 5, 3, 1, 0, 106002, 1, 0, "うっ、のんびり\nしたくなる…\n特訓しなきゃ\nいけないのに～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2097, 6, 3, 1, 0, 106002, 1, 0, "特訓特訓！\nあたしは\nやればできる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2098, 7, 3, 1, 0, 106002, 1, 0, "おいしいものを\nたくさん食べる…\nギルド活動って\n楽しい～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2099, 8, 3, 1, 0, 106002, 1, 0, "魔法を使うにも\n知識が必要だものね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2101, 1, 1, 1, 0, 105901, 1, 0, "この空間は主さまの\n香りがします\n…ふふふ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2102, 2, 1, 1, 0, 105901, 1, 0, "炊事、洗濯、お掃除、\nお買いものもしなくて\nはいけませんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2103, 3, 1, 1, 0, 105901, 1, 0, "アメスさまへの、\nお祈りができそうな\n場所は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2104, 4, 1, 1, 0, 105901, 1, 0, "さすが都会…\nおいしいものが\nたくさんあるのですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2105, 5, 1, 1, 0, 105901, 1, 0, "主さまが不自由なく\n使える部屋に\nしなくては…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2106, 101, 1, 4, 0, 105901, 1, 0, "できるなら…\n主さまと二人だけの\n部屋の方が…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2107, 102, 1, 8, 0, 105901, 1, 0, "主さまの隣には\nわたくしが…\nわたくしの隣には、\n主さまが…幸せです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2108, 1, 2, 1, 0, 105901, 1, 0, "わたくし、背が伸び\nましたでしょうか？\n…そうですか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2109, 2, 2, 1, 0, 105901, 1, 0, "もしお疲れでしたら\n肩でも\nお揉みしましょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2110, 3, 2, 1, 0, 105901, 1, 0, "主さま、なにか\nしてほしいことは\nありませんか？\n欲しいものは？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2111, 4, 2, 1, 0, 105901, 1, 0, "今日のおこづかいです\n何かおいしいものを\n召し上がってください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2112, 101, 2, 4, 0, 105901, 1, 0, "主さまのおてて\n温かいですね…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2113, 102, 2, 8, 0, 105901, 1, 0, "主さまのおそばに\nいられて、わたくし、\n嬉しいです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2114, 1, 2, 1, 0, 105901, 1, 1, "おはようございます。\n洗濯をしなければ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2115, 2, 2, 1, 0, 105901, 1, 2, "そろそろお昼ですね。\nおいしいものを\n食べましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2116, 3, 2, 1, 0, 105901, 1, 3, "おやすみになる時は、\nお声をかけてください\nお供致します");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2117, 1, 3, 1, 0, 105901, 1, 0, "もう少し…\nおっきくなりたい\nです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2118, 2, 3, 1, 0, 105901, 1, 0, "このふかふかの優しさ\n主さまのようです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2119, 3, 3, 1, 0, 105901, 1, 0, "かわいい♪\n主さまにそっくり♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2120, 4, 3, 1, 0, 105901, 1, 0, "故郷の香りとは\n違いますが、これも\n心地よいものです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2121, 5, 3, 1, 0, 105901, 1, 0, "ここで洗濯物を\n乾かせるでしょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2122, 6, 3, 1, 0, 105901, 1, 0, "都会の人々は\nこんなふうに\n運動を…！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2123, 7, 3, 1, 0, 105901, 1, 0, "これは…主さまにも\n食べさせて\n差し上げたい…\nあーんって♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2124, 8, 3, 1, 0, 105901, 1, 0, "よく学んで、\n主さまのお役に\n立たなければ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2126, 1, 1, 1, 0, 105902, 1, 0, "主さまがいつ戻って\n来ても平気なよう\n部屋を綺麗に保たねば");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2127, 2, 1, 1, 0, 105902, 1, 0, "節約のためにも\n自家菜園などするのは\nどうでしょう…　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2128, 3, 1, 1, 0, 105902, 1, 0, "アメスさまへの\nお祈りができそうな\n場所は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2129, 4, 1, 1, 0, 105902, 1, 0, "瞑想をすると\n心が安らぎます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2130, 5, 1, 1, 0, 105902, 1, 0, "都会の方の身なりを\n勉強した方が\n良いのでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2131, 101, 1, 8, 0, 105902, 1, 0, "わたくしの居場所は\n主さまのお傍です\nずっと、ずっと…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2132, 102, 1, 8, 0, 105902, 1, 0, "主さまの隣には\nわたくしが…\nわたくしの隣には\n主さまが…幸せです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2133, 1, 2, 1, 0, 105902, 1, 0, "主さま、なにか\nしてほしいことは\nありませんか？\n欲しいものは？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2134, 2, 2, 1, 0, 105902, 1, 0, "わたくし、背が伸び\nましたでしょうか？\n…そうですか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2135, 3, 2, 1, 0, 105902, 1, 0, "お出かけですか？\nわたくしもお供\nいたします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2136, 4, 2, 1, 0, 105902, 1, 0, "ひゃん！\n主さま…\nいじわるです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2137, 101, 2, 8, 0, 105902, 1, 0, "主さま、なにか御用は\nありませんか？\nわたくし、主さまの\nお役にたちたいのです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2138, 102, 2, 8, 0, 105902, 1, 0, "主さまの優しさに\nわたくしはいつも\n癒されています…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2139, 1, 2, 1, 0, 105902, 1, 1, "おはようございます♪\n主さまの可愛らしい\n寝顔、堪能致しました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2140, 2, 2, 1, 0, 105902, 1, 2, "のんびりした時間帯\nですね…ふぁ～…\nし、失礼致しました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2141, 3, 2, 1, 0, 105902, 1, 3, "ふむ、都会は夜でも\nこんなにも、にぎやか\nなのですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2142, 1, 3, 1, 0, 105902, 1, 0, "主さまに会う前に\n身なりを整えなくては\nいけませんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2143, 2, 3, 1, 0, 105902, 1, 0, "このふかふかの優しさ\n主さまのようです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2144, 3, 3, 1, 0, 105902, 1, 0, "かわいい♪\n主さまにそっくり♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2145, 4, 3, 1, 0, 105902, 1, 0, "この心地よさ…\n主さまのようです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2146, 5, 3, 1, 0, 105902, 1, 0, "ここで洗濯物を\n乾かせるでしょうか　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2147, 6, 3, 1, 0, 105902, 1, 0, "はぁっはぁっはぁっ\n…すべては\n主さまのため…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2148, 7, 3, 1, 0, 105902, 1, 0, "都会の味…\nとてもおいしいです\n…もぐもぐもぐ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2149, 8, 3, 1, 0, 105902, 1, 0, "都会のことを\n学ばないと…\nふむふむ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2151, 1, 2, 1, 0, 190801, 1, 0, "ふぁ～…あっ\n見られちゃい\nましたか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2152, 2, 2, 1, 0, 190801, 1, 0, "ギルドハウスの\n使い心地は\nどうですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2153, 3, 2, 1, 0, 190801, 1, 0, "ご用があれば\nなんでも言って\nくださいね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2154, 4, 2, 1, 0, 190801, 1, 0, "ときどきみなさんと\nクエストに行きたいな\nって思っちゃいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2155, 1, 2, 1, 0, 190801, 1, 1, "おはようございます！\nお掃除の方、\nはじめていきますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2156, 2, 2, 1, 0, 190801, 1, 2, "皆さん、お昼ごはんの\nご要望がありましたら\n用意致しますよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2157, 3, 2, 1, 0, 190801, 1, 3, "ここは夜でも\nにぎやかですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2158, 1, 1, 1, 0, 104701, 1, 0, "…\n少しうとうと\nしてしまった");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2159, 2, 1, 1, 0, 104701, 1, 0, "室内だし兜を脱ぐか\n…いや\nやはりやめておこう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2160, 3, 1, 1, 0, 104701, 1, 0, "部屋にいると\n鎧が蒸し暑くなるが\n我慢せねば…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2161, 4, 1, 1, 0, 104701, 1, 0, "仕事が門番だからか\n部屋にいても\nじっとしてしまう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2162, 5, 1, 1, 0, 104701, 1, 0, "少年と会話したことを\n思いだすと\n自然と楽しくなるな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2163, 101, 1, 4, 0, 104701, 1, 0, "少年のことを考えると\n顔がにやけてしまう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2164, 102, 1, 8, 0, 104701, 1, 0, "少年は今頃\n平和に過ごせて\nいるかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2165, 1, 2, 1, 0, 104701, 1, 0, "ん？　悪いが\n兜は脱がないぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2166, 2, 2, 1, 0, 104701, 1, 0, "私と遊びたいのか？\nそう言われても\n何をしていいやら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2167, 3, 2, 1, 0, 104701, 1, 0, "鎧が重くないかって？\n大丈夫。けっこう\n鍛えているからな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2168, 4, 2, 1, 0, 104701, 1, 0, "少年、寒くはないか？\nいや自分がこうなので\n人が薄着に見えてね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2169, 101, 2, 4, 0, 104701, 1, 0, "君といると、兜の中が\nいつもより暑いんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2170, 102, 2, 8, 0, 104701, 1, 0, "私としゃべりたい？\n物好きだな\nでも、嬉しいよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2171, 1, 2, 1, 0, 104701, 1, 1, "早いな少年\nえ？　私の仕事に\n合わせてくれたのか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2172, 2, 2, 1, 0, 104701, 1, 2, "昼食の誘い？\n嬉しいけど\n人前では食べないんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2173, 3, 2, 1, 0, 104701, 1, 3, "王宮騎士団の\n日報を書かなければ…\n『何事もなし』、と");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2175, 2, 3, 1, 0, 104701, 1, 0, "鎧を着ているから\n感触が分かりづらい\nのが残念だ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2176, 3, 3, 1, 0, 104701, 1, 0, "か、かわいいな…\n私には似合わないが\nぎゅ…ってしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2177, 4, 3, 1, 0, 104701, 1, 0, "良い香りだ…\n普段はどうしても\n鉄くさくなるからな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2178, 5, 3, 1, 0, 104701, 1, 0, "わかっていたけど\n鎧を着たまま暖炉に\nあたると暑い…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2180, 7, 3, 1, 0, 104701, 1, 0, "兜を脱がずに食べる\nうん、段々コツが\n掴めてきた…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2181, 8, 3, 1, 0, 104701, 1, 0, "兜があっても\n意外と本くらいは\n難なく読めるんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2183, 1, 1, 1, 0, 102601, 1, 0, "居心地よくて\nゴロゴロしちゃうよ～\n…いつも通りだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2184, 2, 1, 1, 0, 102601, 1, 0, "ドングリの木\n近くに生えてない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2185, 3, 1, 1, 0, 102601, 1, 0, "快適な寝床があれば\nそれだけで幸せだねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2186, 4, 1, 1, 0, 102601, 1, 0, "あたしと一緒に\nだらけてくれる人が\nいそうだねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2187, 5, 1, 1, 0, 102601, 1, 0, "ここなら牧場よりも\n速く配達が\n届きそうだね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2188, 101, 1, 4, 0, 102601, 1, 0, "あんパン買ったし\nあいつにも\n分けてあげよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2189, 102, 1, 8, 0, 102601, 1, 0, "あいつと一緒に\nだらけられたら\n最高に幸せだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2190, 1, 2, 1, 0, 102601, 1, 0, "ドングリでも\nつまみながら\n一緒にゲームしようよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2191, 2, 2, 1, 0, 102601, 1, 0, "横になりたいから\n枕になっておくれよ～\nあんたあったかいしさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2192, 3, 2, 1, 0, 102601, 1, 0, "ドングリあげるから\nあんパン買ってきて～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2193, 4, 2, 1, 0, 102601, 1, 0, "う～\n疲れちゃったよ～\nおんぶして運んで～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2194, 101, 2, 4, 0, 102601, 1, 0, "あんたといると\nリア充って\n感じがするよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2195, 102, 2, 8, 0, 102601, 1, 0, "あんたが一生\n世話してくれたら\n人生安泰なんだけどね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2196, 1, 2, 1, 0, 102601, 1, 1, "ふわ～っ…\nおはよう…あたしは\nまだ眠いよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2197, 2, 2, 1, 0, 102601, 1, 2, "そろそろお昼寝でも\nしたい気分だねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2198, 3, 2, 1, 0, 102601, 1, 3, "徹夜でゲームするけど\nあんたもどうだい？\nあたしは強いよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2200, 2, 3, 1, 0, 102601, 1, 0, "あ…だめだこれ。\n気持ち良くて\n落ちそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2201, 3, 3, 1, 0, 102601, 1, 0, "かわいいものに\n囲まれて寝るのも\nよさそうだねぇ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2202, 4, 3, 1, 0, 102601, 1, 0, "心身ともに\nリラックスした状態で\nぐうたら出来そうだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2203, 5, 3, 1, 0, 102601, 1, 0, "ふい～…\nごくらくごくらく…\n暖かいねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2205, 7, 3, 1, 0, 102601, 1, 0, "食べてすぐ寝ると\n牛になるって\n本当なのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2206, 8, 3, 1, 0, 102601, 1, 0, "おー！　この本なら\nあたしも居眠りせずに\n読めそうだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2208, 1, 1, 1, 0, 106301, 1, 0, "ランドソル…\nおっきな街だなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2209, 2, 1, 1, 0, 106301, 1, 0, "ロザリア…\nきっと、いるよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2210, 3, 1, 1, 0, 106301, 1, 0, "最近、弓の練習\nサボっちゃってるな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2211, 4, 1, 1, 0, 106301, 1, 0, "今日の私は\n森番じゃなくて\n家番だよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2212, 5, 1, 1, 0, 106301, 1, 0, "ちょっとだけ\n慣れてきたかも？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2213, 101, 1, 4, 0, 106301, 1, 0, "いつか、\nあの人と一緒に…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2214, 102, 1, 8, 0, 106301, 1, 0, "…なんか最近、\nあの人のこと\nばっかり…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2215, 1, 2, 1, 0, 106301, 1, 0, "もしよかったら\n街に出かけない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2216, 2, 2, 1, 0, 106301, 1, 0, "この部屋、\n妖精さんも\n気に入るかも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2217, 3, 2, 1, 0, 106301, 1, 0, "今日は\nなににしよっか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2218, 4, 2, 1, 0, 106301, 1, 0, "今日はどこ行く？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2219, 101, 2, 4, 0, 106301, 1, 0, "たまには二人で…\nな、なんちゃって！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2220, 102, 2, 8, 0, 106301, 1, 0, "最近、\nずっと楽しいんだ！\nあなたのおかげかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2221, 1, 2, 1, 0, 106301, 1, 1, "おはよう！\n今日も一緒に\n頑張ろうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2222, 2, 2, 1, 0, 106301, 1, 2, "お昼はどうする？\nあなたのオススメに\n連れて行って欲しいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2223, 3, 2, 1, 0, 106301, 1, 3, "ランドソルは\n夜でも賑やかだね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2225, 2, 3, 1, 0, 106301, 1, 0, "わぁっ！\nすっごく\nふわふわだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2226, 3, 3, 1, 0, 106301, 1, 0, "かわい～！\nぎゅってしたく\nなっちゃうかも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2227, 4, 3, 1, 0, 106301, 1, 0, "くんくん\nなんか…いい匂い？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2228, 5, 3, 1, 0, 106301, 1, 0, "すっごいなー\nあったかいなー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2230, 7, 3, 1, 0, 106301, 1, 0, "わぁっ、おいしい！\nもっと食べたい\nかも…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2231, 8, 3, 1, 0, 106301, 1, 0, "も、文字は苦手…\nでも、頑張らないと\nだよね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2233, 1, 1, 1, 0, 103601, 1, 0, "にんじんとピーマンを\n食べないでいい方法\nないかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2234, 2, 1, 1, 0, 103601, 1, 0, "カップケーキが\n食べたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2235, 3, 1, 1, 0, 103601, 1, 0, "予習が終わりました！\nさて、次は復習を\nしないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2236, 4, 1, 1, 0, 103601, 1, 0, "あの人の部屋にいる\n私って…もしかして\nふしんしゃなんじゃ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2237, 5, 1, 1, 0, 103601, 1, 0, "男の人は、みんな\nへんたいだと\n聞きました…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2238, 101, 1, 4, 0, 103601, 1, 0, "あの人に、一緒に\n遊んでほしいけど…\nな、なんていえば？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2239, 102, 1, 8, 0, 103601, 1, 0, "早く大人になりたいな\n…あの人と同じくらい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2240, 1, 2, 1, 0, 103601, 1, 0, "ぼ、防犯魔石を\n鳴らしますよ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2241, 2, 2, 1, 0, 103601, 1, 0, "へんたい！？　…\nあ、あなたでしたか～\nやっぱりへんたーい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2242, 3, 2, 1, 0, 103601, 1, 0, "これ宿題です\nやっておいて\nくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2243, 4, 2, 1, 0, 103601, 1, 0, "あ、遅刻ですよ\n待っていたんですから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2244, 101, 2, 4, 0, 103601, 1, 0, "にらめっこですか？\nあ、あなたの前で変顔\nするのはちょっと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2245, 102, 2, 8, 0, 103601, 1, 0, "あの…何歳まで\n子供だと思いますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2246, 1, 2, 1, 0, 103601, 1, 1, "顔を洗って、着替えて\n朝ごはんを食べて、\n歯を磨いて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2247, 2, 2, 1, 0, 103601, 1, 2, "て、鉄棒の練習！？　\nほ、他のことを\nしませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2248, 3, 2, 1, 0, 103601, 1, 3, "ね、眠くないです\n子供ではありません\nから…ふわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2250, 2, 3, 1, 0, 103601, 1, 0, "ひと休みしよっと\n………うん、\nひと休みおしまい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2251, 3, 3, 1, 0, 103601, 1, 0, "つ、つぶらな瞳には\n弱いんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2252, 4, 3, 1, 0, 103601, 1, 0, "リラックスできますね\n集中力も\n上がりそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2253, 5, 3, 1, 0, 103601, 1, 0, "あったかいと\n眠くなっちゃうな…\n勉強しなくちゃなのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2255, 7, 3, 1, 0, 103601, 1, 0, "ピーマンもこれくらい\nおいしければ\nいいのに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2256, 8, 3, 1, 0, 103601, 1, 0, "この本、むずかしい\n…もっと勉強\nがんばらなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2258, 1, 1, 1, 0, 101501, 1, 0, "今日はみんなに\nなにを読んで\nあげようかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2259, 2, 1, 1, 0, 101501, 1, 0, "子どもたちと同じ\n目線で考えるのが\n大事よね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2260, 3, 1, 1, 0, 101501, 1, 0, "お天気が良い日は\nみんなでお散歩に\n行きたいわね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2261, 4, 1, 1, 0, 101501, 1, 0, "鬼ごっこにかくれんぼ\n…みんなは\nどっちが好きかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2262, 5, 1, 1, 0, 101501, 1, 0, "お遊戯会の配役、\n考え出すと\n大変だわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2263, 101, 1, 4, 0, 101501, 1, 0, "彼は優しいから、\nきっと良い\nお父さんになるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2264, 102, 1, 8, 0, 101501, 1, 0, "彼には私がいないと\n…っていうのは少し\n過保護すぎるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2265, 1, 2, 1, 0, 101501, 1, 0, "保育園の行事を\n考えてるんだけど…\n良い案ないかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2266, 2, 2, 1, 0, 101501, 1, 0, "今度、子どもたちと\nおやつを作るから、\n食べに来てね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2267, 3, 2, 1, 0, 101501, 1, 0, "よかったら一緒に\n絵本を作らない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2268, 4, 2, 1, 0, 101501, 1, 0, "あなたはいつも元気ね\n先生も見習わないと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2269, 101, 2, 4, 0, 101501, 1, 0, "先生は\nずーっと、ずーっと、\nあなたの味方だからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2270, 102, 2, 8, 0, 101501, 1, 0, "あなたみたいな\nいい子をお世話できて\n先生は幸せものだわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2271, 1, 2, 1, 0, 101501, 1, 1, "おはよう～\nちゃんと朝ごはんは\n食べた？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2272, 2, 2, 1, 0, 101501, 1, 2, "お昼寝の時間ね♪\nあなたも一緒に\n寝ましょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2273, 3, 2, 1, 0, 101501, 1, 3, "すっかり真っ暗ね。\n今日も一日、\nよくできました♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2275, 2, 3, 1, 0, 101501, 1, 0, "ふかふかねぇ♪\n年甲斐もなく、\n飛び跳ねちゃいそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2276, 3, 3, 1, 0, 101501, 1, 0, "あらあら、かわいい！\n保育園のみんなに\n見せてあげたいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2277, 4, 3, 1, 0, 101501, 1, 0, "いい香りね～\n保育園にも\n置こうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2278, 5, 3, 1, 0, 101501, 1, 0, "寒い日は、ここで\n子どもたちに絵本を\n読んであげましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2280, 7, 3, 1, 0, 101501, 1, 0, "美味しい～♪\n遠足に持っていったら\nみんな喜びそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2281, 8, 3, 1, 0, 101501, 1, 0, "みんなが\n楽しめる読み聞かせの\n方法特集♪　素敵ねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2283, 1, 1, 1, 0, 104401, 1, 0, "世界の前に、\nこの部屋を征服\nしてやろう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2284, 2, 1, 1, 0, 104401, 1, 0, "拠点とはやはり\n斯くあるべきじゃの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2285, 3, 1, 1, 0, 104401, 1, 0, "眷属の物はわらわの物\n故に、この部屋は\nわらわの部屋じゃな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2286, 4, 1, 1, 0, 104401, 1, 0, "永く眠っている間に\n随分と世界は変わった\nようじゃな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2287, 5, 1, 1, 0, 104401, 1, 0, "うるさいのう～\nまったく、近頃の\n若いもんは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2288, 101, 1, 4, 0, 104401, 1, 0, "あやつが来てから\n動悸が治まらぬ…\n如何ような病で\nあろうかの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2289, 102, 1, 8, 0, 104401, 1, 0, "眷属よ、どこに行った\nのじゃ？\nわらわの世話を\n許可するのじゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2290, 1, 2, 1, 0, 104401, 1, 0, "いずれ世界は\n我が手中に収まる\nふふふ、\n楽しみじゃのう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2291, 2, 2, 1, 0, 104401, 1, 0, "眷属よ、わらわから\n離れてはならんぞ！\n子供に戻ってしまう\nではないか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2292, 3, 2, 1, 0, 104401, 1, 0, "トマトジュースが\n欲しいのじゃ！\n野菜ジュースでは\nダメだぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2293, 4, 2, 1, 0, 104401, 1, 0, "蚊にくわれたぞ！\nわらわの血を吸う\nとは～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2294, 101, 2, 4, 0, 104401, 1, 0, "こら、頭をなでるな\nお主はこの姿でも\n子供扱いするのか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2295, 102, 2, 8, 0, 104401, 1, 0, "お主が望むなら世界の\n半分をくれてやっても\n良いのじゃぞ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2296, 1, 2, 1, 0, 104401, 1, 1, "朝早くから感心じゃの\nさすがわらわの\n眷属じゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2297, 2, 2, 1, 0, 104401, 1, 2, "太陽は苦手じゃ…\nこの部屋の中で\n過ごそうぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2298, 3, 2, 1, 0, 104401, 1, 3, "夜も更けてきた！\nわらわ達の時間は\nこれからじゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2300, 2, 3, 1, 0, 104401, 1, 0, "よい座り心地じゃ\nわらわの玉座としよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2301, 3, 3, 1, 0, 104401, 1, 0, "可愛いではないか\nわらわの眷属に\nしてやろうかのう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2302, 4, 3, 1, 0, 104401, 1, 0, "うむ、良い気持ちじゃ\nこれを作った者、\n褒めてつかわすぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2303, 5, 3, 1, 0, 104401, 1, 0, "あたたかい…\n身も心も\n浄化されるようじゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2305, 7, 3, 1, 0, 104401, 1, 0, "吸血鬼のわらわが、\nこのようなもの…\nうまい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2306, 8, 3, 1, 0, 104401, 1, 0, "このまま大人の姿を\n保つ方法…どこかに\n書いてないかのう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2308, 1, 1, 1, 0, 105401, 1, 0, "いろんな人がいて\nいろんな服を着てて…\n目の保養になります♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2309, 2, 1, 1, 0, 105401, 1, 0, "レイ様への新作\nどんな服にしよう…\n方向性が絞れない～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2310, 3, 1, 1, 0, 105401, 1, 0, "忘れないうちに\n隠し糸のメンテナンス\nやっておこうっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2311, 4, 1, 1, 0, 105401, 1, 0, "むっ！　あの人の\nスリーサイズは…\nほほう…なるほど♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2312, 5, 1, 1, 0, 105401, 1, 0, "ノゾミさんの\n衣装はああして\nチカさんのは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2313, 101, 1, 4, 0, 105401, 1, 0, "私がアイドル…\n…実感ないけど\n精一杯やってみよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2314, 102, 1, 8, 0, 105401, 1, 0, "まさか私が\nアイドルになるなんて\n思ってなかったです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2315, 1, 2, 1, 0, 105401, 1, 0, "なんですかぁ？\n衣装作りで疲れて\n眠いんですぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2316, 2, 2, 1, 0, 105401, 1, 0, "あーっ！　また\n服がほつれてる…\nしょうがないですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2317, 3, 2, 1, 0, 105401, 1, 0, "はっ！　ちょうど今\n新しいデザインが\n思い浮かびました！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2318, 4, 2, 1, 0, 105401, 1, 0, "暇そうですね？\n時間あるなら仕事\n手伝ってください！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2319, 101, 2, 4, 0, 105401, 1, 0, "どうしました？\n新しい服が\n欲しくなりましたか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2320, 102, 2, 8, 0, 105401, 1, 0, "騎士さんのおかげで\nカルミナでも\n頑張れてますよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2321, 1, 2, 1, 0, 105401, 1, 1, "おはようございます…\nなんで朝って毎日\nやってくるんでしょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2322, 2, 2, 1, 0, 105401, 1, 2, "お腹空きましたね\n騎士さんはちゃんと\n御飯食べましたか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2323, 3, 2, 1, 0, 105401, 1, 3, "夜の方が\n作業が捗るのは\n私だけですかね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2325, 2, 3, 1, 0, 105401, 1, 0, "このふかふか具合\nいい素材を\n使ってますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2326, 3, 3, 1, 0, 105401, 1, 0, "小さくて可愛い♪\nそうだ！　レイ様の\nぬいぐるみを…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2327, 4, 3, 1, 0, 105401, 1, 0, "こういう時くらい\n何も考えずに\nリラックスしないと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2328, 5, 3, 1, 0, 105401, 1, 0, "炎を使った服って\nカッコ良いかも…\nでも材料がな～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2330, 7, 3, 1, 0, 105401, 1, 0, "何をするにも\n食事は大切！\n体力が資本です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2331, 8, 3, 1, 0, 105401, 1, 0, "私もいつか\nデザインを\nまとめて本に…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2333, 1, 1, 1, 0, 107501, 1, 0, "またお魚を\n捕りにいこうかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2334, 2, 1, 1, 0, 107501, 1, 0, "そろそろみんなも\nお腹が空くころ\nじゃないですか～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2335, 3, 1, 1, 0, 107501, 1, 0, "ここなら、\n日焼けの心配は\nありませんね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2336, 4, 1, 1, 0, 107501, 1, 0, "お刺身に焼き貝…\nお腹が魚介類を\n求めてますっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2337, 5, 1, 1, 0, 107501, 1, 0, "泳ぐのも食べるのも\n大得意です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2338, 101, 1, 4, 0, 107501, 1, 0, "あの人と二人で\n浜辺を散歩…\n素敵ですねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2339, 102, 1, 8, 0, 107501, 1, 0, "あの人に水着を\n褒めてもらえたら、\nすごく嬉しいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2340, 1, 2, 1, 0, 107501, 1, 0, "たまには釣りじゃなく\n一緒に素潜りでも\n行きませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2341, 2, 2, 1, 0, 107501, 1, 0, "男の子に水着を\n見られるのって\n少し緊張しちゃいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2342, 3, 2, 1, 0, 107501, 1, 0, "ギルドハウスの\nみんなとも、\n海に行きたいですね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2343, 4, 2, 1, 0, 107501, 1, 0, "あなたの水着、\n私が選んであげます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2344, 101, 2, 4, 0, 107501, 1, 0, "泳ぎの練習なら\n付き合いますよ！\n手取り足取り♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2345, 102, 2, 8, 0, 107501, 1, 0, "水着姿が好きなら\nいくらでも\n着てあげますよぉ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2346, 1, 2, 1, 0, 107501, 1, 1, "朝の海も\n幻想的で\nいいですよねぇ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2347, 2, 2, 1, 0, 107501, 1, 2, "お昼はみんなで、\n海鮮バーベキューとか\nどうでしょう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2348, 3, 2, 1, 0, 107501, 1, 3, "夜の海は星が\nきれいですよ！\n見に行きましょう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2350, 2, 3, 1, 0, 107501, 1, 0, "泳ぎ疲れたので\nちょっと休憩です～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2351, 3, 3, 1, 0, 107501, 1, 0, "あなたにも、\n可愛い水着を\n着せてあげたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2352, 4, 3, 1, 0, 107501, 1, 0, "なんだか、\nリゾート気分です…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2353, 5, 3, 1, 0, 107501, 1, 0, "ふい～、泳ぎで冷えた\n身体を暖めましょう～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2355, 7, 3, 1, 0, 107501, 1, 0, "おいひ～です～\nこれ、海水浴にも\n持っていきたいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2356, 8, 3, 1, 0, 107501, 1, 0, "南国のフルーツ図鑑\n…じゅるり…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2358, 10, 3, 1, 0, 107501, 1, 0, "わ～♪　おいしそ…\nか、かわいいですね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2359, 11, 3, 1, 0, 107501, 1, 0, "これくらい大きな貝…\n食べたいな～\n食べたいな～～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2360, 1, 1, 1, 0, 107601, 1, 0, "この格好で\n部屋をうろつくのは\n不思議な感じがします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2361, 2, 1, 1, 0, 107601, 1, 0, "南国の果実を使って\n主さまにデザートを\nお作りしましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2362, 3, 1, 1, 0, 107601, 1, 0, "せっかくの水着ですし\nこれから定期的に\n海水浴に行きたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2363, 4, 1, 1, 0, 107601, 1, 0, "海の生き物も、\n森の生き物に負けず\n可愛かったです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2364, 5, 1, 1, 0, 107601, 1, 0, "クロールの練習なら、\n部屋でもできそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2365, 101, 1, 4, 0, 107601, 1, 0, "主さまに、水着姿を\n褒めていただけた…\nえへへ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2366, 102, 1, 8, 0, 107601, 1, 0, "水着で主さまの\nお世話をしたら、\n喜びますでしょうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2367, 1, 2, 1, 0, 107601, 1, 0, "お疲れでしたら\nわたくしの膝を\nお使いくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2368, 2, 2, 1, 0, 107601, 1, 0, "主さま、海の家で\nつかうおこづかいを\n渡しておきますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2369, 3, 2, 1, 0, 107601, 1, 0, "海の美しさは、\n森とはちがう\n魅力がありました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2370, 4, 2, 1, 0, 107601, 1, 0, "この髪飾りですか？\n造花ですから\n水の中も平気です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2371, 101, 2, 4, 0, 107601, 1, 0, "水着でくっついて\n眠ると、いつもより\n密着して暖かいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2372, 102, 2, 8, 0, 107601, 1, 0, "はじめての海が、\n主さまと一緒で\n幸せです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2373, 1, 2, 1, 0, 107601, 1, 1, "おはようございます。\n泳ぎに行く準備は\n万端です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2374, 2, 2, 1, 0, 107601, 1, 2, "午後は泳ぐのをやめて\nスイカ割りなど\nいかがでしょう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2375, 3, 2, 1, 0, 107601, 1, 3, "夜も更けてきました…\n波の音を聞きながら\n少しお話しませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2377, 2, 3, 1, 0, 107601, 1, 0, "あぅ…この家具には、\n人をダメにする魔法が\nかけられています…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2378, 3, 3, 1, 0, 107601, 1, 0, "ふふっ♪\nあなたも、海水浴に\n行きますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2379, 4, 3, 1, 0, 107601, 1, 0, "この香り…\nきっと主さまも\n気に入ります");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2380, 5, 3, 1, 0, 107601, 1, 0, "これは暖かいです…\n後ほど主さまと一緒に\nあたりましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2382, 7, 3, 1, 0, 107601, 1, 0, "泳いだ後の食事は\n一段と美味しく\n感じます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2383, 8, 3, 1, 0, 107601, 1, 0, "深海魚の生態…\nこれは主さまにも\nお伝えしなくては…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2385, 10, 3, 1, 0, 107601, 1, 0, "顔立ちが、主さまに\n似ております…\nかわいらしい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2386, 11, 3, 1, 0, 107601, 1, 0, "ふかふかですね\n主さまのようです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2387, 1, 1, 1, 0, 107701, 1, 0, "お掃除、お掃除\nふんふふ～ん☆\nあ、聞かれてました？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2388, 2, 1, 1, 0, 107701, 1, 0, "日焼けには回復魔法が\n効きますよ。どうして\n逃げるんですか～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2389, 3, 1, 1, 0, 107701, 1, 0, "今日はドジを\nしませんように！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2390, 4, 1, 1, 0, 107701, 1, 0, "接客業を極めれば\nメイドとして\n成長できるかも？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2391, 5, 1, 1, 0, 107701, 1, 0, "水着って\n動きやすいんですけど\n人の目が気になります");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2392, 101, 1, 4, 0, 107701, 1, 0, "あの人の気持ちを知る\n魔法とかあれば…\nな、なんでもないです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2393, 102, 1, 8, 0, 107701, 1, 0, "水着でご奉仕したら、\nあの人は喜ぶかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2394, 1, 2, 1, 0, 107701, 1, 0, "暑いのでしたら、\n私が魔法で涼しく…\nえ？　いらない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2395, 2, 2, 1, 0, 107701, 1, 0, "何か御用ですか？\n特にないのでしたら、\nお話ししましょう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2396, 3, 2, 1, 0, 107701, 1, 0, "水着姿でも\nメイドはメイドです\nご奉仕しますよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2397, 4, 2, 1, 0, 107701, 1, 0, "ひゃっ！　あ、危うく\n転ぶところでした…\n…きゃうっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2398, 101, 2, 4, 0, 107701, 1, 0, "どうかしましたか？\nあなたの御用なら、\n喜んでお受けしますよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2399, 102, 2, 8, 0, 107701, 1, 0, "水着姿をあなたに\n見られると、\nドキドキしちゃいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2400, 1, 2, 1, 0, 107701, 1, 1, "朝は暑くてやる気が\n出ない？　でしたら、\nえぇい、元気になぁれ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2401, 2, 2, 1, 0, 107701, 1, 2, "お腹がぺこぺこなら、\nお昼は海の家で\n食べましょう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2402, 3, 2, 1, 0, 107701, 1, 3, "夜の浜辺でお散歩も\nいいですね。たくさん\n転びそうですけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2404, 2, 3, 1, 0, 107701, 1, 0, "休憩しながら、\nお掃除すれば\n一石二鳥です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2405, 3, 3, 1, 0, 107701, 1, 0, "きれいにすれば\nかわいさも倍増\nですよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2406, 4, 3, 1, 0, 107701, 1, 0, "素敵な香りです～\n救護院に置けば、\nみんな喜ぶかも～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2407, 5, 3, 1, 0, 107701, 1, 0, "あったかいですね…\nはっ！　いけません！\nメイドがサボるなんて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2409, 7, 3, 1, 0, 107701, 1, 0, "料理のできない\nメイドなんて…\nはぐはぐ、おいしい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2410, 8, 3, 1, 0, 107701, 1, 0, "水着姿で接客をすると\n売り上げが倍になる\n…本当ですか、これ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2412, 10, 3, 1, 0, 107701, 1, 0, "えへへ♪\n南の島まで\n乗せてください！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2413, 11, 3, 1, 0, 107701, 1, 0, "なんだか、\n人魚姫に\nなった気分です♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2414, 1, 1, 1, 0, 107801, 1, 0, "みんなで過ごす\n休日っていいわよね…\nずっと続かないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2415, 2, 1, 1, 0, 107801, 1, 0, "海に浮輪でぷかぷか\n浮かぶのって\n癖になりそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2416, 3, 1, 1, 0, 107801, 1, 0, "ビーチにいると\n日焼けが心配だわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2417, 4, 1, 1, 0, 107801, 1, 0, "水着姿って楽よね。\n室内だとちょっと\n落ち着かないけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2418, 5, 1, 1, 0, 107801, 1, 0, "お、泳ぎの練習なんて\nしないからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2419, 101, 1, 4, 0, 107801, 1, 0, "楽しすぎて立場を\n忘れそう…あんたの\nせいなんだから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2420, 102, 1, 8, 0, 107801, 1, 0, "みんなで遊んで\n美味しいもの食べて\nほんっとに楽しいっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2421, 1, 2, 1, 0, 107801, 1, 0, "マジであっついわね…\nよっし！　海に入って\n涼みましょ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2422, 2, 2, 1, 0, 107801, 1, 0, "シャワー浴びたばかり\nなのに…また、遊び\nたくなってきたわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2423, 3, 2, 1, 0, 107801, 1, 0, "遊び足りないって？\nしょうがないわね…\n付き合ってあげるわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2424, 4, 2, 1, 0, 107801, 1, 0, "一応伝えておくけど\n猫って水が苦手なの！\nわかった！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2425, 101, 2, 4, 0, 107801, 1, 0, "あたしと話したいの？\nふふ。\nまぁ、いいわよ。\nほら隣に座りなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2426, 102, 2, 8, 0, 107801, 1, 0, "こんなに楽しいの\n初めてかも…\nずっと続けばいいのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2427, 1, 2, 1, 0, 107801, 1, 1, "は、早起きしたのは、\n楽しみで眠れなかった\nからじゃないわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2428, 2, 2, 1, 0, 107801, 1, 2, "昼食後のストレッチ\n終わり！　さあ、\nビーチが待ってるわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2429, 3, 2, 1, 0, 107801, 1, 3, "夜の海に散歩に\n行こうかな～\nあんたも来なさいよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2431, 2, 3, 1, 0, 107801, 1, 0, "海ではしゃぎすぎて\n疲れたわ…ちょっと\n休もうかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2432, 3, 3, 1, 0, 107801, 1, 0, "こんな魔物がいたら\n操るのも楽しいかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2433, 4, 3, 1, 0, 107801, 1, 0, "にゃう～♪\nまるで南国にいる\n気分ね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2434, 5, 3, 1, 0, 107801, 1, 0, "あったかぁい♪\n身体が冷えてきたから\n丁度いいわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2436, 7, 3, 1, 0, 107801, 1, 0, "運動後のご飯って\nなんでこんなに\n美味しいんだろ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2437, 8, 3, 1, 0, 107801, 1, 0, "どんなカナヅチでも、\n絶対必ず泳げる方法、\n書いてないかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2439, 10, 3, 1, 0, 107801, 1, 0, "あんたもあたしが\n操ってあげる！\nなんてね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2440, 11, 3, 1, 0, 107801, 1, 0, "リゾートリゾートっ\nのんびりしましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2441, 1, 1, 1, 0, 108001, 1, 0, "ここなら思う存分\nデスクワークに\n励めるわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2442, 2, 1, 1, 0, 108001, 1, 0, "武器のメンテナンスも\nしっかりしないと\n最高効率は望めないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2443, 3, 1, 1, 0, 108001, 1, 0, "準備をしっかり整えて\nもっともっと\n稼がなくちゃね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2444, 4, 1, 1, 0, 108001, 1, 0, "少し休んだら\n次のバイトに\n行ってくるわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2445, 5, 1, 1, 0, 108001, 1, 0, "この格好でここに\nいるのって\n気恥ずかしいわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2446, 101, 1, 4, 0, 108001, 1, 0, "キミが望むなら\n今日のバイト\n休んでもいいわよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2447, 102, 1, 8, 0, 108001, 1, 0, "キミだけね…\n私のことをここまで\n理解してくれるのは");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2448, 1, 2, 1, 0, 108001, 1, 0, "普段と違う格好\nだからって\nそんなに見ないでよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2449, 2, 2, 1, 0, 108001, 1, 0, "キミを立派な\nバイト戦士にするのが\n師匠としての役目よね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2450, 3, 2, 1, 0, 108001, 1, 0, "そろそろ次のバイトに\n行かないと…\nキミも一緒に来る？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2451, 4, 2, 1, 0, 108001, 1, 0, "効率は大事だけど\nゆっくりするのも\n悪くないわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2452, 101, 2, 4, 0, 108001, 1, 0, "一緒の時間が楽しくて\nバイトのことを\n忘れちゃいそうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2453, 102, 2, 8, 0, 108001, 1, 0, "キミと一緒なら\nどんなミッションも\n楽勝ね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2454, 1, 2, 1, 0, 108001, 1, 1, "おはよう、いい朝ね！\n今日もめいっぱい\n稼ぐわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2455, 2, 2, 1, 0, 108001, 1, 2, "もうお昼だったのね…\n内職のバイトに\n集中しすぎちゃったわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2456, 3, 2, 1, 0, 108001, 1, 3, "スケジュールは、と…\nこういう管理の徹底が\n効率を生み出すのよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2458, 2, 3, 1, 0, 108001, 1, 0, "しっかり働いて休む…\n最高効率にまた一歩\n近づいたわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2459, 3, 3, 1, 0, 108001, 1, 0, "なごんじゃうわね…\nよぉし、次のバイトも\n頑張らないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2460, 4, 3, 1, 0, 108001, 1, 0, "いい香りね…\n働く意欲が\n湧いてくるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2461, 5, 3, 1, 0, 108001, 1, 0, "身体が冷えたから\n助かるわ…冷えは\n女の天敵だもの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2463, 7, 3, 1, 0, 108001, 1, 0, "海のバイトは\n体力勝負よ\nエネルギーはしっかり\n摂取しないとね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2464, 8, 3, 1, 0, 108001, 1, 0, "座学も大切ね\nもっと知識を\n身につけないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2466, 10, 3, 1, 0, 108001, 1, 0, "海の楽園みたいね…\n今だけは効率を\n忘れちゃいそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2467, 11, 3, 1, 0, 108001, 1, 0, "落ち着くわ…\n海とひとつになった\n気分ね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2468, 1, 1, 1, 0, 107901, 1, 0, "ちょっと休憩にゃ～\n潮風は体に\n良くないにゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2469, 2, 1, 1, 0, 107901, 1, 0, "猫グッズで\n海の家を飾りたいにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2470, 3, 1, 1, 0, 107901, 1, 0, "海の幸は美味しいけど\n水はイヤだにゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2471, 4, 1, 1, 0, 107901, 1, 0, "開店にゃ！\nこのたい焼きなら\nきっと大繁盛にゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2472, 5, 1, 1, 0, 107901, 1, 0, "海と言えば水着にゃ\n似合ってるかにゃ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2473, 101, 1, 4, 0, 107901, 1, 0, "キミが頼むなら\n手伝ってあげても\nいいにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2474, 102, 1, 8, 0, 107901, 1, 0, "あたしの宝は\nここにあるにゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2475, 1, 2, 1, 0, 107901, 1, 0, "にゃ？\nそんなに見つめても\n何も出ないにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2476, 2, 2, 1, 0, 107901, 1, 0, "今からキミを\nあたしの相棒に\n任命するにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2477, 3, 2, 1, 0, 107901, 1, 0, "これから\n開店の準備にゃ\nキミも手伝って\nくれるのかにゃ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2478, 4, 2, 1, 0, 107901, 1, 0, "海の家で出す\n新しいメニューを\n考え中なのにゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2479, 101, 2, 4, 0, 107901, 1, 0, "キミと一緒なら\n売上げナンバーワンに\nなれるにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2480, 102, 2, 8, 0, 107901, 1, 0, "キミと一緒にいると\n楽しくて、もっと\nいたくなるにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2481, 1, 2, 1, 0, 107901, 1, 1, "おはようにゃ！\n今日も頑張って\nいくにゃー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2482, 2, 2, 1, 0, 107901, 1, 2, "お腹すいたにゃ～…\nお魚、ちょっとだけ、\nつまみ食いするにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2483, 3, 2, 1, 0, 107901, 1, 3, "明日の準備は万端にゃ\nいつでも\n出発できるにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2485, 2, 3, 1, 0, 107901, 1, 0, "このふかふか具合\nまるで子猫の\n毛並みのようにゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2486, 3, 3, 1, 0, 107901, 1, 0, "にゃにゃ～\nなんてかわいさにゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2487, 4, 3, 1, 0, 107901, 1, 0, "この匂い…\nもう少し香ばしいと\nいいかもしれないにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2488, 5, 3, 1, 0, 107901, 1, 0, "にゃ～…\nあったかくて\nぬくぬくだにゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2490, 7, 3, 1, 0, 107901, 1, 0, "働くにはまず体力にゃ\nしっかり食べて\nスタミナアップ\nだにゃ!");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2491, 8, 3, 1, 0, 107901, 1, 0, "ふむふむ…\nここにお宝が\n眠ってるんだにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2493, 10, 3, 1, 0, 107901, 1, 0, "シードレイクにゃ！\n本物は怖かったけど、\nぬいぐるみなら\nかわいいにゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2494, 11, 3, 1, 0, 107901, 1, 0, "貝なのにふかふかの\nクッションにゃ！\n屋台の前にも\n置いてみたいにゃあ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2495, 1, 1, 1, 0, 103701, 1, 0, "人の家って、道場とは\n違った香りがするね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2496, 2, 1, 1, 0, 103701, 1, 0, "ちょっと退屈だね…\nあの人をからかいに\n行こうかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2497, 3, 1, 1, 0, 103701, 1, 0, "普通の女の子みたいに\n遊びたいって思う\nこともあるんだよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2498, 4, 1, 1, 0, 103701, 1, 0, "剣の手入れを怠らない\nようにしないと。\nいざという時、困るし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2499, 5, 1, 1, 0, 103701, 1, 0, "もっと\n上手く立ち回って\n出世したいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2500, 101, 1, 4, 0, 103701, 1, 0, "おかえりなさい！\nふふ、なんだか奥さん\nになった気分だよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2501, 102, 1, 8, 0, 103701, 1, 0, "恥ずかしくて、あなた\nを見られないよ…\n私らしくないなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2502, 1, 2, 1, 0, 103701, 1, 0, "私、お話好きなんだ。\nどうせなら楽しい話を\nしたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2503, 2, 2, 1, 0, 103701, 1, 0, "女の子っぽい子と、\n男勝りな子、あなたは\nどっちが好き？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2504, 3, 2, 1, 0, 103701, 1, 0, "そろそろ見回りの\n時間かな。あなたも\n一緒に行く？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2505, 4, 2, 1, 0, 103701, 1, 0, "構って欲しいのかな？\nそれじゃ一緒に\nランニングに行こうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2506, 101, 2, 4, 0, 103701, 1, 0, "二人で出かけるなら、\n手を繋がないとね。\nあはは、冗談冗談♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2507, 102, 2, 8, 0, 103701, 1, 0, "ねえ、あなた♪\nおや、顔が真っ赤だ！\n…ふふ、私も、かな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2508, 1, 2, 1, 0, 103701, 1, 1, "私は朝から鍛錬だよ。\n慣れてるけど大変だ。\nお互いに頑張ろうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2509, 2, 2, 1, 0, 103701, 1, 2, "鍛錬でお腹ぺこぺこ。\nお昼ごはんが\n楽しみだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2510, 3, 2, 1, 0, 103701, 1, 3, "今日も一日見回りと\n鍛錬を頑張ったよ。\nあなたもお疲れさま");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2512, 2, 3, 1, 0, 103701, 1, 0, "いざという時のため\nにも、休憩は大事だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2513, 3, 3, 1, 0, 103701, 1, 0, "こういうものには\n今まで\n縁がなかったけど。\nうん、可愛いね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2514, 4, 3, 1, 0, 103701, 1, 0, "精神統一に通じる\nものがあるね。\nふぅ、癒されるなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2515, 5, 3, 1, 0, 103701, 1, 0, "あったかいなぁ。\nたまにはのんびり\nしようか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2517, 7, 3, 1, 0, 103701, 1, 0, "鍛錬後はすごくお腹が\n空くんだよね。\nう～ん、おいしい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2518, 8, 3, 1, 0, 103701, 1, 0, "剣術書だけで強くなる\nには飛びぬけた才能と\n努力が必要だよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2520, 1, 1, 1, 0, 100501, 1, 0, "正義の刃で\n悪を挫く！\n…キマったッス♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2521, 2, 1, 1, 0, 100501, 1, 0, "ヒーローの\n秘密特訓を\n始めるッスよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2522, 3, 1, 1, 0, 100501, 1, 0, "正義の味方目指して\n今日も明日も\n全力ッスよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2523, 4, 1, 1, 0, 100501, 1, 0, "一日一善！\nヒーローだったら\n当たり前ッス♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2524, 5, 1, 1, 0, 100501, 1, 0, "どうッスか\nこのポーズ！\nイイ感じッスか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2525, 101, 1, 4, 0, 100501, 1, 0, "た、たまには\nよく頑張ったねって\n褒めてほしいッス…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2526, 102, 1, 8, 0, 100501, 1, 0, "自分を信じてくれる\nあんたと一緒なら\n何でもやれるッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2527, 1, 2, 1, 0, 100501, 1, 0, "おつかれッス♪\n冒険の準備は\nばっちりッスよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2528, 2, 2, 1, 0, 100501, 1, 0, "どうしたんッスか？\n…はっ！　もしや敵が\n迫ってるんスかっ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2529, 3, 2, 1, 0, 100501, 1, 0, "べ、別に\n頭を撫でてほしいとか\n思ってないッスよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2530, 4, 2, 1, 0, 100501, 1, 0, "スーパーヒーロー\nトラタイガーは\n絶対無敵ッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2531, 101, 2, 4, 0, 100501, 1, 0, "あんたと自分で\n正義の心を燃やして\n悪を一網打尽ッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2532, 102, 2, 8, 0, 100501, 1, 0, "あんたと一緒だと\n幸せな気持ちに\nなるんッス…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2533, 1, 2, 1, 0, 100501, 1, 1, "お、早いッスね～♪\n今日も一日一善\nよろしくッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2534, 2, 2, 1, 0, 100501, 1, 2, "一休みしながら\nヒーローについて\n語り合うッスよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2535, 3, 2, 1, 0, 100501, 1, 3, "夜のパトロールで\n一緒に平和を\n守るッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2537, 2, 3, 1, 0, 100501, 1, 0, "ふぅぅ…\n落ち着くッスね\n戦士の休息ッス♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2538, 3, 3, 1, 0, 100501, 1, 0, "くぅぅ、可愛いッス…\nヒーローが守るべき\n愛らしさッスね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2539, 4, 3, 1, 0, 100501, 1, 0, "なんスかこの香り？\nすぅぅ…ふぅぅ…\n力がみなぎるッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2540, 5, 3, 1, 0, 100501, 1, 0, "優しい光ッスね…\nヒーローの優しさ\nそのものッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2542, 7, 3, 1, 0, 100501, 1, 0, "あむあむあむ…\nんぅう、元気が溢れて\n止まらないッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2543, 8, 3, 1, 0, 100501, 1, 0, "トラタイガーのお話は\n笑いあり涙ありで\n超おすすめッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2545, 1, 1, 1, 0, 108101, 1, 0, "ハッピーハロウィン\nお父さん、お菓子は…\n食べられないね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2546, 2, 1, 1, 0, 108101, 1, 0, "トリックオアトリート\nお菓子をくれないと\n不吉な占いをします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2547, 3, 1, 1, 0, 108101, 1, 0, "ふふ、あなたの後ろで\n霊のみなさんが\n踊り始めました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2548, 4, 1, 1, 0, 108101, 1, 0, "霊感がいつも以上に\n冴えているので\n占いの調子も良好です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2549, 5, 1, 1, 0, 108101, 1, 0, "父はハロウィンが\n大好きだそうです\n大胆な格好をする子が\n多いので…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2550, 101, 1, 4, 0, 108101, 1, 0, "あなたは霊たちにも\n大人気ですよね\n私も見てほしいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2551, 102, 1, 8, 0, 108101, 1, 0, "ハロウィンの賑やかさ\n今は好きです…\nあなたといられるので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2552, 1, 2, 1, 0, 108101, 1, 0, "霊のみなさんとの\nダンスパーティー…\n楽しみです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2553, 2, 2, 1, 0, 108101, 1, 0, "お父さん、元気だね\nえ？　ここは色んな\n女の子に会えて幸せ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2554, 3, 2, 1, 0, 108101, 1, 0, "ハロウィンのお菓子\n食べすぎちゃったな…\nでも、美味しかった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2555, 4, 2, 1, 0, 108101, 1, 0, "あなたの女難の相…\n悪化していますね\nお祓いが必要かも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2556, 101, 2, 4, 0, 108101, 1, 0, "あの、霊のみなさんが\nあなたと踊りたいと…\nえっと、私も…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2557, 102, 2, 8, 0, 108101, 1, 0, "あなたと手を繋ぐと\n胸が苦しくなります\nでも、繋ぎたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2558, 1, 2, 1, 0, 108101, 1, 1, "ハッピーハロウィン…\n父が元気なので\n今日の運気は良好です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2559, 2, 2, 1, 0, 108101, 1, 2, "父はお昼寝中です\n本当に寝ているかは\n私にも分かりませんが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2560, 3, 2, 1, 0, 108101, 1, 3, "お父さん、\nもう眠っちゃったの？\n…眠れるんだったっけ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2562, 2, 3, 1, 0, 108101, 1, 0, "落ち着きますね…\n霊のみなさんも\n喜んでいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2563, 3, 3, 1, 0, 108101, 1, 0, "つん、つん。ふふっ♪\n癒やされます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2564, 4, 3, 1, 0, 108101, 1, 0, "精神が研ぎ澄まされる\n香りですね…\n占いが捗ります");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2565, 5, 3, 1, 0, 108101, 1, 0, "あったかいね\nお父さん…\nえ？　分からない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2567, 7, 3, 1, 0, 108101, 1, 0, "霊のみなさんは\n食べられないので…\n私がいただきます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2568, 8, 3, 1, 0, 108101, 1, 0, "お父さんを元に戻す\n手掛かり…\n書かれていないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2570, 12, 3, 1, 0, 108101, 1, 0, "わぁ、お菓子が沢山…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2572, 1, 1, 1, 0, 108201, 1, 0, "無料でプリンが\nもらえるなんて、\nハロウィンはすごいの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2573, 2, 1, 1, 0, 108201, 1, 0, "生きてるときも、\nミヤコはハロウィンが\n好きだった気がするの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2574, 3, 1, 1, 0, 108201, 1, 0, "みんなに仮装を\n見せつけて、\nプリンをもらうの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2575, 4, 1, 1, 0, 108201, 1, 0, "この仮装で、\nみんなに恐怖を\n教えてやるの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2576, 5, 1, 1, 0, 108201, 1, 0, "アオーン、アオーン！\nミヤコ、狼女に\nなりきってるの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2577, 101, 1, 4, 0, 108201, 1, 0, "アイツに秘密で、\nパーティーの\n飾り付けをするの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2578, 102, 1, 8, 0, 108201, 1, 0, "アイツが狼男の\n仮装をすれば、\nおそろいなの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2579, 1, 2, 1, 0, 108201, 1, 0, "プリンをくれなきゃ、\nオマエをカボチャに\nしてやるの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2580, 2, 2, 1, 0, 108201, 1, 0, "ハロウィンは幽霊でも\n参加できるから\n楽しいの～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2581, 3, 2, 1, 0, 108201, 1, 0, "プリンがないなら\nカボチャプリンを\n食べればいいの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2582, 4, 2, 1, 0, 108201, 1, 0, "プリンの可能性は\n無限大なの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2583, 101, 2, 4, 0, 108201, 1, 0, "オマエの隣で\nプリンを食べると、\nいつもより美味しいの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2584, 102, 2, 8, 0, 108201, 1, 0, "オマエが死んでも、\nミヤコはずーっと\n一緒にいてやるの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2585, 1, 2, 1, 0, 108201, 1, 1, "朝ごはんは\nカボチャプリンなの！\nハロウィンっぽいの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2586, 2, 2, 1, 0, 108201, 1, 2, "ランチは豪華に\nプリンアラモードなの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2587, 3, 2, 1, 0, 108201, 1, 3, "夜は幽霊たちと\nハロウィンするの！\nオマエも来るの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2589, 2, 3, 1, 0, 108201, 1, 0, "幽霊にも休息は\n必要なの！\nプリンもってこいなの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2590, 3, 3, 1, 0, 108201, 1, 0, "オマエもミヤコの\nパーティーに\n招待してあげるの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2591, 4, 3, 1, 0, 108201, 1, 0, "癒されるの～\nまるで天国なの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2592, 5, 3, 1, 0, 108201, 1, 0, "ここでなら、\n焼きプリンが\n作れるの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2594, 7, 3, 1, 0, 108201, 1, 0, "腹が減っては\nハロウィンは\nできぬなの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2595, 8, 3, 1, 0, 108201, 1, 0, "丸ごとカボチャ\nプリン特集！？\n美味しそうなの～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2597, 12, 3, 1, 0, 108201, 1, 0, "お菓子がたくさんで、\nミヤコはとっても\nハッピーなの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2599, 1, 1, 1, 0, 108301, 1, 0, "魔女以外にも、\n色々な仮装を\nしてみたいわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2600, 2, 1, 1, 0, 108301, 1, 0, "チョコやアメよりも、\nアタシに相応しい\nスイーツがあるはず…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2601, 3, 1, 1, 0, 108301, 1, 0, "お菓子の食べ過ぎは、\nお母さんに\n怒られるかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2602, 4, 1, 1, 0, 108301, 1, 0, "この格好で学院に\n行ったら、\nみんな驚くかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2603, 5, 1, 1, 0, 108301, 1, 0, "大人のレディは、\nどういうハロウィンを\n過ごすべきかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2604, 101, 1, 4, 0, 108301, 1, 0, "お菓子、アイツの分も\nとっといてあげよ！\n大人の余裕ってやつね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2605, 102, 1, 8, 0, 108301, 1, 0, "アイツを魅了する\n魔法とかないかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2606, 1, 2, 1, 0, 108301, 1, 0, "おしゃれスイーツを\nくれなきゃ\nイタズラするわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2607, 2, 2, 1, 0, 108301, 1, 0, "アタシの大人センスで\nアンタに似合う仮装を\n選んであげるわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2608, 3, 2, 1, 0, 108301, 1, 0, "不気味よねぇ…\nジャックオーランタン\nこ、怖くないわよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2609, 4, 2, 1, 0, 108301, 1, 0, "ハロウィンが楽しくて\n宿題やり忘れてたわ…\nて、手伝って～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2610, 101, 2, 4, 0, 108301, 1, 0, "お菓子をもらうのも\nアンタと一緒なら\n恥ずかしくないわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2611, 102, 2, 8, 0, 108301, 1, 0, "アタシのエスコートを\n任せられるのは、\nアンタだけなんだから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2612, 1, 2, 1, 0, 108301, 1, 1, "朝食はオシャレに\nグリーンスムージー！\n…に、にがぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2613, 2, 2, 1, 0, 108301, 1, 2, "昼下がりはカフェで\n優雅なティータイム\n…憧れるわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2614, 3, 2, 1, 0, 108301, 1, 3, "ハロウィンナイトの\nはじまりよ！\n街に繰り出しましょ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2616, 2, 3, 1, 0, 108301, 1, 0, "あう～、お菓子の\n食べすぎで\n動けな～い");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2617, 3, 3, 1, 0, 108301, 1, 0, "アンタも仮装する？\nいまよりもーっと\nかわいくなるわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2618, 4, 3, 1, 0, 108301, 1, 0, "大人な香りに\n包まれてる～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2619, 5, 3, 1, 0, 108301, 1, 0, "ポカポカね～♪\n…ああー！\nチョコが溶けてる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2621, 7, 3, 1, 0, 108301, 1, 0, "おいしい～♪\n…じゃなくて！\nび、美味ですわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2622, 8, 3, 1, 0, 108301, 1, 0, "この服かわい～♪\nって、なにこの値段！\nお小遣い何年分よ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2624, 12, 3, 1, 0, 108301, 1, 0, "お、お菓子なんかで\n喜ぶほど、子供じゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2626, 1, 1, 1, 0, 107101, 1, 0, "次はどんな策で団長を\nからかってみようか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2627, 2, 1, 1, 0, 107101, 1, 0, "む？\n血の臭いがするな\n祭りの時間か☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2628, 3, 1, 1, 0, 107101, 1, 0, "平和に飼い殺される\n前に、混沌の愛を\n育みたいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2629, 4, 1, 1, 0, 107101, 1, 0, "本気を出した団長と\nいつか手加減なしに\n殺り合いたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2630, 5, 1, 1, 0, 107101, 1, 0, "おばさん呼ばわりする\n新米騎士の小娘を\n懲らしめてやろうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2631, 101, 1, 4, 0, 107101, 1, 0, "胸を触られるまで\n誓約のことなど\nすっかり忘れていたな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2632, 102, 1, 8, 0, 107101, 1, 0, "まさかこのワタシが\nプロポーズするとはな\n…笑えるじゃないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2633, 1, 2, 1, 0, 107101, 1, 0, "面白い暇つぶしを\n思いついたんだ\n戯れに付き合え☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2634, 2, 2, 1, 0, 107101, 1, 0, "退屈で死にそうだ\n愉しい話題を\nワタシに提供してくれ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2635, 3, 2, 1, 0, 107101, 1, 0, "なんだ、暇なのか？\n心躍ることでも探しに\n出かけようではないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2636, 4, 2, 1, 0, 107101, 1, 0, "このワタシを愉快に\nさせてくれる事でも\nあったのか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2637, 101, 2, 4, 0, 107101, 1, 0, "ワタシに求婚した男の\n数だと？\nいちいち覚えてないな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2638, 102, 2, 8, 0, 107101, 1, 0, "最強無敵の女と\n結婚できるんだ\n誇りに思えよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2639, 1, 2, 1, 0, 107101, 1, 1, "なにか愉快なことが\n起こりそうな朝だ☆\nワクワクするね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2640, 2, 2, 1, 0, 107101, 1, 2, "うーむ、腹がすいたな\n愉快なことで\nこの空腹を満たしたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2641, 3, 2, 1, 0, 107101, 1, 3, "これからは大人の\n時間だ。愉しみ方を\n知りたいのかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2643, 2, 3, 1, 0, 107101, 1, 0, "このワタシとした事が\n穏やかな気分に\nなってしまうとは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2644, 3, 3, 1, 0, 107101, 1, 0, "可愛い姿をしたものが\n惨たらしい\n醜態を晒すのを\n想像してしまう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2645, 4, 3, 1, 0, 107101, 1, 0, "悪くはない香りだ\nだが、ワタシは血の\n臭いを嗅ぎたいぞ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2646, 5, 3, 1, 0, 107101, 1, 0, "ぬるい、ぬるすぎる！\n地獄の業火には\nほど遠い熱さだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2648, 7, 3, 1, 0, 107101, 1, 0, "ワタシの腕前に\n勝るとも劣らない\nなかなかの味だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2649, 8, 3, 1, 0, 107101, 1, 0, "意中の男性を絶対に\n落とす方法…？\nく、下らんっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2651, 1, 1, 1, 0, 105601, 1, 0, "明日はあの釣り場に\n行くとしようかな\nあの子も誘ってみるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2652, 2, 1, 1, 0, 105601, 1, 0, "ぷはーっ！\n体を動かしたあとの\n一杯は格別だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2653, 3, 1, 1, 0, 105601, 1, 0, "天気が良いと\n昼寝か釣りかで\n迷っちまうな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2654, 4, 1, 1, 0, 105601, 1, 0, "大物が釣れたときの\n快感は、他じゃ\n味わえないね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2655, 5, 1, 1, 0, 105601, 1, 0, "ふあぁ～…\n昼寝でもするか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2656, 101, 1, 4, 0, 105601, 1, 0, "ふふっ…\nあの子、見た目より\n根性あるんだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2657, 102, 1, 8, 0, 105601, 1, 0, "あの子が強くなるには\nどんな魚を食べさせて\nあげればいいのやら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2658, 1, 2, 1, 0, 105601, 1, 0, "姉御って呼ぶんじゃ\nないよ。からかうと\nタダじゃおかないよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2659, 2, 2, 1, 0, 105601, 1, 0, "釣りのコツ？\n何事も経験が大事だ\n今から行くかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2660, 3, 2, 1, 0, 105601, 1, 0, "どうしたのさ？\n助太刀が必要かい？\nアタシにまかせときな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2661, 4, 2, 1, 0, 105601, 1, 0, "困ってる人がいたら\nまた力を貸しておくれ\n頼りにしてるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2662, 101, 2, 4, 0, 105601, 1, 0, "なにか困りごとかい？\nどうやら昼寝は\nまた今度だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2663, 102, 2, 8, 0, 105601, 1, 0, "よしよし！\nお人好しのお前さんを\n労ってあげるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2664, 1, 2, 1, 0, 105601, 1, 1, "おはよう、お前さん\n魚屋は早起きでなきゃ\nつとまらないよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2665, 2, 2, 1, 0, 105601, 1, 2, "昼飯かい？　今朝\n仕入れた魚があるんだ\n食べてみるかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2666, 3, 2, 1, 0, 105601, 1, 3, "夜釣りにぴったりの\n月が出てるよ\nいい釣りが出来そうだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2668, 2, 3, 1, 0, 105601, 1, 0, "コイツに座って\nのんびり釣りが\nできりゃいいのにな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2669, 3, 3, 1, 0, 105601, 1, 0, "よしよし…♪\nおっと、かわいい物も\nつい抱きしめちまうな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2670, 4, 3, 1, 0, 105601, 1, 0, "これで魚の臭いを\n消せれば、猫も\n寄らなくなるのかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2671, 5, 3, 1, 0, 105601, 1, 0, "冬場の釣りも\nこれくらい暖かけりゃ\nいいんだけどね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2673, 7, 3, 1, 0, 105601, 1, 0, "腹が減っては\n釣りもできぬ、ってな\nまずは腹ごしらえだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2674, 8, 3, 1, 0, 105601, 1, 0, "へぇ…こんな魚が\nいたとは…いつか\n釣りたいもんだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2676, 1, 1, 1, 0, 101301, 1, 0, "流石に室内で\n魔法ぶっぱしたら\n怒られるよねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2677, 2, 1, 1, 0, 101301, 1, 0, "可愛い女の子が\nたくさんいる！\nここは楽園か！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2678, 3, 1, 1, 0, 101301, 1, 0, "みんなに漫画とか\n勧めてみようかな！\n布教用のがあるし！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2679, 4, 1, 1, 0, 101301, 1, 0, "わ、私一人の\n部屋じゃないから\n色々自重せねば！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2680, 5, 1, 1, 0, 101301, 1, 0, "「ぬるぽ」\n…くっ、\n誰も反応なしか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2681, 101, 1, 4, 0, 101301, 1, 0, "次はどの漫画を\n貸そうかなー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2682, 102, 1, 8, 0, 101301, 1, 0, "次の定期巡回で\nとっておきの店に\n連れてってあげよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2683, 1, 2, 1, 0, 101301, 1, 0, "君に似合いそうな\n衣装を買ったよ！\n君もいざ魔法少女に！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2684, 2, 2, 1, 0, 101301, 1, 0, "さあ！\n暇なら定期巡回に\nレッツラゴー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2685, 3, 2, 1, 0, 101301, 1, 0, "戦闘だけじゃなくて、\n日常にも役立つ\n魔法を習得したいね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2686, 4, 2, 1, 0, 101301, 1, 0, "新魔法思いついた！\n私って天才！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2687, 101, 2, 4, 0, 101301, 1, 0, "決め台詞は超大事！\n君の決め台詞も\n私が考えてあげよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2688, 102, 2, 8, 0, 101301, 1, 0, "私ってもしやリア充？\n…そんなバカな！\n非リア代表のはずが！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2689, 1, 2, 1, 0, 101301, 1, 1, "おはよー…\n徹夜で本読んでたから\nまだ眠い～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2690, 2, 2, 1, 0, 101301, 1, 2, "昼飯食べて、\n午後の定期巡回も\n頑張りましょー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2691, 3, 2, 1, 0, 101301, 1, 3, "夜からが、\nオタ活本番でしょ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2693, 2, 3, 1, 0, 101301, 1, 0, "ふいー！\nくつろいで本を読む！\n最高だねー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2694, 3, 3, 1, 0, 101301, 1, 0, "君、可愛いね～♪\n魔法少女の\n使い魔みたい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2695, 4, 3, 1, 0, 101301, 1, 0, "良い匂いに\n釣られてしまった…\nまさか、孔明の罠！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2696, 5, 3, 1, 0, 101301, 1, 0, "暖かいけど、\nここで本を読むのは\nちょっち危ないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2698, 7, 3, 1, 0, 101301, 1, 0, "ウマ―！\nこれの詳細きぼんぬ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2699, 8, 3, 1, 0, 101301, 1, 0, "こ、古代語の本！？\n現代語でおk…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2701, 1, 1, 1, 0, 190901, 1, 0, "ふふふっ♪\n次はどんな悪戯を\nしてやろうかしら♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2702, 2, 1, 1, 0, 190901, 1, 0, "幻影湖の霧を吸った\n人間たちの\nリアクションって、\nサイコーよねぇ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2703, 3, 1, 1, 0, 190901, 1, 0, "室内だけとはいえ…\n自由に動けるって、\nやっぱりいいわ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2704, 4, 1, 1, 0, 190901, 1, 0, "改めて見ると良い\n部屋ね…悪戯とか\nしやすそうだしぃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2705, 5, 1, 1, 0, 190901, 1, 0, "私を封じていた部屋\nなのに…急に居心地が\n良くなったわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2706, 1, 2, 1, 0, 190901, 1, 0, "あんたの頭、座り心地\n良いわね…私専用の\n椅子にしてあげる♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2707, 2, 2, 1, 0, 190901, 1, 0, "外は大変みたいねぇ…\nまあ、私は好き勝手に\nやらせてもらうわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2708, 3, 2, 1, 0, 190901, 1, 0, "顔に落書された？\n誰か知らないけど、\n悪いことする奴も\nいるものねぇ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2709, 4, 2, 1, 0, 190901, 1, 0, "フィオのやつ…\nどこをウロチョロ\nしてるのかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2710, 1, 2, 1, 0, 190901, 1, 1, "人間の朝は大変ねぇ…\n私はその様を見ながら\nゆっくりするわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2711, 2, 2, 1, 0, 190901, 1, 2, "う～私も、お日様を\n浴びながら、お外を\nお散歩したーい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2712, 3, 2, 1, 0, 190901, 1, 3, "この暗さ…閉じ込め\nられていた時を\n思い出すわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2714, 2, 3, 1, 0, 190901, 1, 0, "悪戯しすぎて\n疲れたから、ちょっと\n休憩しよっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2715, 3, 3, 1, 0, 190901, 1, 0, "ガイド妖精たる私が、\nこんな造形物に\n惹かれる…わけが……\nかわいい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2716, 4, 3, 1, 0, 190901, 1, 0, "この香りを囮にして、\n周りに悪戯を仕込む…\n完璧ね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2717, 5, 3, 1, 0, 190901, 1, 0, "不思議ねぇ…私は\n温度とか関係ないのに\n離れられないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2719, 7, 3, 1, 0, 190901, 1, 0, "食事の必要がない体…\nつまり、食べたければ\n食べていいのよね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2720, 8, 3, 1, 0, 190901, 1, 0, "へぇ…最近はこんな\n悪戯もあるのねぇ…\nあいつで試さないと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2722, 1, 1, 1, 0, 108401, 1, 0, "メリークリスマス！\n歌で幸せを\n届けます…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2723, 2, 1, 1, 0, 108401, 1, 0, "あなたと出会えたのは\n偶然ではなくて…\nクリスマスの奇跡だと\n思うんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2724, 3, 1, 1, 0, 108401, 1, 0, "クリスマスは華やかで\nつい子供のように\nはしゃいでしまいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2725, 4, 1, 1, 0, 108401, 1, 0, "曲が書けるのは\nあなたが側に\nいてくれるからです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2726, 5, 1, 1, 0, 108401, 1, 0, "感動を与えられる歌…\nあなたと一緒になら\n生み出せるはず…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2727, 101, 1, 4, 0, 108401, 1, 0, "クリスマスの幸せを\nあなたと\n感じ合えたらな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2728, 102, 1, 8, 0, 108401, 1, 0, "あなたの幸せを願った\nクリスマスソング…\nいつか披露しますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2729, 1, 2, 1, 0, 108401, 1, 0, "みなさんの笑顔を\n守りたいから…\n私は歌い続けます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2730, 2, 2, 1, 0, 108401, 1, 0, "歌を届ける\nサンタさんに\nなりたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2731, 3, 2, 1, 0, 108401, 1, 0, "お暇でしたら\nクリスマスのお祝いを\nしませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2732, 4, 2, 1, 0, 108401, 1, 0, "ステージに立つ前に\n喉を整えないと…\n発声練習は念入りに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2733, 101, 2, 4, 0, 108401, 1, 0, "まわりはかわいい子\nばっかりだけど…\nこの服なら\nアピールになるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2734, 102, 2, 8, 0, 108401, 1, 0, "歌でならいくらでも\nあの人への気持ちを\n込められるのに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2735, 1, 2, 1, 0, 108401, 1, 1, "今日も一日\n幸せな歌で世界が\n包まれますように…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2736, 2, 2, 1, 0, 108401, 1, 2, "お茶を飲みながら\n好きな音楽を\n語り合いませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2737, 3, 2, 1, 0, 108401, 1, 3, "ふふ、寝かしつけの\n子守唄を\nお望みですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2739, 2, 3, 1, 0, 108401, 1, 0, "ふかふかですね\n心地良すぎて\n眠ってしまいそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2740, 3, 3, 1, 0, 108401, 1, 0, "素敵…\n優しい歌みたいに\n気持ちが落ち着く…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2741, 4, 3, 1, 0, 108401, 1, 0, "インスピレーションが\n溢れてくる…\nいい曲が書けそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2742, 5, 3, 1, 0, 108401, 1, 0, "この光みたいに\n灯火になるような\n歌を歌いたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2744, 7, 3, 1, 0, 108401, 1, 0, "喉の健康のためにも\n食事はしっかり\nとるようにしています");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2745, 8, 3, 1, 0, 108401, 1, 0, "物語には\n曲作りのヒントが\n詰まっているんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2747, 14, 3, 1, 0, 108401, 1, 0, "絵が飛び出してくる\nなんて…精霊が宿って\nいるのでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2748, 15, 3, 1, 0, 108401, 1, 0, "か、可愛い…♪\nちょっとだけ触っても\nいいですよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2749, 1, 1, 1, 0, 108501, 1, 0, "クリスマスでも、\n演劇の練習は\nしっかりやらないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2750, 2, 1, 1, 0, 108501, 1, 0, "あうぅ…\nクリスマスの準備が\n終わらないよぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2751, 3, 1, 1, 0, 108501, 1, 0, "アヤネちゃんが\n摘み食いしないように\n見ておかないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2752, 4, 1, 1, 0, 108501, 1, 0, "サンタさんみたいに、\n皆に笑顔で接する…\nうぅ…私には無理ぃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2753, 5, 1, 1, 0, 108501, 1, 0, "新しいお洋服～♪\nスズメお姉ちゃんに\nお礼をいわないと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2754, 101, 1, 4, 0, 108501, 1, 0, "お兄ちゃんの為に、\nプレゼントを\n用意しないと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2755, 102, 1, 8, 0, 108501, 1, 0, "クリスマス…\n恋人の日…ひゃわっ！\nわ、私ってば何を…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2756, 1, 2, 1, 0, 108501, 1, 0, "メリー\nクリスマスです、\nお兄ちゃん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2757, 2, 2, 1, 0, 108501, 1, 0, "そ、そんなに\n見られると…\n恥ずかしいよぉ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2758, 3, 2, 1, 0, 108501, 1, 0, "ひゃわぁっ！？\n急に触られると、\n驚くからやめてぇ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2759, 4, 2, 1, 0, 108501, 1, 0, "あ…クリスマスの\n準備を手伝って\nくれるんですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2760, 101, 2, 4, 0, 108501, 1, 0, "お兄ちゃんと\n過ごすクリスマス、\n楽しみですぅ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2761, 102, 2, 8, 0, 108501, 1, 0, "クリスマスはその…\n二人で…あうぅ…\nなんでもないですぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2762, 1, 2, 1, 0, 108501, 1, 1, "うう…パーティーが\n楽しみで、あんまり\n眠れなかったよぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2763, 2, 2, 1, 0, 108501, 1, 2, "ケーキを食べられなく\nなっちゃうから、\nお昼は軽めにしないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2764, 3, 2, 1, 0, 108501, 1, 3, "ちょっと眠いけど…\n今日は少しだけ\n夜更かししたいです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2766, 2, 3, 1, 0, 108501, 1, 0, "ふかふかぁ…\nクリスマスの準備中に\n眠くなっちゃいますぅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2767, 3, 3, 1, 0, 108501, 1, 0, "この子と一緒に\nおままごとしたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2768, 4, 3, 1, 0, 108501, 1, 0, "いい匂い…♪\nみんなで\nアロマパーティー\nしたいなぁ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2769, 5, 3, 1, 0, 108501, 1, 0, "ぬっくぬく…♪\nもう、ここから\n離れたくないよぉ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2771, 7, 3, 1, 0, 108501, 1, 0, "はむはむ…♪\nクリスマスのお料理\nより美味しいかも～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2772, 8, 3, 1, 0, 108501, 1, 0, "すごい…\nクリスマスの\n演劇って、\nこんなにあるんだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2774, 14, 3, 1, 0, 108501, 1, 0, "すごい…まるで、\nクリスマスの演劇を\n観てるようですぅ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2775, 15, 3, 1, 0, 108501, 1, 0, "とっても可愛いです♪\nお芝居の相手役に\nしたいなぁ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2776, 1, 1, 1, 0, 108601, 1, 0, "甘ぁいケーキも、\nデッカイ七面鳥も、\nぜーんぶ私のだー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2777, 2, 1, 1, 0, 108601, 1, 0, "毎日が\nクリスマスだったら\nいいのにな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2778, 3, 1, 1, 0, 108601, 1, 0, "プレゼントはあるし、\n料理は美味しいし、\nクリスマス最高ー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2779, 4, 1, 1, 0, 108601, 1, 0, "ここでぷうきちの\nクリスマス一発芸♪\n『無茶ぶりするな！』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2780, 5, 1, 1, 0, 108601, 1, 0, "ぷうきちがいつもより\n重いかも…太ったの？\n『衣装の重さだよ！』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2781, 101, 1, 4, 0, 108601, 1, 0, "お兄ちゃんが\n一緒にいてくれると\nクリスマス楽しいね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2782, 102, 1, 8, 0, 108601, 1, 0, "お兄ちゃんに抱きつく\nと、なんだかドキドキ\nする…なんでかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2783, 1, 2, 1, 0, 108601, 1, 0, "メリークリスマス♪\nプレゼントは、\nいつでも受付中だよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2784, 2, 2, 1, 0, 108601, 1, 0, "このクマさん耳\n可愛いでしょ♪\nぷうきちと\nお揃いなんだー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2785, 3, 2, 1, 0, 108601, 1, 0, "お兄ちゃん…私、\n甘ぁいケーキが\n食べたいなぁ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2786, 4, 2, 1, 0, 108601, 1, 0, "クリスマスぷうきちは\nぬくぬく感が凄いよ！\nお兄ちゃんもさわる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2787, 101, 2, 4, 0, 108601, 1, 0, "えへへ…お兄ちゃんの\n手は、大きくて、\n暖かくて大好き～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2788, 102, 2, 8, 0, 108601, 1, 0, "来年のクリスマスも、\nこうやって\nお兄ちゃんに\n甘えていたいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2789, 1, 2, 1, 0, 108601, 1, 1, "あれぇ…\n私のケーキはぁ…？\n『ちゃんと起きろ』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2790, 2, 2, 1, 0, 108601, 1, 2, "お昼はデッカイ\n七面鳥が食べたーい♪\n『夜まで我慢しろ』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2791, 3, 2, 1, 0, 108601, 1, 3, "『もう寝る時間だぞ』\nサンタさんが来る\nまで起きてるぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2793, 2, 3, 1, 0, 108601, 1, 0, "このふかふか具合…\nぷうきち！\n負けてられないよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2794, 3, 3, 1, 0, 108601, 1, 0, "この子、\nすっごくかわいい～♪\n『ライバル登場か！』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2795, 4, 3, 1, 0, 108601, 1, 0, "良い匂い…あっ！\nぷうきちにこの\n匂いを移せば…！\n『匂い袋にするな』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2796, 5, 3, 1, 0, 108601, 1, 0, "あったか～い♪\nえへへ、ぷうきちも\nあっためてあげる♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2798, 7, 3, 1, 0, 108601, 1, 0, "ぷうきち！　これ、\nとってもおいしいよ♪\n『食べすぎるなよ』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2799, 8, 3, 1, 0, 108601, 1, 0, "お、大人の私なら、\nこれぐらい…読め…\n『無理するな…』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2801, 14, 3, 1, 0, 108601, 1, 0, "絵が飛び出す…\nぷうきちに絵本を\n入れれば、イタズラに\n使えるかも…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2802, 15, 3, 1, 0, 108601, 1, 0, "か、可愛いけど…\nぷうきちサンタの方が\n可愛いんだからぁ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2803, 1, 1, 1, 0, 108901, 1, 0, "着物も慣れると\n動きやすいものさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2804, 2, 1, 1, 0, 108901, 1, 0, "鼻緒が緩んでしまった\n下駄で修業は\n無理があったかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2805, 3, 1, 1, 0, 108901, 1, 0, "小腹が空いた…\nユイが作った餅、\nまだ食べられるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2806, 4, 1, 1, 0, 108901, 1, 0, "服装も変わったし\nいつもと違う戦い方を\n想定しないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2807, 5, 1, 1, 0, 108901, 1, 0, "…ヒヨリは動きすぎて\n着崩れしてないか\n心配だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2808, 101, 1, 4, 0, 108901, 1, 0, "これからもずっと\n仲間と、彼と\n一緒に…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2809, 102, 1, 8, 0, 108901, 1, 0, "願いを叶えるために\nもっと自分を\n鍛えていかないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2810, 1, 2, 1, 0, 108901, 1, 0, "頭の飾りがずれてた？\nそうか、直してくれて\nありがとう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2811, 2, 2, 1, 0, 108901, 1, 0, "着物がそんなに\n珍しい？\nキミも着てみる？\n…冗談だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2812, 3, 2, 1, 0, 108901, 1, 0, "肩掛けの触り心地が\n気に入った？\nならもっと触る？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2813, 4, 2, 1, 0, 108901, 1, 0, "ああ、この刀？\n釣り仲間に見繕って\nもらったんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2814, 101, 2, 4, 0, 108901, 1, 0, "キミといると\n気持ちが段々と\n安らいでいくよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2815, 102, 2, 8, 0, 108901, 1, 0, "キミは私の行く先を\n照らしてくれる\n光のような存在だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2816, 1, 2, 1, 0, 108901, 1, 1, "おはよう\n朝の修行を始めるけど\nキミもどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2817, 2, 2, 1, 0, 108901, 1, 2, "この時間に軽く\n休憩をとるといい\n能率がよくなるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2818, 3, 2, 1, 0, 108901, 1, 3, "もう夜か…\n明日もまた頑張ろう\nそれじゃ、おやすみ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2820, 2, 3, 1, 0, 108901, 1, 0, "…疲れていたのかな\nもう少しで眠る\nところだった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2821, 3, 3, 1, 0, 108901, 1, 0, "ふふっ、正月衣装を\n着せてやるのも\nよさそうだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2822, 4, 3, 1, 0, 108901, 1, 0, "ふぅ…いい香りだ\n慌ただしい日々から\n心が解放される");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2823, 5, 3, 1, 0, 108901, 1, 0, "この心地よさ…\n寝てしまわないよう\n気をつけないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2825, 7, 3, 1, 0, 108901, 1, 0, "おいしいけど\n帯がきつくなる前に\n手を止めよう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2826, 8, 3, 1, 0, 108901, 1, 0, "外を出歩くのも\nいいけど、中で\n読書もありだな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2828, 1, 1, 1, 0, 108801, 1, 0, "…騎士クンって\nおせち料理で\n何が好きなんだろう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2829, 2, 1, 1, 0, 108801, 1, 0, "着物でお掃除や\nお洗濯するの\n慣れてきた♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2830, 3, 1, 1, 0, 108801, 1, 0, "今年は\nどんな福袋を\n買おうかな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2831, 4, 1, 1, 0, 108801, 1, 0, "お餅に使う調味料\nみんなで違うから\n色々用意しなきゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2832, 5, 1, 1, 0, 108801, 1, 0, "ほっぺがお餅みたいに\nぷにぷに…\n食べ過ぎちゃった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2833, 101, 1, 4, 0, 108801, 1, 0, "来年も、再来年も\nみんなで一緒に\n新年を迎えたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2834, 102, 1, 8, 0, 108801, 1, 0, "お願いです…\nいつかこの気持ちが\n伝わりますように…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2835, 1, 2, 1, 0, 108801, 1, 0, "髪飾りが落ちそう？\nじゃあ…騎士クン\nつけ直してくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2836, 2, 2, 1, 0, 108801, 1, 0, "着物が着たいの？\nじゃあ今度一緒に\n買いに…行く？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2837, 3, 2, 1, 0, 108801, 1, 0, "あっ、騎士クン\nお雑煮のお餅\nいくつ入れたい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2838, 4, 2, 1, 0, 108801, 1, 0, "外、寒かったよね？\nはいこれ。熱い甘粥\n飲むと温まるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2839, 101, 2, 4, 0, 108801, 1, 0, "今年は騎士クンと…\nえっ？　騎士クン！？\nな、なんでもないよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2840, 102, 2, 8, 0, 108801, 1, 0, "騎士クンの願い事\nわたしが\n叶えてあげたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2841, 1, 2, 1, 0, 108801, 1, 1, "おはよう\n太陽の光に当たると\n元気が出るよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2842, 2, 2, 1, 0, 108801, 1, 2, "お昼ごはん\n作らなきゃ…\n騎士クンも食べる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2843, 3, 2, 1, 0, 108801, 1, 3, "一日が終わるのは\nあっという間だよね\n一年も同じなのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2845, 2, 3, 1, 0, 108801, 1, 0, "ふぅ…\n帯も少し\nゆるめちゃおう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2846, 3, 3, 1, 0, 108801, 1, 0, "お正月用に\n着物を縫って\nあげたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2847, 4, 3, 1, 0, 108801, 1, 0, "これでお肌が\n保湿出来たら\nいいのになぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2848, 5, 3, 1, 0, 108801, 1, 0, "ん～…\nぬくぬくしてて\n動きたくないよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2850, 7, 3, 1, 0, 108801, 1, 0, "…冬眠しないのに\n熊さんみたいに\n食べちゃいそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2851, 8, 3, 1, 0, 108801, 1, 0, "年末年始は\n告白のチャンス…\nむ、無理無理！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2853, 1, 1, 1, 0, 108701, 1, 0, "みんな忙しそう…\n待っててね、\nすぐ助けるから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2854, 2, 1, 1, 0, 108701, 1, 0, "ユイちゃんと\nレイさん…よし！\nどっちも手伝おう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2855, 3, 1, 1, 0, 108701, 1, 0, "あっ、着崩れてる！\nわわっ、どうしよ！\n帯が結べないよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2856, 4, 1, 1, 0, 108701, 1, 0, "初詣楽しみー！\n出店はどこから\n行こうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2857, 5, 1, 1, 0, 108701, 1, 0, "お正月だし\nみんなで楽しく\n遊んじゃおー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2858, 101, 1, 4, 0, 108701, 1, 0, "うーん…\n騎士くんはお正月\n何してるんだろ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2859, 102, 1, 8, 0, 108701, 1, 0, "ううぅー…\n騎士くんを見てると\nドキってなっちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2860, 1, 2, 1, 0, 108701, 1, 0, "あたしから\nおいしそうな匂い？\nくんくん…ソースだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2861, 2, 2, 1, 0, 108701, 1, 0, "ヘアピンが…\n拾ってくれたんだ！\nありがとう騎士くん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2862, 3, 2, 1, 0, 108701, 1, 0, "髪飾りがかわいい？\n耳の近く触りたい？\n…優しくね？　");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2863, 4, 2, 1, 0, 108701, 1, 0, "グローブで食べるの\n大変そう？　特訓して\n今はお箸も使えるよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2864, 101, 2, 4, 0, 108701, 1, 0, "えっ、ほっぺが赤い？\nそうかな…？\n気のせい気のせい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2865, 102, 2, 8, 0, 108701, 1, 0, "騎士くんといるとね…\nなんでもない！\nまだ内緒っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2866, 1, 2, 1, 0, 108701, 1, 1, "おはよー！\n今日も明るく元気に\nがんばろー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2867, 2, 2, 1, 0, 108701, 1, 2, "お腹すいてない？\n一緒にご飯食べよ！\n何にしようかなー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2868, 3, 2, 1, 0, 108701, 1, 3, "今日もいっぱい\nがんばったー！\nいつも？　…そう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2870, 2, 3, 1, 0, 108701, 1, 0, "休憩休憩♪\nちょっと休んで\nガンガン動くぞー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2871, 3, 3, 1, 0, 108701, 1, 0, "かわいい♪\nでも、壊しそうで\nちょっと怖い…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2872, 4, 3, 1, 0, 108701, 1, 0, "はぁー♪\nいい香りー…\n気分スッキリ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2873, 5, 3, 1, 0, 108701, 1, 0, "ほっこりしてて\nぬくぬく…\n丸まりたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2875, 7, 3, 1, 0, 108701, 1, 0, "ど、どうしよう…！\n手が、止まんないよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2876, 8, 3, 1, 0, 108701, 1, 0, "へー…お年玉って\n昔はお餅だったんだ\n…今のほうがいいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2878, 1, 1, 1, 0, 109001, 1, 0, "甘いチョコの香りを\n漂わせて…ふふっ\nこれで準備万端ですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2879, 2, 1, 1, 0, 109001, 1, 0, "ここを私のチョコで\n埋め尽くしますわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2880, 3, 1, 1, 0, 109001, 1, 0, "エプロンを着て\nあの方を待つ私…\nまるで…クスクス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2881, 4, 1, 1, 0, 109001, 1, 0, "キッチンはどこかしら\n今のうちに作って\nおきたいものが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2882, 5, 1, 1, 0, 109001, 1, 0, "あのお方を私のチョコ\nなしでは生きられない\n体に…ふふっ\n冗談ですわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2883, 101, 1, 4, 0, 109001, 1, 0, "このチョコは運命の味\n一口食べれば私の虜…\nそれも運命ですわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2884, 102, 1, 8, 0, 109001, 1, 0, "私ともあろうものが\nなんだかドキドキして\nきましたわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2885, 1, 2, 1, 0, 109001, 1, 0, "あなた様。私に\n隠しているものなど\nありませんよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2886, 2, 2, 1, 0, 109001, 1, 0, "私の手作りチョコです\n味の方にも自信\nありますのよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2887, 3, 2, 1, 0, 109001, 1, 0, "少し苦いのは\nチョコがビターなだけ\nお気になさらず…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2888, 4, 2, 1, 0, 109001, 1, 0, "解毒薬はどこに\nいれたかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2889, 101, 2, 4, 0, 109001, 1, 0, "運命で結ばれている\nあなた様と私…\nチョコも特別でないと\nいけませんわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2890, 102, 2, 8, 0, 109001, 1, 0, "チョコを食べた後は\nメインディッシュ…\nさぁ、私を召し上がれ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2891, 1, 2, 1, 0, 109001, 1, 1, "目覚めのチョコですわ\nすっきり目が覚めます\nしばらく眠れなく\nなりますけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2892, 2, 2, 1, 0, 109001, 1, 2, "おやつのチョコですわ\nデザートにどうぞ\n空腹を感じなく\nなりますわ…クスクス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2893, 3, 2, 1, 0, 109001, 1, 3, "お夜食のチョコですわ\nとてもよく眠れます\nさ、溶けてしまう前に");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2895, 2, 3, 1, 0, 109001, 1, 0, "この心地良さ…\n参考になりますわ\n次の薬は…クスクス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2896, 3, 3, 1, 0, 109001, 1, 0, "この中、何か\n入りそうですわね\n…チョコレート、とか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2897, 4, 3, 1, 0, 109001, 1, 0, "いい香り…この香りと\n同じものを調合して\n私も持っていたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2898, 5, 3, 1, 0, 109001, 1, 0, "この暖かさ…\nチョコが溶けないよう\n気を付けなくては");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2900, 7, 3, 1, 0, 109001, 1, 0, "いい味をしていますわ\n私も腕を磨きましょう\n料理と、調合の腕を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2901, 8, 3, 1, 0, 109001, 1, 0, "勉強になりますわ\n知識はいくらあっても\n困りませんもの\n特に、人体の知識は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2903, 1, 1, 1, 0, 109101, 1, 0, "弟くんのことを\n考えると\nあっという間に時間が\n過ぎちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2904, 2, 1, 1, 0, 109101, 1, 0, "お姉ちゃんの\n元気の源は、弟くんの\n喜ぶ顔なんだから♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2905, 3, 1, 1, 0, 109101, 1, 0, "弟くんと会ったら\nまずは抱きしめて\nそれからそれから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2906, 4, 1, 1, 0, 109101, 1, 0, "今日のお姉ちゃんは\n昨日のお姉ちゃんより\nいいお姉ちゃんだよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2907, 5, 1, 1, 0, 109101, 1, 0, "弟くん、もっと\nお姉ちゃんに\n甘えてもいいのに♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2908, 101, 1, 4, 0, 109101, 1, 0, "お姉ちゃんのチョコ\n食べさせてあげたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2909, 102, 1, 8, 0, 109101, 1, 0, "ドキドキしてきた…\nお姉ちゃんなのに\nどうしてかなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2910, 1, 2, 1, 0, 109101, 1, 0, "お姉ちゃんを\n好きなだけ\n触っていいよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2911, 2, 2, 1, 0, 109101, 1, 0, "そんなにお姉ちゃんの\nチョコが欲しいの？\n食いしん坊さん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2912, 3, 2, 1, 0, 109101, 1, 0, "ナデナデするのは\nお姉ちゃんの仕事！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2913, 4, 2, 1, 0, 109101, 1, 0, "ありがとうなんて…\nお姉ちゃんとして\n当たり前だよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2914, 101, 2, 4, 0, 109101, 1, 0, "どうしたのかなっ？\nお姉ちゃんはいつでも\n弟くんのそばにいるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2915, 102, 2, 8, 0, 109101, 1, 0, "チョコを作ったよ\n隠し味は、たくさんの\n弟くんへの愛情♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2916, 1, 2, 1, 0, 109101, 1, 1, "おはよ。お姉ちゃんが\n顔を洗うの\n手伝ってあげるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2917, 2, 2, 1, 0, 109101, 1, 2, "ご飯を食べたら\n眠たくなるよね…\nお姉ちゃんと寝る？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2918, 3, 2, 1, 0, 109101, 1, 3, "そろそろ眠くなった？\nお姉ちゃんが添い寝\nしてあげるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2920, 2, 3, 1, 0, 109101, 1, 0, "この気持ちよさは\nお姉ちゃんも太鼓判♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2921, 3, 3, 1, 0, 109101, 1, 0, "このかわいさは\nお姉ちゃんも大満足♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2922, 4, 3, 1, 0, 109101, 1, 0, "この香り、チョコに\n使えるかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2923, 5, 3, 1, 0, 109101, 1, 0, "弟くんと一緒に\nぬくぬくしたいな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2925, 7, 3, 1, 0, 109101, 1, 0, "すごくおいしいねっ♪\nあとで運動しなきゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2926, 8, 3, 1, 0, 109101, 1, 0, "本を読んでる\n知的なお姉ちゃん\n素敵でしょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2928, 1, 1, 1, 0, 106101, 1, 0, "アタシって…\nここにいても\nいいのか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2929, 2, 1, 1, 0, 106101, 1, 0, "ちゃんとした建物に\nいるのが久しぶりで\nそわそわする…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2930, 3, 1, 1, 0, 106101, 1, 0, "ここで天楼覇断剣\n出す練習したら\nアイツら怒るかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2931, 4, 1, 1, 0, 106101, 1, 0, "ギルドハウスか…\nこういう隠れ家\n欲しかったんだよな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2932, 5, 1, 1, 0, 106101, 1, 0, "めちゃくちゃ暇だ…\n…なんかやること\nないのか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2933, 101, 1, 4, 0, 106101, 1, 0, "みんなが早く\nアタシのこと\n思い出さないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2934, 102, 1, 8, 0, 106101, 1, 0, "アイツはいいヤツだし\n戦う時はアタシも\n協力してやるか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2935, 1, 2, 1, 0, 106101, 1, 0, "ちゃんはいらん！\nノウェムでいい！\n分かったか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2936, 2, 2, 1, 0, 106101, 1, 0, "どうした？\n戦うのか！？\n…なんだ、違うのか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2937, 3, 2, 1, 0, 106101, 1, 0, "身長のことは\nあんまり言うな！\n気にしてるからな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2938, 4, 2, 1, 0, 106101, 1, 0, "アタシの戦い方は\nなんでもアリだ！\nだから見習うなよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2939, 101, 2, 4, 0, 106101, 1, 0, "オマエとの思い出か…\n敵として戦ってばっか\nだったな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2940, 102, 2, 8, 0, 106101, 1, 0, "オマエやオクトーと\n一緒に、あちこち\nいってみたいんだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2941, 1, 2, 1, 0, 106101, 1, 1, "よっ！　おはよう！\n朝だぞー！\n起きてるかー？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2942, 2, 2, 1, 0, 106101, 1, 2, "腹減ったー！\n飯食うぞ、飯！\nオマエも行くよな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2943, 3, 2, 1, 0, 106101, 1, 3, "ふわぁ…\nまだ起きてんのか？\n元気だなオマエ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2945, 2, 3, 1, 0, 106101, 1, 0, "ふぃ～…\n極楽極楽…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2946, 3, 3, 1, 0, 106101, 1, 0, "おいオマエ！\n寝技の練習に\n付き合ってもらうぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2947, 4, 3, 1, 0, 106101, 1, 0, "くんくん…\nたまにはこういうのも\n悪くないかもな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2948, 5, 3, 1, 0, 106101, 1, 0, "あー…\nもっと前にコイツと\n出会いたかった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2950, 7, 3, 1, 0, 106101, 1, 0, "VRでも飯はうまい！\n腹が減るのはちゃんと\n生きてる気がするな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2951, 8, 3, 1, 0, 106101, 1, 0, "勉強は大事だな！\nうん！…だめだ！\n全然わからん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2953, 1, 1, 1, 0, 101401, 1, 0, "探偵というのは\n謎を追い求める\n生き物なのさっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2954, 2, 1, 1, 0, 101401, 1, 0, "事件のオチは\n往々にして\n取るに足らないものさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2955, 3, 1, 1, 0, 101401, 1, 0, "読書で得る知識が\n探偵の\n血肉になるんだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2956, 4, 1, 1, 0, 101401, 1, 0, "この前の\n捜査資料…\nどこにあったかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2957, 5, 1, 1, 0, 101401, 1, 0, "どんな小さな謎も\n私にとっては\n宝石みたいなものさ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2958, 101, 1, 4, 0, 101401, 1, 0, "助手くんと一緒だと\nよい発想が浮かぶ…\nどうしてだろうね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2959, 102, 1, 8, 0, 101401, 1, 0, "助手くんの好きな\nタイプって…\nす、推理してみるっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2960, 1, 2, 1, 0, 101401, 1, 0, "珈琲、淹れたてだよ\n一杯どうだい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2961, 2, 2, 1, 0, 101401, 1, 0, "事件の考察を\nまとめてみたんだけど\n聞いてくれるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2962, 3, 2, 1, 0, 101401, 1, 0, "小さな違和感を\n見逃さない…\n探偵の心得だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2963, 4, 2, 1, 0, 101401, 1, 0, "機能的な手帳とペン…\nこの仕事には\n欠かせないね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2964, 101, 2, 4, 0, 101401, 1, 0, "助手くんに\n珈琲…\n淹れてほしいなぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2965, 102, 2, 8, 0, 101401, 1, 0, "助手くんは\n私にとって\n最高の相棒だよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2966, 1, 2, 1, 0, 101401, 1, 1, "朝はいいひらめきが\n得られるんだ…\nさあ捜査を始めよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2967, 2, 2, 1, 0, 101401, 1, 2, "一休みしたら\n推理の答え合わせを\nしてみようか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2968, 3, 2, 1, 0, 101401, 1, 3, "夜の張りこみかい？\nなら私も\n同行させてほしいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2970, 2, 3, 1, 0, 101401, 1, 0, "脳を酷使した後は\nゆっくり休む…\nこれも仕事だよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2971, 3, 3, 1, 0, 101401, 1, 0, "この愛らしさ…\n要捜査対象だね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2972, 4, 3, 1, 0, 101401, 1, 0, "思考が活性化される\n素敵な香りだね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2973, 5, 3, 1, 0, 101401, 1, 0, "くぅ、心地よすぎる…\n今だけは捜査も\n一休みだね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2975, 7, 3, 1, 0, 101401, 1, 0, "いっぱい食べて\nいっぱい考える\n探偵の本分だね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2976, 8, 3, 1, 0, 101401, 1, 0, "探偵だからね\nミステリには\n一家言あるんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2978, 1, 1, 1, 0, 105501, 1, 0, "先輩、素敵だなぁ…\nもっと近づければ\nいいのに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2979, 2, 1, 1, 0, 105501, 1, 0, "せ、先輩がいた部屋！\n私には刺激が強い…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2980, 3, 1, 1, 0, 105501, 1, 0, "先輩を観察しやすい\n場所はあるかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2981, 4, 1, 1, 0, 105501, 1, 0, "バ、バイト代出たし、\nせ、先輩をご飯とかに\n誘いたい…な");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2982, 5, 1, 1, 0, 105501, 1, 0, "今頃先輩は\nあの辺かな…？\n見に行ってみよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2983, 101, 1, 4, 0, 105501, 1, 0, "私と先輩の出会いって\n思い返すと少女漫画\nみたい…えへへ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2984, 102, 1, 8, 0, 105501, 1, 0, "せ、先輩になら\n観察されてもいいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2985, 1, 2, 1, 0, 105501, 1, 0, "バイト先に新しい子が\n入って来たんです…\nわ、私、先輩です♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2986, 2, 2, 1, 0, 105501, 1, 0, "せ、先輩…？\nえっと、あの、その、\nあわわわわ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2987, 3, 2, 1, 0, 105501, 1, 0, "えへへ…えへへ～\nせ、先輩から\n話しかけてくれました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2988, 4, 2, 1, 0, 105501, 1, 0, "ま、また…\n先輩と一緒に\nバイトしたい…です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2989, 101, 2, 4, 0, 105501, 1, 0, "私と先輩が同じ空間に\n…ゆ、夢みたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2990, 102, 2, 8, 0, 105501, 1, 0, "せ、先輩のそばに\n居られて、私\n今、とっても\n幸せです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2991, 1, 2, 1, 0, 105501, 1, 1, "せ、先輩…！\nおひゃっ！\nおはようございます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2992, 2, 2, 1, 0, 105501, 1, 2, "先輩ランチに\n行きましょう！\nよし、練習はバッチリ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2993, 3, 2, 1, 0, 105501, 1, 3, "あ、せ、先輩。\nえと、そ、外…\nもう真っ暗ですねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2995, 2, 3, 1, 0, 105501, 1, 0, "こ、ここで先輩も\n休んだり…はっ！\nわ、私ったらなにを！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2996, 3, 3, 1, 0, 105501, 1, 0, "かわいいですねー\n君も一緒に、\n先輩を観察する？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2997, 4, 3, 1, 0, 105501, 1, 0, "ここから先輩の\n香りがすればなあ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (2998, 5, 3, 1, 0, 105501, 1, 0, "先輩と一緒に\nぬくぬくできたら\n最高なんだけどなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3000, 7, 3, 1, 0, 105501, 1, 0, "おいし～\nこれは\n先輩も好きな味かな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3001, 8, 3, 1, 0, 105501, 1, 0, "す、好きな人に\n近づく方法…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3003, 1, 1, 1, 0, 109201, 1, 0, "私の力は、大切な\n人たちを護るために\n役立てたいんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3004, 2, 1, 1, 0, 109201, 1, 0, "きれいな景色と\n美味しいご飯！\nこの世界も素敵だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3005, 3, 1, 1, 0, 109201, 1, 0, "この世界のみんなとも\nもっと仲良く\nなりたいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3006, 4, 1, 1, 0, 109201, 1, 0, "わー！\nあれもこれも\n気になっちゃうな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3007, 5, 1, 1, 0, 109201, 1, 0, "しっかりしなきゃって\n思ってても、\nグレアといるとつい\n甘えちゃうんだよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3008, 101, 1, 4, 0, 109201, 1, 0, "違う世界でも\n友だちができて、\nすごくうれしいよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3009, 102, 1, 8, 0, 109201, 1, 0, "みんなとも一緒に\n授業とか受けたいな～\n絶対楽しそうだもん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3010, 1, 2, 1, 0, 109201, 1, 0, "歩き方がきれい？\nえへへ、そうかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3011, 2, 2, 1, 0, 109201, 1, 0, "勉強は好きだよ！\n知識が増えていくのは\nやっぱり楽しいから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3012, 3, 2, 1, 0, 109201, 1, 0, "私たちの国マナリアは\n人々の間に魔法が\n伝えられた、その\n始まりの地なんだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3013, 4, 2, 1, 0, 109201, 1, 0, "この部屋にも、\nもっとたくさん本棚が\n増えないかな～…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3014, 101, 2, 4, 0, 109201, 1, 0, "あなたも魔法、\n覚えてみる？\n私、教えるよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3015, 102, 2, 8, 0, 109201, 1, 0, "お茶の時間に\nしたいな～…\n一緒にどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3016, 1, 2, 1, 0, 109201, 1, 1, "おはようっ！\n今日も素敵な\n一日にしようね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3017, 2, 2, 1, 0, 109201, 1, 2, "お昼ご飯は\nちゃんと食べた？\n午後も頑張ろうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3018, 3, 2, 1, 0, 109201, 1, 3, "つい本の続きが\n気になって、夜更かし\nしちゃうんだよね～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3020, 2, 3, 1, 0, 109201, 1, 0, "はぁ、気持ちいい～…\nちょっとだけ\n眠っちゃおうかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3021, 3, 3, 1, 0, 109201, 1, 0, "わあ、これ可愛い！\nグレアにも見せて\nあげたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3022, 4, 3, 1, 0, 109201, 1, 0, "いい香り～！\nなんだか気持ちが\n落ち着くね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3023, 5, 3, 1, 0, 109201, 1, 0, "あぁ、あったかくて\n幸せ～♪　身体が\nポカポカしてきたよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3025, 7, 3, 1, 0, 109201, 1, 0, "こ、これ美味し～！\n止められないよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3026, 8, 3, 1, 0, 109201, 1, 0, "ふんふん…\n…はっ！　む、夢中に\nなっちゃってた…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3028, 1, 1, 1, 0, 109301, 1, 0, "新しい建物に入ると\n必ず一度は迷子に\nなっちゃうですよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3029, 2, 1, 1, 0, 109301, 1, 0, "おやつはどこですか？\nお腹が空いて\nきちゃったですぅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3030, 3, 1, 1, 0, 109301, 1, 0, "宿題、７つぐらい\n出しそびれたですけど\nまあ大丈夫ですぅ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3031, 4, 1, 1, 0, 109301, 1, 0, "不思議なこと\nばかりですけど…\nまぁ大丈夫です！\nこれもせいしゅんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3032, 5, 1, 1, 0, 109301, 1, 0, "なにか面白そうなもの\nないですかね～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3033, 101, 1, 4, 0, 109301, 1, 0, "ここのみんなとも\nもうお友だちですぅ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3034, 102, 1, 8, 0, 109301, 1, 0, "おなかが減ったです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3035, 1, 2, 1, 0, 109301, 1, 0, "ごはんも美味しいし\nここはいいところです\nルゥは幸せですぅ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3036, 2, 2, 1, 0, 109301, 1, 0, "魔法の話ですか？\nそれはアンせんぱいに\n聞いてほしいですぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3037, 3, 2, 1, 0, 109301, 1, 0, "あなたもお勉強\n苦手ですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3038, 4, 2, 1, 0, 109301, 1, 0, "ルゥの帽子、\nかわいいです？\nお気に入りですぅ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3039, 101, 2, 4, 0, 109301, 1, 0, "お友だちいっぱいで、\nルゥはうれしいです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3040, 102, 2, 8, 0, 109301, 1, 0, "一緒にお勉強…！？\nぐえぇ、イヤですぅ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3041, 1, 2, 1, 0, 109301, 1, 1, "朝ですねぇ…ふわわ…\nルゥはまだ夢の中に\nいたいですぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3042, 2, 2, 1, 0, 109301, 1, 2, "午後もいっぱい\n遊ぶですよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3043, 3, 2, 1, 0, 109301, 1, 3, "夜ふかしって\nドキドキするです！\nせいしゅんですぅ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3045, 2, 3, 1, 0, 109301, 1, 0, "ふかふかですぅ～♪\nおひるねが\nしたくなるですぅ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3046, 3, 3, 1, 0, 109301, 1, 0, "これふかふかですぅ！\n机でうとうとする時の\n枕によさそうですぅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3047, 4, 3, 1, 0, 109301, 1, 0, "ふぁぁ、いいにおい…\nなんだか気持ちが\nよくなってきたですぅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3048, 5, 3, 1, 0, 109301, 1, 0, "ぽっかぽかですぅ～！\nあったまったら\nまた遊びにいくですぅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3050, 7, 3, 1, 0, 109301, 1, 0, "お、おいしいですぅ！\n全部ルゥに\nくださいですぅ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3051, 8, 3, 1, 0, 109301, 1, 0, "本は…読むと、\nすぐ眠気がぁ…\n…ぐぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3053, 1, 1, 1, 0, 109401, 1, 0, "ピアノ…\nどこかにないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3054, 2, 1, 1, 0, 109401, 1, 0, "ふぅ…\n落ち着くな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3055, 3, 1, 1, 0, 109401, 1, 0, "マナリアはいつも\n賑やかなんだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3056, 4, 1, 1, 0, 109401, 1, 0, "みんな…\n今頃何してるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3057, 5, 1, 1, 0, 109401, 1, 0, "まさか違う世界に\n来ちゃうなんて…\nびっくりだよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3058, 101, 1, 4, 0, 109401, 1, 0, "人と話すのは\n得意じゃないな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3059, 102, 1, 8, 0, 109401, 1, 0, "ここのみんなと一緒に\n学院に通えたら…\nちょっと面白いかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3060, 1, 2, 1, 0, 109401, 1, 0, "やっぱり、私の翼や\n尻尾…気になる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3061, 2, 2, 1, 0, 109401, 1, 0, "一番得意なのは、\nやっぱり炎魔法かな…\n加減は難しいけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3062, 3, 2, 1, 0, 109401, 1, 0, "私の故郷は竜の国…\n険しい山脈を\n越えた先にあるんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3063, 4, 2, 1, 0, 109401, 1, 0, "アン…？\nあっ、ご、ごめんね！\n間違えちゃった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3064, 101, 2, 4, 0, 109401, 1, 0, "ふん…ふん…♪\n…わっ！\n今の、聞いてた…？\nは、恥ずかしい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3065, 102, 2, 8, 0, 109401, 1, 0, "私に手伝えること、\nなにかある…？\nなんでも言ってね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3066, 1, 2, 1, 0, 109401, 1, 1, "朝の空気って\nすごく\n静かで透き通ってて…\nなんだか落ち着くよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3067, 2, 2, 1, 0, 109401, 1, 2, "学院食堂のランチも\n美味しいけど…\nここのご飯も好きかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3068, 3, 2, 1, 0, 109401, 1, 3, "そろそろベッドに\n行かないとだね\n…寝相、今夜こそ\n気を付けよう…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3070, 2, 3, 1, 0, 109401, 1, 0, "羽を伸ばしたく\nなっちゃうね…ふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3071, 3, 3, 1, 0, 109401, 1, 0, "わ、私が持つには\nかわいすぎるかな…\nでも、素敵だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3072, 4, 3, 1, 0, 109401, 1, 0, "いい香り…\nこれ、\nアンも好きそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3073, 5, 3, 1, 0, 109401, 1, 0, "火を見ていると\n少し落ち着くんだ…\nへ、変かな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3075, 7, 3, 1, 0, 109401, 1, 0, "わ、美味しい…！\nこれ、どうやって\n作ったのかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3076, 8, 3, 1, 0, 109401, 1, 0, "この本…アンにも\n見せてあげたら\n喜ぶかな、ふふっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3078, 1, 1, 1, 0, 109501, 1, 0, "着物はきれいですが\n歩きにくいです…\nいっそ脱いで…ぐふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3079, 2, 1, 1, 0, 109501, 1, 0, "あっ、いけません\n着物がはだけて…はっ\nもしやドＳさんが…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3080, 3, 1, 1, 0, 109501, 1, 0, "この部屋は妄想する\nのにうってつけです…\nぐふふ…じゅるり");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3081, 4, 1, 1, 0, 109501, 1, 0, "扇をゆっくりと開く\nこの感触…なぜだか\n艶めかしさを感じます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3082, 5, 1, 1, 0, 109501, 1, 0, "「マッサージをすると\n言いながらドＳさんの\n手は次第に」…ぐふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3083, 101, 1, 4, 0, 109501, 1, 0, "…ドＳさんの視線を\n思い出しながら踊りの\n練習です…イイ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3084, 102, 1, 8, 0, 109501, 1, 0, "よいではないか\nよいではないか～\nいけませんご堪忍を～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3085, 1, 2, 1, 0, 109501, 1, 0, "あ～れ～～～！\nドＳさんもお好きな人\nですねぇ…ぐふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3086, 2, 2, 1, 0, 109501, 1, 0, "どこにいてもドＳさん\nの気配を感じ取れる\nようになりました…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3087, 3, 2, 1, 0, 109501, 1, 0, "こんな場所で\nなんというプレイを！\n…妄想でした");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3088, 4, 2, 1, 0, 109501, 1, 0, "クウカを押し倒して\nそのまま…じゅるり\nああっ、着物が…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3089, 101, 2, 4, 0, 109501, 1, 0, "ドＳさんは優しいです\n優しいのにドＳとは\nさすが人格破綻者…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3090, 102, 2, 8, 0, 109501, 1, 0, "ドＳさんの考えている\nことが伝わってきます\nはい…クウカ脱ぎます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3091, 1, 2, 1, 0, 109501, 1, 1, "眩しい朝日がクウカの\n体を焦がします\n…それもイイ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3092, 2, 2, 1, 0, 109501, 1, 2, "お昼のランチは\nクウカがいいだなんて\n大胆過ぎです…じゅる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3093, 3, 2, 1, 0, 109501, 1, 3, "…今夜のドＳさんは\n大胆です…ぐふふ…\nはっ、視線が…！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3095, 2, 3, 1, 0, 109501, 1, 0, "この心地良さ、\n心が休まりすぎて\n体が疼いてきます…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3096, 3, 3, 1, 0, 109501, 1, 0, "すごく愛らしいです…\n妄想も出てこない\nくらい…じゅるり");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3097, 4, 3, 1, 0, 109501, 1, 0, "この香りに包まれて\nいると、いい気持ちに\nなって…いきますぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3098, 5, 3, 1, 0, 109501, 1, 0, "「熱を帯びた体は\nどうしようもなく\n誰かを求め…」ぐふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3100, 7, 3, 1, 0, 109501, 1, 0, "お腹が膨らんで\nいきます…それは\nまるで…ぐふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3101, 8, 3, 1, 0, 109501, 1, 0, "クウカの探している\nジャンルはどこに\nありますかね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3103, 1, 1, 1, 0, 109601, 1, 0, "カチョーフーゲツは\nトーゴクの心を\n表した言葉デスね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3104, 2, 1, 1, 0, 109601, 1, 0, "オー！　新しい忍法を\n思いついたデス！\nさっそく試すデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3105, 3, 1, 1, 0, 109601, 1, 0, "トーゴクの天気には\n槍が降る日も\nあるそうデス…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3106, 4, 1, 1, 0, 109601, 1, 0, "我がショーグンは\n永遠にフメツデース\nいざ出陣デース！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3107, 5, 1, 1, 0, 109601, 1, 0, "壁に耳あり\n障子に…ん？\nメアリーって誰デス？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3108, 101, 1, 4, 0, 109601, 1, 0, "ショーグンがいれば\nワタシはどんな\n忍法も使いこなせマス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3109, 102, 1, 8, 0, 109601, 1, 0, "不届き者はどこで\nゴザルデス？　忍法で\n退治してくれヨウ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3110, 1, 2, 1, 0, 109601, 1, 0, "ショーグン！　新しい\n忍法を覚えたデス！\n見てほしいデース！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3111, 2, 2, 1, 0, 109601, 1, 0, "レッツ手裏剣道デス！\n投げてソウロウで\nゴザルデース！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3112, 3, 2, 1, 0, 109601, 1, 0, "ふりかかる火の粉は\nワタシが払うデス！\nバンバン！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3113, 4, 2, 1, 0, 109601, 1, 0, "とっておきの忍法が\n吹き荒れるデス！\nよそ見はダメデスヨ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3114, 101, 2, 4, 0, 109601, 1, 0, "ショーグンは\n何階建てのお城を\n建てたいデスか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3115, 102, 2, 8, 0, 109601, 1, 0, "テンシュカクから\n平和な城下町を\n眺めてみたいデス…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3116, 1, 2, 1, 0, 109601, 1, 1, "おはようございマス！\n本日はオヒガラモヨク\n良い日になりそうデス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3117, 2, 2, 1, 0, 109601, 1, 2, "お腹すいたデース…\nショーグンもご飯に\nしまショウ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3118, 3, 2, 1, 0, 109601, 1, 3, "闇討ちに遭わぬよう\n夜は気を付けて\n歩くデスよー？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3120, 2, 3, 1, 0, 109601, 1, 0, "天下分け目の\n戦いに備えて…\nマッタリデース");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3121, 3, 3, 1, 0, 109601, 1, 0, "口寄せの術で\n召喚したいくらい\nかわいいデース");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3122, 4, 3, 1, 0, 109601, 1, 0, "いい匂いデ～ス\n香り玉の開発の\n参考になりそうデスね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3123, 5, 3, 1, 0, 109601, 1, 0, "ワタシの懐よりも\nゾーリが暖まりマス…\nライバル出現デス…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3125, 7, 3, 1, 0, 109601, 1, 0, "腹が減っては\n戦はできぬデース！\n天下統一に向けて\n腹ごしらえデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3126, 8, 3, 1, 0, 109601, 1, 0, "ムム、暗号文デス！？\n解読には時間が\nかかりそうデース…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3128, 1, 1, 1, 0, 109701, 1, 0, "掃除も終わりましたし\nそろそろ、食事の\n準備をしなくては");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3129, 2, 1, 1, 0, 109701, 1, 0, "異世界の演劇…\n許されるならば、\n観てみたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3130, 3, 1, 1, 0, 109701, 1, 0, "こちらの世界には、\nマヨネーズが普通に\n存在するのですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3131, 4, 1, 1, 0, 109701, 1, 0, "こちらの世界は食材も\n面白い物が多いですね\nなにかレシピを\n考えてみましょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3132, 5, 1, 1, 0, 109701, 1, 0, "みょんみょんみょん…\n魔法の練習は\nこれぐらいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3133, 101, 1, 4, 0, 109701, 1, 0, "倒木の撤去で思わぬ\n収入となりました\nサレン様に\nお渡ししておかないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3134, 102, 1, 8, 0, 109701, 1, 0, "料理を美味しく\n召し上がって頂けると\nメイド冥利につきます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3135, 1, 2, 1, 0, 109701, 1, 0, "お出かけでしたら、\nレムも同行\nさせてくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3136, 2, 2, 1, 0, 109701, 1, 0, "レムにできること\nでしたら、なんでも\nお申し付けください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3137, 3, 2, 1, 0, 109701, 1, 0, "じーー。いえ、\nその髪の長さが少し、\nとても少し、かなり\n少し気になったもので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3138, 4, 2, 1, 0, 109701, 1, 0, "鉄球ですか？\nあれは護身用ですので\n問題はありませんよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3139, 101, 2, 4, 0, 109701, 1, 0, "計算の勉強は\n進んでおりますか？\nレムでよろしければ、\nいつでもお教えします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3140, 102, 2, 8, 0, 109701, 1, 0, "次はもっと、大きな\n魔物料理に挑戦します\nワイバーンの姿焼き\nなんてどうでしょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3141, 1, 2, 1, 0, 109701, 1, 1, "おはようございます\n朝食の準備が\nできておりますので、\n食卓におこしください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3142, 2, 2, 1, 0, 109701, 1, 2, "昼食の時間ですね\n何か食べたいものは\nありますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3143, 3, 2, 1, 0, 109701, 1, 3, "寝ないのか、ですか？\nメイドの就寝は、\n屋敷で最後と\n決まっておりますので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3145, 2, 3, 1, 0, 109701, 1, 0, "ふんわり…\nこのふんわりさは、\n鬼をも黙らせます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3146, 3, 3, 1, 0, 109701, 1, 0, "ふふっ…異世界でも\nかわいいものは\n共通なのですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3147, 4, 3, 1, 0, 109701, 1, 0, "よい香りですね\n魔女教の悪臭とは\n大違いです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3148, 5, 3, 1, 0, 109701, 1, 0, "ぬくぬくです…はっ！\nこれはいけません！\n人を…いえ、\n鬼をだめにします！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3150, 7, 3, 1, 0, 109701, 1, 0, "はむはむ…美味しい！\nこの味を再現できたら\n褒めてもらえる\nかもしれません…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3151, 8, 3, 1, 0, 109701, 1, 0, "絵がいっぱい…\n異世界の本は\nとても面白いですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3153, 1, 1, 1, 0, 109801, 1, 0, "異世界であろうと、\nラムのやるべきことは\n変わらないわ\nまずは休憩するわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3154, 2, 1, 1, 0, 109801, 1, 0, "マヨネーズがある\nということは、\nバルスの故郷が近い\nのかもしれないわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3155, 3, 1, 1, 0, 109801, 1, 0, "この世界では、バルス\nの言う言葉が使われる\nときがあるのね\n忌々しいかぎりだわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3156, 4, 1, 1, 0, 109801, 1, 0, "ラムたち以外にも\nメイドが居るのね\nラムが…いえ、\n仕事を押しつけるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3157, 5, 1, 1, 0, 109801, 1, 0, "…千里眼で視るかぎり\n周囲に異変はないわね\n危険がないなら、\nあとはレムに任せるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3158, 101, 1, 4, 0, 109801, 1, 0, "…ラムもまた、\n「お姉ちゃん」って\n呼ばれる日が\nくるのかしらね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3159, 102, 1, 8, 0, 109801, 1, 0, "ハッ！　ラムが作る\n蒸かし芋は完璧ね\n…気が向いたら、また\n作ってやろうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3160, 1, 2, 1, 0, 109801, 1, 0, "ラムに構う暇が\nあるなら働きなさい\nそうすれば、\nラムが楽をできるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3161, 2, 2, 1, 0, 109801, 1, 0, "ラムに何かを\n期待しても無駄よ\nラムに命令できるのは\nロズワール様だけだわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3162, 3, 2, 1, 0, 109801, 1, 0, "暇なら買い物に\n付き合いなさい\n荷物を\n持たせてあげるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3163, 4, 2, 1, 0, 109801, 1, 0, "ラムになんの用？\nふざけた内容なら\nねじ切るわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3164, 101, 2, 4, 0, 109801, 1, 0, "そういえば、あなたは\n記憶喪失だったわね…\n思い出す努力をなさい\n…家族が悲しむわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3165, 102, 2, 8, 0, 109801, 1, 0, "蒸かし芋が欲しい？\n随分と厚かましいわね\n…まだ残りがあるから\n好きに食べなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3166, 1, 2, 1, 0, 109801, 1, 1, "だらしない顔ね\n顔を洗って\nしゃんとなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3167, 2, 2, 1, 0, 109801, 1, 2, "お腹が空く時間ね\nラムの昼食を\n用意させてあげるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3168, 3, 2, 1, 0, 109801, 1, 3, "メイドが寝るのは\n屋敷で最後…\nラムが寝るために、\nさっさと寝なさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3170, 2, 3, 1, 0, 109801, 1, 0, "…ここから動かない\nという、誓いを\n立てたくなるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3171, 3, 3, 1, 0, 109801, 1, 0, "これは…かわいいわね\nもちろん、\nラムほどではないけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3172, 4, 3, 1, 0, 109801, 1, 0, "…香炉かしら？\nこちらの世界にも\n質のよい物があるのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3173, 5, 3, 1, 0, 109801, 1, 0, "見つけてしまったの\nかもしれないわ…\nラムの楽園を！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3175, 7, 3, 1, 0, 109801, 1, 0, "…はむっ\nラムの蒸かし芋ほど\nではないけど、\nなかなかいけるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3176, 8, 3, 1, 0, 109801, 1, 0, "異世界ならではの\n面白い内容もあるわね\nとても興味深いわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3178, 1, 1, 1, 0, 109901, 1, 0, "ねえパック、\nにゃんにゃか\nにゃかにゃんしよっか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3179, 2, 1, 1, 0, 109901, 1, 0, "時間もあるし、\nこっちの世界の石で\n石積みしようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3180, 3, 1, 1, 0, 109901, 1, 0, "私もお姉さんだし、\nサレンさんを\n見習わないと…うん！\n私、すごーく頑張る！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3181, 4, 1, 1, 0, 109901, 1, 0, "この世界は、銀髪で\nハーフエルフでも受け\n入れてくれるのね…\nなんだか嬉しいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3182, 5, 1, 1, 0, 109901, 1, 0, "今日のご飯…\nピーマルは\n入ってないわよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3183, 101, 1, 4, 0, 109901, 1, 0, "また、みんなで\n一緒に買い物に\n行きたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3184, 102, 1, 8, 0, 109901, 1, 0, "パック以外から\n家族って呼ばれたの\n初めて…ふふっ♪\nちょっと嬉しいかも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3185, 1, 2, 1, 0, 109901, 1, 0, "今からパックの\n毛繕いをするけど…\n一緒にする？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3186, 2, 2, 1, 0, 109901, 1, 0, "私も何かお手伝いを…\nあ、そうだ！\n料理とかどうかな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3187, 3, 2, 1, 0, 109901, 1, 0, "ねえ、ここで\n歌の練習って、\nしてもいいかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3188, 4, 2, 1, 0, 109901, 1, 0, "…あ、ごめんなさい！\n話しかけられるのって\nあまり慣れてなくて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3189, 101, 2, 4, 0, 109901, 1, 0, "すごーく頑張るから、\nこれからも勉強を\n手伝ってね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3190, 102, 2, 8, 0, 109901, 1, 0, "せーの、びくとりー！\nふふっ…また、一緒に\nラジーオタイソー\nしようね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3191, 1, 2, 1, 0, 109901, 1, 1, "ちゃんと起きてる？\nふふっ…よかった。\nあ、べ、別に心配した\nわけじゃないからね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3192, 2, 2, 1, 0, 109901, 1, 2, "お昼ご飯が楽しみね♪\nあ、こっちの世界って\nまよねーずはあるの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3193, 3, 2, 1, 0, 109901, 1, 3, "そろそろ寝る時間よ。\n夜更かししたら、\nめっ！　だからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3195, 2, 3, 1, 0, 109901, 1, 0, "勉強も終わったし…\nちょっ、ちょっとだけ\n休んでもいいよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3196, 3, 3, 1, 0, 109901, 1, 0, "か、かわいい…！\nパックのかわいさに\n匹敵するかも…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3197, 4, 3, 1, 0, 109901, 1, 0, "良い香り…\nロズワールの屋敷にも\nこういうのって\nあるのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3198, 5, 3, 1, 0, 109901, 1, 0, "あったかい…\nずっとここに…はっ！\nダメダメ！　王選の\nために勉強しないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3200, 7, 3, 1, 0, 109901, 1, 0, "あ…これ美味しい！\nこっちの世界は色んな\n食べ物があるのね。");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3201, 8, 3, 1, 0, 109901, 1, 0, "知らないことが\nいっぱい書いてある…\n異世界の本って、\n面白いのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3203, 1, 1, 1, 0, 110001, 1, 0, "海ってマジ最高！\nビーチの撮影も\n超楽しいしー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3204, 2, 1, 1, 0, 110001, 1, 0, "20パーって何パ？\n今度ヒデサイに\n聞いてみよっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3205, 3, 1, 1, 0, 110001, 1, 0, "夏の思い出を\nヒデサイと一緒に\n作りたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3206, 4, 1, 1, 0, 110001, 1, 0, "テンションあがる\n水着ゲットして\n超ラッキーだよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3207, 5, 1, 1, 0, 110001, 1, 0, "休憩が終わったら\n撮影にもどらないと！\n気合入れてこ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3208, 101, 1, 4, 0, 110001, 1, 0, "ヒデサイとビーチで\nパーティーしたいな～\n超楽しそうだよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3209, 102, 1, 8, 0, 110001, 1, 0, "ヒデサイといると\n楽しくてうれしくて…\nカレシってこんな感じ\nなのかなぁ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3210, 1, 2, 1, 0, 110001, 1, 0, "見て見て～！\n夏らしいネイルに\nしてみたんだ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3211, 2, 2, 1, 0, 110001, 1, 0, "ヒデサイ～\nこの水着どうかな？\nイケてるっしょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3212, 3, 2, 1, 0, 110001, 1, 0, "水着姿の写真？\nもちいいよ！\nかわいく撮ってね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3213, 4, 2, 1, 0, 110001, 1, 0, "うちだって\n夏の海みたいに\nキラキラしちゃうよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3214, 101, 2, 4, 0, 110001, 1, 0, "ヒデサイとうちの\nフィーリングって\nめっちゃエモいよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3215, 102, 2, 8, 0, 110001, 1, 0, "ねーねーヒデサイ！\n一緒に泳ぎにいこっ！\nほら、手繋いで♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3216, 1, 2, 1, 0, 110001, 1, 1, "水着オッケー！\nネイルもばっちり！\n朝から遊んじゃおー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3217, 2, 2, 1, 0, 110001, 1, 2, "お昼食べたら\n昼寝して\nリフレッシュしよー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3218, 3, 2, 1, 0, 110001, 1, 3, "水着ってマジで\n最強かも…このまま\nお風呂にも入れるし♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3220, 2, 3, 1, 0, 110001, 1, 0, "マジ気持ちいいー♪\nおに癒やされるん\nですけど～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3221, 3, 3, 1, 0, 110001, 1, 0, "やばばばばー！\nかわいすぎだってば！\nマジらぶだよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3222, 4, 3, 1, 0, 110001, 1, 0, "あ、この香り超好き！\nモデル仲間に\n教えたげよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3223, 5, 3, 1, 0, 110001, 1, 0, "あったか～い♪\n夏の太陽みたい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3225, 7, 3, 1, 0, 110001, 1, 0, "マジ美味しいねこれ♪\nビーチで\n流行っちゃうかも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3226, 8, 3, 1, 0, 110001, 1, 0, "夏のために\n最新ファッションを\n勉強ちう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3228, 10, 3, 1, 0, 110001, 1, 0, "なにコレもにカワ～♪\nなんて生き物？\nヒデサイ知ってる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3229, 11, 3, 1, 0, 110001, 1, 0, "うわっ超フカフカ～\nなんかうち眠く\nなってきちゃった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3230, 1, 1, 1, 0, 110101, 1, 0, "海の家でのんびり\n過ごしましょう\n熱中症には注意してね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3231, 2, 1, 1, 0, 110101, 1, 0, "はぁ、どうやったら\n泳げるように\nなれるのかしら～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3232, 3, 1, 1, 0, 110101, 1, 0, "海で日焼け止めを\n塗らないと、あとで\n大変なことになるわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3233, 4, 1, 1, 0, 110101, 1, 0, "久しぶりに水着を\n着たんだけど\n変じゃなかったかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3234, 5, 1, 1, 0, 110101, 1, 0, "波の音って落ち着くわ\n授業中に聞いたら\nみんな寝ちゃうかも？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3235, 101, 1, 4, 0, 110101, 1, 0, "海が楽しいって\n思えたのも\nあの子のおかげね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3236, 102, 1, 8, 0, 110101, 1, 0, "あの子と二人で海に\n来られてよかったわ\n一日があっという間ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3237, 1, 2, 1, 0, 110101, 1, 0, "男の子と海だなんて\n少女漫画みたいで\n憧れてたの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3238, 2, 2, 1, 0, 110101, 1, 0, "夏休みの宿題は\nちゃんとやった？\n遊んでばかりではダメ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3239, 3, 2, 1, 0, 110101, 1, 0, "昼の海と夜の海\nどっちが好き？　私は\n君といる海が一番よ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3240, 4, 2, 1, 0, 110101, 1, 0, "ふう、疲れたわ～\n冷たいジュースで\n元気回復ね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3241, 101, 2, 4, 0, 110101, 1, 0, "海で見た君の背中\nすごく大きく見えたわ\nやっぱり男の子なのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3242, 102, 2, 8, 0, 110101, 1, 0, "君と一緒に見た\n夜の海…\n忘れられそうにないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3243, 1, 2, 1, 0, 110101, 1, 1, "準備ができたら\n海に出かけようよ\n今日も楽しみましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3244, 2, 2, 1, 0, 110101, 1, 2, "あら、もうお昼？\n海の家でランチに\nしましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3245, 3, 2, 1, 0, 110101, 1, 3, "夜の海岸についてきて\nくれる？　暗がりは\n一人じゃ怖くて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3247, 2, 3, 1, 0, 110101, 1, 0, "泳ぐ練習をしたら\n疲れちゃったわ～\nちょっと一休み…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3248, 3, 3, 1, 0, 110101, 1, 0, "かわいいわね～\n浮き輪に乗せて\n海に浮かべたいわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3249, 4, 3, 1, 0, 110101, 1, 0, "この匂い…\nなんだか夏の海を\n思い出すわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3250, 5, 3, 1, 0, 110101, 1, 0, "夜の海風で冷えない\nように、しっかりと\n身体を暖めましょうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3252, 7, 3, 1, 0, 110101, 1, 0, "海で遊ぶ前に\nしっかり食べて\n体力つけましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3253, 8, 3, 1, 0, 110101, 1, 0, "夏休み中でも\nしっかりお勉強\nしないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3255, 10, 3, 1, 0, 110101, 1, 0, "この子に乗れば\n海の上でも\nすいすい進めるかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3256, 11, 3, 1, 0, 110101, 1, 0, "ビーナスの誕生！\n…なんちゃって\nはしゃぎすぎかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3257, 1, 1, 1, 0, 110301, 1, 0, "夏の海には商機が\nあるはず…\nのがす手はないわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3258, 2, 1, 1, 0, 110301, 1, 0, "あたしが作った\n日焼け止め…\nこれは売れそうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3259, 3, 1, 1, 0, 110301, 1, 0, "子どもたちのために\n浮き輪を用意して\nおかないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3260, 4, 1, 1, 0, 110301, 1, 0, "海っていいわよね！\nみんなで羽を伸ばしに\n行きたいわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3261, 5, 1, 1, 0, 110301, 1, 0, "波の音を聞いて\nのんびりするのも\n悪くないわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3262, 101, 1, 4, 0, 110301, 1, 0, "ただの砂遊びも\nあんたと一緒なら\n楽しいから不思議ね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3263, 102, 1, 8, 0, 110301, 1, 0, "あんたがあたしの\nなんであれ、大切な\n存在ではあるのよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3264, 1, 2, 1, 0, 110301, 1, 0, "夏の海って\nすごい人よね…\n迷子にならないでよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3265, 2, 2, 1, 0, 110301, 1, 0, "ぼんやり海に浮かんで\n波に揺られるのも\n悪くないわよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3266, 3, 2, 1, 0, 110301, 1, 0, "ビーチで子どもたちと\n一緒に砂のお城を\n作りたいわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3267, 4, 2, 1, 0, 110301, 1, 0, "海で食べる\n焼きそばパン…\nいいかもしれないわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3268, 101, 2, 4, 0, 110301, 1, 0, "あたしの水着\n似合ってる？\nそう、ありがとう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3269, 102, 2, 8, 0, 110301, 1, 0, "あんたが居ると\nうれしい…って、\n子どもたちが\n言ってたわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3270, 1, 2, 1, 0, 110301, 1, 1, "朝の浜辺って\nいいわよね\n散歩しに行きたいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3271, 2, 2, 1, 0, 110301, 1, 2, "海の家のご飯って\nなんであんなに\nおいしいのかしら♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3272, 3, 2, 1, 0, 110301, 1, 3, "夜の海って、\nロマンチックよね。\nずっと眺めてたいわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3274, 2, 3, 1, 0, 110301, 1, 0, "やわらかくて\n気持ちいい…\nこのまま寝ちゃいそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3275, 3, 3, 1, 0, 110301, 1, 0, "海に一緒に入れる\nぬいぐるみとか\nないかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3276, 4, 3, 1, 0, 110301, 1, 0, "夏らしい\nいい香りね…\nなんの香りかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3277, 5, 3, 1, 0, 110301, 1, 0, "あったかい…\n濡れた体を乾かすには\nちょうどいいわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3279, 7, 3, 1, 0, 110301, 1, 0, "泳いだ後の食事は\n普段の何倍も\nおいしく感じるわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3280, 8, 3, 1, 0, 110301, 1, 0, "海に行く前にいろいろ\n調べなきゃね。備え\nあれば憂いなしよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3282, 10, 3, 1, 0, 110301, 1, 0, "海の守り神？\nずいぶんかわいらしい\n神様ね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3283, 11, 3, 1, 0, 110301, 1, 0, "このぐらい\n大きな貝があったら\n食費も浮くかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3284, 1, 1, 1, 0, 110401, 1, 0, "浜辺で食うものって\nなんであんなに\nうまいのかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3285, 2, 1, 1, 0, 110401, 1, 0, "いてて…\nちょっと日焼け\nしすぎたかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3286, 3, 1, 1, 0, 110401, 1, 0, "砂浜で走ると\nいいトレーニングに\nなるんだぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3287, 4, 1, 1, 0, 110401, 1, 0, "夏ならではの\n料理…か\n何がいいかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3288, 5, 1, 1, 0, 110401, 1, 0, "やっぱりここは\n涼しくて快適だな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3289, 101, 1, 4, 0, 110401, 1, 0, "泳ぎの練習だったら\nいつでも付き合って\nやるからな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3290, 102, 1, 8, 0, 110401, 1, 0, "水着で部屋の中に\nいるのって\n変な感じだな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3291, 1, 2, 1, 0, 110401, 1, 0, "うおっ！\nきゅ、急に\n触るなって…\nびっくりした");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3292, 2, 2, 1, 0, 110401, 1, 0, "え、砂がついてた？\n払ってくれたのか\nありがとよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3293, 3, 2, 1, 0, 110401, 1, 0, "夏バテしてないか？\nここで休んでけよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3294, 4, 2, 1, 0, 110401, 1, 0, "…そう見られると\n照れるっていうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3295, 101, 2, 4, 0, 110401, 1, 0, "カキ氷とか\n食いたくないか？\n氷、削ってやるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3296, 102, 2, 8, 0, 110401, 1, 0, "おまえと\n夏の思い出ができて\nよかったよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3297, 1, 2, 1, 0, 110401, 1, 1, "ふう…\n朝一番で泳ぐの\nやっぱ気持ちいいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3298, 2, 2, 1, 0, 110401, 1, 2, "一番あちぃ時間だ\n水分補給は\nこまめにな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3299, 3, 2, 1, 0, 110401, 1, 3, "今日もお疲れ\n明日のパトロールも\nよろしくな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3301, 2, 3, 1, 0, 110401, 1, 0, "泳ぎ疲れたからな\n少し休憩だ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3302, 3, 3, 1, 0, 110401, 1, 0, "か、かわいい…\nいや、なんでもねぇ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3303, 4, 3, 1, 0, 110401, 1, 0, "この香り落ち着くな\nこういうのも\n悪くねーかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3304, 5, 3, 1, 0, 110401, 1, 0, "あったけえ…！\n泳ぎ終わった後って\nけっこう体冷えてよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3306, 7, 3, 1, 0, 110401, 1, 0, "海で食べると\nまた一味違うよな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3307, 8, 3, 1, 0, 110401, 1, 0, "夏のサバイバル特集…\nちょっと読んでみるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3309, 10, 3, 1, 0, 110401, 1, 0, "へー！　こいつ、\nよくできてんな！\nいいなあ、実物も\n乗れたらいいのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3310, 11, 3, 1, 0, 110401, 1, 0, "か、かわ…！\nいや、じゃなくて\nあ、あたしがここに\n寝ていいのか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3311, 1, 1, 1, 0, 110501, 1, 0, "故郷の花を飾っても\nいいかな～？\n部屋が楽しくなるよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3312, 2, 1, 1, 0, 110501, 1, 0, "水着で歩いてると\n泳ぎたくなるさ～\n我慢できないさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3313, 3, 1, 1, 0, 110501, 1, 0, "夏が眩しいのは\nてぃーだがにこにこ\n笑ってるからさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3314, 4, 1, 1, 0, 110501, 1, 0, "泳ぎ疲れたら\n涼しい木陰で\nお昼寝するさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3315, 5, 1, 1, 0, 110501, 1, 0, "クロールも\n犬かきも\n大得意さ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3316, 101, 1, 4, 0, 110501, 1, 0, "なんだか歌いたい\n気分さ～\nキミもどう～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3317, 102, 1, 8, 0, 110501, 1, 0, "海の近くに住んで\nキミと歌って踊って\nそれが理想さ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3318, 1, 2, 1, 0, 110501, 1, 0, "私とキミ\nどっちがたくさん\n泳げるか\n競争するさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3319, 2, 2, 1, 0, 110501, 1, 0, "キミも三線に興味が\nあるのかな～？\n私が教えるさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3320, 3, 2, 1, 0, 110501, 1, 0, "嫌なことがあっても\n私と歌って踊れば\nなんくるないさー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3321, 4, 2, 1, 0, 110501, 1, 0, "たまには時間を忘れて\n私とのーんびり\n海を眺めるさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3322, 101, 2, 4, 0, 110501, 1, 0, "ぶるぶるぶるっ！\n毛が濡れちゃっても\nへっちゃらさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3323, 102, 2, 8, 0, 110501, 1, 0, "泳ぐ前は準備体操～！\n背中押してあげるから\nしっかりやるさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3324, 1, 2, 1, 0, 110501, 1, 1, "朝の浜辺は\nちゅらさんよ～\n一緒に歩こうよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3325, 2, 2, 1, 0, 110501, 1, 2, "お昼ご飯は\n決まったかな～？\n私はタコライスさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3326, 3, 2, 1, 0, 110501, 1, 3, "星と波音の中で\n三線鳴らすのも\nオツなものさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3328, 2, 3, 1, 0, 110501, 1, 0, "ちょうどよかったさー\nゆっくり休んだら\nまた泳ぎに行くさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3329, 3, 3, 1, 0, 110501, 1, 0, "砂浜に飾って\nおきたいさ～\nきっとかわいいさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3330, 4, 3, 1, 0, 110501, 1, 0, "くんくん…はあ\n癒されるさ…\n故郷の夏の匂いさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3331, 5, 3, 1, 0, 110501, 1, 0, "おおー…！\n濡れた髪が\nみるみる乾いてくさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3333, 7, 3, 1, 0, 110501, 1, 0, "ん～！　これ、\n海で食べたら\nもっとおいしいさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3334, 8, 3, 1, 0, 110501, 1, 0, "海の生物図鑑ね～\nこの前みかけた魚も\n載ってるかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3336, 10, 3, 1, 0, 110501, 1, 0, "わぁ～！　みてみて！\n背中に乗れるさー！\nキミと一緒に\n乗りたいさ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3337, 11, 3, 1, 0, 110501, 1, 0, "ふかふかさ～\n海の底の\n人魚になった気分さ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3338, 103, 1, 12, 0, 105801, 1, 0, "あの人が\nわたしの騎士だったら\nいいのにな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3339, 103, 2, 12, 0, 105801, 1, 0, "あなたのおかげで\nわたしの心はいつも\nお腹いっぱいです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3340, 103, 1, 12, 0, 105901, 1, 0, "許されるのならば、\n今すぐにでも、\n主さまのおそばに\n行きたいです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3341, 103, 2, 12, 0, 105901, 1, 0, "主さま…\nお慕いしております…\nいつまでも、おそばに\n居させてください…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3342, 103, 1, 12, 0, 106001, 1, 0, "なんか最近、\nあいつのことしか\n考えてない…\nあたし…どうしよう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3343, 103, 2, 12, 0, 106001, 1, 0, "そ、外に行くなら、\n連れていきなさいよね\nその…あたしが\n守ってあげるから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3344, 1, 1, 1, 0, 110601, 1, 0, "部屋の中は涼しくて\n気持ちええどすなぁ\n天国やわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3345, 2, 1, 1, 0, 110601, 1, 0, "クラゲはんって\nフリルいっぱいの\nドレスみたいやねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3346, 3, 1, 1, 0, 110601, 1, 0, "外でセミはんが\n元気に鳴いてはるねぇ\n今日もええ天気やわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3347, 4, 1, 1, 0, 110601, 1, 0, "こないに暑いと\n海に入って\n涼みたくなるわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3348, 5, 1, 1, 0, 110601, 1, 0, "いつか\nマホマホ王国にも\n海の家作りまひょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3349, 101, 1, 4, 0, 110601, 1, 0, "うちも\n付き合いますえ\n泳ぎの練習しまひょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3350, 102, 1, 8, 0, 110601, 1, 0, "うちの里帰り\n王子はんも一緒に\n来まへんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3351, 1, 2, 1, 0, 110601, 1, 0, "王子はんは日焼けより\n色白美人の方が\n好きでっしゃろか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3352, 2, 2, 1, 0, 110601, 1, 0, "うちと一緒に\n浮き輪で海、\nプカプカしまへん？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3353, 3, 2, 1, 0, 110601, 1, 0, "日が落ちたら\n線香花火\nやりたいわぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3354, 4, 2, 1, 0, 110601, 1, 0, "木陰でのんびり\nお昼寝…\n最高やね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3355, 101, 2, 4, 0, 110601, 1, 0, "お祭ではぐれても\n王子はんなら見つけて\nくれはります？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3356, 102, 2, 8, 0, 110601, 1, 0, "楽しい夏やわぁ\nずっとこんな日が\nつづくとええね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3357, 1, 2, 1, 0, 110601, 1, 1, "うちにしては早起き？\n暑くて目が早う\n覚めてもうたんどす");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3358, 2, 2, 1, 0, 110601, 1, 2, "お昼は冷たい\nおそうめんとか\nどうでっしゃろ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3359, 3, 2, 1, 0, 110601, 1, 3, "夜は星がきれいやね\n二人で浜辺でも\n行きまへんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3361, 2, 3, 1, 0, 110601, 1, 0, "うーん、遊び疲れた\n身体にちょうどええ\nほっこり具合やわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3362, 3, 3, 1, 0, 110601, 1, 0, "かいらしい子は\nみーんな\nマホマホ王国の\n住人どすえ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3363, 4, 3, 1, 0, 110601, 1, 0, "この香り…\n南国にいる気分やねぇ\n癒されるわぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3364, 5, 3, 1, 0, 110601, 1, 0, "これで\n冷えた身体も\nポカポカやねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3366, 7, 3, 1, 0, 110601, 1, 0, "外はまだ暑いやろうし\nバテんよう\nしっかり食べんとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3367, 8, 3, 1, 0, 110601, 1, 0, "海の中にもお城が\nあるんやねぇ\n行ってみたいわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3369, 10, 3, 1, 0, 110601, 1, 0, "この子、ふかふかやね\nこのままマホマホ王国\n乗せてってくれはる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3370, 11, 3, 1, 0, 110601, 1, 0, "人魚姫になっても\n最後は王子はんと\nハッピーエンド\nどすえ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3371, 1, 1, 1, 0, 107001, 1, 0, "真似したくなる\n人がここには\n大勢いますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3372, 2, 1, 1, 0, 107001, 1, 0, "偽物を一人\n紛れこませました\n…冗談です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3373, 3, 1, 1, 0, 107001, 1, 0, "動物に変身して\nその辺りを\n散歩してきます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3374, 4, 1, 1, 0, 107001, 1, 0, "失った記憶は\nどの程度回復するの\nでしょうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3375, 5, 1, 1, 0, 107001, 1, 0, "人や物だけでなく\nいずれは世界すら\n真似てみせます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3376, 101, 1, 4, 0, 107001, 1, 0, "次は彼に\nどんなことを\n教えましょうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3377, 102, 1, 8, 0, 107001, 1, 0, "知識はともかく\n私の力はまだ\n必要なようですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3378, 1, 2, 1, 0, 107001, 1, 0, "どうしました？\n…何でもない？\n…そうですか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3379, 2, 2, 1, 0, 107001, 1, 0, "退屈しています\n芸でもして\n楽しませなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3380, 3, 2, 1, 0, 107001, 1, 0, "研究のためです\n少し話し相手に\nなりなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3381, 4, 2, 1, 0, 107001, 1, 0, "何か真似して欲しい？\n私の能力を何だと\n思っているのですか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3382, 101, 2, 4, 0, 107001, 1, 0, "貴方にはまだ色々と\n教えるべきことが\nありますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3383, 102, 2, 8, 0, 107001, 1, 0, "随分多くの女性と\n知り合いなのですね\n驚きました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3384, 1, 2, 1, 0, 107001, 1, 1, "…\nおはようございます\n…まだ朝ですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3385, 2, 2, 1, 0, 107001, 1, 2, "食事にします\n…どうしました？\n早く持ってきなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3386, 3, 2, 1, 0, 107001, 1, 3, "早く寝なさい\n夜更かしすると\n背が伸びませんよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3388, 2, 3, 1, 0, 107001, 1, 0, "マサキより\n座り心地は\nいいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3389, 3, 3, 1, 0, 107001, 1, 0, "意外に複雑な\n構造ですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3390, 4, 3, 1, 0, 107001, 1, 0, "真似るなら\n香りまで\n再現しなくては");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3391, 5, 3, 1, 0, 107001, 1, 0, "発火現象の\n模倣…なかなか\n難しいものです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3393, 7, 3, 1, 0, 107001, 1, 0, "偽物や分身を作るには\nエネルギーが\n必要不可欠なのです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3394, 8, 3, 1, 0, 107001, 1, 0, "暇つぶしには\nちょうどよさそうです\n…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3396, 1, 1, 1, 0, 110701, 1, 0, "学院かぁ…\n友達の作り方の\n授業はないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3397, 2, 1, 1, 0, 110701, 1, 0, "学院でぼっちに\nなったときのために、\n避難場所を\n探しておかないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3398, 3, 1, 1, 0, 110701, 1, 0, "ぼっちの私が学院…\nな、なんだか\n目まいがしてきました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3399, 4, 1, 1, 0, 110701, 1, 0, "クラスメイトに\n話しかける練習…\nむ、難しすぎます…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3400, 5, 1, 1, 0, 110701, 1, 0, "目指せ友達100人…\n無理かな…10人…\nや、やっぱり一人！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3401, 101, 1, 4, 0, 110701, 1, 0, "あなたと学院生活が\n送れるなんて、\nとっても\nうれしいです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3402, 102, 1, 8, 0, 110701, 1, 0, "えへへ…\n学院でも、\nあなたと一緒に\n居られてうれしいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3403, 1, 2, 1, 0, 110701, 1, 0, "が、学院ってあんなに\n人が居るんですね…\n友達作りのイメトレを\nやり直さないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3404, 2, 2, 1, 0, 110701, 1, 0, "私にとって\n部活動とはＢＢ団！\n今日もたくさん\n活動しましょうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3405, 3, 2, 1, 0, 110701, 1, 0, "休み時間は寝たふり…\nご飯はおトイレ…\nぼっち対策は完璧です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3406, 4, 2, 1, 0, 110701, 1, 0, "学院で友達を作る\n勉強は完璧ですよ！\n購買部でパンを買って\n渡すんですよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3407, 101, 2, 4, 0, 110701, 1, 0, "学院でも、\nＢＢ団の活動を\nしていきましょうね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3408, 102, 2, 8, 0, 110701, 1, 0, "ぼっちに学院生活は\n厳しいですね…でも、\nあなたと一緒なら\n乗りこえられそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3409, 1, 2, 1, 0, 110701, 1, 1, "もうこんな時間…\nあの…一緒に学院に\n行ってくれませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3410, 2, 2, 1, 0, 110701, 1, 2, "お昼ですね！\n言ってくれれば、\nパンでもお握りでも\n買ってきますよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3411, 3, 2, 1, 0, 110701, 1, 3, "今日もぼっち…\nいつか友達と一緒に、\nパジャマパーティー\nしたいなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3413, 2, 3, 1, 0, 110701, 1, 0, "森とは違う\n心地良さが…このまま\n眠っちゃいそうです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3414, 3, 3, 1, 0, 110701, 1, 0, "かわいい…この子を、\n話す練習の相手役に\nしてみようかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3415, 4, 3, 1, 0, 110701, 1, 0, "いい香り…\nいつ友達ができても\nいいように、私の\n部屋にも置こうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3416, 5, 3, 1, 0, 110701, 1, 0, "こ、これは…\nぼっちで\n日陰者の私には\n暖かすぎます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3418, 7, 3, 1, 0, 110701, 1, 0, "おいしい…！\nお弁当にして、学院に\n持っていけないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3419, 8, 3, 1, 0, 110701, 1, 0, "学院の授業に\nついていくためにも、\n勉強しておこうかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3421, 1, 1, 1, 0, 110801, 1, 0, "あんた、何してんの。\nいいけど、なんでも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3422, 2, 1, 1, 0, 110801, 1, 0, "邪魔。どいて。\nいや怒ってないし。\nコレがフツーだから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3423, 3, 1, 1, 0, 110801, 1, 0, "いいけど、\n散らかしめの部屋だと\n片付けたくなるよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3424, 4, 1, 1, 0, 110801, 1, 0, "暇なときは明日の\nコーデ考えてるよ。\n考えるのはタダだし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3425, 5, 1, 1, 0, 110801, 1, 0, "昔よくシオリン\n構いすぎてハツネに\n文句言われたなァ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3426, 101, 1, 4, 0, 110801, 1, 0, "なんかさ。あんたって\n謎に女子トモ多いよね\n…いいけど、べつに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3427, 102, 1, 8, 0, 110801, 1, 0, "ねえ。あのさあ。\nあんた弁当で好きな\n具とかってあんの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3428, 1, 2, 1, 0, 110801, 1, 0, "あ？　何。なんか用。\nや、ないならないで\nいいけど、べつに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3429, 2, 2, 1, 0, 110801, 1, 0, "ごめ、ちょっと\n黙っててくんない。\n明日の試験ヤバだから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3430, 3, 2, 1, 0, 110801, 1, 0, "歩き方が静か？\n癖になってるんだよね\n足音を殺すの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3431, 4, 2, 1, 0, 110801, 1, 0, "うちの血液型？\n大雑把のОだけど。\nなんか文句あんの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3432, 101, 2, 4, 0, 110801, 1, 0, "ひゃんっ！\nや、だからさ…急に\n話しかけんなっての");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3433, 102, 2, 8, 0, 110801, 1, 0, "な、何…あんまジッと\n見ないでくんない…\nなんか、その、ハズい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3434, 1, 2, 1, 0, 110801, 1, 1, "早起きは得意な方だと\n思うけど。昔から\nそれがデフォだったし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3435, 2, 2, 1, 0, 110801, 1, 2, "こんな時間か…\n昼ごはん\nサクッと作っちゃお");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3436, 3, 2, 1, 0, 110801, 1, 3, "あ？　夜遊び？\nはッ…そんなん\n５歳で卒業したっての");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3438, 2, 3, 1, 0, 110801, 1, 0, "あーヤバじゃんコレ…\nふかついてる場合\nじゃないっつーのに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3439, 3, 3, 1, 0, 110801, 1, 0, "なんだこれ\nかわいいかよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3440, 4, 3, 1, 0, 110801, 1, 0, "ふーん。\nこの匂い…\nなんかいいじゃん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3441, 5, 3, 1, 0, 110801, 1, 0, "暖炉はアドじゃん。\n煮物、焼き物、蒸し物\nいろいろ作れそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3443, 7, 3, 1, 0, 110801, 1, 0, "何コレ\n食べ物困んないじゃん\nうちにも一台くんない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3444, 8, 3, 1, 0, 110801, 1, 0, "本かァー…んー\n学校の勉強だけで\nいいかなァ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3446, 1, 1, 1, 0, 111101, 1, 0, "イタズラってなにを\nしたらいいのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3447, 2, 1, 1, 0, 111101, 1, 0, "カップケーキ\n上手に作れました\n食べてくれるかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3448, 3, 1, 1, 0, 111101, 1, 0, "あの人、\nお菓子くれるかな？\nくれなかったら…ふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3449, 4, 1, 1, 0, 111101, 1, 0, "オバケ…いないよね？\n怖くなんてないけど！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3450, 5, 1, 1, 0, 111101, 1, 0, "ハロウィンは\n楽しいけどオバケの\nお祭りなんだよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3451, 101, 1, 4, 0, 111101, 1, 0, "にゃ～、にゃお～！\nちゃんと怖いかな？\n早く帰ってこないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3452, 102, 1, 8, 0, 111101, 1, 0, "あの人のことだから\nお菓子欲しがるよね…\n準備はバッチリです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3453, 1, 2, 1, 0, 111101, 1, 0, "えへへ。猫さんのお耳\nよく出来てるでしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3454, 2, 2, 1, 0, 111101, 1, 0, "触りましたね？\nイタズラしましたね？\nへんた～い！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3455, 3, 2, 1, 0, 111101, 1, 0, "フー！　頭を撫でたら\n怒りますよ！　あれ？\n猫みたいでした？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3456, 4, 2, 1, 0, 111101, 1, 0, "きゃっ！　も、もう、\n脅かさないでください\n怖くありませんけど！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3457, 101, 2, 4, 0, 111101, 1, 0, "お菓子ですか？\nありがとうございます\nハッピーハロウィン♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3458, 102, 2, 8, 0, 111101, 1, 0, "ゴロゴロ…\nね、猫さんの真似です\n…似てましたか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3459, 1, 2, 1, 0, 111101, 1, 1, "さぁ、お菓子作りを\n始めますよ。下準備は\n大事ですからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3460, 2, 2, 1, 0, 111101, 1, 2, "今、つまみ食い\nしましたね！？　あっ\nおやつの時間でしたか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3461, 3, 2, 1, 0, 111101, 1, 3, "さぁ、ハロウィンの\n始まりです…ふぁ…\nね、眠くありません！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3463, 2, 3, 1, 0, 111101, 1, 0, "ちょっと疲れたかも…\nパーティの時間まで\nひと休みしなきゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3464, 3, 3, 1, 0, 111101, 1, 0, "私も今、こんな感じ\nなのかな？　こんなに\nかわいいといいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3465, 4, 3, 1, 0, 111101, 1, 0, "甘い匂いがいっぱい…\nお菓子の香りかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3466, 5, 3, 1, 0, 111101, 1, 0, "温かくなると、\n丸まりたくなって…\n…猫になっちゃう！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3468, 7, 3, 1, 0, 111101, 1, 0, "ニンジンもこれくらい\nおいしければ\nいいのに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3469, 8, 3, 1, 0, 111101, 1, 0, "ハロウィンの本、\nオバケがたくさん\n載ってて怖いかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3471, 12, 3, 1, 0, 111101, 1, 0, "美味しそうなお菓子が\nいっぱい…これなら\nイタズラされませんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3473, 1, 1, 1, 0, 111201, 1, 0, "たくさんいたずら\nできるから\nハロウィン大好き！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3474, 2, 1, 1, 0, 111201, 1, 0, "ハロウィンだから\nいつもよりすごい\nいたずらしたいな～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3475, 3, 1, 1, 0, 111201, 1, 0, "カボチャを綺麗に\nくり抜いてすごく怖い\nランタン作っちゃお！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3476, 4, 1, 1, 0, 111201, 1, 0, "お菓子がたくさんで\nどれから食べるか\n迷っちゃうな～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3477, 5, 1, 1, 0, 111201, 1, 0, "どうすればみんなを\nびっくりさせられる\nかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3478, 101, 1, 4, 0, 111201, 1, 0, "カボチャ見てたら\nお腹空いて来たな～\nお菓子食べちゃお♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3479, 102, 1, 8, 0, 111201, 1, 0, "にいちゃんには\n特別ないたずらを\n用意してあげるね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3480, 1, 2, 1, 0, 111201, 1, 0, "カボチャにクラッカー\nを仕掛けて…わっ！？\nみ、見ちゃダメだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3481, 2, 2, 1, 0, 111201, 1, 0, "ん？　なぁに？\nお菓子ほしいの？\nもう、しかたないな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3482, 3, 2, 1, 0, 111201, 1, 0, "にいちゃんの\n面白い仮装が\n見てみたいな～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3483, 4, 2, 1, 0, 111201, 1, 0, "お菓子くれたお礼に\nとびっきりの\nいたずらしちゃうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3484, 101, 2, 4, 0, 111201, 1, 0, "にいちゃんは\nハロウィンでも最高の\nいたずら相手だよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3485, 102, 2, 8, 0, 111201, 1, 0, "にいちゃんと一緒に\nハロウィンパレード\n歩きたいな～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3486, 1, 2, 1, 0, 111201, 1, 1, "おはようにいちゃん！\n仮装して出かける\n準備しなきゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3487, 2, 2, 1, 0, 111201, 1, 2, "お腹すいたな～\nもらったお菓子\n食べちゃだめかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3488, 3, 2, 1, 0, 111201, 1, 3, "たくさんいたずらして\nもうクタクタ～\nミソギもう寝るね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3490, 2, 3, 1, 0, 111201, 1, 0, "やわらか～い…\nここでひと休みして\nまたいたずらしよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3491, 3, 3, 1, 0, 111201, 1, 0, "かわいいもので\n油断させてわっ！\nってするのどうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3492, 4, 3, 1, 0, 111201, 1, 0, "いいにお～い！\nいたずらのアイデアが\nわいてくるよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3493, 5, 3, 1, 0, 111201, 1, 0, "もらったお菓子\nあったかくしたら\nおいしいかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3495, 7, 3, 1, 0, 111201, 1, 0, "お菓子ばっかりじゃ\n飽きちゃうもんね！\nご飯も食べよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3496, 8, 3, 1, 0, 111201, 1, 0, "本のなかに\nいたずらのヒント\nないかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3498, 12, 3, 1, 0, 111201, 1, 0, "お菓子がたくさん！\n一人で食べていいの？\nやっぱりだめか～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3500, 103, 1, 12, 0, 101101, 1, 0, "お勉強は順調ですよ\nやっぱりお兄ちゃんの\nおかげなんでしょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3501, 103, 2, 12, 0, 101101, 1, 0, "お兄ちゃんとの\n思い出の場所\nまた行きましょうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3502, 1, 1, 1, 0, 111301, 1, 0, "えへへ～♪\nハロウィンの\nミイラさんうさぎさん\nぴょんぴょ～ん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3503, 2, 1, 1, 0, 111301, 1, 0, "るんたった～\nハロウィンハロウィン\n楽しいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3504, 3, 1, 1, 0, 111301, 1, 0, "ハロウィンって\nどんなお菓子を\nもらえるのかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3505, 4, 1, 1, 0, 111301, 1, 0, "お菓子をもらう\n練習をしなくちゃ！\nトリックオア\nトリート～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3506, 5, 1, 1, 0, 111301, 1, 0, "おにいちゃんと\nハロウィンするの\nミミ楽しみだな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3507, 101, 1, 4, 0, 111301, 1, 0, "おにいちゃんと\nいっしょにお菓子を\n食べたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3508, 102, 1, 8, 0, 111301, 1, 0, "おにいちゃんと\n毎日ハロウィン\nできたらいいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3509, 1, 2, 1, 0, 111301, 1, 0, "えへへ～\nおにいちゃん！\nハッピーハロウィン♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3510, 2, 2, 1, 0, 111301, 1, 0, "おにいちゃんも\nいっしょに\nハロウィンパレード\nしようね～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3511, 3, 2, 1, 0, 111301, 1, 0, "ミイラさんうさぎさん\nだぞ～…えへへ\nミミこわかったかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3512, 4, 2, 1, 0, 111301, 1, 0, "おにいちゃん！\nハロウィンのお菓子\nおいしいね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3513, 101, 2, 4, 0, 111301, 1, 0, "おにいちゃんと\nいっしょなら\nおばけさんも\nこわくないよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3514, 102, 2, 8, 0, 111301, 1, 0, "ミミね\nハロウィンも\nおにいちゃんも\nだ～いすき♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3515, 1, 2, 1, 0, 111301, 1, 1, "おひさまさんも\nハロウィンの\nおようふく\n着たいかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3516, 2, 2, 1, 0, 111301, 1, 2, "ねえねえおにいちゃん\nお昼ごはんはもらった\nお菓子でもい～い？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3517, 3, 2, 1, 0, 111301, 1, 3, "まだハロウィン…？\nうぅん…眠くないよぅ\nでもちょっと…ふぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3519, 2, 3, 1, 0, 111301, 1, 0, "ふかふか～♪\nおばけさんが\n中にいるのかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3520, 3, 3, 1, 0, 111301, 1, 0, "わぁ、かわいい～♪\nミミといっしょに\nあそぼ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3521, 4, 3, 1, 0, 111301, 1, 0, "ふわぁ～\nミミ、このにおい\nだ～いすき♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3522, 5, 3, 1, 0, 111301, 1, 0, "あったかいね～♪\nおばけさんも\nポカポカしてるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3524, 7, 3, 1, 0, 111301, 1, 0, "おいしい～♪\nおにいちゃんも\n食べようよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3525, 8, 3, 1, 0, 111301, 1, 0, "この本\nおにいちゃんと\nいっしょに\n読みたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3527, 12, 3, 1, 0, 111301, 1, 0, "ハッピーハロウィン♪\nえへへ、お菓子が\nいっぱいだね～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3529, 1, 1, 1, 0, 111401, 1, 0, "ここ、好きだよ。\nみんな優しいから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3530, 2, 1, 1, 0, 111401, 1, 0, "なんかさみしいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3531, 3, 1, 1, 0, 111401, 1, 0, "知らない人怖いな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3532, 4, 1, 1, 0, 111401, 1, 0, "お部屋おっきいねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3533, 5, 1, 1, 0, 111401, 1, 0, "ルナね…\nお昼寝したいかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3534, 101, 1, 4, 0, 111401, 1, 0, "おにいさん！\n今日は何して遊ぶの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3535, 102, 1, 8, 0, 111401, 1, 0, "あのね、\nお料理教えてほしい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3536, 1, 2, 1, 0, 111401, 1, 0, "あっ、おにいさんだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3537, 2, 2, 1, 0, 111401, 1, 0, "ルナは元気だよ！\nいいこだもん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3538, 3, 2, 1, 0, 111401, 1, 0, "今日は何しようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3539, 4, 2, 1, 0, 111401, 1, 0, "ルナと遊んでよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3540, 101, 2, 4, 0, 111401, 1, 0, "ねーねー、\nルナとお出かけして！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3541, 102, 2, 8, 0, 111401, 1, 0, "おにいさんと、\n遊びたいなー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3542, 1, 2, 1, 0, 111401, 1, 1, "ふふっ！\nなんかまぶしいね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3543, 2, 2, 1, 0, 111401, 1, 2, "ルナ、お腹空いたな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3544, 3, 2, 1, 0, 111401, 1, 3, "どこに行こうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3546, 2, 3, 1, 0, 111401, 1, 0, "ルナ、これ好きだな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3547, 3, 3, 1, 0, 111401, 1, 0, "かわいい！　好き！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3548, 4, 3, 1, 0, 111401, 1, 0, "なんかいい匂い！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3549, 5, 3, 1, 0, 111401, 1, 0, "あったかいねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3551, 7, 3, 1, 0, 111401, 1, 0, "ふふっ\nおいしいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3552, 8, 3, 1, 0, 111401, 1, 0, "ルナ、\n眠くなっちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3554, 103, 1, 12, 0, 105201, 1, 0, "えへへ。あの人と\nランドソルでデート\nできたらうれしいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3555, 103, 2, 12, 0, 105201, 1, 0, "あなたとなら\nどんなことだって\nできる気がするわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3556, 1, 1, 1, 0, 106501, 1, 0, "あーあ、退屈だな\nカレでも探しに\nいこうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3557, 2, 1, 1, 0, 106501, 1, 0, "この前のケンカは\n最高に燃えたなぁ\n…拳が疼いてきたぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3558, 3, 1, 1, 0, 106501, 1, 0, "一体、この世界は\nどうなっちまったって\nいうんだ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3559, 4, 1, 1, 0, 106501, 1, 0, "もう仕事の時間か\nボスも人使いが荒いぜ\n…ま、いいけどさ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3560, 5, 1, 1, 0, 106501, 1, 0, "オレたち以外に\nドラゴン族はあと何人\nいるんだろうな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3561, 101, 1, 4, 0, 106501, 1, 0, "カレの真剣な顔\n面白かったな\nまた遊びたいぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3562, 102, 1, 8, 0, 106501, 1, 0, "どうしてカレがそばに\nいると、腹の底から\n力が湧いてくるんだ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3563, 1, 2, 1, 0, 106501, 1, 0, "よっす！\nなんかオイシイ話でも\nあったりしない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3564, 2, 2, 1, 0, 106501, 1, 0, "なあ、オレと遊ぼうぜ\n心配すんなよ。危ない\nことはよしとくからさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3565, 3, 2, 1, 0, 106501, 1, 0, "どうした。オレに\nケンカ売ろうってか？\n…ははは、冗談だよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3566, 4, 2, 1, 0, 106501, 1, 0, "ちょうど退屈してた\nところだ、特訓に\n付き合ってくれよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3567, 101, 2, 4, 0, 106501, 1, 0, "ったくよぉ…\nオレがかわいいなんて\n冗談はもうよせよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3568, 102, 2, 8, 0, 106501, 1, 0, "次の仕事も一緒に\n来るだろ？　断っても\n連れて行くけどな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3569, 1, 2, 1, 0, 106501, 1, 1, "おはよう！　今日の\n予定はまずケンカして\nで、その後もケンカだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3570, 2, 2, 1, 0, 106501, 1, 2, "よっす！\n腹ごしらえが済んだら\nオレと遊ぼうぜ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3571, 3, 2, 1, 0, 106501, 1, 3, "夜は危ないから\nあんま出歩くな？\n…だから面白えんだろ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3573, 2, 3, 1, 0, 106501, 1, 0, "次のケンカに備えて\n今は休んでおくか…\n全力で暴れたいからな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3574, 3, 3, 1, 0, 106501, 1, 0, "ボスの飼ってる\nラーゴが、中に\n入ってるんじゃ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3575, 4, 3, 1, 0, 106501, 1, 0, "ああ、たぎる匂いが\nする…ひと暴れ\nしたくなってきた！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3576, 5, 3, 1, 0, 106501, 1, 0, "おおぉ…\nオレの拳もなんだか\n熱くなってきたぜ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3578, 7, 3, 1, 0, 106501, 1, 0, "いつでも全力で\nケンカするために\n力を蓄えないとな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3579, 8, 3, 1, 0, 106501, 1, 0, "やっぱりな…オレが\n知ってる地図とは\nまるで違ってやがる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3581, 1, 1, 1, 0, 111501, 1, 0, "さぁプレゼントで\n埋め尽くしてやろう！\n大いに喜ぶがいいよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3582, 2, 1, 1, 0, 111501, 1, 0, "メリークリスマス☆\n聖夜の宴だ\n派手に楽しむとしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3583, 3, 1, 1, 0, 111501, 1, 0, "煙突から入る？\nいいや、ワタシは\nいつでも正面からさ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3584, 4, 1, 1, 0, 111501, 1, 0, "サンタクロースの\nお出ましだ！\n歓迎するがいいよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3585, 5, 1, 1, 0, 111501, 1, 0, "飾り付けが足りん！\nワタシが演出して\nやろうじゃないか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3586, 101, 1, 4, 0, 111501, 1, 0, "人の喜ぶ顔を見るのも\n悪くはないな…おっと\nワタシらしくないな☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3587, 102, 1, 8, 0, 111501, 1, 0, "プレゼントはまだか？\nワタシを喜ばせたら\nお返しは弾むぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3588, 1, 2, 1, 0, 111501, 1, 0, "ワタシを呼んだか？\n退屈な要件だったら\n覚悟しておくことだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3589, 2, 2, 1, 0, 111501, 1, 0, "なんだ？\nワタシへの挑戦か？\nよし、受けた♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3590, 3, 2, 1, 0, 111501, 1, 0, "おっと、当たらんよ\nワタシの乱数聖域は\n絶対だからな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3591, 4, 2, 1, 0, 111501, 1, 0, "なんだ、オマエも\n暇なのか？\n奇遇だな、ワタシもさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3592, 101, 2, 4, 0, 111501, 1, 0, "なにか愉しいことでも\nしようじゃないか\nさぁ、何をする？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3593, 102, 2, 8, 0, 111501, 1, 0, "こうもワタシに\n気安く触れるのは\nオマエくらいだよ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3594, 1, 2, 1, 0, 111501, 1, 1, "朝だろうと関係ない！\nさぁ愉しく苛烈に\n騒ごうじゃないか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3595, 2, 2, 1, 0, 111501, 1, 2, "調子の出てくる時間だ\nしっかりワタシを\n愉しませてくれよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3596, 3, 2, 1, 0, 111501, 1, 3, "眠いなどと言わせんぞ\nまだまだ一日は\n終わらんからな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3598, 2, 3, 1, 0, 111501, 1, 0, "いい具合じゃないか\nこのまま持って帰って\nしまおうか…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3599, 3, 3, 1, 0, 111501, 1, 0, "なかなか愛らしい\n造形をしているな？\nワタシには負けるがな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3600, 4, 3, 1, 0, 111501, 1, 0, "ほう、悪くない香りだ\n戦いの匂いをうまく\n隠してくれそうだ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3601, 5, 3, 1, 0, 111501, 1, 0, "体が温まってくると\nひと暴れしたくなるな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3603, 7, 3, 1, 0, 111501, 1, 0, "ワタシの舌は厳しいぞ\n…ふーむ、なるほど\n認めざるをえんな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3604, 8, 3, 1, 0, 111501, 1, 0, "クリスティーナさんは\n知識の収集も\n欠かさないんだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3606, 14, 3, 1, 0, 111501, 1, 0, "これは驚いたな\nだがもっと、もっとだ\nワタシを退屈させるな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3607, 15, 3, 1, 0, 111501, 1, 0, "こんな戯れだって\n軽くこなしてしまう\nクリスティーナさんさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3608, 1, 1, 1, 0, 111601, 1, 0, "メリークリスマス！\nさあ、パーティーを\n盛り上げるよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3609, 2, 1, 1, 0, 111601, 1, 0, "衣装一つで全然\n気分が違うね！\n最高のクリスマスに\nなりそうだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3610, 3, 1, 1, 0, 111601, 1, 0, "ツリーのてっぺんの\n星って、なんだか\n欲しくなるんだよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3611, 4, 1, 1, 0, 111601, 1, 0, "めいっぱい\nクリスマスを楽しむよ\n遊びだって本気\nなんだからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3612, 5, 1, 1, 0, 111601, 1, 0, "赤、白、緑、金\nクリスマスカラー\nってお洒落だよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3613, 101, 1, 4, 0, 111601, 1, 0, "雪、降らないかな？\nホワイトクリスマス\nってちょっと\n憧れるなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3614, 102, 1, 8, 0, 111601, 1, 0, "キミと過ごすこの\n楽しい時間がずーっと\n続けばいいのにな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3615, 1, 2, 1, 0, 111601, 1, 0, "クリスマスライブ\nチケット用意するから\n絶対来てよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3616, 2, 2, 1, 0, 111601, 1, 0, "カンパーイ！\nジュースだけど\nちょっと大人の\n気分だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3617, 3, 2, 1, 0, 111601, 1, 0, "クリスマス衣装どう？\nかわいいでしょ\nあっ、どこ見てるの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3618, 4, 2, 1, 0, 111601, 1, 0, "ねえ、後で街に\n行こうよ\n大きなツリーを\n一緒に見たいんだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3619, 101, 2, 4, 0, 111601, 1, 0, "ねえ、ダンスの練習に\n付き合ってくれない？\n大丈夫、手取り足取り\n教えてあげるから♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3620, 102, 2, 8, 0, 111601, 1, 0, "来年のクリスマスも\n隣にキミが\nいてくれたら\nうれしいのにな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3621, 1, 2, 1, 0, 111601, 1, 1, "クリスマスって朝から\nドキドキしちゃうね\nなんだか子どもみたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3622, 2, 2, 1, 0, 111601, 1, 2, "パーティーの準備も\n大分進んだね\n一息ついて\nランチにしよっか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3623, 3, 2, 1, 0, 111601, 1, 3, "静かな夜だね\n心臓の音まで\n聞こえちゃいそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3625, 2, 3, 1, 0, 111601, 1, 0, "あ～、この絶妙な\n柔らかさ…\nいい仕事してるなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3626, 3, 3, 1, 0, 111601, 1, 0, "アイドル顔負けの\nかわいさ、ズルい！\nでもかわいい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3627, 4, 3, 1, 0, 111601, 1, 0, "ん～、落ち着くなぁ\n今日はゆっくり\n眠れそうだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3628, 5, 3, 1, 0, 111601, 1, 0, "ぬくぬく～\nどうしよう、ここから\n動きたくないなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3630, 7, 3, 1, 0, 111601, 1, 0, "ダンスの練習もしたし\nちょっとくらいなら\nいいよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3631, 8, 3, 1, 0, 111601, 1, 0, "アイドルといえど\nかわいいだけじゃダメ\n知識も必要だよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3633, 14, 3, 1, 0, 111601, 1, 0, "面白ーい！\nこの演出、ライブでも\nできないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3634, 15, 3, 1, 0, 111601, 1, 0, "もふもふ～♪\n寒い日には最高の\n抱き心地だね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3635, 103, 1, 12, 0, 101801, 1, 0, "彼ともっとお話し\nしたいな…もう少し\n補習を増やそうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3636, 103, 2, 12, 0, 101801, 1, 0, "君のこともっともっと\n教えて欲しいな。私に\n補習授業してくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3637, 1, 1, 1, 0, 111701, 1, 0, "この姿ならあやつも\n子ども扱いできまい！\n…じゃがなぜか、少し\n物足りないような…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3638, 2, 1, 1, 0, 111701, 1, 0, "時間もあるし、\n聖夜の宴の\n準備をするかのう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3639, 3, 1, 1, 0, 111701, 1, 0, "…わらわの知る聖夜と\n随分違うが、宴は宴\n楽しませて\nもらおうかのう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3640, 4, 1, 1, 0, 111701, 1, 0, "大人の姿で\nできること…ふむ\n少しあやつを\nからかってやるか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3641, 5, 1, 1, 0, 111701, 1, 0, "…クリスマスは\n恋人たちの夜！？\nち、近頃の若いもんは\n破廉恥なのじゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3642, 101, 1, 4, 0, 111701, 1, 0, "…あやつがおらんと、\n宴も物足りぬな\n…馬鹿者が\n早く帰ってこい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3643, 102, 1, 8, 0, 111701, 1, 0, "誰も見ておらぬな…？\n…よし、あやつへの\nプレゼントを\n準備するとしようか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3644, 1, 2, 1, 0, 111701, 1, 0, "クリスマスの\nチキンにケーキ…\nべ、別に楽しみになど\nしておらぬぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3645, 2, 2, 1, 0, 111701, 1, 0, "この姿では、わらわの\n頭をなでるのは\n難しかろう…べ、\n別に残念ではないわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3646, 3, 2, 1, 0, 111701, 1, 0, "メリー\nクリスマスじゃ！\nさあ、わらわのために\n宴の準備をするのじゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3647, 4, 2, 1, 0, 111701, 1, 0, "そんなにこの衣装が\n気になるのか？\n…だったら、直に\n触ってみるがよい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3648, 101, 2, 4, 0, 111701, 1, 0, "いつもと逆に、お主を\n子ども扱いしてやるか\nほれ、膝枕をしてやる\nからそばに来い♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3649, 102, 2, 8, 0, 111701, 1, 0, "…せ、聖夜の予定は\n空けておくのじゃぞ？\nなんでって…\nな、なんでもじゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3650, 1, 2, 1, 0, 111701, 1, 1, "もう朝か…聖夜の宴が\n楽しみで…ではなく！\n準備のせいで、\nあまり眠れんかったぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3651, 2, 2, 1, 0, 111701, 1, 2, "…ずっと雪が\n降っておれば、\n陽光が強いこの時間も\n怯えずにすむのにのう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3652, 3, 2, 1, 0, 111701, 1, 3, "時は来た…\nさあ眷属よ！\nわらわと共に、\n聖夜の宴を楽しもうぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3654, 2, 3, 1, 0, 111701, 1, 0, "良い椅子ではないか\nここから聖夜の宴を\n眺めるのもよいかもな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3655, 3, 3, 1, 0, 111701, 1, 0, "か、かわい…こほん\nなかなか良い\nデザインをしておるな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3656, 4, 3, 1, 0, 111701, 1, 0, "ふむ、良い香りじゃ\n聖夜の宴でも\nこれを使うとしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3657, 5, 3, 1, 0, 111701, 1, 0, "これが癒し…はっ！\nあやうく浄化される\nところであった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3659, 7, 3, 1, 0, 111701, 1, 0, "ニ、ニンニクは\n入っておらぬよな？\n…うむ、美味じゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3660, 8, 3, 1, 0, 111701, 1, 0, "聖夜は恋人たちの夜…\n…き、気になるわけ\nではないが、\n少し調べてみるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3662, 14, 3, 1, 0, 111701, 1, 0, "ほう…これは面白い\n魔法の使い方じゃな\nまるで本物の\n演劇のようじゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3663, 15, 3, 1, 0, 111701, 1, 0, "こ、この程度の\nかわいさに誘惑される\nわらわでは…\nふわもこなのじゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3664, 1, 1, 1, 0, 112001, 1, 0, "おせち料理も\n魔物尽くしだったり\nしないわよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3665, 2, 1, 1, 0, 112001, 1, 0, "初詣で何をお祈り\nしようかしら…\n定番でいいわよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3666, 3, 1, 1, 0, 112001, 1, 0, "初日の出って\n特別な感じがして\nいいわよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3667, 4, 1, 1, 0, 112001, 1, 0, "寒い中並んで飲む\n甘酒って不思議なほど\nおいしいわよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3668, 5, 1, 1, 0, 112001, 1, 0, "羽根つきで勝負…\nあいつにだったら\n勝てるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3669, 101, 1, 4, 0, 112001, 1, 0, "年賀状になんて書こう\n…いろいろと\n恥ずかしくなるのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3670, 102, 1, 8, 0, 112001, 1, 0, "今年もあいつと\n居られること…\n結構うれしいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3671, 1, 2, 1, 0, 112001, 1, 0, "何じっと\n見てんのよ？\nお年玉はあげないわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3672, 2, 2, 1, 0, 112001, 1, 0, "おせち料理一緒に\n食べる？\n結構おいしいわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3673, 3, 2, 1, 0, 112001, 1, 0, "羽根つきで負けたら\n顔に墨塗られるのよ\n覚悟しなさい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3674, 4, 2, 1, 0, 112001, 1, 0, "門松飾るから\nちょっと手伝って\nくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3675, 101, 2, 4, 0, 112001, 1, 0, "あんたと一緒に\n初詣行くのも悪くない\n…かも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3676, 102, 2, 8, 0, 112001, 1, 0, "初詣で何をお祈り\nしたか？　うっさい！\n内緒よ！内緒！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3677, 1, 2, 1, 0, 112001, 1, 1, "もう朝なの…\n正月くらいゆっくり\n寝ていたいわよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3678, 2, 2, 1, 0, 112001, 1, 2, "おせちに飽きたら\n次は何を食べよう\nかしら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3679, 3, 2, 1, 0, 112001, 1, 3, "そろそろ寝ましょ\nいい初夢が見られると\nいいわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3681, 2, 3, 1, 0, 112001, 1, 0, "この格好でいるのも\nなかなか疲れるわね\n休憩～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3682, 3, 3, 1, 0, 112001, 1, 0, "か、かわいい…う～ん\n鏡餅も顔を描けば\nかわいくなるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3683, 4, 3, 1, 0, 112001, 1, 0, "いい匂いね\n落ち着いて\n眠れそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3684, 5, 3, 1, 0, 112001, 1, 0, "ここでお餅焼いたら\n一段とおいしく\nなりそうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3686, 7, 3, 1, 0, 112001, 1, 0, "正月に食べるものは\nなんでもおいしく\n感じちゃうわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3687, 8, 3, 1, 0, 112001, 1, 0, "魔物を使わない\nおせちを\n調べておかなきゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3689, 1, 1, 1, 0, 112101, 1, 0, "新年を気持ちよく\n過ごせるように\nお掃除がんばります！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3690, 2, 1, 1, 0, 112101, 1, 0, "神殿に通っていたら\nいつの間にか足腰が\n鍛えられたような…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3691, 3, 1, 1, 0, 112101, 1, 0, "神殿付近は屋台も\nあるので、良い香りが\n漂ってくるんですよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3692, 4, 1, 1, 0, 112101, 1, 0, "おせちを作れるように\nなれば、子どもたちも\n喜んでくれるかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3693, 5, 1, 1, 0, 112101, 1, 0, "コホォォォォォ…！\nふぅ、深呼吸すると\n落ち着きますね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3694, 101, 1, 4, 0, 112101, 1, 0, "お仕事以外の時も\nあなたと…い、いえ！\nなんでもないです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3695, 102, 1, 8, 0, 112101, 1, 0, "あなたと一緒だと\nなんだかポカポカ\nしてくるんです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3696, 1, 2, 1, 0, 112101, 1, 0, "この格好をしていると\nなんだか神殿にいる\n気分になりますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3697, 2, 2, 1, 0, 112101, 1, 0, "そういえば神殿で\n甘酒をもらったんです\nあなたも飲みますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3698, 3, 2, 1, 0, 112101, 1, 0, "あっ、髪飾りが\nズレちゃってました！\nいけないいけない…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3699, 4, 2, 1, 0, 112101, 1, 0, "ひゃわっ！？\nく、くすぐったり\nしないでください～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3700, 101, 2, 4, 0, 112101, 1, 0, "そ、そんなに\n見つめられると\nて、照れちゃいます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3701, 102, 2, 8, 0, 112101, 1, 0, "今度、私が考えた\n運気上昇のおまじない\nかけてあげますね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3702, 1, 2, 1, 0, 112101, 1, 1, "おはようございます\n神殿のお手伝いに行く\n準備もしなきゃですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3703, 2, 2, 1, 0, 112101, 1, 2, "お昼になりましたし\nご飯は私が作…\nえっ、ダメですか！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3704, 3, 2, 1, 0, 112101, 1, 3, "明日も早いですし\nそろそろ寝る支度を…\nふわぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3706, 2, 3, 1, 0, 112101, 1, 0, "お掃除も終わったので\n少し休憩を…ふわぁ…\n急に眠気が…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3707, 3, 3, 1, 0, 112101, 1, 0, "新年を気持ちよく\n過ごせるようこの子も\nきれいにしましょう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3708, 4, 3, 1, 0, 112101, 1, 0, "神殿のお香のような\n香りだと落ち着いて\n過ごせそうですよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3709, 5, 3, 1, 0, 112101, 1, 0, "ぽかぽかですね～…\n甘酒も飲んで体の\n芯から温めましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3711, 7, 3, 1, 0, 112101, 1, 0, "今年こそ\n料理も上手に…\nもぐもぐもぐもぐ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3712, 8, 3, 1, 0, 112101, 1, 0, "失敗続きだと\n逆に運が良くなる…\nほ、本当ですかぁ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3714, 103, 1, 12, 0, 103401, 1, 0, "キミにならもう\nどんな私を見られても\n大丈夫かな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3715, 103, 2, 12, 0, 103401, 1, 0, "なになにどしたのぉ？\nお姉さんが撫でたげる\nこっちにきなさぁい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3716, 1, 1, 1, 0, 111901, 1, 0, "わたくしの舞を\n主さまは喜んで\nくださるでしょうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3717, 2, 1, 1, 0, 111901, 1, 0, "年を越したあとに\n食べるおそばも\nおいしいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3718, 3, 1, 1, 0, 111901, 1, 0, "甘酒を飲むと\n心まで温まる\n気がいたします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3719, 4, 1, 1, 0, 111901, 1, 0, "主さまのために\n真心を込めたおせちを\nご用意しなくては");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3720, 5, 1, 1, 0, 111901, 1, 0, "おみくじを引くのは\nドキドキしつつも\n楽しいものです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3721, 101, 1, 4, 0, 111901, 1, 0, "主さまの温もりは\n心まで温めてくれる\nようです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3722, 102, 1, 8, 0, 111901, 1, 0, "うまくできなくとも\n心を込めて精いっぱい\n舞いましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3723, 1, 2, 1, 0, 111901, 1, 0, "主さま、この晴れ着は\n似合っている\nでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3724, 2, 2, 1, 0, 111901, 1, 0, "お餅はゆっくりと\n召し上がって\nくださいまし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3725, 3, 2, 1, 0, 111901, 1, 0, "主さまのお顔の\n福笑いなら、完璧に\nできる気がいたします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3726, 4, 2, 1, 0, 111901, 1, 0, "主さまはどのような\n初夢をご覧になった\nのでしょう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3727, 101, 2, 4, 0, 111901, 1, 0, "甘酒の飲み過ぎは\nいけませんよ？\nめっ、でございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3728, 102, 2, 8, 0, 111901, 1, 0, "二人羽織とは\nあんなにも暖かい\nものなのですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3729, 1, 2, 1, 0, 111901, 1, 1, "おはようございます\n寒い季節の朝日は\nとても美しいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3730, 2, 2, 1, 0, 111901, 1, 2, "おいしくとも\n食べ過ぎは正月太りの\nもとでございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3731, 3, 2, 1, 0, 111901, 1, 3, "いい夢が見られるよう\n暖かくして\n眠るといたしましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3733, 2, 3, 1, 0, 111901, 1, 0, "ふかふか…\nこのまま\n寝てしまいそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3734, 3, 3, 1, 0, 111901, 1, 0, "あなたと一緒に\nお正月遊びを\n楽しんでみたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3735, 4, 3, 1, 0, 111901, 1, 0, "神殿の独特な香りを\nおうちに持ち込むのは\nどうでしょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3736, 5, 3, 1, 0, 111901, 1, 0, "風邪をひきませんよう\n暖かくいたしましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3738, 7, 3, 1, 0, 111901, 1, 0, "食べ過ぎは\n正月太りの\nもとだというのに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3739, 8, 3, 1, 0, 111901, 1, 0, "主さまのために\n参拝の作法を\n予習しておきましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3741, 1, 1, 1, 0, 112201, 1, 0, "…この杖、変身前には\n無いパーツがあるけど\nこれはどこから…うん\n考えないようにしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3742, 2, 1, 1, 0, 112201, 1, 0, "フ、フリフリの\nかわいい衣装…はっ！\n素に戻ってはダメだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3743, 3, 1, 1, 0, 112201, 1, 0, "魔法探偵\nミスティ★カスミ！\n魔法の力で捜査開始！\n…練習終わりっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3744, 4, 1, 1, 0, 112201, 1, 0, "怪しい視線を感じる…\nまさか、近くに\n闇の力を持つ人が！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3745, 5, 1, 1, 0, 112201, 1, 0, "時間もあるし、\n魔法少女の修行を…\nじゃ、じゃなくて！\n探偵の仕事をしよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3746, 101, 1, 4, 0, 112201, 1, 0, "助手くんとずっと\n一緒に居られるし、\n魔法少女も\n案外悪くないかも♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3747, 102, 1, 8, 0, 112201, 1, 0, "魔法少女の訓練のため\n助手くんの所に行こう\nかな…あ、あくまで\n訓練のためにね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3748, 1, 2, 1, 0, 112201, 1, 0, "…髪型が急に\n変わって驚いた？\nき、気になるなら…\n少し触ってみるかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3749, 2, 2, 1, 0, 112201, 1, 0, "助手くんは魔法少女に\nなりたいのかい？\nその場合は魔法騎士…\nいや、魔法助手とか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3750, 3, 2, 1, 0, 112201, 1, 0, "頭に浮かぶ呪文…\n強制変身…助手くん\n魔法少女とは\n呪いか何かなのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3751, 4, 2, 1, 0, 112201, 1, 0, "あ、あまり触らないで\nくれ…魔法少女になる\nと感覚が鋭くなって、\n耳も敏感に…ひゃう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3752, 101, 2, 4, 0, 112201, 1, 0, "や、やっぱりこの\n格好は変かな…え、\nかわいい？　じゃあ…\nいや、でも、う～ん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3753, 102, 2, 8, 0, 112201, 1, 0, "…この変身は助手くん\nのせいでもあるんだよ\nだから…せ、責任を\n取ってもらうからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3754, 1, 2, 1, 0, 112201, 1, 1, "おはよう助手くん\nさあ、そろそろ\n街のパトロールに\n行こうじゃないか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3755, 2, 2, 1, 0, 112201, 1, 2, "もうお昼…助手くん、\nそろそろ本業に戻ろう\n…その顔は何かな？\n私の本業は探偵だぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3756, 3, 2, 1, 0, 112201, 1, 3, "夜だけど、私は\nもう少し仕事をするよ\n魔法少女の強い体は\nこんなときに便利だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3758, 2, 3, 1, 0, 112201, 1, 0, "気持ちいい…\nこの癒しを、魔法と\n論理の二つの観点から\n解明したいね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3759, 3, 3, 1, 0, 112201, 1, 0, "ダ、ダメ！！\nここで感情のままに\n飛びついたら、私の\nイメージがぁ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3760, 4, 3, 1, 0, 112201, 1, 0, "心が安らぐ香りだね…\n…今なら、魔法少女も\nすんなりと受け入れ…\nてはダメだっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3761, 5, 3, 1, 0, 112201, 1, 0, "あったかい…\n魔法少女だろうと\n休息は必要だし、少し\n休んでいこうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3763, 7, 3, 1, 0, 112201, 1, 0, "魔法少女も探偵も、\nやっぱり体が資本！\n食べられるときに\n食べておかないとね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3764, 8, 3, 1, 0, 112201, 1, 0, "…魔法少女\nセリイちゃんの本は\nどこにあるのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3766, 1, 1, 1, 0, 112301, 1, 0, "魔法少女かぁ…\nせっかくだし思う存分\n体を動かしてみたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3767, 2, 1, 1, 0, 112301, 1, 0, "ニャットちゃん…\nこの格好を見て\n私って気づくかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3768, 3, 1, 1, 0, 112301, 1, 0, "ふふ…\n今日はなんだか\n調子がいいかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3769, 4, 1, 1, 0, 112301, 1, 0, "魔法は便利だけど\nあまり頼りすぎちゃ\nダメだよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3770, 5, 1, 1, 0, 112301, 1, 0, "さっき街で小さな子に\n声かけられちゃった\n照れるけどうれしいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3771, 101, 1, 4, 0, 112301, 1, 0, "あの人がいると\nなんだかホッとする\n不思議…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3772, 102, 1, 8, 0, 112301, 1, 0, "魔法少女になっても\nあの人への気持ちは\nずっと同じ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3773, 1, 2, 1, 0, 112301, 1, 0, "今日の私…ですか？\nはいとっても元気です\n…あなたのおかげかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3774, 2, 2, 1, 0, 112301, 1, 0, "よかったら魔法の\n練習に付き合って\nくれませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3775, 3, 2, 1, 0, 112301, 1, 0, "あの…\nこの格好どうですか？\n似合ってると…いいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3776, 4, 2, 1, 0, 112301, 1, 0, "…な、なんですか？\nあまり見られると\n恥ずかしいです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3777, 101, 2, 4, 0, 112301, 1, 0, "私、あなたのそばに\nいられたら、それで…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3778, 102, 2, 8, 0, 112301, 1, 0, "想い人と結ばれる\n魔法は…ひゃっ！？\n今の聞いてましたか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3779, 1, 2, 1, 0, 112301, 1, 1, "おはようございます\n今日も街の平和の\nために頑張らなきゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3780, 2, 2, 1, 0, 112301, 1, 2, "お腹すきましたね。\nあの…一緒にランチは\nいかがですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3781, 3, 2, 1, 0, 112301, 1, 3, "あ、もうこんな時間…\nふふ、まだこんなに\n体力が余ってるのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3783, 2, 3, 1, 0, 112301, 1, 0, "気持ちいい…\nこの気持ち良さは\nどんな魔法も勝てない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3784, 3, 3, 1, 0, 112301, 1, 0, "何これ、かわいい…\nお姉ちゃんにも\n見せてあげたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3785, 4, 3, 1, 0, 112301, 1, 0, "ん～、いい香り\n…これ、魔法で\n出せたりしないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3786, 5, 3, 1, 0, 112301, 1, 0, "あったか～い\nえへへ…なんだか\nお姉ちゃんみたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3788, 7, 3, 1, 0, 112301, 1, 0, "おいしいなぁ、これ\n魔法少女になってから\n食欲旺盛かも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3789, 8, 3, 1, 0, 112301, 1, 0, "ふふ…\n魔法少女になっても\n読書はやめられないな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3791, 103, 1, 12, 0, 101001, 1, 0, "みらくるまほりん\nくるりんぱ～♪\n王子はんのために\n花嫁修業や～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3792, 103, 2, 12, 0, 101001, 1, 0, "あ、あのな王子はん\nできたらその…\nお姫さまだっこを\nお願いしてもええ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3793, 1, 1, 1, 0, 180401, 1, 0, "やっぱりわたしたちの\nギルドハウスの\n居心地は最高ですね☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3794, 2, 1, 1, 0, 180401, 1, 0, "王宮じゃできないこと\nやっちゃいましょう♪\n例えば、えっと～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3795, 3, 1, 1, 0, 180401, 1, 0, "そうだ、隠しておいた\nおやつがありました！\nまだ食べられますね☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3796, 4, 1, 1, 0, 180401, 1, 0, "ごはんはみんなで\n楽しく食べましょう！\nそれが一番の\n調味料です♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3797, 5, 1, 1, 0, 180401, 1, 0, "やっぱりここが、\nわたしの帰る場所です\n…ただいま☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3798, 101, 1, 4, 0, 180401, 1, 0, "なんだか物足りません\nきっと、あの人が隣に\nいないからですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3799, 102, 1, 8, 0, 180401, 1, 0, "どこを見ても、大切な\n思い出がたくさん\n詰まっていますね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3800, 1, 2, 1, 0, 180401, 1, 0, "無礼者～、なんて\n冗談です♪　どんどん\n触っちゃってください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3801, 2, 2, 1, 0, 180401, 1, 0, "ぷにぷにでしょう～？\nい～っぱい食べるのが\nぷにぷにの秘訣です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3802, 3, 2, 1, 0, 180401, 1, 0, "握手したいんですか？\nはい、にぎにぎ～！\nもう離しませんよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3803, 4, 2, 1, 0, 180401, 1, 0, "どうかしましたか？\n退屈してるんでしたら\nお散歩に行きましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3804, 101, 2, 4, 0, 180401, 1, 0, "ごはん王子♪\nわたしは王女ですから\nこれでピッタリですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3805, 102, 2, 8, 0, 180401, 1, 0, "大好きです～\n愛してます～\n…ほんと、ですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3806, 1, 2, 1, 0, 180401, 1, 1, "朝ごはんは大事です！\n山盛りごはんを食べて\n元気いっぱいですよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3807, 2, 2, 1, 0, 180401, 1, 2, "お腹ぺこぺこになる\n時間ですね～！\nごはん特盛、一つ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3808, 3, 2, 1, 0, 180401, 1, 3, "お腹いっぱい、今日は\nよく眠れそうですね♪\n明日もおいしい一日を");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3810, 2, 3, 1, 0, 180401, 1, 0, "休憩休憩～♪\nお腹を休めて、次の\nごはんに挑みます…☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3811, 3, 3, 1, 0, 180401, 1, 0, "かわいらしい\nぬいぐるみですね～\nキャルちゃんみたい☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3812, 4, 3, 1, 0, 180401, 1, 0, "すんすん…この匂い\n食欲増進の効果が\nありそうですね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3813, 5, 3, 1, 0, 180401, 1, 0, "体温が上がってくると\n眠くなっちゃいます…\nほわぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3815, 7, 3, 1, 0, 180401, 1, 0, "もぐもぐもぐもぐもぐ\nむぐむぐむぐむぐむぐ\nはぐはぐはぐはぐはぐ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3816, 8, 3, 1, 0, 180401, 1, 0, "教養を身に着けるには\n読書が一番です！\nえっと次のレシピは～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3818, 1, 1, 1, 0, 112401, 1, 0, "アイドルらしくなる\nコツって、何か\nあるんでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3819, 2, 1, 1, 0, 112401, 1, 0, "色んな人と話すのが\n好きなんです。つい\n長くなっちゃって…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3820, 3, 1, 1, 0, 112401, 1, 0, "アイドルを目指すって\n決めてから、毎日が\nワクワクなんです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3821, 4, 1, 1, 0, 112401, 1, 0, "ちゃんとストレッチ\nしておかなくっちゃ\nよいしょ、よいしょ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3822, 5, 1, 1, 0, 112401, 1, 0, "リンちゃんミオちゃん\n二人に負けないように\n私、頑張ります！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3823, 101, 1, 4, 0, 112401, 1, 0, "私の笑顔は素敵だって\n誰かに褒められた…\nそんな気がするんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3824, 102, 1, 8, 0, 112401, 1, 0, "私たちを支えてくれる\n誰かが、ずっと一緒に\nいてくれたような…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3825, 1, 2, 1, 0, 112401, 1, 0, "どうかしましたか？\n何か困ってるのなら\nお手伝いしますよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3826, 2, 2, 1, 0, 112401, 1, 0, "みなさん個性的で\n普通じゃない人ばかり\nいるような気が…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3827, 3, 2, 1, 0, 112401, 1, 0, "今日はポカポカした\nいい天気ですね～\nお散歩日和です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3828, 4, 2, 1, 0, 112401, 1, 0, "今、ミルクティーを\n淹れてたんです♪\nあなたも飲みますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3829, 101, 2, 4, 0, 112401, 1, 0, "私の得意なこと？\nうーんなんでしょう…\nあっ、肩たたきです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3830, 102, 2, 8, 0, 112401, 1, 0, "生・ハム・メローン！\nあ、ライブの掛け声を\n練習してたんですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3831, 1, 2, 1, 0, 112401, 1, 1, "おはようございます！\n今日も一日\n頑張りましょうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3832, 2, 2, 1, 0, 112401, 1, 2, "しっかりお昼を食べて\n午後からも張り切って\nいきましょうね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3833, 3, 2, 1, 0, 112401, 1, 3, "ぐっすり眠れるよう\n早めに用事を済ませて\nお休みしましょうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3835, 2, 3, 1, 0, 112401, 1, 0, "ちょっと休んだら\nレッスンの続きも\n頑張ります！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3836, 3, 3, 1, 0, 112401, 1, 0, "えへへ～\nふわふわもこもこで\nかわいいです～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3837, 4, 3, 1, 0, 112401, 1, 0, "リラックスできる\nいい香りですね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3838, 5, 3, 1, 0, 112401, 1, 0, "わぁ、ポカポカです♪\n温かい飲み物も\nほしくなりますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3840, 7, 3, 1, 0, 112401, 1, 0, "レッスンしたら\nお腹が空いちゃって…\nぱくぱくもぐもぐ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3841, 8, 3, 1, 0, 112401, 1, 0, "レッスンに役立つ\n運動の情報とか\n載ってるでしょうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3843, 1, 1, 1, 0, 112601, 1, 0, "きらきらーん☆\nよし、次のステージは\nこれで行けるかも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3844, 2, 1, 1, 0, 112601, 1, 0, "私の元気でみんなも\n元気になってくれたら\nうれしいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3845, 3, 1, 1, 0, 112601, 1, 0, "ちょっとレッスンで\n疲れちゃったかも…\nでも頑張るぞっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3846, 4, 1, 1, 0, 112601, 1, 0, "晩ごはん何にしよう？\nそーだ、しぶりんにも\n聞いてみよっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3847, 5, 1, 1, 0, 112601, 1, 0, "元気だから笑顔になる\nじゃなくて\n笑顔だから\n元気になるんだよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3848, 101, 1, 4, 0, 112601, 1, 0, "声援を聞いてる時ね\nすごく懐かしいって\n思うことがあるんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3849, 102, 1, 8, 0, 112601, 1, 0, "私を応援してくれる\n一番大事な人が\n隣にいた気がする…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3850, 1, 2, 1, 0, 112601, 1, 0, "なになにー？\nミオちゃんに\n何か用かな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3851, 2, 2, 1, 0, 112601, 1, 0, "おっ、やっほー！\n元気そうだね～、キミ\n私？\nもちろん元気～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3852, 3, 2, 1, 0, 112601, 1, 0, "ねぇねぇ、ちょっと\n遊びに行かない？\nたまには息抜きで！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3853, 4, 2, 1, 0, 112601, 1, 0, "ね、この魔物料理さ\nプリンって言い張れば\n食べてもらえそうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3854, 101, 2, 4, 0, 112601, 1, 0, "えへへ\nいつもありがとねっ！\nパワーもらってるよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3855, 102, 2, 8, 0, 112601, 1, 0, "どうしたどうした～\nミオちゃんの魅力に\nメロメロなのかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3856, 1, 2, 1, 0, 112601, 1, 1, "おっはよ～！\n一日の始まりだし\nテンション上げてこ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3857, 2, 2, 1, 0, 112601, 1, 2, "お腹空いた～…\nねぇねぇ、一緒に\nお昼食べようよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3858, 3, 2, 1, 0, 112601, 1, 3, "ふわぁ～…\n眠くなってきちゃった\nそろそろ休もっかなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3860, 2, 3, 1, 0, 112601, 1, 0, "わぁ、ふっかふか～！\nレッスンの疲れも\n吹っ飛んじゃうね☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3861, 3, 3, 1, 0, 112601, 1, 0, "何これ…かわいーっ！\n早くしまむーに\n教えてあげなきゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3862, 4, 3, 1, 0, 112601, 1, 0, "すぅ～…\nうんっ、これ私の\n好きな香りだな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3863, 5, 3, 1, 0, 112601, 1, 0, "ポッカポカだね～♪\n…あ～ん、ここから\n動きたくないーっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3865, 7, 3, 1, 0, 112601, 1, 0, "わっ、おーいしー！\nこれはテンション\n上がっちゃうね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3866, 8, 3, 1, 0, 112601, 1, 0, "ふむふむ…\nふむふむふむ…！\n勉強になった、ブイ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3868, 103, 1, 12, 0, 100101, 1, 0, "なんでドキドキが\n止まらないの…？\n騎士くんのせいだー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3869, 103, 2, 12, 0, 100101, 1, 0, "ドキドキしてるの\nあたしだけ、かな…\n騎士くんはどう…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3870, 103, 1, 12, 0, 100201, 1, 0, "騎士クンの前で\n好きって言えるように\n練習しないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3871, 103, 2, 12, 0, 100201, 1, 0, "騎士クン…大好き\n…き、騎士クン！？\nなんでここに！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3872, 103, 1, 12, 0, 100301, 1, 0, "困ったな…\n彼が居ないだけで、\nここまで\n寂しいと思うなんて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3873, 103, 2, 12, 0, 100301, 1, 0, "えっと…\n今日は訓練じゃなくて\nその…二人でゆっくり\n過ごしたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3874, 1, 1, 1, 0, 112501, 1, 0, "アイドルの心構え…\nどういう風に考えると\nしっくりくるのかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3875, 2, 1, 1, 0, 112501, 1, 0, "何か始めるのって\nドキドキするよね\nだから最近楽しいんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3876, 3, 1, 1, 0, 112501, 1, 0, "冒険者の時って毎日\nバタバタしてたけど…\n目標ができると違うね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3877, 4, 1, 1, 0, 112501, 1, 0, "少しお腹が空いた…\nチョコレート一粒だけ\n食べようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3878, 5, 1, 1, 0, 112501, 1, 0, "ウヅキもミオも\n頑張ってるし\n私も負けられないね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3879, 101, 1, 4, 0, 112501, 1, 0, "レッスンしてる時さ\n何か、誰かが足りない\nそう思うことがあるの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3880, 102, 1, 8, 0, 112501, 1, 0, "大事なのは笑顔…\n誰か、大切な人から\n言われた気がするんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3881, 1, 2, 1, 0, 112501, 1, 0, "どうしたの、何か用？\n手伝えることがあれば\nすぐに言ってね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3882, 2, 2, 1, 0, 112501, 1, 0, "姿勢がいい？\n普段から鍛えてるし\n自然とそうなるのかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3883, 3, 2, 1, 0, 112501, 1, 0, "さっき散歩してたら\n犬を見かけたんだ\n人懐っこい子だったよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3884, 4, 2, 1, 0, 112501, 1, 0, "今から冒険？\nなら私も一緒に行くよ\n前衛は任せておいて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3885, 101, 2, 4, 0, 112501, 1, 0, "今からレッスンに\n行くつもりだったんだ\n少し手伝ってくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3886, 102, 2, 8, 0, 112501, 1, 0, "蒼の剣を受けよ！\nえ、何してるのって？\nただの発声練習だけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3887, 1, 2, 1, 0, 112501, 1, 1, "おはよう、早いね\n今日は依頼もないし\nゆっくりしようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3888, 2, 2, 1, 0, 112501, 1, 2, "そろそろお昼だね\nうーん、今日は\n何を食べよう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3889, 3, 2, 1, 0, 112501, 1, 3, "もうこんな時間…\n明日も早いし\nそろそろ寝なくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3891, 2, 3, 1, 0, 112501, 1, 0, "レッスンで疲れたし\nちょっとだけ\n休んでおこうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3892, 3, 3, 1, 0, 112501, 1, 0, "ふふっ、かわいい\nふわふわしたものって\n撫でたくなるんだよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3893, 4, 3, 1, 0, 112501, 1, 0, "うん、いい香り…\nこういうものがあると\n落ち着くからいいよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3894, 5, 3, 1, 0, 112501, 1, 0, "温かい場所って\n居心地がいいから\nのんびりしちゃうよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3896, 7, 3, 1, 0, 112501, 1, 0, "レッスン頑張ったら\nすぐお腹が空くし\n食べておかないと…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3897, 8, 3, 1, 0, 112501, 1, 0, "アイドルのことを\nもっと勉強して\n成長しなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3899, 1, 1, 1, 0, 111001, 1, 0, "ああ、知りたい…\nなんでもかんでも\nとにかく知りたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3900, 2, 1, 1, 0, 111001, 1, 0, "ああ、眠い…\nいつでもどこでも\nとにかく眠い…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3901, 3, 1, 1, 0, 111001, 1, 0, "君、気を付けたまえ\nぼーっと歩いていると\nほわっ！　転んだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3902, 4, 1, 1, 0, 111001, 1, 0, "ミツキ師にいただいた\n新作サプリ…丁度よい\n被験体はいないものか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3903, 5, 1, 1, 0, 111001, 1, 0, "サレンディア救護院に\nユニちゃん８歳として\n潜入済みだが何か？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3904, 101, 1, 4, 0, 111001, 1, 0, "君がユニちゃんズの\n同志であること、\nぼくは誇りに思うぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3905, 102, 1, 8, 0, 111001, 1, 0, "ぼくは青春がしたい\nおい、君\nぼくと青春しないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3906, 1, 2, 1, 0, 111001, 1, 0, "ああ、そうだな。\nぼくもそう思う。\n……えっ、何が？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3907, 2, 2, 1, 0, 111001, 1, 0, "待て、話しかけるな。\n今の閃きをメモに…\n…ああっ、忘れた！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3908, 3, 2, 1, 0, 111001, 1, 0, "歩き方が綺麗？\n何を今更なこと\n言っとるんだ君は");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3909, 4, 2, 1, 0, 111001, 1, 0, "ぼくの血液型？\n大らかのОだ。\n何か異論あるかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3910, 101, 2, 4, 0, 111001, 1, 0, "君の声は精神に\n高揚をもたらすな…\n波形を分析したいぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3911, 102, 2, 8, 0, 111001, 1, 0, "妙だな…最近\n君に話しかけられると\n心拍に乱れを覚える");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3912, 1, 2, 1, 0, 111001, 1, 1, "おっと、朝だな。\nそろそろ寝るか、\n朝更かしは体に悪い");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3913, 2, 2, 1, 0, 111001, 1, 2, "ふむ、昼餉時か…\n今日のランチは\nサプリ定食にしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3914, 3, 2, 1, 0, 111001, 1, 3, "もう夜だな、\nそろそろ起きるか。\n最高の一日にするぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3916, 2, 3, 1, 0, 111001, 1, 0, "ほわぁ～\n副交感神経が…\n優位に…ふふっひ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3917, 3, 3, 1, 0, 111001, 1, 0, "かわいすぎるな…\nセクシーユニには\nミスマッチか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3918, 4, 3, 1, 0, 111001, 1, 0, "ほぁあアあァぁー…\nいい香りー…\nあアァあ…イイ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3919, 5, 3, 1, 0, 111001, 1, 0, "炎はいいぞ\nそこには人類発展の\nドラマがある");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3921, 7, 3, 1, 0, 111001, 1, 0, "フオオー！\n次から次へと固形食物\n原理気になるー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3922, 8, 3, 1, 0, 111001, 1, 0, "良書は時間を忘れる\n…ふむ、今度\n布団を持ってこよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3924, 103, 1, 12, 0, 101201, 1, 0, "きらーん☆\nハツネちゃんに\n不可能はないのだ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3925, 103, 2, 12, 0, 101201, 1, 0, "キミと一緒だと\n寝ちゃうのが\nもったいないよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3933, 1, 2, 1, 0, 192101, 1, 0, "ちぇるーん☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3951, 1, 1, 1, 0, 110901, 1, 0, "ちぇる～ん☆\n今日もチエルは\nかわいいですよね～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3952, 2, 1, 1, 0, 110901, 1, 0, "どこかに楽しいもの\n落ちてないかにゃー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3953, 3, 1, 1, 0, 110901, 1, 0, "チエルのオキニは\n甘々カフェラテ！\nシクヨロでぇ～す☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3954, 4, 1, 1, 0, 110901, 1, 0, "先輩、ひまですよね？\nチエル遊んであげても\nいいですけど？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3955, 5, 1, 1, 0, 110901, 1, 0, "はぁー…しゅき…\nカルミナ尊い…\n一生すこれる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3956, 101, 1, 4, 0, 110901, 1, 0, "先輩、ひまー\nちょっとは構えよーう\nデュクシ！デュクシ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3957, 102, 1, 8, 0, 110901, 1, 0, "先輩なんか\nおごって～！\nてか…おごらなくても\nいいから遊んでよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3958, 1, 2, 1, 0, 110901, 1, 0, "え、なんですか？\n告白だったら\n間に合ってますけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3959, 2, 2, 1, 0, 110901, 1, 0, "ちょっと静かに！\n今ヤバかわポーズの\nイメトレ中なんです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3960, 3, 2, 1, 0, 110901, 1, 0, "足取りが軽やか？\nあー…ダンスとか\n習ってるからですかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3961, 4, 2, 1, 0, 110901, 1, 0, "チエルの血液型？\n大型新人のОです\n何か問題でも？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3962, 101, 2, 4, 0, 110901, 1, 0, "先輩って何気に\nいい声してますよね\n言うことは変だけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3963, 102, 2, 8, 0, 110901, 1, 0, "え、なんですか？\nたまにだったら\n告白してもいいですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3964, 1, 2, 1, 0, 110901, 1, 1, "おはちぇる～ん☆\nハイ、ご一緒に～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3965, 2, 2, 1, 0, 110901, 1, 2, "今日のランチは\nどこで\n映えよっかにゃー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3966, 3, 2, 1, 0, 110901, 1, 3, "こんばんちぇるるん☆\nハイ、ご一緒に～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3968, 2, 3, 1, 0, 110901, 1, 0, "ふかふかチエルン\n略して、ふかルン♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3969, 3, 3, 1, 0, 110901, 1, 0, "かわいいこの子と\nかわいいチエル！\n映ぁ～え～る～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3970, 4, 3, 1, 0, 110901, 1, 0, "かわいい香り～！\n持って帰ろっと！\nすぅーっ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3971, 5, 3, 1, 0, 110901, 1, 0, "マシュマロは\n焼かない方のが\nかわいくないです？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3973, 7, 3, 1, 0, 110901, 1, 0, "チエル食べても\n太らない体質\nなんでぇ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3974, 8, 3, 1, 0, 110901, 1, 0, "読書は好きですよ\nシンプルに楽しいし\nギャップ萌えでしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3976, 1, 1, 1, 0, 112701, 1, 0, "みんなのあたしを\n見る目が違うね\nま、気にしないけどね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3977, 2, 1, 1, 0, 112701, 1, 0, "今日も疲れた～\nやる気ゼロだし\nもう寝ちゃおうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3978, 3, 1, 1, 0, 112701, 1, 0, "あたしの代わりに誰か\n働いてくれないかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3979, 4, 1, 1, 0, 112701, 1, 0, "労働の後に食べる\nあんパン最高～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3980, 5, 1, 1, 0, 112701, 1, 0, "仕事の合間に\nちょっと一息いれよ\nあ～ドングリ美味し～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3981, 101, 1, 4, 0, 112701, 1, 0, "報酬も入ったことだし\nあいつに何か\n買ってあげようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3982, 102, 1, 8, 0, 112701, 1, 0, "次の休みはあいつと\n一日中だらだら\nしたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3983, 1, 2, 1, 0, 112701, 1, 0, "あたしは褒められて\n伸びるタイプなんだ\nだから褒めて褒めて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3984, 2, 2, 1, 0, 112701, 1, 0, "お、差し入れ？\n気が利くねぇ\nあんがと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3985, 3, 2, 1, 0, 112701, 1, 0, "新しい依頼？\n今日はもう無理～\n閉店で～す");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3986, 4, 2, 1, 0, 112701, 1, 0, "サ、サボってないよ！\nちょっと休憩してた\nだけだから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3987, 101, 2, 4, 0, 112701, 1, 0, "ねえ、一緒に\nサボろうよ？\n働き過ぎはよくないよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3988, 102, 2, 8, 0, 112701, 1, 0, "あんたが近くにいると\n仕事の疲れも\n和らぐんだよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3989, 1, 2, 1, 0, 112701, 1, 1, "はぁ…もう起きなきゃ\nつらい労働の\nはじまりだ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3990, 2, 2, 1, 0, 112701, 1, 2, "うぅ、お昼に\nあんパン食べ過ぎた…\n苦しい…眠い…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3991, 3, 2, 1, 0, 112701, 1, 3, "明日は仕事ないし\nガッツリ夜ふかし\nしちゃうよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3993, 2, 3, 1, 0, 112701, 1, 0, "猫みたいに\n丸くなっちゃうよ～\nあたしリスだけどね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3994, 3, 3, 1, 0, 112701, 1, 0, "ふかふか～\nあたしの尻尾と\n互角とはやるね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3995, 4, 3, 1, 0, 112701, 1, 0, "あんパンの香りの\nアロマとか\nあればいいのにな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3996, 5, 3, 1, 0, 112701, 1, 0, "これは危険な\nあたたかさだね～\n労働意欲が\nなくなるよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3998, 7, 3, 1, 0, 112701, 1, 0, "いっぱい働いたから\nいっぱい食べても\nカロリー０だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (3999, 8, 3, 1, 0, 112701, 1, 0, "あたしだってたまには\n本くらい読むって\n全然似合わないけどね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4001, 103, 1, 12, 0, 104601, 1, 0, "あたしの作った\nオリジナルたい焼き…\nあいつ、\n喜んでくれるかにゃ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4002, 103, 2, 12, 0, 104601, 1, 0, "あ、お帰りにゃー♪\nえへへ…キミに\nお帰りって言えるのが\nなんかうれしいにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4003, 1, 1, 1, 0, 112801, 1, 0, "フロンティア\nスピリッツを\nお見せするべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4004, 2, 1, 1, 0, 112801, 1, 0, "この鎧を着ると\n気が引き締まる\n感じがするべ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4005, 3, 1, 1, 0, 112801, 1, 0, "搾りたての牛乳飲んで\n今日も一日\nがんばるべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4006, 4, 1, 1, 0, 112801, 1, 0, "みんなに牧場の\n乳製品を\n味わってもらいてぇべ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4007, 5, 1, 1, 0, 112801, 1, 0, "ここはいいとこだべ\nうちの動物たちも\n連れてきてやりてぇな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4008, 101, 1, 4, 0, 112801, 1, 0, "みんなオラより\n若ぇのに働いてて\n立派だべな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4009, 102, 1, 8, 0, 112801, 1, 0, "牧場もギルドの\nみんなもオラが\nまとめて面倒見るべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4010, 1, 2, 1, 0, 112801, 1, 0, "さあ、今日も\n忙しくなるべよ\n気合入れてくべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4011, 2, 2, 1, 0, 112801, 1, 0, "お、あんちゃん\n丁度いいとこに！\n一緒に街に\n行商しに行くべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4012, 3, 2, 1, 0, 112801, 1, 0, "牧場仕事で培った力が\n戦いでも役立つなら\n一石二鳥だべさ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4013, 4, 2, 1, 0, 112801, 1, 0, "疲れた時は牧場産の\nミルク菓子で\n糖分補給だべ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4014, 101, 2, 4, 0, 112801, 1, 0, "これ、牧場の\n新製品だべ\n一番最初に味見\nしてほしいべさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4015, 102, 2, 8, 0, 112801, 1, 0, "働きづめはよくねぇベ\n膝枕してやっから\nこっち来るべさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4016, 1, 2, 1, 0, 112801, 1, 1, "ふぁあ…\n酪農家の朝は\n早ぇんだべ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4017, 2, 2, 1, 0, 112801, 1, 2, "ごはんの時間だべ！\n腹が減っては酪農も\n戦いもできねえべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4018, 3, 2, 1, 0, 112801, 1, 3, "そろそろ寝るべ！\n健全なお笑いは\n健全な肉体に宿るべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4020, 2, 3, 1, 0, 112801, 1, 0, "牧草みたいに\nふっかふかだべ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4021, 3, 3, 1, 0, 112801, 1, 0, "この子、目の感じが\nエリザベスに似てるべ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4022, 4, 3, 1, 0, 112801, 1, 0, "いい匂いだべ～\n疲れた体に\nしみるべな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4023, 5, 3, 1, 0, 112801, 1, 0, "あったけぇな～\n牧場にも\n置いてみっかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4025, 7, 3, 1, 0, 112801, 1, 0, "うまいべ！\n生産者のこだわりを\n感じるべさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4026, 8, 3, 1, 0, 112801, 1, 0, "酪農も戦いも\nまずは知識だべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4028, 1, 1, 1, 0, 113001, 1, 0, "ぴょん、ぴょん♪\nこの服のおかげで、\n体が軽いなぁ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4029, 2, 1, 1, 0, 113001, 1, 0, "今の内に部屋の\n掃除をしておこっと…\nみんな喜んで\nくれるといいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4030, 3, 1, 1, 0, 113001, 1, 0, "耳と尻尾…この服、\n本当にウサギさん\nみたいだなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4031, 4, 1, 1, 0, 113001, 1, 0, "なんだか先輩の\n気配がするような…\n気のせいかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4032, 5, 1, 1, 0, 113001, 1, 0, "ウサギさんの真似を\nしたら、存在感が薄い\nとか言われないかな？\nア、アユミだぴょん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4033, 101, 1, 4, 0, 113001, 1, 0, "えへへ…\nいつもとは違う先輩が\nたくさん見られて、\nうれしいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4034, 102, 1, 8, 0, 113001, 1, 0, "本の中の世界で先輩と\n旅をするなんて…\n幸せすぎて、罰が\n当たりそうだよぉ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4035, 1, 2, 1, 0, 113001, 1, 0, "じ～…はっ！？\nす、すみません！\n話しかけてもらえる\nなんて思ってなくて！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4036, 2, 2, 1, 0, 113001, 1, 0, "先輩がすぐそばに…\nし、幸せすぎて\n倒れそうですぅ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4037, 3, 2, 1, 0, 113001, 1, 0, "え、えっと…あの…！\nうう…いざ先輩と\n向き合うと\n緊張しちゃうよぉ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4038, 4, 2, 1, 0, 113001, 1, 0, "はうっ！？\nしょ、正面から見る\n先輩は、私にとって\n神々しすぎますぅ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4039, 101, 2, 4, 0, 113001, 1, 0, "先輩…その…\nい、一緒にご飯でも\nどうでひゅか！\nうう…またかんだぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4040, 102, 2, 8, 0, 113001, 1, 0, "せ、先輩…\nハーブティーを\n入れたんですが、\n一緒にどうですか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4041, 1, 2, 1, 0, 113001, 1, 1, "せ、先輩！\nおはようございます！\nえへへ、練習通りに\nバッチリ言えたぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4042, 2, 2, 1, 0, 113001, 1, 2, "あ、もうお昼ですね\n時計を持ってて\n良かったです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4043, 3, 2, 1, 0, 113001, 1, 3, "もうこんな時間…\nお休みする\n準備をしちゃいますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4045, 2, 3, 1, 0, 113001, 1, 0, "あ…ちょっとだけ\n先輩の匂いがする…\nえへへ、幸せだなぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4046, 3, 3, 1, 0, 113001, 1, 0, "…私もウサギさんの\nぬいぐるみとして、\n先輩のそばに…はっ！\n私ったら何を…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4047, 4, 3, 1, 0, 113001, 1, 0, "あ、いい香り…\n先輩もこういうのが\n好きなのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4048, 5, 3, 1, 0, 113001, 1, 0, "先輩が隣に\n居たら、もっと\n暖かいのになぁ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4050, 7, 3, 1, 0, 113001, 1, 0, "おいしい…でも、\n先輩と一緒に\n食べたら、もっと\nおいしいだろうな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4051, 8, 3, 1, 0, 113001, 1, 0, "ウサギさんって、穴を\n掘ったりするんだ…\n私も、隠れたいときに\n掘ってみようかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4053, 1, 1, 1, 0, 180501, 1, 0, "ネビアさまのように\n普段からパタパタと\n飛んでみるのも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4054, 2, 1, 1, 0, 180501, 1, 0, "ご立派になられた\n主さまと並べるように\nもっと精進しなくては");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4055, 3, 1, 1, 0, 180501, 1, 0, "月々の食費が\n増えてしまいました\n申し訳ございません…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4056, 4, 1, 1, 0, 180501, 1, 0, "ワンワンのほうの\n主さまは、この姿に\n驚くでしょうか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4057, 5, 1, 1, 0, 180501, 1, 0, "主さまと離れていても\n主さまとの絆は\n胸に感じております…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4058, 101, 1, 4, 0, 180501, 1, 0, "このギルドハウスは\nみなさまの帰る場所…\nわたくしが守ります");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4059, 102, 1, 8, 0, 180501, 1, 0, "どんな未来が\n待ち受けようとも\n主さまと添い遂げます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4060, 1, 2, 1, 0, 180501, 1, 0, "おでかけですか？\nではわたくしも\nお供いたします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4061, 2, 2, 1, 0, 180501, 1, 0, "もう二度と主さまと\n離れたくはありません\nいつ何時も…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4062, 3, 2, 1, 0, 180501, 1, 0, "なにかお困りごと\nでございますか？\nわたくしに何なりと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4063, 4, 2, 1, 0, 180501, 1, 0, "どうぞゆっくりと\n心ゆくまでくつろいで\nくださいまし、主さま");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4064, 101, 2, 4, 0, 180501, 1, 0, "この羽で主さまを\nどこまでも遠く…\n高くへと導きます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4065, 102, 2, 8, 0, 180501, 1, 0, "主さま、主さま…♪\nおそばにいられるのが\nうれしくて、つい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4066, 1, 2, 1, 0, 180501, 1, 1, "おはようございます\n今日も一日、主さまの\nサポートをいたします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4067, 2, 2, 1, 0, 180501, 1, 2, "今日も頑張っている\n主さまに、スタンプを\nもう一つ…ポン！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4068, 3, 2, 1, 0, 180501, 1, 3, "寝付けないのでしたら\nわたくしが子守唄を\n歌ってさしあげます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4070, 2, 3, 1, 0, 180501, 1, 0, "ふかふか…\nまるで主さまのような\n柔らかさでございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4071, 3, 3, 1, 0, 180501, 1, 0, "あなたも一緒に\n主さまと遊びますか？\n至福の時間ですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4072, 4, 3, 1, 0, 180501, 1, 0, "主さまの優しくて\nくすぐったい匂いが\nたまらなく恋しいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4073, 5, 3, 1, 0, 180501, 1, 0, "主さまの心と\n繋がったときのような\n温もりを感じます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4075, 7, 3, 1, 0, 180501, 1, 0, "いけませんっ…！\n元の姿に戻ると、また\n食べてしまうのに…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4076, 8, 3, 1, 0, 180501, 1, 0, "主さまに読み聞かせる\n絵本は…妖精が主役の\n物語にいたしましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4078, 103, 1, 12, 0, 104801, 1, 0, "…彼のこと弟みたいに\n思ってきたのに…私、\nどうしたらいいの…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4079, 103, 2, 12, 0, 104801, 1, 0, "よ、予定がなかったら\nでいいんだけど…\nその、ふ、二人で\n訓練とか…どうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4080, 1, 1, 1, 0, 112901, 1, 0, "おめかしもしたし\nあとはお兄ちゃんを\n待つだけですね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4081, 2, 1, 1, 0, 112901, 1, 0, "お兄ちゃんの身の回り\nをお片付け～、これぞ\nデキる妹アピール！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4082, 3, 1, 1, 0, 112901, 1, 0, "あ、衣装がほつれてる\nこれくらいなら自分で\n繕えますね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4083, 4, 1, 1, 0, 112901, 1, 0, "この格好で歩いてると\n見慣れた景色も\n違うものに見えますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4084, 5, 1, 1, 0, 112901, 1, 0, "勉強もちゃんとします\n…でも、一人だと\n集中力がもちません～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4085, 101, 1, 4, 0, 112901, 1, 0, "お兄ちゃんを大好きな\n妹が待ってますよ～\n…まだですかね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4086, 102, 1, 8, 0, 112901, 1, 0, "お兄ちゃんのために\n掃除洗濯をする私って\nお嫁さんみたい…\n…えへへ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4087, 1, 2, 1, 0, 112901, 1, 0, "おに～いちゃん！\n縫い物、一緒に\nやりましょうよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4088, 2, 2, 1, 0, 112901, 1, 0, "かわいい妹を\n愛でたくなりました？\n思う存分、どうぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4089, 3, 2, 1, 0, 112901, 1, 0, "わっ、ビックリした～\nもう、お兄ちゃんてば\nイタズラっ子ですね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4090, 4, 2, 1, 0, 112901, 1, 0, "一緒にお買い物\n行きませんか？\n妹とデートですよっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4091, 101, 2, 4, 0, 112901, 1, 0, "お兄ちゃん…頭を\n撫でてくれませんか？\nえへへ、これが一番♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4092, 102, 2, 8, 0, 112901, 1, 0, "お兄ちゃん大好き♪\n何度でも言いますよ！\nお兄ちゃん大好きっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4093, 1, 2, 1, 0, 112901, 1, 1, "おはよ～お兄ちゃん！\n妹モーニングコールの\n時間ですよっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4094, 2, 2, 1, 0, 112901, 1, 2, "そろそろ休憩ですね！\n甘いお菓子で\n元気回復しましょ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4095, 3, 2, 1, 0, 112901, 1, 3, "夜更かし厳禁！\nでも、もう少しだけ\nお話ししたいなぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4097, 2, 3, 1, 0, 112901, 1, 0, "ふっかふかですよ！\nお兄ちゃんと一緒に\n座りたいなぁ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4098, 3, 3, 1, 0, 112901, 1, 0, "このぬいぐるみの\nかわいさ…う～ん\n負けられません…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4099, 4, 3, 1, 0, 112901, 1, 0, "香りにも気をつかって\nパーフェクトな妹に\nなっちゃいますから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4100, 5, 3, 1, 0, 112901, 1, 0, "はぁ～ぬくぬくです～\nお兄ちゃんと一緒に\n温まりたいなぁ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4102, 7, 3, 1, 0, 112901, 1, 0, "これは止まりませんね\nもぐもぐ…いくらでも\n食べられちゃいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4103, 8, 3, 1, 0, 112901, 1, 0, "これ、デザインの\n参考になりそう！\n私にも作れるかなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4105, 1, 1, 1, 0, 106601, 1, 0, "退屈です…\nなにか楽しいことは\nないですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4106, 2, 1, 1, 0, 106601, 1, 0, "ギャングの仕事は\n今日はお休みです\nのんびりするですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4107, 3, 1, 1, 0, 106601, 1, 0, "ひうっ！　あたしの\n尻尾なんて食べても\nおいしくないですよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4108, 4, 1, 1, 0, 106601, 1, 0, "ふう…どうやら\n例の件はまだボスに\nバレてないですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4109, 5, 1, 1, 0, 106601, 1, 0, "下克上…いい言葉です\nって、ボスに聞かれて\nないですよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4110, 101, 1, 4, 0, 106601, 1, 0, "いつか絶対ビッグに\nなってやるです！\nあたしを信じるです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4111, 102, 1, 8, 0, 106601, 1, 0, "あたしが覚醒したら\nきっと誰よりも\n強くなるはずです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4112, 1, 2, 1, 0, 106601, 1, 0, "なんですか？\n貢ぎ物なら\nいつでも歓迎ですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4113, 2, 2, 1, 0, 106601, 1, 0, "あたしだって\nやる時はやるですよ！\nその時がこないだけ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4114, 3, 2, 1, 0, 106601, 1, 0, "しりとり勝負ですか？\nいい度胸ですね、\nかかってくるです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4115, 4, 2, 1, 0, 106601, 1, 0, "お兄さんは\nヒマそうですね…\nうらやましいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4116, 101, 2, 4, 0, 106601, 1, 0, "かまってほしいです？\nまったく…いいですよ\nしょうがないですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4117, 102, 2, 8, 0, 106601, 1, 0, "お兄さんのことは\nこのあたしが\n守ってやるですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4118, 1, 2, 1, 0, 106601, 1, 1, "デキるギャングの\n朝は早いのです…\nふぁあ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4119, 2, 2, 1, 0, 106601, 1, 2, "お腹がすいたですね\nなにか食べにいくです\nお兄さんのおごりで！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4120, 3, 2, 1, 0, 106601, 1, 3, "ふぁあ…むにゅう…\nまだ起きてるですよぉ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4122, 2, 3, 1, 0, 106601, 1, 0, "はぁ～…\nもうここから一歩も\n動きたくないです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4123, 3, 3, 1, 0, 106601, 1, 0, "なかなかいいモフりを\nしてやがるです…\n舎弟にしてやるですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4124, 4, 3, 1, 0, 106601, 1, 0, "なんかおしゃれな\n匂いがするですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4125, 5, 3, 1, 0, 106601, 1, 0, "ふふーん！\nあたしのブレスの方が\n火力は上ですね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4127, 7, 3, 1, 0, 106601, 1, 0, "あたしに貢ぎ物とは\nよく分かってるですね\n食べてやるですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4128, 8, 3, 1, 0, 106601, 1, 0, "ふーむ…\nもっと楽しい本は\nないですかね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4130, 1, 1, 1, 0, 113201, 1, 0, "海に眠る秘宝…\n心躍る響きだ！\n早く見つけたい…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4131, 2, 1, 1, 0, 113201, 1, 0, "うう～、暑いぃ…\nかき氷を食べて\nすっきりしたいぃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4132, 3, 1, 1, 0, 113201, 1, 0, "アターック！\nいや、もっとこう…\nアタァーック！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4133, 4, 1, 1, 0, 113201, 1, 0, "スイカ割りで\n目を回さない\nコツはなんだろうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4134, 5, 1, 1, 0, 113201, 1, 0, "せっかく海に来たのだ\n泳ぎも上手に\nなりたいものだな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4135, 101, 1, 4, 0, 113201, 1, 0, "ふっふっふ…\n疼く…疼くぞ！\n日焼けの痕が…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4136, 102, 1, 8, 0, 113201, 1, 0, "シグルドと私は\n来世でも共にある…\nつまり我らはずっと…\nはわわ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4137, 1, 2, 1, 0, 113201, 1, 0, "シグルド、私と共に\n日光浴に行かないか？\n光の力を集めよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4138, 2, 2, 1, 0, 113201, 1, 0, "この格好だからできる\n必殺技を考えている\n何か案はないか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4139, 3, 2, 1, 0, 113201, 1, 0, "シグルド～！\nスイカを貰ったから\n一緒に食べよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4140, 4, 2, 1, 0, 113201, 1, 0, "こう日差しが強いと\n日焼けしそうだな\n跡になってないか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4141, 101, 2, 4, 0, 113201, 1, 0, "我らの夏の黙示録\nしっかりと記録\nしておかねばな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4142, 102, 2, 8, 0, 113201, 1, 0, "ちゃんと日焼けどめを\n塗ってもらうべき\nだったかな…？\nシ、シグルドに…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4143, 1, 2, 1, 0, 113201, 1, 1, "朝だぞシグルド！\nさぁ、日光を浴びて\n光の加護を得るのだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4144, 2, 2, 1, 0, 113201, 1, 2, "もう昼食の時間か…\n私の魔力も減ったし\n早く補給しなければ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4145, 3, 2, 1, 0, 113201, 1, 3, "夜でも我らの活動は\n終わることはない！\nさぁ準備を…ふわぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4147, 2, 3, 1, 0, 113201, 1, 0, "海で遊んでいると\n疲れてしまうからな\n少し休まるとしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4148, 3, 3, 1, 0, 113201, 1, 0, "えへへ～、君の名前は\n何にしまちょうかね♪\n…はっ、見たのか！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4149, 4, 3, 1, 0, 113201, 1, 0, "心地よい香りで\n我が精神も安らぐ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4150, 5, 3, 1, 0, 113201, 1, 0, "別に寒くなどないぞ！\n寒くないが、ちょっと\n暖まりたくなってな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4152, 7, 3, 1, 0, 113201, 1, 0, "もぐ…食べ過ぎた分は\n魔力に変換されるのだ\n…たぶん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4153, 8, 3, 1, 0, 113201, 1, 0, "…なな、なんだ！？\nシグルドはこういう\n趣味なのか…！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4155, 10, 3, 1, 0, 113201, 1, 0, "むむ、この乗り心地…\nいざゆかん、\nシードラゴンよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4156, 11, 3, 1, 0, 113201, 1, 0, "疾風の冥姫の名に\nふさわしき\n深海の玉座よ…\nふああ…柔らかい～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4157, 1, 1, 1, 0, 180201, 1, 0, "この姿でいると\nわたしもお姫様に\nなれた気がする…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4158, 2, 1, 1, 0, 180201, 1, 0, "お腹空いてきちゃった\nまずは買い出しに…\n…変身解かなくちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4159, 3, 1, 1, 0, 180201, 1, 0, "胸のところが空いてて\nスースーするの\nまだ慣れないな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4160, 4, 1, 1, 0, 180201, 1, 0, "治癒魔法に使ってた\n魔力を攻撃魔法に…\n頭の中でも練習練習");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4161, 5, 1, 1, 0, 180201, 1, 0, "何もできなかった\nわたしから、少しは\n変われたのかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4162, 101, 1, 4, 0, 180201, 1, 0, "騎士クン…\n今どこにいるの…？\n…会いたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4163, 102, 1, 8, 0, 180201, 1, 0, "離れてても分かるよ…\n温かい力で騎士クンに\n守られてるの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4164, 1, 2, 1, 0, 180201, 1, 0, "わたしが戦えてるのは\n騎士クンのおかげだよ\nいつもありがとう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4165, 2, 2, 1, 0, 180201, 1, 0, "お腹空いてそう…？\n…内緒で作ったおやつ\n騎士クンも食べる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4166, 3, 2, 1, 0, 180201, 1, 0, "ひゃうっ！　え！？\nせ、背中はダメ～！\n言ってから触って～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4167, 4, 2, 1, 0, 180201, 1, 0, "この格好、どうかな？\nえ？　似合ってる…？\n本当？　…うれしい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4168, 101, 2, 4, 0, 180201, 1, 0, "かわいい？　そうだね\nひらひらが…わたし？\nええっ、そ、そんな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4169, 102, 2, 8, 0, 180201, 1, 0, "騎士クン、これからも\nずっと…わたしの\nそばにいてください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4170, 1, 2, 1, 0, 180201, 1, 1, "朝からこんなに\n食べる日が来るなんて\n思ってなかったよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4171, 2, 2, 1, 0, 180201, 1, 2, "お昼を作らなくちゃ\n騎士クン、一緒に\nお料理してみる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4172, 3, 2, 1, 0, 180201, 1, 3, "騎士クン、もう眠い？\n眠るまで、わたしが\nずっとそばにいるね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4174, 2, 3, 1, 0, 180201, 1, 0, "攻撃参加するからこそ\n適度に体を休めるのは\n大切だよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4175, 3, 3, 1, 0, 180201, 1, 0, "かわいい…騎士クンと\nシェフィちゃんにも\nプレゼントしたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4176, 4, 3, 1, 0, 180201, 1, 0, "いい香り～…\nあれ？　お腹が空いて\nきちゃった…！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4177, 5, 3, 1, 0, 180201, 1, 0, "温かい…\n騎士クンがくれる\n力みたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4179, 7, 3, 1, 0, 180201, 1, 0, "ぱくっ、\nあむ、はむっ…\nううぅ～…やっぱり\n手が止まらないよぉ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4180, 8, 3, 1, 0, 180201, 1, 0, "新しく覚えたいな…\nみんなで食べられる\n大皿向けの料理♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4182, 103, 1, 12, 0, 104901, 1, 0, "お姉ちゃんの愛\nこのままじゃ\nあふれちゃうよ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4183, 103, 2, 12, 0, 104901, 1, 0, "弟くん♪\n弟くんっ♪\nおっとうっとくんっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4184, 1, 1, 1, 0, 113101, 1, 0, "泳ぐのもいいけど\n今日は砂浜で\nのんびりしようかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4185, 2, 1, 1, 0, 113101, 1, 0, "さてと\nちょっくらひと泳ぎ\n行ってくるかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4186, 3, 1, 1, 0, 113101, 1, 0, "あっついねぇ…\nうちわがないと\nしんどいったらないよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4187, 4, 1, 1, 0, 113101, 1, 0, "冷たすぎる飲み物で\n体を冷やさないよう\n気をつけないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4188, 5, 1, 1, 0, 113101, 1, 0, "夏はあっという間だし\n悔いがないように\n楽しまないとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4189, 101, 1, 4, 0, 113101, 1, 0, "きっとこの夏は\nアタシにとって大事な\n想い出になるね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4190, 102, 1, 8, 0, 113101, 1, 0, "…前に比べたら\nアタシたちの距離も\n近づいたみたいだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4191, 1, 2, 1, 0, 113101, 1, 0, "もし暇なら\n今日も笹舟釣り\n一緒にどうだい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4192, 2, 2, 1, 0, 113101, 1, 0, "お前さん、釣りに\n興味が湧いたなら今度\n道具を見に行こうよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4193, 3, 2, 1, 0, 113101, 1, 0, "今から砂浜に行くんだ\nお前さんも一緒に\n散歩するかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4194, 4, 2, 1, 0, 113101, 1, 0, "え、日焼け跡？\nおや…本当だ\nすぐ焼けちまうねえ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4195, 101, 2, 4, 0, 113101, 1, 0, "ひゃっ！？\nちょっと！\n日焼け跡をいきなり\n触らないでおくれ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4196, 102, 2, 8, 0, 113101, 1, 0, "お前さんは、その…\nアタシと一緒にいて\n楽しかったかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4197, 1, 2, 1, 0, 113101, 1, 1, "おはようさん\n今日も砂浜に行って\nゆっくりしようか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4198, 2, 2, 1, 0, 113101, 1, 2, "お昼か…\nそうだ、よかったら\n刺身定食、作ろうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4199, 3, 2, 1, 0, 113101, 1, 3, "夜の空を見てるとさ\nなつかしい気持ちに\nなるんだよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4201, 2, 3, 1, 0, 113101, 1, 0, "適度に休憩して\n夏バテしないよう\n気をつけないとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4202, 3, 3, 1, 0, 113101, 1, 0, "あんたたちも\n海を楽しみたいって\n思っているのかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4203, 4, 3, 1, 0, 113101, 1, 0, "ん～…香りでも\nバカンスらしさを\n楽しめるもんだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4204, 5, 3, 1, 0, 113101, 1, 0, "こういう格好だと\n少し冷えちまうんだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4206, 7, 3, 1, 0, 113101, 1, 0, "もぐもぐもぐ…\n遊んだ分、お腹が\n空いちまってねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4207, 8, 3, 1, 0, 113101, 1, 0, "…ん、なんだいこの本\n催眠…うーん読めない\nナナカに聞いてみるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4209, 10, 3, 1, 0, 113101, 1, 0, "へえ…\nなかなかいい\n乗り心地じゃないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4210, 11, 3, 1, 0, 113101, 1, 0, "そうそうハマグリって\n竿でも釣れるんだよ\n知ってたかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4211, 1, 1, 1, 0, 113301, 1, 0, "海を満喫しなきゃね\nちょっとひと泳ぎ\n行ってこようかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4212, 2, 1, 1, 0, 113301, 1, 0, "う～ん…♪\nいつもと違った\n開放感～\nなんちゃって！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4213, 3, 1, 1, 0, 113301, 1, 0, "今のナナカちゃんは\nたぶん水属性！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4214, 4, 1, 1, 0, 113301, 1, 0, "水着もバッチリ！\nサイカワサイツヨ\nナナカちゃ～ん☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4215, 5, 1, 1, 0, 113301, 1, 0, "んっふっふ\nドキ！　水着だらけの\nギルドハウス！\nとかどうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4216, 101, 1, 4, 0, 113301, 1, 0, "そんなに見られると\nちょ～っと\n恥ずかしいかも…\nなんてねなんてね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4217, 102, 1, 8, 0, 113301, 1, 0, "ちょっとくらい\nドキッとしてくれても\nいいのにな～、もう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4218, 1, 2, 1, 0, 113301, 1, 0, "水着魔法少女の\n相方がほしいなぁ～…\nね、君やってみない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4219, 2, 2, 1, 0, 113301, 1, 0, "いつもの格好と同じ？\nも～、わかってない！\nセクスィー度が違う！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4220, 3, 2, 1, 0, 113301, 1, 0, "どうかなどうかな？\nこのひらひらのとこが\nかわいーかなー\nとか思うんだけど！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4221, 4, 2, 1, 0, 113301, 1, 0, "せっかくだから\nギャルゲーイベント\nごっことか\nやってみる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4222, 101, 2, 4, 0, 113301, 1, 0, "ナナカちゃんの\n好感度を上げたい？\nならおでかけだー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4223, 102, 2, 8, 0, 113301, 1, 0, "おうちで水着って\nなんだかコスプレ\nみたいで楽しいかも♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4224, 1, 2, 1, 0, 113301, 1, 1, "おっはよーう！\n今日はバカンス日和！\n海へゴーですぞ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4225, 2, 2, 1, 0, 113301, 1, 2, "お昼ご飯どうしよ～…\nあ、ナナカちゃんと\nどっか食べに行く？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4226, 3, 2, 1, 0, 113301, 1, 3, "夜は本を読むのが\n捗りまくりですな～！\n今日はなに読もっかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4228, 2, 3, 1, 0, 113301, 1, 0, "次のイベントもあるし\nちょっと休んで体力を\n回復しなきゃね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4229, 3, 3, 1, 0, 113301, 1, 0, "こういうマスコット\n私にもいたらなぁ\nいっそ作っちゃう…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4230, 4, 3, 1, 0, 113301, 1, 0, "水着魔法少女に\n似合う香りってのも\n考えてみよっかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4231, 5, 3, 1, 0, 113301, 1, 0, "夜になると急に冷えて\n肌寒いんだよね～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4233, 7, 3, 1, 0, 113301, 1, 0, "あんまり食べると\nお腹が出て…でも…\nうう、止まらない～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4234, 8, 3, 1, 0, 113301, 1, 0, "この催眠魔法の本\n誰にもばれないように\n保管しとかなきゃね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4236, 10, 3, 1, 0, 113301, 1, 0, "ゴーゴーゴーゴーゴー\nナナカちゃーん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4237, 11, 3, 1, 0, 113301, 1, 0, "ナナカちゃんの\n誕生～\nなんちゃって");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4238, 1, 1, 1, 0, 113401, 1, 0, "ファイトファイト☆\n一生懸命\n応援するね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4239, 2, 1, 1, 0, 113401, 1, 0, "みんながんばってる！\n私も応援でみんなを\n盛り上げなきゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4240, 3, 1, 1, 0, 113401, 1, 0, "もし元気のない人が\nいたら…応援で少し\nでも元気にしたいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4241, 4, 1, 1, 0, 113401, 1, 0, "がんばれ～☆\nよし、発声練習OK！\n応援は、声も大事！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4242, 5, 1, 1, 0, 113401, 1, 0, "せっかく水着なんだし\n泳いだり潜ったりして\n遊びたいな～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4243, 101, 1, 4, 0, 113401, 1, 0, "チアリーダーとして\nキミを精一杯\n応援したいな…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4244, 102, 1, 8, 0, 113401, 1, 0, "キミへの応援\nちゃんと\n届いてるかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4245, 1, 2, 1, 0, 113401, 1, 0, "えへへ…今ね、\nキミへの応援歌を\n考えてたのだ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4246, 2, 2, 1, 0, 113401, 1, 0, "どうしたの？\n元気がないなら\n私が応援するよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4247, 3, 2, 1, 0, 113401, 1, 0, "がんばったあとは休憩\nしなきゃね！　私と\n一緒にお昼寝する？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4248, 4, 2, 1, 0, 113401, 1, 0, "シオリンとおそろいの\n水着で応援…\nしてみたいなぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4249, 101, 2, 4, 0, 113401, 1, 0, "次はなにして遊ぶ？\nキミがしたいことを\n教えてよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4250, 102, 2, 8, 0, 113401, 1, 0, "キミを応援\nすることができて…\n私、すごく幸せ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4251, 1, 2, 1, 0, 113401, 1, 1, "キミって早起き\nなんだね！　私も\n見習わなきゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4252, 2, 2, 1, 0, 113401, 1, 2, "ちょっとお疲れかな？\nそれじゃあ\n応援してあげるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4253, 3, 2, 1, 0, 113401, 1, 3, "遅い時間まで\nがんばってえらいね！\nでも無理はダメだよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4255, 2, 3, 1, 0, 113401, 1, 0, "ちょっとだけ休憩…\n…あう、座り心地が\n良すぎて…眠気が…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4256, 3, 3, 1, 0, 113401, 1, 0, "ここにいるみんなを\n私の応援でもっと\n元気にするのだ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4257, 4, 3, 1, 0, 113401, 1, 0, "元気の出る香り～♪\nこれもうまく応援に\n活かせないかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4258, 5, 3, 1, 0, 113401, 1, 0, "ぽかぽかあったまって\n元気をチャージ\nするのだ～☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4260, 7, 3, 1, 0, 113401, 1, 0, "いっぱい食べて、\nみんなを応援する\nパワーをつけなきゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4261, 8, 3, 1, 0, 113401, 1, 0, "みんなを元気にする\n方法は…どこかに\n書いてないかなぁ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4263, 10, 3, 1, 0, 113401, 1, 0, "わぁ、この子\n怪獣さんみたいで\nかわいいね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4264, 11, 3, 1, 0, 113401, 1, 0, "水着でこれに\n乗ってると海にいる\n気分になれるね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4265, 1, 1, 1, 0, 113501, 1, 0, "すごく忙しいけど\nとても充実した気分\nこれが青春なのかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4266, 2, 1, 1, 0, 113501, 1, 0, "森の静かな雰囲気も\n海の開放的な空気も\nどちらも素敵ね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4267, 3, 1, 1, 0, 113501, 1, 0, "汚れたお洗濯物は\nみんなが頑張った証\nなんだか愛おしいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4268, 4, 1, 1, 0, 113501, 1, 0, "みんなを見てると\n何だか私も\n走りたくなっちゃうわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4269, 5, 1, 1, 0, 113501, 1, 0, "せっかくの水着だし\n泳ぐ練習でも\nしてみようかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4270, 101, 1, 4, 0, 113501, 1, 0, "みんな～ファイト～！\n応援するのも大事よね\n練習しておかなきゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4271, 102, 1, 8, 0, 113501, 1, 0, "先生に教えられること\nまだまだい～っぱいね\n次は何がいいかしら♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4272, 1, 2, 1, 0, 113501, 1, 0, "今日も暑くなりそうね\nこまめな水分補給を\n忘れないでね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4273, 2, 2, 1, 0, 113501, 1, 0, "手伝ってくれるの？\nありがとう♪\n先生、頼りにしてるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4274, 3, 2, 1, 0, 113501, 1, 0, "休憩はこまめに\nとりましょうね\n無理は厳禁よ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4275, 4, 2, 1, 0, 113501, 1, 0, "海の遊びって\nどんなのがあるの？\n先生に教えてね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4276, 101, 2, 4, 0, 113501, 1, 0, "水着は初めてだけど\nどう？　変じゃない？\nふふ、ありがとう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4277, 102, 2, 8, 0, 113501, 1, 0, "あなたと過ごした\nこの夏は、きっと…\n忘れられない思い出ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4278, 1, 2, 1, 0, 113501, 1, 1, "おはよう～\n朝練前にちゃんと\nごはん食べましょうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4279, 2, 2, 1, 0, 113501, 1, 2, "お弁当作ってきたの\n栄養いっぱい摂って\n午後も頑張ろうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4280, 3, 2, 1, 0, 113501, 1, 3, "もうお休みしなきゃね\n先生が子守唄を歌って\nあげましょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4282, 2, 3, 1, 0, 113501, 1, 0, "ふふ、いい気持ちねぇ\n先生、少しだけ\n休憩しちゃおうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4283, 3, 3, 1, 0, 113501, 1, 0, "あらかわいい♪\nチームにもこういう\nマスコットが欲しいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4284, 4, 3, 1, 0, 113501, 1, 0, "あら、海の香り？\n波の音まで聞こえて\nきちゃいそうだわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4285, 5, 3, 1, 0, 113501, 1, 0, "うふふ\nこれなら濡れた水着を\n乾かすのも簡単ね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4287, 7, 3, 1, 0, 113501, 1, 0, "これ、美味しいわね♪\nでも、食べ過ぎは\n禁物よ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4288, 8, 3, 1, 0, 113501, 1, 0, "先生だって日々勉強よ\n新しいことを知るのは\nとても楽しいわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4290, 10, 3, 1, 0, 113501, 1, 0, "あらあら、楽しいわね\nみんなもきっと\nおおはしゃぎね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4291, 11, 3, 1, 0, 113501, 1, 0, "ふふ、これで\n夏らしい気分を\n満喫するわよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4292, 103, 1, 12, 0, 102301, 1, 0, "サンドイッチも\n作ったし、\nお兄ちゃんのお出迎え\n準備は完璧だね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4293, 103, 2, 12, 0, 102301, 1, 0, "えへへ、お兄ちゃんと\nぷうきちが居てくれる\nだけで、なんだか\nうれしくなっちゃう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4294, 1, 1, 1, 0, 113601, 1, 0, "少し赤くなっているな\n日焼けなんてしたのは\nいつ以来だろう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4295, 2, 1, 1, 0, 113601, 1, 0, "この格好で\n過ごすのは\n少し勇気がいるな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4296, 3, 1, 1, 0, 113601, 1, 0, "暑いのは平気だが\n肌が外気に触れるの\nにはまだ慣れないな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4297, 4, 1, 1, 0, 113601, 1, 0, "この格好でも\n堂々としていれば\n恥ずかしくはない…\nのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4298, 5, 1, 1, 0, 113601, 1, 0, "おっと…鎧姿の時と\n重心が違うせいか\nちょっと不安定だな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4299, 101, 1, 4, 0, 113601, 1, 0, "この水着…\n私に似合って\nいるのだろうか…？\n少年には聞きづらいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4300, 102, 1, 8, 0, 113601, 1, 0, "少年との\n海のバカンス…\nまた行きたい\nものだな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4301, 1, 2, 1, 0, 113601, 1, 0, "あまり見るのは\nよしてくれ…\n恥ずかしいじゃ\nないか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4302, 2, 2, 1, 0, 113601, 1, 0, "どうかしたのかい？\n私でよければ\n話し相手くらいには\nなろうじゃないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4303, 3, 2, 1, 0, 113601, 1, 0, "ひゃっ！\nす、すまない\nちょっと過敏に\nなっているようだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4304, 4, 2, 1, 0, 113601, 1, 0, "…っくしゅん！\nすまない\n薄着には慣れて\nないものでね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4305, 101, 2, 4, 0, 113601, 1, 0, "まあ、少年になら\n見られても…\nい、いや！\nなんでもない！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4306, 102, 2, 8, 0, 113601, 1, 0, "私がこうして\nゆっくりできるのは\n少年がそばにいて\nくれるからだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4307, 1, 2, 1, 0, 113601, 1, 1, "この時間なら\nビーチにも人は\n少ないだろうね…\n遊びに行くかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4308, 2, 2, 1, 0, 113601, 1, 2, "昼食のお誘いかい？\nいいよ、付き合おう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4309, 3, 2, 1, 0, 113601, 1, 3, "もう夜か…\n一日が経つのは\nはやいものだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4311, 2, 3, 1, 0, 113601, 1, 0, "これは楽でいいな…\nいつもは鎧姿で\n家具を傷つけないか\n気を使っているからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4312, 3, 3, 1, 0, 113601, 1, 0, "うん…ふわふわの\n感触が\nよくわかるな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4313, 4, 3, 1, 0, 113601, 1, 0, "いつもは\n鎧に匂いが\n移ってしまうのが\n悩みなんだよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4314, 5, 3, 1, 0, 113601, 1, 0, "うーむ…\n涼しいのに暖かい\nなんだか奇妙な気分だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4316, 7, 3, 1, 0, 113601, 1, 0, "兜を気にせず\n食べられるのは\n楽でいいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4317, 8, 3, 1, 0, 113601, 1, 0, "ふむ…鎧がないと\nページがめくりやすい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4319, 10, 3, 1, 0, 113601, 1, 0, "身軽でいいな…\n鎧を着ていると\n騎乗訓練の時\n馬に申し訳がなくてね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4320, 11, 3, 1, 0, 113601, 1, 0, "貝をうまく使えば\n水中でも\n守りを固められそうだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4321, 1, 1, 1, 0, 106801, 1, 0, "どこをアジトと\nつなげようかな～…\nこのへんにしよっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4322, 2, 1, 1, 0, 106801, 1, 0, "ここってちょっと\n変わった建物だね\n妖精がいるでしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4323, 3, 1, 1, 0, 106801, 1, 0, "色んな人を観察できて\n眼福眼福…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4324, 4, 1, 1, 0, 106801, 1, 0, "家具の配置変更なら\nアタシにおまかせあれ\n…家の形は変えない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4325, 5, 1, 1, 0, 106801, 1, 0, "新メニューどうしよう\n思いついた人がいたら\nアタシに教えてね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4326, 101, 1, 4, 0, 106801, 1, 0, "少年、早く帰って\nこないかな…\nよし、迎えに行こう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4327, 102, 1, 8, 0, 106801, 1, 0, "結局またあちこち\n移動する日々だし…\n少年に会いたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4328, 1, 2, 1, 0, 106801, 1, 0, "どしたの少年？\nお姉さんに何でも\n相談してみな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4329, 2, 2, 1, 0, 106801, 1, 0, "あれをああして…\nおや少年！　ごめんね\nすぐに気づけなくて！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4330, 3, 2, 1, 0, 106801, 1, 0, "何？　クリスが\nアタシを探してる？\n…いないって言って！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4331, 4, 2, 1, 0, 106801, 1, 0, "よければリノちゃんと\nシズルちゃんにも\n顔を見せてあげて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4332, 101, 2, 4, 0, 106801, 1, 0, "少年～！\nもうヘトヘトだよ～！\nお願い癒して～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4333, 102, 2, 8, 0, 106801, 1, 0, "…アタシが素直に\n助けてって言えるのは\n少年だけだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4334, 1, 2, 1, 0, 106801, 1, 1, "朝だよ少年！\n爽やかな朝の\nクレープはいかが？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4335, 2, 2, 1, 0, 106801, 1, 2, "お腹空いたな～\nお昼のクレープ\n少年は食べる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4336, 3, 2, 1, 0, 106801, 1, 3, "夜までクレープは\nやめとけ？　ごめん\nそれだけは無理…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4338, 2, 3, 1, 0, 106801, 1, 0, "アタシこんなに\nゆっくりしちゃって\nいいんだっけ～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4339, 3, 3, 1, 0, 106801, 1, 0, "…これ\nネネカが変身\nしてないよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4340, 4, 3, 1, 0, 106801, 1, 0, "いい香りだ…\n解析完了\n今度生成しようっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4341, 5, 3, 1, 0, 106801, 1, 0, "安心するな～…\nアジトに置けないから\n羨ましいよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4343, 7, 3, 1, 0, 106801, 1, 0, "食べ物を消化するって\n仕組み、どんなものか\n気になる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4344, 8, 3, 1, 0, 106801, 1, 0, "速読できるけど\n本を読む時くらい\n文字にじっくり\n浸かりたいんだよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4346, 1, 1, 1, 0, 113701, 1, 0, "エンジェルとして\nみんなを元気に…！\nアカリ、頑張ります♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4347, 2, 1, 1, 0, 113701, 1, 0, "お姉ちゃんと一緒に\nお兄ちゃんを…えへへ\nまだかな、お兄ちゃん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4348, 3, 1, 1, 0, 113701, 1, 0, "エンジェルの音色を\n目指して、今日も\nサックスの練習です♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4349, 4, 1, 1, 0, 113701, 1, 0, "お兄ちゃんとの特訓も\n頑張らないと…\n厳しくしてくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4350, 5, 1, 1, 0, 113701, 1, 0, "かわいいエンジェルの\n格好、お兄ちゃんなら\n喜んでくれますよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4351, 101, 1, 4, 0, 113701, 1, 0, "エンジェルの力で\nお兄ちゃんのハートも\nイチコロですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4352, 102, 1, 8, 0, 113701, 1, 0, "アカリが一番\n元気にしたいのは\nお兄ちゃんですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4353, 1, 2, 1, 0, 113701, 1, 0, "お兄ちゃん？\n触りたいなら…\nこことかどうですか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4354, 2, 2, 1, 0, 113701, 1, 0, "特訓の時間ですか？\nアカリ、楽しみに\nしてたんですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4355, 3, 2, 1, 0, 113701, 1, 0, "あ、お兄ちゃん！\nそろそろアカリと\n休憩…しませんか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4356, 4, 2, 1, 0, 113701, 1, 0, "この羽、触り心地\nいいですか？　あんっ\nくすぐったいですよぉ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4357, 101, 2, 4, 0, 113701, 1, 0, "お兄ちゃんも元気に\nなりたいんですか？\nアカリにお任せです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4358, 102, 2, 8, 0, 113701, 1, 0, "やんっ♪\nお兄ちゃんったら\nダイタンですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4359, 1, 2, 1, 0, 113701, 1, 1, "お兄ちゃん、朝ですよ\nすっごく気持ちのいい\nお天気ですよ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4360, 2, 2, 1, 0, 113701, 1, 2, "お昼寝しませんか\nお兄ちゃん？\nアカリの膝枕で…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4361, 3, 2, 1, 0, 113701, 1, 3, "夜ですね、お兄ちゃん\nアカリ、なんだか胸が\nドキドキしちゃいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4363, 2, 3, 1, 0, 113701, 1, 0, "フカフカですね…\n隣にお兄ちゃんが\nいてくれたらなぁ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4364, 3, 3, 1, 0, 113701, 1, 0, "えへへ、アカリも\nこんな風にかわいく\nなりたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4365, 4, 3, 1, 0, 113701, 1, 0, "お兄ちゃんが好きな\n匂いなのかな？\n参考にしますね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4366, 5, 3, 1, 0, 113701, 1, 0, "体が火照ってきて\nなんだかアカリ…\nクラクラしちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4368, 7, 3, 1, 0, 113701, 1, 0, "はむ、んぐ…あっ\nほっぺについちゃった\nベトベトですよぉ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4369, 8, 3, 1, 0, 113701, 1, 0, "エンジェルって色んな\n物語に出てきますよね\nもっと調べなくちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4371, 103, 1, 12, 0, 103201, 1, 0, "あの方の前では\n常に気高く\nありたいですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4372, 103, 2, 12, 0, 103201, 1, 0, "どんなに道に迷っても\nあなたさまの元には\n絶対に辿り着く\n自信がありますわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4373, 103, 1, 12, 0, 102801, 1, 0, "あんたと一緒に\nいるときが一番楽しい\n一時かもしれないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4374, 103, 2, 12, 0, 102801, 1, 0, "いつかあんたと一緒に\nサレンディア救護院を\n切り盛り…なんてね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4375, 1, 1, 1, 0, 113801, 1, 0, "今日も\nエンジェルとして、\nみんなの幸せの\nために頑張らないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4376, 2, 1, 1, 0, 113801, 1, 0, "せっかく羽が\nついてるのに\n飛べないのが残念だわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4377, 3, 1, 1, 0, 113801, 1, 0, "この格好、子供たちに\n妙にウケがいいわね\nま、悪くないけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4378, 4, 1, 1, 0, 113801, 1, 0, "や、やっぱりみんな\n注目してくるわね…\nエンジェルって珍しい\nからしかたないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4379, 5, 1, 1, 0, 113801, 1, 0, "エンジェルになると\n人見知りがなおる！\n…わけないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4380, 101, 1, 4, 0, 113801, 1, 0, "エンジェルの活動は\n大変だけど、自分が\n成長してるって\n実感がうれしいわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4381, 102, 1, 8, 0, 113801, 1, 0, "もし誰かの願いを\nかなえられるなら\n私はアイツの…\nって何考えてるのよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4382, 1, 2, 1, 0, 113801, 1, 0, "何ボサっとしてるの！\nさあ、街に出て\n人助けするわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4383, 2, 2, 1, 0, 113801, 1, 0, "エンジェリック\nアロー！\nなんてね…え、アンタ\nいつから見てたのよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4384, 3, 2, 1, 0, 113801, 1, 0, "コラ！\n羽は触らないで！\n壊れたらどうするのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4385, 4, 2, 1, 0, 113801, 1, 0, "エンジェルじゃなく\nても、アンタはいつも\n人助けしてるわよね\n…ちょっと尊敬するわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4386, 101, 2, 4, 0, 113801, 1, 0, "この服なら他の子より\n私を見てくれるかも…\nって、な、何\n見てるのよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4387, 102, 2, 8, 0, 113801, 1, 0, "ね、ねえ、もし私が\n困ってたら、一番に\n駆けつけて…やっぱり\n何でもないわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4388, 1, 2, 1, 0, 113801, 1, 1, "おはよう…あ、あの、\nエンジェルとして\n町に行くんだけど…\n一緒に行かない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4389, 2, 2, 1, 0, 113801, 1, 2, "ふぅ、いいことした\n後のランチは\nおいしいわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4390, 3, 2, 1, 0, 113801, 1, 3, "もうこんな時間…\n夜更かししてないで\n早く寝なさいよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4392, 2, 3, 1, 0, 113801, 1, 0, "いい座り心地ね～\nまさに天にも昇る\n心地よさだわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4393, 3, 3, 1, 0, 113801, 1, 0, "ふふ、かわいい…\nあ、羽付けたら\nもっとかわいく\nなるんじゃないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4394, 4, 3, 1, 0, 113801, 1, 0, "はぁ～落ち着くわ～\n回復アイテムみたいで\n癒やされちゃうわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4395, 5, 3, 1, 0, 113801, 1, 0, "わっ、とと…\n危ない、羽が\nこげちゃうところ\nだったわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4397, 7, 3, 1, 0, 113801, 1, 0, "人の役に立つのって\nすごく大変だから、\nこれでライフ回復よ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4398, 8, 3, 1, 0, 113801, 1, 0, "エンジェルに関する\n本はあるかしら…あ！\nこれ探してた攻略本！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4400, 1, 1, 1, 0, 113901, 1, 0, "ふっふっふ\n吸血鬼らしく\n驚かせてあげましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4401, 2, 1, 1, 0, 113901, 1, 0, "獲物はどこですか～！\nう～ん、もうちょっと\n迫力が欲しいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4402, 3, 1, 1, 0, 113901, 1, 0, "トリックオアトリート\n…返事がないので\nイタズラしておきます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4403, 4, 1, 1, 0, 113901, 1, 0, "ハロウィンですし\nたまには騎士さんでも\n誘ってあげますかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4404, 5, 1, 1, 0, 113901, 1, 0, "マントは動きに\nメリハリがついて\nいいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4405, 101, 1, 4, 0, 113901, 1, 0, "色んな仮装が見られて\nやっぱりハロウィンは\n最高ですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4406, 102, 1, 8, 0, 113901, 1, 0, "吸血鬼らしい行動って\n噛みついたり…いや\nそれは大胆過ぎです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4407, 1, 2, 1, 0, 113901, 1, 0, "呼びましたか？\n手短にお願いしますよ\n忙しいんですから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4408, 2, 2, 1, 0, 113901, 1, 0, "え？　衣装に穴が？\nありがとうございます\n…よく見てるんですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4409, 3, 2, 1, 0, 113901, 1, 0, "ふわあ…吸血鬼の\n姿でも、眠い時は\n眠いんですよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4410, 4, 2, 1, 0, 113901, 1, 0, "ハロウィンってライブ\nとは違った賑やかさが\nあってワクワクします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4411, 101, 2, 4, 0, 113901, 1, 0, "私を驚かそうとしても\n無駄ですよ！\nすぐ分かるんですから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4412, 102, 2, 8, 0, 113901, 1, 0, "騎士さん、一緒に\nハロウィンを…いいえ\nなんでもないですっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4413, 1, 2, 1, 0, 113901, 1, 1, "仕事で寝不足だから\n太陽がまぶしいです…\n私、吸血鬼っぽいかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4414, 2, 2, 1, 0, 113901, 1, 2, "お昼ご飯は真っ赤な…\nトマト尽くしのお弁当\nにしてみました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4415, 3, 2, 1, 0, 113901, 1, 3, "夜はハロウィンが\n盛り上がる時間…\n行きますよ騎士さん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4417, 2, 3, 1, 0, 113901, 1, 0, "このフィット感\nどうにか服作りにも\n活かせれば…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4418, 3, 3, 1, 0, 113901, 1, 0, "よく出来てますね…！\nぬいぐるみの服を作る\nのも楽しそうですね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4419, 4, 3, 1, 0, 113901, 1, 0, "いい感じですね…\n服に合わせた香りって\nいうのも、いいかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4420, 5, 3, 1, 0, 113901, 1, 0, "はぁ、温まりますね…\nおっと、マントに火が\n点いちゃいそうです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4422, 7, 3, 1, 0, 113901, 1, 0, "あぁ、美味しい～\n食べた分は、働いて\n燃焼しますからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4423, 8, 3, 1, 0, 113901, 1, 0, "伝説の吸血鬼…\n夜を統べる者…\nほうほう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4425, 12, 3, 1, 0, 113901, 1, 0, "やっぱりハロウィンと\nいえばお菓子です！\nさぁ配りましょうか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4427, 1, 1, 1, 0, 114101, 1, 0, "この格好…\nカッコイイのに\n動きやすくて\n着心地も最高ッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4428, 2, 1, 1, 0, 114101, 1, 0, "キメポーズはこう…\nいやこっちのほうが…\nなやましいッス…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4429, 3, 1, 1, 0, 114101, 1, 0, "トリックオア\nジャスティス！\nって言ったら何か\nもらえるッスかね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4430, 4, 1, 1, 0, 114101, 1, 0, "新しい必殺技の\n特訓もしなくちゃ\nいけないッスね…\n忙しいッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4431, 5, 1, 1, 0, 114101, 1, 0, "自分のこの姿\nトモね～ちゃんにも\nみせてあげるッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4432, 101, 1, 4, 0, 114101, 1, 0, "ホワイトタイガー\n参上ッス！\n今のポーズは\nキマったッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4433, 102, 1, 8, 0, 114101, 1, 0, "あの人と一緒だと\nほんとにヒーローに\nなれる気がするッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4434, 1, 2, 1, 0, 114101, 1, 0, "どうッスか？\nこの色、自分に\n似合ってるッスかね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4435, 2, 2, 1, 0, 114101, 1, 0, "ヒマだったら\n必殺技の特訓に\n付き合ってもらって\nいいッスか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4436, 3, 2, 1, 0, 114101, 1, 0, "ちょうどいいところに\n来たッスね！\nこのキメポーズ\nどうッスか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4437, 4, 2, 1, 0, 114101, 1, 0, "お！　この格好、\n気になるッスか？\nじっくり見ても\nいいッスよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4438, 101, 2, 4, 0, 114101, 1, 0, "あんたも一緒に\n新しい技の練習\nどうッスか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4439, 102, 2, 8, 0, 114101, 1, 0, "今日もあんたと一緒に\nランドソルの平和を\n守るッスよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4440, 1, 2, 1, 0, 114101, 1, 1, "朝ッス！\n一緒に早朝特訓\nやるッスよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4441, 2, 2, 1, 0, 114101, 1, 2, "お昼休憩ッス！\nヒーローにも\n休息は必要ッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4442, 3, 2, 1, 0, 114101, 1, 3, "闇夜に映える\n白い衣装で\n平和を守るッスよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4444, 2, 3, 1, 0, 114101, 1, 0, "トラも狩りの時以外は\nごろごろしてるって\n本で読んだッスよー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4445, 3, 3, 1, 0, 114101, 1, 0, "もこもこッスね♪\nこのかわいらしさを\n守ってあげるのも\nヒーローの役目ッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4446, 4, 3, 1, 0, 114101, 1, 0, "いい匂いッスね…\nリラックスして\n瞑想するッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4447, 5, 3, 1, 0, 114101, 1, 0, "燃える炎は\nヒーローの心意気ッス\nいつまでも\n見てられるッスよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4449, 7, 3, 1, 0, 114101, 1, 0, "もぐもぐ…\nいっぱい食べて\n強いヒーローに\nなるッスよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4450, 8, 3, 1, 0, 114101, 1, 0, "ちゃんと勉強の本も\n読んでるッスよ…！\nヒーローには賢さも\n必要らしいッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4452, 12, 3, 1, 0, 114101, 1, 0, "わわっ、お菓子が\nいっぱいッス！\nみんなで\n食べるッスよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4454, 103, 1, 12, 0, 103001, 1, 0, "ワタシがチューシンと\nなった今、天下統一は\n目の前デス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4455, 103, 2, 12, 0, 103001, 1, 0, "もうショーグンってば\nそれはセイシツに\nすることデ～ス…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4456, 1, 1, 1, 0, 114001, 1, 0, "女幽霊…うらめしや…\nうーん、これは\nちょっと違う気が\nするな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4457, 2, 1, 1, 0, 114001, 1, 0, "何だか寒気がする…\nま、まさか\nこの部屋にも幽霊が？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4458, 3, 1, 1, 0, 114001, 1, 0, "ハロウィンは楽しいね\n童心に帰ったような\n気分だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4459, 4, 1, 1, 0, 114001, 1, 0, "今度のハロウィンは\nユイとヒヨリを\n誘ってみようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4460, 5, 1, 1, 0, 114001, 1, 0, "ハロウィンのお菓子は\nどれもかわいいね\n…一つくらいなら\nいいかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4461, 101, 1, 4, 0, 114001, 1, 0, "次は彼と\nどんなハロウィンを\n過ごそうかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4462, 102, 1, 8, 0, 114001, 1, 0, "こんな賑やかさも\nいいものだね\n彼といられるのなら\nなおさら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4463, 1, 2, 1, 0, 114001, 1, 0, "…いたずらしようと\nしてない、キミ？\nふふ、お見通しだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4464, 2, 2, 1, 0, 114001, 1, 0, "え、私にもお菓子を？\nありがとう…ふふ\nうれしいものだね\nハッピーハロウィン！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4465, 3, 2, 1, 0, 114001, 1, 0, "どうしたの？\n出かけるなら\n私も同行しようか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4466, 4, 2, 1, 0, 114001, 1, 0, "この格好、舞踏会にも\n出られそうだね\n一曲、踊ってみる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4467, 101, 2, 4, 0, 114001, 1, 0, "やるからには本気で\nやらせてもらおう\nトリックオア\nトリート！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4468, 102, 2, 8, 0, 114001, 1, 0, "他の子に目移りする\nのも分かるが、その…\nせっかくの特別な衣装\n見てほしいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4469, 1, 2, 1, 0, 114001, 1, 1, "寝起きの体を\n慣らしておこうか\nほら、剣を取って");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4470, 2, 2, 1, 0, 114001, 1, 2, "お菓子もいいけど\nちゃんと昼食も\nとるんだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4471, 3, 2, 1, 0, 114001, 1, 3, "さあ、行こうか！\nハロウィンは\nこれからが本番だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4473, 2, 3, 1, 0, 114001, 1, 0, "ハロウィンはまだ\nこれからだ\n一休みしようか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4474, 3, 3, 1, 0, 114001, 1, 0, "キミたちも\n仮装に興味は\nあるかな？　…ふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4475, 4, 3, 1, 0, 114001, 1, 0, "いい香りだけど\n幽霊が集まったり\nしないだろうか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4476, 5, 3, 1, 0, 114001, 1, 0, "暖かい…一息ついたら\nハロウィンの\nパレードを\n見に行こうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4478, 7, 3, 1, 0, 114001, 1, 0, "ハロウィンを本気で\n楽しむなら\n食事もしっかり\nとっておかないとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4479, 8, 3, 1, 0, 114001, 1, 0, "ハロウィンの\nホラー小説か…\nけ、結構\n怖いものだね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4481, 12, 3, 1, 0, 114001, 1, 0, "お菓子がいっぱいだ…\nこういうのって\n見ているだけで心が\n躍ってしまうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4483, 1, 1, 1, 0, 114201, 1, 0, "こんなにかわいい\n武器で戦えるとは…\nすごいものだな\n魔法少女は");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4484, 2, 1, 1, 0, 114201, 1, 0, "決めポーズの訓練も\nしっかりやっておくか\n…誰も見ていないな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4485, 3, 1, 1, 0, 114201, 1, 0, "こういう格好は\nユキあたりがすごく\n似合いそうだな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4486, 4, 1, 1, 0, 114201, 1, 0, "子どもたちにサインを\n求められてしまった…\nこれもまた私の使命！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4487, 5, 1, 1, 0, 114201, 1, 0, "この格好は目立つな…\nいや、提督とは人々の\n視線を集めるものだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4488, 101, 1, 4, 0, 114201, 1, 0, "あいつと作戦会議を\nしておくか。あれで\nなかなか頼れるからな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4489, 102, 1, 8, 0, 114201, 1, 0, "あいつには私の勇姿を\nちゃんと見ていて\nほしいものだな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4490, 1, 2, 1, 0, 114201, 1, 0, "一仕事終えたことだし\n一緒に甘いものでも\n食べに行くか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4491, 2, 2, 1, 0, 114201, 1, 0, "怪しげな気配がするな\n貴公も警戒を\n怠るなよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4492, 3, 2, 1, 0, 114201, 1, 0, "シオリに魔法少女の\n本を借りたんだ\n一緒に読まないか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4493, 4, 2, 1, 0, 114201, 1, 0, "巡回の時間まで\nお茶にでもするか\n貴公も付き合うがいい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4494, 101, 2, 4, 0, 114201, 1, 0, "貴公がサポートして\nくれるのなら心強いな\n頼りにしているぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4495, 102, 2, 8, 0, 114201, 1, 0, "頭を撫でるな～！\n…まったく、貴公だけ\nだぞ、こんな風に私を\n撫でてくるのは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4496, 1, 2, 1, 0, 114201, 1, 1, "起きろ貴公！\n魔法少女の朝は\n早いぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4497, 2, 2, 1, 0, 114201, 1, 2, "ほら、食後の\nデザートだ\nて、適度な糖分は\n体に必要なんだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4498, 3, 2, 1, 0, 114201, 1, 3, "ふわぁ…魔法少女も…\n眠気、には…い、いや\n寝てないぞ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4500, 2, 3, 1, 0, 114201, 1, 0, "任務や訓練で\n疲れた体に\nこれは効くなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4501, 3, 3, 1, 0, 114201, 1, 0, "うむ、かわいいな\nモーラのやつを隣に\n並べようか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4502, 4, 3, 1, 0, 114201, 1, 0, "ああ、身も心も\n安らぐ…\nまるで魔法だな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4503, 5, 3, 1, 0, 114201, 1, 0, "この温かさ…\n愛と希望に\n通じるものがある…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4505, 7, 3, 1, 0, 114201, 1, 0, "食事の大切さは\n魔法少女も軍人も\n変わりない\nしっかり食べるんだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4506, 8, 3, 1, 0, 114201, 1, 0, "魔法少女の本を\n読んでるのだが\nわ、私もこんななのか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4508, 103, 1, 12, 0, 103301, 1, 0, "オラとあんちゃんは\nボケもツッコミも\nあうんの呼吸だべ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4509, 103, 2, 12, 0, 103301, 1, 0, "あんちゃんと二人で\nネタ合わせ…初めての\n共同作業だべ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4510, 1, 1, 1, 0, 192501, 1, 0, "ぴっぷる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4511, 2, 1, 1, 0, 192501, 1, 0, "ぴっぷるぴっぷる♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4512, 3, 1, 1, 0, 192501, 1, 0, "ぴっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4513, 4, 1, 1, 0, 192501, 1, 0, "ぷっぷー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4514, 5, 1, 1, 0, 192501, 1, 0, "ぴぃ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4515, 1, 2, 1, 0, 192501, 1, 0, "ぴっぷるんるん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4516, 2, 2, 1, 0, 192501, 1, 0, "ぷぅ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4517, 3, 2, 1, 0, 192501, 1, 0, "ぴぴっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4518, 4, 2, 1, 0, 192501, 1, 0, "ぷぅー…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4519, 1, 2, 1, 0, 192501, 1, 1, "ちゅ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4520, 2, 2, 1, 0, 192501, 1, 2, "ぷはー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4521, 3, 2, 1, 0, 192501, 1, 3, "ぴぇー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4531, 1, 1, 1, 0, 114301, 1, 0, "魔法少女になったら\n髪型も変わるんだね\n色々試してみようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4532, 2, 1, 1, 0, 114301, 1, 0, "…煌く剣技で、\n悪を断つ！\nうん、今日も\n完璧なポーズだね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4533, 3, 1, 1, 0, 114301, 1, 0, "ミクマ流剣術で、\n魔法少女の技に使え\nそうなものは…よし、\n早速試してみよっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4534, 4, 1, 1, 0, 114301, 1, 0, "魔法少女になったから\nには、サインの練習も\nしないと…\nよし、頑張るぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4535, 5, 1, 1, 0, 114301, 1, 0, "魔法少女の姿はすごく\nかわいいけど…この\n姿はジュンさんたちに\n見せられないなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4536, 101, 1, 4, 0, 114301, 1, 0, "あの人は魔法少女\nのこと好きなのかな？\n…好きだったら\nうれしいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4537, 102, 1, 8, 0, 114301, 1, 0, "…やっぱり、\nあの人がいないと\n特訓に身が入らない…\n早く帰ってこないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4538, 1, 2, 1, 0, 114301, 1, 0, "もし時間があるなら、\n私と街の見回りに\n行かない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4539, 2, 2, 1, 0, 114301, 1, 0, "あ、いいところに！\n新しい魔法剣術を\n編み出したから、\n見てくれないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4540, 3, 2, 1, 0, 114301, 1, 0, "魔法少女の姿が気に\nなるのは分かるけど…\nず、ずっと見られる\nのは照れるからやめて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4541, 4, 2, 1, 0, 114301, 1, 0, "変身ポーズ中の動き、\n少し変えた方が\nいいかな…\nあなたはどう思う？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4542, 101, 2, 4, 0, 114301, 1, 0, "よければ、\n魔法少女の特訓に\n付き合ってくれない？\nその…二人きりでさ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4543, 102, 2, 8, 0, 114301, 1, 0, "私…あなただけの\n魔法少女になっても…\nふふっ、な～んてね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4544, 1, 2, 1, 0, 114301, 1, 1, "今日もいい朝だね\nさあ、一緒に\n街の見回りに行こうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4545, 2, 2, 1, 0, 114301, 1, 2, "もう昼か…なにか\n食べたいものある？\n簡単なのでいいなら、\n私が作ってあげるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4546, 3, 2, 1, 0, 114301, 1, 3, "そろそろ休もうか\n…なんなら、添い寝\nしてあげようか？\nふふっ、冗談だよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4548, 2, 3, 1, 0, 114301, 1, 0, "これは…\n心身ともに安らぐね\nなんだか\n眠くなっちゃいそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4549, 3, 3, 1, 0, 114301, 1, 0, "か、かわいい…これ、\n魔法で動かせたり\nしないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4550, 4, 3, 1, 0, 114301, 1, 0, "いい香りだね\nなんだか頭が冴えて\nきたし、新しい技でも\n考えようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4551, 5, 3, 1, 0, 114301, 1, 0, "あったかいな…\nこの温もりは、\n魔法少女の魔法でも\n再現不可能だね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4553, 7, 3, 1, 0, 114301, 1, 0, "こ、これは…\nおいしすぎて手が\n止まらないかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4554, 8, 3, 1, 0, 114301, 1, 0, "この本の\nキャラの動き、\n変身ポーズの\n参考にできるかも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4556, 1, 1, 1, 0, 114401, 1, 0, "メリークリスマス！\nさあ、素敵な\nパーティーを始めると\nいたしましょう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4557, 2, 1, 1, 0, 114401, 1, 0, "ふふっ、\nいくつになっても、\nやはりクリスマスは、\nワクワクしますわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4558, 3, 1, 1, 0, 114401, 1, 0, "自分で料理をしてみて\nシェフたちのすごさが\n改めて分かりましたわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4559, 4, 1, 1, 0, 114401, 1, 0, "何事も自分で\n体験してみると\n新しい発見が\nあるものですわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4560, 5, 1, 1, 0, 114401, 1, 0, "やはり、クリスマスは\n街が活発になり\nますわね…これは、\n絶好の商機ですわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4561, 101, 1, 4, 0, 114401, 1, 0, "他のクリスマス料理も\n作れるようになったら\nあのお方は食べて\nくださるかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4562, 102, 1, 8, 0, 114401, 1, 0, "あのお方に贈る\nプレゼント…\nこれはかなりの\n難題ですわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4563, 1, 2, 1, 0, 114401, 1, 0, "メリークリスマス！\nよろしければ、一緒に\nクリスマスの準備を\nいたしませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4564, 2, 2, 1, 0, 114401, 1, 0, "まあ、クリスマスの\n飾りつけを手伝って\nいただけるのですか？\nありがとうございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4565, 3, 2, 1, 0, 114401, 1, 0, "クリスマスに合わせて\nあつらえた自慢の衣装\nなのですが…その、\nいかがでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4566, 4, 2, 1, 0, 114401, 1, 0, "幼い頃はサンタさんが\nいらっしゃるのを\n待ちわびたものです\n今は…内緒ですわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4567, 101, 2, 4, 0, 114401, 1, 0, "も、もしお時間が\nあるようでしたら、\nクリスマスの街を\n一緒に歩きませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4568, 102, 2, 8, 0, 114401, 1, 0, "来年のクリスマスも\nあのお方と一緒に\n迎えられたら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4569, 1, 2, 1, 0, 114401, 1, 1, "時は金なり…\nせっかくの朝ですもの\n時間を有効活用\nいたしましょう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4570, 2, 2, 1, 0, 114401, 1, 2, "お昼になりましたわね\nさあ、\nパーティーの準備を\n進めますわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4571, 3, 2, 1, 0, 114401, 1, 3, "静かな夜ですわね…\nもうちょっとだけ、\nあなたさまとお話を\nしていたい気分です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4573, 2, 3, 1, 0, 114401, 1, 0, "適度な休息は\n成功の秘訣ですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4574, 3, 3, 1, 0, 114401, 1, 0, "このかわいらしさ…\nいつまでも見て\nいられそうですわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4575, 4, 3, 1, 0, 114401, 1, 0, "人をもてなすには\nこうしたところにも\n気を配らないと\nいけませんわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4576, 5, 3, 1, 0, 114401, 1, 0, "暖かい…\nこういう憩いの\nひと時こそ、大事に\nしたいものですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4578, 7, 3, 1, 0, 114401, 1, 0, "この奥深い味わい…\n何か隠し味など\n使われていまして？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4579, 8, 3, 1, 0, 114401, 1, 0, "クリスマス料理の\nレシピも、\nこれだけあると\n迷ってしまいますわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4581, 14, 3, 1, 0, 114401, 1, 0, "この絵本、とっても\n面白いつくりですわね\nうちの商品に\nしたいぐらいですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4582, 15, 3, 1, 0, 114401, 1, 0, "これだけ大きな\n着ぐるみ…\n職人の技術が\n光りますわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4583, 1, 1, 1, 0, 114601, 1, 0, "クリスマスといえば\nパーティーよね！\nいっぱい飲むわよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4584, 2, 1, 1, 0, 114601, 1, 0, "私を麦しゅわだけの\n女と思ったら\n大間違いなんだから♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4585, 3, 1, 1, 0, 114601, 1, 0, "クリスマスらしい\n飲み物も結構いいわね\n私も今度\n作ってみようかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4586, 4, 1, 1, 0, 114601, 1, 0, "暖かい部屋で飲む\n麦しゅわも\nまた格別なのよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4587, 5, 1, 1, 0, 114601, 1, 0, "今日はオフの日だし\n朝から飲んでも\n怒られないわよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4588, 101, 1, 4, 0, 114601, 1, 0, "クリスマスの\nデートスポットで\n彼と一緒に…ってなに\n考えてるのユカリ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4589, 102, 1, 8, 0, 114601, 1, 0, "背伸びしなくても\nありのままの自分を\n受け入れてくれるって\nすごく…幸せ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4590, 1, 2, 1, 0, 114601, 1, 0, "大丈夫よ～\n飲んでない\n飲んでないひゃら～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4591, 2, 2, 1, 0, 114601, 1, 0, "クリスマスは\n特別だもの\n特別な一杯を\n飲まないとね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4592, 3, 2, 1, 0, 114601, 1, 0, "メリークリスマース！\nほらほらぁ\n乾杯しましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4593, 4, 2, 1, 0, 114601, 1, 0, "お姉さんの\n頼れるところ\n見せてあげるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4594, 101, 2, 4, 0, 114601, 1, 0, "何かあったら\n頼ってくれても\nいいんだからね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4595, 102, 2, 8, 0, 114601, 1, 0, "ふふ…これからも\nキミのこと…\n頼りにしちゃうからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4596, 1, 2, 1, 0, 114601, 1, 1, "さわやかな朝ね\n…二日酔いがないと\n朝ってこんなに\n気持ちいいのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4597, 2, 2, 1, 0, 114601, 1, 2, "昼間から飲むのって\nまた格別よね…って\nガマン、ガマンよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4598, 3, 2, 1, 0, 114601, 1, 3, "もうこんな時間かあ…\nあとは寝るだけだし\nちょっとくらいは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4600, 2, 3, 1, 0, 114601, 1, 0, "ゴロゴロするのって\n最高ね～\nあとは麦しゅわが\nあればなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4601, 3, 3, 1, 0, 114601, 1, 0, "私だって…\nかわいいものは\n好きでいいわよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4602, 4, 3, 1, 0, 114601, 1, 0, "んっ～…いい香りね\n日頃の疲れが\n取れる気がするわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4603, 5, 3, 1, 0, 114601, 1, 0, "ポカポカする～\n…なんだかのどが\nかわいてきたわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4605, 7, 3, 1, 0, 114601, 1, 0, "もぐもぐ…労働の\n後のご飯はやっぱり\nおいしいわぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4606, 8, 3, 1, 0, 114601, 1, 0, "クリスマスデート\n完全攻略マニュアル？\n…読んでおかなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4608, 14, 3, 1, 0, 114601, 1, 0, "あら、絵が飛び出して\n見えるけど…\n酔っ払ってるせいじゃ\nないわよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4609, 15, 3, 1, 0, 114601, 1, 0, "いい手触りね～\nウチにもほしいけど\n麦しゅわをこぼしたら\n大変そうだわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4610, 103, 1, 12, 0, 101601, 1, 0, "ヒデサイの視線\nずっと独り占め\nしてたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4611, 103, 2, 12, 0, 101601, 1, 0, "ヒデサイといるだけで\nうち、おに楽しいし！\nヒデサイもっしょ～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4612, 1, 1, 1, 0, 114501, 1, 0, "メリークリスマス！\nふふ、口にするだけで\n何だか楽しくなるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4613, 2, 1, 1, 0, 114501, 1, 0, "いつもは子どもたちを\n見守る方だけど\n今ははしゃいでも\nいいわよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4614, 3, 1, 1, 0, 114501, 1, 0, "ツリーや料理\nそしてプレゼント！\nいくつになっても\nやっぱり心躍るわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4615, 4, 1, 1, 0, 114501, 1, 0, "飾り付けも料理も\nいいセンスしてるわね\n救護院のパーティーの\n参考にさせてもらうわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4616, 5, 1, 1, 0, 114501, 1, 0, "焼きそばパンを\nクリスマスの定番に\nするにはどうすれば…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4617, 101, 1, 4, 0, 114501, 1, 0, "これ、あいつの\n好きそうな料理だわ\n取っといて食べさせて\nあげようかしら♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4618, 102, 1, 8, 0, 114501, 1, 0, "あいつのプレゼント\nちょっとだけ奮発\nしたのよね…\n喜んでくれるかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4619, 1, 2, 1, 0, 114501, 1, 0, "このドレス\n似合ってるかしら？\n今だけは見とれても\n許してあげるわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4620, 2, 2, 1, 0, 114501, 1, 0, "見て、このケーキ！\nおいしそうでしょ\nたまにはこんな贅沢も\nいいわよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4621, 3, 2, 1, 0, 114501, 1, 0, "料理も飲み物も\nおいしいわね！\nいっぱい食べて\n元を取らないと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4622, 4, 2, 1, 0, 114501, 1, 0, "子どもたちと一緒に\n雪遊び、楽しそうね\nあんたもどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4623, 101, 2, 4, 0, 114501, 1, 0, "せっかくの\nクリスマスなんだもの\nエスコート\nよろしくね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4624, 102, 2, 8, 0, 114501, 1, 0, "寒い？　そう…\nなら、もっとこっち\n来ていいわよ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4625, 1, 2, 1, 0, 114501, 1, 1, "ほら、早く起きて？\nパーティー用の\n買い出しに\n付き合ってちょうだい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4626, 2, 2, 1, 0, 114501, 1, 2, "パーティーの料理の\n準備をしながらお昼も\n作っておいたわ\n我ながらいい手際ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4627, 3, 2, 1, 0, 114501, 1, 3, "にぎやかなパーティー\nもいいけど、聖夜の\n余韻を感じるのも\n結構素敵ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4629, 2, 3, 1, 0, 114501, 1, 0, "いい座り心地だわ～\n腕のいい職人の仕事ね\nうちでも扱いたいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4630, 3, 3, 1, 0, 114501, 1, 0, "かわいい！\n子どもたちに\nプレゼントしたら\n喜んでくれるかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4631, 4, 3, 1, 0, 114501, 1, 0, "華やかな香りね\nクリスマスに\nピッタリだわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4632, 5, 3, 1, 0, 114501, 1, 0, "寒い日にはやっぱり\nこれよね…\nはぁ、極楽極楽♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4634, 7, 3, 1, 0, 114501, 1, 0, "んー、おいしいわ！\n焼きそばパン味の\nものも、作れない\nかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4635, 8, 3, 1, 0, 114501, 1, 0, "たまにはのんびり\n読書でも…なんだか\nラブロマンスばかりね\nクリスマスだから？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4637, 14, 3, 1, 0, 114501, 1, 0, "これ、面白いわね！\n子どもたちの\nプレゼントに\nピッタリだわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4638, 15, 3, 1, 0, 114501, 1, 0, "こんないい毛並み\n初めて見るわ…\n一体どこで手に\n入るのかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4639, 1, 1, 1, 0, 114701, 1, 0, "アタシもみんなと\n一緒に正月を\n楽しんでいいのか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4640, 2, 1, 1, 0, 114701, 1, 0, "今年こそ、もう少し\n身長が伸びます\nように…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4641, 3, 1, 1, 0, 114701, 1, 0, "げっ！　お年玉が\n全然残ってないぞ！？\nそんな、嘘だろ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4642, 4, 1, 1, 0, 114701, 1, 0, "大勢で過ごす\n正月か…初めてだけど\n悪くないもんだな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4643, 5, 1, 1, 0, 114701, 1, 0, "んー…ここじゃ\n天楼覇断剣の\n出番はなさそうだな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4644, 101, 1, 4, 0, 114701, 1, 0, "アイツらと作る\n戦い以外の思い出も\nもっと増やしたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4645, 102, 1, 8, 0, 114701, 1, 0, "こんなに賑やかな\n正月は初めてだ\n…温かくて、いいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4646, 1, 2, 1, 0, 114701, 1, 0, "記憶がなくったって\n楽しい思い出は\n新しく作れるよな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4647, 2, 2, 1, 0, 114701, 1, 0, "早くでかけるぞ！\nアタシはもっと\n正月を楽しみたい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4648, 3, 2, 1, 0, 114701, 1, 0, "なあ、オマエはもう\nノウェムって名前\n覚えてくれたよな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4649, 4, 2, 1, 0, 114701, 1, 0, "この服、アタシに\n似合ってるのか？\n…そっか。\nありがとな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4650, 101, 2, 4, 0, 114701, 1, 0, "オマエらと見た朝日は\nきっと忘れないぞ！\n思い出ができたな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4651, 102, 2, 8, 0, 114701, 1, 0, "いつかオクトーも\n一緒に、みんなで\n正月を過ごせたらな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4652, 1, 2, 1, 0, 114701, 1, 1, "朝から元気だな！\nアタシもいっちょ\n見習ってみるか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4653, 2, 2, 1, 0, 114701, 1, 2, "昼飯は何にする？\n正月はうまいものが\n多くて迷うよな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4654, 3, 2, 1, 0, 114701, 1, 3, "いい夜だな！\nアタシと一緒に\n夜更かしを楽しむか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4656, 2, 3, 1, 0, 114701, 1, 0, "正月らしく、たまには\nゆっくりするのも\nいいかもな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4657, 3, 3, 1, 0, 114701, 1, 0, "なんだ？\nオマエも初詣に\n行きたいのか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4658, 4, 3, 1, 0, 114701, 1, 0, "すーはー…\n神殿のニオイがするな\nいい事ありそうだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4659, 5, 3, 1, 0, 114701, 1, 0, "コイツがあれば\nうまい魚が\n焼けそうだな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4661, 7, 3, 1, 0, 114701, 1, 0, "ううー\n食べ過ぎて帯が\nきつくなってきたぞ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4662, 8, 3, 1, 0, 114701, 1, 0, "おみくじって\n書いてあることが\nむずかしいんだよな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4664, 1, 1, 1, 0, 180101, 1, 0, "困ってる人は\nいないみたいだし…\nちょっとここで、\n特訓しようかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4665, 2, 1, 1, 0, 180101, 1, 0, "空が飛べるんだから\nもっとたくさんの人を\n助けにいけちゃう！\n…ここじゃ飛べないや");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4666, 3, 1, 1, 0, 180101, 1, 0, "炎の翼\nかっこいいなー！\nこれ、もっと大きく\nできないのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4667, 4, 1, 1, 0, 180101, 1, 0, "やっぱり変身すると\nお腹すくんだね…\n…今ならペコさんの\n食欲の理由が分かるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4668, 5, 1, 1, 0, 180101, 1, 0, "色なんかは違うけど…\nマントがあるから\n騎士くんとお揃いに\nなったみたい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4669, 101, 1, 4, 0, 180101, 1, 0, "…騎士くんがいないと\nなんか調子でない…\n早く会いたいよぉ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4670, 102, 1, 8, 0, 180101, 1, 0, "この姿になると、\n騎士くんを近くに\n感じる…なんだろ\nドキドキしちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4671, 1, 2, 1, 0, 180101, 1, 0, "騎士くん騎士くん！\n今大丈夫？\nトレーニングメニュー\n考えるの手伝って！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4672, 2, 2, 1, 0, 180101, 1, 0, "…うにゃっ！？\nこ、この姿になっても\n尻尾は触っちゃ\nダメー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4673, 3, 2, 1, 0, 180101, 1, 0, "もしかして、この服が\n気になってるの？\nだったら、もっと\n近くで見ていいよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4674, 4, 2, 1, 0, 180101, 1, 0, "あ、騎士くん！\n困ってる人がいないか\n見回りに行くんだけど\nついてきて欲しいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4675, 101, 2, 4, 0, 180101, 1, 0, "耳に触りたいの？\nだったら頭もなでて！\nそしたら、好きなだけ\n触っていいよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4676, 102, 2, 8, 0, 180101, 1, 0, "…あたし、強くなって\n騎士くんを守るよ！\nだから…これからも\n一緒にいていい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4677, 1, 2, 1, 0, 180101, 1, 1, "おっはよー！\nさあさあ騎士くん！\n今日も一緒に\nはりきっていこー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4678, 2, 2, 1, 0, 180101, 1, 2, "お昼、お昼～♪\n今日のご飯は何かな～\nあ、騎士くん！\n早くお昼食べ行こ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4679, 3, 2, 1, 0, 180101, 1, 3, "今日もお疲れ様ー！\n騎士くん、あたしが\nマッサージしよっか？\n結構評判なんだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4681, 2, 3, 1, 0, 180101, 1, 0, "うにゃぁ…\nこの気持ちよさ…\n溶けちゃいそう…\nにゃぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4682, 3, 3, 1, 0, 180101, 1, 0, "か、かわいい～\nこれ、なでなで\nしていいんだよね…？\nよしよし…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4683, 4, 3, 1, 0, 180101, 1, 0, "とってもいい香り！\n気分も落ち着くし、\n特訓の後なんかに\nいいかもー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4684, 5, 3, 1, 0, 180101, 1, 0, "ぬくぬくだぁ…\nなんだか、\nふにゃふにゃに\nなっちゃうよぉ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4686, 7, 3, 1, 0, 180101, 1, 0, "お、おいひぃ…！\nこの姿になると\nお腹すくし、すっごく\n助かっちゃった！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4687, 8, 3, 1, 0, 180101, 1, 0, "この本で勉強して、\nぶんぶりょーどーの\n超ウルトラヒヨリに\nなっちゃうぞー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4689, 1, 1, 1, 0, 111801, 1, 0, "今年もみんなで\nおいしいものを\nたくさん食べたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4690, 2, 1, 1, 0, 111801, 1, 0, "挑戦は大切ですよね☆\nというわけで\nおせちに魔物を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4691, 3, 1, 1, 0, 111801, 1, 0, "おせちは縁起物です！\n食べれば食べるほど\n幸せになるはずです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4692, 4, 1, 1, 0, 111801, 1, 0, "食べ物がたくさん\n入った福袋は\nないんでしょうか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4693, 5, 1, 1, 0, 111801, 1, 0, "初詣で何を\nお願いしましょう…\n五穀豊穣？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4694, 101, 1, 4, 0, 111801, 1, 0, "ずっとこうして\n年の始まりを\n過ごしたいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4695, 102, 1, 8, 0, 111801, 1, 0, "いつか二人きりで\n初日の出を\n見たいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4696, 1, 2, 1, 0, 111801, 1, 0, "お餅おかわりです！\nいくらでも\n食べられますよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4697, 2, 2, 1, 0, 111801, 1, 0, "おせちの食材を\n取りに行きませんか？\nいい運動です☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4698, 3, 2, 1, 0, 111801, 1, 0, "凧揚げって\n難しいですね～\n糸が絡まっちゃいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4699, 4, 2, 1, 0, 111801, 1, 0, "一年の計は元旦にあり\n今年一年分の\n献立を作りましょう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4700, 101, 2, 4, 0, 111801, 1, 0, "ほらほら！\nもっと近くで着物を\n見ていいんですよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4701, 102, 2, 8, 0, 111801, 1, 0, "あなたはどんな\n初夢を見ましたか？\nわたしは…内緒です☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4702, 1, 2, 1, 0, 111801, 1, 1, "年明けの朝は\n心なしか\n気持ちいいですね☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4703, 2, 2, 1, 0, 111801, 1, 2, "お雑煮のあとは\nおしるこで\nおやつタイムです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4704, 3, 2, 1, 0, 111801, 1, 3, "あたたかくして\n幸せな初夢を\n見ましょうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4706, 2, 3, 1, 0, 111801, 1, 0, "はぁ～屋台巡りを\n満喫しました☆\n一休み一休み");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4707, 3, 3, 1, 0, 111801, 1, 0, "縁起のいい\nぬいぐるみを並べて\n福を呼びましょう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4708, 4, 3, 1, 0, 111801, 1, 0, "おしるこのアロマって\nないんでしょうか？\nそれなら作るしか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4709, 5, 3, 1, 0, 111801, 1, 0, "ここでお餅を\n焼いたらおいしく\nなりそうですね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4711, 7, 3, 1, 0, 111801, 1, 0, "おいしすぎて\n食べる手が\n止まりません～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4712, 8, 3, 1, 0, 111801, 1, 0, "新しいおせち料理の\nヒントは…なるほど…\nふむふむ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4714, 103, 1, 12, 0, 100601, 1, 0, "お兄ちゃんとあんな\n特訓やこんな特訓が\nしたいなぁ、えへへ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4715, 103, 2, 12, 0, 100601, 1, 0, "お兄ちゃんに褒めて\nもらうと、身体が\nじぃーんと\n熱くなっちゃいます♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4716, 1, 1, 1, 0, 115001, 1, 0, "見目麗しい衣装に\n身を包むのも\n悪い気分では\nありませんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4717, 2, 1, 1, 0, 115001, 1, 0, "縁起物で\n験を担ぐというのも\nたまにはよいでしょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4718, 3, 1, 1, 0, 115001, 1, 0, "非効率なので\nあまり行いませんが\n私も手料理くらいは\n作れるのですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4719, 4, 1, 1, 0, 115001, 1, 0, "研究のためなら\n時に遠路を超え\n実地へ赴くことも\n必要なのです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4720, 5, 1, 1, 0, 115001, 1, 0, "トゥンヌスの\n突然変異…\n大いに興味を\nそそられますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4721, 101, 1, 4, 0, 115001, 1, 0, "漁師の技法も\n再現できたことで\nまた一つ、仮説が\n実証できました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4722, 102, 1, 8, 0, 115001, 1, 0, "正月くらいは\n私ものんびりしたい\n気持ちなのですよ\n意外ですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4723, 1, 2, 1, 0, 115001, 1, 0, "模倣に頼らずとも\n衣装に合わせた\n所作程度は\nできて当然です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4724, 2, 2, 1, 0, 115001, 1, 0, "お年玉の使い道は\n思いつきましたか\nゆっくり考えても\nいいのですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4725, 3, 2, 1, 0, 115001, 1, 0, "トランプでも花札でも\n相手をしましょう\n手心が必要なら\nいつでも言いなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4726, 4, 2, 1, 0, 115001, 1, 0, "初詣でお祈りする\n内容ですか\n…ヒミツ、として\nおきましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4727, 101, 2, 4, 0, 115001, 1, 0, "私たちでオーマ中の\nトゥンヌスを\n釣り上げましょうか\n…冗談ですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4728, 102, 2, 8, 0, 115001, 1, 0, "見返りを求めない願い\nそれは祈りに通じるの\nかもしれませんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4729, 1, 2, 1, 0, 115001, 1, 1, "…貴方がその眠たげな\n顔を洗ってくる間に、\n温かいお茶でも\n淹れておきましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4730, 2, 2, 1, 0, 115001, 1, 2, "さて、本格的に\n活動を再開します\n貴方も同行しなさい\n昼食は済みましたか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4731, 3, 2, 1, 0, 115001, 1, 3, "私はもう少し\n作業を片付けてから\n寝ることにします\n早く眠りなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4733, 2, 3, 1, 0, 115001, 1, 0, "少し休みます…\n時間が来たら\n起こすように");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4734, 3, 3, 1, 0, 115001, 1, 0, "贈り物を模倣して\n潜入…試してみる\n価値はありそうですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4735, 4, 3, 1, 0, 115001, 1, 0, "嗅覚から得られる\n情報量は侮れません\n動物の模倣において\n注意すべき点ですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4736, 5, 3, 1, 0, 115001, 1, 0, "穏やかな炎による\nリラックス効果は\n本能によるものかも\nしれませんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4738, 7, 3, 1, 0, 115001, 1, 0, "いかなる強者でも\n兵站、補給は\n必要なものです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4739, 8, 3, 1, 0, 115001, 1, 0, "あらゆる学問は\n完璧な模倣のための\n大きな礎となります");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4741, 1, 1, 1, 0, 115501, 1, 0, "新たに得たこの力で\n仲間と目指す未来を\n切り拓いてみせます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4742, 2, 1, 1, 0, 115501, 1, 0, "ここは、みなさまと…\nわたくしの\n帰る場所でございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4743, 3, 1, 1, 0, 115501, 1, 0, "主さまも精霊の召喚を\n試してみますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4744, 4, 1, 1, 0, 115501, 1, 0, "主さま、おこづかいは\n足りていますか？\n遠慮は無用ですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4745, 5, 1, 1, 0, 115501, 1, 0, "この装束をまとうと\n自然と背筋が伸びる\n思いがいたします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4746, 101, 1, 4, 0, 115501, 1, 0, "進化した精霊に\n負けぬよう\n修行に励みます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4747, 102, 1, 8, 0, 115501, 1, 0, "仲間たちといられる\nこの幸せが、末永く\n続きますように…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4748, 1, 2, 1, 0, 115501, 1, 0, "主さまのお手手は\n大きくて温かいですね\nぎゅっぎゅっ…ふふ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4749, 2, 2, 1, 0, 115501, 1, 0, "今度、主さまにも\n里に伝わる昔話を\nお話しいたしましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4750, 3, 2, 1, 0, 115501, 1, 0, "里で採れた果物を\n持って参りました\n召し上がってください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4751, 4, 2, 1, 0, 115501, 1, 0, "里のお土産を\nここのみなさまに\nお配りいたしましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4752, 101, 2, 4, 0, 115501, 1, 0, "仲間と囲む食卓…この\n温もりは、みなさまの\n心の温かさなのですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4753, 102, 2, 8, 0, 115501, 1, 0, "主さまに名前を\n呼んでいただくと\n心が温かくなります♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4754, 1, 2, 1, 0, 115501, 1, 1, "ふふっ…主さま\n寝癖がついて\nおりますよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4755, 2, 2, 1, 0, 115501, 1, 2, "今日の昼食は\n里の伝統料理です\nお口に合うでしょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4756, 3, 2, 1, 0, 115501, 1, 3, "主さまが眠れるよう\n安らぎの風を…\nおやすみなさいませ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4758, 2, 3, 1, 0, 115501, 1, 0, "この癒し…\n主さまにも味わって\nいただきたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4759, 3, 3, 1, 0, 115501, 1, 0, "この愛らしさ…\n精霊たちと似たものを\n感じます…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4760, 4, 3, 1, 0, 115501, 1, 0, "精霊よ…この安らぐ\n香りを、隅々まで\n届けてくださいまし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4761, 5, 3, 1, 0, 115501, 1, 0, "瞑想するのに\nちょうどよい暖かさで\nございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4763, 7, 3, 1, 0, 115501, 1, 0, "進化した精霊を\n使役するためにも\nよく食べて体力を…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4764, 8, 3, 1, 0, 115501, 1, 0, "風の精霊について\nもっと詳しく知って\nおかなければ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4766, 1, 1, 1, 0, 115601, 1, 0, "儀式の時を思い出して\n精霊に呼びかける…\n出ておいで～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4767, 2, 1, 1, 0, 115601, 1, 0, "ひゃうっ！　もう…\n急に背中を触るなんて\nいたずら好きな精霊に\n育てた覚えはないのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4768, 3, 1, 1, 0, 115601, 1, 0, "儀式用の衣装…\nあんまり激しい動きは\nできないよね…でも\n戦う時は気にしない！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4769, 4, 1, 1, 0, 115601, 1, 0, "そうだ…精霊に\n騎士クンのそばで\n見守っていてって\n頼んでみようかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4770, 5, 1, 1, 0, 115601, 1, 0, "ふふっ、こうやって、\n楽しく精霊とお話し\nしていられる、平穏な\n日々が続くといいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4771, 101, 1, 4, 0, 115601, 1, 0, "き、きき、騎士クン！\nわたしと、あの…！\nうう…練習ですら\n上手く誘えないよぉ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4772, 102, 1, 8, 0, 115601, 1, 0, "あっ、精霊が…\nふふ、応援ありがとう\nわたしの想い…いつか\n必ず伝えるね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4773, 1, 2, 1, 0, 115601, 1, 0, "新しく覚えた料理\n作ってみたんだけど\n騎士クンも食べない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4774, 2, 2, 1, 0, 115601, 1, 0, "騎士クン、\n疲れてない？\nわたしと精霊で\n治療するよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4775, 3, 2, 1, 0, 115601, 1, 0, "もう、いたずらしない\n…騎士クン！？\nご、ごめんなさい！\n精霊だと思って！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4776, 4, 2, 1, 0, 115601, 1, 0, "騎士クン！\n時間が合ったら、\n精霊と一緒に\nお話しない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4777, 101, 2, 4, 0, 115601, 1, 0, "…こういう服着るの\n初めてなんだけど…\nえっ、かわいい…？\nあ、ありがとう…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4778, 102, 2, 8, 0, 115601, 1, 0, "困ったことがあったら\n相談してね。わたし、\n騎士クンのためなら…\n色々できるよ、色々！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4779, 1, 2, 1, 0, 115601, 1, 1, "おはよう騎士クン！\n今からお外で\n瞑想するんだけど…\n騎士クンもどうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4780, 2, 2, 1, 0, 115601, 1, 2, "お昼の時間だ\nご飯ならわたしが\n用意するから\nゆっくりしてて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4781, 3, 2, 1, 0, 115601, 1, 3, "もうこんな時間…\n騎士クン、はいどうぞ\n寝る前の温かいミルク\nぐっすり眠れるよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4783, 2, 3, 1, 0, 115601, 1, 0, "…うん、落ち着く\n精霊との魔法で\nこんな風に誰かを\n安心させたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4784, 3, 3, 1, 0, 115601, 1, 0, "かわいい…\n精霊も気に入ってる…\nそうだ、同じ物\n作ってあげようかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4785, 4, 3, 1, 0, 115601, 1, 0, "いい香り…これ、\nうちに置いたら、\nお母さん喜ぶかも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4786, 5, 3, 1, 0, 115601, 1, 0, "あったかい…\nまるで誰かが\n抱きしめてくれた\nみたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4788, 7, 3, 1, 0, 115601, 1, 0, "自然の恵みに\n感謝して…\nいただきます♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4789, 8, 3, 1, 0, 115601, 1, 0, "もっと精霊について\n勉強して、みんなを\n守れるように\nなりたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4791, 103, 1, 12, 0, 102201, 1, 0, "アイツといると胸が\nぎゅーっとなる…\nこれってもしかして…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4792, 103, 2, 12, 0, 102201, 1, 0, "アンタとならきっと\nどんなゲームでも…\nそ、その、たた、\n楽しいって思えるわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4793, 1, 1, 1, 0, 106401, 1, 0, "色んな人と話したら\n記憶探しの手がかりが\n見つかるかも…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4794, 2, 1, 1, 0, 106401, 1, 0, "アイスクリームでも\n作ろうかしら？\nバニラにミントに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4795, 3, 1, 1, 0, 106401, 1, 0, "ネビアに話しかけると\n逃げられるのよね…\nもう、襲わないのに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4796, 4, 1, 1, 0, 106401, 1, 0, "「コッコロさん」、\n「コッコロさん」…\n…間違えないように…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4797, 5, 1, 1, 0, 106401, 1, 0, "最近少し太ったかも？\nきっとおいしいもの、\n食べ過ぎね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4798, 101, 1, 4, 0, 106401, 1, 0, "ここにいると、\nとても落ち着くわ…\n自分の家、だものね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4799, 102, 1, 8, 0, 106401, 1, 0, "みんなと一緒の時間、\nずっと記憶に残したい\n…そう思っているのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4800, 1, 2, 1, 0, 106401, 1, 0, "ドラゴン族って、\nそんなに珍しいの？\nあまり実感ないけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4801, 2, 2, 1, 0, 106401, 1, 0, "料理、練習してるのよ\n…味見してもらえる？\n期待はしないでね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4802, 3, 2, 1, 0, 106401, 1, 0, "頭を叩いたら、\n記憶が戻ったり\nしないかしら…？\nやらなくていいわよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4803, 4, 2, 1, 0, 106401, 1, 0, "赤ちゃんみたいだった\n時のことは、忘れて…\nお願いだから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4804, 101, 2, 4, 0, 106401, 1, 0, "ひゃんっ！？\nし、しっぽを掴むのは\nダメよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4805, 102, 2, 8, 0, 106401, 1, 0, "記憶が戻っても…\n私は、あなたたちと\n一緒にいたいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4806, 1, 2, 1, 0, 106401, 1, 1, "おはよう。\n寝ぐせついてるわよ？\n…ふふっ、これでよし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4807, 2, 2, 1, 0, 106401, 1, 2, "そろそろお昼かしら？\nおいしいごはんを、\nみんなで一緒に…ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4808, 3, 2, 1, 0, 106401, 1, 3, "もうこんな時間ね。\nそろそろ休みましょ？\n…ふわぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4810, 2, 3, 1, 0, 106401, 1, 0, "ふかふか、ぎゅう～…\n…あっ、これはその…\nストレッチしててっ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4811, 3, 3, 1, 0, 106401, 1, 0, "あまり、興味ないわ。\nけど…けど…\n…か、かわいい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4812, 4, 3, 1, 0, 106401, 1, 0, "いい香りね。\nとっても落ち着くわ…\n…っくしゅっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4813, 5, 3, 1, 0, 106401, 1, 0, "冷やす方が得意だけど\nあったかいのも、\nキライじゃないのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4815, 7, 3, 1, 0, 106401, 1, 0, "別に、食いしん坊\nじゃないのよ？\nでも、もう一口だけ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4816, 8, 3, 1, 0, 106401, 1, 0, "ん…なるほどね。\n勉強になるわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4818, 1, 1, 1, 0, 115701, 1, 0, "水着の探偵か…\nちょっと恥ずかしい\n気がしてきたよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4819, 2, 1, 1, 0, 115701, 1, 0, "依頼があれば\n海でも山でも\n赴くさ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4820, 3, 1, 1, 0, 115701, 1, 0, "今のうちに\n助手くんの秘密を…\nわ…私はなにをっ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4821, 4, 1, 1, 0, 115701, 1, 0, "休暇も時には必要さ\n海でゆっくりと…\nむっ？　事件の気配！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4822, 5, 1, 1, 0, 115701, 1, 0, "探偵の秘密道具…\n水着だと隠す\n場所がない…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4823, 101, 1, 4, 0, 115701, 1, 0, "そろそろ助手くんが\n現れる時間かな？\nふふっ、楽しみだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4824, 102, 1, 8, 0, 115701, 1, 0, "真実は私と助手くん\n二人だからこそ\n解き明かせるのさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4825, 1, 2, 1, 0, 115701, 1, 0, "ひゃああっ！？\nわ、私の不意を突く\nとは…やるね助手くん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4826, 2, 2, 1, 0, 115701, 1, 0, "さて、なにか気づいた\nことはあるかな？\n言ってごらん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4827, 3, 2, 1, 0, 115701, 1, 0, "この感触…分かった！\n助手くんだね！\nふふっ、やっぱり♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4828, 4, 2, 1, 0, 115701, 1, 0, "水着…どうかな？\n探偵らしさは\n残してるつもりだけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4829, 101, 2, 4, 0, 115701, 1, 0, "ん？　依頼かな？\n助手くんの頼みなら\nなんでもお安い御用さ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4830, 102, 2, 8, 0, 115701, 1, 0, "助手くん、私と海に\n行かないかな\n…事件じゃないよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4831, 1, 2, 1, 0, 115701, 1, 1, "珈琲でも淹れて\n目を覚ますとしよう\n一緒に飲むかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4832, 2, 2, 1, 0, 115701, 1, 2, "昼食は済ませた？\nなにを食べたか\n当ててあげよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4833, 3, 2, 1, 0, 115701, 1, 3, "夜は謎が深まる時間…\n闇に覆い隠された真実\n必ず暴いてみせる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4835, 2, 3, 1, 0, 115701, 1, 0, "さて、推理の時間だ\n…サボってないよ？\n考えてるんだからね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4836, 3, 3, 1, 0, 115701, 1, 0, "これはもしや、中に\n秘密のメッセージが？\n…かわいいだけだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4837, 4, 3, 1, 0, 115701, 1, 0, "ふむ、なんだか\n頭がスッキリするね\n…閃いた！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4838, 5, 3, 1, 0, 115701, 1, 0, "ポカポカするね…\n助手くん\n君もおいでよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4840, 7, 3, 1, 0, 115701, 1, 0, "はむ、はむ…んぐっ\nた、食べてるところを\n見つめられると～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4841, 8, 3, 1, 0, 115701, 1, 0, "秘密の依頼とか\nこういう場所に\n隠したりするよね…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4843, 10, 3, 1, 0, 115701, 1, 0, "これはいい乗り心地だ\n事件現場にこれで登場\n…は、やめておこう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4844, 11, 3, 1, 0, 115701, 1, 0, "不思議な感触だね…\nでも、いい発想が\n生まれてきそうだ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4845, 1, 1, 1, 0, 180601, 1, 0, "これはあたしが\n前へ進むために\nあいつがくれた\n大切な力…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4846, 2, 1, 1, 0, 180601, 1, 0, "チェンジ・\nプリンセスフォーム！\n練習練習、っと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4847, 3, 1, 1, 0, 180601, 1, 0, "もうあいつに助けて\nもらいっぱなしの\nあたしは…\n卒業しなきゃね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4848, 4, 1, 1, 0, 180601, 1, 0, "気ままに、お気楽に\nあいつと冒険する…\nそれって幸せよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4849, 5, 1, 1, 0, 180601, 1, 0, "プリンセスフォーム…\nお姫様みたいね\nあたしがお姫様か…\nそっかぁ…ふふ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4850, 101, 1, 4, 0, 180601, 1, 0, "あいつと繋がって\n生まれたこの絆は\nあたしの宝物だわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4851, 102, 1, 8, 0, 180601, 1, 0, "あたしの命の使い方…\n全て受け止めてくれた\nあいつにだったら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4852, 1, 2, 1, 0, 180601, 1, 0, "ふふ～ん♪\nプリンセスフォームの\n天才魔法使い\nキャル様に用かしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4853, 2, 2, 1, 0, 180601, 1, 0, "これからは\nあたしの力で\nなんでもパパっと\n解決してあげるわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4854, 3, 2, 1, 0, 180601, 1, 0, "魔力がみなぎってる…\nねえ、もしかして\n今のあたしって本気で\nすごいんじゃない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4855, 4, 2, 1, 0, 180601, 1, 0, "変身の反動で\nお腹が空いても\n魔物料理だけは\nいやだからね！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4856, 101, 2, 4, 0, 180601, 1, 0, "ねぇ、あんたになら\nあたしの心…\n全部預けていいかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4857, 102, 2, 8, 0, 180601, 1, 0, "あいつと一緒に\nいられたら、他には\n何も…って、あああ\nあんたいつの間に！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4858, 1, 2, 1, 0, 180601, 1, 1, "早起きも悪くないわね\n読みかけの魔導書\n今のうちに\n読んじゃおうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4859, 2, 2, 1, 0, 180601, 1, 2, "ねぇ～お腹すいたー\nあんたなんか\n作りなさいよ\n魔物料理以外でね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4860, 3, 2, 1, 0, 180601, 1, 3, "ふぁぁ…眠すぎて\n今なら変身しても\nお腹が減らない\n自信があるわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4862, 2, 3, 1, 0, 180601, 1, 0, "あー♪　最っ高！\n休んで魔力を高めて…\nあいつの役に\n立ってあげなきゃね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4863, 3, 3, 1, 0, 180601, 1, 0, "なにこれかわいい…！\nコレクションにしたく\nなっちゃうじゃない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4864, 4, 3, 1, 0, 180601, 1, 0, "この香り…すごく\nリラックスできるわ…\nあ、いい感じの魔法\n思いついちゃったかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4865, 5, 3, 1, 0, 180601, 1, 0, "あったかい…\n落ち着くわ…\nあいつの手の\nぬくもりみたいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4867, 7, 3, 1, 0, 180601, 1, 0, "プリンセスフォーム…\nこ、こんなに\nお腹が減るのね\n甘く見てたわ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4868, 8, 3, 1, 0, 180601, 1, 0, "ま、魔物料理の本！？\n誰よこんな本\n買ったの！　って…\n一人しかいないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4870, 1, 1, 1, 0, 115801, 1, 0, "憧れの舞踏会…\n私、きちんと\n踊れるかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4871, 2, 1, 1, 0, 115801, 1, 0, "アン・ドゥ・トロワ\nアン・ドゥ・トロワ\n練習はばっちりね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4872, 3, 1, 1, 0, 115801, 1, 0, "こんなにすてきな\nドレスを着られて\n本当に夢みたいだわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4873, 4, 1, 1, 0, 115801, 1, 0, "魔法はいつか解ける…\nでも、その時間は心に\n残り続けるわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4874, 5, 1, 1, 0, 115801, 1, 0, "ガラスの靴は夢へ\n踏み出す魔法の道具…\n私、がんばっちゃう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4875, 101, 1, 4, 0, 115801, 1, 0, "舞踏会であなたと\n一緒に踊れたら\nいいのにな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4876, 102, 1, 8, 0, 115801, 1, 0, "舞踏会に行く前に\n運命の王子様には\n出会ってるのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4877, 1, 2, 1, 0, 115801, 1, 0, "どうかしら？\n私、きちんとドレス\n着られてる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4878, 2, 2, 1, 0, 115801, 1, 0, "あなたも一緒に\n踊ってみる？\nしゃなりしゃなり♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4879, 3, 2, 1, 0, 115801, 1, 0, "あなたにエスコート\nされてきれいなお城を\n歩いてみたいわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4880, 4, 2, 1, 0, 115801, 1, 0, "どう？　レッスンの\n成果はきちんと\n出てるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4881, 101, 2, 4, 0, 115801, 1, 0, "あなたが隣にいれば\n私も立派なお姫様に\n見えるかしら♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4882, 102, 2, 8, 0, 115801, 1, 0, "私にとって\n一番の魔法はあなたが\nくれる勇気よ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4883, 1, 2, 1, 0, 115801, 1, 1, "さぁ！　今日も一日\n立派な淑女を目指して\nいきましょう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4884, 2, 2, 1, 0, 115801, 1, 2, "お昼ごはん代わりに\nメタモルアップルを\n食べておきましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4885, 3, 2, 1, 0, 115801, 1, 3, "そろそろ魔法が解ける\n時間…でも淑女の\n心得は忘れないわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4887, 2, 3, 1, 0, 115801, 1, 0, "淑女にも休息は\n必要よね…少しだけ\n休ませてもらおっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4888, 3, 3, 1, 0, 115801, 1, 0, "かわいいものに\n囲まれた部屋も\n女の子の夢よね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4889, 4, 3, 1, 0, 115801, 1, 0, "すてきな香り…\nお花かしら？\n森で探してみようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4890, 5, 3, 1, 0, 115801, 1, 0, "暖かい…暖炉のそばで\nおとぎ話を聞くのも\nいいわよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4892, 7, 3, 1, 0, 115801, 1, 0, "レッスンのために\n栄養補給して\nおかないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4893, 8, 3, 1, 0, 115801, 1, 0, "教養を身に着ける\nことも大切よね！\nなになに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4895, 1, 1, 1, 0, 115901, 1, 0, "や、やっぱスカートは\n落ち着かねえな…\nなんか、\nスースーするしよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4896, 2, 1, 1, 0, 115901, 1, 0, "せっかくこんな格好\nしてるし、いつもとは\n違う剣術の訓練を\nしてみるかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4897, 3, 1, 1, 0, 115901, 1, 0, "さて、他の連中が\n帰ってくる前に、\nなんか料理でも\n作っといてやるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4898, 4, 1, 1, 0, 115901, 1, 0, "こ、こんな服着てる\nわけだし、紅茶とか\n楽しんじゃっても\n変じゃないよな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4899, 5, 1, 1, 0, 115901, 1, 0, "暇だし運動でも…\nあ、あぶねえ！\nスカートなの忘れてた\n…誰も見てねえよな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4900, 101, 1, 4, 0, 115901, 1, 0, "紅茶が切れてるな…\nよし、あいつと一緒に\n買い物にでも行くか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4901, 102, 1, 8, 0, 115901, 1, 0, "…あいつがいねえと、\nつまんねえな…ったく\n飯用意してやるから、\n早く帰ってこいよな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4902, 1, 2, 1, 0, 115901, 1, 0, "あ、あんまり\nジロジロ見んなよ\n…結構、\n恥ずかしいんだからな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4903, 2, 2, 1, 0, 115901, 1, 0, "ダンスの相手は\n無理だが、\n剣の訓練なら\nいつでも付き合うぜ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4904, 3, 2, 1, 0, 115901, 1, 0, "この服に\n触りたいのか？\nすごい作りだし、\n気持ちは分かるぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4905, 4, 2, 1, 0, 115901, 1, 0, "お、いいところに！\nクッキーを焼く\nところだったんだが、\nおまえも食うか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4906, 101, 2, 4, 0, 115901, 1, 0, "おまえにもこういう服\n似合うんじゃねえか？\n今度あたしが\n選んでやるよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4907, 102, 2, 8, 0, 115901, 1, 0, "…おまえの前でなら、\nこういう格好を\nすんのも…\nな、なんでもねえよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4908, 1, 2, 1, 0, 115901, 1, 1, "朝の訓練を始めるか\n時間あるなら、\nおまえも付き合えよな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4909, 2, 2, 1, 0, 115901, 1, 2, "もうこんな時間か…\n昼飯作るけど、\nなんか\n食いたいものあるか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4910, 3, 2, 1, 0, 115901, 1, 3, "眠れないなら、\nホットミルク飲むか？\n体あったまって、\n眠くなると思うぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4912, 2, 3, 1, 0, 115901, 1, 0, "ちょっと休憩して…\nおっと、服にしわが\nできないように\nしねえとな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4913, 3, 3, 1, 0, 115901, 1, 0, "だ、誰も\n見てねえよな？\n…よ～しよしよし、\nかわいいなおまえー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4914, 4, 3, 1, 0, 115901, 1, 0, "すげぇいい香りだな\nうちの居酒屋にも…\nいや、合わねえか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4915, 5, 3, 1, 0, 115901, 1, 0, "あったけぇ…\nちょっとだけなら、\n寝ちまっても\nいいよな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4917, 7, 3, 1, 0, 115901, 1, 0, "これうめえな！\nたぶん材料は…よし！\nあたしも作ってみるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4918, 8, 3, 1, 0, 115901, 1, 0, "この本は…\n誰でも分かる作法…か\n最低限このぐらいは\n勉強しとくか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4920, 103, 1, 12, 0, 102001, 1, 0, "ミミがおとなに\nなっても\nおにいちゃんとは\nずーっといっしょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4921, 103, 2, 12, 0, 102001, 1, 0, "ミミとくべつなだっこ\nしてほしいな…うん！\nおひめさまだっこ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4922, 103, 1, 12, 0, 100401, 1, 0, "次はにいちゃんに\nどんなイタズラしよう\n早く会いたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4923, 103, 2, 12, 0, 100401, 1, 0, "ミソギの特別な\nイタズラ見てくれる？\nいいよねっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4924, 103, 1, 12, 0, 103601, 1, 0, "大人になったら、\nあの人と何しようかな\n…楽しみだなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4925, 103, 2, 12, 0, 103601, 1, 0, "頭を撫でないで\nください！　もう、\n少しだけ、ですからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4926, 1, 1, 1, 0, 116001, 1, 0, "くるくる〜♪\nうちのドレス\nかわええなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4927, 2, 1, 1, 0, 116001, 1, 0, "日差しは苦手やけど\nたまにはひなたの下で\nぽかぽかしたいわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4928, 3, 1, 1, 0, 116001, 1, 0, "外はお花が咲いてる\n久しぶりにお花を\n活けたいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4929, 4, 1, 1, 0, 116001, 1, 0, "お花をたくさん集めて\nギルドハウスに飾れば\n喜んでくれはるかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4930, 5, 1, 1, 0, 116001, 1, 0, "あたたかい日は\n紅茶を飲みながら\nゆっくりしたいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4931, 101, 1, 4, 0, 116001, 1, 0, "お稽古事を始めるなら\nうちに言ってな\nどんなことも教えたる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4932, 102, 1, 8, 0, 116001, 1, 0, "うちにいろんな夢を\n見せてくれはって\nほんま、おおきにな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4933, 1, 2, 1, 0, 116001, 1, 0, "王子はん\n一緒におとぎの国へ\nお散歩にいきまひょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4934, 2, 2, 1, 0, 116001, 1, 0, "ふんふんふ〜ん♪\n今な、王子はんに\n花冠を作ってるんよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4935, 3, 2, 1, 0, 116001, 1, 0, "王子はんは\nお菓子好きどす？\nうち、作りますわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4936, 4, 2, 1, 0, 116001, 1, 0, "うーん。ドレスの柄は\nお花とお星さま\nどっちにしまひょか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4937, 101, 2, 4, 0, 116001, 1, 0, "王子はんとの\n思い出が増えるたび\nうちの宝物も増えます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4938, 102, 2, 8, 0, 116001, 1, 0, "王子はんと一緒なら\nどんな場所でも\n夢の国になりますわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4939, 1, 2, 1, 0, 116001, 1, 1, "夢の中におりたいけど\n王子はんに会いたくて\n起きてもうたわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4940, 2, 2, 1, 0, 116001, 1, 2, "王子はん一緒に\nアフタヌーンティー\nいかがやろか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4941, 3, 2, 1, 0, 116001, 1, 3, "夜の舞踏会…\n夢が広がるわぁ\nもちろんお相手は…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4943, 2, 3, 1, 0, 116001, 1, 0, "ふわふわや〜\nなんや心地よぉて\n眠ってしまいそうや…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4944, 3, 3, 1, 0, 116001, 1, 0, "かいらしいなぁ\n新しいお洋服でも\n作ってあげまひょか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4945, 4, 3, 1, 0, 116001, 1, 0, "お花やろうか…\nリラックスできて\nええ香りやねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4946, 5, 3, 1, 0, 116001, 1, 0, "こういう場所で\n絵本を読むと\n気分が出てええなぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4948, 7, 3, 1, 0, 116001, 1, 0, "舞踏会を楽しむなら\nたくさん食べて\nたくさん踊りまひょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4949, 8, 3, 1, 0, 116001, 1, 0, "うち、この本好きや\n王子さまと結ばれる\nお姫さまのお話なんよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4951, 1, 1, 1, 0, 116301, 1, 0, "はぁ、宿題めんどい…\nこれは楽しくない…\nこんな青春いらない…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4952, 2, 1, 1, 0, 116301, 1, 0, "奨学金の道は遠いなぁ\nメルクリちゃんたちが\nお金くれればいいのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4953, 3, 1, 1, 0, 116301, 1, 0, "アオイちゃん元気かな\nチエルに会いたくて\n泣いてるんだろうな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4954, 4, 1, 1, 0, 116301, 1, 0, "暇だし鏡でも見るか…\nうわ、顔良っ！\nえ誰この超絶美少女！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4955, 5, 1, 1, 0, 116301, 1, 0, "ワンツーワンツー♪\nうーん…カルミナの\n振りコピ難しいにゃー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4956, 101, 1, 4, 0, 116301, 1, 0, "先輩も運動してます？\nチエルが一緒に走って\nあげてもいいですよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4957, 102, 1, 8, 0, 116301, 1, 0, "来年のテレフェスも\n今から楽しみだなあ…\nまた一緒にお化け屋敷\n入ってくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4958, 1, 2, 1, 0, 116301, 1, 0, "ちぇる～ん☆\nフェス仕様でも\nかわいいちえるん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4959, 2, 2, 1, 0, 116301, 1, 0, "いま話しかけないで！\n来年の聖学祭ライブの\nイメトレ中なんです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4960, 3, 2, 1, 0, 116301, 1, 0, "クロエ先輩のウェア姿\nめっちゃカッコよ！\n思わずおへそ触ったら\nぶたれましたけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4961, 4, 2, 1, 0, 116301, 1, 0, "ユニ先輩の体操着姿…\nあれはあれで実に良き\n一生見てられますよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4962, 101, 2, 4, 0, 116301, 1, 0, "先輩って体操着持って\nないんですか？　ハ？\nチエルのを貸せと…？\nえっ…変態かな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4963, 102, 2, 8, 0, 116301, 1, 0, "テレフェスでは先輩も\n地味に頑張ってました\nね。まあ格好よかった\nんじゃないですか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4964, 1, 2, 1, 0, 116301, 1, 1, "おはちぇる～ん☆\nさあ今日も楽しいを\n探しに行きますよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4965, 2, 2, 1, 0, 116301, 1, 2, "先輩ビッグニュース！\n今からお昼ごはん\nおごらせてあげます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4966, 3, 2, 1, 0, 116301, 1, 3, "こんばんちぇるるん☆\nさあ朝まで楽しいを\n探しに行きますよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4968, 2, 3, 1, 0, 116301, 1, 0, "はぁ…ふかふか～…\n運動の後は…眠たく…\nなり…ま…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4969, 3, 3, 1, 0, 116301, 1, 0, "ユニ先輩に似合いそ！\nいやクロエ先輩かな？\nチエルは当然すぎて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4970, 4, 3, 1, 0, 116301, 1, 0, "やん、いい香り～！\nまるでチエルのために\n存在するみたい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4971, 5, 3, 1, 0, 116301, 1, 0, "この火を使って\n聖火リレーしましょう\n先輩、一本抜いて！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4973, 7, 3, 1, 0, 116301, 1, 0, "あむあむ…ちゃんと\n食べないとユニ先輩\nみたいになっちゃう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4974, 8, 3, 1, 0, 116301, 1, 0, "ふむふむ…ちゃんと\n読まないとクロエ先輩\nみたいになっちゃう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4976, 103, 1, 12, 0, 102901, 1, 0, "今なら書ける気がする\n私の本当の\n想いを込めた\nラブソングを！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4977, 103, 2, 12, 0, 102901, 1, 0, "輝きを増した私を\nいっぱい見てね！\n…ちょ、ちょっと\n見つめすぎだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4978, 1, 1, 1, 0, 116201, 1, 0, "テレフェスかぁー…\nあんまいい記憶ないな\nよし、忘れとこ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4979, 2, 1, 1, 0, 116201, 1, 0, "暇だし鏡でも見るか…\nふふ～ん…いいじゃん\nあ？　何見てんだコラ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4980, 3, 1, 1, 0, 116201, 1, 0, "ワンツー、ワンツー♪\nああクソ、難しいな…\nあ？　何見てんだコラ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4981, 4, 1, 1, 0, 116201, 1, 0, "アオイ元気してるかな\nまた絶叫したり白目\n剥いたりしてんのかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4982, 5, 1, 1, 0, 116201, 1, 0, "ミフユねえさんが\nバイトリーダーしてる\n工場…うちも行くか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4983, 101, 1, 4, 0, 116201, 1, 0, "うーん…今日の晩御飯\n何にすっかなァ…\nあんたも食べてく？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4984, 102, 1, 8, 0, 116201, 1, 0, "来年のテレフェスは\nどーなンだかねえ？\nま、一緒にまた弟の\n相手してやってよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4985, 1, 2, 1, 0, 116201, 1, 0, "体操着なんてフツーに\n着てもつまんないし？\nその辺センス出るよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4986, 2, 2, 1, 0, 116201, 1, 0, "奨学金の道、遠くね？\nアキノ先輩と仲良く\nなった方が早いかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4987, 3, 2, 1, 0, 116201, 1, 0, "あんた体操着は持って\nないの。ハ？　うちの\n貸せって？　いいけど\n…いや、よくねえよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4988, 4, 2, 1, 0, 116201, 1, 0, "にゃんっ！\nや、だからさ…急に\n話しかけんなっての");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4989, 101, 2, 4, 0, 116201, 1, 0, "え、なに？　この服？\nハ？　似合ってる？\n…え、聞こえなかった\nちょ、もっかい言って");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4990, 102, 2, 8, 0, 116201, 1, 0, "あんたもテレフェスで\n一応は頑張ってたよね\nま格好よかったんじゃ\nないの。知んないけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4991, 1, 2, 1, 0, 116201, 1, 1, "ふぁ～あ…おはーす\n昨日も寝たの遅くて\nまだ目がショボだよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4992, 2, 2, 1, 0, 116201, 1, 2, "なに。あんた昼御飯\nまだなの。じゃ、うち\n適当になんか作ろうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4993, 3, 2, 1, 0, 116201, 1, 3, "夜っていいよね。色々\n見えすぎない感じとか\n…この話したっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4995, 2, 3, 1, 0, 116201, 1, 0, "あ、ヤバ…運動の後に\nこのフカついたのは…\n秒でスヤれる…すやぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4996, 3, 3, 1, 0, 116201, 1, 0, "へーこんなんチエルに\n似合いそうじゃん。\n…いやユニ先輩かな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4997, 4, 3, 1, 0, 116201, 1, 0, "お、なんか良さげな\n香りじゃん。これは\n何の…いや分かんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4998, 5, 3, 1, 0, 116201, 1, 0, "熱ッ！　この野郎なに\n爆ぜてンだコラァ！\n濡らすぞ木、てめえ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5000, 7, 3, 1, 0, 116201, 1, 0, "何コレよく分かんない\nけど、今日モヤシしか\n食ってないから助かる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5001, 8, 3, 1, 0, 116201, 1, 0, "今日、体操着だしね。\n読書には逆アドかな。\nうん帰ろ。いやあ残念");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5003, 1, 1, 1, 0, 116501, 1, 0, "ビッグボス・イノリ様\nふっふっふ…\nしびれる響きです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5004, 2, 1, 1, 0, 116501, 1, 0, "いつかお兄さんを\nあたしの側近に\nしてやるですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5005, 3, 1, 1, 0, 116501, 1, 0, "ビッグボスになったら\nみんなからたくさん\nお菓子をもらうです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5006, 4, 1, 1, 0, 116501, 1, 0, "ふふん！\nこの服はあたしにしか\n着こなせませんよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5007, 5, 1, 1, 0, 116501, 1, 0, "ばーんと立って\nどーんと腕を組む！\nこれがボスのポーズ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5008, 101, 1, 4, 0, 116501, 1, 0, "イノリ様の側近に\n選ばれるなんて\n名誉なことですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5009, 102, 1, 8, 0, 116501, 1, 0, "未来の側近として\nあたしをしっかり\n甘やかすですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5010, 1, 2, 1, 0, 116501, 1, 0, "あたしがお兄さんを\n立派なギャングに\nしてあげますからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5011, 2, 2, 1, 0, 116501, 1, 0, "側近たるもの\nボスを甘やかなさいと\nだめですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5012, 3, 2, 1, 0, 116501, 1, 0, "なに見てやがるです…\nくぅ、分かりました！\nお菓子は半分こです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5013, 4, 2, 1, 0, 116501, 1, 0, "お兄さんも\nあたしがボスなら\nうれしいですよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5014, 101, 2, 4, 0, 116501, 1, 0, "お兄さんが側近なら\nあたしも安心して\n夜眠れるですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5015, 102, 2, 8, 0, 116501, 1, 0, "ビッグボスになったら\nお兄さんにいい思い\nさせてあげますから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5016, 1, 2, 1, 0, 116501, 1, 1, "ボスたるもの\n早起きは鉄則ですよ！\nふぁあ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5017, 2, 2, 1, 0, 116501, 1, 2, "お腹が空きました…\nご飯食べにいきますよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5018, 3, 2, 1, 0, 116501, 1, 3, "ボスたるものぉ〜…\n夜更かしぐらい当然…\nぐー…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5020, 2, 3, 1, 0, 116501, 1, 0, "は〜これは人をだめに\nしやがるやつですね\nあたし専用です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5021, 3, 3, 1, 0, 116501, 1, 0, "これはけしからん\nかわいらしさですね\nあたしにぴったりです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5022, 4, 3, 1, 0, 116501, 1, 0, "高級な香りがするです\nボスになったら\n部屋に置いてやるです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5023, 5, 3, 1, 0, 116501, 1, 0, "あったかいですねぇ\nちょっとこのまま\n一休憩です…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5025, 7, 3, 1, 0, 116501, 1, 0, "はむはむ♪\nボスたるもの食べねば\n戦はできませんよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5026, 8, 3, 1, 0, 116501, 1, 0, "ボスなら経済書ぐらい\n…う。難しくて\n読めねーです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5028, 103, 1, 12, 0, 102501, 1, 0, "あなたはドジな私を\n受け入れてくれる…\nだから、頑張れます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5029, 103, 2, 12, 0, 102501, 1, 0, "何でも仰ってください\nちょっぴり大胆な\nことでも…な～んて♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5030, 1, 1, 1, 0, 116601, 1, 0, "あーあー、よし\nのどの調子もいいし\nはりきってガイド\nしてくるか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5031, 2, 1, 1, 0, 116601, 1, 0, "さあ、そろそろ行くか\nガイドが\n遅刻したんじゃ\n話になんないからな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5032, 3, 1, 1, 0, 116601, 1, 0, "しれっとドラゴン族が\n旅行に来たり\nしてくれないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5033, 4, 1, 1, 0, 116601, 1, 0, "たぎるガイド先…\n火山、魔物の巣…\nダメだ、そんなとこ\nオレしか行けないや");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5034, 5, 1, 1, 0, 116601, 1, 0, "この前行った絶景\nスポットよかったな\nキレイな景色を見る\nのもいいもんだぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5035, 101, 1, 4, 0, 116601, 1, 0, "お、今日はカレと\n一緒か。なんだか\nやる気出てきたぜ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5036, 102, 1, 8, 0, 116601, 1, 0, "カレにガイドして\nもらったら\nどこに行っても\n楽しいだろうな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5037, 1, 2, 1, 0, 116601, 1, 0, "よっしゃあ！\nどっちが上手く\nガイドできるか\n勝負しようぜ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5038, 2, 2, 1, 0, 116601, 1, 0, "飯でも食いがてら\nおススメの店の\n下調べでもしようぜ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5039, 3, 2, 1, 0, 116601, 1, 0, "なかなかいいだろ？\nこの格好。キミも\n作ってもらったら\nどうだ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5040, 4, 2, 1, 0, 116601, 1, 0, "普通は行けない\n場所とか行きたいよな\nキミならどんな\nとこがいい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5041, 101, 2, 4, 0, 116601, 1, 0, "ガイドの仕事は\nキミの方が得意そうだ\n参考にさせてもらうぜ\nよろしくな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5042, 102, 2, 8, 0, 116601, 1, 0, "キミの探してきた店\n結構よさそうじゃん\nそうだ、今度二人で\n下見に行こうぜ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5043, 1, 2, 1, 0, 116601, 1, 1, "いい朝だな。絶好の\n仕事日和だぜ！\n今日もよろしくな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5044, 2, 2, 1, 0, 116601, 1, 2, "よし、昼飯にしよう\nこの後も激務だし\n飯抜きじゃあ\nぶっ倒れちまうからな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5045, 3, 2, 1, 0, 116601, 1, 3, "お疲れさん！　さーて\n次はオレと遊んで\nくれよ。まだまだ\nいけるだろ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5047, 2, 3, 1, 0, 116601, 1, 0, "ガイドは一日\n歩きっぱなしだからな\nゆっくり休ませて\nもらうぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5048, 3, 3, 1, 0, 116601, 1, 0, "これ、どこで\n売ってるんだろ？\n土産の情報も\n仕入れとかなきゃな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5049, 4, 3, 1, 0, 116601, 1, 0, "アロマとかよく\n分かんねえけど\n土産にはいいかもな\n覚えておくぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5050, 5, 3, 1, 0, 116601, 1, 0, "体が温まると心も\n熱くなるんだよな\nいい仕事が\nできそうだぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5052, 7, 3, 1, 0, 116601, 1, 0, "食べ放題か\nこれはお客さんも\n喜んでくれそうだな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5053, 8, 3, 1, 0, 116601, 1, 0, "へえ、こんなスポット\nあったんだ。やっぱ\nたまには勉強も\nしとくもんだな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5055, 1, 1, 1, 0, 116701, 1, 0, "バイト先になじめる\nように笑顔の練習を！\nに、にへぇ〜…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5056, 2, 1, 1, 0, 116701, 1, 0, "働いて働いて働いて\n…いつかその先に\nぼっちの出口が\n見えるのかも…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5057, 3, 1, 1, 0, 116701, 1, 0, "バイトのイメトレを\n始めます。ポーズを\n決めて…よし！\n角度を変えて…よし！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5058, 4, 1, 1, 0, 116701, 1, 0, "バイト仲間に入る\nためには厳しい修業が\n必須と聞きました…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5059, 5, 1, 1, 0, 116701, 1, 0, "どんどん技術を磨いて\nバイト仲間として\n認めてもらうんです！\n目指せ職人技…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5060, 101, 1, 4, 0, 116701, 1, 0, "あの人が応援して\nくれる…だから必ず\nバイト仲間の輪に\n入ってみせます…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5061, 102, 1, 8, 0, 116701, 1, 0, "あの人がいてくれると\n勇気が湧いてきます…\nぼっち卒業を夢見ても\nいいんだ、って…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5062, 1, 2, 1, 0, 116701, 1, 0, "緊張するけど\n思い切って声をかけて\nみます…バイト仲間に\n入るために…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5063, 2, 2, 1, 0, 116701, 1, 0, "ぼっちの私が\nおもちゃ作りで\n人と共同作業…！\nか、感動です…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5064, 3, 2, 1, 0, 116701, 1, 0, "好きなおもちゃって\nありますか？　私は\nもちろんマイフレンド\nくんです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5065, 4, 2, 1, 0, 116701, 1, 0, "私が作ったおもちゃも\n誰かの友達に\nなってたら\nいいなぁ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5066, 101, 2, 4, 0, 116701, 1, 0, "今日も明日もバイト\nですね！　バイト\n仲間ができる日が\n楽しみです…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5067, 102, 2, 8, 0, 116701, 1, 0, "脱ぼっちを目指して\nこれからも一緒に\n頑張りましょう！\n目指せ、バイト仲間！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5068, 1, 2, 1, 0, 116701, 1, 1, "おはようございます\n今日も気合いを入れて\nおもちゃ作りします！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5069, 2, 2, 1, 0, 116701, 1, 2, "ランチの時間です…♪\nもちろん工場の隅で\nぼっち飯です…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5070, 3, 2, 1, 0, 116701, 1, 3, "ふわぁ…今日も\nお疲れさまでした\n明日も働きます～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5072, 2, 3, 1, 0, 116701, 1, 0, "バイトで頑張った日は\nふわふわの誘惑に\n勝てません…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5073, 3, 3, 1, 0, 116701, 1, 0, "こういうおもちゃの\nアイデアも\n素敵かも…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5074, 4, 3, 1, 0, 116701, 1, 0, "いい香りがする\nおもちゃはどうかな…\n森の薬草を使って…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5075, 5, 3, 1, 0, 116701, 1, 0, "ぽかぽか…\n幸せなひとときですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5077, 7, 3, 1, 0, 116701, 1, 0, "もぐもぐ…たくさん\n食べて厳しいバイトを\n乗り切ります…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5078, 8, 3, 1, 0, 116701, 1, 0, "ふむふむ…おもちゃの\n設計図を見るのも\n勉強になりますね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5080, 1, 1, 1, 0, 116801, 1, 0, "う～ん\n次はどんなたい焼きを\n作ろうかにゃぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5081, 2, 1, 1, 0, 116801, 1, 0, "あたしが売る\nたい焼きには\n夢が詰まってるにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5082, 3, 1, 1, 0, 116801, 1, 0, "いつか絶対に\nたい焼き工場を\n建て直してみせるにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5083, 4, 1, 1, 0, 116801, 1, 0, "たまにたい焼き以外の\nおやつも食べるにゃ\nたとえば煮干しとか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5084, 5, 1, 1, 0, 116801, 1, 0, "悪い商売人がいたら\nファントムキャッツに\n知らせるにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5085, 101, 1, 4, 0, 116801, 1, 0, "キミと一緒にいると\nたい焼きのアイデアが\n次々出てくるにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5086, 102, 1, 8, 0, 116801, 1, 0, "出来ないことも\nキミと一緒にいれば\n出来る気がするにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5087, 1, 2, 1, 0, 116801, 1, 0, "なんにゃ～？\nお姉さんにかまって\nほしいのかにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5088, 2, 2, 1, 0, 116801, 1, 0, "キミ、いいところに！\nあたしとライバル店へ\n視察にいくにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5089, 3, 2, 1, 0, 116801, 1, 0, "くんくん…この匂い！\nたい焼き持ってるなら\nちょうだいにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5090, 4, 2, 1, 0, 116801, 1, 0, "次はどんなたい焼きを\n売ろうかにゃ～\nキミの案も欲しいにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5091, 101, 2, 4, 0, 116801, 1, 0, "ファントムキャッツに\n相棒が必要にゃ\nたとえばキミとか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5092, 102, 2, 8, 0, 116801, 1, 0, "相棒！\n…ってキミのこと\n呼んでいいかにゃ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5093, 1, 2, 1, 0, 116801, 1, 1, "早起きは三文の徳にゃ\n今日もたい焼き\n売れますよーににゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5094, 2, 2, 1, 0, 116801, 1, 2, "お腹空いたにゃ…\n賄いのたい焼きを\nいただくにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5095, 3, 2, 1, 0, 116801, 1, 3, "猫は夜が本番にゃ\nでもあたしは…\nふわぁ～眠いにゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5097, 2, 3, 1, 0, 116801, 1, 0, "ふかふかにゃ～\nここで体を丸めて\n一眠りしたいにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5098, 3, 3, 1, 0, 116801, 1, 0, "これは…！\n猫にも負けない\nかわいさだにゃ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5099, 4, 3, 1, 0, 116801, 1, 0, "いい香りにゃ～\nゴロゴロのどが\n鳴りそうだにゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5100, 5, 3, 1, 0, 116801, 1, 0, "ふにゃ～…\nこのまま働かずに\nまるまってたいにゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5102, 7, 3, 1, 0, 116801, 1, 0, "商売は戦いにゃ\nたくさん食べて\nたくさん働くにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5103, 8, 3, 1, 0, 116801, 1, 0, "ふむふむ。たい焼きの\nアレンジレシピ集…\nためになるにゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5105, 103, 1, 12, 0, 102101, 1, 0, "お芝居の前に\nお兄ちゃんの顔を\n見ると、とっても\n落ち着きますぅ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5106, 103, 2, 12, 0, 102101, 1, 0, "お兄ちゃんにもっと\n見てもらいたい…\nだから私…\n強くなりたいです…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5107, 1, 1, 1, 0, 116901, 1, 0, "さらなる効率化で\nみんなといい仕事を\nしたいわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5108, 2, 1, 1, 0, 116901, 1, 0, "他のバイトとの\nスケジュールを\n調整しないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5109, 3, 1, 1, 0, 116901, 1, 0, "時給がアップしたわ！\n働きが認められると\nやる気が出るわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5110, 4, 1, 1, 0, 116901, 1, 0, "効率的に動ければ\n業務を追加できる…\n燃えてきたわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5111, 5, 1, 1, 0, 116901, 1, 0, "帳簿付けのコツ…\nユカリさんに教わって\nみようかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5112, 101, 1, 4, 0, 116901, 1, 0, "バイトリーダーとして\nみんなをビシバシ\n鍛えていくわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5113, 102, 1, 8, 0, 116901, 1, 0, "戦いでもバイトでも\nキミなら安心して\n背中を預けられるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5114, 1, 2, 1, 0, 116901, 1, 0, "どうしたの？\n仕事のことなら\nなんでも相談してね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5115, 2, 2, 1, 0, 116901, 1, 0, "さすがは私の弟子ね\nこれなら安心して\n仕事を任せられるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5116, 3, 2, 1, 0, 116901, 1, 0, "みんなのお手本になる\n働きぶりを見せないと\nいけないわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5117, 4, 2, 1, 0, 116901, 1, 0, "キミのこと…もっと\n頼りにしちゃっても\nいいのかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5118, 101, 2, 4, 0, 116901, 1, 0, "ふふ、キミも一人前の\nバイト戦士として\n立派に成長したわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5119, 102, 2, 8, 0, 116901, 1, 0, "新しいおもちゃの\n企画書を作ってみたの\nちょっと見てくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5120, 1, 2, 1, 0, 116901, 1, 1, "朝は一番効率がいい\n時間帯よ！\nバリバリ働くわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5121, 2, 2, 1, 0, 116901, 1, 2, "さ、お昼に行きましょ\n今日の日替わり定食は\n何かしら…楽しみね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5122, 3, 2, 1, 0, 116901, 1, 3, "もうこんな時間…\nちゃんと寝て明日に\n備えなくちゃね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5124, 2, 3, 1, 0, 116901, 1, 0, "適度な労働と休息の\nサイクルが最大効率を\n生み出すのよ…ふぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5125, 3, 3, 1, 0, 116901, 1, 0, "はぁ～なんて素敵な\n抱き心地なのかしら…\n最高効率の癒やしね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5126, 4, 3, 1, 0, 116901, 1, 0, "落ち着く香りね…\nなんだか集中力が\nアップした気がするわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5127, 5, 3, 1, 0, 116901, 1, 0, "ふぅ…癒されるわね…\n仕事のオンオフの\n切り替えは重要よね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5129, 7, 3, 1, 0, 116901, 1, 0, "働くためには\nエネルギーをちゃんと\n摂っておかないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5130, 8, 3, 1, 0, 116901, 1, 0, "効率を上げるため\n生産管理の勉強も\nしておきたいわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5132, 1, 1, 1, 0, 180301, 1, 0, "変身している間に\n色々と試しておこう\nまずは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5133, 2, 1, 1, 0, 180301, 1, 0, "飛べるというのは\n便利だな。料理が\n暖かいうちに\n持ち帰れる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5134, 3, 1, 1, 0, 180301, 1, 0, "プリンセスか…\n柄ではないけれど\n嫌な気はしないな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5135, 4, 1, 1, 0, 180301, 1, 0, "この力で\n何を成すべきなのか…\n剣に聞いてみよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5136, 5, 1, 1, 0, 180301, 1, 0, "変身したとて私は私\n一時的に強くなろうと\n元が弱くてはだめだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5137, 101, 1, 4, 0, 180301, 1, 0, "変身していない時でも\n彼がそばにいると\n力が湧いてくる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5138, 102, 1, 8, 0, 180301, 1, 0, "私の思い…\nいつか伝えてみせるよ\n…きっといつか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5139, 1, 2, 1, 0, 180301, 1, 0, "何者かと戦うの？\nそれとも修行？\nどちらだとしても\n付き合うよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5140, 2, 2, 1, 0, 180301, 1, 0, "変身し続けたら\nどれだけ空腹に…\n私は試さないからね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5141, 3, 2, 1, 0, 180301, 1, 0, "本物のプリンセスに\nなるのは御免だが\nナイトがいて\nくれるのは頼もしいよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5142, 4, 2, 1, 0, 180301, 1, 0, "いつかこの力を\n誰かを救うために…\n戦い以外に使える時が\nくることを願うよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5143, 101, 2, 4, 0, 180301, 1, 0, "キミに感じてほしいな\n私に流れてくる\nキミからの力を…\nその…私の、思いも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5144, 102, 2, 8, 0, 180301, 1, 0, "思いを告げる…\nそれがこんなにも\n難しいなんて…\nでも、いつか必ず…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5145, 1, 2, 1, 0, 180301, 1, 1, "おはよう！\nいい変身日和だ！\n…ふふっ、冗談だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5146, 2, 2, 1, 0, 180301, 1, 2, "いつもより多く\n昼食を用意しよう\n変身が解けたら大変だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5147, 3, 2, 1, 0, 180301, 1, 3, "一日お疲れ様\n私もそろそろ変身を\n解いて休むとするよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5149, 2, 3, 1, 0, 180301, 1, 0, "変身してしまうと\n動かずにいても\n空腹になるのかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5150, 3, 3, 1, 0, 180301, 1, 0, "私もキミたちくらい\n可愛げがある姿に\nなっているかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5151, 4, 3, 1, 0, 180301, 1, 0, "香りに対する感覚も\nいつもより鋭く\nなっているみたいだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5152, 5, 3, 1, 0, 180301, 1, 0, "ありがたいな\n少し足元が\n冷えていたところだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5154, 7, 3, 1, 0, 180301, 1, 0, "これは…！\n持ち運べるように\n改良できないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5155, 8, 3, 1, 0, 180301, 1, 0, "祖父に貰った\n技法書を読んで\n初心に帰ろう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5157, 1, 1, 1, 0, 117001, 1, 0, "最強の惚れ薬を作って\nあのおかたの心を\n私の思いのままに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5158, 2, 1, 1, 0, 117001, 1, 0, "夏といえば海にスイカ\n花火に水着…\nそして惚れ薬ですわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5159, 3, 1, 1, 0, 117001, 1, 0, "あのおかたの心を\n手に入れるための\n準備を進めましょう\nこの夏こそ確実に…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5160, 4, 1, 1, 0, 117001, 1, 0, "あのおかたに近づく\n虫どもを、どうやって\n片付けようかしら…\nまったく忌々しいこと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5161, 5, 1, 1, 0, 117001, 1, 0, "…クスクス\n薬の調合を考えるのは\n至福の時間ですわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5162, 101, 1, 4, 0, 117001, 1, 0, "あのおかたの全てが\n早く私のものに\nなりますように…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5163, 102, 1, 8, 0, 117001, 1, 0, "かき氷も花火も海も…\nあなた様がいてこそ…\nそう、あなた様は\n私の全てなのですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5164, 1, 2, 1, 0, 117001, 1, 0, "二人だけの夏を\n楽しみましょう…？\n…クスクス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5165, 2, 2, 1, 0, 117001, 1, 0, "あら、あなた様\n私に秘密でどこに\n行こうとして\nいますの…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5166, 3, 2, 1, 0, 117001, 1, 0, "海に行きませんか？\nあなた様と一緒に\n過ごすには\n最高の場所ですから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5167, 4, 2, 1, 0, 117001, 1, 0, "ちょうどいいところに\nいらっしゃいました\nできたての薬を…\nさぁどうぞ…クスクス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5168, 101, 2, 4, 0, 117001, 1, 0, "夏の海のきらめきも\nあなた様の存在が\nなければ色あせて\nしまいますわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5169, 102, 2, 8, 0, 117001, 1, 0, "私とあなた様は\n結ばれる運命に\nあるのです…\n逃がしませんわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5170, 1, 2, 1, 0, 117001, 1, 1, "起きてすぐに会いに\n来てくださるなんて\nようやく私の伴侶たる\n自覚が…クスクス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5171, 2, 2, 1, 0, 117001, 1, 2, "お食事はまだですか？\n特製の薬草ランチを\n召し上がれ…クスクス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5172, 3, 2, 1, 0, 117001, 1, 3, "私の夢を見られる薬を\n差し上げますわ…\nおやすみなさいませ\nあなた様…クスクス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5174, 2, 3, 1, 0, 117001, 1, 0, "いい肌触りですわ…\n考え事にもぴったり\n眠くなるのが\n玉に瑕ですが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5175, 3, 3, 1, 0, 117001, 1, 0, "こういったものに\n揮発性の薬を仕込む\nのも一つの手ですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5176, 4, 3, 1, 0, 117001, 1, 0, "この香り…開発中の\n薬に使えそうな気が\nしますわ…クスクス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5177, 5, 3, 1, 0, 117001, 1, 0, "あのおかたの\nぬくもりを\n思い出しますわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5179, 7, 3, 1, 0, 117001, 1, 0, "美味しい…この味なら\n薬を混ぜても違和感は\nなさそうですわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5180, 8, 3, 1, 0, 117001, 1, 0, "この薬の調合法…\n今度試してみましょう\nもちろんあのおかたに\n飲んでいただいて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5182, 10, 3, 1, 0, 117001, 1, 0, "二人乗りができると\nいいですわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5183, 11, 3, 1, 0, 117001, 1, 0, "ふかふかですわ…\nあのおかたの分も\n欲しくなります…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5184, 103, 1, 12, 0, 101701, 1, 0, "今日はキミと\nいつまでも歌って\n踊りたい気分さ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5185, 103, 2, 12, 0, 101701, 1, 0, "あは～♪\nキミの隣は、故郷より\n落ち着くかも～…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5186, 1, 1, 1, 0, 117101, 1, 0, "この水着…\n一番に弟くんに\n見せたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5187, 2, 1, 1, 0, 117101, 1, 0, "弟くんをこっそり\n海に運んで…\nサプライズしちゃお♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5188, 3, 1, 1, 0, 117101, 1, 0, "いつもと違う髪型に\nしてみたけど…\n気に入ってくれるかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5189, 4, 1, 1, 0, 117101, 1, 0, "海は楽しみだけど\n日焼けしないように\n気を付けなきゃね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5190, 5, 1, 1, 0, 117101, 1, 0, "まだかな、弟くん\n水着のお姉ちゃんが\nお出迎えだよっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5191, 101, 1, 4, 0, 117101, 1, 0, "海が見えるおうちで\n弟くんと一緒に\n暮らしたいなぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5192, 102, 1, 8, 0, 117101, 1, 0, "弟くんの水着…\nどんな感じかなぁ\n…あ、想像してたら\nドキドキして…えへへ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5193, 1, 2, 1, 0, 117101, 1, 0, "こーら、水着の\nお姉ちゃんは\nおさわり禁止♪\n…なんてね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5194, 2, 2, 1, 0, 117101, 1, 0, "なぁに？\nふふっ、何回でも\n呼んでいいんだよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5195, 3, 2, 1, 0, 117101, 1, 0, "海で迷子に\nならないように\n手を繋ごうね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5196, 4, 2, 1, 0, 117101, 1, 0, "お姉ちゃんが\n海の楽しみ方を\n教えてあげるねっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5197, 101, 2, 4, 0, 117101, 1, 0, "わっ、弟くん\nどこ触ってるの？\nも～驚いちゃったぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5198, 102, 2, 8, 0, 117101, 1, 0, "お姉ちゃん、海でも\nずっとキミを見てるよ\n…安心してね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5199, 1, 2, 1, 0, 117101, 1, 1, "まだ眠そうだね？\nほら、海が待ってるよ\n早く起きて起きて♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5200, 2, 2, 1, 0, 117101, 1, 2, "大丈夫、疲れてない？\n海で遊び疲れた時は\n素直に休憩しようね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5201, 3, 2, 1, 0, 117101, 1, 3, "ほら、早く寝ないと\n明日もお姉ちゃんと\n遊べないぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5203, 2, 3, 1, 0, 117101, 1, 0, "だらけたお姉ちゃんは\n弟くんには\n見せられないな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5204, 3, 3, 1, 0, 117101, 1, 0, "ふふっ、かわいいね♪\n弟くんが持つと\nもっとかわいいよっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5205, 4, 3, 1, 0, 117101, 1, 0, "いい香りだね…\n一味違うお姉ちゃんに\nなれそう…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5206, 5, 3, 1, 0, 117101, 1, 0, "あったか～い♪\nほら、弟くんも\nおいでよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5208, 7, 3, 1, 0, 117101, 1, 0, "よく食べて、いつでも\n弟くんの呼び声に\n応える準備を…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5209, 8, 3, 1, 0, 117101, 1, 0, "弟くんの水着の写真\nこの辺りに隠して\nおこうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5211, 10, 3, 1, 0, 117101, 1, 0, "この子の背に乗って\nお姉ちゃんと弟くんの\n楽園へ…な～んて♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5212, 11, 3, 1, 0, 117101, 1, 0, "海を感じる感触だね\n弟くんとの楽しい夏を\n思い出しちゃうな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5213, 1, 1, 1, 0, 117201, 1, 0, "この夏、誰よりも\nキラキラしてみせる！\nだって私は\nアイドルだから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5214, 2, 1, 1, 0, 117201, 1, 0, "日傘にアームカバー\n帽子にサングラス…\n紫外線対策は完璧！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5215, 3, 1, 1, 0, 117201, 1, 0, "とっておきの\nサマーソングを\nみんなに届けるよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5216, 4, 1, 1, 0, 117201, 1, 0, "なんにもしないのって\n苦手かも…\n彼、早く来ないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5217, 5, 1, 1, 0, 117201, 1, 0, "ラムネって\n夏って感じするよね\n後で彼と飲もっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5218, 101, 1, 4, 0, 117201, 1, 0, "夏は恋の季節！\n燃えるような恋…\nいつかしたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5219, 102, 1, 8, 0, 117201, 1, 0, "今年の夏の目標は\n…彼との思い出を\nいっぱい作ること！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5220, 1, 2, 1, 0, 117201, 1, 0, "私の水着写真集\n見てくれたんだ！\nどう、かわいかった？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5221, 2, 2, 1, 0, 117201, 1, 0, "スイカ割りしたいの？\nいいね、楽しそう！\nみんなも誘おうよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5222, 3, 2, 1, 0, 117201, 1, 0, "ねぇ、見て見て！\n水着の映える\nポーズ考えたんだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5223, 4, 2, 1, 0, 117201, 1, 0, "ライブ中に\n花火を打ち上げたら\n絶対盛り上がるよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5224, 101, 2, 4, 0, 117201, 1, 0, "最近、忙しいけど…\nキミの顔見たら\n疲れなんて\n消えちゃった！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5225, 102, 2, 8, 0, 117201, 1, 0, "この夏もいーっぱい\nドキドキさせるから！\n覚悟しててよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5226, 1, 2, 1, 0, 117201, 1, 1, "外は朝から暑いね\nけど、負けないから！\nお仕事、頑張るぞー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5227, 2, 2, 1, 0, 117201, 1, 2, "自分へのご褒美に、\nアイス食べちゃお♪\nキミも一緒に食べよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5228, 3, 2, 1, 0, 117201, 1, 3, "夏の夜って\nワクワクするね♪\nホタル見に行こうよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5230, 2, 3, 1, 0, 117201, 1, 0, "ふわぁ…眠い…\n仕事とかの疲れ、\nたまってるのかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5231, 3, 3, 1, 0, 117201, 1, 0, "私のぬいぐるみが\nグッズになったら…\n彼にかわいがって\nもらえるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5232, 4, 3, 1, 0, 117201, 1, 0, "この香り…\n夏限定のやつでしょ？\nいいセンスしてるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5233, 5, 3, 1, 0, 117201, 1, 0, "暑～い！\nけど…汗かいて\n気持ちいいかも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5235, 7, 3, 1, 0, 117201, 1, 0, "レッスンの後のご飯は\n特別おいしい♪\n…もうひとつだけ\n食べちゃおっかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5236, 8, 3, 1, 0, 117201, 1, 0, "あ、この前撮影した\n水着グラビアだ\nうんうん、いい感じ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5238, 10, 3, 1, 0, 117201, 1, 0, "この子、もふもふだね\n触るのクセになりそう\nもふもふもふもふ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5239, 11, 3, 1, 0, 117201, 1, 0, "わ、かわいい♪\n今度のグラビア撮影で\nこれ使ってもいい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5240, 1, 1, 1, 0, 117401, 1, 0, "水着っていいですよね\n海に浮かぶ一輪の花\nって感じがして！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5241, 2, 1, 1, 0, 117401, 1, 0, "自分の水着を作るのも\n誰かの水着を作るのも\n楽しいですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5242, 3, 1, 1, 0, 117401, 1, 0, "水着の最終チェック！\n伸縮性や動きやすさは\n…いい感じですね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5243, 4, 1, 1, 0, 117401, 1, 0, "振り付けや衣装作りに\n歌や踊りの練習…\n…やることがいっぱい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5244, 5, 1, 1, 0, 117401, 1, 0, "はぁ…レイ様の水着…\n私に作らせて\nもらえないかなぁ～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5245, 101, 1, 4, 0, 117401, 1, 0, "騎士さんのことは\n気に入らないですけど\n別に嫌いという\nわけじゃなくて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5246, 102, 1, 8, 0, 117401, 1, 0, "騎士さん暇そうですね\nに、荷物持ちとして\n誘ってみようかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5247, 1, 2, 1, 0, 117401, 1, 0, "騎士さんいいところに\nこの衣装\nどう思います？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5248, 2, 2, 1, 0, 117401, 1, 0, "何見てるんですか？\nもしかしてこの水着の\n良さが分かります！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5249, 3, 2, 1, 0, 117401, 1, 0, "真夏でも涼しい…\nそれも水着の良さの\n一つですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5250, 4, 2, 1, 0, 117401, 1, 0, "仕立て屋も\nアイドルも\n諦めません！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5251, 101, 2, 4, 0, 117401, 1, 0, "夏と言えば\nバカンスですけど…\n予定、あるんですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5252, 102, 2, 8, 0, 117401, 1, 0, "う～ん…騎士さんを\n海へ誘うには…って\nなんでもないですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5253, 1, 2, 1, 0, 117401, 1, 1, "ふー…夏はやっぱり\n朝が一番過ごしやすい\nですね～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5254, 2, 2, 1, 0, 117401, 1, 2, "暑い時こそ海です！\n体力づくりのためにも\n泳ぎにいきますよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5255, 3, 2, 1, 0, 117401, 1, 3, "外で虫が鳴いてる…\n夏って感じがして\n風流ですねぇ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5257, 2, 3, 1, 0, 117401, 1, 0, "少し休憩です…\nこのまま寝ないよう\n気をつけないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5258, 3, 3, 1, 0, 117401, 1, 0, "か、かわいい…！\nこの感動を次の\nステージ衣装にも…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5259, 4, 3, 1, 0, 117401, 1, 0, "いい香りですね～\n波の音が聞こえて\nきそうです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5260, 5, 3, 1, 0, 117401, 1, 0, "泳いだ後は\n少し寒いので\nちょうどいいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5262, 7, 3, 1, 0, 117401, 1, 0, "夏バテしないように\n栄養はしっかり\n取らないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5263, 8, 3, 1, 0, 117401, 1, 0, "次のトレンドは…\nふむふむ、やっぱり\nこう来ましたか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5265, 10, 3, 1, 0, 117401, 1, 0, "デザインはもちろん\n触り心地も\n最高ですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5266, 11, 3, 1, 0, 117401, 1, 0, "夏の撮影スポットに\n活用できそうですね\nさっそく衣装考えて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5267, 103, 1, 12, 0, 104001, 1, 0, "えへへ…♪\n団長さんが初めての\n友達で本当に良かった");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5268, 103, 2, 12, 0, 104001, 1, 0, "あっ、団長さん！\n今日のＢＢ団の活動\nなんですけど…二人で\n大縄跳びしませんか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5269, 1, 1, 1, 0, 117301, 1, 0, "この衣装で\nライブするのは\n恥ずかしいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5270, 2, 1, 1, 0, 117301, 1, 0, "せっかくの夏だし\n肝試しに\n行ってみたいかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5271, 3, 1, 1, 0, 117301, 1, 0, "歌もダンスも\nより上を目指すために\n夏合宿をしよう…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5272, 4, 1, 1, 0, 117301, 1, 0, "夏の暑さにも負けない\n熱いライブに\nしてみせる…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5273, 5, 1, 1, 0, 117301, 1, 0, "新曲のアイデア\nまとめたいな…\n少し海辺を散歩しよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5274, 101, 1, 4, 0, 117301, 1, 0, "かき氷、食べたいな\n…あの人は何味が\n好きなんだろう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5275, 102, 1, 8, 0, 117301, 1, 0, "水着、似合ってるって\n言ってもらえるかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5276, 1, 2, 1, 0, 117301, 1, 0, "サインして、ですか？\nいいですけど…\n少し照れますね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5277, 2, 2, 1, 0, 117301, 1, 0, "少し待ってください\n今、新曲の楽譜を\n書いているので…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5278, 3, 2, 1, 0, 117301, 1, 0, "なんでしょう？\nもしかして…\nボイトレに興味が？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5279, 4, 2, 1, 0, 117301, 1, 0, "今度のライブでは\n夏らしい爽やかな歌を\nファンにお届けします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5280, 101, 2, 4, 0, 117301, 1, 0, "…水鉄砲で遊ぼう？\nふふ。楽しそうですね\nお手柔らかに…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5281, 102, 2, 8, 0, 117301, 1, 0, "あなたの声を\n聴いていると、\n何だか落ち着きます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5282, 1, 2, 1, 0, 117301, 1, 1, "今日も暑くなりそう…\nお互いしっかりと\n水分補給しましょうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5283, 2, 2, 1, 0, 117301, 1, 2, "お腹空きましたよね\n海の家で、\nなにか買ってきます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5284, 3, 2, 1, 0, 117301, 1, 3, "夜の海で月明かりと\n波の音を楽しもうかと\n…一緒に行きますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5286, 2, 3, 1, 0, 117301, 1, 0, "レッスンだけでなく\nリラックスすることも\n大事、ですよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5287, 3, 3, 1, 0, 117301, 1, 0, "ふふ、かわいい\n精霊も負けないくらい\nかわいいですけどね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5288, 4, 3, 1, 0, 117301, 1, 0, "夏らしい爽やかで\nいい匂い…あなたに\nピッタリな香りですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5289, 5, 3, 1, 0, 117301, 1, 0, "海に入った後は、\n体が冷えてしまいます\n一緒に温まりましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5291, 7, 3, 1, 0, 117301, 1, 0, "アイドルとして、\n食べすぎには\n気をつけないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5292, 8, 3, 1, 0, 117301, 1, 0, "夏は恋の季節…\nガンガン攻めるべし…\nなるほど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5294, 10, 3, 1, 0, 117301, 1, 0, "この子に乗りながら\nライブをする…\nというのはどうですか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5295, 11, 3, 1, 0, 117301, 1, 0, "まるで人魚になった\n気分…なんて、ふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5296, 1, 1, 1, 0, 118301, 1, 0, "お姉ちゃんとして\nシオリンにかっこいい\nとこ見せなくっちゃ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5297, 2, 1, 1, 0, 118301, 1, 0, "いつかシオリンと\n一緒に空を飛んで\n空中散歩してみたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5298, 3, 1, 1, 0, 118301, 1, 0, "すこし眠くなってきた\nかも…シオリンと\nお昼寝しようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5299, 4, 1, 1, 0, 118301, 1, 0, "お散歩してこよっと！\nシオリンとお出かけ\nするのにいい場所\n探さなくっちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5300, 5, 1, 1, 0, 118301, 1, 0, "シオリンに過保護って\n言われちゃった…♪\nそれでも心配しちゃう\nのが姉心…だよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5301, 101, 1, 4, 0, 118301, 1, 0, "気持ちいい日差し！\nシオリンと彼と、\nお昼寝したら\n気持ちよさそ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5302, 102, 1, 8, 0, 118301, 1, 0, "今度天気がいい日には\nシオリンと彼を誘って\n一緒にお出かけ\nしたいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5303, 1, 2, 1, 0, 118301, 1, 0, "今日はご機嫌なんだ♪\nだって、シオリンの\n調子がいいんだもん☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5304, 2, 2, 1, 0, 118301, 1, 0, "今からシオリンと\nピクニックに\n行くんだ♪　そうだ！\nキミも一緒にどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5305, 3, 2, 1, 0, 118301, 1, 0, "わっ、びっくりした！\nシオリンから借りた本\n読むのに集中\nしてたから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5306, 4, 2, 1, 0, 118301, 1, 0, "うん？　どうしたの？\nあっ、もしかして\nこの服、気になる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5307, 101, 2, 4, 0, 118301, 1, 0, "シオリンもキミも元気\nいっぱいだと、私も\n元気になっちゃうよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5308, 102, 2, 8, 0, 118301, 1, 0, "シオリンの前だけ\nじゃなくて、キミにも\nかっこいい私の姿を\n見てほしいな☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5309, 1, 2, 1, 0, 118301, 1, 1, "おはよう！　えへへっ\n今日は早起きなんだ♪\nシオリンにかっこ悪い\nとこ見せたくないから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5310, 2, 2, 1, 0, 118301, 1, 2, "おなかすいたなぁ～…\nシオリンと一緒に\nおいしいもの食べに\n行こうかな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5311, 3, 2, 1, 0, 118301, 1, 3, "もうこんな時間！？\nシオリンと一緒だと\n時間が早く\n過ぎていっちゃうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5313, 2, 3, 1, 0, 118301, 1, 0, "この快適な寝心地…！\nシオリンにもおすすめ\nしなきゃ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5314, 3, 3, 1, 0, 118301, 1, 0, "わあ、かわいい！\nそれにさわり心地も\nいいし、抱き枕に\nちょうどいいかも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5315, 4, 3, 1, 0, 118301, 1, 0, "いいにおい…♪\nなんだかリラックス\nできて…すやぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5316, 5, 3, 1, 0, 118301, 1, 0, "ぽかぽか～☆\nシオリンと一緒に\nぬくぬくしたら\n気持ちよさそう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5318, 7, 3, 1, 0, 118301, 1, 0, "仲のいい人が一緒だと\nつい食が進んじゃうね\nえへへ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5319, 8, 3, 1, 0, 118301, 1, 0, "ふむふむ…この本…\nシオリンが好きかも！\n今度おすすめしよっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5322, 1, 1, 1, 0, 118401, 1, 0, "お姉ちゃん、\n私のために無理は\nしてないかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5323, 2, 1, 1, 0, 118401, 1, 0, "新しく買った絵本…\nこういうのなら\nお姉ちゃんと楽しく\n読めるよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5324, 3, 1, 1, 0, 118401, 1, 0, "ニャットちゃんを\nここに連れてきて\nみんなで遊べないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5325, 4, 1, 1, 0, 118401, 1, 0, "本屋さんに行こうかな\nみんなで読める\n面白い本が\nあるといいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5326, 5, 1, 1, 0, 118401, 1, 0, "たまには…読むだけ\nじゃなくて、自分で\nお話を書いて\nみようかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5327, 101, 1, 4, 0, 118401, 1, 0, "時々…お姉ちゃんと\nあの人が似てるって\n思うことがあります…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5328, 102, 1, 8, 0, 118401, 1, 0, "お姉ちゃんとあの人…\n優しくて頼もしい\n二人に囲まれて…\n私、幸せ者だなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5329, 1, 2, 1, 0, 118401, 1, 0, "どうかしましたか？\nもしかして…あなたも\n一緒にこの本を\n読みたい…とか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5330, 2, 2, 1, 0, 118401, 1, 0, "けほっ…けほっ…\nあっ、心配いりません\n飲み物を飲んで\nむせただけですから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5331, 3, 2, 1, 0, 118401, 1, 0, "この格好…\n似合ってますか…？\nえへへ、照れますね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5332, 4, 2, 1, 0, 118401, 1, 0, "なぁに、お姉ちゃん？\n…あっ、すみません\n読書に集中していて…\n間違えちゃいました…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5333, 101, 2, 4, 0, 118401, 1, 0, "お姉ちゃん、時々無理\nしちゃうから…\nあなたも一緒だと\n安心できます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5334, 102, 2, 8, 0, 118401, 1, 0, "お姉ちゃんとあなたと\n頼れる人に囲まれて\n私は幸せものですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5335, 1, 2, 1, 0, 118401, 1, 1, "なんだか朝から\n調子がいい…今日は\nいい日になりそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5336, 2, 2, 1, 0, 118401, 1, 2, "せっかくだから、\nお姉ちゃんを誘って\nお外でランチも\nいいかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5337, 3, 2, 1, 0, 118401, 1, 3, "お姉ちゃんに心配\nかけないように…もう\nちょっと本を読んだら\n寝なくちゃね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5339, 2, 3, 1, 0, 118401, 1, 0, "ふんわり柔らかくて\n気持ちいい手触り…\nお姉ちゃんが寝るのに\nちょうどよさそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5340, 3, 3, 1, 0, 118401, 1, 0, "ふふっ、かわいい♪\n絵本の物語みたいに\nおしゃべりできない\nかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5341, 4, 3, 1, 0, 118401, 1, 0, "素敵な落ち着く香り♪\nなんだかお姉ちゃん\nみたい、ふふっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5342, 5, 3, 1, 0, 118401, 1, 0, "あったかくてほっと\nするなぁ\nここでゆっくり\n読書しようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5344, 7, 3, 1, 0, 118401, 1, 0, "この味…\nお姉ちゃんが好きそう\n少しもらって、\n持って行こうかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5345, 8, 3, 1, 0, 118401, 1, 0, "この本みたいな、\n心躍る大冒険も\nお姉ちゃんと一緒なら\nできちゃいそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5348, 1, 1, 1, 0, 117501, 1, 0, "いい部屋ね\nここを私の分院に\nするのもいいかも\nしれないわね…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5349, 2, 1, 1, 0, 117501, 1, 0, "珍しいカンポーが\n手に入ったから\n色々試してみたいわ\n色々と、ね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5350, 3, 1, 1, 0, 117501, 1, 0, "この服を着ると\n自分が医者だって\nより実感するわね\nまあ、闇医者だけどね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5351, 4, 1, 1, 0, 117501, 1, 0, "新薬開発のために\n薬草を採取して\nおこうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5352, 5, 1, 1, 0, 117501, 1, 0, "いつ急患が来ても\n対応できるように\nしておきましょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5353, 101, 1, 4, 0, 117501, 1, 0, "あの子の研究資料も\nだいぶ増えてきたわね\nちゃんとまとめて\nおかないと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5354, 102, 1, 8, 0, 117501, 1, 0, "あの子は大事な\n研究対象。だから\nいつまでも健康で\nいてもらわないとね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5355, 1, 2, 1, 0, 117501, 1, 0, "薬に興味があるの？\nなら、今度ゆっくりと\n教えてあげるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5356, 2, 2, 1, 0, 117501, 1, 0, "少し時間があいたから\n一緒に新薬の実験を\nしましょうか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5357, 3, 2, 1, 0, 117501, 1, 0, "どうしたの？\nまさか急患…！？\nあら、違うのね\nならよかったわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5358, 4, 2, 1, 0, 117501, 1, 0, "具合が悪い時はすぐに\n言うのよ。君には\nいつでも健康でいて\nほしいから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5359, 101, 2, 4, 0, 117501, 1, 0, "少し仮眠したいわね\n肩…いいえ、膝を\n貸してもらえる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5360, 102, 2, 8, 0, 117501, 1, 0, "たまには…君の隣なら\n闇医者も悪い研究者も\nお休みにするのも\n悪くないわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5361, 1, 2, 1, 0, 117501, 1, 1, "たまには朝の陽ざしを\n浴びるのも…\n悪くないわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5362, 2, 2, 1, 0, 117501, 1, 2, "天気がいい日は\nいい薬草が採れるの\n君も集めるの、\n手伝ってくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5363, 3, 2, 1, 0, 117501, 1, 3, "いけない、もうこんな\n時間なのね\n診察に没頭すると\n時間感覚がなくなるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5365, 2, 3, 1, 0, 117501, 1, 0, "もう少し固い方が\n私好みだけど…\n悪くない寝心地ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5366, 3, 3, 1, 0, 117501, 1, 0, "このぬいぐるみ…\n闇医者として\n興味深いわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5367, 4, 3, 1, 0, 117501, 1, 0, "落ち着く香りね\n私も診察室で\n使ってみようかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5368, 5, 3, 1, 0, 117501, 1, 0, "冷えは病につながるわ\nしっかり温めて\n体をいたわりましょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5370, 7, 3, 1, 0, 117501, 1, 0, "おいしい♪\n研究のお供に\nもってこいの\n味だわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5371, 8, 3, 1, 0, 117501, 1, 0, "医学は日進月歩…\n闇医者とはいえ\n最新の論文には\n目を通しておかないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5400, 1, 1, 1, 0, 117601, 1, 0, "白衣の天使かあ\nまさにボクのための\n呼び方だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5401, 2, 1, 1, 0, 117601, 1, 0, "美しさとは\n日々の努力が\n作るものなんだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5402, 3, 1, 1, 0, 117601, 1, 0, "大変だ…\nボクは美しく\nなりすぎたかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5403, 4, 1, 1, 0, 117601, 1, 0, "ボクのかわいさで\n癒やされて\nみんな健康に\nなっちゃうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5404, 5, 1, 1, 0, 117601, 1, 0, "どんな服装をしても\nボクの美しさは\n変わらないね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5405, 101, 1, 4, 0, 117601, 1, 0, "これからはボクも\n美の伝道師として\nがんばらないとね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5406, 102, 1, 8, 0, 117601, 1, 0, "ボクのかわいい笑顔を\n近くで見る以上の\n癒やしはないよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5407, 1, 2, 1, 0, 117601, 1, 0, "どう？　看護師姿の\nボクもかわいいでしょ\nもっと近くで見る？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5408, 2, 2, 1, 0, 117601, 1, 0, "ほら！　美しいボクの\n看護師姿を見たら\n元気でちゃうでしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5409, 3, 2, 1, 0, 117601, 1, 0, "白衣の天使のボクも\n最高に美しいね\n存分に癒されてよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5410, 4, 2, 1, 0, 117601, 1, 0, "具合が悪いの？\nならボクの美しい顔を\n処方してあげる♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5411, 101, 2, 4, 0, 117601, 1, 0, "さあ今日もボクと\n一緒に美の追求に\n付き合ってもらうよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5412, 102, 2, 8, 0, 117601, 1, 0, "かわいい天使のボクが\nいつもそばにいるんだ\nキミって幸せ者だね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5413, 1, 2, 1, 0, 117601, 1, 1, "さすがボク\n目が覚めるような\n美しさでしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5414, 2, 2, 1, 0, 117601, 1, 2, "美は食で作られる\n美容にいいものを\n食べようよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5415, 3, 2, 1, 0, 117601, 1, 3, "ふああ…早く寝よ？\n夜更かしは美容の\n大敵だからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5417, 2, 3, 1, 0, 117601, 1, 0, "ふう～…\nリラックスする\nボクも美しい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5418, 3, 3, 1, 0, 117601, 1, 0, "ボクが抱きしめると\n普段よりかわいく\n見えちゃうね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5419, 4, 3, 1, 0, 117601, 1, 0, "美しいボクは\n常にいい香りを\nしていなくちゃね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5420, 5, 3, 1, 0, 117601, 1, 0, "光がボクを照らしてる\nんじゃなくて、ボクが\n光を輝かせてるのさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5422, 7, 3, 1, 0, 117601, 1, 0, "バランスのいい食事が\n美しいボクを\n作るのさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5423, 8, 3, 1, 0, 117601, 1, 0, "ふむふむ…なるほど\nこうすればより美しく\nなれるかもしれない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5425, 103, 1, 12, 0, 105701, 1, 0, "仲間のためなら\nきっと…どこまでも\n強くなれるよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5426, 103, 2, 12, 0, 105701, 1, 0, "プリンセスフォーム？\n私と同じような力を\n持ってる人がいるの？\n会ってみたいな～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5427, 1, 1, 1, 0, 118001, 1, 0, "ここの空気は、\nどうもゆるすぎて…\n落ち着きませんわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5428, 2, 1, 1, 0, 118001, 1, 0, "陛下のお越しになる\n別宅としては、\n少し警備が\n甘すぎでは？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5429, 3, 1, 1, 0, 118001, 1, 0, "あらあら？\nサッシにホコリが！\nちょっとネコ助！\n掃除は念入りに！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5430, 4, 1, 1, 0, 118001, 1, 0, "いつまで入り浸って\nいるのかと、\n秘書に叱られて\nしまいましたわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5431, 5, 1, 1, 0, 118001, 1, 0, "もういっそ、\nここに間借りして\n仕事しようかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5432, 101, 1, 4, 0, 118001, 1, 0, "邪魔している身ですし\n家事くらい\nお手伝いさせなさいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5433, 102, 1, 8, 0, 118001, 1, 0, "本当は、意外と\n居心地が良いのかも…\n陛下の気持ち、\n少し分かりましたわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5434, 1, 2, 1, 0, 118001, 1, 0, "ちょっ…わたくしを\n叩いても、ホコリなど\nあまり出ませんわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5435, 2, 2, 1, 0, 118001, 1, 0, "陛下っ？\nなんだ…貴方でしたの\n用件は手短にお願いね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5436, 3, 2, 1, 0, 118001, 1, 0, "別に、好き嫌いは\nありませんけれど…\n魔物料理って、意外と\n美味なものですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5437, 4, 2, 1, 0, 118001, 1, 0, "言っておきますけれど\nわたくしは商売人です\n荒事は専門外ですわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5438, 101, 2, 4, 0, 118001, 1, 0, "プリンセスナイトの\n能力…なにか儲け話に\n使えませんかしらね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5439, 102, 2, 8, 0, 118001, 1, 0, "貴方がたのことも、\n少しくらいは\n信用してないことも\nありませんでしてよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5440, 1, 2, 1, 0, 118001, 1, 1, "おはようございます\nさ、今日もバリバリ\n働きますわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5441, 2, 2, 1, 0, 118001, 1, 2, "お昼ですわね\n栄養補給をしつつ\n働きますわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5442, 3, 2, 1, 0, 118001, 1, 3, "定時ですって？\n関係ありません！\nわたくし、まだまだ\n働きますわよ～っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5444, 2, 3, 1, 0, 118001, 1, 0, "うっ…いけませんわ\n日頃の疲れが…\nふわぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5445, 3, 3, 1, 0, 118001, 1, 0, "もふもふ…ふふっ♪\n…なんですのっ、\nなにかおかしくて！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5446, 4, 3, 1, 0, 118001, 1, 0, "いい香りですわね\nわたくしの執務室にも\n置きたいくらいですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5447, 5, 3, 1, 0, 118001, 1, 0, "いけませんわ…\nこんなに暖かいと\n日頃の疲れが…ふわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5449, 7, 3, 1, 0, 118001, 1, 0, "もう一つ食べたら\n仕事に戻りますわよ？\nあと一つだけ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5450, 8, 3, 1, 0, 118001, 1, 0, "商人にとって\n知識は武器ですわ\n陛下のため、貴方も\nもっと勉強なさい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5452, 1, 1, 1, 0, 117701, 1, 0, "故郷のお菓子を\nいろいろ作ったんだ～\nみんなに\n配ってくるさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5453, 2, 1, 1, 0, 117701, 1, 0, "彼ってどんな仮装が\n似合うかな～？\nシーサーとか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5454, 3, 1, 1, 0, 117701, 1, 0, "カボチャチャンプルー\n作ってみよっと！\nきっとおいしいさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5455, 4, 1, 1, 0, 117701, 1, 0, "視線を感じるさ～\nもしかして幽霊？\nおしゃべりするさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5456, 5, 1, 1, 0, 117701, 1, 0, "さっき作った\nサーターアンダギー、\n早く彼に\n食べてほしいさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5457, 101, 1, 4, 0, 117701, 1, 0, "彼のために、\n特別なイタズラを\n考えとくさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5458, 102, 1, 8, 0, 117701, 1, 0, "いつか彼と、\n故郷のハロウィンを\n楽しみたいさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5459, 1, 2, 1, 0, 117701, 1, 0, "ハロウィンは\n私たちが守るさ～♪\nさ、見回りに行こ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5460, 2, 2, 1, 0, 117701, 1, 0, "この制服、\nハロウィンらしくて\n大好きさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5461, 3, 2, 1, 0, 117701, 1, 0, "イタズラする気ね～？\nどんなことされるのか\n楽しみさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5462, 4, 2, 1, 0, 117701, 1, 0, "カボチャのランタン、\n一緒に作ろ！\n絶対楽しいよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5463, 101, 2, 4, 0, 117701, 1, 0, "お菓子くれるの？\nあは～、ありがとー♪\nもぐもぐ…\n優しい味がするさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5464, 102, 2, 8, 0, 117701, 1, 0, "キミと一緒に過ごす\nハロウィンは、\nドキドキとワクワクが\n止まらないさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5465, 1, 2, 1, 0, 117701, 1, 1, "ハロウィンは\n朝から大忙しさ～！\nお菓子作り、\n手伝ってほしいさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5466, 2, 2, 1, 0, 117701, 1, 2, "お化け屋敷に行こ！\n一緒にいっぱい\nドキドキしようね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5467, 3, 2, 1, 0, 117701, 1, 3, "ここからが\nハロウィン本番さ～！\n幽霊たちと\nいっぱい遊ぶさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5469, 2, 3, 1, 0, 117701, 1, 0, "ちょっと休んだら、\nお菓子作りを\n再開するさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5470, 3, 3, 1, 0, 117701, 1, 0, "でーじかわいいね～♪\nこの子に仮装させたら\nきっと似合うさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5471, 4, 3, 1, 0, 117701, 1, 0, "お菓子みたいに\n甘い匂い…\nハロウィンらしい\nいい香りさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5472, 5, 3, 1, 0, 117701, 1, 0, "ランドソルの秋って\n冷えるけど…\nこれがあれば\n体も心もぽかぽかさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5474, 7, 3, 1, 0, 117701, 1, 0, "故郷のご飯も\nおいしいけど、\nこっちのご飯も\nでーじおいしいさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5475, 8, 3, 1, 0, 117701, 1, 0, "パンプキンパイの\nレシピは…なるほど～\n勉強になるさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5477, 12, 3, 1, 0, 117701, 1, 0, "全部おいしそうで\nどれから食べるか\n迷っちゃうさ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5479, 1, 1, 1, 0, 117801, 1, 0, "ムっ！　幽霊の気配を\n感じるデス！\nさあ姿を現すデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5480, 2, 1, 1, 0, 117801, 1, 0, "ムムム…\n妖魔の力を忍法に\n使えないでショウか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5481, 3, 1, 1, 0, 117801, 1, 0, "怪しい妖魔を\n成敗するデス！\nハロウィンの平和は\nワタシが守りマスよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5482, 4, 1, 1, 0, 117801, 1, 0, "ワタシの祭囃子が\n聞こえマスかー？\nさあ集まるデース！\n陽気に踊りまショウ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5483, 5, 1, 1, 0, 117801, 1, 0, "お祭りは\n楽しんだ者勝ちデス！\n踊らにゃ\nソンソンデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5484, 101, 1, 4, 0, 117801, 1, 0, "幽霊になる前に\n天下統一を\n果たしたいデスね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5485, 102, 1, 8, 0, 117801, 1, 0, "あの世に行っても\nショーグンは\nワタシの大事な\nショーグンデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5486, 1, 2, 1, 0, 117801, 1, 0, "ショーグン！\n悪霊退治に\n出かけるデース！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5487, 2, 2, 1, 0, 117801, 1, 0, "妖魔を家来に\nしてみるのは\nどうデス？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5488, 3, 2, 1, 0, 117801, 1, 0, "マントを使って\nウツセミの術の精度を\n高めるデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5489, 4, 2, 1, 0, 117801, 1, 0, "ハロウィンにちなんだ\n新しい忍法…\nすなわち妖忍法の\n開発を急ぐデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5490, 101, 2, 4, 0, 117801, 1, 0, "あの世でも\nショーグンに\nお仕えしマスよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5491, 102, 2, 8, 0, 117801, 1, 0, "ショーグンもワタシと\nハロウィンパレードを\n踊り明かしまセンか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5492, 1, 2, 1, 0, 117801, 1, 1, "おはようございマス！\n天下統一に向けて\n急いで準備するデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5493, 2, 2, 1, 0, 117801, 1, 2, "お腹減ってまセンか？\nハロウィンスイーツで\n休憩するデ〜ス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5494, 3, 2, 1, 0, 117801, 1, 3, "夜更かしすると幽霊が\nでるかもしれまセン…\nヒュ〜ドロロロ〜…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5496, 2, 3, 1, 0, 117801, 1, 0, "もふもふなところが\nわたあめちゃんに\n似ていマス。わんっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5497, 3, 3, 1, 0, 117801, 1, 0, "ぬいぐるみや人形には\n魂が宿るという\n言い伝えがありマス…\nマカフシギデ〜ス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5498, 4, 3, 1, 0, 117801, 1, 0, "ウ〜ム…\nなんとも怪しい\n香りがしマスね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5499, 5, 3, 1, 0, 117801, 1, 0, "パレードの熱気に\n負けないくらい\n熱いデス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5501, 7, 3, 1, 0, 117801, 1, 0, "ついつい食べすぎて\nしまうのは\n妖魔のせいデスか！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5502, 8, 3, 1, 0, 117801, 1, 0, "トーゴク妖怪の\n図鑑デス！　個性的な\n妖怪ばかりデスね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5504, 12, 3, 1, 0, 117801, 1, 0, "ハロウィンの甘味を\n集めまシタよ！\nショーグンへの\n貢ぎ物デス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5531, 103, 1, 12, 0, 101301, 1, 0, "彼と二人で\n買い物に…って…\nこれってデートに\nなっちゃうのかな！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5532, 103, 2, 12, 0, 101301, 1, 0, "とうっ！　どうどう？\n今の決めポーズ！\nかっこいいよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5533, 1, 1, 1, 0, 117901, 1, 0, "ヒデサイとおそろの\nハロウィンコスとか\nしてみたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5534, 2, 1, 1, 0, 117901, 1, 0, "カボチャ料理かぁ…\n作ったらヒデサイ\n食べてくれるかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5535, 3, 1, 1, 0, 117901, 1, 0, "ハロウィンスイーツ…\nどれもおいしすぎて\n激ヤバなんですけど！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5536, 4, 1, 1, 0, 117901, 1, 0, "霊界ってどんなとこ\nなんだろ～\nわりと近所だったり？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5537, 5, 1, 1, 0, 117901, 1, 0, "服をハロウィンっぽく\nアレンジするのも\nたのしーよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5538, 101, 1, 4, 0, 117901, 1, 0, "ヒデサイと一緒に\nハロウィンパーティー\n…えへへ、楽しみ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5539, 102, 1, 8, 0, 117901, 1, 0, "ヒデサイといると\nドキドキする…\nなんでだろ～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5540, 1, 2, 1, 0, 117901, 1, 0, "ねねね、うちらも\nハロウィンパレード\n見に行こー？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5541, 2, 2, 1, 0, 117901, 1, 0, "ハロウィンセイバーズ\nしゅつどーう！\nヒデサイも行こ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5542, 3, 2, 1, 0, 117901, 1, 0, "マントのロゴ\nかっこいいっしょ～？\nカボきちってゆーんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5543, 4, 2, 1, 0, 117901, 1, 0, "トリックオア\nトリート！\nねえねえヒデサイ\nお菓子ちょうだい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5544, 101, 2, 4, 0, 117901, 1, 0, "ヒデサイも\nメイクしてみる？\nハロウィンぽいやつ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5545, 102, 2, 8, 0, 117901, 1, 0, "ヒデサイのこと\nうちがいつでも\nあっためたげるね！\n…あ！　手、手の話！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5546, 1, 2, 1, 0, 117901, 1, 1, "ハロウィンのイベント\n朝からでも\nやってるかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5547, 2, 2, 1, 0, 117901, 1, 2, "カボチャでおやつ\n作ってみたんだ～\nヒデサイ食べてみて！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5548, 3, 2, 1, 0, 117901, 1, 3, "ハロウィンの夜って\nやっぱテンション\n上がるよね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5550, 2, 3, 1, 0, 117901, 1, 0, "超ふかふかしてる～\nちょっと休憩させて\nもらっちゃお");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5551, 3, 3, 1, 0, 117901, 1, 0, "はぁ…\nもにカワすぎて\nつらいんですけど～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5552, 4, 3, 1, 0, 117901, 1, 0, "ハロウィン限定の\nフレグランスじゃん！\nいい匂いする～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5553, 5, 3, 1, 0, 117901, 1, 0, "やばばば…\nあったかくて\n眠くなっちゃう～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5555, 7, 3, 1, 0, 117901, 1, 0, "これ食べて\nもうひとがんばり\nしよーっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5556, 8, 3, 1, 0, 117901, 1, 0, "ハロウィンっぽい\nファッションとか\n載ってないかなぁ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5558, 12, 3, 1, 0, 117901, 1, 0, "お菓子いっぱいだ～！\nあとでヒデサイにも\n持ってってあげよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5560, 1, 1, 1, 0, 118501, 1, 0, "お掃除が終わったら\n次は書類を片付けて…\nその次は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5561, 2, 1, 1, 0, 118501, 1, 0, "皆さんが冒険している\n間の留守は私に\nお任せください♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5562, 3, 1, 1, 0, 118501, 1, 0, "美食殿の皆さんが\n持ってきてくれる\nお土産が楽しみです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5563, 4, 1, 1, 0, 118501, 1, 0, "ネビアさんとは\nときどき一緒にお茶\nする仲なんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5564, 5, 1, 1, 0, 118501, 1, 0, "ギルドハウスの乱れは\nギルドの乱れ\n整理整頓が大切です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5565, 101, 1, 4, 0, 118501, 1, 0, "素敵なギルドハウスの\n管理人ができて\nとっても幸せです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5566, 102, 1, 8, 0, 118501, 1, 0, "皆さんをほんの少し\n特別扱いしちゃう\n私がいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5567, 1, 2, 1, 0, 118501, 1, 0, "何かわからないことが\nあるときは私に\n聞いてくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5568, 2, 2, 1, 0, 118501, 1, 0, "書類を書いていると\n落ち着きます…\n一緒にどうですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5569, 3, 2, 1, 0, 118501, 1, 0, "あなたのまわりは\nいつも賑やかで\n楽しいですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5570, 4, 2, 1, 0, 118501, 1, 0, "あっ！　お頼みしたい\nことがあって\n探してたんです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5571, 101, 2, 4, 0, 118501, 1, 0, "ギブアンドテイクは\n大切です。たまには\nお礼させてください♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5572, 102, 2, 8, 0, 118501, 1, 0, "陰に日向にあなたを\n支えていきます♪\n期待していてください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5573, 1, 2, 1, 0, 118501, 1, 1, "今日も一日\n管理人として\nがんばります♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5574, 2, 2, 1, 0, 118501, 1, 2, "お腹がすきました…\nそろそろお昼に\nしませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5575, 3, 2, 1, 0, 118501, 1, 3, "もうこんな時間…\n皆さんといると一日が\nあっという間です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5577, 2, 3, 1, 0, 118501, 1, 0, "良質なお仕事は\n良質な休憩から\nです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5578, 3, 3, 1, 0, 118501, 1, 0, "かわいいものに\n囲まれてお仕事できる\nのは幸せですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5579, 4, 3, 1, 0, 118501, 1, 0, "お仕事に集中できる\nアロマを設置するのも\nよさそうですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5580, 5, 3, 1, 0, 118501, 1, 0, "ポカポカ温まりながら\n書類仕事をするのも\nいいものですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5582, 7, 3, 1, 0, 118501, 1, 0, "栄養補給しないと\n頭が回りませんからね\nきちんと食べましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5583, 8, 3, 1, 0, 118501, 1, 0, "新条例はこのように\n活用されている、と…\nふむふむ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5585, 1, 1, 1, 0, 106701, 1, 0, "会合用の資料と\n連載のネーム…\nどっちを片付けよう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5586, 2, 1, 1, 0, 106701, 1, 0, "イノリちゃん、また\nお金くすねてる…\n帰ってきたら\nお尻ペンペンだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5587, 3, 1, 1, 0, 106701, 1, 0, "カヤちゃんの装備\n傷むの早いなぁ〜\nメンテしてあげないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5588, 4, 1, 1, 0, 106701, 1, 0, "そうだ、ラーゴのご飯\n買いに行かないと\n今日は何がいいかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5589, 5, 1, 1, 0, 106701, 1, 0, "ここの人たちは見てて\n飽きない人ばっかり♪\n漫画の参考にしよ〜");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5590, 101, 1, 4, 0, 106701, 1, 0, "また一緒に買い物にも\n行きたいし、冒険も\nしたいな〜…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5591, 102, 1, 8, 0, 106701, 1, 0, "…君は見てるだけで\n満足なの？ ちゃんと\n触って欲しいな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5592, 1, 2, 1, 0, 106701, 1, 0, "私の目が見たいの？\nいいけど…魅了されて\n魂が壊れちゃうよ…？\n…冗談で〜す☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5593, 2, 2, 1, 0, 106701, 1, 0, "ラーゴがね、君に\n遊んで欲しいって☆\n仲良くしてあげてね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5594, 3, 2, 1, 0, 106701, 1, 0, "アシスタントの仕事\n気に入ってくれたなら\nまたお願いしていい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5595, 4, 2, 1, 0, 106701, 1, 0, "私が覚醒できるか？\n見せてあげたいけど…\nすごいことになるから\nまた今度で♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5596, 101, 2, 4, 0, 106701, 1, 0, "楽しいトラブルが\nあったら、とりあえず\n声はかけて欲しいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5597, 102, 2, 8, 0, 106701, 1, 0, "マッサージお願い♪\n変なところは…\n少しだけなら☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5598, 1, 2, 1, 0, 106701, 1, 1, "おはよう〜♪\n今日も一日、一緒に\nがんばっていこうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5599, 2, 2, 1, 0, 106701, 1, 2, "お腹空いちゃった…\n一緒にお昼行かない？\nいいお店があるんだ〜");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5600, 3, 2, 1, 0, 106701, 1, 3, "君、眠れないの？\n誰かに見られてる？\n…きっと気のせいだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5602, 2, 3, 1, 0, 106701, 1, 0, "ちょっと休憩〜…\nこのまま原稿すれば\n疲れなくなるのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5603, 3, 3, 1, 0, 106701, 1, 0, "かわいい〜♪\nラーゴのお友達に\nなってくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5604, 4, 3, 1, 0, 106701, 1, 0, "いい香り〜♪\nこの目でどう見えるか\n伝えられたらいいのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5605, 5, 3, 1, 0, 106701, 1, 0, "ほどほどなのが\nちょうどいい時も\nあるよね…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5607, 7, 3, 1, 0, 106701, 1, 0, "この味付け…\nあっちでも再現\nできるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5608, 8, 3, 1, 0, 106701, 1, 0, "ふふっ、面白い♪\nイノリちゃんの買う\n漫画にハズレなし☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5610, 1, 1, 1, 0, 119001, 1, 0, "私…23歳だもん\n魔法少女だなんて\n名乗れないわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5611, 2, 1, 1, 0, 119001, 1, 0, "あん、どぅ、とろわ〜\nみんなイイ子に\nな〜る♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5612, 3, 1, 1, 0, 119001, 1, 0, "あっ！　イケナイ子の\n気配がするわ！\n風紀の乱れは\n先生が許しませんっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5613, 4, 1, 1, 0, 119001, 1, 0, "ここで闇の力が\n発動したら大変だわ！\nやだっ…そう思ったら\n緊張して…ダメぇ〜！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5614, 5, 1, 1, 0, 119001, 1, 0, "オイタした子はみんな\nどうしてうれしそうに\n私の愛のムチを\n欲しがるのかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5615, 101, 1, 4, 0, 119001, 1, 0, "あの子に次は何を\n教えてあげようかしら\n愛？　希望？\nそれとも…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5616, 102, 1, 8, 0, 119001, 1, 0, "あの子のことを\n考えると、愛と希望で\n胸がいっぱいになるの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5617, 1, 2, 1, 0, 119001, 1, 0, "先生なのに闇の力を\n持ってるのは秘密よ？\n他の子には\n知られたくないから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5618, 2, 2, 1, 0, 119001, 1, 0, "秘密の授業の内容？\nそれは…あんなことや\nこんなことよ♪\nそれから、それから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5619, 3, 2, 1, 0, 119001, 1, 0, "しーっ！　私の正体が\nルーセント学院の\n先生だって、ここでは\n秘密にしててね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5620, 4, 2, 1, 0, 119001, 1, 0, "あら？　補習して\nほしいの？　いいわよ\n君のお願いなら\nなんでも聞いちゃう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5621, 101, 2, 4, 0, 119001, 1, 0, "イイ子にはごほうびを\nあげなくちゃ！\n君はなにが欲しい？\n遠慮しちゃダメよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5622, 102, 2, 8, 0, 119001, 1, 0, "君との秘密が\nまた一つ\n増えちゃったね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5623, 1, 2, 1, 0, 119001, 1, 1, "今日も一日\n元気に過ごしましょう\n先生が指導してあげる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5624, 2, 2, 1, 0, 119001, 1, 2, "夜まで頑張れるように\nお昼ご飯はしっかり\n食べましょう〜！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5625, 3, 2, 1, 0, 119001, 1, 3, "夜更かしはダメよ？\nイケナイ子が\nすることです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5627, 2, 3, 1, 0, 119001, 1, 0, "闇の力に振り回されて\nもうヘトヘトよ〜\n心も体も\n癒されたいわ〜");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5628, 3, 3, 1, 0, 119001, 1, 0, "『秘密の学び舎』に\nこっそり連れて\n行っちゃおうかしら♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5629, 4, 3, 1, 0, 119001, 1, 0, "イケナイ甘い香り…\nなんだか胸の奥が\n熱くなってきたわ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5630, 5, 3, 1, 0, 119001, 1, 0, "やんっ♪\n燃え上がる愛みたい♪\n火照ってきちゃった♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5632, 7, 3, 1, 0, 119001, 1, 0, "生徒の見本に\nなれるように\n好き嫌いはしないの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5633, 8, 3, 1, 0, 119001, 1, 0, "『学び舎に咲く禁断の\n愛』？　気になるわ…\nううん、ダメよっ！\nでも…ちょっとだけ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5635, 103, 1, 12, 0, 106301, 1, 0, "次に会う時は、\nまたあそこに一緒に…\nえへへ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5636, 103, 2, 12, 0, 106301, 1, 0, "横顔見てるの、\nバレてないよね…？\n…ちらっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5637, 103, 1, 12, 0, 105301, 1, 0, "背が少し伸びたか！？\nあ、あいつのところへ\n報告に行かねばっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5638, 103, 2, 12, 0, 105301, 1, 0, "私も貴公の隣に\n立っていられるよう\n日々精進していくぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5639, 1, 1, 1, 0, 119101, 1, 0, "ああ～\nドＭミストが\nあふれてしまいます～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5640, 2, 1, 1, 0, 119101, 1, 0, "魔法少女として\nクウカ頑張ります～！\n愛と希望の妄想を…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5641, 3, 1, 1, 0, 119101, 1, 0, "決めポーズの練習より\nやられポーズの練習を\nしておきます…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5642, 4, 1, 1, 0, 119101, 1, 0, "快感を溜めに溜めて\n放つドＭビームは\n最高ですよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5643, 5, 1, 1, 0, 119101, 1, 0, "はっ！\nこれは闇の気配！\n…クウカ自身でした");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5644, 101, 1, 4, 0, 119101, 1, 0, "ドＳさん…ぐふふ…\nクウカを縛りあげ…\nじゅるりぃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5645, 102, 1, 8, 0, 119101, 1, 0, "ドＳさんに攻められる\nことで、クウカは進化\nしてゆくのです～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5646, 1, 2, 1, 0, 119101, 1, 0, "はぅっ！\nもっと激しく…！\n情熱的に～～～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5647, 2, 2, 1, 0, 119101, 1, 0, "クウカの変身シーンを\nじっくり眺めたい！？\nは、恥ずかしいです～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5648, 3, 2, 1, 0, 119101, 1, 0, "「本当に魔法少女か\n確かめてやるよ…！」\nドＳさんはそう言って\nクウカを…ぐふふ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5649, 4, 2, 1, 0, 119101, 1, 0, "愛と希望の力が\nクウカの中に…\nこの胸の高鳴りが…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5650, 101, 2, 4, 0, 119101, 1, 0, "ひゃあんっ！\nそこです～っ！\nもっと、もっと～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5651, 102, 2, 8, 0, 119101, 1, 0, "クウカをこんなに\n悦ばせるのは\nドＳさんだけです…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5652, 1, 2, 1, 0, 119101, 1, 1, "明るい時間に出歩くと\n目立ちますね\n魔法少女の衣装…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5653, 2, 2, 1, 0, 119101, 1, 2, "お昼の見回りです～♪\nああ～うっかりドＭを\n増やしてしまいました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5654, 3, 2, 1, 0, 119101, 1, 3, "夜！　それはクウカが\n活性化する時間です！\n闇の活動開始です～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5656, 2, 3, 1, 0, 119101, 1, 0, "気の緩んだクウカを\nドＳさんの鋭い牙が\n狙っています～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5657, 3, 3, 1, 0, 119101, 1, 0, "魔法少女のマスコット\nにいいかもしれません\nもっと鎖とか飾りを…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5658, 4, 3, 1, 0, 119101, 1, 0, "魅惑的な香りです～\nドＭミストの香りに\n似て…いや違いますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5659, 5, 3, 1, 0, 119101, 1, 0, "火照る体…紅潮した\nクウカの肢体を熱く\n見つめるドＳさん…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5661, 7, 3, 1, 0, 119101, 1, 0, "食欲を満たした次は\n何を満たせば\nいいですかねぇ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5662, 8, 3, 1, 0, 119101, 1, 0, "魔法少女がひどい目に\n遭う物語は…\nなさそうですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5664, 1, 1, 1, 0, 119901, 1, 0, "ケーキも悪くないけど\nプリンが一番なの\nでもせっかくだから\n両方もらってやるの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5665, 2, 1, 1, 0, 119901, 1, 0, "クリスマスって聞くと\nなんだかあったかい\n気分になるの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5666, 3, 1, 1, 0, 119901, 1, 0, "煙突がなくても\nミヤコはどこからでも\nおうちに入れるの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5667, 4, 1, 1, 0, 119901, 1, 0, "イブもプリン！\nクリスマスもプリン！\nプレゼントもプリン！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5668, 5, 1, 1, 0, 119901, 1, 0, "クリスマスツリーの\n高いところの\n飾りつけは、ミヤコに\nまかせろなの～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5669, 101, 1, 4, 0, 119901, 1, 0, "アイツのプレゼント\n楽しみなの～\nきっと最っ高に特別な\nプリンなの～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5670, 102, 1, 8, 0, 119901, 1, 0, "ミヤコがサンタなら\nアイツはトナカイなの\nつまりお似合いって\nことなの～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5671, 1, 2, 1, 0, 119901, 1, 0, "ミヤコ、プレゼントを\n配りにいくの～♪\nオマエも手伝えなの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5672, 2, 2, 1, 0, 119901, 1, 0, "オマエにも飾りつけ\nしてやるの！\n頭にプリンを乗せると\nかわいいの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5673, 3, 2, 1, 0, 119901, 1, 0, "幽霊のミヤコが\nいるなら、サンタも\nいて当たり前なの～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5674, 4, 2, 1, 0, 119901, 1, 0, "靴下にプリンを\n入れたらつぶれるの\nだからプリンは直接\nミヤコによこすの～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5675, 101, 2, 4, 0, 119901, 1, 0, "今日はプリンだけじゃ\n満足してやらないの！\nミヤコをたくさん\n甘やかせなの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5676, 102, 2, 8, 0, 119901, 1, 0, "ミヤコのプリン\nオマエになら一個…\nうう～、一口だけ\nあげてもいいの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5677, 1, 2, 1, 0, 119901, 1, 1, "サンタの朝は早いの～\nミヤコも早起きして\nプレゼント準備したの\nとってもえらいの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5678, 2, 2, 1, 0, 119901, 1, 2, "今日は一日中\nみんなと遊ぶの～！\nオマエも来いなの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5679, 3, 2, 1, 0, 119901, 1, 3, "みんなが寝たら\nチャンスなの～\nこっそりプレゼント\n配りにいくの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5681, 2, 3, 1, 0, 119901, 1, 0, "むふー、気持ちいいの\nこういうプレゼントも\nいいかもしれないの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5682, 3, 3, 1, 0, 119901, 1, 0, "これ気に入ったの～\nプリンとアイツの\n次くらいなの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5683, 4, 3, 1, 0, 119901, 1, 0, "いいにおいなの～\nうっかり成仏\nしちゃいそうなの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5684, 5, 3, 1, 0, 119901, 1, 0, "ここに飾っといた\n雪だるま\nなくなっちゃったの\nきっと成仏したの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5686, 7, 3, 1, 0, 119901, 1, 0, "これはオマエがくれる\nプリンとは\n別腹なの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5687, 8, 3, 1, 0, 119901, 1, 0, "プリンケーキ…\nこれならミヤコにも\n作れそうなの！\nさっそく作るの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5689, 14, 3, 1, 0, 119901, 1, 0, "びっくりしたの～！\n幽霊のミヤコを\n驚かすなんて…\nなかなかやるの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5690, 15, 3, 1, 0, 119901, 1, 0, "コイツの中…\nあったかいの～♪\n昼寝にぴったりなの～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5691, 1, 1, 1, 0, 119201, 1, 0, "メリークリスマス！\n聖夜に笑顔を\nお届けするべ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5692, 2, 1, 1, 0, 119201, 1, 0, "クリスマス前は\n乳製品がよく売れて\nありがてぇけんど…\n目が回る忙しさだ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5693, 3, 1, 1, 0, 119201, 1, 0, "牧場で売る\nクリスマスリースを\n作っておかねぇと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5694, 4, 1, 1, 0, 119201, 1, 0, "うちの動物たちにも\nクリスマスプレゼント\n用意しなきゃなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5695, 5, 1, 1, 0, 119201, 1, 0, "クリスマスに向けた\n限定商品とか\n作ってみるべか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5696, 101, 1, 4, 0, 119201, 1, 0, "あんちゃんへの\nプレゼント選び…\nここでボケるか…？\nやめておくべか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5697, 102, 1, 8, 0, 119201, 1, 0, "オラ、あんちゃんから\n本当にたくさんの物を\nもらってんなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5698, 1, 2, 1, 0, 119201, 1, 0, "雪遊びがしたいべか？\nへへっ、あんちゃん\nには負けねぇど！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5699, 2, 2, 1, 0, 119201, 1, 0, "ディナーと一緒に\n聖夜のお笑いライブを\nすんのはどうだべか？\nツッコミは任せたべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5700, 3, 2, 1, 0, 119201, 1, 0, "寒くなってくると\n鍋が食べたくなるべや\nあんちゃんはどうだ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5701, 4, 2, 1, 0, 119201, 1, 0, "あんちゃんは\nサンタさんのこと\n信じてるだか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5702, 101, 2, 4, 0, 119201, 1, 0, "どでかいクリスマス\nケーキをこさえるべ\nあんちゃんも作るの\n手伝ってくんろ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5703, 102, 2, 8, 0, 119201, 1, 0, "あんちゃんが\nオラの旦那だったら…\nって、あんちゃん！\n今の聞いてただか！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5704, 1, 2, 1, 0, 119201, 1, 1, "牧場の朝は早いど！\nさぁてと、まずは\n雪かきしに行くべや");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5705, 2, 2, 1, 0, 119201, 1, 2, "あんちゃんも一緒に\nお昼食べてくか？\n採れたての冬野菜は\nうんまいど～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5706, 3, 2, 1, 0, 119201, 1, 3, "よい子は早く寝ねぇと\nサンタさんが\n来てくれねぇべよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5708, 2, 3, 1, 0, 119201, 1, 0, "こういうのリンリンが\n好きそうだな…\nプレゼント候補に\n入れておくべ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5709, 3, 3, 1, 0, 119201, 1, 0, "もふもふしてて\nなまらめんこくて…\nあぁ…癒されるべや…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5710, 4, 3, 1, 0, 119201, 1, 0, "この匂い…\n気持ちが和むべや\n夢心地になっちまうな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5711, 5, 3, 1, 0, 119201, 1, 0, "あったけぇところは\n落ち着くなぁ…\nつい眠くなっちまう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5713, 7, 3, 1, 0, 119201, 1, 0, "こ、この味は…！\n…うーん、もっと\nリアクション芸も\n練習しねぇとな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5714, 8, 3, 1, 0, 119201, 1, 0, "シオシオって\nどんな本読んでんだ？\n…難しい字が\nぎっしりだべや…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5716, 14, 3, 1, 0, 119201, 1, 0, "この仕掛け…\nオラのコントに\n活かせるかも\nしんねぇな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5717, 15, 3, 1, 0, 119201, 1, 0, "この着ぐるみで\nリマリマのモノマネを\n練習してみるべか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5718, 103, 1, 12, 0, 105001, 1, 0, "もっとキレイになって\nアイツにぎゃふんと\n言わせてやるんだから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5719, 103, 2, 12, 0, 105001, 1, 0, "アタシのこと\nどう思う？\nかわいいって…そこは\nキレイって言ってよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5720, 1, 1, 1, 0, 119301, 1, 0, "ハートマークの刺繍…\nは、やりすぎですかね\nいやちょっとくらい\nアピールしてみても…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5721, 2, 1, 1, 0, 119301, 1, 0, "雪降らないかな～\nそしたらお兄ちゃんと\n雪だるま作ったり\nできるのに～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5722, 3, 1, 1, 0, 119301, 1, 0, "プレゼントを入れる\n靴下…いくつ編んでも\n足りません～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5723, 4, 1, 1, 0, 119301, 1, 0, "お兄ちゃんとの\nクリスマスデートは\n早い者勝ちですからね\n負けませんよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5724, 5, 1, 1, 0, 119301, 1, 0, "クリスマスだし…\n受験勉強は今日だけ\nお休みです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5725, 101, 1, 4, 0, 119301, 1, 0, "お兄ちゃんと\nおそろいのコーデで\nクリスマスデート…\nしたいなぁ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5726, 102, 1, 8, 0, 119301, 1, 0, "お兄ちゃんに\nプレゼントする編み物\nこれで３着目～と♪\nあれ、作りすぎ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5727, 1, 2, 1, 0, 119301, 1, 0, "えへへ、もっと近くで\n見たくありませんか？\n私のとっておきの\nクリスマスコーデ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5728, 2, 2, 1, 0, 119301, 1, 0, "お兄ちゃんが風邪を\n引いたら一大事です！\n私の編み物で暖かく\nしてあげます♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5729, 3, 2, 1, 0, 119301, 1, 0, "お兄ちゃん、ほっぺに\nケーキのクリームが\nついちゃってますよ♪\n私がとってあげます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5730, 4, 2, 1, 0, 119301, 1, 0, "お兄ちゃん！\nケーキ、あーんって\nしてあげます！\nほら、あーん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5731, 101, 2, 4, 0, 119301, 1, 0, "クリスマスは大切な\n人と過ごすものっ！\nお兄ちゃん…妹の予定\n空いてますよっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5732, 102, 2, 8, 0, 119301, 1, 0, "クリスマスはずっと、\nお兄ちゃんと一緒に\nいたい…って言ったら\n欲張り…すぎですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5733, 1, 2, 1, 0, 119301, 1, 1, "早起きは３本お得！\n…クリスマスなら\n追加で10本ぐらい\nもらえちゃうかも！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5734, 2, 2, 1, 0, 119301, 1, 2, "お昼はケーキ？\nそれとも七面鳥？\nごちそういっぱいで\n迷っちゃいますね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5735, 3, 2, 1, 0, 119301, 1, 3, "お兄ちゃんと\nクリスマスに夜更かし\n…えへへ、ちょっぴり\nドキドキしちゃう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5737, 2, 3, 1, 0, 119301, 1, 0, "編み物をするには\n絶好のくつろぎ空間\nですね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5738, 3, 3, 1, 0, 119301, 1, 0, "なんというかわいさ…\nクリスマス\nプレゼントに\nもってこいですね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5739, 4, 3, 1, 0, 119301, 1, 0, "これがお兄ちゃんの\nお部屋の香り…？\nんん～！　ずっと\nかいでいたいです～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5740, 5, 3, 1, 0, 119301, 1, 0, "ふぁ、あったか～い…\n冬場はこういうのが\nありがたいですね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5742, 7, 3, 1, 0, 119301, 1, 0, "ごちそうだぁ～♪\nほら、お兄ちゃんも\n食べて食べてっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5743, 8, 3, 1, 0, 119301, 1, 0, "クリスマスデートの\n必勝法…こ、これは\n読むしかないです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5745, 14, 3, 1, 0, 119301, 1, 0, "わっ、すごいです～！\nこれを飾っておけば\nクリスマスが一層\n賑やかになりますね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5746, 15, 3, 1, 0, 119301, 1, 0, "さぷらーいずっ！\nリマちゃんじゃなくて\nリノちゃんでした～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5747, 1, 1, 1, 0, 120601, 1, 0, "ミミにもミソギにも\nあの人にも頼りに\nしてもらえるように\nしっかりしなきゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5748, 2, 1, 1, 0, 120601, 1, 0, "ミミはにんじんを\n食べられてすごいな…\n私も見習わなきゃ\nがんばろう…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5749, 3, 1, 1, 0, 120601, 1, 0, "ミソギから怖い話\n聞いちゃった…\nうぅ…誰か一緒に\nいてくれないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5750, 4, 1, 1, 0, 120601, 1, 0, "立派な大人に\nなれるように\nいっぱい勉強\nしておかなくっちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5751, 5, 1, 1, 0, 120601, 1, 0, "なんだか…あの人の\nあやしい視線を\n感じるような…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5752, 101, 1, 4, 0, 120601, 1, 0, "あの人に勉強を\n教えられるように\nしっかり予習を\nしておこうっと…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5753, 102, 1, 8, 0, 120601, 1, 0, "今日はあの人と\n一緒に冒険できる…\nなんだかワクワク\nしてきちゃった…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5754, 1, 2, 1, 0, 120601, 1, 0, "あ、いいとこに来て\nくれましたね！\nあなたに頼みたい\nことがあるんです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5755, 2, 2, 1, 0, 120601, 1, 0, "きゃあっ！？\nへ、変なところを\n触らないでください！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5756, 3, 2, 1, 0, 120601, 1, 0, "どうですかこの格好？\nかわいい、ですか…？\nそ、そうですか…\nありがとうございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5757, 4, 2, 1, 0, 120601, 1, 0, "ひゃあっ…！\nすみません、勉強に\n集中してたので\n驚いちゃいました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5758, 101, 2, 4, 0, 120601, 1, 0, "一緒に勉強して立派な\n大人になりましょうね\n私がそばで見張ってて\nあげます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5759, 102, 2, 8, 0, 120601, 1, 0, "まだ立派ではないかも\nですけど、私よりも\n大人なあなたのことは\n頼りにしてますからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5760, 1, 2, 1, 0, 120601, 1, 1, "立派な大人は\n朝の時間の使い方が\n上手だと聞きました\nあなたはどうですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5761, 2, 2, 1, 0, 120601, 1, 2, "ミミとミソギと\nあなたと…大事な人と\n一緒のお昼ごはんは\nやさしい味がしますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5762, 3, 2, 1, 0, 120601, 1, 3, "うぅ…怖い話を\n思い出しちゃいました\n寝るまで一緒に\nいてくれますか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5764, 2, 3, 1, 0, 120601, 1, 0, "すごい座り心地…！\nとっても勉強が\nはかどりそう…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5765, 3, 3, 1, 0, 120601, 1, 0, "この子…なんだか\nミミに似てるような\n気がする…ふふっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5766, 4, 3, 1, 0, 120601, 1, 0, "いい香り…♪\n勉強で疲れた\n頭がリフレッシュ\nできそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5767, 5, 3, 1, 0, 120601, 1, 0, "ぽかぽかだ…♪\nミミとミソギと\nあの人と一緒に\nいるときみたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5769, 7, 3, 1, 0, 120601, 1, 0, "いっぱい食べたら\n早く大人になれたり\nしないかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5770, 8, 3, 1, 0, 120601, 1, 0, "あう…\n知らない単語が…\nちゃんと調べて\n覚えなくっちゃ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5773, 1, 1, 1, 0, 120401, 1, 0, "うさぎさんが\nぴょ～んぴょん♪\nみんなえがおで\nるんたった～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5774, 2, 1, 1, 0, 120401, 1, 0, "キョウカちゃんも\nいつかにんじんさんを\n好きになってくれたら\nうれしいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5775, 3, 1, 1, 0, 120401, 1, 0, "今日のミソギちゃんの\nイタズラ、びっくり\nしちゃったけど\nおもしろかったな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5776, 4, 1, 1, 0, 120401, 1, 0, "このおうち、いつも\nいろんな人がいて\nドキドキぴょんぴょん\nって楽しいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5777, 5, 1, 1, 0, 120401, 1, 0, "いいお天気～♪\nお外でみんなと\nいっぱい遊びたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5778, 101, 1, 4, 0, 120401, 1, 0, "ミソギちゃんも\nキョウカちゃんも\nおにいちゃんがいると\nずっと笑顔だね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5779, 102, 1, 8, 0, 120401, 1, 0, "おにいちゃんにはやく\nあいたいな～♪\nまだかな、まだかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5780, 1, 2, 1, 0, 120401, 1, 0, "えへへ♪\nおにいちゃんに\nなでなでされると\nぽかぽかするね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5781, 2, 2, 1, 0, 120401, 1, 0, "聞いて、おにいちゃん\nさっきね、かわいい\nちょうちょさんに\n会ったんだよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5782, 3, 2, 1, 0, 120401, 1, 0, "ふわっ…！\nおにいちゃんの顔を\nお絵かきしてたから\nびっくりしちゃった♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5783, 4, 2, 1, 0, 120401, 1, 0, "おにいちゃんも\n遊びたいの？\nそれじゃあ二人も\n呼んで遊ぼう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5784, 101, 2, 4, 0, 120401, 1, 0, "おにいちゃんも\nみんなも、優しい人\nばっかりで\nミミ幸せ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5785, 102, 2, 8, 0, 120401, 1, 0, "おにいちゃん♪\n高い高いしてほしいな\nすっごくぴょんぴょん\nできて、好きなんだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5786, 1, 2, 1, 0, 120401, 1, 1, "おはよう～♪\nおにいちゃん、今日は\nおひさまみたいに\nきらきら元気だね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5787, 2, 2, 1, 0, 120401, 1, 2, "おひるごはんだね～♪\nにんじんさんを\nいっぱい食べて\n元気いっぱい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5788, 3, 2, 1, 0, 120401, 1, 3, "ふわあ…\n眠くなってきちゃった\nおにいちゃん、\n一緒に寝よう～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5790, 2, 3, 1, 0, 120401, 1, 0, "ふわぁ、気持ちいい♪\nずっとこうやって\n座ってたくなるね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5791, 3, 3, 1, 0, 120401, 1, 0, "わあ、かわいい～\nぎゅ～っ、ぎゅ～っ♪\nこれで仲よしだね\nえへへ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5792, 4, 3, 1, 0, 120401, 1, 0, "気持ちいいにおい～♪\nぴょんぴょんしたく\nなってきちゃった♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5793, 5, 3, 1, 0, 120401, 1, 0, "あったかぽかぽか♪\nおにいちゃんも\nきてくれたら、もっと\nあったかくなりそう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5795, 7, 3, 1, 0, 120401, 1, 0, "もぐもぐ…ごっくん♪\nおっきくなりたいから\nいっぱい食べるよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5796, 8, 3, 1, 0, 120401, 1, 0, "えへへ、おもしろ～い\nこの絵本ね、\nキョウカちゃんから\n教えてもらったんだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5799, 1, 1, 1, 0, 120501, 1, 0, "この部屋…探索の\nしがいがありそう！\nついでにイタズラも\nしかけちゃお♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5800, 2, 1, 1, 0, 120501, 1, 0, "ミミってああ見えて\n実は大胆で度胸も\nあるよね…ちょっと\nかっこいいな…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5801, 3, 1, 1, 0, 120501, 1, 0, "怖い話を聞いた時の\nキョウカって\n面白いんだよね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5802, 4, 1, 1, 0, 120501, 1, 0, "にいちゃんが\n慣れちゃわないように\nまた新しいイタズラを\n考えなきゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5803, 5, 1, 1, 0, 120501, 1, 0, "イタズラもいいけど\nミミとキョウカと\nにいちゃんと、普通に\n遊ぶのも楽しいなぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5804, 101, 1, 4, 0, 120501, 1, 0, "ミミにキョウカ、\nそれににいちゃん！\nみんなそろえば愉快な\n冒険が始まりそう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5805, 102, 1, 8, 0, 120501, 1, 0, "次はどんなイタズラを\nしたら、にいちゃんは\n喜んでくれるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5806, 1, 2, 1, 0, 120501, 1, 0, "今ミソギに触ったね？\nヤバいよにいちゃん…\n逃げないとトラップが\n発動しちゃうよ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5807, 2, 2, 1, 0, 120501, 1, 0, "わわっ！？　びっくり\nしたあ…！　新しい\nトラップを作ってて\n気づかなかったよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5808, 3, 2, 1, 0, 120501, 1, 0, "お？　にいちゃん、\nイタズラする側にも\n興味があるの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5809, 4, 2, 1, 0, 120501, 1, 0, "にいちゃんなにか用？\nあ、もしかして…\nミソギと遊びたく\nなっちゃった？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5810, 101, 2, 4, 0, 120501, 1, 0, "ベストタイミングだよ\nにいちゃん！\n今からみんなで探検に\n行くところなんだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5811, 102, 2, 8, 0, 120501, 1, 0, "にいちゃんってさ\nホントに優しいよね\nなにしても怒らないし\n…ありがとね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5812, 1, 2, 1, 0, 120501, 1, 1, "にいちゃんおはよー！\n景気づけに本日\n一発目のイタズラ、\nやっちゃうよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5813, 2, 2, 1, 0, 120501, 1, 2, "お昼ごはんはロシアン\nサンドイッチだよ！\nさあ、にいちゃん！\n好きなの選んでよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5814, 3, 2, 1, 0, 120501, 1, 3, "夜ってなんだか\nワクワクしてなかなか\n眠れないんだよね\nにいちゃんはどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5816, 2, 3, 1, 0, 120501, 1, 0, "この座り心地のよさ…\nなにかのトラップに\nうまく使えないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5817, 3, 3, 1, 0, 120501, 1, 0, "こういうのに細工して\nミミやキョウカを\n驚かせると、いい反応\nするんだよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5818, 4, 3, 1, 0, 120501, 1, 0, "においをうまく使った\nイタズラって…\nなにかないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5819, 5, 3, 1, 0, 120501, 1, 0, "あったまりながら\n新しいイタズラを\n考えると、いい案が\n出て来たりするんだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5821, 7, 3, 1, 0, 120501, 1, 0, "おいしくてついつい\n食べ過ぎちゃうなぁ…\nはっ…！？　これって\nまさかトラップ…！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5822, 8, 3, 1, 0, 120501, 1, 0, "このキョウカから\n借りた冒険物語\nすっごく\nおもしろいんだよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5825, 1, 1, 1, 0, 120801, 1, 0, "晴れ着を着ると\nなんだか心が躍るね\n足取りも軽く\nなるってもんさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5826, 2, 1, 1, 0, 120801, 1, 0, "正月の食べ物ってのは\n美味いもんだね\nいくらでも\n食べれちまうよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5827, 3, 1, 1, 0, 120801, 1, 0, "普段は好き勝手してる\nアタシらも\n正月くらいは\n大人しくするさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5828, 4, 1, 1, 0, 120801, 1, 0, "年越しそばに雑煮\nこの季節は\n温かいものが\n体に沁みるね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5829, 5, 1, 1, 0, 120801, 1, 0, "正月だからって\nのんびりしすぎたね\nちょっと釣りにでも\n行こうかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5830, 101, 1, 4, 0, 120801, 1, 0, "いい正月だね\nいつかあの子と\n一杯やりたいもんだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5831, 102, 1, 8, 0, 120801, 1, 0, "大事な人と過ごす\n正月ってのがこんなに\n楽しいもんだとはね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5832, 1, 2, 1, 0, 120801, 1, 0, "部屋があったかくて\n顔が火照っちまったよ\nちょいと外に涼みに\n行かないか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5833, 2, 2, 1, 0, 120801, 1, 0, "餅ってのは\n何をつけてもうまいね\nお前さんは\nどの味が好きだい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5834, 3, 2, 1, 0, 120801, 1, 0, "お祝いの鯛が\n足りないって？\nそれじゃあアタシが\n釣ってきてやるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5835, 4, 2, 1, 0, 120801, 1, 0, "おせちが美味いのは\n分かるけど\n食べ過ぎには\n気を付けるんだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5836, 101, 2, 4, 0, 120801, 1, 0, "お前さんのおかげで\nいい正月を\n迎えられたよ\nありがとさん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5837, 102, 2, 8, 0, 120801, 1, 0, "慣れない晴れ着も\nお前さんに見て\nもらえたなら\n着たかいがあったね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5838, 1, 2, 1, 0, 120801, 1, 1, "おはようさん\n寒いのは分かるけど\nいい加減布団から\n出て顔洗ってきな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5839, 2, 2, 1, 0, 120801, 1, 2, "今日の昼飯は雑煮だ\nアタシの郷土の味\nしっかり味わって\nおくれよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5840, 3, 2, 1, 0, 120801, 1, 3, "おや、お前さんも\n夜ふかしかい？\n退屈してたところさ\n付き合っておくれよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5842, 2, 3, 1, 0, 120801, 1, 0, "晴れ着だと座り方にも\n気を遣うね\nしわになったら大変さ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5843, 3, 3, 1, 0, 120801, 1, 0, "せっかくだし\nこの子にも晴れ着を\n着せてあげたいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5844, 4, 3, 1, 0, 120801, 1, 0, "これは冬の花の香り…\n風情があって\nいいじゃないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5845, 5, 3, 1, 0, 120801, 1, 0, "あったかいねぇ…\nこんな寒い日には\nまさに天国だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5847, 7, 3, 1, 0, 120801, 1, 0, "いつも食べてる\nものでも正月に\n食べると\n新鮮な気がするね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5848, 8, 3, 1, 0, 120801, 1, 0, "せっかくの正月休みだ\nたまにはゆっくりと\n本でも読もうかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5850, 1, 1, 1, 0, 120701, 1, 0, "新年のあいさつ…\n私も街のみんなに\nしてみようかしら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5851, 2, 1, 1, 0, 120701, 1, 0, "正月はゆっくり過ごす\nのよね…ゆっくりって\n何したらいいのかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5852, 3, 1, 1, 0, 120701, 1, 0, "この格好も\n慣れてくれば\n動きやすいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5853, 4, 1, 1, 0, 120701, 1, 0, "う～ん、今年の抱負…\nやりたいことが\nたくさんあるのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5854, 5, 1, 1, 0, 120701, 1, 0, "おせち料理\nネビアの分も\n用意しなくちゃね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5855, 101, 1, 4, 0, 120701, 1, 0, "ふふっ\n正月っていいわね\nみんな楽しそうだもの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5856, 102, 1, 8, 0, 120701, 1, 0, "新年の思い出…\nこれからもっと作るわ\nそれが私の抱負よ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5857, 1, 2, 1, 0, 120701, 1, 0, "今日は家で過ごすの？\nあなたと一緒なら\nきっと楽しいわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5858, 2, 2, 1, 0, 120701, 1, 0, "どう？　この格好？\nコッコロさんは\n褒めてくれたけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5859, 3, 2, 1, 0, 120701, 1, 0, "ちょうど良かったわ\nあなたも大掃除\n手伝ってくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5860, 4, 2, 1, 0, 120701, 1, 0, "これから料理するけど\nお雑煮と焼き餅\nどっちが好きかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5861, 101, 2, 4, 0, 120701, 1, 0, "『今の私』にとって\n初めての正月だもの\nあなたと楽しまないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5862, 102, 2, 8, 0, 120701, 1, 0, "去年よりも今年…\nもっと成長するからね\n…お兄ちゃん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5863, 1, 2, 1, 0, 120701, 1, 1, "おはよう\nせっかくの正月だもの\n朝から楽しまないとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5864, 2, 2, 1, 0, 120701, 1, 2, "ねぇ…\n良かったら正月の遊び\n教えてくれるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5865, 3, 2, 1, 0, 120701, 1, 3, "ふわぁ～…今日が\n終わっちゃうのが…\nもったいないわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5867, 2, 3, 1, 0, 120701, 1, 0, "ふぅ…お参り後だから\n心地よすぎて眠って\nしまいそうだわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5868, 3, 3, 1, 0, 120701, 1, 0, "ふふっ\nかわいいものって\n癒されるわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5869, 4, 3, 1, 0, 120701, 1, 0, "…ん\nこれが梅の香り？\n…いい匂いね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5870, 5, 3, 1, 0, 120701, 1, 0, "キャルじゃないけど…\nこのまま丸く\nなりたいところね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5872, 7, 3, 1, 0, 120701, 1, 0, "はむはむっ…♪\nせっかくの正月だもの\n堪能しなくちゃね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5873, 8, 3, 1, 0, 120701, 1, 0, "…ふんふん\n帯の結び方って\nこんなにあるのね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5875, 103, 1, 12, 0, 104201, 1, 0, "今の私が作れる\n最高の一曲…\nあの人に届くといいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5876, 103, 2, 12, 0, 104201, 1, 0, "あの、歌を…\n聞いてくれませんか？\nあなたに贈る\n特別な歌を");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5877, 1, 1, 1, 0, 120901, 1, 0, "ひい、ふう…\nむむ、みなに配る\nお年玉のポチ袋が\n残りわずかなのじゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5878, 2, 1, 1, 0, 120901, 1, 0, "宴の準備はわらわに\n任せておくのじゃ！\n支配者の手腕、\n見せつけてくれる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5879, 3, 1, 1, 0, 120901, 1, 0, "新年の願掛けなら\nわらわにすればよい\n支配者に頼むほうが\n確実じゃろう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5880, 4, 1, 1, 0, 120901, 1, 0, "みなからもらった\nこの年賀状とやら…\nわらわも\n書いてみようかの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5881, 5, 1, 1, 0, 120901, 1, 0, "正月飾りにもいろいろ\n種類があるんじゃの～\nどれも華々しくて\nわらわ好みじゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5882, 101, 1, 4, 0, 120901, 1, 0, "あやつへのお年玉は\nちと多めにしておくか\n…日ごろの感謝も\n込めてのう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5883, 102, 1, 8, 0, 120901, 1, 0, "あやつのことを想うと\nそれだけで行く年\n来る年が楽しみになる\nふふ、愉快なやつじゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5884, 1, 2, 1, 0, 120901, 1, 0, "みなに晴れ着を\n褒められて、とても\nよい気分なのじゃ♪\n次はお主の番じゃぞ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5885, 2, 2, 1, 0, 120901, 1, 0, "お主へのお年玉は\nいちばん最後じゃ！\n残り物には福が宿る\nそうじゃからのう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5886, 3, 2, 1, 0, 120901, 1, 0, "この季節は手が\nかじかむのう…ほれ、\nお主！　わらわの手を\nあたためるのじゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5887, 4, 2, 1, 0, 120901, 1, 0, "お主のために雑煮を\n手作りしてみたのじゃ\n食べていくがよい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5888, 101, 2, 4, 0, 120901, 1, 0, "眷属のお主に\n正月休みはまだ早い！\nずっとわらわのそばに\n控えておくのじゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5889, 102, 2, 8, 0, 120901, 1, 0, "ふふ、これほど楽しい\n正月は初めてじゃ…\nお主と過ごす時間は\nいつだって特別じゃな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5890, 1, 2, 1, 0, 120901, 1, 1, "早起きしてわらわを\n待っておったのか？\nさすがはわらわの眷属\n殊勝な心がけじゃな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5891, 2, 2, 1, 0, 120901, 1, 2, "食事どきじゃな\n正月の宴会料理が\nわらわたちを\n待っておるぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5892, 3, 2, 1, 0, 120901, 1, 3, "夜も更けてきたのう\n冬の夜は長い…\n心ゆくまでお主と\n過ごせるわけじゃな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5894, 2, 3, 1, 0, 120901, 1, 0, "実に心地がよい♪\nこのまま寝正月も\n悪くないかも\nしれぬのう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5895, 3, 3, 1, 0, 120901, 1, 0, "愛いやつじゃのう\nわらわのそばに置いて\nやってもよいぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5896, 4, 3, 1, 0, 120901, 1, 0, "品のある香りじゃのう\n寝室に置いておけば\nなにかご利益に\nあずかれそうじゃな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5897, 5, 3, 1, 0, 120901, 1, 0, "心地よい…\nわらわはしばらく\nここから動かぬぞ\nお主も付き合うがよい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5899, 7, 3, 1, 0, 120901, 1, 0, "舌鼓が鳴るのう♪\n正月の宴には\n持ってこいの品じゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5900, 8, 3, 1, 0, 120901, 1, 0, "ほう、新春にはそんな\n習わしが…正月を\n制するには、まだまだ\n勉強が必要じゃのう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5902, 1, 1, 1, 0, 121001, 1, 0, "久しぶりの我が家って\n感じです！　やっぱり\nここが一番ですね〜！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5903, 2, 1, 1, 0, 121001, 1, 0, "さあ食べましょう！\nみんなで囲める食卓を\n心から味わいますよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5904, 3, 1, 1, 0, 121001, 1, 0, "ランドソルに\n帰ってきた途端に\nお腹が空きました〜！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5905, 4, 1, 1, 0, 121001, 1, 0, "ただいま☆\n幸せ特盛りの\nわたしの日常！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5906, 5, 1, 1, 0, 121001, 1, 0, "ようやくランドソルに\n帰ってきたことですし\nやっぱり魔物料理を\nいただきましょう☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5907, 101, 1, 4, 0, 121001, 1, 0, "あの人との絆を\n守るために\nもっともっと食べて\n強くならなくちゃ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5908, 102, 1, 8, 0, 121001, 1, 0, "いつもありがとうって\nあの人を思いっきり\n抱きしめたいです☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5909, 1, 2, 1, 0, 121001, 1, 0, "あなたの想いは\nこの身をかけて\n全力で受け止めます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5910, 2, 2, 1, 0, 121001, 1, 0, "おかえりなさい☆\nここにいるみんなも\nあなたの帰りをずっと\n待っていましたよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5911, 3, 2, 1, 0, 121001, 1, 0, "このギルドハウスで\n冒険の疲れを\n癒しましょう〜！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5912, 4, 2, 1, 0, 121001, 1, 0, "あなたの想いが\n全力全開を超える\n力をくれました！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5913, 101, 2, 4, 0, 121001, 1, 0, "日常が続く幸せを\nあなたと一緒に\nかみしめたいです☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5914, 102, 2, 8, 0, 121001, 1, 0, "ぎゅ〜っ！\nわたしたちは\nどんなことがあっても\nずっと一緒ですよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5915, 1, 2, 1, 0, 121001, 1, 1, "おはようございます！\nあなたと過ごせる\n幸せを、今日も\n味わいますよ〜！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5916, 2, 2, 1, 0, 121001, 1, 2, "ご飯の時間ですよー！\nあなたも一緒に\n食べましょうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5917, 3, 2, 1, 0, 121001, 1, 3, "明日もあなたが隣に\nいてくれることを\n心から願ってますよ\nおやすみなさい☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5919, 2, 3, 1, 0, 121001, 1, 0, "ふい〜…\n安心できる場所で\nくつろげるって\n幸せですね〜…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5920, 3, 3, 1, 0, 121001, 1, 0, "じゅるり…\n食べたくなっちゃう\nくらい、かわいい☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5921, 4, 3, 1, 0, 121001, 1, 0, "くんくん…おおー！\nステーキの香り！\nやばいですね☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5922, 5, 3, 1, 0, 121001, 1, 0, "体がぽかぽかしてきて\nわたしの食欲も\n燃えてきましたよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5924, 7, 3, 1, 0, 121001, 1, 0, "わたしの食欲に\nついてこられますか？\nまだまだ食べますよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5925, 8, 3, 1, 0, 121001, 1, 0, "これがキャルちゃんの\n言っていた、キスで\n目覚める王子様の\nおとぎ話ですか〜☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5927, 1, 1, 1, 0, 121201, 1, 0, "自分で自分を\n分析するのも、これは\nこれで面白い…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5928, 2, 1, 1, 0, 121201, 1, 0, "強過ぎる力の扱いには\n注意しないと…\n七冠がいい例だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5929, 3, 1, 1, 0, 121201, 1, 0, "少年の交友関係は\n計り知れないな…\nアタシも含むのか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5930, 4, 1, 1, 0, 121201, 1, 0, "原理を徹底解明して\n再発を防ぐぞー！\n…誰か手伝って～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5931, 5, 1, 1, 0, 121201, 1, 0, "これは祝福にも\n呪いにもなる…\n忘れずにいよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5932, 101, 1, 4, 0, 121201, 1, 0, "少年が\n目を覚ましてくれて\n本当によかった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5933, 102, 1, 8, 0, 121201, 1, 0, "彼以外を選んでいたら\n今回の事態は\n乗り切れなかったな…\nさすがだよ、少年");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5934, 1, 2, 1, 0, 121201, 1, 0, "少年！　調子はどう？\nクレープ食べられる？\nっていうか食べて？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5935, 2, 2, 1, 0, 121201, 1, 0, "元気そうで何よりだ\nまた店を手伝いに\nきてよ。二人もキミに\n会いたがってたしさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5936, 3, 2, 1, 0, 121201, 1, 0, "キミの診察もあるし\n今はなるべくそばに\nいるよ。迷惑じゃ\nなければだけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5937, 4, 2, 1, 0, 121201, 1, 0, "やっぱり少年は\nあちこちで人を\n助けてる時が\n一番輝いてるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5938, 101, 2, 4, 0, 121201, 1, 0, "アタシは大したこと\nしてないけど\nみんなのことは\n褒めてあげてね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5939, 102, 2, 8, 0, 121201, 1, 0, "みんなを笑顔に\nできるのは\nやっぱり少年だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5940, 1, 2, 1, 0, 121201, 1, 1, "やあ少年\n朝寝坊はしてない？\nそれじゃ、よい１日を");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5941, 2, 2, 1, 0, 121201, 1, 2, "おや、少年！\nまかないのクレープ\n作ったけど、食べる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5942, 3, 2, 1, 0, 121201, 1, 3, "ふわぁ…もう夜か…\n研究してたら\nあっという間だね…\nおやすみ、少年");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5944, 2, 3, 1, 0, 121201, 1, 0, "体がなまってたのか\n前線に出ると疲れる…\nまさか…年のせい！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5945, 3, 3, 1, 0, 121201, 1, 0, "キミたちも今の\nアタシと同じ感じに\nアレンジしてあげよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5946, 4, 3, 1, 0, 121201, 1, 0, "誰が置いたんだろう？\nいい香りだねぇ…\nうん、気に入った♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5947, 5, 3, 1, 0, 121201, 1, 0, "何も考えてない時間も\n実は思考にとって\n大事なんだよね～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5949, 7, 3, 1, 0, 121201, 1, 0, "食の大切さは\nいつの食事からも\n感じられるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5950, 8, 3, 1, 0, 121201, 1, 0, "ふむ…面白い！\n今度全巻\n借りにこようっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5952, 1, 1, 1, 0, 116401, 1, 0, "聖学祭か…\n良い記憶はないな\nよし忘れよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5953, 2, 1, 1, 0, 116401, 1, 0, "健全なる精神は\n健全なる肉体に宿る…\nはっ、知ったことかよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5954, 3, 1, 1, 0, 116401, 1, 0, "暇だし鏡でも見るか…\nえへへ、ユニだよ♪\nよし子供料金いけるな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5955, 4, 1, 1, 0, 116401, 1, 0, "アオイ君は元気に\nしているだろうか…\n彼女は人一倍ぼくに\n懐いていたからな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5956, 5, 1, 1, 0, 116401, 1, 0, "そろそろシズル君は\n姉という幻想から\n目覚めただろうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5957, 101, 1, 4, 0, 116401, 1, 0, "ぼくは来年も聖学祭に\n行くさ…卒業しても\n君らとは永遠だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5958, 102, 1, 8, 0, 116401, 1, 0, "最近同志の登校率が\n減少傾向だな…\nまあ仕方ないのだが…\nないのだが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5959, 1, 2, 1, 0, 116401, 1, 0, "ほわあああ！\nおい急に話しかけるな\n学びがこぼれる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5960, 2, 2, 1, 0, 116401, 1, 0, "この体操着、周囲から\n大層評判が良いのだよ\nたいそうだけにな\nどやっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5961, 3, 2, 1, 0, 116401, 1, 0, "何を着ていようと\nぼくはぼくさ\n外見など所詮は\n魂の識別符に過ぎん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5962, 4, 2, 1, 0, 116401, 1, 0, "救護院のアヤネ君が\n最近ぼくの自称年齢に\n疑念を持ち始めてな…\nあの熊…殺るか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5963, 101, 2, 4, 0, 116401, 1, 0, "うん？　なんだね？\nなに、用は無い？\n用も無いのに呼ぶとは\nもしや…これが友達！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5964, 102, 2, 8, 0, 116401, 1, 0, "この服が似合ってる？\nな、なんだね突然…\nやめたまえよでゅふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5965, 1, 2, 1, 0, 116401, 1, 1, "ふぁ～あ…\n朝も更けてきたな…\nそろそろ寝るか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5966, 2, 2, 1, 0, 116401, 1, 2, "ふぁ～あ…もう昼だ…\n人間の起きている\n時間ではないな…\n早く寝なくては…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5967, 3, 2, 1, 0, 116401, 1, 3, "うーん、よく寝た！\n気持ちのいい夜だな\n今日も一日がんばるぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5969, 2, 3, 1, 0, 116401, 1, 0, "ほわぁ～…\nもしやこれは都で噂の\n人を駄目にするやつ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5970, 3, 3, 1, 0, 116401, 1, 0, "ふむ、愛くるしいな\nだが似合い過ぎる…\nぼくが持つと我ながら\n子供にしか見えん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5971, 4, 3, 1, 0, 116401, 1, 0, "アロマか、興味深いな\nミツキ印ポーションも\n気化させて鼻腔から\n吸入してみるか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5972, 5, 3, 1, 0, 116401, 1, 0, "んふ、んふふ…\n火ってイイよね…\nずっと見てられるね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5974, 7, 3, 1, 0, 116401, 1, 0, "や、やめろ…\nとめどなく固形食物を\n生産するのはやめろ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5975, 8, 3, 1, 0, 116401, 1, 0, "この可愛げのない筆致\nやはり作者は理系か！\nぐああ目が理系になる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5977, 1, 1, 1, 0, 121101, 1, 0, "…あいつのためなら\n無理くらいいくらでも\nしてやるわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5978, 2, 1, 1, 0, 121101, 1, 0, "この姿、\n魔力の制御ムズ過ぎ…\nま、あたしは優秀だし\nどうとでもなるけど！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5979, 3, 1, 1, 0, 121101, 1, 0, "あいつのこと、\n全部受け入れるって\n決めたから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5980, 4, 1, 1, 0, 121101, 1, 0, "今なら誰だろうと\n負ける気がしないわ\nドラゴンでもなんでも\nかかってこいっての！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5981, 5, 1, 1, 0, 121101, 1, 0, "散々助けられた分、\n今度はあたしが\nあいつのこと助けるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5982, 101, 1, 4, 0, 121101, 1, 0, "あいつとの\nこれまでの冒険は\nどれも、あたしの\n大切な思い出…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5983, 102, 1, 8, 0, 121101, 1, 0, "もしまたあいつが\n寝たままになったら\nなんだってするわ\nキ…キスでも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5984, 1, 2, 1, 0, 121101, 1, 0, "なに、お腹空いたの？\nなら、おいしいご飯を\n食べに行きましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5985, 2, 2, 1, 0, 121101, 1, 0, "やっぱ、\nあんたのアホ面見ると\n安心するわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5986, 3, 2, 1, 0, 121101, 1, 0, "【美食殿】はあんたと\nぺコリーヌがいなきゃ\n始まんないっての");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5987, 4, 2, 1, 0, 121101, 1, 0, "ひゃあっ！？\n急に声かけないで！？\n魔力が暴発しても\n知らないわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5988, 101, 2, 4, 0, 121101, 1, 0, "…あんたとこうして\nぼーっと過ごす時間、\nまあ…嫌いじゃないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5989, 102, 2, 8, 0, 121101, 1, 0, "あんたが信じて\n見守っててくれれば…\nあたし、\nなんだってできるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5990, 1, 2, 1, 0, 121101, 1, 1, "おはよ\n早く顔洗いなさいよ、\nこのねぼすけ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5991, 2, 2, 1, 0, 121101, 1, 2, "今日のお昼は\nどこで食べる？\nあんたが\n決めていいわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5992, 3, 2, 1, 0, 121101, 1, 3, "もしあんたがまた\n夢に囚われても\nあたしが助けるわ\n安心して寝なさいよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5994, 2, 3, 1, 0, 121101, 1, 0, "気持ちいい～…♪\nあいつもたまには\nこうして休ませなきゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5995, 3, 3, 1, 0, 121101, 1, 0, "一目惚れしたかも…！\nこの子、\n部屋に飾りたいわー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5996, 4, 3, 1, 0, 121101, 1, 0, "へぇ、あいつって\nこういう匂いが\n好きなのかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5997, 5, 3, 1, 0, 121101, 1, 0, "暖かくて最高…♪\n丸くなっちゃいそう…\nうにゃあ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (5999, 7, 3, 1, 0, 121101, 1, 0, "イケるわね、これ！\nやっぱり食べるって\n大事よねー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6000, 8, 3, 1, 0, 121101, 1, 0, "ファーストキスは\nどんな味、ね…\nふ、ふ～ん…？\nなるほど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6002, 1, 1, 1, 0, 118101, 1, 0, "お友だち…\nできるかしら…？\nこんなわたしでも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6003, 2, 1, 1, 0, 118101, 1, 0, "あまり、きょろきょろ\nしちゃダメよね…\n変な子だと、\n思われてしまうわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6004, 3, 1, 1, 0, 118101, 1, 0, "広い場所、\n落ち着かない…\nはぅ…どこにいれば…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6005, 4, 1, 1, 0, 118101, 1, 0, "～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6006, 5, 1, 1, 0, 118101, 1, 0, "【レイジ・レギオン】\n…またいつか、\nみんなと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6007, 101, 1, 4, 0, 118101, 1, 0, "…一度でいいから、\nわたしもママって…\nあっ、その…\n…な、なんでもないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6008, 102, 1, 8, 0, 118101, 1, 0, "ここが、今のわたしに\nとっての帰る場所…\n…そう思っても、\nいいのかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6009, 1, 2, 1, 0, 118101, 1, 0, "ええと…\nお腹、空いてる？\nおねむじゃない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6010, 2, 2, 1, 0, 118101, 1, 0, "ここにいると\n邪魔かしら…？\nならもっと隅っこに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6011, 3, 2, 1, 0, 118101, 1, 0, "お喋り…？\nわたしでいいの…？\nうれしい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6012, 4, 2, 1, 0, 118101, 1, 0, "あなたの好きな歌…\n教えて…？\n練習、するから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6013, 101, 2, 4, 0, 118101, 1, 0, "ここは賑やかだけど…\nうるさいとは感じない\nむしろ、心地いい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6014, 102, 2, 8, 0, 118101, 1, 0, "安心、して…\nわたしの歌で、\nあなたを守るから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6015, 1, 2, 1, 0, 118101, 1, 1, "ちょっとだけ…\n朝は、苦手…\n…ふぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6016, 2, 2, 1, 0, 118101, 1, 2, "お昼は、食べた？\n良かったら、一緒に…\n少し…焦げてるけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6017, 3, 2, 1, 0, 118101, 1, 3, "眠れないのかしら…\nじゃ、じゃあ…\n子守歌…聴く？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6019, 2, 3, 1, 0, 118101, 1, 0, "こんな特等席…\n恐縮、です…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6020, 3, 3, 1, 0, 118101, 1, 0, "い、今のうちに、\nこの子でお世話の\n練習を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6021, 4, 3, 1, 0, 118101, 1, 0, "いい香り…\n…つらい気持ちも\n癒してくれる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6022, 5, 3, 1, 0, 118101, 1, 0, "あったかい…\nいつまでも、\nこうしていられそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6024, 7, 3, 1, 0, 118101, 1, 0, "おいしく出来てる…\nすごいわ…\n見習わなくっちゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6025, 8, 3, 1, 0, 118101, 1, 0, "『赤ちゃんとママの\nスキンシップ入門』…\n…べ、勉強になるわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6027, 1, 1, 1, 0, 121301, 1, 0, "きれいなお部屋…！\n立派な舞台の\nセットみたい…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6028, 2, 1, 1, 0, 121301, 1, 0, "お芝居では私が先輩\nなんだから、しっかり\n私がミサキちゃんを\nエスコートしなきゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6029, 3, 1, 1, 0, 121301, 1, 0, "～～♪\n歌うお芝居も多いから\nもっと上手く\nなりたいな…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6030, 4, 1, 1, 0, 121301, 1, 0, "ここにいる人たちと\n仲良くなりたいな…\nそしたらきっと演技の\n幅も広げられるよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6031, 5, 1, 1, 0, 121301, 1, 0, "機会があったら\nアヤネちゃんとも\nお芝居してみたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6032, 101, 1, 4, 0, 121301, 1, 0, "お兄ちゃんに褒めて\nもらえるように\nお芝居の練習\nいっぱいしなきゃ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6033, 102, 1, 8, 0, 121301, 1, 0, "あう…お兄ちゃんを\n意識したら、台詞が\n飛んじゃったよぅ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6034, 1, 2, 1, 0, 121301, 1, 0, "あっ、お兄ちゃん…♪\nお芝居の練習を\n見てくれませんか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6035, 2, 2, 1, 0, 121301, 1, 0, "いまの発声練習\nどうでしたか？\nひゃん…！？\n頭は撫でないでぇ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6036, 3, 2, 1, 0, 121301, 1, 0, "ミサキちゃんも\nお芝居、とっても\n上達してるんですよ\n私も負けられません♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6037, 4, 2, 1, 0, 121301, 1, 0, "また物語を聞かせて\nほしい、ですか…？\n私なんかでよければ\nもちろんよろこんで♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6038, 101, 2, 4, 0, 121301, 1, 0, "新しいお話を\n考えてみました\n聞いてくれますか…？\nよかった…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6039, 102, 2, 8, 0, 121301, 1, 0, "いつか…舞台上じゃ\nなくても、照れずに\nお兄ちゃんに気持ちを\n伝えてみせますね…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6040, 1, 2, 1, 0, 121301, 1, 1, "おはようございます♪\nマヒルさんにもらった\nミルク、一緒に\n飲みませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6041, 2, 2, 1, 0, 121301, 1, 2, "牧場のみなさんに\nドングリパンを\nいただきました～\nおひとつどうぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6042, 3, 2, 1, 0, 121301, 1, 3, "寝る前にまたココアを\n飲みながら、お話を\n聞いてもらえますか？\nえへへ、うれしいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6044, 2, 3, 1, 0, 121301, 1, 0, "お芝居の練習の\nあとは、ここで\nお兄ちゃんと\nゆっくりしたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6045, 3, 3, 1, 0, 121301, 1, 0, "今日も演技の\n練習に付き合ってね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6046, 4, 3, 1, 0, 121301, 1, 0, "素敵な香り…\nこのイメージも\nお芝居に\n活かせないかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6047, 5, 3, 1, 0, 121301, 1, 0, "私もお芝居で\nみんなの心を\nぽかぽか温められる\nようになりたいな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6049, 7, 3, 1, 0, 121301, 1, 0, "舞台に立つんだから\n食べ過ぎないように\n気をつけないと。\nでも…おいしいなぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6050, 8, 3, 1, 0, 121301, 1, 0, "このお話、面白い…\n脚本を書く\n参考にもなりそう…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6052, 103, 1, 12, 0, 107501, 1, 0, "えへへ…♪\n二人で見た夕日…\nキレイでしたね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6053, 103, 2, 12, 0, 107501, 1, 0, "これから泳ぎの\n練習ですか？\n付き合いますよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6054, 103, 1, 12, 0, 107601, 1, 0, "主さまを導くことで\nわたくしも未知なる\n領域へと辿り着けます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6055, 103, 2, 12, 0, 107601, 1, 0, "主さまとなら\n海よりも深く\n空よりも高い場所へも\n目指せそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6056, 103, 1, 12, 0, 107801, 1, 0, "あいつと二人で\n夏の遠い海に…って\nあたしってば\nなに考えてるのよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6057, 103, 2, 12, 0, 107801, 1, 0, "あたしが楽しく\n過ごせるのはあんたが\nいてくれたからよ\nか、感謝してるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6058, 1, 1, 1, 0, 121401, 1, 0, "はぁ…アタシってば\nこんなにかわいくって\nキレイなんて罪よね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6059, 2, 1, 1, 0, 121401, 1, 0, "舞台の衣装を\nクリーニング\nしとかなくちゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6060, 3, 1, 1, 0, 121401, 1, 0, "舞台映えするメイク…\nスズナなら\n知ってるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6061, 4, 1, 1, 0, 121401, 1, 0, "物産展の会計係と\n山盛りの算数の宿題…\nどっちが簡単かしら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6062, 5, 1, 1, 0, 121401, 1, 0, "牧場と温泉の仕事に\nお芝居の練習に…\nちょ、ちょっと休憩～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6063, 101, 1, 4, 0, 121401, 1, 0, "お客さんの視線も\nうれしいけど…\nあいつも見てて\nくれてるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6064, 102, 1, 8, 0, 121401, 1, 0, "もっともっと\nセクシーになって\nあいつをビックリ\nさせてやるわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6065, 1, 2, 1, 0, 121401, 1, 0, "アンタも休憩？\nしっかり働くために\n休むのも大事よね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6066, 2, 2, 1, 0, 121401, 1, 0, "ふふん♪　アタシも\n料理ができるように\nなったんだから！\n簡単なのだけだけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6067, 3, 2, 1, 0, 121401, 1, 0, "温泉ってお肌に\nいいのよね？\nもっとキレイに\nなったらどうしよう〜");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6068, 4, 2, 1, 0, 121401, 1, 0, "物産展の荷物は\nこれでよし…っと\nそれじゃアンタも\n運ぶの手伝ってよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6069, 101, 2, 4, 0, 121401, 1, 0, "いつもと違うアタシに\n見とれちゃった？\n仕方ないわね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6070, 102, 2, 8, 0, 121401, 1, 0, "お花見って風流で\n大人って感じ♪\n…でもお団子も\n忘れないでよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6071, 1, 2, 1, 0, 121401, 1, 1, "みんなに朝ごはんを\n作ってみたら\n喜んでくれるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6072, 2, 2, 1, 0, 121401, 1, 2, "お客さんがいっぱい\n来る時間帯ね！\n元気出していくわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6073, 3, 2, 1, 0, 121401, 1, 3, "そろそろ寝ないと…\n睡眠不足はお肌の\n大敵なんだから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6075, 2, 3, 1, 0, 121401, 1, 0, "ふかふかしてて\n気持ちいい～♪\n疲れが癒されるぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6076, 3, 3, 1, 0, 121401, 1, 0, "この子もアタシと\nおそろいの衣装に\nしてあげようかしら♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6077, 4, 3, 1, 0, 121401, 1, 0, "素敵な衣装で\nいい香りを\n身にまとう…ふふ、\n大人のたしなみよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6078, 5, 3, 1, 0, 121401, 1, 0, "あったか～い♪\nここでお昼寝したら\n気持ちよさそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6080, 7, 3, 1, 0, 121401, 1, 0, "お仕事がんばると\nいつもよりお腹\n空いちゃう～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6081, 8, 3, 1, 0, 121401, 1, 0, "最新のトレンド\n載ってないかしら？\n物産展の売り物に\n取り入れなくちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6083, 1, 1, 1, 0, 121501, 1, 0, "怪盗のこと…\nお父さんお母さんに\nもし知られたら\nなんて説明しよう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6084, 2, 1, 1, 0, 121501, 1, 0, "たとえ怪盗でも、人の\n家にお邪魔するときは\n身だしなみをしっかり\nしないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6085, 3, 1, 1, 0, 121501, 1, 0, "鍵開けって難しい…\nうーん、もっと\n練習しておかなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6086, 4, 1, 1, 0, 121501, 1, 0, "姿が見えない\n怪盗の噂…？\nわ、私のことじゃ\nありませんように…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6087, 5, 1, 1, 0, 121501, 1, 0, "予告状って…\n切手はどこに貼れば\nいいんだろう…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6088, 101, 1, 4, 0, 121501, 1, 0, "怪盗活動にも\n慣れてきたけど…\nやっぱり先輩が\nいないと心細いなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6089, 102, 1, 8, 0, 121501, 1, 0, "せ、先輩の心も\nいつか盗めるかな…？\n…わわわ、私ってば\nなに言ってるんだろ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6090, 1, 2, 1, 0, 121501, 1, 0, "怪盗が大活躍って\n新聞で読んだ…？\nだっ、誰のこと\nでしょうね…あはは");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6091, 2, 2, 1, 0, 121501, 1, 0, "尾行に潜入…\n存在感がないのって\n意外と役立つことも\nあるんですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6092, 3, 2, 1, 0, 121501, 1, 0, "せせせ、先輩っ！\n帽子をぎゅーって\nかぶったら、抜けなく\nなっちゃいました…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6093, 4, 2, 1, 0, 121501, 1, 0, "ぬ、盗み聞きなんて\nしてませんよ？\nみんなが私に気づかず\n話し始めるだけで…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6094, 101, 2, 4, 0, 121501, 1, 0, "秘密道具が見たい？\nそ、それは内緒です！\n秘密道具ですから…\nで、でも先輩になら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6095, 102, 2, 8, 0, 121501, 1, 0, "えへへ\n見つかっちゃいました\n先輩はいつも私を\n見つけてくれますね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6096, 1, 2, 1, 0, 121501, 1, 1, "おはようございまふ…\n秘密道具のお手入れで\n夜更かししちゃって…\nちょっと眠たいです～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6097, 2, 2, 1, 0, 121501, 1, 2, "怪盗が昼に活動する…\n案外そのほうが\n意外性が\nあるのかも…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6098, 3, 2, 1, 0, 121501, 1, 3, "外が暗くなりましたね\n…そろそろ怪盗の活動\n始めましょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6100, 2, 3, 1, 0, 121501, 1, 0, "ここでくつろぐと\n疲れが取れます～\n…今日も怪盗\nがんばろっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6101, 3, 3, 1, 0, 121501, 1, 0, "わぁ、かわいい…！\n心を盗まれるって\nこういうことかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6102, 4, 3, 1, 0, 121501, 1, 0, "素敵な香り…でも\n服に香りがついたら\n隠れてるときに\n見つかっちゃうかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6103, 5, 3, 1, 0, 121501, 1, 0, "ぽかぽかで\nいい気持ち…\n夜道を歩く前に\n温まっておこうっと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6105, 7, 3, 1, 0, 121501, 1, 0, "怪盗活動に備えて\n今のうちにしっかり\n食べておかなきゃ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6106, 8, 3, 1, 0, 121501, 1, 0, "女の子は秘密が\n多いほうが魅力的…？\nそ、そうなんだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6108, 103, 1, 12, 0, 104501, 1, 0, "ドＳさんはいつも\nクウカの妄想の中に…\nぐふふ、じゅるり～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6109, 103, 2, 12, 0, 104501, 1, 0, "やさしい触り方も\n嫌いじゃありません…\nは…恥ずかしいですが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6110, 1, 1, 1, 0, 121601, 1, 0, "この大怪盗さまに\n盗めないものなんて\nないです！　たぶん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6111, 2, 1, 1, 0, 121601, 1, 0, "あたしにふさわしい\nビッグなお宝は\nどこにあるですかね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6112, 3, 1, 1, 0, 121601, 1, 0, "そろーりそろーり…\n気配を消せばお菓子も\n食べ放題…にやり");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6113, 4, 1, 1, 0, 121601, 1, 0, "またサボってたのが\nバレたです…\nボスの地獄耳～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6114, 5, 1, 1, 0, 121601, 1, 0, "ギャングで大怪盗…！\nこの肩書の多さ！\nまさに有能の証です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6115, 101, 1, 4, 0, 121601, 1, 0, "お兄さんだったら…\nお宝を山分けして\nあげてもいいですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6116, 102, 1, 8, 0, 121601, 1, 0, "お兄さんはアレですよ\n大怪盗イノリさまの\n相棒みたいなものです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6117, 1, 2, 1, 0, 121601, 1, 0, "何事も用心深さが\n大切ですよ。ビ…\nビビりじゃないです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6118, 2, 2, 1, 0, 121601, 1, 0, "ぬ、盗み聞き？\nしてないですよっ？\nぴゅーぴゅーぴゅー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6119, 3, 2, 1, 0, 121601, 1, 0, "情報が欲しければ\nお菓子と交換ですよ\nさぁ、交換交換っ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6120, 4, 2, 1, 0, 121601, 1, 0, "しーっ！\n今、尾行中なんです\n話はあとで…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6121, 101, 2, 4, 0, 121601, 1, 0, "お兄さんと話してると\n時間が速いような…？\nこの時間泥棒！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6122, 102, 2, 8, 0, 121601, 1, 0, "ちょうどよかった！\nいい話があるんです\n一口乗りませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6123, 1, 2, 1, 0, 121601, 1, 1, "おてんとうさまが\n出てやがるですね…\n悪事がやりにくいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6124, 2, 2, 1, 0, 121601, 1, 2, "もうこんな時間ですか\nご飯にお昼寝…\nいやー忙しいです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6125, 3, 2, 1, 0, 121601, 1, 3, "ふっふっふ！　夜こそ\n大怪盗の時間です！\n……ふぁあ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6127, 2, 3, 1, 0, 121601, 1, 0, "うーん…\n警備の目がないと\n気楽でいいですねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6128, 3, 3, 1, 0, 121601, 1, 0, "くう…！\nこのかわいさは\n盗めないです…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6129, 4, 3, 1, 0, 121601, 1, 0, "犯行現場に残ったのは\n香水の匂いだけ…\nふふ、おしゃれ大怪盗");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6130, 5, 3, 1, 0, 121601, 1, 0, "意外とこういう場所に\n隠し扉があったり…\nしないです？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6132, 7, 3, 1, 0, 121601, 1, 0, "もぐもぐ…\nこの美味しさ…\nとんでもない罠ですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6133, 8, 3, 1, 0, 121601, 1, 0, "むむむ…ちっとも\n分からないです…\nほとんど暗号ですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6135, 1, 1, 1, 0, 121701, 1, 0, "あら、サレンさんは\nどこに行かれた\nのかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6136, 2, 1, 1, 0, 121701, 1, 0, "ふんふんふーん♪\nなんだか華やいだ\n気分ですわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6137, 3, 1, 1, 0, 121701, 1, 0, "さて…次の事業は\nどうしましょう\n何か面白いことは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6138, 4, 1, 1, 0, 121701, 1, 0, "おーっほっほっほ！\nあら…楽しくて、つい\n笑ってしまいましたわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6139, 5, 1, 1, 0, 121701, 1, 0, "センスがあって\nいいお部屋ですわね\n私も見習いたいですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6140, 101, 1, 4, 0, 121701, 1, 0, "サレンさんとあのお方\n仲がいいですわね\nも、もちろん仲がいい\nのはよいことですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6141, 102, 1, 8, 0, 121701, 1, 0, "どんなときでも\n正々堂々！\nそれが私の\n誇りですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6142, 1, 2, 1, 0, 121701, 1, 0, "ふふ、ごきげんよう\n私、絶好調でしてよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6143, 2, 2, 1, 0, 121701, 1, 0, "どうかされましたか？\n何かお困りごと\nでしたら\n是非力になりますわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6144, 3, 2, 1, 0, 121701, 1, 0, "たまにはこうして\nゆっくりと\nお話しするのも\nいいものですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6145, 4, 2, 1, 0, 121701, 1, 0, "次の事業に関して\n考え事をしてましたの\nよければ相談に乗って\nくださるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6146, 101, 2, 4, 0, 121701, 1, 0, "よろしければ\nお話しませんこと？\nサレンさんのお話を\n聞かせてほしいですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6147, 102, 2, 8, 0, 121701, 1, 0, "ふふっ…\n先ほどサレンさんと\nあなたさまのお話を\nしていたところですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6148, 1, 2, 1, 0, 121701, 1, 1, "さあ！\n今日も一日\n全力で参りますわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6149, 2, 2, 1, 0, 121701, 1, 2, "お昼はどうしましょう\nサレンさんをお誘い\nしてみようかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6150, 3, 2, 1, 0, 121701, 1, 3, "もう少しだけ…\n明日の準備をして\nおかないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6152, 2, 3, 1, 0, 121701, 1, 0, "はぁ～…いいですわね\nはっ、私としたことが\nはしたないですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6153, 3, 3, 1, 0, 121701, 1, 0, "かわいらしいですわ\nいくつになっても\nぎゅっと\nしたくなりますわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6154, 4, 3, 1, 0, 121701, 1, 0, "落ち着きますわね\nサレンさんはどんな\n香りが好きなのかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6155, 5, 3, 1, 0, 121701, 1, 0, "ふふっ、燃え盛る\n情熱の炎…\nいいですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6157, 7, 3, 1, 0, 121701, 1, 0, "このおいしさで\n元手がゼロ…\nすばらしい\n商品ですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6158, 8, 3, 1, 0, 121701, 1, 0, "これは…ふむふむ\n新しい事業のヒントに\nなりそうですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6161, 1, 1, 1, 0, 121801, 1, 0, "さて、と…\n今日は何をしなくちゃ\nいけないんだっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6162, 2, 1, 1, 0, 121801, 1, 0, "やることは山積み\nだけど、手を動かす\nのは嫌いじゃないわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6163, 3, 1, 1, 0, 121801, 1, 0, "あら？　アキノさんの\n声が聞こえたような\n気がしたんだけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6164, 4, 1, 1, 0, 121801, 1, 0, "アキノさんといると\nついこっちまで笑顔に\nなっちゃうのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6165, 5, 1, 1, 0, 121801, 1, 0, "弱音なんか\nはいてられないわ\nアキノさんに\n笑われちゃうもの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6166, 101, 1, 4, 0, 121801, 1, 0, "気が付けばアキノさん\nのペースだけど…\n不思議と嫌では\nないのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6167, 102, 1, 8, 0, 121801, 1, 0, "あたしを好敵手って\n言ってくれる\nアキノさんのためにも\nしっかりしなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6168, 1, 2, 1, 0, 121801, 1, 0, "どうしたの？\nアキノさんなら\nさっきそこに\nいなかった？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6169, 2, 2, 1, 0, 121801, 1, 0, "あたしなら大丈夫\n救護院だって\nみんなが助けて\nくれるからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6170, 3, 2, 1, 0, 121801, 1, 0, "さっきアキノさんが\nあんたを探してたわよ\nなにかしたの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6171, 4, 2, 1, 0, 121801, 1, 0, "こう見えてヒマじゃ\nないんだけど…\n少しくらいなら\n付き合ってあげるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6172, 101, 2, 4, 0, 121801, 1, 0, "ねえ、あんたと\nアキノさんって…\nううん、やっぱり\nなんでもないわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6173, 102, 2, 8, 0, 121801, 1, 0, "アキノさんも誘って\nお茶でもしない？\n話したいことが\nたくさんあるの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6174, 1, 2, 1, 0, 121801, 1, 1, "早起きは三文の得よ\nいい一日を迎えるため\n目を覚まさなきゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6175, 2, 2, 1, 0, 121801, 1, 2, "今日のお昼は…\nアキノさんと同席する\n予定だったわね\nあんたもどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6176, 3, 2, 1, 0, 121801, 1, 3, "ふぁ…っと、だめね\nたるんだところを\nアキノさんに\n見せるわけには");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6178, 2, 3, 1, 0, 121801, 1, 0, "ん～…\n落ち着くわね\nこのまま\n寝ちゃいそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6179, 3, 3, 1, 0, 121801, 1, 0, "救護院の皆も\nぬいぐるみが\n大好きなのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6180, 4, 3, 1, 0, 121801, 1, 0, "いい香りね…\nこれはアキノさんの\n趣味かしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6181, 5, 3, 1, 0, 121801, 1, 0, "こんなに激しく\n燃えているのに\nあったかくて落ち着く\nまるでアキノさんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6183, 7, 3, 1, 0, 121801, 1, 0, "どんどん出てくる…\nこれ、救護院にも\nほしいわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6184, 8, 3, 1, 0, 121801, 1, 0, "ふむふむ…\n前にアキノさんが\n言ってたのは\nこのことかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6187, 1, 1, 1, 0, 122001, 1, 0, "この衣装、私には\nちょっとかわい過ぎて\n恥ずかしいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6188, 2, 1, 1, 0, 122001, 1, 0, "一部の人からは\n海賊より海賊らしいと\n評判の父です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6189, 3, 1, 1, 0, 122001, 1, 0, "潮風で錆びないよう\n武器の手入れを\nしておきましょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6190, 4, 1, 1, 0, 122001, 1, 0, "宝探しのお手伝いなら\n力になれると思います\n父のやる気次第ですが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6191, 5, 1, 1, 0, 122001, 1, 0, "除霊は気を遣います\n一歩間違えると父まで\n成仏させてしまうので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6192, 101, 1, 4, 0, 122001, 1, 0, "あの人と見た\n海の景色を…ずっと\n忘れずにいたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6193, 102, 1, 8, 0, 122001, 1, 0, "幽霊になっても\n一目会えるなら…\n私はきっとあの人に…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6194, 1, 2, 1, 0, 122001, 1, 0, "ボートを漕ぐの、少し\n上手になったんですよ\n今度お見せしますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6195, 2, 2, 1, 0, 122001, 1, 0, "航海に向けた\n買い出しが必要ですね\n予定は空いていますか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6196, 3, 2, 1, 0, 122001, 1, 0, "呪われた財宝の\n解呪依頼が多くて…\nふぅ…えっと次は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6197, 4, 2, 1, 0, 122001, 1, 0, "夜の航海では\n父が明かり代わりに\nなってくれるんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6198, 101, 2, 4, 0, 122001, 1, 0, "船の上では食材が\n限られるので料理の\nいい練習になります");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6199, 102, 2, 8, 0, 122001, 1, 0, "この先もずっと\nあなたと一緒に\nたくさんの思い出を\n作っていきたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6200, 1, 2, 1, 0, 122001, 1, 1, "あの人の寝顔…\nもう少しだけ\n眺めていたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6201, 2, 2, 1, 0, 122001, 1, 2, "船の上では\n規則正しい生活が\n重要ですから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6202, 3, 2, 1, 0, 122001, 1, 3, "夜の海は幽霊が\n見分けやすいんです\n青白く光るので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6204, 2, 3, 1, 0, 122001, 1, 0, "海に揺られるような\n心地よさですね\n気が休まります…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6205, 3, 3, 1, 0, 122001, 1, 0, "あなたも一緒に\n海を見に行きますか？\n…なんて。ふふっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6206, 4, 3, 1, 0, 122001, 1, 0, "爽やかな香りですね…\n一面の青い海が\n目に浮かぶようです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6207, 5, 3, 1, 0, 122001, 1, 0, "温かい…\n潮風で冷えた体に\n沁みますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6209, 7, 3, 1, 0, 122001, 1, 0, "あ、おいしい…\n日持ちするなら船旅に\n持っていこうかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6210, 8, 3, 1, 0, 122001, 1, 0, "アンナさんに教えて\nもらった小説は…\nあ、これですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6212, 103, 1, 12, 0, 102601, 1, 0, "なにもしないを\nしてるんだよ\nあ～いそがしいそがし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6213, 103, 2, 12, 0, 102601, 1, 0, "はぁ～あんたといると\nどこまでも気持ちよく\nダラダラできるね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6214, 1, 1, 1, 0, 121901, 1, 0, "暗黒騎士にして、\n伝説の海賊でもある\n私に不可能はないっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6215, 2, 1, 1, 0, 121901, 1, 0, "海賊団の船員、\n随時募集中です…と\nこれで新たな盟友が\n増えるはずだ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6216, 3, 1, 1, 0, 121901, 1, 0, "肩に乗せるペットが\nほしいな。今のうちに\nペット用品を買いに\n行かなくては…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6217, 4, 1, 1, 0, 121901, 1, 0, "財宝の地図はどこで\n売っているのだろう…\n古本屋？　古物商？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6218, 5, 1, 1, 0, 121901, 1, 0, "この海賊衣装に\n身を包んでいると\n前世の新たな記憶が\nよみがえってくるな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6219, 101, 1, 4, 0, 121901, 1, 0, "いずれはシグルドと\n海原への冒険に\n繰り出したいな…\nきっと楽しいぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6220, 102, 1, 8, 0, 121901, 1, 0, "待ちわびたぞ盟友よ！\n私と貴様あっての\n海賊団…だからその…\n今日はそばにいてくれ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6221, 1, 2, 1, 0, 121901, 1, 0, "シグルド！　港町で\nお魚のおすそ分けを\nもらったんだ！\n一緒に食べよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6222, 2, 2, 1, 0, 121901, 1, 0, "シグルドもこのコート\n羽織ってみないか？\nふふっ、きっとすごく\n似合うと思うぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6223, 3, 2, 1, 0, 121901, 1, 0, "海賊船の新たな\n秘密兵器を作ったぞ！\nシグルド、これから\n見に来ないか！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6224, 4, 2, 1, 0, 121901, 1, 0, "私は伝説の海賊だから\n泳ぐのだって得意だ！\nふ、深いところは\n少し怖いが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6225, 101, 2, 4, 0, 121901, 1, 0, "ふふ、いつ無人島に\n漂着してもいいように\n非常食は準備済みだ\nシグルドの分もある！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6226, 102, 2, 8, 0, 121901, 1, 0, "冥風戦記の新章が\n完成したぞ…！\nシグルド、まずは\n貴様に読んでほしい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6227, 1, 2, 1, 0, 121901, 1, 1, "ふっ、天気明朗\n絶好の航海日和だ！\n早速海に繰り出そう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6228, 2, 2, 1, 0, 121901, 1, 2, "昼食用に魚を\n釣っておいたぞ！\nふふ、いかにも\n海賊っぽいだろう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6229, 3, 2, 1, 0, 121901, 1, 3, "夜の海は真っ黒で\n少しだけ怖いな…\nシグルド、私の\nそばを離れるなよ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6231, 2, 3, 1, 0, 121901, 1, 0, "大海賊がくつろぐのに\n相応しい逸品だ…！\nえっと…これ、どこの\nお店で買えますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6232, 3, 3, 1, 0, 121901, 1, 0, "わわ、かわいい…！\n船室のベッドに\n置いておきたいな…\n連れてってはダメか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6233, 4, 3, 1, 0, 121901, 1, 0, "おぉ、この香りは…！\n集中力が上がりそうだ\n海賊船の船長室に\nぜひ置きたいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6234, 5, 3, 1, 0, 121901, 1, 0, "これが船乗りの\n伝承に聞く、海原を\nさまよう神秘の火か！\n…暖まるな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6236, 7, 3, 1, 0, 121901, 1, 0, "腹が減っては\n海賊はできぬ！\n…小説も書けぬ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6237, 8, 3, 1, 0, 121901, 1, 0, "女海賊と騎士はその後\n恋に落ち…？　恋愛\nモノではないかっ！？\nき、興味深くはあるが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6239, 1, 1, 1, 0, 122101, 1, 0, "いつもの山籠もりが\nブームになるなんて…\n人生、なにが起きるか\n分からないなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6240, 2, 1, 1, 0, 122101, 1, 0, "キャンプ道具…\nいえ、キャンプギア！\nカッコいい響き…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6241, 3, 1, 1, 0, 122101, 1, 0, "レッツ、ＢＢキャン！\nこのフレーズ\n流行るかも…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6242, 4, 1, 1, 0, 122101, 1, 0, "キャンプ仲間…\n募集してみようかな？\n友達も兼任で…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6243, 5, 1, 1, 0, 122101, 1, 0, "ユカリさんと\nジュンさん…元気かな\nまた一緒に\nキャンプしたいなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6244, 101, 1, 4, 0, 122101, 1, 0, "私の取材が載った本…\n【フォレスティエ】に\n送らなくちゃ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6245, 102, 1, 8, 0, 122101, 1, 0, "もし、あの人が\n落ち込むことが\nあったら…その時は\n私が力になりたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6246, 1, 2, 1, 0, 122101, 1, 0, "ブッシュクラフトは\nマイフレンドくんの\nカスタムにも\n活かせる技術です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6247, 2, 2, 1, 0, 122101, 1, 0, "会話に花が咲く…\nって言いますよね\n私の場合、会話相手が\nお花そのものですけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6248, 3, 2, 1, 0, 122101, 1, 0, "この服、実は…\n昔ミサト先生に\nこしらえてもらった\n物なんです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6249, 4, 2, 1, 0, 122101, 1, 0, "昔はやまびこで会話の\n練習をしてたんです\nほとんどオウム返しで\n気まずかったなぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6250, 101, 2, 4, 0, 122101, 1, 0, "どうもマイスターです\n…あ、すみません\nみなさんの期待に\n応えようと練習中で…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6251, 102, 2, 8, 0, 122101, 1, 0, "たとえぼっちを\n卒業しても…\n私は一生ＢＢ団です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6252, 1, 2, 1, 0, 122101, 1, 1, "小鳥さんのさえずりで\n目が覚める…\n心地いいものですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6253, 2, 2, 1, 0, 122101, 1, 2, "キャンプといえば\nおいしいご飯です！\n腕を振るいますよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6254, 3, 2, 1, 0, 122101, 1, 3, "すっかり夜ですね…\nおやすみの前に\n星でも見ませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6256, 2, 3, 1, 0, 122101, 1, 0, "都会でくつろぎ…\n自然の中でくつろぐ…\nくつろぎ無限ループ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6257, 3, 3, 1, 0, 122101, 1, 0, "しっかり観察すれば\nブッシュクラフトで\n再現できるかも…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6258, 4, 3, 1, 0, 122101, 1, 0, "はぁ～…やっぱり\n木の香りを嗅ぐと\n肩の力が抜けますねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6259, 5, 3, 1, 0, 122101, 1, 0, "ああ…あったまります\nなんだか心に\nゆとりがでますね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6261, 7, 3, 1, 0, 122101, 1, 0, "このおいしさ…！\n今度はキャンプに\n持っていこうかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6262, 8, 3, 1, 0, 122101, 1, 0, "ふむふむ…\nいろんな知識があると\nキャンプはもっと\n楽しくなりますよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6264, 1, 1, 1, 0, 122201, 1, 0, "部屋がキャンプ用品で\n埋まっていく…\nキャンプ…なんて\n恐ろしい趣味なの…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6265, 2, 1, 1, 0, 122201, 1, 0, "仕事でも\nアウトドアでも\n頼れるお姉さんに\nなれたらいいなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6266, 3, 1, 1, 0, 122201, 1, 0, "この服、かわいい上に\n本当に快適ね～♪\nおしゃれにキャンプを\n楽しめて最高だわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6267, 4, 1, 1, 0, 122201, 1, 0, "ん〜次はどんな\nキャンプ飯を\n作ろうかしら？\n彼の好物は、っと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6268, 5, 1, 1, 0, 122201, 1, 0, "早く週末が\n来ないかしら…\n仕事を忘れてパーっと\nキャンプ飲みを…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6269, 101, 1, 4, 0, 122201, 1, 0, "新しいキャンプ飯の\nレシピを覚えたわ！\n彼も喜んで\nくれるはず…よね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6270, 102, 1, 8, 0, 122201, 1, 0, "彼の分の食器も\nこっそり買い揃えちゃ\nおうかな…そ、それは\nさすがにまだ早いか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6271, 1, 2, 1, 0, 122201, 1, 0, "今度、財団主催で\n大規模なキャンプを\nやってみるのも\nいいかもしれないわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6272, 2, 2, 1, 0, 122201, 1, 0, "ソロキャンプも\n悪くはないけど\n私はやっぱりキミと…\nな、なんでもない！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6273, 3, 2, 1, 0, 122201, 1, 0, "キャンプのことなら\n私に聞いて。なんでも\n教えてあげるから！\n…調べた上でね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6274, 4, 2, 1, 0, 122201, 1, 0, "キャンプ場で飲む\n最高の一杯は\n他じゃ味わえないわ！\nさあ、乾杯っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6275, 101, 2, 4, 0, 122201, 1, 0, "うん、決めた！　次は\n禁しゅわキャンプ！\nだってキミとゆっくり\n話したいんだもん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6276, 102, 2, 8, 0, 122201, 1, 0, "キミのおかげで\n本当の最高の一杯が\n味わえたわ…\nありがとう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6277, 1, 2, 1, 0, 122201, 1, 1, "んー、気持ちいい！\nキャンプが趣味に\nなってから、寝覚めが\nよくなったわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6278, 2, 2, 1, 0, 122201, 1, 2, "お昼は私がごちそう\nするわ。キャンプ飯で\n鍛えた料理の腕前を\n披露しちゃうわよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6279, 3, 2, 1, 0, 122201, 1, 3, "そろそろ寝ましょ？\n明日も朝日を眺める\nためにね。もちろん\nコーヒー付きで♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6281, 2, 3, 1, 0, 122201, 1, 0, "くつろぐのに\n持ってこいね～\nテントの中に置いても\nよさそうだわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6282, 3, 3, 1, 0, 122201, 1, 0, "ふふ、かわいいわね～\n…今度キャンプ場に\n連れていこうかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6283, 4, 3, 1, 0, 122201, 1, 0, "うん、いい匂い…♪\nキャンプ場を思い出す\n自然の香りだわ〜");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6284, 5, 3, 1, 0, 122201, 1, 0, "はぁ、温まるぅ～\n冬のキャンプで\n使ってみたいわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6286, 7, 3, 1, 0, 122201, 1, 0, "おいしい～♪\nキャンプ飲みの\nおつまみに\nぴったりね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6287, 8, 3, 1, 0, 122201, 1, 0, "へえ…こんなキャンプ\n飯もあるんだ？\n彼、好きだったり\nするかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6289, 103, 1, 12, 0, 100701, 1, 0, "一生ついててやるの\n幽霊の一生は\nなっが～～～いの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6290, 103, 2, 12, 0, 100701, 1, 0, "む～…あんまり触ると\nすり抜けてやるの！\nウソなの。むふふ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6291, 1, 1, 1, 0, 122301, 1, 0, "んー…\n今日はベスちゃんと\nなにして遊ぼーかなー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6292, 2, 1, 1, 0, 122301, 1, 0, "ヴァンピィちゃんも\nけんぞくの友だちと\n仲良くなりたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6293, 3, 1, 1, 0, 122301, 1, 0, "けんぞくのお部屋は\nヴァンピィちゃんが\n守ってあげなくちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6294, 4, 1, 1, 0, 122301, 1, 0, "お掃除するなら\nヴァンピィちゃんも\n手伝ってあげよー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6295, 5, 1, 1, 0, 122301, 1, 0, "ふーん、ふーん♪\nけんぞくってこーゆー\nお部屋が好きなんだー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6296, 101, 1, 4, 0, 122301, 1, 0, "ひまだなー\nけんぞくをさそって\nお散歩いこっかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6297, 102, 1, 8, 0, 122301, 1, 0, "今日のスープに\nけんぞくの大好物を\n入れてあげよっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6298, 1, 2, 1, 0, 122301, 1, 0, "けんぞくー！\nヴァンピィちゃんと\nお出かけしよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6299, 2, 2, 1, 0, 122301, 1, 0, "よしよし！\n今日のけんぞくも\nいい子だね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6300, 3, 2, 1, 0, 122301, 1, 0, "んんー…\nやっぱりけんぞくと\nベスちゃんは似てる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6301, 4, 2, 1, 0, 122301, 1, 0, "いーい？\nヴァンピィちゃんの\nいうこと聞くのよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6302, 101, 2, 4, 0, 122301, 1, 0, "ヴァンピィちゃんの\nけんぞくだもん！\n大切にするからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6303, 102, 2, 8, 0, 122301, 1, 0, "えへへっ！\nやっぱりけんぞくって\nやさしー匂いがする♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6304, 1, 2, 1, 0, 122301, 1, 1, "おはよー…\nヴァンピィちゃんは\nもうちょっと眠るねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6305, 2, 2, 1, 0, 122301, 1, 2, "ヴァンピィちゃん\nひなたぼっこ\nだーいすき！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6306, 3, 2, 1, 0, 122301, 1, 3, "んー！　夜だ♪\nヴァンピィちゃん\n絶好調だよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6308, 2, 3, 1, 0, 122301, 1, 0, "わー！\nふかふかだ！\nきもちぃー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6309, 3, 3, 1, 0, 122301, 1, 0, "かわいー♪\nベスちゃんに負けない\n抱き心地！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6310, 4, 3, 1, 0, 122301, 1, 0, "この香り…なんだろ？\nヴァンピィちゃん\n気に入っちゃった♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6311, 5, 3, 1, 0, 122301, 1, 0, "あったかいねー…\nヴァンピィちゃん\nずっとここにいるー…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6313, 7, 3, 1, 0, 122301, 1, 0, "はむはむ…\nんー！\nおいしー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6314, 8, 3, 1, 0, 122301, 1, 0, "ヴァンピィちゃん\nこの本\n好きなんだよねー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6316, 1, 1, 1, 0, 122501, 1, 0, "夏といえば\nかき氷だよね\n近くにお店は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6317, 2, 1, 1, 0, 122501, 1, 0, "この格好でいるのも\nなじんできたし\nちょっと鍛錬でも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6318, 3, 1, 1, 0, 122501, 1, 0, "動きやすいけれど…\nいつもと違う服装は\n少し落ち着かないな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6319, 4, 1, 1, 0, 122501, 1, 0, "夏の空気に\n当てられると思わず\n気が緩んでしまうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6320, 5, 1, 1, 0, 122501, 1, 0, "砂浜で走ると\nいい具合に体幹を\n鍛えられそうだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6321, 101, 1, 4, 0, 122501, 1, 0, "終わらない夏は\nないけれど…\nつい願ってしまうな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6322, 102, 1, 8, 0, 122501, 1, 0, "胸を張って彼と\n並び立てるよう\n私も、もっと強く…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6323, 1, 2, 1, 0, 122501, 1, 0, "どうしたの？\n行きたい場所が\nあるなら付き合おうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6324, 2, 2, 1, 0, 122501, 1, 0, "快晴で風は穏やか…\n絶好の釣り日和だね\nさあ、出かけようか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6325, 3, 2, 1, 0, 122501, 1, 0, "今日の予定を\n立ててるんだけど…\nキミの希望も\n聞きたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6326, 4, 2, 1, 0, 122501, 1, 0, "ビーチスポーツか…\nキミとなら\nいい勝負ができそうだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6327, 101, 2, 4, 0, 122501, 1, 0, "私たちの夏に\n遠慮は無用だよ\n思いきり楽しもう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6328, 102, 2, 8, 0, 122501, 1, 0, "いつかまた一緒に\n花火を見に行こう\n…約束だよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6329, 1, 2, 1, 0, 122501, 1, 1, "潮騒の音で\n目覚めるのも\nいいものだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6330, 2, 2, 1, 0, 122501, 1, 2, "今朝釣ってきた魚が\nあるんだ。これで\nお昼ご飯にしようか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6331, 3, 2, 1, 0, 122501, 1, 3, "夜にもイベントが\nあるみたいなんだ\n一緒に見に行かない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6333, 2, 3, 1, 0, 122501, 1, 0, "気持ちが安らぐね…\nうっかり眠って…\nしまい…そうだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6334, 3, 3, 1, 0, 122501, 1, 0, "肌触りのよさが\nこの格好だと\nよく分かるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6335, 4, 3, 1, 0, 122501, 1, 0, "海をイメージさせる\n香りだね…\n爽やかで落ち着くよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6336, 5, 3, 1, 0, 122501, 1, 0, "濡れたままだと\n風邪を引いてしまうよ\nほら、キミもおいで");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6338, 7, 3, 1, 0, 122501, 1, 0, "夏を楽しみきるには\nエネルギーが\n必要だからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6339, 8, 3, 1, 0, 122501, 1, 0, "大切な人と過ごせる\n観光スポット紹介…\n…こ、このページは\nもういいかな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6341, 10, 3, 1, 0, 122501, 1, 0, "濡らしてもいいなら\n海に持っていって\n乗るのもよさそうだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6342, 11, 3, 1, 0, 122501, 1, 0, "こういう名画を\n見た気がするな…\nこんな視点なんだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6343, 1, 1, 1, 0, 122401, 1, 0, "水着って\n動きやすくて\nいいよねー♪\nいっちにーさんしー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6344, 2, 1, 1, 0, 122401, 1, 0, "ユイちゃんにもらった\n日焼け止め\n塗っておいて\nよかった～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6345, 3, 1, 1, 0, 122401, 1, 0, "なんだか暑いなあ…\nせっかくだし\nプールで泳いで\nこようかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6346, 4, 1, 1, 0, 122401, 1, 0, "この格好で\n出かけようとしたら\nレイさんに\n怒られちゃった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6347, 5, 1, 1, 0, 122401, 1, 0, "たとえ水着姿でも\n困ってる人を見たら\n助けに行くからね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6348, 101, 1, 4, 0, 122401, 1, 0, "バカンス楽しかった～\nまた騎士くんと\n一緒に行きたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6349, 102, 1, 8, 0, 122401, 1, 0, "この水着、あたしに\n似合ってるかなあ？\n騎士くんはどう\n思ってるんだろ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6350, 1, 2, 1, 0, 122401, 1, 0, "騎士くん！\n海に行くなら\n準備運動\n忘れずにね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6351, 2, 2, 1, 0, 122401, 1, 0, "泳ぐ練習がしたいの？\nいいよ！　水着だから\nなにかあったらすぐに\n助けてあげるね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6352, 3, 2, 1, 0, 122401, 1, 0, "騎士くんの水着姿も\nかっこよかったよ！\nまた遊びに行こ！\n約束ね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6353, 4, 2, 1, 0, 122401, 1, 0, "このグローブの向日葵\nかわいいでしょ？\nユイちゃんが\n選んでくれたんだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6354, 101, 2, 4, 0, 122401, 1, 0, "実はこの水着\nいつも着てる\n服とおなじなんだ…\nって、冗談だよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6355, 102, 2, 8, 0, 122401, 1, 0, "変な日焼けしてないか\n見てもらってもいい？\n…なし！　今のなし！\nやっぱりなしー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6356, 1, 2, 1, 0, 122401, 1, 1, "夏のお日様に\n負けないよう\n今日も元気いっぱい\nがんばるぞー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6357, 2, 2, 1, 0, 122401, 1, 2, "お腹減ってきちゃった\n騎士くんはお腹\n空いてない？\n…聞こえちゃった♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6358, 3, 2, 1, 0, 122401, 1, 3, "今日も一日\n楽しかったー！\n明日もまた\n楽しもうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6360, 2, 3, 1, 0, 122401, 1, 0, "ふわあ…\nふわふわなのが\nいつもより\nよくわかるよー…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6361, 3, 3, 1, 0, 122401, 1, 0, "そうだ！　水着なら\n濡れてもいいし\n今度洗ってあげるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6362, 4, 3, 1, 0, 122401, 1, 0, "んー…いい匂い♪\nなんだか\n身体がぽかぽか\nしてきちゃった！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6363, 5, 3, 1, 0, 122401, 1, 0, "水着だから、えっと…\n暖か涼しい…！\n不思議な感じー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6365, 7, 3, 1, 0, 122401, 1, 0, "思いっきり身体を\n動かした後だから\nいくらでも\n食べちゃえるよー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6366, 8, 3, 1, 0, 122401, 1, 0, "ふむふむ…\nなるほどー\n水着の種類って\nそんなにあるんだぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6368, 10, 3, 1, 0, 122401, 1, 0, "乗り心地バッチリだね\nしゅっぱつしんこー！\nなんちゃって♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6369, 11, 3, 1, 0, 122401, 1, 0, "わっ、ぽよんぽよん！\nトランポリンみたいで\nた～のし～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6370, 103, 1, 12, 0, 101501, 1, 0, "彼のことを考えてると\n幸せで胸が温かくなる\n…私ったら、もう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6371, 103, 2, 12, 0, 101501, 1, 0, "うふふふふ\nくすぐったいわ～♪\nもう、イタズラっ子ね\n次は先生の番よ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6372, 1, 1, 1, 0, 122601, 1, 0, "騎士クンの汗\n拭いてあげたいな…\n余計なお世話かな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6373, 2, 1, 1, 0, 122601, 1, 0, "夏バテ気味かも…\nそうだ、今夜は\nかば焼きにしよう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6374, 3, 1, 1, 0, 122601, 1, 0, "青い空、白い雲\n眩しい日差し…！\n夏って好きだな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6375, 4, 1, 1, 0, 122601, 1, 0, "ヒリヒリする…？\n日に焼けちゃったかな\nふー…ふー…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6376, 5, 1, 1, 0, 122601, 1, 0, "花火大会があるんだ…\n夜、浜辺…2人きり…\nむ、無理だよ〜！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6377, 101, 1, 4, 0, 122601, 1, 0, "水着って不思議…\n引っ込み思案が少し\nおさまる…気がする");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6378, 102, 1, 8, 0, 122601, 1, 0, "騎士クンとまた\n海に行きたいな…\nまた、一緒に…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6379, 1, 2, 1, 0, 122601, 1, 0, "ダ、ダイエット！？\nしてないよ！？\n元々これ位だよ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6380, 2, 2, 1, 0, 122601, 1, 0, "スイカ割りのコツ？\nわたしは、騎士クンに\n教わりたいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6381, 3, 2, 1, 0, 122601, 1, 0, "騎士クン。うちわで\n扇いであげるね\nどこに置いたかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6382, 4, 2, 1, 0, 122601, 1, 0, "うぅ…暑いね…\n騎士クン、温度計は\n見ない方がいいよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6383, 101, 2, 4, 0, 122601, 1, 0, "じ、じっと見ないで…\nええっと…ちょっと！\nちょっとならいいよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6384, 102, 2, 8, 0, 122601, 1, 0, "え、肝試し？\nう〜ん、うう〜ん…\n…騎士クンとなら！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6385, 1, 2, 1, 0, 122601, 1, 1, "おはよう騎士クン\n見て、あっちの空\nもう入道雲が出てる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6386, 2, 2, 1, 0, 122601, 1, 2, "夕立、来るかなぁ…\nもし雷が鳴ったら\nそばにいてくれる…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6387, 3, 2, 1, 0, 122601, 1, 3, "しー。…ほら、虫の声\n…わ、わたしの心臓の\n音は気にしないで…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6389, 2, 3, 1, 0, 122601, 1, 0, "ふふ、水着でゴロゴロ\nするのってなんだか…\nいけないことみたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6390, 3, 3, 1, 0, 122601, 1, 0, "かわいい～♪\n日光浴させて\nあげたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6391, 4, 3, 1, 0, 122601, 1, 0, "ほんのり潮の香りが…\n香ばしくて塩辛くて…\nあ…おなか鳴っちゃう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6392, 5, 3, 1, 0, 122601, 1, 0, "水着、乾かせるかも…\nそうだ、みんなの分も\n持ってこよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6394, 7, 3, 1, 0, 122601, 1, 0, "夏バテなんてしてたら\nみんなの足を\n引っ張っちゃうよね\nいただきます！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6395, 8, 3, 1, 0, 122601, 1, 0, "騎士クンの、どうして\n海はしょっぱいの？\nって質問の答えは…\n分かんないよぉ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6397, 10, 3, 1, 0, 122601, 1, 0, "顔は怒ってるのに\nなんだかかわいい…\n誰かに似てる…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6398, 11, 3, 1, 0, 122601, 1, 0, "これを枕に、ビーチで\n騎士クンと…なんて…\nなんて…なんて…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6399, 1, 1, 1, 0, 122901, 1, 0, "夏休み、\n毎日たのしいな～♪\nつぎはなにしよう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6400, 2, 1, 1, 0, 122901, 1, 0, "自由研究、\nなににしよっかな～？\nプチグリフォンさんの\nかんさつにっきとか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6401, 3, 1, 1, 0, 122901, 1, 0, "夏休みって、\n給食ないから…\nそれはちょっぴり\nさみしいかも…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6402, 4, 1, 1, 0, 122901, 1, 0, "砂浜をはだしで歩くの\nきもちいいよね♪\nくすぐったいけど\nミミ、好きなんだ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6403, 5, 1, 1, 0, 122901, 1, 0, "きれいな貝がら\n見つけちゃった♪\nミミのたからもの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6404, 101, 1, 4, 0, 122901, 1, 0, "ミミ、浴衣を\n買ってもらったんだ♪\n今度、おにいちゃんに\n見せてあげたいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6405, 102, 1, 8, 0, 122901, 1, 0, "ミミ、おにいちゃんと\nいっぱい夏休みの\n思い出つくりたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6406, 1, 2, 1, 0, 122901, 1, 0, "ねえ、おにいちゃん…\n夏休みの宿題、\nわかんないとこ\nおしえてくれる…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6407, 2, 2, 1, 0, 122901, 1, 0, "おかあさんにね、\n麦茶つくるの上手って\nほめられたんだ～♪\n飲んでみて♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6408, 3, 2, 1, 0, 122901, 1, 0, "夏休みの宿題で\nポスターかくんだ～♪\nおにいちゃんを\nかいてもいい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6409, 4, 2, 1, 0, 122901, 1, 0, "線香花火やりたいな♪\nミミ、長持ちさせるの\n上手なんだよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6410, 101, 2, 4, 0, 122901, 1, 0, "おにいちゃんの\n好きな本ってなあに？\nその本で読書感想文\n書こうかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6411, 102, 2, 8, 0, 122901, 1, 0, "海であそんだ後ね、\nおにいちゃんに\n髪を拭いてもらうの\nすきなんだ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6412, 1, 2, 1, 0, 122901, 1, 1, "夏休みって、\nワクワクして\n早起きしちゃうよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6413, 2, 2, 1, 0, 122901, 1, 2, "わぁ♪　お昼は、\n流しそうめんなんだ？\nミミ、流してみたい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6414, 3, 2, 1, 0, 122901, 1, 3, "こわい話聞いて、\nねむれないの…\nねえ、おにいちゃん、\nいっしょに寝ていい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6416, 2, 3, 1, 0, 122901, 1, 0, "ちょっぴりやすんだら\nまた、いっしょに\n海であそぼうね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6417, 3, 3, 1, 0, 122901, 1, 0, "すっごくかわいいね♪\nこの子のこと、\n絵日記にかこうっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6418, 4, 3, 1, 0, 122901, 1, 0, "くんくん…\nスイカのにおいだね♪\nこのにおいだいすき！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6419, 5, 3, 1, 0, 122901, 1, 0, "およいだあとは、\nちゃんと体を\nあっためなくちゃね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6421, 7, 3, 1, 0, 122901, 1, 0, "夏休みのご飯って\nなんだかとくべつ\nおいしい気がするね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6422, 8, 3, 1, 0, 122901, 1, 0, "夏の星座って\nすっごくきれいだね♪\nいつかみんなと\nいっしょに見たいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6424, 10, 3, 1, 0, 122901, 1, 0, "わぁ♪　この子、\nとってもかわいいね！\nおともだちに\nなりたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6425, 11, 3, 1, 0, 122901, 1, 0, "ミミ、人魚姫に\nなったみたい！\nおにいちゃん、\nとなりにすわって♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6426, 1, 1, 1, 0, 122801, 1, 0, "水着姿になると\nバカンス気分を\n味わえちゃうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6427, 2, 1, 1, 0, 122801, 1, 0, "海に行くの待ちきれ\nなくて、もう水着に\n着替えちゃった！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6428, 3, 1, 1, 0, 122801, 1, 0, "海に行ったら\nずぶぬれ系のイタズラ\nたくさんしかけよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6429, 4, 1, 1, 0, 122801, 1, 0, "部屋の中で泳ぎの練習\nしよう！　にいちゃん\nも水着に着替えて！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6430, 5, 1, 1, 0, 122801, 1, 0, "お日さまとお揃いの\n水着なんだ～♪\n似合ってるかなぁ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6431, 101, 1, 4, 0, 122801, 1, 0, "海といえば冒険！\n海底に眠る財宝を\n見つけちゃおう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6432, 102, 1, 8, 0, 122801, 1, 0, "にいちゃんと一緒だと\n部屋にいても海気分♪\nスイカわりしよっか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6433, 1, 2, 1, 0, 122801, 1, 0, "にいちゃん！\n早く海に行く準備\nしなよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6434, 2, 2, 1, 0, 122801, 1, 0, "ねーにいちゃん\n何秒息止められるか\n勝負しよーよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6435, 3, 2, 1, 0, 122801, 1, 0, "にいちゃんはアイスと\nかき氷どっちが好き？\nミソギは…どっちも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6436, 4, 2, 1, 0, 122801, 1, 0, "日焼け止めクリーム\nキョウカに\nもらったんだ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6437, 101, 2, 4, 0, 122801, 1, 0, "水中メガネがあれば\n水鉄砲くらっても\n平気だね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6438, 102, 2, 8, 0, 122801, 1, 0, "水着なら、毎日夏休み\n気分！　にいちゃんも\n着てみなよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6439, 1, 2, 1, 0, 122801, 1, 1, "にいちゃんおはよー！\n早く顔洗って、\nいっぱい遊んじゃお！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6440, 2, 2, 1, 0, 122801, 1, 2, "にいちゃんデザートは\nイチゴのかき氷だよ！\n…激辛ってバレた？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6441, 3, 2, 1, 0, 122801, 1, 3, "今日は楽しかった～！\n明日もイタズラ日和に\nなるといいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6443, 2, 3, 1, 0, 122801, 1, 0, "落とし穴の下に\nやわらかいの置けば\nケガしないよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6444, 3, 3, 1, 0, 122801, 1, 0, "かわいいね～！\nこの子も海に\n連れてっちゃおうよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6445, 4, 3, 1, 0, 122801, 1, 0, "このにおいを利用して\nイタズラするには…\nにいちゃんどう思う？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6446, 5, 3, 1, 0, 122801, 1, 0, "水着を着て暖炉で\nあったまるのって、\n変でおもしろいね～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6448, 7, 3, 1, 0, 122801, 1, 0, "海辺で食べる\nお昼ごはんって最高♪\nってことで海行こう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6449, 8, 3, 1, 0, 122801, 1, 0, "いつか海を越えて、\n地図にも載ってない\n場所を見つけたいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6451, 10, 3, 1, 0, 122801, 1, 0, "この口から水が出たら\nみんな驚くよね！\nぷぷ…細工しちゃお！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6452, 11, 3, 1, 0, 122801, 1, 0, "変な音がするイタズラ\nを仕込んどいて…\n誰か座らないかな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6453, 103, 1, 12, 0, 102701, 1, 0, "あなた様と私の愛を\n周りに見せつけて\n差し上げましょう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6454, 103, 2, 12, 0, 102701, 1, 0, "呼びましたか？\n呼びましたね？\nでは愛を語りましょう\nそうしましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6455, 1, 1, 1, 0, 122701, 1, 0, "水着で歩き回るのは\n恥ずかしいな…\n誰も見てないよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6456, 2, 1, 1, 0, 122701, 1, 0, "夏はやっぱり\nかき氷ですよね\n何色がいいかなぁ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6457, 3, 1, 1, 0, 122701, 1, 0, "あの人、泳げないって\n聞きました！\n私が教えてあげないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6458, 4, 1, 1, 0, 122701, 1, 0, "夏休みの宿題は\n計画的に進めましょう\n当たり前のことです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6459, 5, 1, 1, 0, 122701, 1, 0, "防犯魔石、どこに\n着けておこうかなぁ\n…ここにしようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6460, 101, 1, 4, 0, 122701, 1, 0, "海の楽しみ方は\n予習済みです！\nあとは実践ですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6461, 102, 1, 8, 0, 122701, 1, 0, "水着…きっとあの人に\n見られちゃいますよね\n…褒めてくれるかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6462, 1, 2, 1, 0, 122701, 1, 0, "触りたいんですか？\n…いいですよ\n帽子くらいなら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6463, 2, 2, 1, 0, 122701, 1, 0, "夏は体調管理に\n気をつけましょう\n私が管理してあげます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6464, 3, 2, 1, 0, 122701, 1, 0, "海に行くのが楽しみで\nたまらないんですか？\n私はそこまで…嘘です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6465, 4, 2, 1, 0, 122701, 1, 0, "いつもより薄着だから\nなんだか恥ずかしい…\nみ、見ないでください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6466, 101, 2, 4, 0, 122701, 1, 0, "へんたいふしんしゃ～\nえっ？　ああ、これは\n海に叫ぶ練習です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6467, 102, 2, 8, 0, 122701, 1, 0, "あなたと一緒に\n海に行くなんて…\nなんだか大人…えへへ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6468, 1, 2, 1, 0, 122701, 1, 1, "おはようございます\nさぁ、海に行って\n私と運動しましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6469, 2, 2, 1, 0, 122701, 1, 2, "あっつ～い…\nはっ！？　ダメですよ\nシャキッとしないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6470, 3, 2, 1, 0, 122701, 1, 3, "明日も海で\n遊ぶために、しっかり\nお休みしましょうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6472, 2, 3, 1, 0, 122701, 1, 0, "夏を楽しむときは\n休憩も大事ですよね\n計画的に、計画的に！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6473, 3, 3, 1, 0, 122701, 1, 0, "かわいいなぁ～\n海のお土産屋さんに\n売ってるかなぁ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6474, 4, 3, 1, 0, 122701, 1, 0, "大人な香りがします\n私も違いが分かる\n素敵な女性になります");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6475, 5, 3, 1, 0, 122701, 1, 0, "濡れた体を\n乾かしましょう\nタオル、タオル…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6477, 7, 3, 1, 0, 122701, 1, 0, "泳いだ後は\n栄養補給…だけど\n…おなか膨らんじゃう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6478, 8, 3, 1, 0, 122701, 1, 0, "遊ぶだけじゃなくて\nお勉強もしてますよ\nあなたもどうですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6480, 10, 3, 1, 0, 122701, 1, 0, "ミミが喜びそう…♪\nわ、私ははしゃいだり\nしませんけど…っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6481, 11, 3, 1, 0, 122701, 1, 0, "ミソギがいたずらに\n使いそう…しっかりと\n試しておかないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6482, 1, 1, 1, 0, 123001, 1, 0, "あたしがまさか\nここにいるなんて…\n自分でも不思議だわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6483, 2, 1, 1, 0, 123001, 1, 0, "昔みたいにあちこち\n飛び回れないのって\nちょっと不便かも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6484, 3, 1, 1, 0, 123001, 1, 0, "こうして誰かと一緒に\n暮らせるのもあいつや\nみんなのおかげね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6485, 4, 1, 1, 0, 123001, 1, 0, "ここで厄介になるなら\nあたしも家事とか\n手伝わないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6486, 5, 1, 1, 0, 123001, 1, 0, "…だめ！　誰かの\n世話をせずには\nいられないわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6487, 101, 1, 4, 0, 123001, 1, 0, "あいつたちが\n帰ってくるところだし\n綺麗にしないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6488, 102, 1, 8, 0, 123001, 1, 0, "せっかくあたしが\nいるっていうのに\n少しは構いなさいよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6489, 1, 2, 1, 0, 123001, 1, 0, "おいしい店とか\n知らないの？\n食べに行きましょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6490, 2, 2, 1, 0, 123001, 1, 0, "あんた暇でしょ？\nあたしのやること\n手伝いなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6491, 3, 2, 1, 0, 123001, 1, 0, "コッコロたんと\n遊んでくるから\n留守番よろしく♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6492, 4, 2, 1, 0, 123001, 1, 0, "あらおかえり…って\nボロボロじゃない！\nまた人助けしてたの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6493, 101, 2, 4, 0, 123001, 1, 0, "やっぱりあたしは\nあんたのそばが\n一番落ち着くみたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6494, 102, 2, 8, 0, 123001, 1, 0, "どこまでだって\nあんたと一緒に\nいてやるんだから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6495, 1, 2, 1, 0, 123001, 1, 1, "ふわぁ…おはよう\n…大きくなったせいか\n朝は特に体が重いわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6496, 2, 2, 1, 0, 123001, 1, 2, "お昼ご飯が食べたい？\nしょうがないわね…\nなんか作って\nあげるから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6497, 3, 2, 1, 0, 123001, 1, 3, "あんたまだ成長期だし\nさっさと寝なさい\n大きくなれないわよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6499, 2, 3, 1, 0, 123001, 1, 0, "たまにはあたしも\nゆっくりしないと\nもたないのよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6500, 3, 3, 1, 0, 123001, 1, 0, "かわいいじゃな～い♪\nコッコロたんに\nプレゼントしたいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6501, 4, 3, 1, 0, 123001, 1, 0, "いい香りね\n塔にもこういうの\n置いておこうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6502, 5, 3, 1, 0, 123001, 1, 0, "炎か…前は\n羽が焼けそうで\n怖かったっけ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6504, 7, 3, 1, 0, 123001, 1, 0, "あむ…妖精に\n体重増減の設定って\nあったっけ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6505, 8, 3, 1, 0, 123001, 1, 0, "記憶のデータと違って\n物語はいいわね\n結末が読めなくて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6507, 1, 1, 1, 0, 123101, 1, 0, "冒険のお土産\nみんなにおすそわけ\nせなあきまへんな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6508, 2, 1, 1, 0, 123101, 1, 0, "おとぎ話よりも\n不思議なことが\nあるもんやねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6509, 3, 1, 1, 0, 123101, 1, 0, "冒険しに出かけるなら\n動きやすい服装に\nせななぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6510, 4, 1, 1, 0, 123101, 1, 0, "地図に水筒に…\n他に忘れもんは\nあらへんやろか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6511, 5, 1, 1, 0, 123101, 1, 0, "これまでの冒険のこと\nノートに書いて\nまとめてますんよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6512, 101, 1, 4, 0, 123101, 1, 0, "王子はんとの冒険は\nどれもマホマホ王国の\n大事な歴史や♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6513, 102, 1, 8, 0, 123101, 1, 0, "どこへ冒険するときも\nうちと王子はんは\n一緒どす♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6514, 1, 2, 1, 0, 123101, 1, 0, "魔法で火ぃつける\n練習してますんよ～\nよう爆発しますけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6515, 2, 2, 1, 0, 123101, 1, 0, "うちと王子はんで\n冒険道具をお揃いに\nするんもええなぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6516, 3, 2, 1, 0, 123101, 1, 0, "テント張りも随分\n上達したんよ\n王子はんのおかげやね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6517, 4, 2, 1, 0, 123101, 1, 0, "ランスロットたちの\n新しい冒険衣装\n思いついたんよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6518, 101, 2, 4, 0, 123101, 1, 0, "迷子になっても\n王子はんと一緒なら\nきっと大丈夫やね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6519, 102, 2, 8, 0, 123101, 1, 0, "王子はんのこと、\nきっちり守れるように\nなってみせますえ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6520, 1, 2, 1, 0, 123101, 1, 1, "お寝坊さんは\n布団めくって\n起こしにいきますえ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6521, 2, 2, 1, 0, 123101, 1, 2, "支度が終わったら\n今日の冒険に\n出かけまひょか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6522, 3, 2, 1, 0, 123101, 1, 3, "もうちょっと\nおしゃべりしたいん？\nあと少しだけやで♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6524, 2, 3, 1, 0, 123101, 1, 0, "冒険で疲れた体に\nこの癒しぱわーは\nあきまへん…すや…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6525, 3, 3, 1, 0, 123101, 1, 0, "ふふ、あんさんも\nうちと一緒に\n冒険します？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6526, 4, 3, 1, 0, 123101, 1, 0, "虫除けのアロマは\n冒険の必需品どす\n忘れんようにせんと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6527, 5, 3, 1, 0, 123101, 1, 0, "うちも魔法使わんでも\n火ぃ起こせるよう\n練習せんとあかんなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6529, 7, 3, 1, 0, 123101, 1, 0, "この料理…\n冒険するときに\n作ってみまひょか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6530, 8, 3, 1, 0, 123101, 1, 0, "王子はんとの\n愛と冒険のおとぎ話…\nはぁ…素敵やわぁ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6532, 103, 1, 12, 0, 103101, 1, 0, "あの人との\n最良の未来のために\n占いも霊能力ももっと\n精進しなきゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6533, 103, 2, 12, 0, 103101, 1, 0, "あなたともっと深く\nつながりたいです\n絆も、そして魂までも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6534, 103, 1, 12, 0, 104401, 1, 0, "絆の契約…\nあやつが望むのなら\n考えぬでもないがのう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6535, 103, 2, 12, 0, 104401, 1, 0, "なんじゃ？\nわらわの姿に\n見惚れたかの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6536, 1, 1, 1, 0, 123201, 1, 0, "旅の荷物って多いな…\nねぇぷうきち～\nすこしは持ってよぉ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6537, 2, 1, 1, 0, 123201, 1, 0, "傘はなくてもいっか\nぷうきちがいるし♪\n『おいなんだと…？』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6538, 3, 1, 1, 0, 123201, 1, 0, "旅先で人見知りなんか\nしてちゃだめだよね…\nまずはあいさつだ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6539, 4, 1, 1, 0, 123201, 1, 0, "おみやげはやっぱり\nご当地ぬいぐるみ\nだよね♪　ワクワク…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6540, 5, 1, 1, 0, 123201, 1, 0, "知らない場所かぁ…\nうぅ…考えただけで\nすでにホームシック…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6541, 101, 1, 4, 0, 123201, 1, 0, "野宿するってことは…\nお兄ちゃんのマントで\n寝るチャンスかも…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6542, 102, 1, 8, 0, 123201, 1, 0, "どんなに危険な冒険も\nお兄ちゃんと一緒なら\n大丈夫！　…だよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6543, 1, 2, 1, 0, 123201, 1, 0, "ぷうきちのアイマスク\nも腹巻も持ってくの！\n旅の必需品なの～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6544, 2, 2, 1, 0, 123201, 1, 0, "これ全部背負うのって\nけっこうむずかしいの\n順番まちがえると大変");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6545, 3, 2, 1, 0, 123201, 1, 0, "えへへ～\nなでなでして？　帽子\nの上からでもいいよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6546, 4, 2, 1, 0, 123201, 1, 0, "『悪いが絆創膏の部分\nはアンタッチャブルだ\n綿が飛び出ちまう』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6547, 101, 2, 4, 0, 123201, 1, 0, "お兄ちゃんと一緒に\nもっともっといろんな\n景色が見たいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6548, 102, 2, 8, 0, 123201, 1, 0, "旅って、終わる時は\nきっとさびしいよね…\nお兄ちゃん、帰り道は\n手をつないでもいい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6549, 1, 2, 1, 0, 123201, 1, 1, "出発が楽しみすぎて\n寝られなかった…\n『旅行のお約束だな』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6550, 2, 2, 1, 0, 123201, 1, 2, "わぁ　いいお天気！\n旅の間もずーっと\nぴーかんだといいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6551, 3, 2, 1, 0, 123201, 1, 3, "知らない場所で寝るの\n怖いな…寝る時だけ\n帰ってこようかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6553, 2, 3, 1, 0, 123201, 1, 0, "旅先にはクッションも\nソファもないよね…\n『俺でいいだろ』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6554, 3, 3, 1, 0, 123201, 1, 0, "ぬいぐるみのみんな\n旅の無事を\n祈ってて…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6555, 4, 3, 1, 0, 123201, 1, 0, "旅先の香りも\n思い出に持って\n帰れたらいいのにな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6556, 5, 3, 1, 0, 123201, 1, 0, "旅行用に携帯用暖炉\nがあるといいかも…！\n『まだ荷物増やす？』");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6558, 7, 3, 1, 0, 123201, 1, 0, "『もう出発だぜ？』\nえーまってまって！\n腹ごしらえがまだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6559, 8, 3, 1, 0, 123201, 1, 0, "世界ってこんなに広い\nんだ…！　はやく自分\nの目で見てみたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6561, 1, 1, 1, 0, 123301, 1, 0, "はちゃめちゃヒマ～\nなーんか楽し～コト\nないかなー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6562, 2, 1, 1, 0, 123301, 1, 0, "ここ、いートコだねー\nこんどカリザきゅんも\nつれてこよー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6563, 3, 1, 1, 0, 123301, 1, 0, "かわゆいショタが\n見た～い♪\n触りた～～～い♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6564, 4, 1, 1, 0, 123301, 1, 0, "なんか服きっついなー\nちょい太ったかー？\nん～\nま・気のせーっしょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6565, 5, 1, 1, 0, 123301, 1, 0, "あ～やべ\nおねえちゃんに\nメッセすんの忘れたー\nまいっかー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6566, 101, 1, 4, 0, 123301, 1, 0, "パンケーキ食いてー\n騎士きゅん\n誘ってみよーっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6567, 102, 1, 8, 0, 123301, 1, 0, "きょーも～\n好きぴに囲まれて～\nシ・ア・ワ・セ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6568, 1, 2, 1, 0, 123301, 1, 0, "アタシと遊ばな～い？\nってなんか\nナンパみスゴー\nウケる～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6569, 2, 2, 1, 0, 123301, 1, 0, "んー？\n今はだるいからパース\nあとでねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6570, 3, 2, 1, 0, 123301, 1, 0, "カリザきゅん\n見なかった～？\nおねえちゃんから\n逃げるとかオシオキー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6571, 4, 2, 1, 0, 123301, 1, 0, "ネイルしたいけど\n無理なんよねー\n爪の間にめっちゃ\nスライム入っからさー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6572, 101, 2, 4, 0, 123301, 1, 0, "おねえちゃんに\nかまってほし～の？\nかわゆ～い♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6573, 102, 2, 8, 0, 123301, 1, 0, "な～に騎士きゅん♪\nここでイチャイチャ～\nし・ちゃ・う～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6574, 1, 2, 1, 0, 123301, 1, 1, "ねんむ～\nけど外から\nショタの声したんで～\nつい起きちった～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6575, 2, 2, 1, 0, 123301, 1, 2, "ランチの後はやっぱ\nデザートっしょー\nベツバラってヤツ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6576, 3, 2, 1, 0, 123301, 1, 3, "こんな時間まで\n起きてるコは～\n食べちゃうぞ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6578, 2, 3, 1, 0, 123301, 1, 0, "あーラクー\nいっしょーここで\nキューケーできるわー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6579, 3, 3, 1, 0, 123301, 1, 0, "なにこれ～\nかわいいじゃ～ん\nショタの次くらいに～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6580, 4, 3, 1, 0, 123301, 1, 0, "いーニオイする～\nなんのニオイとかー\nよくわかんないけどー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6581, 5, 3, 1, 0, 123301, 1, 0, "あったか～♪\n溶けてスライム\n戻りそ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6583, 7, 3, 1, 0, 123301, 1, 0, "ン・ン・ン～♪\nお・い・し～♪\nも～っと食べるぅ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6584, 8, 3, 1, 0, 123301, 1, 0, "わ～なんかムズー\n読めなー\nウケるー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6586, 1, 1, 1, 0, 123501, 1, 0, "あんパンって\nお菓子に入るのかな？\nハロウィンで\nもらえたりしない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6587, 2, 1, 1, 0, 123501, 1, 0, "お菓子をくれなきゃ\nぐうたらするぞ～！\nハロウィン以外でも！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6588, 3, 1, 1, 0, 123501, 1, 0, "お化けになったら\n仕事しないで\nゴロゴロし放題\nなのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6589, 4, 1, 1, 0, 123501, 1, 0, "おっと…この仮装\n袖がすごく長いからさ\n引っ掛けないように\n気を付けないとね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6590, 5, 1, 1, 0, 123501, 1, 0, "イタズラするのも\n体力がいるよね～\n楽にできそうなの\n何かないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6591, 101, 1, 4, 0, 123501, 1, 0, "あいつって\n仮装とかするのかな？\n似合いそうなのは\nどんなお化けだろ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6592, 102, 1, 8, 0, 123501, 1, 0, "ずっとハロウィンなら\nあいつと遊び放題\nなんだけどな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6593, 1, 2, 1, 0, 123501, 1, 0, "今の街はハロウィン\n一色だからね～\n人混みが大変だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6594, 2, 2, 1, 0, 123501, 1, 0, "この仮装、どうかな？\n気に入ったなら\n来年もしてあげるよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6595, 3, 2, 1, 0, 123501, 1, 0, "実はこの長い袖\nドングリとかを\nため込めるんだよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6596, 4, 2, 1, 0, 123501, 1, 0, "カボチャランタンが\nあるんなら\nドングリランタンも\nあっていいよね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6597, 101, 2, 4, 0, 123501, 1, 0, "ハロウィンでも\nやる気があれば\nぐうたらできる…\nうん、いいこと言った");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6598, 102, 2, 8, 0, 123501, 1, 0, "一緒にお菓子食べよ？\n寝転びながら堪能する\nハロウィンスイーツは\n最高だからね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6599, 1, 2, 1, 0, 123501, 1, 1, "お化けは寝る時間…\n今のあたしはお化け…\nだから、おやすみ～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6600, 2, 2, 1, 0, 123501, 1, 2, "お昼か～…\n食後のデザートは\nハロウィンのお菓子で\n決まりだね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6601, 3, 2, 1, 0, 123501, 1, 3, "ふぁ～、寝よ…\nお化けは夜に\n出るものだけど\nあたしはリスだからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6603, 2, 3, 1, 0, 123501, 1, 0, "ハロウィンを楽しむ\nためにも、ぐっすり\n寝とかないとね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6604, 3, 3, 1, 0, 123501, 1, 0, "…袖から手が\n出せないから\nこのまま撫でよう\nよしよし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6605, 4, 3, 1, 0, 123501, 1, 0, "リラックスできる\n素敵な香りだね～\n成仏しそうだよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6606, 5, 3, 1, 0, 123501, 1, 0, "あったかいね～\nここで寝てもいい？\n…着替えないとダメか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6608, 7, 3, 1, 0, 123501, 1, 0, "もぐもぐ…\nお化けもリスも\nお腹は空くんだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6609, 8, 3, 1, 0, 123501, 1, 0, "キョンシーって\nどんなお化けなのか\n本で調べようかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6611, 12, 3, 1, 0, 123501, 1, 0, "より取り見取りだね～\nとりあえず、これと\nこのお菓子はキープで");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6613, 1, 1, 1, 0, 123601, 1, 0, "よし、衣装もばっちり\nハロウィンパレードへ\n出かけよう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6614, 2, 1, 1, 0, 123601, 1, 0, "仮装してても\n剣は手放せないね\nほとんど体の一部だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6615, 3, 1, 1, 0, 123601, 1, 0, "見回りに誘うふりして\n二人でパレードに\n参加しちゃおうかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6616, 4, 1, 1, 0, 123601, 1, 0, "…あれ？　手錠の鍵\n落としちゃった…？\nやば、出かける前に\n見つけないと…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6617, 5, 1, 1, 0, 123601, 1, 0, "お家でコスプレも\nこれはこれで楽しいな\n決めポーズの練習\nたくさんしておこう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6618, 101, 1, 4, 0, 123601, 1, 0, "他にも、お姫様に\nメイドさんに学生服…\nやりたいコスプレが\n多すぎるよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6619, 102, 1, 8, 0, 123601, 1, 0, "漫画もゲームも好き！\n仮装するのも大好き！\n…好きを言葉にすると\nもっと好きになる♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6620, 1, 2, 1, 0, 123601, 1, 0, "ずっと目が合ってるね\n見つめてくれるのは\nいいんだけど、今日は\n衣装を見てほしいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6621, 2, 2, 1, 0, 123601, 1, 0, "トリックオアトリート\nお菓子をくれなきゃ\n逮捕しちゃうぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6622, 3, 2, 1, 0, 123601, 1, 0, "あなたにだけはこの姿\nいつでも見せてあげる\nふふ、なんちゃって♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6623, 4, 2, 1, 0, 123601, 1, 0, "どうしたの？\nイタズラするなら\n隙を突かなきゃ\nこんなふうに、ね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6624, 101, 2, 4, 0, 123601, 1, 0, "コスプレしてても\n剣の稽古は休まないよ\nちょっと相手になって\nくれるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6625, 102, 2, 8, 0, 123601, 1, 0, "ひゃっ、びっくりした\n急に触らないでよ～\nハロウィンだからって\nイタズラしないでね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6626, 1, 2, 1, 0, 123601, 1, 1, "おはよう！\n今日も朝から\nパトロールに行こう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6627, 2, 2, 1, 0, 123601, 1, 2, "カボチャのケーキを\n用意してるよ！\nデザートを食べて\n午後も頑張ろう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6628, 3, 2, 1, 0, 123601, 1, 3, "暗くなってきたね\nカボチャのランタンに\n火を灯そうよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6630, 2, 3, 1, 0, 123601, 1, 0, "ふかふか気持ちいい～\nあっでも衣装がシワに\nなっちゃうかも…？\n…でも気持ちいい～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6631, 3, 3, 1, 0, 123601, 1, 0, "…かわいい\nこの子もパレードに\n連れて行きたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6632, 4, 3, 1, 0, 123601, 1, 0, "はぁ～癒される♪\nハロウィンの見回りが\n終わった後は、\nまったりくつろごう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6633, 5, 3, 1, 0, 123601, 1, 0, "ここで二人寄り添って\nカボチャスープ飲もう\n…なんて想像したら\nポカポカしてきた…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6635, 7, 3, 1, 0, 123601, 1, 0, "パレードに参加すると\n体力を使うから、\nいっぱい食べておこう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6636, 8, 3, 1, 0, 123601, 1, 0, "この絵本のお姫様\nかわいいね\nこの仮装もいいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6638, 12, 3, 1, 0, 123601, 1, 0, "わあ、おいしそう！\n見回りに行く前に\n少しつまんじゃおう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6640, 103, 1, 12, 0, 103701, 1, 0, "今日こそは、あの人に\n気持ちを打ち明けて…\nそのあとは…うう\nど、どうしよう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6641, 103, 2, 12, 0, 103701, 1, 0, "私が剣なら、あなたは\nさしずめ私の鞘…\nふふ、私の帰る\n場所ってことだよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6642, 1, 1, 1, 0, 123701, 1, 0, "やっぱり\nコスプレしてると\nテンションあがる～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6643, 2, 1, 1, 0, 123701, 1, 0, "キャラコスにも\n興味あるけど…\nマジカル、ラブリー\nどっちにしよっかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6644, 3, 1, 1, 0, 123701, 1, 0, "キャラコスといえば\nミスティーシャイニー\nもいいんだよねえ…\nうはー！　悩むー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6645, 4, 1, 1, 0, 123701, 1, 0, "ギルドハウスで\n宅コスしてる人\n実は結構\nいるんじゃないかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6646, 5, 1, 1, 0, 123701, 1, 0, "コスプレだけど普段着\nって言いはれそう…\nって、ダメダメ！\nオタクは節度が大事！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6647, 101, 1, 4, 0, 123701, 1, 0, "フェスで買ってきた\n薄い本～♪\nギルドハウスに持って\nきちゃおっかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6648, 102, 1, 8, 0, 123701, 1, 0, "ようこそ\nコスプレ沼へ～\nなんちゃって♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6649, 1, 2, 1, 0, 123701, 1, 0, "どうどう？\nナナカちゃんの\nハロウィンコスプレ\n似合ってる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6650, 2, 2, 1, 0, 123701, 1, 0, "ハロウィン魔法少女\n参上カボ～！\n…やっぱ今の語尾\nナシで！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6651, 3, 2, 1, 0, 123701, 1, 0, "ハロウィンといえば\nトリックオア～…\nコスプレ！\nなんちゃって");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6652, 4, 2, 1, 0, 123701, 1, 0, "ランフェスの\n戦利品～♪\nねえねえ\n見たい？　見たい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6653, 101, 2, 4, 0, 123701, 1, 0, "私にしてほしい\nコスプレがあったら\n教えて♪　君のために\nや～ってやるぜぇ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6654, 102, 2, 8, 0, 123701, 1, 0, "一緒にコスプレしたい\nならナナカちゃんは\nいつでも大歓迎だよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6655, 1, 2, 1, 0, 123701, 1, 1, "ふぁあ…ねむ\nって、ありゃりゃ　\n昨日コスプレしたまま\n寝ちゃってたかあ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6656, 2, 2, 1, 0, 123701, 1, 2, "今日のお昼は\nなんにしよ？\nカボチャ料理に\nしよっかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6657, 3, 2, 1, 0, 123701, 1, 3, "もうこんな時間かあ\nそういえばオタクって\n夜行性の人が多い\n気がするぜぇ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6659, 2, 3, 1, 0, 123701, 1, 0, "ふっふっふ\nこのパニエは\n座るときはちゃんと\nふにゃってなるのさ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6660, 3, 3, 1, 0, 123701, 1, 0, "いや～\nかわいいものをみると\n癒されますな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6661, 4, 3, 1, 0, 123701, 1, 0, "新しい薄い本の匂いの\nアロマとか…ダメ？\n私はあの匂い、なんか\n好きなんだよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6662, 5, 3, 1, 0, 123701, 1, 0, "暖か～い…\nけど近づきすぎて\n衣装が燃えないように\n気を付けなきゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6664, 7, 3, 1, 0, 123701, 1, 0, "コス衣装のために\n体型維持は必須だけど\nついつい\n食べちゃうんだよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6665, 8, 3, 1, 0, 123701, 1, 0, "おっ、次はこの本に\nのってるキャラのコス\nしてみよっかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6667, 12, 3, 1, 0, 123701, 1, 0, "おおっ！\nお菓子がいっぱい！\nベルルちゃんチョコ\n入ってないかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6669, 1, 1, 1, 0, 123801, 1, 0, "むっ…\nこの耳の手触り…\n驚嘆に値する…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6670, 2, 1, 1, 0, 123801, 1, 0, "獲物を狩りまくる…\nそんなウサギがいても\nいいだろう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6671, 3, 1, 1, 0, 123801, 1, 0, "ワナなど怖くないぞ？\nむしろ積極的に\n踏んでいく性分だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6672, 4, 1, 1, 0, 123801, 1, 0, "一匹狼ならぬ\n一匹ウサギか\nどっちでもかまわん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6673, 5, 1, 1, 0, 123801, 1, 0, "人間とて本を正せば獣\n本能に従えばよいのだ\n遠慮は無用さ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6674, 101, 1, 4, 0, 123801, 1, 0, "脱兎のごとく…\n逃げるものか\n坊やを追い回すのさ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6675, 102, 1, 8, 0, 123801, 1, 0, "獣の道は険しいが…\n坊やめ、音を上げずに\nちゃんとついてきたな\n褒めてやるとしよう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6676, 1, 2, 1, 0, 123801, 1, 0, "ニンジンはいらん\n好物は好敵手だ\nさぁどんどんおくれ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6677, 2, 2, 1, 0, 123801, 1, 0, "尻尾に触りたいだと？\nワタシの乱数聖域を\n崩せたらな…☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6678, 3, 2, 1, 0, 123801, 1, 0, "頭で考えるな\n体に率直になれ\n己を野放しにするのさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6679, 4, 2, 1, 0, 123801, 1, 0, "そうさモコフワさ♪\nなで心地は最高だが\n意外にどう猛だぞ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6680, 101, 2, 4, 0, 123801, 1, 0, "ワタシにピョンピョン\n跳ねてほしいのか？\nあとでじっくり、な♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6681, 102, 2, 8, 0, 123801, 1, 0, "ワタシと番になるか？\nオマエさえよければ\nいつでもかまわんぞ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6682, 1, 2, 1, 0, 123801, 1, 1, "太陽と共に目覚め\n活動する\nそれが獣の生き方さ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6683, 2, 2, 1, 0, 123801, 1, 2, "昼寝をすればいい\nワタシが周囲を\n警戒していてやる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6684, 3, 2, 1, 0, 123801, 1, 3, "暗くなれば眠るだけさ\nそうすれば余計な\nストレスなどたまらん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6686, 2, 3, 1, 0, 123801, 1, 0, "むむっ！？\n尻尾がつっかえて\nうまく座れんな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6687, 3, 3, 1, 0, 123801, 1, 0, "愛らしさでワタシに\n張り合おうというのか\n５億年後に出直せ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6688, 4, 3, 1, 0, 123801, 1, 0, "野生の芳香か…\n本能が呼び覚まされる\nいいセンスだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6689, 5, 3, 1, 0, 123801, 1, 0, "寒さも野生のうちだ\n…とはいえ\n温まっていくか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6691, 7, 3, 1, 0, 123801, 1, 0, "悪くはないが物足りん\nこう見えて肉食なのだ\n肉はないのか肉は☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6692, 8, 3, 1, 0, 123801, 1, 0, "ウサギ族は地獄耳？\nワタシとの共通点だな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6694, 103, 1, 12, 0, 106401, 1, 0, "ここが私の家…\nそれはこれからも\nずっと変わらないわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6695, 103, 2, 12, 0, 106401, 1, 0, "ええと、その…今から\nデート…じゃなくって\n散歩でもどうかしら？\n…ふ、二人きりで…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6696, 1, 1, 1, 0, 123901, 1, 0, "ギルドハウスに\nヒーロー参上！\nみんな仲良くッスよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6697, 2, 1, 1, 0, 123901, 1, 0, "料理もできて\n鎧も作れる！\nお母さんはすごいッス");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6698, 3, 1, 1, 0, 123901, 1, 0, "ううう…\nまたマントをドアに\n挟んじゃったッス…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6699, 4, 1, 1, 0, 123901, 1, 0, "ずっと鎧を着ていれば\nジュンさんに近づける\nかも？　燃えるッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6700, 5, 1, 1, 0, 123901, 1, 0, "サインの練習…\nもっとしておいた\nほうがいいッスかね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6701, 101, 1, 4, 0, 123901, 1, 0, "半人前でも\n胸を張るッス！\nそのうち似合う日が\nくるッスから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6702, 102, 1, 8, 0, 123901, 1, 0, "種族の違いも\n強い魂があれば\n超えられるッス！\n信じてるッスよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6703, 1, 2, 1, 0, 123901, 1, 0, "困ったときは\n自分を呼ぶッス！\nあと楽しいときにも\n呼んでほしいッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6704, 2, 2, 1, 0, 123901, 1, 0, "特訓でも行くッスか？\n望むところッス！\n目指せ、一人前！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6705, 3, 2, 1, 0, 123901, 1, 0, "新しいショーの台本を\n読みこんでるッス！\nところで…この言葉の\n意味、分かるッスか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6706, 4, 2, 1, 0, 123901, 1, 0, "ヒミツがなくなると\nなんか恥ずかしいッス\nあんたはどうッスか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6707, 101, 2, 4, 0, 123901, 1, 0, "ヒーローは遅れて\nやってくる…\nあんたもそうッスね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6708, 102, 2, 8, 0, 123901, 1, 0, "誰よりも早く\nあんたに見せたいッス\n一人前になった自分！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6709, 1, 2, 1, 0, 123901, 1, 1, "うーん、今日も\nよく眠れたッス～！\n絶好調、間違いなし！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6710, 2, 2, 1, 0, 123901, 1, 2, "おお、もうお昼ッスか\nどうりでお腹が空くと\n思ったッス～えへへ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6711, 3, 2, 1, 0, 123901, 1, 3, "パトロールのあとは\n歯みがきに宿題に…\n大忙しッスね、夜！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6713, 2, 3, 1, 0, 123901, 1, 0, "こんなにリラックス\nできるなんて…\n平和な証拠ッスね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6714, 3, 3, 1, 0, 123901, 1, 0, "か、かわいい…♪\nさあ、自分と握手…\nううん、抱っこッス♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6715, 4, 3, 1, 0, 123901, 1, 0, "優しい匂いッスね…♪\nこれくらいみんなを\n包み込めるように\nなりたいッス～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6716, 5, 3, 1, 0, 123901, 1, 0, "ひっくちゅ！　うー…\nちょっと冷えるッスね\nぬくぬくするッス～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6718, 7, 3, 1, 0, 123901, 1, 0, "特訓した分、\nいっぱい食べるッス！\nでっかくなるッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6719, 8, 3, 1, 0, 123901, 1, 0, "いつか自分の\nヒミツ図鑑が出たり\nして…いやいやいや");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6721, 1, 1, 1, 0, 106901, 1, 0, "牢獄よりは\nマシな環境ね\n我慢してあげるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6722, 2, 1, 1, 0, 106901, 1, 0, "退屈ね…\nキャルでもいじって\n暇をつぶそうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6723, 3, 1, 1, 0, 106901, 1, 0, "ここにいる連中\n私を天気予報士と\n勘違いしてない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6724, 4, 1, 1, 0, 106901, 1, 0, "音波情報が多いわね…\nここ、もう少し静かに\nならないの…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6725, 5, 1, 1, 0, 106901, 1, 0, "共同生活なんて\n久しぶりだわ\n…懐かしいわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6726, 101, 1, 4, 0, 106901, 1, 0, "あの子たちのギルド\n経営が雑すぎるわ…！\n教育が必要みたいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6727, 102, 1, 8, 0, 106901, 1, 0, "とどめを刺される\n準備はできているのに\nまだなのかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6728, 1, 2, 1, 0, 106901, 1, 0, "私と戦う気になった？\nあら、まだなのね…\nその時を待ってるわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6729, 2, 2, 1, 0, 106901, 1, 0, "私というリソースは\n有効活用しなさい\n子守なんてごめんだわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6730, 3, 2, 1, 0, 106901, 1, 0, "どうしてそんなに\n頭がいいか？\n生まれつきよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6731, 4, 2, 1, 0, 106901, 1, 0, "視力は権能に\n影響しないわよ\n当たり前じゃない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6732, 101, 2, 4, 0, 106901, 1, 0, "あなたまで天気を\n教えろですって…？\nぶっ殺すわよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6733, 102, 2, 8, 0, 106901, 1, 0, "暇なら付き合いなさい\n好きなゲームでいいわ\nどうせ私が勝つもの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6734, 1, 2, 1, 0, 106901, 1, 1, "人生朝露…\n悔いのない一日を\n過ごしなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6735, 2, 2, 1, 0, 106901, 1, 2, "午睡はいいわよ…\nふわぁ…眠りは思考に\n必要不可欠なの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6736, 3, 2, 1, 0, 106901, 1, 3, "夙興夜寝なんて\nやめておきなさい\n休息は大切よ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6738, 2, 3, 1, 0, 106901, 1, 0, "私を満足させるなんて\n大したものね…晶に\n大量生産させるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6739, 3, 3, 1, 0, 106901, 1, 0, "キャルの代わりに\nズタズタにする物が\n欲しかったの…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6740, 4, 3, 1, 0, 106901, 1, 0, "いい香りじゃない\n見たことのない調合ね\n誰が用意したの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6741, 5, 3, 1, 0, 106901, 1, 0, "パワーが足りないわね\nもっとよ、もっと私を\n寛がせなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6743, 7, 3, 1, 0, 106901, 1, 0, "栄養価はともかく\n味のバランスは\n悪くないわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6744, 8, 3, 1, 0, 106901, 1, 0, "つまらない本は\n私が書き直すわ\nこれはどうかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6746, 1, 1, 1, 0, 124001, 1, 0, "今年はアカリと\nお姉ちゃんでサンタが\n二人…つまり幸せも\n二倍ですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6747, 2, 1, 1, 0, 124001, 1, 0, "クリスマスに向けての\nサックス練習…\nお兄ちゃんと一緒に\n猛特訓です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6748, 3, 1, 1, 0, 124001, 1, 0, "クリスマスツリーの\n飾りつけ、完璧です♪\nお兄ちゃんお姉ちゃん\n喜んでくれるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6749, 4, 1, 1, 0, 124001, 1, 0, "わあ、お外が真っ白！\n生クリームが\nいーっぱいの\nケーキみたいです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6750, 5, 1, 1, 0, 124001, 1, 0, "煙突から入ると\nお洋服が汚れちゃう…\n玄関からじゃ\nダメなのかなぁ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6751, 101, 1, 4, 0, 124001, 1, 0, "お兄ちゃんが来たら\nサンタのお洋服\nいっぱい褒めて\nもらおっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6752, 102, 1, 8, 0, 124001, 1, 0, "聖夜をお兄ちゃんと\n過ごせたら…\nアカリもちょっぴり\n大人になれるかも♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6753, 1, 2, 1, 0, 124001, 1, 0, "今のアカリは\nサンタさんですから♪\nなんでもお願いして\nくださいね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6754, 2, 2, 1, 0, 124001, 1, 0, "お外は寒いですから\nアカリとくっついて\nお出かけしましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6755, 3, 2, 1, 0, 124001, 1, 0, "お兄ちゃんは\nアカリのトナカイさん\nですから、ずーっと\nそばにいてください♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6756, 4, 2, 1, 0, 124001, 1, 0, "お兄ちゃん、助けて！\nアカリのカラダで\nラッピング練習したら\n絡まっちゃいました…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6757, 101, 2, 4, 0, 124001, 1, 0, "プレゼント、いっぱい\n準備できました♪\nお兄ちゃんの分は…\nまだヒミツでーす♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6758, 102, 2, 8, 0, 124001, 1, 0, "アカリ、プレゼントは\n大人っぽいのがいいな\n早くお兄ちゃんに\n追いつきたいから♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6759, 1, 2, 1, 0, 124001, 1, 1, "おはようございます♪\nふふ、アカリサンタは\nいい子のお手本なので\n早寝早起きなんです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6760, 2, 2, 1, 0, 124001, 1, 2, "あれ、もうお昼？\nクリスマスナンバーの\n練習してたら\nもうこんな時間…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6761, 3, 2, 1, 0, 124001, 1, 3, "冬の夜空は星が\nキレイですね～\nお兄ちゃん、一緒に\n見に行きませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6763, 2, 3, 1, 0, 124001, 1, 0, "はぁ、快適すぎて\nとろけちゃいそう…\nこういうプレゼントも\nいいかもです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6764, 3, 3, 1, 0, 124001, 1, 0, "やん、かわいいです♪\nえへへ、お兄ちゃんは\nどんなプレゼントが\n欲しいですか～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6765, 4, 3, 1, 0, 124001, 1, 0, "わわ、大人な香り…\nロマンチックな\nクリスマスが\n過ごせそうです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6766, 5, 3, 1, 0, 124001, 1, 0, "これでカラダを温めて\nアカリの温もり…\nお兄ちゃんに\nおすそ分けしよっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6768, 7, 3, 1, 0, 124001, 1, 0, "お腹がパンパンです…\nでもこれで\nちょっとサンタさんに\n近づけたかも…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6769, 8, 3, 1, 0, 124001, 1, 0, "クリスマスイブの\n恋人との過ごし方…？\nはわわ、アカリには\nまだ早いかもです…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6771, 14, 3, 1, 0, 124001, 1, 0, "わっ、すごいすごい！\n不思議な絵本ですね♪\nこの本でお兄ちゃんに\nイタズラしちゃお♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6772, 15, 3, 1, 0, 124001, 1, 0, "アカリ、ホカホカに\nなっちゃいました～♪\n…ぎゅってしても\nいいですよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6773, 1, 1, 1, 0, 124101, 1, 0, "またエンジェルになる\nかもとは思ってたけど\n…サンタさん要素の\n追加は想定外だったわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6774, 2, 1, 1, 0, 124101, 1, 0, "ラフィたちがいない\nときは私がなんとか\nしないとね\n一応…エンジェルだし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6775, 3, 1, 1, 0, 124101, 1, 0, "部屋の飾りつけとか\nするのも…あり？\nふふ、浮かれすぎかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6776, 4, 1, 1, 0, 124101, 1, 0, "パーティーだったら\nみんなで大人数向けの\nボードゲームもできる\nかも…やったっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6777, 5, 1, 1, 0, 124101, 1, 0, "この服のモコモコ…\n気づいたら触っちゃう\n…やるわね、ラフィ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6778, 101, 1, 4, 0, 124101, 1, 0, "アイツと一緒にいると\n人見知りとは違う\n緊張があるのよね…\nって今の聞いてたっ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6779, 102, 1, 8, 0, 124101, 1, 0, "ぬいぐるみ…\nいじめてないわよね？\n…大事にしてるって？\nそれはそれで…あうぅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6780, 1, 2, 1, 0, 124101, 1, 0, "いい子と悪い子って\nどう見分けるのかしら\n…まさか素直さとか？\nだったら困る！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6781, 2, 2, 1, 0, 124101, 1, 0, "プレゼントといえば\nやっぱりゲーム！\n年末商戦サイコー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6782, 3, 2, 1, 0, 124101, 1, 0, "サンタさんはお仕事を\n見られちゃ\nいけないのよね？\n…天職？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6783, 4, 2, 1, 0, 124101, 1, 0, "この服は汚れ対策も\nバッチリなのよね\n煙突に入れるように\n…いや私はNGよ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6784, 101, 2, 4, 0, 124101, 1, 0, "アンタのお願い…\n今なら一つくらい\n聞いてあげるわよ？\nほら、サンタ衣装だし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6785, 102, 2, 8, 0, 124101, 1, 0, "私たちって\nなぜかぬいぐるみと\n縁があるわよね\n…ふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6786, 1, 2, 1, 0, 124101, 1, 1, "お、おはよっ\n…ふぅ、寝ぐせを\n直すのが間に合って\nよかったぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6787, 2, 2, 1, 0, 124101, 1, 2, "え…一緒にごはん？\nそ、そう…うん。OK\nまあ、せっかくだし？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6788, 3, 2, 1, 0, 124101, 1, 3, "この時間のゲームって\n妙に楽しいのよね\n…ということで、\nちょっと遊ばない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6790, 2, 3, 1, 0, 124101, 1, 0, "ああ～ダメになるぅ…\nもうここでずっと\nゲームしてた～い");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6791, 3, 3, 1, 0, 124101, 1, 0, "プレゼントのために\n研究は必要よね、うん\n…はぁ、かわいい～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6792, 4, 3, 1, 0, 124101, 1, 0, "集中力を高める香りも\nあるのよね…\n勝負をするときには\n持ち歩こうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6793, 5, 3, 1, 0, 124101, 1, 0, "なんだかまったり\nしちゃうわね…\n時間が溶けるわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6795, 7, 3, 1, 0, 124101, 1, 0, "お腹いっぱい\n食べられるのも\n幸せなことよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6796, 8, 3, 1, 0, 124101, 1, 0, "ちっちゃいときは\nアカリと一緒に絵本を\n読んだなぁ…懐かしい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6798, 14, 3, 1, 0, 124101, 1, 0, "飛び出す絵本…\nこれでゲームブックを\n作ったらおもしろく\nなる気がするわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6799, 15, 3, 1, 0, 124101, 1, 0, "あったまる…\nモフモフ…ふわふわ…\nちょっと休憩しても…\nいいよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6800, 103, 1, 12, 0, 105101, 1, 0, "あら、どうしたの？\nもしかして、私と\n新しい実験を\n始めたくなった？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6801, 103, 2, 12, 0, 105101, 1, 0, "調子が悪いときは\n診療所に来て\n君は特別に、じっくり\n診察してあげるわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6802, 1, 1, 1, 0, 124201, 1, 0, "特別じゃなくても\nまったり過ごす\nクリスマスも\nいいものだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6803, 2, 1, 1, 0, 124201, 1, 0, "ニットの帽子に\nマフラーに耳当て…\n素顔用の防寒対策を\n整えなければ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6804, 3, 1, 1, 0, 124201, 1, 0, "靴下が\n見当たらなかったから\n枕元にはかわりに\n鎧を置いておこう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6805, 4, 1, 1, 0, 124201, 1, 0, "聖女なんて言われる程\n素晴らしくはないけど\n心は聖くいたいものだ\n日々精進だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6806, 5, 1, 1, 0, 124201, 1, 0, "兜がないから\nイルミネーションが\nいつもよりまぶしく\n感じるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6807, 101, 1, 4, 0, 124201, 1, 0, "皆の幸福を\n祈願して\nクリスマスリースを\n飾ろうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6808, 102, 1, 8, 0, 124201, 1, 0, "私にはかわいすぎる\n衣装だが…開き直って\nクリスマス気分を\n楽しんでしまおう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6809, 1, 2, 1, 0, 124201, 1, 0, "ツリーの飾りつけ\n手伝ってくれるかい？\nセンスは少年に\nお任せするよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6810, 2, 2, 1, 0, 124201, 1, 0, "パーティーは\n用意してる時も楽しい\nねえ少年、この気持ち\n分かってくれるかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6811, 3, 2, 1, 0, 124201, 1, 0, "なんでトナカイの鼻は\n赤いのかって？\n無灯ソリ運転は違反で\n取り締まられるからだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6812, 4, 2, 1, 0, 124201, 1, 0, "トモちゃんや\nマツリちゃんは\nいい子だから、きっと\nサンタさんに会えるね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6813, 101, 2, 4, 0, 124201, 1, 0, "ヒイラギの髪飾り\n実は気にいってるんだ\n少年にも\n褒めてもらいたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6814, 102, 2, 8, 0, 124201, 1, 0, "ねえ少年…そろそろ\n見慣れてほしい\nそんなにまじまじ\n見つめられると照れる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6815, 1, 2, 1, 0, 124201, 1, 1, "朝日に照らされて\n街がキラキラ白銀に\n輝いてるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6816, 2, 2, 1, 0, 124201, 1, 2, "お昼ご飯を食べて\nちょっと散歩しようか\n祝祭に沸く街は\nとてもきれいだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6817, 3, 2, 1, 0, 124201, 1, 3, "やっぱりクリスマスは\n夜が本番って感じだね\nキャンドルを灯して\n厳かに過ごそうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6819, 2, 3, 1, 0, 124201, 1, 0, "鎧姿では無縁だったが\nふかふかしていて\n気持ちいいな…\nふかふか…ふかふか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6820, 3, 3, 1, 0, 124201, 1, 0, "ふふ、かわいいね\n抱きしめると\nあの雪の日に産まれた\n赤ちゃんを思い出す");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6821, 4, 3, 1, 0, 124201, 1, 0, "兜を脱いだおかげで\nこの香りに出会えた\n…クリスマスの魔法も\n悪くないかもね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6822, 5, 3, 1, 0, 124201, 1, 0, "指先から体の芯まで\n暖まるね\nこれなら雪の日でも\n安心だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6824, 7, 3, 1, 0, 124201, 1, 0, "もぐ、もぐ…\nあまり食べるところ\n見ないでほしい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6825, 8, 3, 1, 0, 124201, 1, 0, "素敵なレストランの\n特集記事が載ってる\n聖夜に予約が取れたら\n最高に幸せだろうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6827, 14, 3, 1, 0, 124201, 1, 0, "わっ！\n…………いや\n驚いてなどいない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6828, 15, 3, 1, 0, 124201, 1, 0, "ふふ…頬に直接\nふかふかを感じられる\n温かくて気持ちいいよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6829, 1, 1, 1, 0, 124301, 1, 0, "ピアノに読書…\nグレアと一緒に\nなにをしようかな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6830, 2, 1, 1, 0, 124301, 1, 0, "元の世界へ戻った時\n授業に遅れないよう\nグレアと勉強しとこう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6831, 3, 1, 1, 0, 124301, 1, 0, "街に魔物料理屋さんが\nあるんだ！　グレアと\n食べに行ってみよう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6832, 4, 1, 1, 0, 124301, 1, 0, "せっかく新しい魔法を\n覚えたし、グレアにも\n見てもらいたいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6833, 5, 1, 1, 0, 124301, 1, 0, "グレアも誘って\nランドソルをもっと\n探索したい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6834, 101, 1, 4, 0, 124301, 1, 0, "私たちも\nあの人を見習って\nバイトとかしよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6835, 102, 1, 8, 0, 124301, 1, 0, "いつかあの人を\n私たちの学院に\n招待したいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6836, 1, 2, 1, 0, 124301, 1, 0, "あのね！\nこれからグレアと\n魔法愛好会に\n行くんだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6837, 2, 2, 1, 0, 124301, 1, 0, "これからなにするの？\n私たちもついて行って\nいいかな！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6838, 3, 2, 1, 0, 124301, 1, 0, "グレアと一緒に\nあなたも魔法の練習\nしてみない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6839, 4, 2, 1, 0, 124301, 1, 0, "グレアとよく話すの\nマナリアの制服\nあなたに着せたいって");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6840, 101, 2, 4, 0, 124301, 1, 0, "グレアのそばって\n温かいんだ～！\nぬくぬくだよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6841, 102, 2, 8, 0, 124301, 1, 0, "あなたは\nグレアと私の友達！\nこれからもずっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6842, 1, 2, 1, 0, 124301, 1, 1, "おはよう！\n今朝はグレアと一緒に\n外を散歩してきたよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6843, 2, 2, 1, 0, 124301, 1, 2, "お腹空いたな…\nよし、グレアと一緒に\n魔物料理を作ろう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6844, 3, 2, 1, 0, 124301, 1, 3, "もうこんな時間だね\n明日のために\nそろそろ寝ようかな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6846, 2, 3, 1, 0, 124301, 1, 0, "はぁ～この感触…\nグレアの尻尾みたいで\n安らぐ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6847, 3, 3, 1, 0, 124301, 1, 0, "ぬいぐるみって\nいいよね…私もよく\nグレアに抱き付くんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6848, 4, 3, 1, 0, 124301, 1, 0, "いい香り～…\nグレアもこういうの\n好きなんだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6849, 5, 3, 1, 0, 124301, 1, 0, "あったかいね～…\nグレアにくっついてる\n時を思い出すよ～…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6851, 7, 3, 1, 0, 124301, 1, 0, "この世界にしかない\nおいしいものが\nたくさんあるよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6852, 8, 3, 1, 0, 124301, 1, 0, "世界を繋ぐ魔法の\nヒント…本に書いて\nないかなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6855, 1, 1, 1, 0, 124401, 1, 0, "ピアノに読書…\n今日のアンは\nなにをするのかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6856, 2, 1, 1, 0, 124401, 1, 0, "私はアンほど\n勉強はできないから\nちゃんと自習しないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6857, 3, 1, 1, 0, 124401, 1, 0, "一度始めたら\nとことん追求するのが\nアンなんだよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6858, 4, 1, 1, 0, 124401, 1, 0, "ふふ…夢中になってる\nアンを眺めてるだけで\n一日があっという間…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6859, 5, 1, 1, 0, 124401, 1, 0, "ランドソルは広いね…\nアンと一緒にいろんな\n場所へ行ってみたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6860, 101, 1, 4, 0, 124401, 1, 0, "アンやあの人の笑顔を\n見てると、すごく\n安心するんだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6861, 102, 1, 8, 0, 124401, 1, 0, "もしあの人が私たちの\n学院に編入したら…\nふふ、楽しそうだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6862, 1, 2, 1, 0, 124401, 1, 0, "アンもあなたも\nすごいな…\nみんなとすぐに\n仲良くなっちゃうから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6863, 2, 2, 1, 0, 124401, 1, 0, "あなたはこれから\nなにをするの？\nその…アンと一緒に\nついていってもいい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6864, 3, 2, 1, 0, 124401, 1, 0, "アンから魔法の練習に\n誘われた？　実は私も\n…一緒にどうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6865, 4, 2, 1, 0, 124401, 1, 0, "あなたがマナリアに\n編入したら\n楽しいのになって\nアンとよく話すんだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6866, 101, 2, 4, 0, 124401, 1, 0, "こっちの世界にも\nアンのように\n私を受け入れてくれる\n人たちがいるんだね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6867, 102, 2, 8, 0, 124401, 1, 0, "元の世界へ帰る日が\n来たとしても私たちは\n「さよなら」より\n「またね」がいいよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6868, 1, 2, 1, 0, 124401, 1, 1, "おはよう。さっき\nランドソルの朝日を\nアンと見てきたんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6869, 2, 2, 1, 0, 124401, 1, 2, "私たちは\nこれからなんだけど\nあなたはお昼ごはん\n何を食べたの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6870, 3, 2, 1, 0, 124401, 1, 3, "そろそろ\nアンが眠る時間だ…\nあなたもおやすみ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6872, 2, 3, 1, 0, 124401, 1, 0, "はぁ、疲れが取れる…\nこの尻尾…\nちょっと重いんだよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6873, 3, 3, 1, 0, 124401, 1, 0, "これ…\nアンに見せたら\n喜ぶだろうな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6874, 4, 3, 1, 0, 124401, 1, 0, "いい香り…\nアンの感想も\n聞いてみたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6875, 5, 3, 1, 0, 124401, 1, 0, "あったかい…\nアンがここにいたら\n本を読みながら\n寝ちゃうんだろうな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6877, 7, 3, 1, 0, 124401, 1, 0, "おいしいからたくさん\n食べれちゃうけど\nまた尻尾…\n大きくなっちゃうかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6878, 8, 3, 1, 0, 124401, 1, 0, "アンがおススメ\nしてくれた本は\nこれかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6881, 1, 1, 1, 0, 124701, 1, 0, "凶、凶、凶…大凶？\nなによこのおみくじ\n自宅用だからって\n排出率が適当すぎよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6882, 2, 1, 1, 0, 124701, 1, 0, "今年こそ最高の新薬が\nもはや偶然に近い\n最小限の手間で\n作れますように");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6883, 3, 1, 1, 0, 124701, 1, 0, "喉に詰まる前に\n溶けてなくなるお餅…\n最優先の研究課題だわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6884, 4, 1, 1, 0, 124701, 1, 0, "よし、完成♪\nミツキ特製…\n「新解釈おせち料理」\n医学的根拠が満載よ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6885, 5, 1, 1, 0, 124701, 1, 0, "お年玉を彼に…\nあげるべき…？\n色んな意味で微妙ね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6886, 101, 1, 4, 0, 124701, 1, 0, "ふふ、今年もまた一年\n彼のバイタルを\n記録できるのね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6887, 102, 1, 8, 0, 124701, 1, 0, "今年こそ\n私の薬で彼を魔改造…\nううん、大人の男に！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6888, 1, 2, 1, 0, 124701, 1, 0, "コマ回しのコマを\n見てたら目が回った？\nそう…手当は不要よ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6889, 2, 2, 1, 0, 124701, 1, 0, "私の顔で\n福笑いを作った？\nあら…隻眼まで\n再現度が高いわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6890, 3, 2, 1, 0, 124701, 1, 0, "門松よし、しめ縄よし\nこんなギルドでもね\n一応縁起を担ぐのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6891, 4, 2, 1, 0, 124701, 1, 0, "本気の薬草を煮込んだ\n本気の七草粥よ\n色は気にしちゃダメ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6892, 101, 2, 4, 0, 124701, 1, 0, "君が今年も健康で\nつつがなく…実験台を\n務められますように");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6893, 102, 2, 8, 0, 124701, 1, 0, "いくつ新年を迎えても\n俗世の垢にまみれない\nそんな君こそが…\n私には最高のお薬よ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6894, 1, 2, 1, 0, 124701, 1, 1, "お正月なんだから\nいつまでも寝てないで\nさぁ、実験開始よ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6895, 2, 2, 1, 0, 124701, 1, 2, "カルタも双六もしたし\nあとは実験くらいしか\nやることがないわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6896, 3, 2, 1, 0, 124701, 1, 3, "日頃からたいがい\n意味深な夢を見るけど\n初夢はまた別かしら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6898, 2, 3, 1, 0, 124701, 1, 0, "さすがにこの格好で\n寝正月を敢行するのは\nためらわれるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6899, 3, 3, 1, 0, 124701, 1, 0, "や、闇医者たる者\nこんな愛くるしい物に\n心奪われるわけには…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6900, 4, 3, 1, 0, 124701, 1, 0, "お雑煮のいい香り…\n食欲が増進されるわ\nアロマも立派なお薬ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6901, 5, 3, 1, 0, 124701, 1, 0, "胸元は閉じないわよ？\nでも時々ここで\nこっそり暖まるの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6903, 7, 3, 1, 0, 124701, 1, 0, "無から有が生まれてる\n新年早々物理の法則を\n無視してくるのね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6904, 8, 3, 1, 0, 124701, 1, 0, "どれもこれも読んだわ\n新しい婚活本の\n入荷はまだかしら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6906, 1, 1, 1, 0, 124601, 1, 0, "彼が一生懸命\n書いてくれた年賀状\n気持ちがこもっていて\nすごくうれしいわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6907, 2, 1, 1, 0, 124601, 1, 0, "しっかり丁寧に\n大掃除したから\nとってもいい気持ちで\n新年を迎えられたわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6908, 3, 1, 1, 0, 124601, 1, 0, "彼の着物姿\nきっと凛々しいわよね\n想像しただけで\n笑顔になるわ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6909, 4, 1, 1, 0, 124601, 1, 0, "お雑煮は地域によって\n違いがあるけれど\n愛情が隠し味なのは\nどこも一緒よね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6910, 5, 1, 1, 0, 124601, 1, 0, "彼と凧揚げして\n遊びたいけど\n森では引っかかって\nできないかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6911, 101, 1, 4, 0, 124601, 1, 0, "今年も彼が素直に\n成長できるように\nたくさんいい子いい子\nしてあげましょう…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6912, 102, 1, 8, 0, 124601, 1, 0, "絵馬に彼と\n書いた通り\n今年もみんなが笑って\n過ごせますように");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6913, 1, 2, 1, 0, 124601, 1, 0, "先生と初詣に\n行きましょう〜♪\n迷子にならないように\n手を繋いで、ね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6914, 2, 2, 1, 0, 124601, 1, 0, "初売りセールいいわね\nでも気を付けないと\nあれこれ欲しくなって\n買い過ぎちゃうかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6915, 3, 2, 1, 0, 124601, 1, 0, "風邪をひかないように\n温かくするんですよ～\nえ？　先生、温めて？\nふふ、甘えん坊さんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6916, 4, 2, 1, 0, 124601, 1, 0, "あなたのために\nちょっと豪華なおせち\n用意したのよ\nお口に合うかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6917, 101, 2, 4, 0, 124601, 1, 0, "あなたも着物着たい？\nふふ、貫禄出ちゃって\n先生ドキドキ\nしちゃうかも…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6918, 102, 2, 8, 0, 124601, 1, 0, "あなたの成長は\nとってもうれしいけど\n今年もまだ、あなたの\n先生でいたいな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6919, 1, 2, 1, 0, 124601, 1, 1, "あら、起きたの？\nお雑煮できてるから\nちゃんとお顔\n洗ってらっしゃいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6920, 2, 2, 1, 0, 124601, 1, 2, "お昼ご飯を\nしっかり食べて\nみんなでかるた大会\nしましょう〜♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6921, 3, 2, 1, 0, 124601, 1, 3, "は～い、良い子は\nもう寝る時間ですよ\n素敵な初夢が\n見られますように♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6923, 2, 3, 1, 0, 124601, 1, 0, "このフカフカちゃんも\n天日干ししたいけど…\nその前にちょっと\n休憩しちゃおうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6924, 3, 3, 1, 0, 124601, 1, 0, "うふふ、かわいい～\nアオイちゃんや\nハツネちゃんも\nきっと気に入るわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6925, 4, 3, 1, 0, 124601, 1, 0, "お正月は空気も\n透き通ってるから\nいつも以上に\n素敵な香りに感じるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6926, 5, 3, 1, 0, 124601, 1, 0, "火のぬくもりに\n抱かれていると\n不思議と眠気が…\nふああ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6928, 7, 3, 1, 0, 124601, 1, 0, "愛情のこもった料理は\nおいしいだけじゃなく\n心も満たされちゃう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6929, 8, 3, 1, 0, 124601, 1, 0, "お正月のお作法も\nたくさんあるのね～\n先生も日々勉強だわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6931, 103, 1, 12, 0, 104701, 1, 0, "少年への感謝をどんな\n形で伝えるべきか…\n言葉よりも物の方が\n良いのだろうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6932, 103, 2, 12, 0, 104701, 1, 0, "話し相手になって\nもらってもいいかな？\n少年と一緒にいると\nとても楽しいんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6933, 1, 1, 1, 0, 124501, 1, 0, "お正月だからって\nギャングのボスは\n油断できないよ～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6934, 2, 1, 1, 0, 124501, 1, 0, "イノリちゃんがお年玉\n欲しいんだって♪\n悪い子だったし\n10ルピでいいかな☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6935, 3, 1, 1, 0, 124501, 1, 0, "お正月だからお雑煮を\n作ったんだけど\nカヤちゃんには\n大好評だったよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6936, 4, 1, 1, 0, 124501, 1, 0, "ラーゴがお餅を\n食べたがってるけど…\nこの子にあげるのは\nちょっと心配かな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6937, 5, 1, 1, 0, 124501, 1, 0, "お正月は晴れ着の子が\nやっぱり多いよね～\n今度、私の漫画でも\n出してみようかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6938, 101, 1, 4, 0, 124501, 1, 0, "君と二人っきりで\n神殿に初詣…\n行ってみたいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6939, 102, 1, 8, 0, 124501, 1, 0, "君とお正月を\n過ごしていると\n面倒なことも\n全部忘れられそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6940, 1, 2, 1, 0, 124501, 1, 0, "この着物、どう思う？\n似合ってたら\nうれしいけどな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6941, 2, 2, 1, 0, 124501, 1, 0, "袖を引っ張ったり\nしないでね？\n着崩れしちゃうから♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6942, 3, 2, 1, 0, 124501, 1, 0, "お正月ならではの\n漫画ネタってある？\n参考にしたいんだよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6943, 4, 2, 1, 0, 124501, 1, 0, "昔は凧あげとか\n駒回しとかしてたけど\n大人になるとそういう\n機会も減るよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6944, 101, 2, 4, 0, 124501, 1, 0, "君にもお年玉を\nあげようか？\n好きな額を言ってね☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6945, 102, 2, 8, 0, 124501, 1, 0, "来年も、再来年も…\nこうしてみんなで\n新年がお祝いできると\n素敵だね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6946, 1, 2, 1, 0, 124501, 1, 1, "おはよ～♪\n朝ごはんは\n焼いたお餅とか\nどうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6947, 2, 2, 1, 0, 124501, 1, 2, "お昼だね～\nおせちを用意したから\nみんなで食べよっか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6948, 3, 2, 1, 0, 124501, 1, 3, "もうこんな時間だね～\n一日中着物だったから\n肩が凝っちゃったよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6950, 2, 3, 1, 0, 124501, 1, 0, "このまま寝たら\nしわになるかな？\n着替えた方がいい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6951, 3, 3, 1, 0, 124501, 1, 0, "こういうのって\nラーゴのおもちゃに\nちょうどいいかも♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6952, 4, 3, 1, 0, 124501, 1, 0, "いい香りだけど\n着物に移らないように\n気をつけないとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6953, 5, 3, 1, 0, 124501, 1, 0, "ちょうどいい\n火加減だね♪\nぽかぽかするよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6955, 7, 3, 1, 0, 124501, 1, 0, "着物の時は\nほどほどにしないと…\n欲張ったら、お腹が\n苦しくなるからね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6956, 8, 3, 1, 0, 124501, 1, 0, "ふーん\nイノリちゃんは最近\nこんな漫画を\n読んでるんだ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6958, 1, 1, 1, 0, 124801, 1, 0, "楽園の気配は…ナシ！\nみんな前を向いてるね\nそうこなくっちゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6959, 2, 1, 1, 0, 124801, 1, 0, "レッスンの成果も\nこの格好くらい\n目に見えたら\n分かりやすいのになぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6960, 3, 1, 1, 0, 124801, 1, 0, "次の曲はワイルドで\n悪い感じもいいなぁ…\nカヤとムイミちゃん\nみたいなイメージで！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6961, 4, 1, 1, 0, 124801, 1, 0, "私…服、着てるよね？\nうんうん、着てる！\nあんまり体が軽いと\n急に焦る瞬間あるな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6962, 5, 1, 1, 0, 124801, 1, 0, "最近ファンの年齢層が\n幅広くなってきたかも\nこれって私…国民的\nアイドルに近づいた？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6963, 101, 1, 4, 0, 124801, 1, 0, "パティスリーとコラボ\nしたらどんな感じかな\n…ノゾミンマカロン♪\nとか？　…いけるかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6964, 102, 1, 8, 0, 124801, 1, 0, "彼と一緒にいると…\nうれしくって苦しいな\nでも両方諦められない\n…アイドルらしいや");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6965, 1, 2, 1, 0, 124801, 1, 0, "この格好、チカと\nツムギも似合うと\n思うんだけどな～\nキミもそう思うよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6966, 2, 2, 1, 0, 124801, 1, 0, "街を歩いてたらね？\nライブとか写真集の\n告知イベントだって\n思われちゃった！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6967, 3, 2, 1, 0, 124801, 1, 0, "私が持ってた剣に\n結んであったリボン…\n何か気づいてくれた？\nヒントは…色だよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6968, 4, 2, 1, 0, 124801, 1, 0, "キミの気配ってすごく\n分かりやすいんだよ\n近くにいたらすぐに\nピンとくるんだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6969, 101, 2, 4, 0, 124801, 1, 0, "あ、それ…はじめて\nキミにあげた音響盤！\nね、一緒に聴こうよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6970, 102, 2, 8, 0, 124801, 1, 0, "ぼうっとしてたら\nイタズラしちゃうよ♪\nもっともっと私のこと\n見てないとダーメ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6971, 1, 2, 1, 0, 124801, 1, 1, "朝は今日のはじまり！\n昨日よりももっと\nいい一日にしようね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6972, 2, 2, 1, 0, 124801, 1, 2, "レッスンがんばったし\nまだお昼だし…\nランチ大盛りにしても\nセーフだよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6973, 3, 2, 1, 0, 124801, 1, 3, "寝る前に明日の予定を\n確認しておかないと！\nえっと、集合場所は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6975, 2, 3, 1, 0, 124801, 1, 0, "一休みのつもりが\nなが～い休憩になるの\nあるあるだよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6976, 3, 3, 1, 0, 124801, 1, 0, "ノゾミンの熱烈ハグ♪\n…ここだけ聞いたら\nスクープになっちゃう\nかも？　なーんて！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6977, 4, 3, 1, 0, 124801, 1, 0, "香りってなんだか\n記憶に残るよねー\n…こういうの私だけ？\nみんなも同じだよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6978, 5, 3, 1, 0, 124801, 1, 0, "なんだかライブの\n熱気を思い出して\nきちゃった…！\nレッスンしよっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6980, 7, 3, 1, 0, 124801, 1, 0, "お腹が減ってたら\nいいパフォーマンスは\nできないもんね！\n…んー、おいし～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6981, 8, 3, 1, 0, 124801, 1, 0, "いい歌詞を書くには\nしっくりくる言葉を\n知っておかないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6983, 1, 1, 1, 0, 124901, 1, 0, "うだうだ悩んでる\nヤツがいたら\nオレのとこ連れてこい\n背中押してやるからさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6984, 2, 1, 1, 0, 124901, 1, 0, "最近どことなく\nファミリーの連中が\n浮き足立ってんだよな\n…なんでだ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6985, 3, 1, 1, 0, 124901, 1, 0, "イノリのヤツ\nやたらと脇腹\nつついてきやがって…\nくすぐったいっての");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6986, 4, 1, 1, 0, 124901, 1, 0, "身軽になったのは\nいいが…くそっ\nどこもかしこも\nスースーする…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6987, 5, 1, 1, 0, 124901, 1, 0, "思い出に浸るのも\n悪くはないが\nやっぱ人間\n未来に生きないとな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6988, 101, 1, 4, 0, 124901, 1, 0, "またムイミやノゾミと\nツルむのもいいな\nそこにカレもいたら\nなおいいぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6989, 102, 1, 8, 0, 124901, 1, 0, "未来のことを考えると\nなぜかいつもカレが\n頭に浮かんじまう…\nええい、やめだやめ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6990, 1, 2, 1, 0, 124901, 1, 0, "ちょっくらオレと\n腕相撲しねえか？\nこの新しい力\n試させてくれ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6991, 2, 2, 1, 0, 124901, 1, 0, "なあ、悪いが上着\n貸してくれないか？\nこのカッコ、割と\n肌寒いんだよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6992, 3, 2, 1, 0, 124901, 1, 0, "おっ、生まれ変わった\n喧嘩屋にご用命か？\nいいぜ、キミの\n依頼なら二つ返事だ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6993, 4, 2, 1, 0, 124901, 1, 0, "なんか悩みごとが\nあるなら、なんでも\n話してくれよな\nオレとキミの仲だろ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6994, 101, 2, 4, 0, 124901, 1, 0, "このカッコが\nきれいだって？\nや、やめろよ…\n照れくさいだろ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6995, 102, 2, 8, 0, 124901, 1, 0, "キミがいると、なにを\nするにも退屈しないぜ\nだから今日も\n付き合ってくれよな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6996, 1, 2, 1, 0, 124901, 1, 1, "おはよう！　新しい\n未来がやってきたぜ！\n一秒だって時間は\n無駄にするなよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6997, 2, 2, 1, 0, 124901, 1, 2, "そろそろ昼飯に\nしないか？\n穴場のうまい店に\n案内してやるからさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (6998, 3, 2, 1, 0, 124901, 1, 3, "夜更かしは\n未来の前借りだ\n体壊さないように\nほどほどにしとけよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7000, 2, 3, 1, 0, 124901, 1, 0, "お、いいなこれ\nファミリーの\nアジトにも\n置いときたいぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7001, 3, 3, 1, 0, 124901, 1, 0, "べ、別にかわいいもん\nなんて、そんなに\n好きじゃないし…\n嫌いでもないけどさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7002, 4, 3, 1, 0, 124901, 1, 0, "嗅いだことない\n香りだな\nなかなか気に入った！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7003, 5, 3, 1, 0, 124901, 1, 0, "薄着で暖を取るのって\n最高にぜいたくだよな\nへへっ、堪能させて\nもらうとするか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7005, 7, 3, 1, 0, 124901, 1, 0, "こいつはいいや\nこのカッコだと\n消耗が激しくて\nやたら腹が減るからな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7006, 8, 3, 1, 0, 124901, 1, 0, "甘辛コーデ…\nへぇ、そんなのが\nあるのか…\nわ、悪くねえかもな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7008, 103, 1, 12, 0, 105501, 1, 0, "はぁ…\nもっともっと長い時間\n先輩と過ごせたらなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7009, 103, 2, 12, 0, 105501, 1, 0, "えへへ…♪\n先輩が、すぐそばに\nいてくれるなんて…\n幸せだなぁ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7010, 1, 1, 1, 0, 125001, 1, 0, "はーっはっは！\n強くてカッコいい\n大悪党、ここに参上！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7011, 2, 1, 1, 0, 125001, 1, 0, "みんなおしゃれで\nカッコいいけど\n今のアタシも\n負けてないぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7012, 3, 1, 1, 0, 125001, 1, 0, "ギャングのアジトも\nよかったけど\nここも賑やかで\n悪くないな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7013, 4, 1, 1, 0, 125001, 1, 0, "悪党にも休息は必要だ\nここならゆっくり\n休めそうだ！\n邪魔するぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7014, 5, 1, 1, 0, 125001, 1, 0, "いっぱい人がいるな…\nアタシの悪党っぷりを\n広めるチャンスだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7015, 101, 1, 4, 0, 125001, 1, 0, "ここにいれば\nいい思い出がたくさん\n作れそうだな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7016, 102, 1, 8, 0, 125001, 1, 0, "いつかアタシも\nオクトーと一緒に\nこんなアジトを手に\n入れてやるからな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7017, 1, 2, 1, 0, 125001, 1, 0, "ん？　アタシの格好が\n気になるのか？\nならもっと近くで\n見てもいいぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7018, 2, 2, 1, 0, 125001, 1, 0, "おい、暇だから\nアタシと遊べ！\nカヤとノゾミも呼んで\n大騒ぎするぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7019, 3, 2, 1, 0, 125001, 1, 0, "オマエ、前より強く\nなってないか！？\nくっそー！　アタシも\n負けてらんないぞー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7020, 4, 2, 1, 0, 125001, 1, 0, "今日は特別にアタシの\n思い出話を聞かせて\nやる！　さーて、どの\n悪事から話そうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7021, 101, 2, 4, 0, 125001, 1, 0, "オマエとの付き合いも\n結構長くなったよな？\nこれからも\nよろしく頼むぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7022, 102, 2, 8, 0, 125001, 1, 0, "オマエまでいなく\nなったらアタシが困る\n勝手にどっか\n行くんじゃないぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7023, 1, 2, 1, 0, 125001, 1, 1, "起きろ、起きろー！\n大悪党の朝は早いんだ\nさっさと\n顔洗ってこい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7024, 2, 2, 1, 0, 125001, 1, 2, "昼飯どうしようか…\nそうだ！　オマエの\nおススメに連れてけ！\nいい店期待してるぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7025, 3, 2, 1, 0, 125001, 1, 3, "明日を思い切り\n楽しむためにも\n早く寝とけよ！\nまた明日な！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7027, 2, 3, 1, 0, 125001, 1, 0, "こうやって座ると…\nおお！　すっごく悪党\nっぽいぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7028, 3, 3, 1, 0, 125001, 1, 0, "オマエ、仲間に\nなりたそうな目を\nしてるな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7029, 4, 3, 1, 0, 125001, 1, 0, "うん、いい匂いだ！\n何の匂いかは全然\n分かんないけどな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7030, 5, 3, 1, 0, 125001, 1, 0, "炎ってなんだか\nカッコいいよな！\n見てるだけで心が\n燃えてくるぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7032, 7, 3, 1, 0, 125001, 1, 0, "いっぱい食べれば\nちょっとは\n背が伸びるかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7033, 8, 3, 1, 0, 125001, 1, 0, "ぐぬぅ…たまには\n本でもと思ったけど\nやっぱりアタシは\nバトル担当だな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7035, 1, 1, 1, 0, 118201, 1, 0, "お邪魔しまーす★\nなーんてもう\nすっかりくつろいで\nますけどー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7036, 2, 1, 1, 0, 118201, 1, 0, "騎士さんの\nギルドハウス…★\nなんだかドキドキ\nしちゃいます♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7037, 3, 1, 1, 0, 118201, 1, 0, "ぺんぽこりんの\n置き場所はー…\nま、このへんで★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7038, 4, 1, 1, 0, 118201, 1, 0, "うーん、これは\n壊しがいがありそ…\nウソウソ、冗談です★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7039, 5, 1, 1, 0, 118201, 1, 0, "オトモダチでも\n作ってみますかー\nくすっ★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7040, 101, 1, 4, 0, 118201, 1, 0, "退屈ですねー\n騎士さん、構って\nくれないかなー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7041, 102, 1, 8, 0, 118201, 1, 0, "もっともっと早く\n騎士さんに逢えてたら\n…なんて、わたし\nらしくないですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7042, 1, 2, 1, 0, 118201, 1, 0, "わたし一人にするの\n不安だったりします？\nちゃーんとイイコに\nしてますってー★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7043, 2, 2, 1, 0, 118201, 1, 0, "お出かけします？\nそれともおうちで\nまったりしますー？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7044, 3, 2, 1, 0, 118201, 1, 0, "女の子をすぐ家に\nあげちゃうなんて…\nふふ、やっぱり隅に\n置けないですねー★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7045, 4, 2, 1, 0, 118201, 1, 0, "騎士さん騎士さーん★\nウザ絡みしても\nいいですかー？\n騎士さんってばー★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7046, 101, 2, 4, 0, 118201, 1, 0, "一緒にゴロゴロ\nしませんかー？\nコイビトっぽくて\n楽しそうですし♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7047, 102, 2, 8, 0, 118201, 1, 0, "うふふ★\nこーやってあなたに\n優しくされると…\nときめいちゃいます♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7048, 1, 2, 1, 0, 118201, 1, 1, "おはようございます★\nあれれー？\nまだおねむですかー？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7049, 2, 2, 1, 0, 118201, 1, 2, "騎士さん、お昼は\nもう食べましたー？\nわたし、ラーメンが\n食べたいでーす★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7050, 3, 2, 1, 0, 118201, 1, 3, "あ、夜更かししてちゃ\nダメですよー？\nほらほら、お布団に\nごーごー★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7052, 2, 3, 1, 0, 118201, 1, 0, "ふかふかのふわふわー\nついついまーったり\nしちゃいます★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7053, 3, 3, 1, 0, 118201, 1, 0, "かっわいー★\n名前はー、んー…\nぱんぱかぷんで★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7054, 4, 3, 1, 0, 118201, 1, 0, "くんくん★\nうーん…\nたぶん素敵な香り♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7055, 5, 3, 1, 0, 118201, 1, 0, "あったかーい★\n心も体も\nぽっかぽかですねー★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7057, 7, 3, 1, 0, 118201, 1, 0, "もぐもぐ★\nんー、おいしくって\n止まらないですねー★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7058, 8, 3, 1, 0, 118201, 1, 0, "へー★\nほほー★\nふんふーん★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7060, 1, 1, 1, 0, 125101, 1, 0, "さ～て時間もあるし\nラテアートの練習でも\nするかにゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7061, 2, 1, 1, 0, 125101, 1, 0, "カフェの猫たちも\n元気に働いてくれて\nお客さんからの評判も\n上々にゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7062, 3, 1, 1, 0, 125101, 1, 0, "カフェのカウンターに\nファントムキャッツの\n目安箱を置こうかにゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7063, 4, 1, 1, 0, 125101, 1, 0, "あんこもコーヒーも\n原料は豆にゃ～\nそりゃ相性いいに\n決まってるにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7064, 5, 1, 1, 0, 125101, 1, 0, "あいつの為に\nタマキ特製ブレンドを\n開発したいにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7065, 101, 1, 4, 0, 125101, 1, 0, "あいつと働いてると\nなぜかあっという間に\n閉店時間が\n来ちゃうのにゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7066, 102, 1, 8, 0, 125101, 1, 0, "あいつといると\n新しいアイデアが\n溢れるほど\n出てきちゃうのにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7067, 1, 2, 1, 0, 125101, 1, 0, "キミがコーヒーを\n淹れてくれたのにゃ？\nにゃはは、常温で\n猫舌にも優しいにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7068, 2, 2, 1, 0, 125101, 1, 0, "料理が上手くなったら\nカフェご飯メニューも\n充実させたいにゃ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7069, 3, 2, 1, 0, 125101, 1, 0, "お店の経営は大変\nだけど、キミとなら\n乗り越えられるって\n確信してるにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7070, 4, 2, 1, 0, 125101, 1, 0, "ん？　この制服\n似合ってるにゃ？\nにゃはは！　褒めても\n１ルピも出ないにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7071, 101, 2, 4, 0, 125101, 1, 0, "あたしが好きなのは\n猫に好かれる人にゃ♪\n…ん、キミ猫に懐かれ\nまくってるにゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7072, 102, 2, 8, 0, 125101, 1, 0, "キミの制服姿\nけっこーイケてるにゃ\nあたしがお客さんなら\n通いつめちゃうにゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7073, 1, 2, 1, 0, 125101, 1, 1, "朝は一杯の\nコーヒーから始まる…\nにゃふふん♪\nシャレた朝だにゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7074, 2, 2, 1, 0, 125101, 1, 2, "お昼はたい焼きと\nコーヒーのセットで\nまったり休憩\nしようにゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7075, 3, 2, 1, 0, 125101, 1, 3, "コーヒー淹れたにゃ\n星空を見ながら\n二人で飲もうにゃ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7077, 2, 3, 1, 0, 125101, 1, 0, "ふにゃ～ん…ゴロゴロ\nコーヒーと同じくらい\n癒されるにゃ～…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7078, 3, 3, 1, 0, 125101, 1, 0, "こいつかわいいにゃ～\nうちの猫たちとも\nいい勝負なのにゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7079, 4, 3, 1, 0, 125101, 1, 0, "ん～いい香りだにゃ～\nコーヒーもそうだけど\n香りの癒し効果は\n抜群にゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7080, 5, 3, 1, 0, 125101, 1, 0, "猫に暖かいものは\nまるまれと言ってる\nようなもんにゃ…♪\nまるまる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7082, 7, 3, 1, 0, 125101, 1, 0, "にゃは～うまいにゃ♪\nカフェの新メニューに\n採用しちゃおう\nかにゃ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7083, 8, 3, 1, 0, 125101, 1, 0, "にゃるほど…\n調べれば調べるほど\nコーヒーは\n奥が深いのにゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7085, 103, 1, 12, 0, 107101, 1, 0, "ワタシの手料理は\n坊やの口に合うらしい\n胃袋は討ち取ったぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7086, 103, 2, 12, 0, 107101, 1, 0, "胸に再度触れると\n誓約は無効になるのか\n…だと？　鋭い質問だ\n安心しろ。ならん☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7087, 1, 1, 1, 0, 125201, 1, 0, "ようやくこの服にも\n慣れてきたかな？\nふふっ、たまには\nこういう服も悪くない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7088, 2, 1, 1, 0, 125201, 1, 0, "今日も店は好調だが、\n私は軍人だからな\n当初の目的も\n忘れないようにしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7089, 3, 1, 1, 0, 125201, 1, 0, "猫が近くに来ると\nついつい見てしまうな\n仕事が終わったら\n遊んでやるかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7090, 4, 1, 1, 0, 125201, 1, 0, "コーヒーの淹れ方が\nうまくなってきたな♪\nどうせならお菓子も\n研究してみるか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7091, 5, 1, 1, 0, 125201, 1, 0, "利益を考えると\n価格をあげるべきか？\n…いや、利益よりも\n皆の笑顔の方が大事だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7092, 101, 1, 4, 0, 125201, 1, 0, "またあいつを\n呼んでしまったな…\n今度、コーヒーでも\n淹れて労ってやるか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7093, 102, 1, 8, 0, 125201, 1, 0, "次に入荷するお菓子は\nあいつの意見を聞くか\nどんな味が好きか\n気になるしな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7094, 1, 2, 1, 0, 125201, 1, 0, "なに、コーヒーを\n淹れてほしい？\nふふっ♪\n仕方のない奴だな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7095, 2, 2, 1, 0, 125201, 1, 0, "…そうだ。\nコーヒーと乾パンは\n合うのではないか？\n今度試してみよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7096, 3, 2, 1, 0, 125201, 1, 0, "コーヒーもいいが、\nココアも悪くないぞ♪\n貴公も一緒にどうだ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7097, 4, 2, 1, 0, 125201, 1, 0, "魔法少女に比べれば\n大人しい服だろう？\nだが、カフェには\nこの服でバッチリだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7098, 101, 2, 4, 0, 125201, 1, 0, "貴公はコーヒーを\n飲めるのかっ？それは\nうらやましいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7099, 102, 2, 8, 0, 125201, 1, 0, "貴公の働きぶりには\n目を見張るものがある\nその姿は、その…\n結構かっこいいぞっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7100, 1, 2, 1, 0, 125201, 1, 1, "さぁ、今日も一日、\n頑張るぞっ！\n気合いを入れて\n開店準備だっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7101, 2, 2, 1, 0, 125201, 1, 2, "昼は稼ぎ時だからな！\n荒波を乗り切るため\n貴公も一緒に\n頑張ってくれるか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7102, 3, 2, 1, 0, 125201, 1, 3, "ふあぁ…もう夜か\n今日は頑張ったからな\nはやめに休むとしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7104, 2, 3, 1, 0, 125201, 1, 0, "はふぅ～…\nたまにはこうして\nゆったりするのも\n悪くないな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7105, 3, 3, 1, 0, 125201, 1, 0, "猫もかわいいが、\nこいつもなかなか…\n見ていると、\n撫でたくなるな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7106, 4, 3, 1, 0, 125201, 1, 0, "これは良い香りだな\nふむ、コーヒーも\nより香り高いものが\n作れるよう試すか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7107, 5, 3, 1, 0, 125201, 1, 0, "ふぅ～…\n体を温めなければ、\nすぐに動けないからな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7109, 7, 3, 1, 0, 125201, 1, 0, "これもうまいが、\n私はお菓子も…\nいや、食べすぎは\n体に良くないな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7110, 8, 3, 1, 0, 125201, 1, 0, "…書物は参考になるな\n次はこのやり方を\n試してみるかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7112, 1, 1, 1, 0, 120001, 1, 0, "愛と希望の魔法少女！\n弟くんの平和は\nお姉ちゃんが守るよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7113, 2, 1, 1, 0, 120001, 1, 0, "魔法少女の戦い方を\n見せてあげる！\nお姉ちゃんチョップ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7114, 3, 1, 1, 0, 120001, 1, 0, "闇の力が高まってる…\n早く弟くんを\nギュ～ってしないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7115, 4, 1, 1, 0, 120001, 1, 0, "ミニ弟くんを\n部屋中に呼び出して\n弟くんハウスに～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7116, 5, 1, 1, 0, 120001, 1, 0, "決めポーズの練習でも\nしよっかな…\nはい、ポーズ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7117, 101, 1, 4, 0, 120001, 1, 0, "魔法少女の力で\n弟くんのそばに\n瞬間移動したいなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7118, 102, 1, 8, 0, 120001, 1, 0, "禁じられた必殺技\nその名も──\n闇のお姉ちゃん頭突き");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7119, 1, 2, 1, 0, 120001, 1, 0, "魔法少女な\nお姉ちゃんに\n興味津々だねっ？\n全部教えてあげるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7120, 2, 2, 1, 0, 120001, 1, 0, "闇のお姉ちゃんとして\n世界を弟くんのものに\n…な～んて冗談冗談♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7121, 3, 2, 1, 0, 120001, 1, 0, "弟くんって魔法少女に\nなりたがってたよね？\n…うん。応援するね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7122, 4, 2, 1, 0, 120001, 1, 0, "サインが欲しいの？\nふふっ、任せて！\n愛する弟くんへ、と♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7123, 101, 2, 4, 0, 120001, 1, 0, "ふんふふ～ん♪\n魔法少女お姉ちゃんの\nテーマソング完成っ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7124, 102, 2, 8, 0, 120001, 1, 0, "えへへ、弟くんからの\n愛と希望を感じるよ…\n更に変身しちゃうぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7125, 1, 2, 1, 0, 120001, 1, 1, "弟くんの朝を魔法で\n守りに来たよ！\n希望の朝だねっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7126, 2, 2, 1, 0, 120001, 1, 2, "弟くんのお昼を魔法で\n守りに来たよ！\n愛のお弁当をどうぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7127, 3, 2, 1, 0, 120001, 1, 3, "弟くんの夜を魔法で\n守りに来たよ！\nここからは闇の時間♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7129, 2, 3, 1, 0, 120001, 1, 0, "魔法少女の一休み♪\n愛と希望と…闇の力が\n回復していくね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7130, 3, 3, 1, 0, 120001, 1, 0, "かわいいかわいい♪\nお姉ちゃんの魔法で\n増やしちゃうぞ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7131, 4, 3, 1, 0, 120001, 1, 0, "この香り…\n弟くんと同じ…\nくんくん、くんくん…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7132, 5, 3, 1, 0, 120001, 1, 0, "体を温めておいて…\nこの熱を、ぜ～んぶ\n弟くんに伝えるよ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7134, 7, 3, 1, 0, 120001, 1, 0, "ミニ弟くんを呼ぶには\nいっぱい食べないと…\n魔法ってお腹減るから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7135, 8, 3, 1, 0, 120001, 1, 0, "弟くんの平和を守る…\nそのためには\nチェックチェック…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7137, 1, 1, 1, 0, 125301, 1, 0, "この服も、最初は\n慣れなかったのですが\n今ではすっかり\n体に馴染んでおります");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7138, 2, 1, 1, 0, 125301, 1, 0, "自然を守るためにも\nお勉強は欠かせません\n日々精進でございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7139, 3, 1, 1, 0, 125301, 1, 0, "採取した薬草を\n調合しておきましょう\nいつ必要になるか\n分かりませんからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7140, 4, 1, 1, 0, 125301, 1, 0, "合宿は過酷でしたが\nおかげでちょっと\n力持ちになったような\n気がいたします…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7141, 5, 1, 1, 0, 125301, 1, 0, "わんわんのほうの\n主さまに、ごはんを\nあげる時間ですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7142, 101, 1, 4, 0, 125301, 1, 0, "もっともっと訓練や\nお勉強を重ねて\n主さまのお役に\n立たなくては…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7143, 102, 1, 8, 0, 125301, 1, 0, "おや、そろそろ\nわんわんのほうの\n主さまをお散歩に\n連れていく時間です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7144, 1, 2, 1, 0, 125301, 1, 0, "主さま、よろしければ\nお散歩に行きませんか\n今日の森は穏やかで\n過ごしやすいかと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7145, 2, 2, 1, 0, 125301, 1, 0, "わんわんのほうの\n主さまも、今では\n【美食殿】の大切な\n仲間でございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7146, 3, 2, 1, 0, 125301, 1, 0, "森には危険が\nいっぱいでございます\nケガをなさらないよう\nお気をつけください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7147, 4, 2, 1, 0, 125301, 1, 0, "もし森や動物のことで\n気になることがあれば\n気軽にお尋ねください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7148, 101, 2, 4, 0, 125301, 1, 0, "森へ行く前には\n必ず装備の点検を\nお願いいたします\n約束ですよ、主さま？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7149, 102, 2, 8, 0, 125301, 1, 0, "森の中で主さまたちと\nゆったり過ごす時間は\nわたくしにとって\n大切なひとときです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7150, 1, 2, 1, 0, 125301, 1, 1, "おはようございます\n朝ごはんをしっかり\n食べて、お勤めに\n備えましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7151, 2, 2, 1, 0, 125301, 1, 2, "わんわんのほうの\n主さまにおやつを\nあげる時間です\nどうぞ、召し上がれ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7152, 3, 2, 1, 0, 125301, 1, 3, "どれだけ野営に\n慣れたとしても\nベッドで眠れるなら\nそうしたいところです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7154, 2, 3, 1, 0, 125301, 1, 0, "こちらなのですが\nわんわんのほうの\n主さまもお気に入りの\nようです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7155, 3, 3, 1, 0, 125301, 1, 0, "わんわんのほうの\n主さまにも、こうした\n玩具を与えるべき\nでしょうか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7156, 4, 3, 1, 0, 125301, 1, 0, "心地よい香りです\n次は、自然由来の\n香料も試しましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7157, 5, 3, 1, 0, 125301, 1, 0, "暖をとるのは\n野営の時などに\nとても大事なことで\nございますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7159, 7, 3, 1, 0, 125301, 1, 0, "食べられる時に食べて\nおくのも、大自然では\n重要でございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7160, 8, 3, 1, 0, 125301, 1, 0, "より知識を蓄え\n自然の力を活用できる\nようにいたしましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7162, 103, 1, 12, 0, 100901, 1, 0, "今回の「冥風戦記」も\nなかなかよく書けたぞ\nふふっ、シグルドも\n喜んでくれるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7163, 103, 2, 12, 0, 100901, 1, 0, "貴様のためならば\n我が真なる魔力\nいつでも\n解き放とうぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7164, 1, 1, 1, 0, 125401, 1, 0, "ニャットちゃんに\nブラッシングを\nしてあげようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7165, 2, 1, 1, 0, 125401, 1, 0, "ふふ…\nこれがレンジャーの\n制服ですか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7166, 3, 1, 1, 0, 125401, 1, 0, "そろそろ\nパトロールの\n時間だ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7167, 4, 1, 1, 0, 125401, 1, 0, "魔物について\nもっと知りたいな\n本を探しに行こう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7168, 5, 1, 1, 0, 125401, 1, 0, "レンジャーになって\n体調を崩す日が\n減った気がします…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7169, 101, 1, 4, 0, 125401, 1, 0, "本だけじゃわからない\n世界のことを、\nもっと知りたいです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7170, 102, 1, 8, 0, 125401, 1, 0, "こんな私にも\nできることはある…\nそう信じています");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7171, 1, 2, 1, 0, 125401, 1, 0, "あの…良かったら\n一緒に見回りへ\n行きませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7172, 2, 2, 1, 0, 125401, 1, 0, "またあなたと一緒に\nレンジャーの仕事が\nできたらうれしいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7173, 3, 2, 1, 0, 125401, 1, 0, "けほっこほっ\n…だ、大丈夫です\nたまに出るだけなので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7174, 4, 2, 1, 0, 125401, 1, 0, "ニャットちゃん\nあなたにも\n懐いてきましたね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7175, 101, 2, 4, 0, 125401, 1, 0, "ニャットちゃんと\n散歩に出かけようかな\n…あの人も誘って");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7176, 102, 2, 8, 0, 125401, 1, 0, "あなたと肩を並べて\nレンジャーの仕事が\nできてうれしいです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7177, 1, 2, 1, 0, 125401, 1, 1, "おはようございます\nレンジャー・シオリ\n元気に出勤します");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7178, 2, 2, 1, 0, 125401, 1, 2, "ニャットちゃんにも\nお昼ごはんを\n用意しなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7179, 3, 2, 1, 0, 125401, 1, 3, "明日は仕事だから\n早起きしなくちゃ\nおやすみなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7181, 2, 3, 1, 0, 125401, 1, 0, "ふぅ…仕事で\n走り回ったので\n少し休憩します");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7182, 3, 3, 1, 0, 125401, 1, 0, "仕事が終わった後に\nこうして触れていると\n癒されますね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7183, 4, 3, 1, 0, 125401, 1, 0, "森の香りがします…\n今日はよく\n眠れそうです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7184, 5, 3, 1, 0, 125401, 1, 0, "ニャットちゃんと\n同じぐらい\n暖かいです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7186, 7, 3, 1, 0, 125401, 1, 0, "レンジャーの仕事を\nしていると\nお腹が空きます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7187, 8, 3, 1, 0, 125401, 1, 0, "どんなに忙しくても\n読書だけは\nやめられませんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7189, 1, 1, 1, 0, 125801, 1, 0, "兄様のお留守の間\nわたくしが、兄様の\n御家を守ります！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7190, 2, 1, 1, 0, 125801, 1, 0, "に、に、兄様の御家…\n招待いただいた以上は\n失礼のないよう\n振る舞わなくては…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7191, 3, 1, 1, 0, 125801, 1, 0, "ふふっ…兄様の素敵な\nお人柄が、家中から\nにじみ出ています…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7192, 4, 1, 1, 0, 125801, 1, 0, "靴を脱がずに\n御家に上がるのに\n慣れていなくて…あ！\n飛べばいいのでは…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7193, 5, 1, 1, 0, 125801, 1, 0, "ここに花を生けたら\n華やぎそうですね\n兄様はお花…\n好きでしょうか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7194, 101, 1, 4, 0, 125801, 1, 0, "ずっとここにいたい…\nなどと言ったら\n兄様を困らせて\nしまいますよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7195, 102, 1, 8, 0, 125801, 1, 0, "お料理などを作って\n兄様を出迎えられたら\nいいのに…料理の腕も\n磨かなくては…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7196, 1, 2, 1, 0, 125801, 1, 0, "このような姿で\n失礼しております…！\nネ、ネズミがいたので\nつい本気を…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7197, 2, 2, 1, 0, 125801, 1, 0, "おかえりなさいませ\nお忙しい御身をどうぞ\n癒してくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7198, 3, 2, 1, 0, 125801, 1, 0, "兄様の話し相手…！？\nど、どうしましょう…\nわたくしには面白い\n話なんて…はうぅ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7199, 4, 2, 1, 0, 125801, 1, 0, "なぜか、動物などに\n好かれる体質で…\n迷い猫捜しのバイトの\nお役に立てますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7200, 101, 2, 4, 0, 125801, 1, 0, "に、兄様の家に来たら\n『添い寝』をするのが\n礼儀とリアさんが…\n本当…でしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7201, 102, 2, 8, 0, 125801, 1, 0, "わたくしはここに\nいて…よいのですね？\n『仲間』として…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7202, 1, 2, 1, 0, 125801, 1, 1, "朝は得意なんです\nもし兄様が苦手なら\nわたくしが起こして\n差し上げますよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7203, 2, 2, 1, 0, 125801, 1, 2, "兄様…昼餉を作って\nみたのですが、失敗\nしてしまいました…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7204, 3, 2, 1, 0, 125801, 1, 3, "ふあぁ…\nはっ！　お…\nお恥ずかしい所を…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7206, 2, 3, 1, 0, 125801, 1, 0, "こ、これは…！\n人様の御家なのに\nつい…駄目になって…\nしまいますぅ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7207, 3, 3, 1, 0, 125801, 1, 0, "と、飛びかかっては\nこない…ですよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7208, 4, 3, 1, 0, 125801, 1, 0, "すぅ…はぁ…\nこのかぐわしさ\n心が洗われます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7209, 5, 3, 1, 0, 125801, 1, 0, "なんて暖かい…\n兄様の優しくお広い\n御心のようです…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7211, 7, 3, 1, 0, 125801, 1, 0, "こんなに食べていたら\nはしたない…\nでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7212, 8, 3, 1, 0, 125801, 1, 0, "兄様の本棚はまるで\n知識の宝庫ですね\n己の世間知らずぶりを\n実感してしまいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7214, 1, 1, 1, 0, 125501, 1, 0, "次の冒険に向けて\n騎空士弁当を作ろっと\nまずはおにぎりから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7215, 2, 1, 1, 0, 125501, 1, 0, "魔法の修行しなくちゃ\nもっともっと頼れる\n団長になりたいから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7216, 3, 1, 1, 0, 125501, 1, 0, "ビカラちゃんを\n遊びに誘いたいけど…\nどういう場所が\n好きなんだろう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7217, 4, 1, 1, 0, 125501, 1, 0, "仕事を真面目に\nしっかりこなすことが\n騎空艇への\n一番の近道だよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7218, 5, 1, 1, 0, 125501, 1, 0, "ここにいる人の中で\n騎空団に興味ある人\nいたりしないかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7219, 101, 1, 4, 0, 125501, 1, 0, "これまでも想い出は\nいっぱいできたけど…\nこれからもたくさん\n想い出を作りたいな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7220, 102, 1, 8, 0, 125501, 1, 0, "仲間がいるから\n騎空士は限界だって\n超えられるんだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7221, 1, 2, 1, 0, 125501, 1, 0, "この衣装\n魔法使いらしいでしょ\n服に着られないよう\n頑張らなくちゃね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7222, 2, 2, 1, 0, 125501, 1, 0, "あなたとなら\nどんな相手だって\n怖くなんてないよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7223, 3, 2, 1, 0, 125501, 1, 0, "カリンさんから\n新しい依頼が来たよ！\n一緒に頑張ろ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7224, 4, 2, 1, 0, 125501, 1, 0, "操舵士になるのは\nずいぶん難しそう…\nいつか頼れる仲間が\n見つかるといいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7225, 101, 2, 4, 0, 125501, 1, 0, "手合わせしたいの？\nいいよ、たまには\n団長らしいところ\n見せてあげるね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7226, 102, 2, 8, 0, 125501, 1, 0, "まだ二人きりだけど…\nこの騎空団は\n私の宝物だよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7227, 1, 2, 1, 0, 125501, 1, 1, "おはよう～…\n昨日は遅くまで\n魔法の研究してて…\nふわぁ…眠いなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7228, 2, 2, 1, 0, 125501, 1, 2, "さてと、お昼休み！\n紅茶淹れてくるから\n一緒に飲もうよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7229, 3, 2, 1, 0, 125501, 1, 3, "遅くまでお疲れさま！\n無理しない程度に\nお互い頑張ろう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7231, 2, 3, 1, 0, 125501, 1, 0, "魔法の研究は\n一旦、休憩！\n頭を休めなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7232, 3, 3, 1, 0, 125501, 1, 0, "魔法みたいに\nかわいい！\n騎空団に入る？\nなんてね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7233, 4, 3, 1, 0, 125501, 1, 0, "いい匂い…\nそれになんだか\n集中力が増したかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7234, 5, 3, 1, 0, 125501, 1, 0, "体だけじゃなくて\n心までポカポカする…\nなんだか魔法みたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7236, 7, 3, 1, 0, 125501, 1, 0, "いろいろ考え事したら\nお腹が空いちゃった！\nいただきまーす！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7237, 8, 3, 1, 0, 125501, 1, 0, "『摂理の彼方へ\n至るには…』\n…この魔導書\n勉強になるなあ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7239, 1, 1, 1, 0, 125701, 1, 0, "こちらの服を着ると\n冒険に出かけたく\nなっちゃいますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7240, 2, 1, 1, 0, 125701, 1, 0, "冒険者の心得その一\n準備はできる限り\nしっかりとこなすべし\nなんてどうでしょう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7241, 3, 1, 1, 0, 125701, 1, 0, "調合に必要な素材は\nあれとこれとそれと…\n時間があるとついつい\n考えちゃいますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7242, 4, 1, 1, 0, 125701, 1, 0, "せっかくですから\nより良い素材を\n自分で集めたいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7243, 5, 1, 1, 0, 125701, 1, 0, "このポーションが\nみなさんの役に立つと\nうれしいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7244, 101, 1, 4, 0, 125701, 1, 0, "冒険者の心得その二\n危なくなった時は\nまず逃げるべし！\n大事なことですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7245, 102, 1, 8, 0, 125701, 1, 0, "あの人の冒険は\nいつも楽しそうで\n元気がもらえます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7246, 1, 2, 1, 0, 125701, 1, 0, "ぜひおすすめしたい\n依頼があるんです\nこちらをどうぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7247, 2, 2, 1, 0, 125701, 1, 0, "ほしいお薬があれば\n錬金術で作って\nさしあげますよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7248, 3, 2, 1, 0, 125701, 1, 0, "依頼で気になる\nところがあれば\n何でもご確認ください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7249, 4, 2, 1, 0, 125701, 1, 0, "このギルドハウスに\n錬金術の実験設備を…\nえ？　だめですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7250, 101, 2, 4, 0, 125701, 1, 0, "ポーションをどうぞ\n大丈夫、効果は\n確認済みですので♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7251, 102, 2, 8, 0, 125701, 1, 0, "次はどんな冒険に\n行かれるんですか？\nいつでもお供しますよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7252, 1, 2, 1, 0, 125701, 1, 1, "今日もいい一日に\nなりそうですね\n冒険日和といった\nところでしょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7253, 2, 2, 1, 0, 125701, 1, 2, "いい時間ですし\nランチにしませんか？\n次の冒険の\n作戦会議も兼ねて♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7254, 3, 2, 1, 0, 125701, 1, 3, "夜も遅いですし\n明日の冒険のため\n今日は早く寝ましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7256, 2, 3, 1, 0, 125701, 1, 0, "ふう…やはり冒険は\n事務仕事と違いますね\n少し休憩を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7257, 3, 3, 1, 0, 125701, 1, 0, "冒険は緊張の連続です\nかわいい物で\n心を癒しましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7258, 4, 3, 1, 0, 125701, 1, 0, "ふむ、この香りは…\n素晴らしいバランスで\n調合されていますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7259, 5, 3, 1, 0, 125701, 1, 0, "この火力…\n錬金術の調合に\n使えそうですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7261, 7, 3, 1, 0, 125701, 1, 0, "冒険の際は食べられる\n時に食べておく！\n…とペコリーヌさんも\nおっしゃってましたね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7262, 8, 3, 1, 0, 125701, 1, 0, "ふむふむ…なるほど\nこんな調合も\nあるのですね…\n奥が深いです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7264, 103, 1, 12, 0, 106101, 1, 0, "アイツどこ行った…？\n戦うならアタシも\n連れてけよなー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7265, 103, 2, 12, 0, 106101, 1, 0, "今日も悪いヤツ退治…\nの前に腹ごしらえだ！\nなんか食べに行くぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7266, 1, 1, 1, 0, 125601, 1, 0, "みんなー！\nギルドハウスで\nぼくと握手！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7267, 2, 1, 1, 0, 125601, 1, 0, "種族も年齢も違うけど\nみんな楽しそうだね！\nやっぱりここはぼくの\nゆ～とぴあさ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7268, 3, 1, 1, 0, 125601, 1, 0, "ハハッ！　まるで\nパーティー会場だね！\nこれは楽しませがいが\nあるってものだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7269, 4, 1, 1, 0, 125601, 1, 0, "やぁみんな！\nご利益満点のネズ耳は\nいかがかな？\nひとつ３ルピだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7270, 5, 1, 1, 0, 125601, 1, 0, "ここにいれば\n遊び相手に困らないね\nかしこみかしこみ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7271, 101, 1, 4, 0, 125601, 1, 0, "どこか遊びに\n行こうかな♪\nそうだ、あの人にも\n声をかけてみよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7272, 102, 1, 8, 0, 125601, 1, 0, "あの人といると\nぼくまで楽しくなって\nくるんだよね！\n毎日パレード気分さ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7273, 1, 2, 1, 0, 125601, 1, 0, "ネズ耳の在庫が\n切れたんだ！\n作るのを\n手伝ってくれるかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7274, 2, 2, 1, 0, 125601, 1, 0, "ん？　握手かい？\nいいとも！\nいつでも何度でも\nしてあげるよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7275, 3, 2, 1, 0, 125601, 1, 0, "この衣装に興味が\nあるのかい？\nきみ、なかなか\n見る目があるね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7276, 4, 2, 1, 0, 125601, 1, 0, "しばらくここに厄介に\nなるつもりなんだ\nあとで街を案内\nしてくれるかい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7277, 101, 2, 4, 0, 125601, 1, 0, "とっておきのチーズ\nきみと半分こだ！\nみんなには内緒だよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7278, 102, 2, 8, 0, 125601, 1, 0, "きみはいてほしい時に\nいつもそばに\nいてくれるね\n本当にかしこみだよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7279, 1, 2, 1, 0, 125601, 1, 1, "やぁ、おはよう！\n気持ちのいい朝だね\n今日も楽しくネズ耳\n売りにはげもうか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7280, 2, 2, 1, 0, 125601, 1, 2, "お昼だね！\nおいしいチーズを\n持ってきたから\nぼくと半分こだ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7281, 3, 2, 1, 0, 125601, 1, 3, "今日も一日\n楽しかったね！\nいい夢が見られること\n間違いなしさ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7283, 2, 3, 1, 0, 125601, 1, 0, "ぼくにも休息は\n必要さ！\nリラックス〜\nリラックス〜♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7284, 3, 3, 1, 0, 125601, 1, 0, "ぼくのぬいぐるみも\n作って売ろうかな…\n修繕費も一気に\n集まるかもね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7285, 4, 3, 1, 0, 125601, 1, 0, "いい香りだね！\nトーゴクのお香に\nよく似てるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7286, 5, 3, 1, 0, 125601, 1, 0, "はぁ…温まるねぇ…\nそうだ、この火で\nチーズでも炙って\nみようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7288, 7, 3, 1, 0, 125601, 1, 0, "うーん、この味…\nトーゴクを思い出すよ\nどれ、もう一つ\nいただこうか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7289, 8, 3, 1, 0, 125601, 1, 0, "これはランドソルの\nガイド本だね！\nありがたく参考に\nさせてもらうよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7291, 1, 1, 1, 0, 126201, 1, 0, "まさか、わらわが\nこのような装束を\n纏う日がくるとはな…\n感慨深いものじゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7292, 2, 1, 1, 0, 126201, 1, 0, "わらわの美貌で\nこのギルドハウスも\nより華やかに\nなったようじゃな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7293, 3, 1, 1, 0, 126201, 1, 0, "つまらぬ戦いで\n晴れ着を汚しとうない\n今日は一日\nゆっくりするかの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7294, 4, 1, 1, 0, 126201, 1, 0, "今日はわらわが食事の\n準備をして、あやつの\n帰りを待ってやろう\n献立は何がよいかの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7295, 5, 1, 1, 0, 126201, 1, 0, "ユキといったか…\n掴みどころのない\nやつじゃが、根性は\n認めてやるかの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7296, 101, 1, 4, 0, 126201, 1, 0, "こうして、仲間と\nのんびり過ごす時間も\n悪くないのう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7297, 102, 1, 8, 0, 126201, 1, 0, "あやつを誘って\n月を見に行こうかの\n夜が楽しみじゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7298, 1, 2, 1, 0, 126201, 1, 0, "いかなる衣装で\nあろうとも、わらわは\n完璧に着こなして\nしまうのじゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7299, 2, 2, 1, 0, 126201, 1, 0, "なんじゃ？\nわらわの姿に\n見惚れておったとな？\nす、素直でよいのじゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7300, 3, 2, 1, 0, 126201, 1, 0, "吸血鬼であるわらわに\n相応しい装束じゃろう\nあとは真っ赤な血を\n添えたいのう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7301, 4, 2, 1, 0, 126201, 1, 0, "お主、疲れておるな？\nわらわが癒してやろう\nほれ、近う寄るのじゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7302, 101, 2, 4, 0, 126201, 1, 0, "お主がおるだけで\nギルドハウスが\n賑やかになるのう\nある種の才能じゃな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7303, 102, 2, 8, 0, 126201, 1, 0, "眷属よ、風呂にするか\nご飯にするか\nそれとも、わらわに…\nいや、忘れるのじゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7304, 1, 2, 1, 0, 126201, 1, 1, "朝一番、わらわに\n会いたかったとな…\n眷属よ\n褒めてつかわすぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7305, 2, 2, 1, 0, 126201, 1, 2, "眷属よ、わらわが\n食事を用意したぞ\n忌々しい太陽に負けず\n頑張るのじゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7306, 3, 2, 1, 0, 126201, 1, 3, "眠るには惜しい夜じゃ\n眷属よ、もうしばらく\nわらわの傍に\nおるがよい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7308, 2, 3, 1, 0, 126201, 1, 0, "ふかふかじゃの♪\n今度あやつにも\n座らせてやろう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7309, 3, 3, 1, 0, 126201, 1, 0, "愛いやつじゃ\n少しばかり、わらわが\n遊んでやろうかの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7310, 4, 3, 1, 0, 126201, 1, 0, "気品ある香りじゃのう\nわらわの古城にも\n一つ欲しいところじゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7311, 5, 3, 1, 0, 126201, 1, 0, "よいぬくもりじゃ…\n忌々しい太陽とは\n大違いじゃの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7313, 7, 3, 1, 0, 126201, 1, 0, "味付けの参考に\nあと、もう一つだけ…\n止まらんのじゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7314, 8, 3, 1, 0, 126201, 1, 0, "吸血鬼の弱点について\n記されておるのか…\nふむ、眠気が\nさめてしもうたぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7316, 103, 1, 12, 0, 100801, 1, 0, "このままボクが美しく\nなり続けても、彼なら\nきっと隣にいてくれる\nはずだよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7317, 103, 2, 12, 0, 100801, 1, 0, "もっとそばに来なよ\nボクの隣は\nキミのための\n特等席なんだから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7318, 1, 1, 1, 0, 126301, 1, 0, "ドレスの影響かな…\n前より黒や赤が\n好きになったかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7319, 2, 1, 1, 0, 126301, 1, 0, "ボクがいるだけで\nここがぐんっと\n華やかになったね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7320, 3, 1, 1, 0, 126301, 1, 0, "ボクを描いた絵画\n今度持ってきて\n飾ってあげようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7321, 4, 1, 1, 0, 126301, 1, 0, "ボクはボクに\n魅了されっぱなしさ♪\nまさに魔性の存在だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7322, 5, 1, 1, 0, 126301, 1, 0, "美のアドバイスを\n聞きたい人いるかい？\nボクがもっともっと\n輝かせてあげるよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7323, 101, 1, 4, 0, 126301, 1, 0, "あの人、今度はボクを\nどう褒めるだろう？\nもし語彙が尽きても\n許してあげよっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7324, 102, 1, 8, 0, 126301, 1, 0, "あの人に似合うコーデ\n考えてあげよっと\n案外、なんでも\n着こなしそうだよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7325, 1, 2, 1, 0, 126301, 1, 0, "吸血鬼になるなんて\nやっぱりゴメンだね！\n永遠の美よりも\n大事なことがあるのさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7326, 2, 2, 1, 0, 126301, 1, 0, "お肌にいいものは\n大体好きだよ\nトマトジュースとかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7327, 3, 2, 1, 0, 126301, 1, 0, "銀のアクセサリーが\nボクは大好きでね\nいつでもプレゼント\n待ってるよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7328, 4, 2, 1, 0, 126301, 1, 0, "イリヤみたいにお城に\n住んでみたいんだ♪\n美を統べる者に\n相応しいでしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7329, 101, 2, 4, 0, 126301, 1, 0, "今のボクがカップを\n触ると壊しちゃうんだ\nだからほら、キミが\nボクに紅茶を飲ませて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7330, 102, 2, 8, 0, 126301, 1, 0, "キミも美を磨けば\nもっと輝けるはずさ！\nボクがメイクとか\nしてあげようか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7331, 1, 2, 1, 0, 126301, 1, 1, "んん、まだ眠い…\n美のためにも、\nもうひと眠りするよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7332, 2, 2, 1, 0, 126301, 1, 2, "ボクにぴったりな\n日傘を買ったんだ♪\n散歩にでも行こうよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7333, 3, 2, 1, 0, 126301, 1, 3, "夜こそボクの時間！\nさぁ、あまねく人々へ\nボクの美を広めよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7335, 2, 3, 1, 0, 126301, 1, 0, "リラックスは大事だよ\n心の余裕こそが\n美の秘訣だからね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7336, 3, 3, 1, 0, 126301, 1, 0, "キミもボクの\n美の虜にしてあげる♪\nうれしいでしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7337, 4, 3, 1, 0, 126301, 1, 0, "人々を魅了するほどの\n魔性の香り…\nボクにふさわしいね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7338, 5, 3, 1, 0, 126301, 1, 0, "冷えは美の大敵さ\nボクのように\n美しくなりたいなら\n体を温めるべきだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7340, 7, 3, 1, 0, 126301, 1, 0, "食事をするボクの\nなまめかしさ…♪\n吸血鬼すらも\nドキッとするだろうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7341, 8, 3, 1, 0, 126301, 1, 0, "吸血鬼って\n美しい存在だよね…\nボクほどではないけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7343, 1, 1, 1, 0, 126401, 1, 0, "ここがナイトさんの\nお家なんですねーっ！\n雰囲気そっくりっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7344, 2, 1, 1, 0, 126401, 1, 0, "ドアも壁もお菓子じゃ\nないんですよねっ？\n不思議ですねーっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7345, 3, 1, 1, 0, 126401, 1, 0, "失礼のないように\n気をつけないとっ！\nライラエルさまとも\n約束してますからっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7346, 4, 1, 1, 0, 126401, 1, 0, "向こうに帰るころには\nお土産話がいっぱい\nできてるといいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7347, 5, 1, 1, 0, 126401, 1, 0, "戦闘用のアームの他に\n観光用のアームも\nあったらいいのにな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7348, 101, 1, 4, 0, 126401, 1, 0, "ナイトさんの充填と\nライラエルさまの充填\nどっちも違って\nどっちも大好きです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7349, 102, 1, 8, 0, 126401, 1, 0, "…ナイトさんが\nマスターになって\nくれたら…えへへっ\nなんでもないですっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7350, 1, 2, 1, 0, 126401, 1, 0, "お手伝いだったら\n任せてくださいっ！\nお家の移転とか\nしちゃいますかっ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7351, 2, 2, 1, 0, 126401, 1, 0, "こっちに来るときは\nポポおじいさんが\nしっかりメンテして\nくれるんですよっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7352, 3, 2, 1, 0, 126401, 1, 0, "お家の中にいるのも\nいいですけど、お外も\n気になります～っ！\nお出かけしましょう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7353, 4, 2, 1, 0, 126401, 1, 0, "ヴォルガーノさんに\nそっくりの子猫さんを\n見かけたんですっ！\nご親戚ですかねっ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7354, 101, 2, 4, 0, 126401, 1, 0, "ここだけの話ですよ？\n…実はケーブルって\n触られると、ちょっと\nくすぐったいんですっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7355, 102, 2, 8, 0, 126401, 1, 0, "このお家の持ち主は\nナイトさんですよね？\nそれじゃここでは\nご主人さまですねっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7356, 1, 2, 1, 0, 126401, 1, 1, "おはようございますっ\n今日もフルパワーで\nがんばりましょうっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7357, 2, 2, 1, 0, 126401, 1, 2, "お昼の時間ですねっ！\nランチの充填、\nお願いしまーすっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7358, 3, 2, 1, 0, 126401, 1, 3, "そろそろ眠らなくて\n大丈夫ですかっ？\n夜ふかしさんなら\nお付き合いしますよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7360, 2, 3, 1, 0, 126401, 1, 0, "エネルギーの消費を\n抑えるのも大切\nですよね～っ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7361, 3, 3, 1, 0, 126401, 1, 0, "わたしが触っても\n平気なんて…！\nかわいくて頑丈っ！\n好きですっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7362, 4, 3, 1, 0, 126401, 1, 0, "センサーによると…\nこの香りはいい香りに\n該当するみたいですっ\nなるほどーっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7363, 5, 3, 1, 0, 126401, 1, 0, "あったかいのって\nいいですよねっ！\nみなさんうれしそう\nですしっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7365, 7, 3, 1, 0, 126401, 1, 0, "これがこっちの世界の\nごはんなんですねっ\nおいしい気がします！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7366, 8, 3, 1, 0, 126401, 1, 0, "そーっとそーっと…\n本を破かないように…\n書いてある内容より\n難しいです～っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7368, 1, 1, 1, 0, 126701, 1, 0, "ウィスタリア家の\nプライベートビーチも\nご案内しますわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7369, 2, 1, 1, 0, 126701, 1, 0, "世界を巡る\nリゾートクルーズも\nご用意できますわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7370, 3, 1, 1, 0, 126701, 1, 0, "避暑地に専用の\n別荘がありますの\n今度ご招待しますわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7371, 4, 1, 1, 0, 126701, 1, 0, "日焼けは乙女の\n天敵ですわね\n備えはしっかりと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7372, 5, 1, 1, 0, 126701, 1, 0, "線香花火だけでは\n物足りませんわね\nもっとドカーンと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7373, 101, 1, 4, 0, 126701, 1, 0, "ギルド活動も全力で！\nバカンスも全力で！\nそれが私ですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7374, 102, 1, 8, 0, 126701, 1, 0, "私のセンスで選んだ\n特注の水着ですもの\n似合って当然ですわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7375, 1, 2, 1, 0, 126701, 1, 0, "ご希望ならすぐにでも\n夏の飛空艇遊覧ツアー\nへご招待しますわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7376, 2, 2, 1, 0, 126701, 1, 0, "夏の賑やかな\n雰囲気は好きですが…\n暑さには参りますわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7377, 3, 2, 1, 0, 126701, 1, 0, "日の光を浴びるほどに\n輝きを増す夏の私！\n今日も絶好調ですわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7378, 4, 2, 1, 0, 126701, 1, 0, "夏祭りに協力するなら\n資金と人材、どちらも\n用意しないとですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7379, 101, 2, 4, 0, 126701, 1, 0, "あなたさま…その…\nそうも見つめられると\n照れてしまいます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7380, 102, 2, 8, 0, 126701, 1, 0, "タマキさんの働く\n海の家も訪れて\nみたいですわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7381, 1, 2, 1, 0, 126701, 1, 1, "港の市場が\n賑わう頃ですわね！\n私たちも参りますわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7382, 2, 2, 1, 0, 126701, 1, 2, "冷たい飲み物でも\nご一緒にいかが？\nうちのシェフに用意\nさせてありますの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7383, 3, 2, 1, 0, 126701, 1, 3, "まだもう少し…\nこの夏の夜を\nあなたさまと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7385, 2, 3, 1, 0, 126701, 1, 0, "あなたさまも\n良ければこちらへ\nいらっしゃいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7386, 3, 3, 1, 0, 126701, 1, 0, "夏に合わせた装いに\n替えてみるのも\n楽しそうですわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7387, 4, 3, 1, 0, 126701, 1, 0, "この夏めいた爽やかな\n香り…期間限定で\n売り出したいですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7388, 5, 3, 1, 0, 126701, 1, 0, "く…我慢です…\nこの暑さに耐えてこそ\n美しさにも磨きが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7390, 7, 3, 1, 0, 126701, 1, 0, "暑い季節に働く\nみなさまへ差し入れも\n必要ですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7391, 8, 3, 1, 0, 126701, 1, 0, "夏のトレンドを\n押さえておくのも\n大事ですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7393, 10, 3, 1, 0, 126701, 1, 0, "上手くいけば\nヒット商品になる\nポテンシャルを\n感じますわね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7394, 11, 3, 1, 0, 126701, 1, 0, "この極上の肌触り…\n言い値で買いますわ\n一体おいくらですの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7395, 1, 1, 1, 0, 126601, 1, 0, "せっかくのバカンス…\n自由に羽を\n伸ばすとしましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7396, 2, 1, 1, 0, 126601, 1, 0, "たとえどのような\n秘密を持とうとも\n私には筒抜けですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7397, 3, 1, 1, 0, 126601, 1, 0, "子供だましの怪談に\n関心はありませんが…\n霊には興味があります\n観察対象として、ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7398, 4, 1, 1, 0, 126601, 1, 0, "彼の絵日記…\nあとでゆっくりと\n読ませてもらいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7399, 5, 1, 1, 0, 126601, 1, 0, "セミの鳴き声に入道雲\nそしてクリームソーダ\nこれでこそ夏ですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7400, 101, 1, 4, 0, 126601, 1, 0, "夏休みの宿題でも\n作るとしましょうか\n彼の限界を少し超えた\n負荷を与えるには…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7401, 102, 1, 8, 0, 126601, 1, 0, "彼と過ごす夏を\n特別なものにしたい…\nそれが私の望みです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7402, 1, 2, 1, 0, 126601, 1, 0, "夏だからといって\n浮かれすぎないように\n節度を持って\n楽しみなさい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7403, 2, 2, 1, 0, 126601, 1, 0, "ああ見えてもマサキは\n私のプリンセスナイト\nあまり侮られては\n困りますよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7404, 3, 2, 1, 0, 126601, 1, 0, "私の秘密ですか？\nまんじゅうが怖い…\nというのはどうです？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7405, 4, 2, 1, 0, 126601, 1, 0, "ここは誰かの秘密を\n盗み聞くのに\n最適な場所ですね\n…ジョークですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7406, 101, 2, 4, 0, 126601, 1, 0, "一緒に風鈴の音を\nのんびり楽しもう…？\n…別に構いませんよ\n貴方とならば");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7407, 102, 2, 8, 0, 126601, 1, 0, "貴方に約束しましょう\n決して忘れられない\n夏にしてあげますよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7408, 1, 2, 1, 0, 126601, 1, 1, "早起きとは感心ですね\nでは一緒に\n体操でもしましょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7409, 2, 2, 1, 0, 126601, 1, 2, "昼食は流しそうめん？\n非効率的ですね\n…食べないとは\n一言も言っていません");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7410, 3, 2, 1, 0, 126601, 1, 3, "…貴方が望むならば\nいくらでも怖い話を\nしてあげますが…\nいかがですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7412, 2, 3, 1, 0, 126601, 1, 0, "七冠にも休息は\n必要なのです\nしばらくここで\n休ませてもらいますよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7413, 3, 3, 1, 0, 126601, 1, 0, "なかなか気に入った…\nというのは\n誰にも秘密です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7414, 4, 3, 1, 0, 126601, 1, 0, "薫風を思わせる\nこのさわやかな香り…\n悪くないセンスですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7415, 5, 3, 1, 0, 126601, 1, 0, "夏だからこそ\n冷え対策は\n重要なのです\n…とはいえ暑いですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7417, 7, 3, 1, 0, 126601, 1, 0, "私がどのような味が\n好きなのかは…\n当然秘密です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7418, 8, 3, 1, 0, 126601, 1, 0, "夏を舞台にした\n小説は数多くあります\n彼が好きそうな本を\n何冊か見繕いましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7420, 10, 3, 1, 0, 126601, 1, 0, "見た目も手触りも\n完璧に覚えました\nいつでも模倣できます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7421, 11, 3, 1, 0, 126601, 1, 0, "ふむ…夏らしい\nクッションですね\nナイトプールに\n映えそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7422, 103, 1, 12, 0, 105401, 1, 0, "レイ様も格好良いけど\n騎士さんもなかなか…\nって、今の聞こえて\nませんよねっ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7423, 103, 2, 12, 0, 105401, 1, 0, "騎士さんはシンプルな\n服が似合いそうです！\n今度、一緒に\n見に行きましょう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7424, 1, 1, 1, 0, 126801, 1, 0, "最初はどうかな～って\n思ったけど…\n水着姿でも案外\n問題ないのよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7425, 2, 1, 1, 0, 126801, 1, 0, "水着で飲みすぎると\nお腹が冷える、って\n言うけど…麦しゅわ\nなら問題ないわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7426, 3, 1, 1, 0, 126801, 1, 0, "暑ければ暑いほど\nその後の麦しゅわは\nおいしくなるのよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7427, 4, 1, 1, 0, 126801, 1, 0, "しっかりと仕事を\nこなしてから、\nしっかりと麦しゅわ！\nやっぱりこれね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7428, 5, 1, 1, 0, 126801, 1, 0, "ふふっ、デザインも\n着心地も最高ね\n奮発して用意して\n正解だったわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7429, 101, 1, 4, 0, 126801, 1, 0, "伝説の麦しゅわ、\n飲めるものなら\nまた飲みたいわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7430, 102, 1, 8, 0, 126801, 1, 0, "二つ名に恥じない\n聖騎士として\n私…飲むわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7431, 1, 2, 1, 0, 126801, 1, 0, "この格好なら水に\n濡れても大丈夫！\nなんだけど、さすがに\n書類は濡らせないわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7432, 2, 2, 1, 0, 126801, 1, 0, "そうやってじっと\n見られると…ちょっと\n恥ずかしいわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7433, 3, 2, 1, 0, 126801, 1, 0, "今日もいい天気ね\nふふっ、あとで\nビーチに遊びに\n行きましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7434, 4, 2, 1, 0, 126801, 1, 0, "水着姿も慣れると\n案外快適ね\nそうだ、キミも\n水着になっちゃう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7435, 101, 2, 4, 0, 126801, 1, 0, "例え水着姿であろうと\n聖騎士としての誇りは\n忘れてないわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7436, 102, 2, 8, 0, 126801, 1, 0, "キミとだったら\n麦しゅわなしでも\n最高の夏のバカンスに\nなると思うわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7437, 1, 2, 1, 0, 126801, 1, 1, "仕事終わりの\n麦しゅわのために\n今日も一日\n頑張るわよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7438, 2, 2, 1, 0, 126801, 1, 2, "今日のお昼は\nどうしようかしら…\nさ、さすがに昼からは\n自重してるわよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7439, 3, 2, 1, 0, 126801, 1, 3, "さ、一日の疲れを\n洗い流すために…\n軽～く飲むわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7441, 2, 3, 1, 0, 126801, 1, 0, "こうやって\n直に触れると\n肌触りの良さが\nよく分かるわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7442, 3, 3, 1, 0, 126801, 1, 0, "今日もかわいいわね～\nどう？　今度\nお姉さんの一人飲みに\n付き合わない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7443, 4, 3, 1, 0, 126801, 1, 0, "いい香りね～…はっ！\n麦しゅわの匂いの\nアロマポットなんて\nあったらよくない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7444, 5, 3, 1, 0, 126801, 1, 0, "こんな格好で火に\n当たってると焙られる\nスルメの気分が\nちょっと分かるわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7446, 7, 3, 1, 0, 126801, 1, 0, "もぐもぐ…うん、\n結構おつまみにも\nむいてそうね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7447, 8, 3, 1, 0, 126801, 1, 0, "試験に使った参考書、\nたまには読み返して\nおかないとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7449, 10, 3, 1, 0, 126801, 1, 0, "ふふ♪\nいい手触りね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7450, 11, 3, 1, 0, 126801, 1, 0, "…はふう～…\nゴロゴロするのって\n最高ね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7451, 1, 1, 1, 0, 126901, 1, 0, "ん…やっぱり\nこの水着…\n大胆、なんじゃ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7452, 2, 1, 1, 0, 126901, 1, 0, "海でもお世話って、\nできるのかしら…？\n浮き輪代わりになる、\nとか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7453, 3, 1, 1, 0, 126901, 1, 0, "～♪\nふふ…海に行く\n準備も、楽しい…かも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7454, 4, 1, 1, 0, 126901, 1, 0, "あうぅ…水着で\n歩いてると…お尻…\nすぐ食い込んじゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7455, 5, 1, 1, 0, 126901, 1, 0, "海では、はしゃいだ\nほうがいいのよね…\nわ、わー、い…♪\n…こうかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7456, 101, 1, 4, 0, 126901, 1, 0, "あなたとなら…\n楽しい夏の思い出、\n作れる…気がするの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7457, 102, 1, 8, 0, 126901, 1, 0, "また来年も…\n再来年も…\nあなたと海へ\n行けますように…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7458, 1, 2, 1, 0, 126901, 1, 0, "水着の着方を\n練習してるの…\n後ろ、変じゃない…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7459, 2, 2, 1, 0, 126901, 1, 0, "海に行く支度…\n進んでるかしら…？\nお手伝い、する…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7460, 3, 2, 1, 0, 126901, 1, 0, "ひ、日除けの準備は\n万全よ…\nずっと太陽の下に\nいたら…溶けちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7461, 4, 2, 1, 0, 126901, 1, 0, "泳ぐ練習…\nこ、ここでするのは\n…さすがに変？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7462, 101, 2, 4, 0, 126901, 1, 0, "人混みに入るのは\nまだ不安で…\nでも、あなたといれば\nきっと…大丈夫…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7463, 102, 2, 8, 0, 126901, 1, 0, "あなたのおかげで\n海の楽しいところを\nたくさん知ったわ…\nありがとう…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7464, 1, 2, 1, 0, 126901, 1, 1, "お出かけの日の朝は\n早い、のよね…？\nだから、ずっと\n起きていたわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7465, 2, 2, 1, 0, 126901, 1, 2, "今頃ビーチの日差しは\n強いんでしょうね…\nそ、想像しただけで…\nめまいが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7466, 3, 2, 1, 0, 126901, 1, 3, "ビーチの夜といえば\n花火って、聞いたわ…\nバン、って言わない\n花火…ある…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7468, 2, 3, 1, 0, 126901, 1, 0, "素肌にふわふわが…\n気持ちいい…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7469, 3, 3, 1, 0, 126901, 1, 0, "うふふ…\n一緒に海…行く？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7470, 4, 3, 1, 0, 126901, 1, 0, "ふぅ…♪\n気分まで…\n晴れやかになるわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7471, 5, 3, 1, 0, 126901, 1, 0, "暑いような…\n寒いような…\n不思議な気持ちに\nなるわ…ね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7473, 7, 3, 1, 0, 126901, 1, 0, "泳いだ後には\nいっぱい食べたほうが\n体によさそう、ね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7474, 8, 3, 1, 0, 126901, 1, 0, "ビーチの日陰で\n読書するのも…\n気持ちよさそう…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7476, 10, 3, 1, 0, 126901, 1, 0, "これで合ってる…？\n遊び方わからなくて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7477, 11, 3, 1, 0, 126901, 1, 0, "ふわふわ…♪\n海の底にいるみたい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7478, 1, 1, 1, 0, 127001, 1, 0, "恥ずかしい格好で\n室内を歩くこの快感\nクセになりそうです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7479, 2, 1, 1, 0, 127001, 1, 0, "この水着…\nどうしてかポーズを\n決めたくなりますね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7480, 3, 1, 1, 0, 127001, 1, 0, "海にはどんな生き物が\nいるのでしょう～\n胸が高鳴ります～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7481, 4, 1, 1, 0, 127001, 1, 0, "夏は暑いですね…\nクウカの体が熱いのも\n夏のせい…ぐふふ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7482, 5, 1, 1, 0, 127001, 1, 0, "ドＳさんと無人島に\n取り残されて…という\n妄想はかなりイイです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7483, 101, 1, 4, 0, 127001, 1, 0, "ドＳさんの\n欲望に満ちた眼差し…\nクウカ、受け止めます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7484, 102, 1, 8, 0, 127001, 1, 0, "海に行くのが\n楽しみです…\nドＳさんと…ぐふふ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7485, 1, 2, 1, 0, 127001, 1, 0, "「もっと過激な水着を\n見せてみろよ」なんて\nいけませんドＳさん…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7486, 2, 2, 1, 0, 127001, 1, 0, "水着のままで\n踊ればいいのですね…\nドＳさんの望みなら！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7487, 3, 2, 1, 0, 127001, 1, 0, "ドＳさんの熱い視線を\n感じます…じゅるり…\nもっと見てください…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7488, 4, 2, 1, 0, 127001, 1, 0, "こんな格好のクウカを\n放っておくなんて…\nさすがですドＳさん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7489, 101, 2, 4, 0, 127001, 1, 0, "海で水着といえば\n何かが起きる予感…！\nドＳさんの新たな攻め\n期待していますね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7490, 102, 2, 8, 0, 127001, 1, 0, "恥ずかしいですけど\n頑張っちゃいました\nドＳさん…こういう\n水着、好きですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7491, 1, 2, 1, 0, 127001, 1, 1, "こんな朝からクウカを\n水着に着替えさせて…\n本当にドＳさんは\n欲望に正直ですね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7492, 2, 2, 1, 0, 127001, 1, 2, "こんな昼間から\nドＳさんがヌルヌルの\n液体をクウカに～！\nえっ…日焼け止め？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7493, 3, 2, 1, 0, 127001, 1, 3, "ドＳさん…これから\nクウカと夜の海を\n見に行きませんか？\nきっと綺麗ですよ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7495, 2, 3, 1, 0, 127001, 1, 0, "ここなら妄想に\n集中できます～♪\nじゅるり～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7496, 3, 3, 1, 0, 127001, 1, 0, "こうもかわいいと\n妄想に登場させるのも\n気が引けます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7497, 4, 3, 1, 0, 127001, 1, 0, "クウカを昂らせる\nこの香り…！\nは！　ドＳさんの罠！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7498, 5, 3, 1, 0, 127001, 1, 0, "体を熱くさせて\n水着を脱がそうと！？\nテクニカルです…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7500, 7, 3, 1, 0, 127001, 1, 0, "クウカの口の中に\nたくさん…♪\n止まりません…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7501, 8, 3, 1, 0, 127001, 1, 0, "読書は心が穏やかに\nなりますね…！\nぐふふ…穏やかに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7503, 10, 3, 1, 0, 127001, 1, 0, "いい乗り心地です…♪\nあっ…普通に楽しんで\nしまいました…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7504, 11, 3, 1, 0, 127001, 1, 0, "これは…\n妄想に役立ちそうな\n感触です…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7505, 103, 1, 12, 0, 100501, 1, 0, "成長した自分に\nあわせて、もっと\nかっこいいポーズを\n研究するッス！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7506, 103, 2, 12, 0, 100501, 1, 0, "これからも一緒に\n最高のヒーローを\n目指していくッスよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7507, 1, 1, 1, 0, 127101, 1, 0, "お父さん、娘の\n水着姿がそんなに\nうれしいの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7508, 2, 1, 1, 0, 127101, 1, 0, "怖い話を子どもたちに\n聞かせたら泣かれて\nしまいました…\n加減が難しいです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7509, 3, 1, 1, 0, 127101, 1, 0, "海に行くと父が\n水着の女性ばかり\n追いかけて困ります…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7510, 4, 1, 1, 0, 127101, 1, 0, "拾った貝殻で\n新しい占いでも\nはじめてみようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7511, 5, 1, 1, 0, 127101, 1, 0, "貝殻を耳に当てると\n波の音が…あっ\nこれはダメです\nよくない声がします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7512, 101, 1, 4, 0, 127101, 1, 0, "この飲み物、スーッと\n体に沁み込んでくる…\nあの人にも\n教えてあげたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7513, 102, 1, 8, 0, 127101, 1, 0, "強い日差しも騒がしい\n海も苦手なのに\nあの人となら不思議と\n楽しく思えるんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7514, 1, 2, 1, 0, 127101, 1, 0, "夏限定、水と氷を\n使った特別な占いは\nいかがですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7515, 2, 2, 1, 0, 127101, 1, 0, "暑い日々にはやはり\n怪談ですね\n厳選フルコースで\nお聞かせします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7516, 3, 2, 1, 0, 127101, 1, 0, "寒気がする？　それは\n霊ではなくかき氷の\n食べ過ぎですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7517, 4, 2, 1, 0, 127101, 1, 0, "今日の占い、あなたの\nラッキーパーソンは…\n白い水着の女性です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7518, 101, 2, 4, 0, 127101, 1, 0, "あの、よければ\n日焼け止めを塗って\nもらえませんか？\n背中は届かなくて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7519, 102, 2, 8, 0, 127101, 1, 0, "海に行きませんか？\n二人きりで静かな\n砂浜を散歩したいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7520, 1, 2, 1, 0, 127101, 1, 1, "潮騒だけが響く朝の海\n心が落ち着きます\nこれから一緒に散歩に\n行ってみませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7521, 2, 2, 1, 0, 127101, 1, 2, "不思議です。どうして\n普通のご飯でも、海で\n食べると特別おいしく\n感じるのでしょう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7522, 3, 2, 1, 0, 127101, 1, 3, "夜の海に行きませんか\n今なら夜光虫が\n見られるかも\nしれませんよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7524, 2, 3, 1, 0, 127101, 1, 0, "夏は知らぬ間に体力を\n消耗しています\n適度に休息して\nいきましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7525, 3, 3, 1, 0, 127101, 1, 0, "このぬいぐるみ…\n大丈夫です\n何も憑いては\nいませんよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7526, 4, 3, 1, 0, 127101, 1, 0, "ほのかにお線香\nみたいな香り…\nなんだか\n落ち着きます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7527, 5, 3, 1, 0, 127101, 1, 0, "人魂、鬼火\nセントエルモの火…\n炎を見ていると色々と\n連想してしまいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7529, 7, 3, 1, 0, 127101, 1, 0, "お腹を壊さぬよう\n食い合わせには\nご注意ください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7530, 8, 3, 1, 0, 127101, 1, 0, "これはいい\n怪談集ですね…\nつい読みふけって\nしまいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7532, 10, 3, 1, 0, 127101, 1, 0, "ふふ、こういうのに\n乗るとなんだか\n子どもに戻った\nみたいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7533, 11, 3, 1, 0, 127101, 1, 0, "こ、これは…\nちょっとメルヘン\n過ぎて恥ずかしい\nですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7534, 1, 1, 1, 0, 126501, 1, 0, "本当に素敵なお家…♪\n騎士たちの人柄を\n感じられるようで…\n不思議と落ち着きます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7535, 2, 1, 1, 0, 126501, 1, 0, "調度品をつい間食…\nという習慣がこちらの\n世界にはないのですね\n…気をつけないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7536, 3, 1, 1, 0, 126501, 1, 0, "手土産のお菓子は\nどちらに置けば\nよいでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7537, 4, 1, 1, 0, 126501, 1, 0, "まるでおとぎ話の中に\n入ってしまったかの\nよう…別世界とは\nよく言ったものです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7538, 5, 1, 1, 0, 126501, 1, 0, "お忍び…ふふっ♪\nときめく響きです\nなんだかお茶目で…\n密やかな印象が");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7539, 101, 1, 4, 0, 126501, 1, 0, "ふわ…\nああ、ついあくびが…\n居心地がよすぎるのも\n困り物ですね…ふふ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7540, 102, 1, 8, 0, 126501, 1, 0, "騎士には不思議な力が\nあるだけでなく\n何者かの加護が\nあるようですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7541, 1, 2, 1, 0, 126501, 1, 0, "この『王家の装備』は\n少し気難しいのです\nわたし以外が触れると\nその…ビリビリっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7542, 2, 2, 1, 0, 126501, 1, 0, "子どもたちに新しい\n遊びを教わりました♪\nにーらめっこしましょ\nあっぷっ…ぷ～っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7543, 3, 2, 1, 0, 126501, 1, 0, "実は憧れていたのです\n友人の家を訪ねると\nいう経験に…ふふっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7544, 4, 2, 1, 0, 126501, 1, 0, "ぎるどはうす…\nぎるど活動の拠点だと\n管理協会？　の方に\nうかがいました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7545, 101, 2, 4, 0, 126501, 1, 0, "あなたは運命を\n信じますか？\nわたしは…信じます\nよい運命だけですが♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7546, 102, 2, 8, 0, 126501, 1, 0, "もしわたしが本当に\n天使だったとしたら…\nどうされますか？\n…ふふ、冗談です♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7547, 1, 2, 1, 0, 126501, 1, 1, "パンケーキの香りで\n目覚める朝は\nとても良いものですよ\nぜひともお試しを♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7548, 2, 2, 1, 0, 126501, 1, 2, "ひと休みの時間ですね\n食事にお昼寝…\nすべきことを行って\n英気を養いましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7549, 3, 2, 1, 0, 126501, 1, 3, "そろそろ休まれては？\n眠れないようであれば\n寝物語か子守歌でも\nふふ、遠慮は無用です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7551, 2, 3, 1, 0, 126501, 1, 0, "すう………はっ！\n眠ってはいませんよ？\nいくら居心地が良い\nからといって…ふわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7552, 3, 3, 1, 0, 126501, 1, 0, "まあ、あいらしい…♪\nぜひわたしの寝室に\n招待させてください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7553, 4, 3, 1, 0, 126501, 1, 0, "なんて、かぐわしい…\nオーブンからただよう\n焼き菓子の香りとは\nまた異なる魅力が…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7554, 5, 3, 1, 0, 126501, 1, 0, "みなで暖をとりながら\n互いに語り笑い合う\n…心休まる時間ですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7556, 7, 3, 1, 0, 126501, 1, 0, "食は心と体に\nゆとりを生みます\n…辛い食べ物の場合？\nそれは、その…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7557, 8, 3, 1, 0, 126501, 1, 0, "こちらの世界の知識を\n蓄えておかなければ\nテーブルマナーに\nついてのページは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7559, 1, 1, 1, 0, 127201, 1, 0, "新しい色の蛍光ペン\n買ったのよね\nこれで勉強が\n楽しくなるわ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7560, 2, 1, 1, 0, 127201, 1, 0, "学食のランチ、結構\nおいしいのよね～\n今度ペコリーヌに\n教えてやろうかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7561, 3, 1, 1, 0, 127201, 1, 0, "ふふふ…扉に黒板消し\n仕掛けてるの…あいつ\n引っかかるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7562, 4, 1, 1, 0, 127201, 1, 0, "部活するなら運動部も\n悪くないかもね～\n夕日に向かって\n突っ走ってやるわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7563, 5, 1, 1, 0, 127201, 1, 0, "毎日窮屈な制服着て\n学生も大変ね～\n…ま、かわいいけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7564, 101, 1, 4, 0, 127201, 1, 0, "あいつに貸したノート\n変な落書きとか\nしてなかったよね…？\n…その、相合傘とか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7565, 102, 1, 8, 0, 127201, 1, 0, "昨日の家庭科で\n作ったクッキー…\nあいつにどうやって\n渡そうかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7566, 1, 2, 1, 0, 127201, 1, 0, "宿題教えてって？\nしょうがないわね～\nじゃあ一緒に\nやりましょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7567, 2, 2, 1, 0, 127201, 1, 0, "あ、明日あたしたち\n日直当番よね？\nめんどい仕事は\nあんたに任せるわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7568, 3, 2, 1, 0, 127201, 1, 0, "寮生活は楽しいけど\n就寝時間が早すぎよね\nいきなり消灯されると\nビックリするわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7569, 4, 2, 1, 0, 127201, 1, 0, "校則で禁止だけど、\nにけつでほうき通学\nとか青春っぽくない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7570, 101, 2, 4, 0, 127201, 1, 0, "制服って好きな人とも\n自然にお揃いになれて\nいいわよね…って別に\nあんたとって訳じゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7571, 102, 2, 8, 0, 127201, 1, 0, "あんたネクタイ\n曲がってるわよ～？\nほら直したげるから\nこっち向いて？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7572, 1, 2, 1, 0, 127201, 1, 1, "おはよ～！\n今日も元気に登校よ！\n忘れ物ないようにね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7573, 2, 2, 1, 0, 127201, 1, 2, "午前の授業疲れたわ～\nしっかりお昼を食べて\n午後も頑張るわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7574, 3, 2, 1, 0, 127201, 1, 3, "うう…学校の怪談\n思い出しちゃった…\n…別に怖くないけど！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7576, 2, 3, 1, 0, 127201, 1, 0, "ふかふか～\n…気持ち良すぎて\n制服のまま\n寝ちゃいそうね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7577, 3, 3, 1, 0, 127201, 1, 0, "かわいくて癒されるわ\n寮に持ち込んでも\n大丈夫かしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7578, 4, 3, 1, 0, 127201, 1, 0, "集中力の高まる香りで\n勉強の効率爆上がりね\n次のテストで\nいい点取るわよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7579, 5, 3, 1, 0, 127201, 1, 0, "うう、ちょっと冷えて\n来たわね…\nスカートの下に\nジャージ穿こうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7581, 7, 3, 1, 0, 127201, 1, 0, "もぐっ…もぐっ…\n食べとかないと教室で\nお腹なっちゃうわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7582, 8, 3, 1, 0, 127201, 1, 0, "図書室で借りた本\n明日返却日なのよね…\n今日中に読むわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7584, 103, 1, 12, 0, 104301, 1, 0, "あいつに背中を\n預けるのもいい気分だ\nいつかは、全部…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7585, 103, 2, 12, 0, 104301, 1, 0, "な、なんだよ？\nじっと見るんじゃねぇ\n尻尾が揺れちまうだろ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7586, 1, 1, 1, 0, 127301, 1, 0, "魔法の練習！\nむむむ～…\nそれっ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7587, 2, 1, 1, 0, 127301, 1, 0, "そだ！　これ着て\nルー学行こっかな？　\n制服自慢しちゃお♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7588, 3, 1, 1, 0, 127301, 1, 0, "赤点回避の魔法とか\nあったら最高じゃね？\n誰かうちに教えて～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7589, 4, 1, 1, 0, 127301, 1, 0, "制服が一番映える\n場所ってどこだろ？\n教室？　遊園地？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7590, 5, 1, 1, 0, 127301, 1, 0, "ベンキョーつらたん…\n今度キャルっちに\n助けてもらお");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7591, 101, 1, 4, 0, 127301, 1, 0, "部活か…\nヒデサイと一緒に\nやったら楽し～かも♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7592, 102, 1, 8, 0, 127301, 1, 0, "男子の制服\nもにカワだった…\n今度ヒデサイに\n借りよっかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7593, 1, 2, 1, 0, 127301, 1, 0, "ちょすー、うちの\nさいきょー魔法で\nテンアゲしてあげる～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7594, 2, 2, 1, 0, 127301, 1, 0, "九九って呪文ぽくね？\nほら、例えばヒチシ…\nヒチシ、なんだっけ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7595, 3, 2, 1, 0, 127301, 1, 0, "ヒデサイセンセー\nうちにベンキョー\n教えて！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7596, 4, 2, 1, 0, 127301, 1, 0, "学割マジ助かるー\nヒデサイ、一緒に\nどんどん使ってこー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7597, 101, 2, 4, 0, 127301, 1, 0, "今度ヒデサイに\nお弁当作ったげる\n屋上で一緒に食べよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7598, 102, 2, 8, 0, 127301, 1, 0, "ヒデサイのバイブス\n上がる言葉教えてよ\nつらたんな時、うちが\nいっぱい言ったげるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7599, 1, 2, 1, 0, 127301, 1, 1, "ちょすちょす～\n今日も朝から\nバイブス十分♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7600, 2, 2, 1, 0, 127301, 1, 2, "お昼どうしよっかな\nたまにはガッツリ\nいっちゃう系？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7601, 3, 2, 1, 0, 127301, 1, 3, "やべ、宿題まだ\nできてないし…\nヒデサイ助けて～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7603, 2, 3, 1, 0, 127301, 1, 0, "充電ちう～\n…ガッコーのイスも\nこれにして～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7604, 3, 3, 1, 0, 127301, 1, 0, "かわいいし、\n癒されるし、キュン死\nしちゃうじゃん…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7605, 4, 3, 1, 0, 127301, 1, 0, "リフレッシュの\n魔法発見！\nいい香り～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7606, 5, 3, 1, 0, 127301, 1, 0, "ぽかぽかサイコー♪\n今日はもーずーっと\nここにいたいかも～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7608, 7, 3, 1, 0, 127301, 1, 0, "超おいし～♪\n学食にあったら\n毎日リピする～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7609, 8, 3, 1, 0, 127301, 1, 0, "ふむふむ…\nねむみパない…\n続きはまた今度～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7611, 1, 1, 1, 0, 127501, 1, 0, "今度は子どもたちも\nサラサリアに連れて\n行ってあげたいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7612, 2, 1, 1, 0, 127501, 1, 0, "子どもたちから\nお姫さまみたいって\n言われちゃった♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7613, 3, 1, 1, 0, 127501, 1, 0, "この剣…火を点けたり\nするのに便利なのよ\nコントロールも効くし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7614, 4, 1, 1, 0, 127501, 1, 0, "あのサラサリアの\nカラっとした暑さが\nちょっと恋しいわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7615, 5, 1, 1, 0, 127501, 1, 0, "買ってきたお土産、\nお世話になってる\nみんなに配りましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7616, 101, 1, 4, 0, 127501, 1, 0, "あんたと一緒なら\nどこの国でだって\n暮らしていけそうね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7617, 102, 1, 8, 0, 127501, 1, 0, "今の事業を大きくして\nあんたと世界中の国を\n飛び回ったり…なんて\nすてきじゃない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7618, 1, 2, 1, 0, 127501, 1, 0, "サラサリアで食べた\n料理が恋しい…？\nもう…また今度\n作ってあげるわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7619, 2, 2, 1, 0, 127501, 1, 0, "今度旅行するなら\nどこに行こうかしら？\n希望があれば教えてね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7620, 3, 2, 1, 0, 127501, 1, 0, "サラサリアの香辛料、\nランドソルでも\n人気が出そうよね\nいいビジネスの予感！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7621, 4, 2, 1, 0, 127501, 1, 0, "そんなにじっと\n見られるとさすがに\n恥ずかしいってば…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7622, 101, 2, 4, 0, 127501, 1, 0, "お嫁さんは憧れるけど\nお婿さんになって\nもらうのもありよね…\nあんたはどう思う？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7623, 102, 2, 8, 0, 127501, 1, 0, "やっぱり、あんたには\nいつもあたしの隣に\n居てほしいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7624, 1, 2, 1, 0, 127501, 1, 1, "陽射しが強くなる前に\n雑多な用事は\n片付けちゃいましょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7625, 2, 2, 1, 0, 127501, 1, 2, "サラサリアで食べた\n料理を再現してみたの\n味見してくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7626, 3, 2, 1, 0, 127501, 1, 3, "暑さに負けないように\n睡眠はちゃんと\n取っておかないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7628, 2, 3, 1, 0, 127501, 1, 0, "こっちでもあっちでも\n忙しいのは変わらない\nわね…ちょっと休憩～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7629, 3, 3, 1, 0, 127501, 1, 0, "サラサリアで見た\nぬいぐるみも\nかわいかったわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7630, 4, 3, 1, 0, 127501, 1, 0, "お香って地域ごとの\n特色が出るわよね\nこの香りは…\nちょっと神秘的？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7631, 5, 3, 1, 0, 127501, 1, 0, "砂漠地方も夜は冷える\nのよね。温かいものが\nあると安心するわ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7633, 7, 3, 1, 0, 127501, 1, 0, "食べ慣れた味って\nどうしてほっと\nするのかしら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7634, 8, 3, 1, 0, 127501, 1, 0, "今後の取引相手に\nなるかもしれないし\n向こうの文化も\n勉強しておかないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7636, 103, 1, 12, 0, 101401, 1, 0, "犯人はこの中にいる！\n探偵として一度は\n言ってみたいセリフさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7637, 103, 2, 12, 0, 101401, 1, 0, "助手くんの情報を\n仕入れておかないと…\n理想の私を、ずっと\n見ていてほしいからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7638, 1, 1, 1, 0, 127601, 1, 0, "久々の長旅で\n里心がついちまったね\nしばらくランドソルで\nのんびりしようか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7639, 2, 1, 1, 0, 127601, 1, 0, "たまには違う服装\n違う得物を使うのも\n悪くないね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7640, 3, 1, 1, 0, 127601, 1, 0, "サラサリアにいた時は\n砂まみれで大丈夫かと\n思ってたけど、今じゃ\n懐かしく感じるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7641, 4, 1, 1, 0, 127601, 1, 0, "魔法の絨毯、あれは\n楽だし速いし便利\nだったねえ…土産に\n一枚欲しかったな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7642, 5, 1, 1, 0, 127601, 1, 0, "砂上での戦いは\nなかなかいい鍛錬に\nなったね…今度は\n修行しに行くとしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7643, 101, 1, 4, 0, 127601, 1, 0, "サラサリアの人たちも\n気のいい連中だったが\n元気にやってるかねえ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7644, 102, 1, 8, 0, 127601, 1, 0, "旅の恥はかき捨てって\nいうけど、悪い旅じゃ\nなかったね。次は\nアイツとどこに行こう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7645, 1, 2, 1, 0, 127601, 1, 0, "この格好を冷やかしに\n来たのかい？\n生憎、もうすっかり\n慣れちまったよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7646, 2, 2, 1, 0, 127601, 1, 0, "ギルドの連中に\n土産をわたしに\n行くところなんだ\n付き合っておくれよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7647, 3, 2, 1, 0, 127601, 1, 0, "久々に水場で\n釣りがしたいねえ…\nもちろんお前さんも\nくるんだろう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7648, 4, 2, 1, 0, 127601, 1, 0, "おっと\nサラサリアの連中から\n便りが来てるよ\nさ、一緒に読もうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7649, 101, 2, 4, 0, 127601, 1, 0, "最近サラサリアの踊り\nを練習してるんだ\nあとで振付けを\n見ておくれよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7650, 102, 2, 8, 0, 127601, 1, 0, "なんだいお前さん？\n…なんだか若奥さん\nっぽいって？　まあ、\nそりゃあ、ねえ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7651, 1, 2, 1, 0, 127601, 1, 1, "いい時間だね\n日が昇りきる前に\nやることをすませ\nとかないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7652, 2, 2, 1, 0, 127601, 1, 2, "昼はどうしようかね\nサラサリア風の\n食事でもつくろうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7653, 3, 2, 1, 0, 127601, 1, 3, "さて、早めに寝ようか\n砂漠の夜は冷えるから\n…っと、まだ旅行中の\n気分でいたよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7655, 2, 3, 1, 0, 127601, 1, 0, "良い座り心地だ\nサラサリア宮殿の\n応接間を\n思い出すねえ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7656, 3, 3, 1, 0, 127601, 1, 0, "ランプの魔神に\nあげたら喜ぶかねえ？\n次に会う時までに\n見繕ってみようか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7657, 4, 3, 1, 0, 127601, 1, 0, "この香り…\nサラサリア土産の\n香木かい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7658, 5, 3, 1, 0, 127601, 1, 0, "旅先での焚火を\n思い出すよ\nなんだかほっとするね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7660, 7, 3, 1, 0, 127601, 1, 0, "ふふ、慣れてる味も\nいいけど、むこうの\n味付けが懐かしく\nなっちまうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7661, 8, 3, 1, 0, 127601, 1, 0, "ふむふむ…\n千夜一夜物語か\nおもしろいもんだねえ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7663, 1, 1, 1, 0, 126001, 1, 0, "立派なギルドハウス♪\n帰る場所が素敵だと\n冒険に出るのも\n楽しくなりそうです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7664, 2, 1, 1, 0, 126001, 1, 0, "お掃除でも…と\n思いましたけど、\nさすがお兄さんのお家\nきれいにしてますね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7665, 3, 1, 1, 0, 126001, 1, 0, "わたしたちもいつか\n立派なギルドハウスが\n持てる冒険者に\nなりたいです…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7666, 4, 1, 1, 0, 126001, 1, 0, "わたし冒険者ですけど\n家を守ってお兄さんの\n帰りを待つのも\n悪くない…かも？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7667, 5, 1, 1, 0, 126001, 1, 0, "お菓子焼こうかな…♪\nちょっと多めに作って\nお兄さんにも\n食べてもらおうっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7668, 101, 1, 4, 0, 126001, 1, 0, "このお家、とっても\n大好きになりました♪\nだからその…もう少し\nいてもいいですか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7669, 102, 1, 8, 0, 126001, 1, 0, "お兄さんに\n感謝の手紙を書いて\n枕元に隠して\nおこうかな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7670, 1, 2, 1, 0, 126001, 1, 0, "…お兄さん\nお暇なんですか？\nじゃあ一緒に冒険へ\n出かけましょう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7671, 2, 2, 1, 0, 126001, 1, 0, "お兄さんは苦手な食材\nとかありますか？\nあの、もしよければ\n今から手料理を…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7672, 3, 2, 1, 0, 126001, 1, 0, "まったり過ごす\nお家時間もいいですね\n冒険者には羽休めも\n大事ですから♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7673, 4, 2, 1, 0, 126001, 1, 0, "いつでもお兄さんを\n守れるように\nこの姿でいることに\n慣れておきますね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7674, 101, 2, 4, 0, 126001, 1, 0, "お兄さん眠そうです…\nちょっとお昼寝\nしちゃいましょうか♪\nはい、膝枕…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7675, 102, 2, 8, 0, 126001, 1, 0, "お兄さん怪我を…！？\nわたしが治療を…\nふー…ふー…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7676, 1, 2, 1, 0, 126001, 1, 1, "おはようございます♪\n朝、元気に挨拶すれば\n幸せな一日が過ごせる\nそうですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7677, 2, 2, 1, 0, 126001, 1, 2, "お昼ごはんの時間です\n…手がふさがってる？\nわかりました、じゃあ\nあ～んしますね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7678, 3, 2, 1, 0, 126001, 1, 3, "ふわぁ…眠くなって\nきちゃいました…\nお兄さん…お泊りして\nいいですか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7680, 2, 3, 1, 0, 126001, 1, 0, "ふにゃ～～…♪\nこんな姿、他の人には\n見せられません…♪\nもふもふ～～…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7681, 3, 3, 1, 0, 126001, 1, 0, "お兄さんこういうの\n好きなのかな～…\nふふっ、わたしも♪\nぎゅ～～～っ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7682, 4, 3, 1, 0, 126001, 1, 0, "アロマの癒し効果…\n上手くアレンジして\nみなさんの治療に\n活かせないかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7683, 5, 3, 1, 0, 126001, 1, 0, "は～気持ちいい～♪\n身体が暖まると\n心もぽかぽかです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7685, 7, 3, 1, 0, 126001, 1, 0, "うふふ、おいしい♪\nプレシアちゃんなら\n無限にぱくぱく～って\nしちゃいそうです…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7686, 8, 3, 1, 0, 126001, 1, 0, "本はわたしを\n知らない世界に\n連れていってくれる…\nまるでお兄さんです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7688, 103, 1, 12, 0, 103801, 1, 0, "話題の新刊…\nあの人も読んでるかな\n今度会う時、感想\n聞いてみたいな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7689, 103, 2, 12, 0, 103801, 1, 0, "うにゃっ…あ、熱を\n測ってくれたんですか\nありがとうございます\nバッチリ元気ですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7690, 1, 1, 1, 0, 126101, 1, 0, "お兄の、けはい…\nん、みつけた\nぎゅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7691, 2, 1, 1, 0, 126101, 1, 0, "きょろきょろ\nここも\nぱとろる、するよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7692, 3, 1, 1, 0, 126101, 1, 0, "おうち\nにぎやか\nさみしく、ない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7693, 4, 1, 1, 0, 126101, 1, 0, "きょだい、おにぎり\nきょだい、肉まん\nきょだい…お兄？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7694, 5, 1, 1, 0, 126101, 1, 0, "はっぴーちゃん\nどこ？\nお兄、たべた？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7695, 101, 1, 4, 0, 126101, 1, 0, "くんくん…この、へや\nお兄の、におい\nすんでる\nすめる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7696, 102, 1, 8, 0, 126101, 1, 0, "おそうじ、にがて\nでも\nれんしゅう\nきゅっきゅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7697, 1, 2, 1, 0, 126101, 1, 0, "みみ、さわり、たい？\nんー…だめ…\nむずむず\nなので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7698, 2, 2, 1, 0, 126101, 1, 0, "くろぷれしあ\nかっこいい？\nん…あざます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7699, 3, 2, 1, 0, 126101, 1, 0, "お兄の、おうち\nきょうみ、ましまし\nたんけん\nするね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7700, 4, 2, 1, 0, 126101, 1, 0, "なでなで、される…と\nねむ…く…\nぶぅ…ぶぅ…ぶぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7701, 101, 2, 4, 0, 126101, 1, 0, "かみ、りぼん\nおてつだい\nよろ\nです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7702, 102, 2, 8, 0, 126101, 1, 0, "ここ\nすむ\nね？\nまいにち、いっしょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7703, 1, 2, 1, 0, 126101, 1, 1, "ぐっもにん\nあさごはん\nあさごはん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7704, 2, 2, 1, 0, 126101, 1, 2, "お兄\nおつかれ？\nれっつ、まいぺーす");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7705, 3, 2, 1, 0, 126101, 1, 3, "ひとりで、ねれる\nでも\nひとりじゃ、なくても\nねれる、よ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7707, 2, 3, 1, 0, 126101, 1, 0, "ふかふか\nパパの、おなか\nみたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7708, 3, 3, 1, 0, 126101, 1, 0, "こんにちは\nぷれしあ、です\nおともだち、なろ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7709, 4, 3, 1, 0, 126101, 1, 0, "いい、におい\nでも、お兄\nもっと、いい、におい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7710, 5, 3, 1, 0, 126101, 1, 0, "とりま\nお肉、やこ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7712, 7, 3, 1, 0, 126101, 1, 0, "もぐもぐ…\nむげん肉まん、も\nきぼう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7713, 8, 3, 1, 0, 126101, 1, 0, "ぜんぶ、よんだ\nもっと、ぶあついほん\nでも、いーよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7715, 1, 1, 1, 0, 127901, 1, 0, "幸せなクリスマスを\n過ごすため\nギルドハウスを\nきれいにしなくちゃ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7716, 2, 1, 1, 0, 127901, 1, 0, "えへへ♪\n彼へのプレゼント…\n枕元にそっと\nおいておきましょう☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7717, 3, 1, 1, 0, 127901, 1, 0, "クリスマスといえば\n七面鳥の丸焼き…☆\nよだれを拭いて\nいざ準備です♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7718, 4, 1, 1, 0, 127901, 1, 0, "彼に用意した\nプレゼント…\n大きすぎて\nくつ下に入りません…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7719, 5, 1, 1, 0, 127901, 1, 0, "プレゼントは\n貰う方も、贈る方も\nどちらも幸せを\n感じますね…☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7720, 101, 1, 4, 0, 127901, 1, 0, "夜景が見える\nレストランであの人と\nクリスマスデート…\n憧れちゃいますね☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7721, 102, 1, 8, 0, 127901, 1, 0, "プレゼントはわたし…\n恥ずかしいですけど\nこの贈り物、彼に\n喜んでほしいです…☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7722, 1, 2, 1, 0, 127901, 1, 0, "オーナメントを\nたくさん用意したので\n二人でツリーに\n飾りつけましょう☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7723, 2, 2, 1, 0, 127901, 1, 0, "あはは、お腹\n空いちゃいました？\nパーティーまで\n我慢してください♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7724, 3, 2, 1, 0, 127901, 1, 0, "ジングルベ～ル♪\nあなたも一緒に\nクリスマスソング\n歌っちゃいましょう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7725, 4, 2, 1, 0, 127901, 1, 0, "サプライズプレゼント\nの用意をして…って\nあなた！？　い、今の\n聞いてませんよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7726, 101, 2, 4, 0, 127901, 1, 0, "クリスマスの夜は\nパーティーしましょう\nできれば…その…\n二人っきりで…☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7727, 102, 2, 8, 0, 127901, 1, 0, "あなたと過ごした\n最高のクリスマス…\nずっとずっと心の奥に\nしまっておきますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7728, 1, 2, 1, 0, 127901, 1, 1, "おはようございます！\n皆の願いが叶うような\n素敵な一日に\nしましょうね☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7729, 2, 2, 1, 0, 127901, 1, 2, "お昼ですね！\nディナーの買い出しが\n済んだら、少しお昼寝\nしちゃいましょうか☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7730, 3, 2, 1, 0, 127901, 1, 3, "そろそろ就寝の\n時間ですね～\n枕元にくつ下の準備を\nお忘れなく～☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7732, 2, 3, 1, 0, 127901, 1, 0, "ふ～気持ちいい…☆\nお家でまったり過ごす\nクリスマスも\nいいですよね…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7733, 3, 3, 1, 0, 127901, 1, 0, "かわいいですね～♪\nサンタさんからの\n贈り物でしょうか～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7734, 4, 3, 1, 0, 127901, 1, 0, "すう～…はあ～…\nすごく素敵な香り…\n炊き立てのご飯と\nいい勝負です…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7735, 5, 3, 1, 0, 127901, 1, 0, "暖かいですけど…\nあの日の山小屋を\n思い出して\n恥ずかしいですね…☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7737, 7, 3, 1, 0, 127901, 1, 0, "むしゃむしゃもぐもぐ\n止まりませんよ\nクリスマスですから\nむしゃむしゃもぐもぐ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7738, 8, 3, 1, 0, 127901, 1, 0, "物語に出てくる\nサンタさんみたいに\nわたしも幸せを\n運びたいです…☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7740, 14, 3, 1, 0, 127901, 1, 0, "わっ！\nこ…これは素敵な\nサプライズプレゼント\nですね…☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7741, 15, 3, 1, 0, 127901, 1, 0, "これを着ればわたしも\n立派なサンタさんに\nなれますかね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7742, 103, 1, 12, 0, 106601, 1, 0, "ここが今のあたしの\n居場所ってやつです\nふふっ、なかなか\n悪くねー気分ですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7743, 103, 2, 12, 0, 106601, 1, 0, "これからはボス代行\nとしてブイブイ\nいわせてやるです\nついてくるですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7744, 1, 1, 1, 0, 128001, 1, 0, "陛下～♪\n貴女のクレジッタが\nおめかしして\nはせ参じましたわ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7745, 2, 1, 1, 0, 128001, 1, 0, "パーティーとは景気の\n良さを見せつける場…\n倹約などは\nもっての外でしてよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7746, 3, 1, 1, 0, 128001, 1, 0, "この天井の高さなら\n搬入できそうですわね\n陛下用の特注ケーキ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7747, 4, 1, 1, 0, 128001, 1, 0, "…ぶぇっくしゅ！\nふう…少し背中を\n開けすぎたかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7748, 5, 1, 1, 0, 128001, 1, 0, "ここは秘書の目も\n届きませんから\nチクりメモの心配も\nありませんのよね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7749, 101, 1, 4, 0, 128001, 1, 0, "いくらでも二度見して\nよろしくてよ？\n本当にわたくしだと\n心から納得できるまで");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7750, 102, 1, 8, 0, 128001, 1, 0, "袖の下以外の贈り物も\nなかなかどうして…\n悪くないものですのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7751, 1, 2, 1, 0, 128001, 1, 0, "こう見えてダンスの\nたしなみはありますの\nお相手してあげても\nよろしくってよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7752, 2, 2, 1, 0, 128001, 1, 0, "ドレスはもちろん\n特注品ですわ♪\nもしや貸衣装だと\n思いまして？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7753, 3, 2, 1, 0, 128001, 1, 0, "バッグの中身？\n仕事に必要なものと…\n心を潤わせるための\n宝石がいくつか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7754, 4, 2, 1, 0, 128001, 1, 0, "やる気というものは\n仕事に必要な条件です\nいわばドレスコードの\nようなものですわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7755, 101, 2, 4, 0, 128001, 1, 0, "全ての仕事は自分の\n血となり肉となり\nお金にもなるもの\nなのです。経験談です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7756, 102, 2, 8, 0, 128001, 1, 0, "今年の教訓を活かして\n来年は更に素晴らしい\nクリスマスにして\n差し上げますわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7757, 1, 2, 1, 0, 128001, 1, 1, "おはようございます\n今日という稼ぎ時の\nはじまりですわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7758, 2, 2, 1, 0, 128001, 1, 2, "安くて早くておいしい\nそれがランチに必須の\n栄養素ですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7759, 3, 2, 1, 0, 128001, 1, 3, "宵越しの仕事は\n安眠の敵！\n熟睡したいのであれば\n今が勝負時ですわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7761, 2, 3, 1, 0, 128001, 1, 0, "たまにはこうして\n休息を取ることも…\n…はっ！？\nドレスにシワが～っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7762, 3, 3, 1, 0, 128001, 1, 0, "…わたくしの勘が\n言っていますわ\nこの愛らしさ！\n爆売れ確・定！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7763, 4, 3, 1, 0, 128001, 1, 0, "いい香りですわね…\nお金の匂いには\n敵いませんけれども♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7764, 5, 3, 1, 0, 128001, 1, 0, "……ハッ！？\n完全にボーッとして\nしまいましたわ…！\nぬくもり…恐ろしい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7766, 7, 3, 1, 0, 128001, 1, 0, "考えませんわ…\n考えませんわよ！\nカロリーのことはっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7767, 8, 3, 1, 0, 128001, 1, 0, "ビジネス本以外の本を\n読むのも、たまには\n悪くありませんわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7769, 14, 3, 1, 0, 128001, 1, 0, "よくできていますわね\nこの絵本！\n子ども向けだと甘く\n見ていましたわ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7770, 15, 3, 1, 0, 128001, 1, 0, "この視界の狭さ…\n思い出しますわね\nティッシュ配りの\nアルバイト時代を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7771, 1, 1, 1, 0, 128101, 1, 0, "ふふふ…こっそり\nスイーツを食べる\nリノちゃん見～っけ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7772, 2, 1, 1, 0, 128101, 1, 0, "お姉ちゃんの抜き打ち\nお部屋チェック～♪\n…ケーキの食べこぼし\nこれはリノちゃんだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7773, 3, 1, 1, 0, 128101, 1, 0, "この衣装は目立つから\nどこにいても弟くんに\n気付いてもらえるね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7774, 4, 1, 1, 0, 128101, 1, 0, "弟くん、協力して！\nリノちゃんにお勉強\nしなさいって圧を\nかけるんだよっ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7775, 5, 1, 1, 0, 128101, 1, 0, "絆の力を感じるよ\nこれならもっと万全な\n弟くんのお世話が\nできそうだねっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7776, 101, 1, 4, 0, 128101, 1, 0, "お姉ちゃんもたまには\nリノちゃんみたいに\n甘えてみようかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7777, 102, 1, 8, 0, 128101, 1, 0, "弟くんとリノちゃん\nどっちも大切な\n私のきょうだいだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7778, 1, 2, 1, 0, 128101, 1, 0, "分かってるよ♪\nお姉ちゃんの膝枕を\nご所望だねっ？　え？\n違う？　違わないよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7779, 2, 2, 1, 0, 128101, 1, 0, "リノちゃんがね\nお姉ちゃんチョップを\n防ぐ妹白刃取りを\n訓練してるんだよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7780, 3, 2, 1, 0, 128101, 1, 0, "お姉ちゃん頭突きは\n封印しないとね…\nだって、今使うと\n頭飾りで威力が…ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7781, 4, 2, 1, 0, 128101, 1, 0, "ふふっ♪\n目をつぶってても\n弟くんは見えてるよ\n…そこでしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7782, 101, 2, 4, 0, 128101, 1, 0, "お姉ちゃんも\nリノちゃんみたいに\nかわいさいっぱいに\n振舞っちゃうぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7783, 102, 2, 8, 0, 128101, 1, 0, "弟くんっ♪\nいつもお姉ちゃんの\n声が届く範囲にいてね\n…絶対だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7784, 1, 2, 1, 0, 128101, 1, 1, "おはよう、弟くん！\nリノちゃんが起こして\nくれたんだね♪\n…先を越されちゃった");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7785, 2, 2, 1, 0, 128101, 1, 2, "お姉ちゃんランチの\n時間だぞ♪\nさ、食べさせてあげる\nお口を開けて…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7786, 3, 2, 1, 0, 128101, 1, 3, "おやすみの時間だよ\n…弟くんは真ん中ね\n左右には私たち姉妹が\nいるから安心だよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7788, 2, 3, 1, 0, 128101, 1, 0, "お姉ちゃんは全力で\nリラックスしてても\n弟くんの声一つで\nすぐにでも動けるよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7789, 3, 3, 1, 0, 128101, 1, 0, "リノちゃんこういうの\n好きそうだよね\n今度プレゼントして\nみようかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7790, 4, 3, 1, 0, 128101, 1, 0, "いい匂いがするね～\nあれ？\nリノちゃんのケーキの\n甘い匂いも混ざってる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7791, 5, 3, 1, 0, 128101, 1, 0, "お姉ちゃんの\n弟くんへの愛も\n熱く燃えあがるね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7793, 7, 3, 1, 0, 128101, 1, 0, "たくさん食べて\n栄養を補給して\nお姉ちゃん力に\n全て変換するよっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7794, 8, 3, 1, 0, 128101, 1, 0, "ことわざ辞典…\nリノちゃんにこれを\n読ませようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7797, 1, 1, 1, 0, 128201, 1, 0, "そろ～り、そろり…\nお姉ちゃんが居ぬ間に\nスイーツを～…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7798, 2, 1, 1, 0, 128201, 1, 0, "いつか\nお姉ちゃんに似合う服\n作ってみたいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7799, 3, 1, 1, 0, 128201, 1, 0, "あいたっ！？\nひらひらしたとこ\n踏んづけちゃいました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7800, 4, 1, 1, 0, 128201, 1, 0, "お姉ちゃんと\nお兄ちゃんの二人から\n勉強しろって圧力が～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7801, 5, 1, 1, 0, 128201, 1, 0, "私の中にも秘めた力が\n眠っているはず…\nそう、妹パワーが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7802, 101, 1, 4, 0, 128201, 1, 0, "私もお兄ちゃんを\n甘やかしてみたいです\n…お姉ちゃんみたいに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7803, 102, 1, 8, 0, 128201, 1, 0, "お兄ちゃんの部屋を\nこっそり拝見～♪\nはっ！？　これは\nお姉ちゃんの視線…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7804, 1, 2, 1, 0, 128201, 1, 0, "お姉ちゃん頭突きは\n大地を揺らす威力です\n私とお兄ちゃんは\n挨拶感覚で喰らいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7805, 2, 2, 1, 0, 128201, 1, 0, "お姉ちゃんチョップは\n雲を裂く切れ味です\n早く妹白刃取りを\n完成させないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7806, 3, 2, 1, 0, 128201, 1, 0, "お姉ちゃんみたいに\n大人っぽく着こなす\nには一体どうしたら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7807, 4, 2, 1, 0, 128201, 1, 0, "弓のデザインも\nかわいいんですよっ♪\n常に持ち歩きたいです\nけど…危ないですよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7808, 101, 2, 4, 0, 128201, 1, 0, "きれいな服を着てると\nお姫さま気分に\nなれますね…あとは\n王子さまがいれば…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7809, 102, 2, 8, 0, 128201, 1, 0, "お兄ちゃんっ！\n私は褒められて伸びる\nタイプなのでもっと\nナデナデしてください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7810, 1, 2, 1, 0, 128201, 1, 1, "妹モーニングコール♪\nお姉ちゃんより先に\n起こしに来れました！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7811, 2, 2, 1, 0, 128201, 1, 2, "ああっ、お姉ちゃん！\nお兄ちゃんにアーン\nするなんてずるいです\n私もしたいですっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7812, 3, 2, 1, 0, 128201, 1, 3, "おやすみの時間ですね\nえへへ、きょうだいで\n並んで寝るのって\n楽しいですよね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7814, 2, 3, 1, 0, 128201, 1, 0, "スイーツを食べた後は\nお腹を休めましょう～\n平気平気…ちゃぁんと\n運動もしますからぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7815, 3, 3, 1, 0, 128201, 1, 0, "お姉ちゃんも\nこういうかわいいもの\n好きなんですかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7816, 4, 3, 1, 0, 128201, 1, 0, "くんくん…\nなんの匂いでしょうか\n新しいスイーツ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7817, 5, 3, 1, 0, 128201, 1, 0, "きょうだい３人\n肩を寄せて暖まるとか\nよくないですかっ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7819, 7, 3, 1, 0, 128201, 1, 0, "いつも元気な妹で\nいるためには\nよく食べるのが大事！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7820, 8, 3, 1, 0, 128201, 1, 0, "なんか姉に関する本が\nちらほらと混ざって…\nこれお姉ちゃんの\n仕業ですね！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7823, 1, 1, 1, 0, 128301, 1, 0, "ふんふんふ～ん\nお正月で世間は\n浮かれてるですねえ\nま、いいですけど♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7824, 2, 1, 1, 0, 128301, 1, 0, "は～、お正月は\nだらだらできて\n最高ですね\n…いつも通りですけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7825, 3, 1, 1, 0, 128301, 1, 0, "ビッグな幹部は\nビッグなお年玉が\nもらえるはずです\n楽しみですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7826, 4, 1, 1, 0, 128301, 1, 0, "今度ドラちゃんに\nお年玉を持っていって\nやりたいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7827, 5, 1, 1, 0, 128301, 1, 0, "そういえばアユアユと\n約束してたですよ…\nそろそろ出かける\nですかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7828, 101, 1, 4, 0, 128301, 1, 0, "お年玉がもらえたら\n何に使うか…\n今のうちに\n考えとくです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7829, 102, 1, 8, 0, 128301, 1, 0, "年神の報酬の駄菓子が\nたまってきたですね…\nガキどもにでも\n配っちまうですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7830, 1, 2, 1, 0, 128301, 1, 0, "あたしのレアな\n晴れ着姿、今のうちに\nしっかり目に焼き付け\nとくがいいですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7831, 2, 2, 1, 0, 128301, 1, 0, "お兄さんは今日も\nヒマそうですねぇ…\nしょうがないから\nかまってやるですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7832, 3, 2, 1, 0, 128301, 1, 0, "そういえばカヤぴぃ\n見なかったですか？\n喧嘩屋初売りセール\nとか言ってたですけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7833, 4, 2, 1, 0, 128301, 1, 0, "お正月ならではの\n大きなシノギ…\nなにかないですかね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7834, 101, 2, 4, 0, 128301, 1, 0, "いいとこに来たですよ\nさっき走ったら帯が\n曲がっちゃったです\n直すの手伝うです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7835, 102, 2, 8, 0, 128301, 1, 0, "年神の仕事ですか？\nこれからいくとこです\nお兄さんも一緒に\n来やがるですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7836, 1, 2, 1, 0, 128301, 1, 1, "ふぁあ…\nどうしたですか？\nお正月に早起きなんて\n無粋ってヤツですよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7837, 2, 2, 1, 0, 128301, 1, 2, "小腹が減ったですね\n一緒におせちでも\nつつきにいくですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7838, 3, 2, 1, 0, 128301, 1, 3, "夜はあたしの時間\nと言いたいとこですが\n初夢のために早く\n寝とくですかね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7840, 2, 3, 1, 0, 128301, 1, 0, "正月は食っちゃ寝\nするのが仕事…\nって聞いたこと\nあるですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7841, 3, 3, 1, 0, 128301, 1, 0, "ふふっ、晴れ着の\nあたしの次くらいには\nかわいいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7842, 4, 3, 1, 0, 128301, 1, 0, "なんかいい匂い…？\nよく知らんですけど\n晴れ着からも同じ\n匂いがしてるですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7843, 5, 3, 1, 0, 128301, 1, 0, "ふ～あったまるです…\nお正月の唯一の弱点は\n寒いことですからね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7845, 7, 3, 1, 0, 128301, 1, 0, "もぐもぐ…正月太り？\nあたしには関係ない\n言葉ですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7846, 8, 3, 1, 0, 128301, 1, 0, "あったあった…\nトーゴクには\nドラゴンの神宮も\nあるんですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7848, 1, 1, 1, 0, 128401, 1, 0, "お正月のトラブルも\nハツネちゃんが\nめでたく解決\nしてみせるのだ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7849, 2, 1, 1, 0, 128401, 1, 0, "そうだ、新年会に\nサプライズ大作戦を\nしかけちゃおう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7850, 3, 1, 1, 0, 128401, 1, 0, "イノリちゃんも\nカスミンも振袖姿が\nかわいかったな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7851, 4, 1, 1, 0, 128401, 1, 0, "シオリンに\nお年玉あげたいし\n彼にバイトを紹介\nしてもらおうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7852, 5, 1, 1, 0, 128401, 1, 0, "今度はどんな凧を\n飛ばそうかな？\nみんなが驚くような\n凧がいいよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7853, 101, 1, 4, 0, 128401, 1, 0, "ひらめいた！\n彼への年賀状は\nきらーんっ☆って\n感じにしよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7854, 102, 1, 8, 0, 128401, 1, 0, "来年も彼の隣で\n初日の出が\n見られるといいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7855, 1, 2, 1, 0, 128401, 1, 0, "今日はキミが\nギルドハウスに来る\n予知夢を見たんだよ～\nふふ、正夢になったね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7856, 2, 2, 1, 0, 128401, 1, 0, "この振袖どうかな？\nすっごくかわいいよね\nえへへ、ありがとう～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7857, 3, 2, 1, 0, 128401, 1, 0, "ハツネちゃんおみくじ\n開始！　きらーんっ☆\nキミは大吉なのだ～\nどう元気出たかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7858, 4, 2, 1, 0, 128401, 1, 0, "今度エルフの森にある\n薬草を使って七草粥を\n作ろうと思うんだ～\nぜひ食べてほしいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7859, 101, 2, 4, 0, 128401, 1, 0, "お正月っぽい遊びを\n色々と用意したのだ～\nたまにはギルドハウス\nでゆっくり過ごそうよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7860, 102, 2, 8, 0, 128401, 1, 0, "もしかして眠たいの？\n…じゃあ、また膝枕\nしてあげてもいいよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7861, 1, 2, 1, 0, 128401, 1, 1, "いっぱい寝たから\n元気いっぱいだよ～\n今日もがんばろう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7862, 2, 2, 1, 0, 128401, 1, 2, "お昼だね～\nおせちがあるから\nキミも食べるでしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7863, 3, 2, 1, 0, 128401, 1, 3, "そろそろ寝る時間だね\n今日はどんな夢を\n見られるかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7865, 2, 3, 1, 0, 128401, 1, 0, "いい座り心地～\n寝正月で過ごすのも\n最高なのだ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7866, 3, 3, 1, 0, 128401, 1, 0, "かわいいな～\n癒されてぐっすり\n眠れそうだよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7867, 4, 3, 1, 0, 128401, 1, 0, "いい香り～\nリラックスすると\n眠たくなっちゃうよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7868, 5, 3, 1, 0, 128401, 1, 0, "ポカポカいい気持ち～\n初日の出の温もりを\n思い出しちゃうな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7870, 7, 3, 1, 0, 128401, 1, 0, "もぐもぐ、おいし～\nでもいっぱい食べたら\n眠くなっちゃった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7871, 8, 3, 1, 0, 128401, 1, 0, "ふむふむ\nお正月料理も\n色々あるんだね～\n今度作ってみようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7873, 103, 1, 12, 0, 106501, 1, 0, "最近カレを見てたら\n何故かおいしそうに\n思えてくるんだよな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7874, 103, 2, 12, 0, 106501, 1, 0, "手握っててくれるか？\nじゃないとオレ…\n力が抑えきれない…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7875, 1, 1, 1, 0, 128501, 1, 0, "つかの間の平和を享受\nしながらぬくぬくと\n読書に耽る…\nふふ、最高だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7876, 2, 1, 1, 0, 128501, 1, 0, "お正月飾りなんて\n置いたらはしゃいでる\nように見えるかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7877, 3, 1, 1, 0, 128501, 1, 0, "ま、まずい…\n一人遊びしすぎて\nお正月遊びをほぼ\n極めつつある…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7878, 4, 1, 1, 0, 128501, 1, 0, "ミステリーは\n時と場所を選ばない\nつまり…新年でも\n探偵は休まないよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7879, 5, 1, 1, 0, 128501, 1, 0, "お世話になった人に\n年賀状でも書こうかな\n助手くん、喜んで\nくれるかな…えへへっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7880, 101, 1, 4, 0, 128501, 1, 0, "絵馬に願い事を書こう\n助手くんと一緒に\nいられますように…♪\n…は、恥ずかしいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7881, 102, 1, 8, 0, 128501, 1, 0, "助手くんはもっと\n派手な着物のほうが\n好みだったかな…？\nき、気になる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7882, 1, 2, 1, 0, 128501, 1, 0, "やあ。助手くんも\nお正月休みを\n持て余してるのかい？\nふふ、似た者同士だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7883, 2, 2, 1, 0, 128501, 1, 0, "助手くん助手くん！\n凧あげしにいこう！\n…そ、捜査の一環で");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7884, 3, 2, 1, 0, 128501, 1, 0, "着物は転びそうで\n怖いんだよなあ…\nお、押さないでね？\nフリじゃないよ！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7885, 4, 2, 1, 0, 128501, 1, 0, "ひ、人目を憚る\n本を読むなら\nみんなが帰省中の今！\nはっ！　助手くん！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7886, 101, 2, 4, 0, 128501, 1, 0, "ね、ねえ…助手くん…\n一緒に初詣いかない？\nあ、いや！　深い\n意味はないんだけど！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7887, 102, 2, 8, 0, 128501, 1, 0, "あはは…助手くんと\n一緒だと家でごろごろ\nしてるだけでも\n楽しいや…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7888, 1, 2, 1, 0, 128501, 1, 1, "ふぁ～…\nお正月休みのおかげで\n昼夜逆転中だよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7889, 2, 2, 1, 0, 128501, 1, 2, "お正月も依頼が\nひっきりなしだね\nさあ、街へ出よう！\nもちろん君も一緒にね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7890, 3, 2, 1, 0, 128501, 1, 3, "も、もっと\n近くにきてもいいよ？\n冬の夜は…寒いからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7892, 2, 3, 1, 0, 128501, 1, 0, "ううぅ～…！\nこのままじゃ\n寝正月だぁ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7893, 3, 3, 1, 0, 128501, 1, 0, "みんなが帰省中でも\nこれがあれば\n寂しくない…かな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7894, 4, 3, 1, 0, 128501, 1, 0, "うーん…♪\nお正月休みの\nリフレッシュに\nちょうどいいや♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7895, 5, 3, 1, 0, 128501, 1, 0, "ふぅ…あったまるな\n冬は寒いから\n助かるよ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7897, 7, 3, 1, 0, 128501, 1, 0, "うーん、おいしい♪\n読書のお供に\nちょうどいい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7898, 8, 3, 1, 0, 128501, 1, 0, "時間に余裕があると\n読書が進むよ\nいざ、本棚読破だ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7900, 1, 1, 1, 0, 128801, 1, 0, "この新しい力…\nさらに使いこなせる\nようになるには…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7901, 2, 1, 1, 0, 128801, 1, 0, "私に眠る属性の力…\n風の力以外には\nどんな力があるのかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7902, 3, 1, 1, 0, 128801, 1, 0, "今の私なら\nどこまでいけるのか…\nやれるだけ\nやってみよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7903, 4, 1, 1, 0, 128801, 1, 0, "風の力の制御…\n段々とコツが\n掴めてきたな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7904, 5, 1, 1, 0, 128801, 1, 0, "風の力か…\n応用の幅は広そうだ\n何ができそうか\n色々試してみよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7905, 101, 1, 4, 0, 128801, 1, 0, "今度、私とキミで\n料理対決でもする？\n簡単には負けないよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7906, 102, 1, 8, 0, 128801, 1, 0, "この胸に溢れる\n温かな気持ちは…\nきっと彼への…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7907, 1, 2, 1, 0, 128801, 1, 0, "一段と剣技が\n冴えてきたような…\nいや…油断禁物だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7908, 2, 2, 1, 0, 128801, 1, 0, "かっこいいって？\nありがとう…そんなに\n真っすぐ褒められると\n照れてしまうな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7909, 3, 2, 1, 0, 128801, 1, 0, "どれほど厚い壁が\n立ち塞がろうと\n打ち破ってみせる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7910, 4, 2, 1, 0, 128801, 1, 0, "手が空いてるなら\n剣の稽古に少し\n付き合ってくれるかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7911, 101, 2, 4, 0, 128801, 1, 0, "試練を乗り越えて…\n私の中にあるものが\nはっきりと分かったよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7912, 102, 2, 8, 0, 128801, 1, 0, "キミから流れてくる\n力の温かさ…これが\n私たちの絆なんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7913, 1, 2, 1, 0, 128801, 1, 1, "朝だよ、そろそろ\n起きる時間だ\nそれとも私に起こして\nほしいのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7914, 2, 2, 1, 0, 128801, 1, 2, "昼食は私が作るよ\nリクエストはある？\nできる範囲で応えるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7915, 3, 2, 1, 0, 128801, 1, 3, "おやすみ。また明日も\n一緒に冒険しよう\n約束だよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7917, 2, 3, 1, 0, 128801, 1, 0, "休める時は休む…\n戦い続けるには\n必要なことだからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7918, 3, 3, 1, 0, 128801, 1, 0, "心の安らぎの大切さ…\nそれを知れたのは\nキミたちのおかげだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7919, 4, 3, 1, 0, 128801, 1, 0, "気持ちが落ち着くな…\nこの香り、風の力で\n纏えたりしないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7920, 5, 3, 1, 0, 128801, 1, 0, "暖まった空気の流れ…\n以前より風の変化に\n気づくようになったな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7922, 7, 3, 1, 0, 128801, 1, 0, "この味付け…\n今度試してみようか\n味見は任せたからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7923, 8, 3, 1, 0, 128801, 1, 0, "心技体、すべてを\n鍛えるには座学も\n必要だからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7925, 1, 1, 1, 0, 128901, 1, 0, "瞑想するのに\nいいところはあるかな\n集中できて…お昼寝は\n我慢できるところ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7926, 2, 1, 1, 0, 128901, 1, 0, "ここにはあったかい\n空気が流れてるなぁ…\nみんなが受け入れて\nくれるおかげだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7927, 3, 1, 1, 0, 128901, 1, 0, "まるで心の中に\n光が満ちてるみたい…\nこの気持ち、みんなに\nおすそ分けしたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7928, 4, 1, 1, 0, 128901, 1, 0, "この衣装は属性の力を\n反映しやすいんだよね\nキラキラしてるのも\n納得だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7929, 5, 1, 1, 0, 128901, 1, 0, "エルフの里のみなさん\n元気かなぁ…\nまた会いに行きたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7930, 101, 1, 4, 0, 128901, 1, 0, "まだ変身できてる…\nわたしと騎士クンの\n修行の成果\n出てるなぁ…ふふっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7931, 102, 1, 8, 0, 128901, 1, 0, "この服を脱いだら\nどうなるのかな…\nた、試す勇気は\nないけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7932, 1, 2, 1, 0, 128901, 1, 0, "ふぅ…あ、騎士クン\nちょうど瞑想してたの\n一緒に…する？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7933, 2, 2, 1, 0, 128901, 1, 0, "不思議だけど\nいつの間にか\n出たり消えたりするの\n…背中の輪っか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7934, 3, 2, 1, 0, 128901, 1, 0, "この服って肌触りが\nとってもいいんだよ\nさ、触ってみる？\nスベスベだよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7935, 4, 2, 1, 0, 128901, 1, 0, "アストラルの力…\nすごく持続できてるね\n修行の成果が出てるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7936, 101, 2, 4, 0, 128901, 1, 0, "この力があれば\n暗いところで\n落とし物をしても\n見つけやすいかも…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7937, 102, 2, 8, 0, 128901, 1, 0, "冒険の準備なら\nできてるよ\nいつでも声をかけてね\n…楽しみにしてる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7938, 1, 2, 1, 0, 128901, 1, 1, "おはよう騎士クン\n一緒にお散歩とか…\nどうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7939, 2, 2, 1, 0, 128901, 1, 2, "お昼ご飯のあとの\n瞑想って難しいんだよ\n眠くなっちゃって…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7940, 3, 2, 1, 0, 128901, 1, 3, "夜ふかしさんは\nほどほどにね？\n一日頑張った自分を\n休ませてあげないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7942, 2, 3, 1, 0, 128901, 1, 0, "のんびりしてたら\nケーキが食べたく\nなっちゃうなぁ…\nでも太る…よね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7943, 3, 3, 1, 0, 128901, 1, 0, "わあ、かわいい…！\n見てるだけで\nにやけちゃう…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7944, 4, 3, 1, 0, 128901, 1, 0, "これは…花の香りかな\n知ってる花かも…？\n当ててみようっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7945, 5, 3, 1, 0, 128901, 1, 0, "あったかいと\nどうしてこんなに\n落ち着くんだろう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7947, 7, 3, 1, 0, 128901, 1, 0, "食べ過ぎたらお腹が\n目立っちゃうかもって\n分かってるのに…！\n止められないよ～っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7948, 8, 3, 1, 0, 128901, 1, 0, "こ、恋の精霊とか\nいたりするのかな…？\nはっ！　ダメダメっ！\n実力で頑張らないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7950, 1, 1, 1, 0, 128701, 1, 0, "お部屋の中でも\n修行、修行っ♪\nでも燃やさないように\n注意しなきゃだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7951, 2, 1, 1, 0, 128701, 1, 0, "うーん…この衣装\n厚着か薄着か\nどっちなんだろう…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7952, 3, 1, 1, 0, 128701, 1, 0, "いつもの肉球がない分\nお片付けしやすいな♪\n騎士くんのお部屋\nピカピカにしとこー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7953, 4, 1, 1, 0, 128701, 1, 0, "お休みは騎士くんと\nＢＢＱに行きたいなー\nあたしと一緒なら\n火の心配はいらないよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7954, 5, 1, 1, 0, 128701, 1, 0, "この姿ならもっと\n人を助けられる…！\nえへへっ！\n燃えてきたーーっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7955, 101, 1, 4, 0, 128701, 1, 0, "騎士くんが帰ったら\nアイラみたいな笑顔で\nお疲れさまさまって\nお出迎えしよっと…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7956, 102, 1, 8, 0, 128701, 1, 0, "この姿の時、いつも\n胸が熱く燃えてるのは\nずっと騎士くんのこと\n考えてるからかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7957, 1, 2, 1, 0, 128701, 1, 0, "騎士くん騎士くん！\nあたしに触れると\nやけどしちゃうよ…？\nなんちゃってー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7958, 2, 2, 1, 0, 128701, 1, 0, "おっ、騎士くん\n修行に行きたいの？\nえへへっ、いいねー♪\n二人で燃えちゃおー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7959, 3, 2, 1, 0, 128701, 1, 0, "そうだ騎士くん\nじゃんけんしよっか？\nグローブ外してるから\nチョキも出せるよっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7960, 4, 2, 1, 0, 128701, 1, 0, "この姿でいられる時間\nすごく増えてきた…！\nえへへ！　あたしたち\n修行の成果出てるね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7961, 101, 2, 4, 0, 128701, 1, 0, "じっと見つめないでよ\n顔が真っ赤に…やば！\nほんとに顔から\n火噴いちゃいそう…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7962, 102, 2, 8, 0, 128701, 1, 0, "火には強くなれても\n騎士くんに触られた\nほっぺはずーっと\n熱くてたまんないや…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7963, 1, 2, 1, 0, 128701, 1, 1, "おはよー騎士くん！\n今日も一日\n燃え滾っていくよー！\nファイヤーッ！！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7964, 2, 2, 1, 0, 128701, 1, 2, "騎士くんお昼だよ！\nちゃんとご飯食べて\n午後からの修行も\n乗り切ろうねー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7965, 3, 2, 1, 0, 128701, 1, 3, "今日もお疲れさま！\nそうだ、寝る前に\nキャンプファイヤー\n囲んじゃおっか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7967, 2, 3, 1, 0, 128701, 1, 0, "ぼふーんっ！\nえへへ、気持ちいい…\n修行の前に\nちょっと休憩ー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7968, 3, 3, 1, 0, 128701, 1, 0, "かわいいな～♪\nなでなでなでなでなで\nなでなでなでなでっ！\nあははっ、摩擦熱！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7969, 4, 3, 1, 0, 128701, 1, 0, "ん～いい香り♪\n少し熱したほうが\n香りが広がるね…って\n蒸発しちゃった！！！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7970, 5, 3, 1, 0, 128701, 1, 0, "外でも自分の火で\nあったまれるけど\nお部屋でぬくぬく\nするのが一番だよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7972, 7, 3, 1, 0, 128701, 1, 0, "もぐもぐっ！\nお腹が減っては\n人助けはできずっ！\nもぐもぐもぐっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7973, 8, 3, 1, 0, 128701, 1, 0, "ふむふむ…\nなるほどなるほど…\n…これが上手な\nＢＢＱのやり方か…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7975, 1, 1, 1, 0, 129001, 1, 0, "…壁も扉も柱も\n全て記録で見たまま\n本当に…来ているのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7976, 2, 1, 1, 0, 129001, 1, 0, "…騒がしい場所\n騎士クンが受け入れて\nくれるのをいいことに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7977, 3, 1, 1, 0, 129001, 1, 0, "ここが…騎士クンの\n守りたかった場所\n騎士クンの思い出が\n詰まった場所…ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7978, 4, 1, 1, 0, 129001, 1, 0, "視線を感じる…\nこちらの様子を\n探るような…心の動き\n取るに足らないけれど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7979, 5, 1, 1, 0, 129001, 1, 0, "…そこかしこで…\n言葉にもしたくない\n相手が過ごしていた\n記録を思い出す…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7980, 101, 1, 4, 0, 129001, 1, 0, "人は多いけれど…\n雪深い山中よりは\n過ごしやすい…か");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7981, 102, 1, 8, 0, 129001, 1, 0, "自覚したことは\nあまりなかったけれど\nひどく…諦めの悪い女\nなのかもしれない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7982, 1, 2, 1, 0, 129001, 1, 0, "お招きありがとう\nそれで…何をして\nいればいい…かな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7983, 2, 2, 1, 0, 129001, 1, 0, "ここは…明るいね\nわたしの城と比べると\nなんだか眩しいくらい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7984, 3, 2, 1, 0, 129001, 1, 0, "仮面はもう必要ないよ\nだって…わたしの顔を\n騎士クンに見て\nもらえなくなるから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7985, 4, 2, 1, 0, 129001, 1, 0, "騎士クンさえよければ\nわたしの城に専用の\n部屋を用意するよ\n…いつでも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7986, 101, 2, 4, 0, 129001, 1, 0, "…騎士クンのマント\nまた貸してほしいな\nきれいに使うから\n…だめ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7987, 102, 2, 8, 0, 129001, 1, 0, "いつか二人の願いが\n重なり合えるって…\n信じているね\n…いつまでだって…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7988, 1, 2, 1, 0, 129001, 1, 1, "おはよう、騎士クン\n…昨日は夢の中で\nお話ししすぎちゃって\nごめんね。ふふっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7989, 2, 2, 1, 0, 129001, 1, 2, "お腹は…空いてない？\n食べ物はないけれど\n空腹を忘れる魔法なら\nかけてあげられるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7990, 3, 2, 1, 0, 129001, 1, 3, "騎士クン…\nまだ、眠らないの？\n…そう。それなら…\nわたしも起きているね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7992, 2, 3, 1, 0, 129001, 1, 0, "肩の力を抜くには…\nまだ時間がかかりそう\nきっと…騎士クンと\n二人きりなら別なのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7993, 3, 3, 1, 0, 129001, 1, 0, "ぺんぽこりん…\nそう、確かあれも\nこんな感じだった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7994, 4, 3, 1, 0, 129001, 1, 0, "花の香りは…好き\nつかの間\n心を穏やかに\nしてくれるから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7995, 5, 3, 1, 0, 129001, 1, 0, "あたたかい…けれど\n騎士クンの優しさに\n比べれば、まだまだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7997, 7, 3, 1, 0, 129001, 1, 0, "おい、しい…？\nこの感覚が、それ？\nなぜか…納得できる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (7998, 8, 3, 1, 0, 129001, 1, 0, "情報を入手するには\nわざわざ本を開く\n必要があるだなんて…\nプレイヤーは面倒ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8000, 1, 1, 1, 0, 129301, 1, 0, "メルクリゾートか…\n良い記憶はないな\nよし忘れよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8001, 2, 1, 1, 0, 129301, 1, 0, "知性の戦士ユニ！\nその恐るべき筋力！\nふおお！　うにゃー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8002, 3, 1, 1, 0, 129301, 1, 0, "ぽーん！\n石用の水着ください！\nセクシーロゼッタが、\n渚の視線を独占です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8003, 4, 1, 1, 0, 129301, 1, 0, "学院から奨学金を\n勝ち取るより某財団を\nだまくらかした方が\n早い気がしてきたな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8004, 5, 1, 1, 0, 129301, 1, 0, "わんつぅ、わんつぅ…\nんぎゃあ足攣ったー！\nおのれカルミナとやら\n絶対に許さん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8005, 101, 1, 4, 0, 129301, 1, 0, "ところで…なぜぼくは\nプールでもないのに\n水着のままなんだ…\nおのれ世界め！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8006, 102, 1, 8, 0, 129301, 1, 0, "彼と二人で撮った動画\nうう、凝視に耐えん…\nなんだこのムズ痒さは");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8007, 1, 2, 1, 0, 129301, 1, 0, "なに？　水着姿で\n寒くないのかだと？\n普段からもっと薄着の\n娘が沢山いるだろう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8008, 2, 2, 1, 0, 129301, 1, 0, "シノブ君にメリゾの\n招待状を送ったのだが\n御尊父の暴走を\n心配していたな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8009, 3, 2, 1, 0, 129301, 1, 0, "ミミ君らにメリゾの\n招待状を送ったのだよ\n迎える準備をせねば…\nおしゃぶり持ってる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8010, 4, 2, 1, 0, 129301, 1, 0, "本質の賢者…？\nいや元気にしているが\nなぜ君がぼくの身内を\n知っているんだ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8011, 101, 2, 4, 0, 129301, 1, 0, "水着が似合ってる？\nな、なんだね突然…\nやめたまえよふひひ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8012, 102, 2, 8, 0, 129301, 1, 0, "今度は夏にメリゾへ\n行きたいものだ\nむろん君も一緒だぞ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8013, 1, 2, 1, 0, 129301, 1, 1, "ぐああっ、朝陽が…！\n朝陽が昇っている…！\n夜行性ユニ死んじゃう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8014, 2, 2, 1, 0, 129301, 1, 2, "はぁ…もう昼か…\nそろそろ寝ないとな\n規則正しい生活を\nしないと不健康だ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8015, 3, 2, 1, 0, 129301, 1, 3, "ひゃっはー、夜だー！\nオレたちの時間だぜ！\nふおおブチ上がり～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8017, 2, 3, 1, 0, 129301, 1, 0, "これは…ぼくにここで\n寝ろということか？\n一向に構わんが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8018, 3, 3, 1, 0, 129301, 1, 0, "きゃっきゃっ！\nこれかわい～！\n…よし、今日も\n子供の擬態完璧だな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8019, 4, 3, 1, 0, 129301, 1, 0, "ふむ、良い香りだ\nだがそれだけか…\nとくに精神高揚効果は\nないのか…ちぇー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8020, 5, 3, 1, 0, 129301, 1, 0, "火を見ていると…\n魔導罐を思いだすな…\nかに座、元気かな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8022, 7, 3, 1, 0, 129301, 1, 0, "ええい、\n固形食物はいらん！　\nポーションを出せ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8023, 8, 3, 1, 0, 129301, 1, 0, "やはり書は文系に限る\nなんと心地よい筆致…\nぐああ突然理系文が！\nひぃ目が理系になる！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8025, 10, 3, 1, 0, 129301, 1, 0, "ほああ～！\n知性の海上騎士ユニ！\nこれは新たな可能性！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8026, 11, 3, 1, 0, 129301, 1, 0, "これは…なんだ？\n何が面白いんだ？\n難しいな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8027, 103, 1, 12, 0, 108901, 1, 0, "大切な人と過ごす\n正月の思い出、か…\n昔の私だったら\n考えられなかったな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8028, 103, 2, 12, 0, 108901, 1, 0, "叶えたい願いなら\nたくさんあるよ\nそれでも一番を選ぶ\nなら、やはりキミと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8029, 103, 1, 12, 0, 108801, 1, 0, "神殿にあった\n恋愛おみくじ…\n引いてみようかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8030, 103, 2, 12, 0, 108801, 1, 0, "騎士クン。来年も\nまた一緒におみくじ\n結ぼうね。約束だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8031, 103, 1, 12, 0, 108701, 1, 0, "今度は騎士くんと\n一緒にうつった写真、\nおばあちゃんに\n送ろうっと♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8032, 103, 2, 12, 0, 108701, 1, 0, "あ、騎士くん！\n今年も…ううん\nこれからも、よろしく\nおねがいします♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8033, 1, 1, 1, 0, 129401, 1, 0, "旧校舎の地下牢…\n真冬のサマー計画…\n等身大のＰＲ…\nうッ、頭が…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8034, 2, 1, 1, 0, 129401, 1, 0, "暇だし鏡でも見るか。\nお、いい腹筋育って…\nあ？　何見てんだコラ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8035, 3, 1, 1, 0, 129401, 1, 0, "オレは金色の疾風！\nんん…なんか違うな。\n我が名は金色の…\nあ？　何見てんだコラ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8036, 4, 1, 1, 0, 129401, 1, 0, "モニカとユニ先輩って\n口調と身長似てるけど\n子供扱いに対する\n反応は真逆だよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8037, 5, 1, 1, 0, 129401, 1, 0, "シオリン元気かな…\n昔くちゃくちゃに\n撫でくり回して\n嫌がられたっけなァ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8038, 101, 1, 4, 0, 129401, 1, 0, "べつにいんだけどさ…\nあんたの知り合いって\n普段から水着みたいな\nカッコの女多くない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8039, 102, 1, 8, 0, 129401, 1, 0, "そだ、弟らがあんたに\n会いたがってたンだ。\n暇だったらいつでも\nウチ来てやってよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8040, 1, 2, 1, 0, 129401, 1, 0, "特別講座は色々あった\nけど…メリゾ自体は\nまあ悪くなかったよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8041, 2, 2, 1, 0, 129401, 1, 0, "水着と合わせる小物に\nセンス出るよね、\nって話をミィコ先輩が\nしててマジわかりみ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8042, 3, 2, 1, 0, 129401, 1, 0, "水着のミフユねえさん\nやっぱ仕上がってたね\nあれが竜殺しの体か…\nバリかっけーな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8043, 4, 2, 1, 0, 129401, 1, 0, "はにょんっ！？\nや、だからさ…\n後ろから声かけんな、\nつってンじゃん…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8044, 101, 2, 4, 0, 129401, 1, 0, "メリゾの特別講座が\n上手くいったのも\n敏腕カメラマンがいた\nお陰だよ。ありがとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8045, 102, 2, 8, 0, 129401, 1, 0, "あ？　この水着が？\n似合っ…え、なんて？\nごめ、聞こえんくて。\nもっかい言ってみて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8046, 1, 2, 1, 0, 129401, 1, 1, "もう朝とかマジないわ\n昨日二人に付き合って\nオールでカラオケだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8047, 2, 2, 1, 0, 129401, 1, 2, "はぁ授業行かなきゃ…\n真っ昼間から勉強とか\nマジつらたん過ぎ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8048, 3, 2, 1, 0, 129401, 1, 3, "今日これから夜勤で…\nいやバイトちゃーくて\nボランティアの話よ？\n校則違反よくない");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8050, 2, 3, 1, 0, 129401, 1, 0, "うわ、ふっかふか…\nオニほど安らぐわ…\nやば、ユニってくる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8051, 3, 3, 1, 0, 129401, 1, 0, "うちも妹いりゃ\nこーゆーのもなァ…\nま自分用でもいいか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8052, 4, 3, 1, 0, 129401, 1, 0, "ふーん…\nいいじゃんこの香り\n抜群に嗅げるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8053, 5, 3, 1, 0, 129401, 1, 0, "うちン家のルーツの森\n大火災でなくなった\nらしンだよね…\n生まれる前の話だけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8055, 7, 3, 1, 0, 129401, 1, 0, "何コレありがてぇー\n食料ほくほく過ぎて草\n米ガチで尊いわァ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8056, 8, 3, 1, 0, 129401, 1, 0, "いいけど、なんでうち\n水着で本読んでンだよ\nどーゆープレイだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8058, 10, 3, 1, 0, 129401, 1, 0, "金色の海上騎士クロエ\n推して参る！　覇ァ！\nあ？　何見てんだコラ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8059, 11, 3, 1, 0, 129401, 1, 0, "何コレ、貝の椅子？\nどーやって遊ぶんだ…\nいや座って終わりか…\nまァそりゃそーか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8060, 1, 1, 1, 0, 129801, 1, 0, "さてと…\n明日の訓練メニュー\n考えねえとな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8061, 2, 1, 1, 0, 129801, 1, 0, "また新入りの女子に\n弁当もらっちまった…\nありがたく食うけどよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8062, 3, 1, 1, 0, 129801, 1, 0, "種族なんて関係なく\nみんなが力を合わせて\nランドソルを守る…\nいい時代になったよな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8063, 4, 1, 1, 0, 129801, 1, 0, "誰にだって長所はある\n新入りのいいところを\n見つけてやるのも\n教官の仕事だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8064, 5, 1, 1, 0, 129801, 1, 0, "厳し過ぎても\n甘過ぎてもダメ…\n教官ってのは難しいぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8065, 101, 1, 4, 0, 129801, 1, 0, "戦いが苦手な新入りを\nどうフォローするか…\n後であいつと\n相談してみるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8066, 102, 1, 8, 0, 129801, 1, 0, "あいつは優し過ぎて\n戦いに向いてねえ\n…そういう甘さ\n嫌いじゃねえけどな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8067, 1, 2, 1, 0, 129801, 1, 0, "強くなる近道はねえ\n地道な鍛錬あるのみだ\nさ、訓練始めるぞ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8068, 2, 2, 1, 0, 129801, 1, 0, "新入りにも\nいつも言ってるが…\n装備の手入れは\n念入りにしろよな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8069, 3, 2, 1, 0, 129801, 1, 0, "座学も受けてえのか？\nいい心がけだな！\nなんでも教えてやるよ\n…魔法以外ならな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8070, 4, 2, 1, 0, 129801, 1, 0, "新入りたちがよく\n恋バナしててな…\nお、おまえは…誰か\n気になるやついるか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8071, 101, 2, 4, 0, 129801, 1, 0, "なあ、ストレッチ\n手伝ってくれねえか？\n訓練前にしっかり\n筋肉ほぐさねえと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8072, 102, 2, 8, 0, 129801, 1, 0, "ずいぶん頑張って\n鍛えたよな、おまえ\nよし！　ご褒美に\nお菓子作ってやるよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8073, 1, 2, 1, 0, 129801, 1, 1, "訓練日和だな！\nさぁて…まずは\n走り込みといくか！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8074, 2, 2, 1, 0, 129801, 1, 2, "昼飯はしっかり食えよ\nでなきゃ、\nこの後もたねえぜ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8075, 3, 2, 1, 0, 129801, 1, 3, "とっくに消灯時間だ\nさっさと寝な？\n明日も早いんだからよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8077, 2, 3, 1, 0, 129801, 1, 0, "休むのも訓練のうちだ\n今はのんびり\nさせてもらうぜ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8078, 3, 3, 1, 0, 129801, 1, 0, "いい面構えだ\n気に入ったぜ！\nあたしの班に入るか？\n…なんてな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8079, 4, 3, 1, 0, 129801, 1, 0, "…いやされる匂いだな\n新入りたちにも\nすすめてみるか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8080, 5, 3, 1, 0, 129801, 1, 0, "あったけえからって\n寝ないようにしねえと\n教官としての\n威厳に関わるからな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8082, 7, 3, 1, 0, 129801, 1, 0, "食事も訓練の一環だ\nとはいえ食い過ぎには\n気をつけねえと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8083, 8, 3, 1, 0, 129801, 1, 0, "トーゴクの剣術…か\nなにか訓練に\n活かせるかもしれねえ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8085, 1, 1, 1, 0, 129901, 1, 0, "あのおかたに近付く\n不埒な輩には、特別な\n訓練で地獄を見て\nいただきましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8086, 2, 1, 1, 0, 129901, 1, 0, "これだけ広ければ\n多少派手に\n動き回っても\n問題なさそうですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8087, 3, 1, 1, 0, 129901, 1, 0, "…今誰か私を\n「鬼」教官と\n呼びませんでしたか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8088, 4, 1, 1, 0, 129901, 1, 0, "新しく開発したこの薬\n誰か試してくれる人は\nいませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8089, 5, 1, 1, 0, 129901, 1, 0, "厳しくすれば投げ出し\n優しくすればサボる\n人というのはどこまで\n度し難いのでしょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8090, 101, 1, 4, 0, 129901, 1, 0, "はじめましょう\nあのおかたの心を\n射貫くための\nシミュレーションを");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8091, 102, 1, 8, 0, 129901, 1, 0, "あらゆる苦難と\n忌々しい女から守る\nためにも、私自身も\n鍛えておかねば");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8092, 1, 2, 1, 0, 129901, 1, 0, "あなた様、そんなに\n見つめられると…え？\nエリコはカッコいい？\nええ、当然ですとも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8093, 2, 2, 1, 0, 129901, 1, 0, "不調があればすぐ\n報告してください\n体のケアも教官の\n大事な役目ですので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8094, 3, 2, 1, 0, 129901, 1, 0, "新しい訓練器具の\n使い心地はどう…え？\n重すぎる？　これでも\n軽くしたのですが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8095, 4, 2, 1, 0, 129901, 1, 0, "運動後には特製の\n栄養ドリンクをどうぞ\nクスクス、何も\n入れたりしてませんわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8096, 101, 2, 4, 0, 129901, 1, 0, "よくがんばりました\nあなた様。あぁ…\nお疲れになったお顔も\n素敵ですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8097, 102, 2, 8, 0, 129901, 1, 0, "あなた様、二人だけの\n遠征訓練へ\nまいりましょう。\n既に準備万端ですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8098, 1, 2, 1, 0, 129901, 1, 1, "まだ眠いですか？\nならばストレッチで\n体を痛めつ…ではなく\nほぐしていきましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8099, 2, 2, 1, 0, 129901, 1, 2, "お昼はお弁当をご用意\nいたしました。量も\nスタミナも増し増し\n残さず食べてください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8100, 3, 2, 1, 0, 129901, 1, 3, "よい睡眠こそ健やかな\n体に不可欠。ですので\n私が寝ずの番をさせて\nいただきますわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8102, 2, 3, 1, 0, 129901, 1, 0, "休憩用に使おうと思い\nましたが、心地よくて\n立てなくなって\nしまいますわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8103, 3, 3, 1, 0, 129901, 1, 0, "中に重しを詰めれば\n愛でながら運動が\n可能ですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8104, 4, 3, 1, 0, 129901, 1, 0, "香りでリラックスさせ\n同時に暗示を\nかけてみましょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8105, 5, 3, 1, 0, 129901, 1, 0, "…くっ、眠気を誘う\nこの暖かさ…\n油断も隙もありません");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8107, 7, 3, 1, 0, 129901, 1, 0, "主食はこちらで十分\nまかなえますわね\nそれでは私はおかずを\n作りましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8108, 8, 3, 1, 0, 129901, 1, 0, "まあ、実用書の類も\n揃っているのですね\nとても助かりますわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8110, 1, 1, 1, 0, 129601, 1, 0, "……（そわそわ）");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8111, 2, 1, 1, 0, 129601, 1, 0, "ここに寄らずの花陣…\n作ったらダメですよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8112, 3, 1, 1, 0, 129601, 1, 0, "部屋の隅が\n落ち着きます\nそれか、陽の当たる所");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8113, 4, 1, 1, 0, 129601, 1, 0, "身を隠せる場所が\nあると…\n助かるんですけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8114, 5, 1, 1, 0, 129601, 1, 0, "複雑な造りの家ですね\n触って壊れたり─\nしませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8115, 101, 1, 4, 0, 129601, 1, 0, "出入りするひと\nみんな、笑顔…\n…変わった家ですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8116, 102, 1, 8, 0, 129601, 1, 0, "この家なら安全─\nかもしれません\n魔物が出ないので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8117, 1, 2, 1, 0, 129601, 1, 0, "これも、視察の一環\n遊びに来たわけじゃ\nないです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8118, 2, 2, 1, 0, 129601, 1, 0, "長話─苦手です\n疲れるので…\nふぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8119, 3, 2, 1, 0, 129601, 1, 0, "ここで友達を作れと\nネアさんが…\nそう、言われても…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8120, 4, 2, 1, 0, 129601, 1, 0, "世話をするのは\n得意です\n…花の、ですよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8121, 101, 2, 4, 0, 129601, 1, 0, "媛へのお土産を\n探してるんですけど…\n…貴方のおすすめ、\n聞いておきます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8122, 102, 2, 8, 0, 129601, 1, 0, "平和でのんきで…\n貴方らしい家です\n一応、褒めてます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8123, 1, 2, 1, 0, 129601, 1, 1, "花に、お水─？\n…いりません");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8124, 2, 2, 1, 0, 129601, 1, 2, "日が高いうちは\nむやみに外へ出ません\n面倒事、多いので…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8125, 3, 2, 1, 0, 129601, 1, 3, "夜番。私がします\nあまり眠らない\n性質なので…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8127, 2, 3, 1, 0, 129601, 1, 0, "ここなら根を張れる\nかもしれません\n…張りませんけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8128, 3, 3, 1, 0, 129601, 1, 0, "こんなにやわな体じゃ\n身を守れませんよ─\n…あ。生き物じゃ\nないんですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8129, 4, 3, 1, 0, 129601, 1, 0, "花みたいに─\nいい匂い、です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8130, 5, 3, 1, 0, 129601, 1, 0, "火を見てると、\nジオ・ゲヘナを\n思い出します…ふぅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8132, 7, 3, 1, 0, 129601, 1, 0, "食事も立派な戦支度\n媛が言ってました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8133, 8, 3, 1, 0, 129601, 1, 0, "知識も武器の一つだと\n媛が…でも、\nこれでどうやって…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8135, 1, 1, 1, 0, 130701, 1, 0, "天気もいいしお花畑に\nピクニックでも\n行こうかな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8136, 2, 1, 1, 0, 130701, 1, 0, "あ、どこからか\nお花の匂いが…\nいい香りですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8137, 3, 1, 1, 0, 130701, 1, 0, "新しいシャベルとか\nじょうろもほしいなぁ\nお小遣いしっかり\nためないとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8138, 4, 1, 1, 0, 130701, 1, 0, "お花飾りたいけど\n花瓶はどこかな…\nあとであの人に\n聞いてみよっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8139, 5, 1, 1, 0, 130701, 1, 0, "お花の観察日記\n書かなきゃ\n日々勉強は\n欠かせませんよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8140, 101, 1, 4, 0, 130701, 1, 0, "衣装にお花を足して\nみたけど、あの人\n気付いてくれるかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8141, 102, 1, 8, 0, 130701, 1, 0, "この花冠、上手に\n作れたかも…\n日頃のお礼にあの人に\nあげようかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8142, 1, 2, 1, 0, 130701, 1, 0, "あなたは何のお花が\n好きですか？　ほら、\n一応知っておいたら\n役に立つかもですし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8143, 2, 2, 1, 0, 130701, 1, 0, "そのお花、乱暴に\n扱っちゃダメですよ\n花粉が服について\nとれなくなりますから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8144, 3, 2, 1, 0, 130701, 1, 0, "土いじりしたから\n服が汚れてますよ\nはたいてあげますから\nじっとしててください");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8145, 4, 2, 1, 0, 130701, 1, 0, "そんなにすぐに芽は\n出ませんよ\nまあ、楽しみなのは\n私も同じですけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8146, 101, 2, 4, 0, 130701, 1, 0, "この衣装、そんなに\n気になります？　なら\nこうしてお花を\n着ければおそろいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8147, 102, 2, 8, 0, 130701, 1, 0, "お花の種を私に？\nありがとうございます\nせっかくなので一緒に\nお世話しませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8148, 1, 2, 1, 0, 130701, 1, 1, "お花にお水をあげるの\n手伝ってもらえます？\nお水は朝にあげるのが\nいいんですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8149, 2, 2, 1, 0, 130701, 1, 2, "とっておきのお花見\nスポットに\nご案内しますよ\nお弁当も忘れずに！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8150, 3, 2, 1, 0, 130701, 1, 3, "もうこんな時間\n早く寝ましょう\n草木も眠るなんとか\nって言いますからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8152, 2, 3, 1, 0, 130701, 1, 0, "お花のお手入れって\nけっこう疲れますね…\nここでちょっと一息\nしちゃおっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8153, 3, 3, 1, 0, 130701, 1, 0, "耳にお花を着ければ…\nえへへ、すっごく\nかわいくなったね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8154, 4, 3, 1, 0, 130701, 1, 0, "これはラベンダー\nこっちはミモザ\nフローラル系の香り\nっていいですねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8155, 5, 3, 1, 0, 130701, 1, 0, "ポカポカしますね～\nまるで春の陽気\nみたいです～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8157, 7, 3, 1, 0, 130701, 1, 0, "お花を一輪さすだけで\nご飯の時間がとても\n華やかになりますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8158, 8, 3, 1, 0, 130701, 1, 0, "お花の本が\nいっぱいある！\n今日はこれで\nお勉強です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8160, 1, 1, 1, 0, 130801, 1, 0, "ふんふ～ん♪\n華やかな服を着ると\n心がウキウキします♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8161, 2, 1, 1, 0, 130801, 1, 0, "花祭りで出会った\nみなさん…\nお元気でしょうか？\nまたお会いしたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8162, 3, 1, 1, 0, 130801, 1, 0, "はっ！　そうでした\nこの服の時は\nメイドのお仕事は\nお休みでした…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8163, 4, 1, 1, 0, 130801, 1, 0, "この服は替えが\nありませんから\n大きなドジには\n気を付けないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8164, 5, 1, 1, 0, 130801, 1, 0, "目立ったほつれもなし\n…うん、いい感じに\n補修できました♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8165, 101, 1, 4, 0, 130801, 1, 0, "メイド姿でなくても\n心はいつでも\nお嬢さまの\nメイドです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8166, 102, 1, 8, 0, 130801, 1, 0, "この服を着ると心が\n浮き立つのはあのかた\nと一緒にいる気持ちに\nなるからでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8167, 1, 2, 1, 0, 130801, 1, 0, "はい、今日は一日\nこの服で過ごそうと\n思います\n変じゃないですよね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8168, 2, 2, 1, 0, 130801, 1, 0, "花祭りのおかげで\n少しだけお花に\n詳しくなった…\nような気がします！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8169, 3, 2, 1, 0, 130801, 1, 0, "花祭り、今度は\nお嬢さまと救護院の\nみんなと一緒に\n行ってみたいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8170, 4, 2, 1, 0, 130801, 1, 0, "今度キョウカちゃんと\n花祭りの服でお花を\n見にお出かけ\nするんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8171, 101, 2, 4, 0, 130801, 1, 0, "メイド服を全部洗濯\nしちゃうなんて…\nドジっちゃいましたぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8172, 102, 2, 8, 0, 130801, 1, 0, "花祭りの服は私たちの\n思い出の服ですから…\nこれからも\n大切にします♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8173, 1, 2, 1, 0, 130801, 1, 1, "はう、そうでした\nお花にお水を\nあげる時間です！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8174, 2, 2, 1, 0, 130801, 1, 2, "お昼ご飯は\nバスケットを持って\nお花畑に食べ\nに行きませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8175, 3, 2, 1, 0, 130801, 1, 3, "ふぁあ…繕い物を\nしていたらこんな時間\nになってしまいました\n早く寝ないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8177, 2, 3, 1, 0, 130801, 1, 0, "ふわふわしてて\nきもちいいです～\nどんな生地を\nつかってるんだろ～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8178, 3, 3, 1, 0, 130801, 1, 0, "かわいいですね～\nぬいぐるみさんにも\n服をつくって\nあげたいです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8179, 4, 3, 1, 0, 130801, 1, 0, "いい香りです～\nあれ？　もしかして\n私の服についてる花と\n同じ香りが…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8180, 5, 3, 1, 0, 130801, 1, 0, "暖かいですけど\nあまり近づいちゃうと\n頭の花飾りが乾燥\nしちゃいそうですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8182, 7, 3, 1, 0, 130801, 1, 0, "もぐもぐ…\nいい花を咲かせるには\nしっかりとした栄養が\n必要だそうです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8183, 8, 3, 1, 0, 130801, 1, 0, "なるほどなるほど…\nお花のお手入れは\n奥が深いですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8185, 1, 1, 1, 0, 131001, 1, 0, "マホマホ王国にも\nサーカス団設立や\n夢と希望を届けますえ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8186, 2, 1, 1, 0, 131001, 1, 0, "せっかくの晴れ舞台や\nかっこいいポーズも\nできるようにしたいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8187, 3, 1, 1, 0, 131001, 1, 0, "むむむむ～っ。うーん\nクルルはんみたいに\n胸から宝石を出すんは\n難しいみたいやわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8188, 4, 1, 1, 0, 131001, 1, 0, "あむっ…んん～♪\nやっぱり練習のあとは\n甘いものに限るわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8189, 5, 1, 1, 0, 131001, 1, 0, "アーサーたちの衣装も\n今のうちに考えんと…\n生地、足りるやろか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8190, 101, 1, 4, 0, 131001, 1, 0, "王子はんとなら\nどんなアイデアも\n見つけられます♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8191, 102, 1, 8, 0, 131001, 1, 0, "うちの晴れ姿が\n王子はんの目に一等\n輝いて見えますように");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8192, 1, 2, 1, 0, 131001, 1, 0, "キリっとしたうちも\nかっこいい？\nもう、上手やなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8193, 2, 2, 1, 0, 131001, 1, 0, "新しい演目考えたんよ\nなぁ王子はん、意見\n聞かせてもらえます？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8194, 3, 2, 1, 0, 131001, 1, 0, "聞いてや王子はん\n動物さんたちとさらに\n息が合うてきたんよ\nみんな頑張り屋さんや");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8195, 4, 2, 1, 0, 131001, 1, 0, "演技の感想なら\n大歓迎どすえ♪\nたんと聞かせてや～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8196, 101, 2, 4, 0, 131001, 1, 0, "王子はん、本番当日は\n最前席で見たってな\nそしたらうち、もっと\n頑張れますさかい♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8197, 102, 2, 8, 0, 131001, 1, 0, "この技をあなたに\n捧げます…なんて♪\n驚いたやろ？\nどっきり作戦成功や♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8198, 1, 2, 1, 0, 131001, 1, 1, "素敵なショーのためや\n今日も焦らず一歩ずつ\n成長していきまひょ\nな、王子はん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8199, 2, 2, 1, 0, 131001, 1, 2, "お弁当、王子はんも\n一緒にいかがどす？\nみんなで食べて団結や");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8200, 3, 2, 1, 0, 131001, 1, 3, "夜のサーカスも\n幻想的でとっても\n魅力的なんよ\n一緒にいきまひょか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8202, 2, 3, 1, 0, 131001, 1, 0, "練習が終わったあとは\nの～んびりして\n体力を回復せな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8203, 3, 3, 1, 0, 131001, 1, 0, "この子たちとなら\n空中ブランコや\n玉乗りもええなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8204, 4, 3, 1, 0, 131001, 1, 0, "いい香りやなぁ\n本番前の緊張も\n和らげてくれそうやわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8205, 5, 3, 1, 0, 131001, 1, 0, "このあったかい感じ…\nスポットライトの熱を\n思い出すわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8207, 7, 3, 1, 0, 131001, 1, 0, "ちゃんと食べへんと\nいい演技はできまへん\n団長はんも言うてたわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8208, 8, 3, 1, 0, 131001, 1, 0, "動物さんたちのことも\nもっと勉強せな\n大事な仲間やさかい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8210, 103, 1, 12, 0, 105601, 1, 0, "器用じゃないが、\n情には厚いよ\nこういう女を「一途」\nってそう言うんだろ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8211, 103, 2, 12, 0, 105601, 1, 0, "斬れないものはないと\n思ってきたさ。だけど\n…この気持ちだけは\n斬れないね、絶対に");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8212, 1, 1, 1, 0, 130901, 1, 0, "んしょ、んしょっ…！\n日頃の感謝を込めて\nヒーローさんのお家を\nきれいにしますです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8213, 2, 1, 1, 0, 130901, 1, 0, "ふむふむ…\n新アトラクションは\nこのギルドハウスを\nモチーフに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8214, 3, 1, 1, 0, 130901, 1, 0, "ごそごそ、こそこそ…\nヒーローさんに内緒で\nどこかにお礼の宝石を\n隠しておきましょう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8215, 4, 1, 1, 0, 130901, 1, 0, "パークの運営が\n落ち着いたら\nわたしもギルド活動？\nしてみたいですます♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8216, 5, 1, 1, 0, 130901, 1, 0, "こんなすてきな\nおうちに住めたら…\nいえ！　うさぎ小屋で\n十分です～っ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8217, 101, 1, 4, 0, 130901, 1, 0, "ヒーローさんのおうち\nだって意識したら\nアトラクションよりも\nドキドキしてきます…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8218, 102, 1, 8, 0, 130901, 1, 0, "ヒーローさんのことを\n考えると顔が赤く…\nこれってもしかして\nひょっとして…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8219, 1, 2, 1, 0, 130901, 1, 0, "あっ、ヒーローさん！\n話しかけてくれた記念\nということで、宝石\n受け取ってください♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8220, 2, 2, 1, 0, 130901, 1, 0, "元気がない時は\n語尾にぴょんですっ！\nさあヒーローさんも\nやってみるぴょん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8221, 3, 2, 1, 0, 130901, 1, 0, "ヒーローさんへのご恩\nおばあちゃんうさぎに\nなるまでに、お返し\nできるでしょうか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8222, 4, 2, 1, 0, 130901, 1, 0, "ヒーローさん！\n二人で一緒に\nパレードの練習\nしませんか～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8223, 101, 2, 4, 0, 130901, 1, 0, "あはは♪\nヒーローさんは\n人を笑顔にする力が\nありますです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8224, 102, 2, 8, 0, 130901, 1, 0, "ヒーローさんに\n一日一恩返しですっ！\n返し終わるまで\nやめませんですます♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8225, 1, 2, 1, 0, 130901, 1, 1, "おはようございます♪\nんしょ、んしょっ…！\n気持ちよく起きられた\n記念に宝石どうぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8226, 2, 2, 1, 0, 130901, 1, 2, "お昼にフードコートで\nかばばん君バーガー\n買ってきましたよ！\n一緒に食べますです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8227, 3, 2, 1, 0, 130901, 1, 3, "今日も一日\nお疲れさまですっ♪\nマッサージしますから\n寝そべってください♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8229, 2, 3, 1, 0, 130901, 1, 0, "はふぅ～…♪\nお仕事の疲れも\nぴょんぴょ～んって\n飛んでっちゃいます♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8230, 3, 3, 1, 0, 130901, 1, 0, "わぁっ、とっても\nかわいいですますっ！\nギルドハウスの\nマスコットですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8231, 4, 3, 1, 0, 130901, 1, 0, "ヒーローさんの好きな\n香り…これを宝石に\nつければ、受け取って\nもらえるでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8232, 5, 3, 1, 0, 130901, 1, 0, "はあ、気持ちいい♪\nヒーローさんの\n好きな温度に\n調整しときますです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8234, 7, 3, 1, 0, 130901, 1, 0, "支配人は体が資本っ！\nたくさん食べ…すぎて\n動けなくなっちゃい\nましたぁ～…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8235, 8, 3, 1, 0, 130901, 1, 0, "パークの\nガイドブックとか\nあったらいいですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8237, 1, 1, 1, 0, 131101, 1, 0, "外あつすぎ溶けるわ～\nやっぱ部屋ん中で\n水着がラクだねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8238, 2, 1, 1, 0, 131101, 1, 0, "ン～\nカリザきゅんどこー？\nもしかして逃げた？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8239, 3, 1, 1, 0, 131101, 1, 0, "ミソラちゃんと\nリリちゃん誘って\nそろそろイイコト\nしよっかなー？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8240, 4, 1, 1, 0, 131101, 1, 0, "おねえちゃんに\n頼まれたシゴトは\nまた今度にすっかー\n夏休みだしー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8241, 5, 1, 1, 0, 131101, 1, 0, "騎士きゅんの\nプリンセスフォームも\n見てみたいんだよなー\nンフ♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8242, 101, 1, 4, 0, 131101, 1, 0, "スライムを\nこーしてあーしたら\n騎士きゅんの泳ぐ\n練習に使えるっぽ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8243, 102, 1, 8, 0, 131101, 1, 0, "おかえり～♡\nって水着で迎えたら\n騎士きゅん喜んで\nくれるかなー？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8244, 1, 2, 1, 0, 131101, 1, 0, "騎士きゅん\nこのサングラス\nかけてみる？\nぜってー似合うよー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8245, 2, 2, 1, 0, 131101, 1, 0, "日焼け痛かったら\nいつでも言ってねー\nスライムでひんやり\nしてあげるよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8246, 3, 2, 1, 0, 131101, 1, 0, "今から外で\n焼いてこっかなー\n騎士きゅんもどー？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8247, 4, 2, 1, 0, 131101, 1, 0, "スライムマッサージ\nしてあげよっかー\nほーれ、もみもみ～♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8248, 101, 2, 4, 0, 131101, 1, 0, "騎士きゅんが選んだ\n水着も着てみたーい\nネアおねえちゃんに\nどんなの着てほしい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8249, 102, 2, 8, 0, 131101, 1, 0, "騎士きゅ～ん\n尻相撲しよっかー♪\nおねえちゃんに\n勝てたらご褒美だぞ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8250, 1, 2, 1, 0, 131101, 1, 1, "暑すぎてムダに\n早起きしちった～\n二度寝すっか～\n…ふぁあ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8251, 2, 2, 1, 0, 131101, 1, 2, "夏バテしても\nスイカとかかき氷なら\n全然ウェルカム\nなんだよなー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8252, 3, 2, 1, 0, 131101, 1, 3, "今日はこのまま\n水着で寝るかー\n夢ん中で泳ごー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8254, 2, 3, 1, 0, 131101, 1, 0, "いったんキューケイ…\nンー…よし\n充電カンリョ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8255, 3, 3, 1, 0, 131101, 1, 0, "仲間になりたそうに\nこっち見てんねー\nきゃわいいしおっけ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8256, 4, 3, 1, 0, 131101, 1, 0, "ン～いいニオーイ\nお日様あたった\n騎士きゅんの\n次くらいかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8257, 5, 3, 1, 0, 131101, 1, 0, "カラダ冷えてきたから\nたすかるーおかげで\nまだまだ水着イケるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8259, 7, 3, 1, 0, 131101, 1, 0, "うめ～\nとまんねぇ～\n夏バテどこいった～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8260, 8, 3, 1, 0, 131101, 1, 0, "ふむふむ…\nこれは意外と\nぬるっと読めるっぽー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8262, 10, 3, 1, 0, 131101, 1, 0, "ンフフ～\n海の戦士ってカンジ？\nアリよりのアリだね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8263, 11, 3, 1, 0, 131101, 1, 0, "あーやべ\n一瞬で寝そー\nヤバだわ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8264, 1, 1, 1, 0, 129701, 1, 0, "服や紙が易々と\n燃えぬとは\nランドソルとはまこと\n住み易き国で候");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8265, 2, 1, 1, 0, 129701, 1, 0, "どの世界にあっても\n民は活力に溢れ\n街は賑わうもの…\n善哉、善哉");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8266, 3, 1, 1, 0, 129701, 1, 0, "食べ歩きに世界征服…\nギルドとはかくも\n自由気儘な徒党に\nありんすなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8267, 4, 1, 1, 0, 129701, 1, 0, "連絡は…今日もなし\n我が妹子は相変わらず\n放埓なことよ喃");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8268, 5, 1, 1, 0, 129701, 1, 0, "モネは相変わらず\n警戒しきりなれど…\nそのようなところも\n愛らしくあり申す");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8269, 101, 1, 4, 0, 129701, 1, 0, "なんと長閑な世にや\nありけむ…この平和は\n騎士殿たちの努力の\n賜物にありんす喃");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8270, 102, 1, 8, 0, 129701, 1, 0, "『王家の装備』は\n使わぬのかと？\n…フフ。すでに\n用いており申す");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8271, 1, 2, 1, 0, 129701, 1, 0, "今ばかりは媛という\n立場は置いて\nこの地の者らと\n歓談したく候");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8272, 2, 2, 1, 0, 129701, 1, 0, "強さの秘密？　…フフ\n女子の秘密を暴くのは\n野暮にござんす\nご寛恕いただきたく候");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8273, 3, 2, 1, 0, 129701, 1, 0, "此方の家屋、\n見目以上に\n堅牢であり申す\n何ぞ仕掛けがありや？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8274, 4, 2, 1, 0, 129701, 1, 0, "心地よい時間とは\n疾く過ぎ去りゆくもの\n此処で過ごすと改めて\n実感できる喃");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8275, 101, 2, 4, 0, 129701, 1, 0, "視線が気になる？\nこれはすみませぬ\nなにぶん、お前さまは\n見ていて飽きませぬ故");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8276, 102, 2, 8, 0, 129701, 1, 0, "お前さまの前では\n誰もが心を開く…\nなんとまぁ罪作りな\n色男にありんすな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8277, 1, 2, 1, 0, 129701, 1, 1, "よく眠れましたかの？\n寝る子は良く育つ、と\n古くより申します由");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8278, 2, 2, 1, 0, 129701, 1, 2, "美食殿の作法に倣い\n皆で共に昼餉を頂くと\n致しんしょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8279, 3, 2, 1, 0, 129701, 1, 3, "逢魔ヶ時は望まぬ客も\n参るもの…お前さまも\n気をつけなんし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8281, 2, 3, 1, 0, 129701, 1, 0, "わっちの蛇に\n勝るとも劣らぬ\n座り心地で候");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8282, 3, 3, 1, 0, 129701, 1, 0, "魂、万物に宿る\nとの云いあらば\n情愛を注いでやるのが\nよかろうの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8283, 4, 3, 1, 0, 129701, 1, 0, "いと香しき哉…\n騎士殿は香の道にも\n詳しくあられるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8284, 5, 3, 1, 0, 129701, 1, 0, "ジオ・ゲヘナの\n灼熱と比ぶれば\nそよ風と変わり\nござんせん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8286, 7, 3, 1, 0, 129701, 1, 0, "美味なる哉…この味\nぺコリーヌ姫が好むも\n道理にありんす");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8287, 8, 3, 1, 0, 129701, 1, 0, "トーゴクに、オーマ…\n書で見るだけでも\n心惹かれる土地よの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8289, 1, 1, 1, 0, 131201, 1, 0, "暑い日には\n冷たいものですよねー\nかき氷とか食べて\nすっきりしたいです★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8290, 2, 1, 1, 0, 131201, 1, 0, "海への行き来は\nテレポーテーションに\nお任せです★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8291, 3, 1, 1, 0, 131201, 1, 0, "トロピカルジュースが\n飲みたいでーす♪\n海の家で見たんですよ\nカップル用ジュース★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8292, 4, 1, 1, 0, 131201, 1, 0, "ご飯どうしようかなー\nあ、海鮮ラーメンとか\n美味しそうかも★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8293, 5, 1, 1, 0, 131201, 1, 0, "水鉄砲、普通に撃つと\n少し物足りないかも…\nどるるるる～ん★って\n感じが欲しいですよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8294, 101, 1, 4, 0, 131201, 1, 0, "コイビトっぽいこと\nアオハルっぽいこと\nいっぱいしたいです★\n修羅場とかも♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8295, 102, 1, 8, 0, 131201, 1, 0, "騎士さんが溺れたら\n絶対助けに行きますね\n人工呼吸でもなんでも\nしてあげますから★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8296, 1, 2, 1, 0, 131201, 1, 0, "騎士さーん\n日焼け止めの塗り直し\nお願いします★\n優しくしてくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8297, 2, 2, 1, 0, 131201, 1, 0, "海で食べたフルーツ？\nはい、まだありますよ\nこっちでもあーんして\n食べさせましょうか★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8298, 3, 2, 1, 0, 131201, 1, 0, "ぺんぽこりんは\nどうしたのかって？\nどうしたんでしょうね\nどーでもいいです★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8299, 4, 2, 1, 0, 131201, 1, 0, "今日はどんな\nイイコトしましょうか\n思い出作り？\n人助けもいいですね★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8300, 101, 2, 4, 0, 131201, 1, 0, "ヒモを引っ張ったら…\n「セ・キ・ニ・ン」\n取ってもらいますよ？\nなーんてウソですけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8301, 102, 2, 8, 0, 131201, 1, 0, "みんなでイイコトも\n楽しいですけど～\n…二人でイイコト\nしちゃいますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8302, 1, 2, 1, 0, 131201, 1, 1, "朝ですよー！\n今日も一日、\nイイコト日和ですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8303, 2, 2, 1, 0, 131201, 1, 2, "日差しにご注意ですね\n日焼け止め…誰かに\n塗ってほしいなー？\n…ちらっ★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8304, 3, 2, 1, 0, 131201, 1, 3, "夜の海って\n惹かれちゃいますよね\n…ロマンチックです★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8306, 2, 3, 1, 0, 131201, 1, 0, "う～ん、まったり～\nこれぞ新ジャンル\nおうちバカンス★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8307, 3, 3, 1, 0, 131201, 1, 0, "よーしよーし★\nわたしとイイコト\n一緒にしましょうねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8308, 4, 3, 1, 0, 131201, 1, 0, "いい香りですねー\nリラックスタイムに\nちょうどよさそう★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8309, 5, 3, 1, 0, 131201, 1, 0, "水遊びのあとは\nしっかり体を\n温めないとですよね★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8311, 7, 3, 1, 0, 131201, 1, 0, "栄養補給もバッチリ★\n遊びもイイコトも\nお腹が減ってたら\nできませんからねー？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8312, 8, 3, 1, 0, 131201, 1, 0, "今だと海関連の本とか\n興味あるんですよねー\n魚とか海難救助とか★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8314, 10, 3, 1, 0, 131201, 1, 0, "かっこいー★\n名前はー…\nぷんぷくぽんとか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8315, 11, 3, 1, 0, 131201, 1, 0, "映えますねー\n写真撮ったら\n素敵な思い出に\nなりそうです★");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8316, 1, 1, 1, 0, 131601, 1, 0, "海でもないのに\nこの姿でいるのは…\nやはり、場違いでは\nありませんか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8317, 2, 1, 1, 0, 131601, 1, 0, "スイカとは割ることと\n見つけたり！\n…ですが目隠しすれば\n見当たらないもの…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8318, 3, 1, 1, 0, 131601, 1, 0, "まぁ、膝に砂が…\n気がつきませんでした\nまるでわんぱくな\nお子様のよう…ふふっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8319, 4, 1, 1, 0, 131601, 1, 0, "家の中でスイカを割る\nわけにはまいりません\nここは潔く包丁で\n切りましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8320, 5, 1, 1, 0, 131601, 1, 0, "ミソラ様やネア様の\n大胆さを見習って…\nき、騎士きゅーん…★\n難しいですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8321, 101, 1, 4, 0, 131601, 1, 0, "きゅ、急に暗く…！？\n…失礼しました\n鉢巻きが下がってきた\nだけでした…ううぅ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8322, 102, 1, 8, 0, 131601, 1, 0, "わたくしに剣の才は\nあるのでしょうか…\nいえ、何事もまずは\nやってみなくては");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8323, 1, 2, 1, 0, 131601, 1, 0, "なにか羽織った方が\nよろしいですよね…？\nそのままでいい？\nそれはそれで…その…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8324, 2, 2, 1, 0, 131601, 1, 0, "あの、兄様…？\nスイカの種を飛ばす\n遊びもあるというのは\n…本当なのでしょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8325, 3, 2, 1, 0, 131601, 1, 0, "強くなるための修行は\nまだ始まったばかり\nまずは己の目指すべき\n道を見定めなくては");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8326, 4, 2, 1, 0, 131601, 1, 0, "同じ薄着であっても\n黒い天使の姿より…\n気が楽です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8327, 101, 2, 4, 0, 131601, 1, 0, "はい、ただいまー！\n…あっ！\n海の家でのお手伝いの\nくせが、つい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8328, 102, 2, 8, 0, 131601, 1, 0, "兄様さえよろしければ\nまた一緒に海へ…\nあ…申し訳ありません\n浮ついてしまいました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8329, 1, 2, 1, 0, 131601, 1, 1, "本日もイイコトをして\n清々しい一日を\n過ごしたいものです\nまさに一日一善ですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8330, 2, 2, 1, 0, 131601, 1, 2, "お昼時になると\n海の家の料理を\n思い出してしまいます\n焼きそばにかき氷…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8331, 3, 2, 1, 0, 131601, 1, 3, "兄様…よろしければ\n浜辺を歩きませんか？\nきっと、月が\nきれいでしょうから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8333, 2, 3, 1, 0, 131601, 1, 0, "ふわふわ心地よすぎて\n眠くなってしまいます\n水着姿では\nいけません…ふぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8334, 3, 3, 1, 0, 131601, 1, 0, "なんてよい手触り…\n癖になってしまいます\nふふ、よしよし…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8335, 4, 3, 1, 0, 131601, 1, 0, "爽やかな香り…♪\n日焼け止めクリームを\n思い出してしまいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8336, 5, 3, 1, 0, 131601, 1, 0, "冷たい水で冷えた体が\n温まります…♪\nまるで兄様のようです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8338, 7, 3, 1, 0, 131601, 1, 0, "お腹が空いては\n修行ができません…！\n動きに障りない程度に\n栄養の補給を…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8339, 8, 3, 1, 0, 131601, 1, 0, "剣術とスイカ割りが\n上達する指南書…\n見つかりませんね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8341, 10, 3, 1, 0, 131601, 1, 0, "さあ、ともに大海原を\n参りましょう！\nなんて…ふふっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8342, 11, 3, 1, 0, 131601, 1, 0, "まるでおとぎ話の\n登場人物になった\nような心持ちです…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8343, 1, 1, 1, 0, 131701, 1, 0, "あたしはなんで水着で\n室内をうろついてるの\nかしら…不思議だわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8344, 2, 1, 1, 0, 131701, 1, 0, "あ、天井が汚れてる\n仕方ないわね\nひとっ飛びしますか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8345, 3, 1, 1, 0, 131701, 1, 0, "はい、お疲れさま♪\n出迎えの言葉は\nやっぱこれよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8346, 4, 1, 1, 0, 131701, 1, 0, "そういえばあたしって\n羽があるけど\n泳げるのかしら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8347, 5, 1, 1, 0, 131701, 1, 0, "あいつのために\n浮き輪も用意したし\n抜かりはないわよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8348, 101, 1, 4, 0, 131701, 1, 0, "海までのガイド計画も\nまとまったわね\nふふっ…楽しみだわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8349, 102, 1, 8, 0, 131701, 1, 0, "この水着、あいつが\n選んでくれたのよね\n…大事にしないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8350, 1, 2, 1, 0, 131701, 1, 0, "ネビアは最近どう？\n迷惑かけてない？\n…かけてるのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8351, 2, 2, 1, 0, 131701, 1, 0, "あんた…部屋の片付け\nくらい自分でしなさい\n散らかってたわよ？\n…片付けておいたけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8352, 3, 2, 1, 0, 131701, 1, 0, "もしかして暇なの？\nだったら記憶でも\n見せましょうか？\n凄く恥ずかしいやつ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8353, 4, 2, 1, 0, 131701, 1, 0, "夏ってこんなに\n暑いのね…\n海にばかり行く\n気持ちが分かったわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8354, 101, 2, 4, 0, 131701, 1, 0, "あんたの水着って\n新しいの買わないの？\nなんならあたしが\n選んであげるわよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8355, 102, 2, 8, 0, 131701, 1, 0, "気軽に触れ合える\n距離にいる…\nあたしにとって\nとても大事なことよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8356, 1, 2, 1, 0, 131701, 1, 1, "あらおはよう\n夏の朝は暑いわね\nシャワーでも浴びて\nさっぱりしなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8357, 2, 2, 1, 0, 131701, 1, 2, "お昼は何を食べるの？\nガイド妖精として\n提案しましょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8358, 3, 2, 1, 0, 131701, 1, 3, "夜更かしは厳禁よ\n無理やり眠らせて\nあげましょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8360, 2, 3, 1, 0, 131701, 1, 0, "アメスさまだって\nゴロゴロするときは\nあるのよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8361, 3, 3, 1, 0, 131701, 1, 0, "…ふふっ♪\n何よ、あたしが\nかわいいものを\n愛でちゃだめなの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8362, 4, 3, 1, 0, 131701, 1, 0, "こういういい香り…\n塔の中じゃなかなか\n楽しめないのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8363, 5, 3, 1, 0, 131701, 1, 0, "水着を着てるのに\n温まるのって\n矛盾してない？\n気にしすぎかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8365, 7, 3, 1, 0, 131701, 1, 0, "あんたと行動するなら\n沢山食べられるように\nならなきゃね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8366, 8, 3, 1, 0, 131701, 1, 0, "文字を読むのと\nデータを読むのは\nまったく違うわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8368, 10, 3, 1, 0, 131701, 1, 0, "へぇ、面白いじゃない\nこういう経験、昔じゃ\nできなかったわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8369, 11, 3, 1, 0, 131701, 1, 0, "面白いクッションね\nところであんた…\nあたしで遊んでない？\n気のせいならいいけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8370, 1, 1, 1, 0, 118601, 1, 0, "また新しい悪戯\n思いついちゃった♪\n誰に仕掛けようかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8371, 2, 1, 1, 0, 118601, 1, 0, "あ～あ、退屈…\nフィオでもからかって\nこようかしら♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8372, 3, 1, 1, 0, 118601, 1, 0, "ミソギの悪戯って\nレベル高いのよね…\n負けてらんないわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8373, 4, 1, 1, 0, 118601, 1, 0, "家事ニガテなのよね～\nコッコロたちには\n感謝しないとね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8374, 5, 1, 1, 0, 118601, 1, 0, "私も魔物料理に\n慣れてきちゃった…\n毒されてるわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8375, 101, 1, 4, 0, 118601, 1, 0, "あいつに仕掛ける\n次の悪戯は～…♪\nこれ…ううん…\nやっぱこっちかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8376, 102, 1, 8, 0, 118601, 1, 0, "結局ギルドハウスが\n一番落ち着くわね\n…私たちの家だもの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8377, 1, 2, 1, 0, 118601, 1, 0, "悪戯のコツでも\n教えてあげよっか？\n…え～興味ないの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8378, 2, 2, 1, 0, 118601, 1, 0, "これからもずーっと\n退屈しない毎日に\nしてあげる♪\n私の悪戯でね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8379, 3, 2, 1, 0, 118601, 1, 0, "ちょうど退屈してたの\nたーっぷりと\n構ってもらうわよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8380, 4, 2, 1, 0, 118601, 1, 0, "案内が必要なら\n頼ってくれていいわよ\n一応は私だって\nガイド妖精だし！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8381, 101, 2, 4, 0, 118601, 1, 0, "冒険のガイドなら\n私に任せなさい♪\nある意味忘れられない\n旅にしてあげる♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8382, 102, 2, 8, 0, 118601, 1, 0, "妖精がいる家は\n栄えるのよ♪　だから\nずっといてあげる\nあんたのそばにね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8383, 1, 2, 1, 0, 118601, 1, 1, "きゃははっ！\n寝ぐせついてるわよ？\nこのままにしましょ！\nだって面白いし！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8384, 2, 2, 1, 0, 118601, 1, 2, "自由に外へ行けるって\nすっごく幸せなことよ\nさ、散歩行きましょ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8385, 3, 2, 1, 0, 118601, 1, 3, "安心していいわ\n寝てるあんたに\n悪戯しないから\n…あんたにはね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8387, 2, 3, 1, 0, 118601, 1, 0, "悪くはないけど…\nあいつの頭の方が\n座り心地いいかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8388, 3, 3, 1, 0, 118601, 1, 0, "この子を使った\n悪戯は…\n…止めとこっと\nこんなにかわいいし♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8389, 4, 3, 1, 0, 118601, 1, 0, "このギルドハウスに\nピッタリな匂いね♪\n一言で言えば…\nカオスって感じ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8390, 5, 3, 1, 0, 118601, 1, 0, "なんていうか…\n心があたたかいわ\n…変な感じ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8392, 7, 3, 1, 0, 118601, 1, 0, "ガイド妖精にも\n食事の機能があって\nよかったのかも\nしれないわね…もぐ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8393, 8, 3, 1, 0, 118601, 1, 0, "じれったい物語ね…\nこんなの霧を使えば\n一瞬で終わるのに！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8395, 1, 1, 1, 0, 131801, 1, 0, "わる～い子は\nトゥンヌス漁船に\n乗ってもらおうかな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8396, 2, 1, 1, 0, 131801, 1, 0, "たまにはファミリーの\nみんなにもお休みを\nあげないとね～☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8397, 3, 1, 1, 0, 131801, 1, 0, "海辺に素敵な\nバーがあるんだ～\n彼が大人になったら\n一緒に行きたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8398, 4, 1, 1, 0, 131801, 1, 0, "夏の風を肌で\n感じるの好きかも～\nラーゴはどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8399, 5, 1, 1, 0, 131801, 1, 0, "海岸線を\nのんびり散歩もいいね\n砂や貝殻に紛れた\nお宝探しの旅だよ～☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8400, 101, 1, 4, 0, 131801, 1, 0, "みんなで集まって\nビーチパーティーでも\n開いちゃおっかな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8401, 102, 1, 8, 0, 131801, 1, 0, "さて、この水着…\n彼は気に入って\nくれてるかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8402, 1, 2, 1, 0, 131801, 1, 0, "心ゆくまで夏を\n楽しんじゃお～☆\nほら君も♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8403, 2, 2, 1, 0, 131801, 1, 0, "水着似合ってるって？\nふふ♪　うれしいこと\n言ってくれるね～☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8404, 3, 2, 1, 0, 131801, 1, 0, "熱中症には\n気を付けないと\nだめだよ～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8405, 4, 2, 1, 0, 131801, 1, 0, "海の家ならうちの\nファミリーでやってる\nとこにしよっか☆\n豪遊しちゃお～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8406, 101, 2, 4, 0, 131801, 1, 0, "君と一緒なら\nどんな夏になるのか\n楽しみだね～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8407, 102, 2, 8, 0, 131801, 1, 0, "君といると子供心を\nくすぐられちゃうな～\n大人だって思いっきり\n遊んでいいんだよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8408, 1, 2, 1, 0, 131801, 1, 1, "さ、今日は何をして\n過ごそっかな～…\nねえ、君は何したい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8409, 2, 2, 1, 0, 131801, 1, 2, "ふふ♪\n波音が心地良い\n時間だね～☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8410, 3, 2, 1, 0, 131801, 1, 3, "今夜は星空の下で\n乾杯しよっか～☆\n飲み物取ってくるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8412, 2, 3, 1, 0, 131801, 1, 0, "ここ涼しい～♪\nちょっと一休み\nしていこっか☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8413, 3, 3, 1, 0, 131801, 1, 0, "こういうのも良いけど\nやっぱりラーゴの方が\nかわいいかな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8414, 4, 3, 1, 0, 131801, 1, 0, "爽やかな香りだね～\nこういう感覚も絵で\n表現してみたいな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8415, 5, 3, 1, 0, 131801, 1, 0, "続きを描く前に\n原稿を乾かさないとね\nインクがにじむと\n直すの大変なんだよ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8417, 7, 3, 1, 0, 131801, 1, 0, "今日は水着だし…\n食べるのは控えめに\nしておこっかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8418, 8, 3, 1, 0, 131801, 1, 0, "話題の作品は\nチェックしないとね～\nあっ、この作家さん\n新刊出すんだ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8420, 10, 3, 1, 0, 131801, 1, 0, "うちの出店の客引きに\nこういう乗り物系を\n使うのもアリかな～☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8421, 11, 3, 1, 0, 131801, 1, 0, "これ、背景用の\n参考資料に\n一つ欲しいかも♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8422, 1, 1, 1, 0, 181201, 1, 0, "ここに帰るのも\n久しぶり…あれから\n変わったところは\nあるかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8423, 2, 1, 1, 0, 181201, 1, 0, "バイトも復帰しなきゃ\nうちのギルドにとって\n食費は重要だもの…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8424, 3, 1, 1, 0, 181201, 1, 0, "コッコロマ…っ\n…うぅ…\nこの癖は\n直らないのね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8425, 4, 1, 1, 0, 181201, 1, 0, "この世界はまだまだ\n知らないことだらけね\n『裏世界』とか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8426, 5, 1, 1, 0, 181201, 1, 0, "必ずみんなを\n助け出してみせるわ\n…もちろん、兄さんも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8427, 101, 1, 4, 0, 181201, 1, 0, "またみんなと\n暮らせるなんて…\n夢じゃ、ないのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8428, 102, 1, 8, 0, 181201, 1, 0, "たくさんの人が\n私に優しくしてくれる\n…だからこそ、私も\n頼れる人になりたいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8429, 1, 2, 1, 0, 181201, 1, 0, "次はランドソルの\n街の外にも行きたいわ\nあの…よかったらまた\n一緒に回ってくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8430, 2, 2, 1, 0, 181201, 1, 0, "独りぼっちで眠るのは\nやっぱり寂しかったわ\n…みんなで雑魚寝？\nそんなの…絶対やるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8431, 3, 2, 1, 0, 181201, 1, 0, "ネビアってば大泣きで\n私を出迎えてくれたの\n…すごく嬉しかったわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8432, 4, 2, 1, 0, 181201, 1, 0, "この翼、陽に当たると\n本当に綺麗よね…\n自分のだけれど、つい\nずっと見ちゃうもの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8433, 101, 2, 4, 0, 181201, 1, 0, "おにーたんっ♪\n…呼びたくなっただけ\n本当にそれだけよっ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8434, 102, 2, 8, 0, 181201, 1, 0, "どうしたの？\n…ふふっ、安心して\nこれからもずっと\n私はここにいるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8435, 1, 2, 1, 0, 181201, 1, 1, "みんな起きだす時間ね\n街が活気づいてく感じ\n嫌いじゃないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8436, 2, 2, 1, 0, 181201, 1, 2, "【美食殿】のお昼は\nいつも美味しいから\nまた太っちゃいそうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8437, 3, 2, 1, 0, 181201, 1, 3, "おやすみなさい\n明日も、その先も\n一緒に冒険しましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8439, 2, 3, 1, 0, 181201, 1, 0, "休憩も大事…よね\nじゃあ遠慮なく…\nふぅ～…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8440, 3, 3, 1, 0, 181201, 1, 0, "はぁ…ふわふわ…♪\nこのかわいさには\nもう抗えないわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8441, 4, 3, 1, 0, 181201, 1, 0, "落ち着く香り…\nこの匂いを嗅いでると\n帰ってきたなって\n思うわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8442, 5, 3, 1, 0, 181201, 1, 0, "みんなで野宿した時も\n焚火の明かりを見て\nすごく安心したのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8444, 7, 3, 1, 0, 181201, 1, 0, "ペコリーヌさんには\n負けるけど…\n美味しくって手が\n止まらないわ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8445, 8, 3, 1, 0, 181201, 1, 0, "プリンセスフォーム…\n一体どういう仕組みで\n発動するのか、文献に\n書いてないかしら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8447, 1, 1, 1, 0, 131901, 1, 0, "すごーく暑いけど、\nこの暑さをどうやって\n乗り越えるかって\n考えるのも楽しいかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8448, 2, 1, 1, 0, 131901, 1, 0, "氷で彫刻を作るの？\nそれは楽しそうだけど\nすぐに溶けちゃわ\nないかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8449, 3, 1, 1, 0, 131901, 1, 0, "お日様の下で遊ぶのも\n部屋の中で涼むのも\nどっちも夏ならではの\n楽しみ方なのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8450, 4, 1, 1, 0, 131901, 1, 0, "生き物の観察日記、\n私も書いてみたいな\nパックのお昼寝日記\nなんてどうかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8451, 5, 1, 1, 0, 131901, 1, 0, "さまぁばけぇしょんは\n計画を立てるもの\nなんだって\n私も挑戦してみるわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8452, 101, 1, 4, 0, 131901, 1, 0, "この世界のことを\nもっと知って\nアーラム村のみんなに\nお話ししてあげるの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8453, 102, 1, 8, 0, 131901, 1, 0, "いつルグニカに帰るか\nわからないからこそ\n毎日頑張らなきゃね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8454, 1, 2, 1, 0, 131901, 1, 0, "今日はどこに行くの？\n私は、えーと…\nかき氷が食べたいわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8455, 2, 2, 1, 0, 131901, 1, 0, "ここにも精霊が\n住んでたりするの？\n…精霊じゃなくて\nがいど妖精？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8456, 3, 2, 1, 0, 131901, 1, 0, "パックったら、\n近所の子にいっぱい\nなでなでされてたわ\nすごーく人気者ね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8457, 4, 2, 1, 0, 131901, 1, 0, "実は…線香花火の\n特訓をしてたの！\n次は負けないんだから");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8458, 101, 2, 4, 0, 131901, 1, 0, "昨日、みんなの\n似顔絵も絵日記に\n描いてみたんだけど…\n笑っちゃダメよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8459, 102, 2, 8, 0, 131901, 1, 0, "何気ない時間だって\n後で思い返せば\nずっと忘れない\n素敵な思い出になるの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8460, 1, 2, 1, 0, 131901, 1, 1, "気持ちよく起きて、\nいい一日を過ごしたい\nそんなときには\nラジーオタイソーね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8461, 2, 2, 1, 0, 131901, 1, 2, "お昼ごはんの時間ね\n暑さに負けないように\nしっかり食べましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8462, 3, 2, 1, 0, 131901, 1, 3, "外は涼しいみたいだし\n夜の散歩に行ってみる\nのはどうかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8464, 2, 3, 1, 0, 131901, 1, 0, "遊び疲れたら\nここでひとやすみ…\nふわぁ…\n眠くなっちゃった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8465, 3, 3, 1, 0, 131901, 1, 0, "細かいところまで\nすごーく丁寧に\n作られてる…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8466, 4, 3, 1, 0, 131901, 1, 0, "わっ、なんだか\nすーっとする香りね\nちょっぴり涼しく\nなったみたい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8467, 5, 3, 1, 0, 131901, 1, 0, "海で遊ぶと\n体が冷えるから\nあったかいのも\nすごーく嬉しい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8469, 7, 3, 1, 0, 131901, 1, 0, "これも美味しい…！\nペコリーヌが\nどんどん食べちゃう\n気持ちが分かるかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8470, 8, 3, 1, 0, 131901, 1, 0, "このお話も面白い…！\nあっという間に時間が\n過ぎちゃったわ…\n…ね、寝てません！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8472, 10, 3, 1, 0, 131901, 1, 0, "この子と一緒に海に\nいったら楽しそうね！\nどこに行けば\n会えるのかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8473, 11, 3, 1, 0, 131901, 1, 0, "ふかふかね！\nこうしてると波の音が\n聞こえてきそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8474, 1, 1, 1, 0, 132101, 1, 0, "こちらでは水着姿で\n過ごすのも\n珍しくないようですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8475, 2, 1, 1, 0, 132101, 1, 0, "メイド服ではなく\n姉様と色違いの水着…\nレムは嬉しいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8476, 3, 1, 1, 0, 132101, 1, 0, "少し室温が高いかも\nしれませんね…\nいくつか氷を配置して\nおきましょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8477, 4, 1, 1, 0, 132101, 1, 0, "清涼感があるとはいえ\n鉄球をビーチバレーの\nボールに代用するのは\n危ないでしょうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8478, 5, 1, 1, 0, 132101, 1, 0, "ふぅー…ふぅー…\nようやく浮輪が\n膨らみました\n姉様にお渡ししないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8479, 101, 1, 4, 0, 132101, 1, 0, "海のことをもっと\n教えていただけますか\n…スバルくんと海の\n話をしたいんです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8480, 102, 1, 8, 0, 132101, 1, 0, "もし海に行く機会が\nあればレムにも…\nお声がけくださいね\nぜひ、お願いします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8481, 1, 2, 1, 0, 132101, 1, 0, "何を着ていても\nメイドはメイド\n掃除も料理も\nなんでもござれです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8482, 2, 2, 1, 0, 132101, 1, 0, "スバルくんとあなたは\n兄弟のように\n仲がいいですね\n姉様とレムと一緒です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8483, 3, 2, 1, 0, 132101, 1, 0, "この姿で子どもたちと\n遊ぶのは…さすがに\nはばかられますね\nやはり着替えてきます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8484, 4, 2, 1, 0, 132101, 1, 0, "ナンパ…というものが\n海にはあるそうです\nスバルくんがとても\n警戒していました");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8485, 101, 2, 4, 0, 132101, 1, 0, "魚釣りでしたら\nレムもご一緒します\n氷漬けの魚の備蓄を\n補充したかったので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8486, 102, 2, 8, 0, 132101, 1, 0, "子どもたちと砂遊びの\n約束をしているんです\nあなたもご一緒に\nいかがですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8487, 1, 2, 1, 0, 132101, 1, 1, "ラジーオタイソーは\nもうされましたか？\n体がほぐれますよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8488, 2, 2, 1, 0, 132101, 1, 2, "お昼ですね。では\n姉様に焼きそばを…\nもちろん皆様の分も\n用意してありますよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8489, 3, 2, 1, 0, 132101, 1, 3, "熱帯夜であっても\nお休みの際はお腹を\n冷やさないように\n気をつけてくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8491, 2, 3, 1, 0, 132101, 1, 0, "とても気持ちよさそう\nです…！\nさっそく姉様に\nお教えしないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8492, 3, 3, 1, 0, 132101, 1, 0, "季節に合わせた\n着せ替えができれば\n子どもたちも\n楽しめそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8493, 4, 3, 1, 0, 132101, 1, 0, "ふむふむ…この香りは\n疲れを癒やしてくれ\nますね。エミリア様に\nお持ちします");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8494, 5, 3, 1, 0, 132101, 1, 0, "身も心もほぐれます\n思っていたよりも\n体が冷えていたみたい\nですね…ふう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8496, 7, 3, 1, 0, 132101, 1, 0, "もぐもぐ…んうっ！？\nこのすっぱさは…\n梅干し、ですか…\nくせになりますね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8497, 8, 3, 1, 0, 132101, 1, 0, "海に関する詩文なども\nあるのでしょうか…\n気になります");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8499, 10, 3, 1, 0, 132101, 1, 0, "地竜とは違った\n乗り心地です…\n本物にも乗ってみたい\nものですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8500, 11, 3, 1, 0, 132101, 1, 0, "この大きさで\n本物の貝であれば…\nどんな料理にするか\n想像が膨らみます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8501, 1, 1, 1, 0, 132001, 1, 0, "これがこの世界の\n居住環境か…\n面白い構造だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8502, 2, 1, 1, 0, 132001, 1, 0, "暇を持て余していてね\n誰か話し相手に\nなってくれないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8503, 3, 1, 1, 0, 132001, 1, 0, "目新しいものが\nたくさんあるね\n胸が躍るよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8504, 4, 1, 1, 0, 132001, 1, 0, "頑丈そうな建物だ\nここなら彼女たちが\n暴れても大丈夫かな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8505, 5, 1, 1, 0, 132001, 1, 0, "力が制限されていて\n良かった面もある\n君も吐かずにすんだし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8506, 101, 1, 4, 0, 132001, 1, 0, "悪さなんてするわけ\nないじゃないか\n傷つくなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8507, 102, 1, 8, 0, 132001, 1, 0, "普段と違う格好で\n歩き回るのも\n悪くない経験だ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8508, 1, 2, 1, 0, 132001, 1, 0, "ボクに聞きたいことが\nあるなら遠慮なく\n質問するといい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8509, 2, 2, 1, 0, 132001, 1, 0, "気軽に魔女に\n話しかけるなんて\n君は物好きだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8510, 3, 2, 1, 0, 132001, 1, 0, "この世界においては\nボクは異物だからね\n大人しくしているさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8511, 4, 2, 1, 0, 132001, 1, 0, "ボクの反応を\n見たいのかい？\n君の好奇心には\n恐れ入るよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8512, 101, 2, 4, 0, 132001, 1, 0, "ボクの手を借りたい？\nもちろん構わないさ\n対価はいただくけどね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8513, 102, 2, 8, 0, 132001, 1, 0, "ボクと海を見たい？\nふふ、魅力的な\nお誘いだね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8514, 1, 2, 1, 0, 132001, 1, 1, "お目覚めかな？\nさて、君の見た夢を\n教えてくれないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8515, 2, 2, 1, 0, 132001, 1, 2, "食後のお茶を\n一緒にどうだろうか？\nさあ、席に座ってよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8516, 3, 2, 1, 0, 132001, 1, 3, "おや、お休みかな？\n魔女の前で無防備だね\n…無論、何もしないさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8518, 2, 3, 1, 0, 132001, 1, 0, "こういう椅子は\n茶会には向かないね\nつい気が緩んでしまう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8519, 3, 3, 1, 0, 132001, 1, 0, "こういうものを好きな\n女の子がいいのかな？\n君の嗜好を知りたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8520, 4, 3, 1, 0, 132001, 1, 0, "いい香りだ\nこれにはどんな\n効能があるんだろう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8521, 5, 3, 1, 0, 132001, 1, 0, "火の点け方に\nボクのいた世界との\n違いはないのかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8523, 7, 3, 1, 0, 132001, 1, 0, "これもまた未知の味だ\n存分に味わわせて\nもらうとしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8524, 8, 3, 1, 0, 132001, 1, 0, "素晴らしいね\nここには叡智が\n詰まっている");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8526, 10, 3, 1, 0, 132001, 1, 0, "魔物を模倣した\nぬいぐるみか…\n実物を見たくなるね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8527, 11, 3, 1, 0, 132001, 1, 0, "いい気持ちだ…ボクと\nしたことが、何も考え\nられなくなりそうだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8528, 103, 1, 12, 0, 109701, 1, 0, "願わずにいられません\nどうかこちらの\n世界には…悲劇が\n生まれませんようにと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8529, 103, 2, 12, 0, 109701, 1, 0, "食事のご希望があれば\nなんなりと。お腹が\nいっぱいになるまで\n沢山ご用意しますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8530, 103, 1, 12, 0, 109801, 1, 0, "あの男、これからも\n観察が必要ね\nラムの目の届く範囲に\n置く必要があるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8531, 103, 2, 12, 0, 109801, 1, 0, "素直なところは\nあの男の美点ね\n癪だけど、偶然にも\nラムと同じだわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8532, 103, 1, 12, 0, 109901, 1, 0, "迷惑かけちゃったけど\n雪遊びは楽しかったわ\nまたやりたい…なんて\n言ったら怒られるかも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8533, 103, 2, 12, 0, 109901, 1, 0, "数えきれないくらいの\n思い出を、みんなで\n作りましょう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8534, 1, 1, 1, 0, 132201, 1, 0, "わわっ、今すごく\nいい香りがしたけど…\n誰の香水かな\n教えてほしいな…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8535, 2, 1, 1, 0, 132201, 1, 0, "錬金術用の釜、\n置くならどこかな？\n自分専用の錬金釜、\n憧れちゃうよね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8536, 3, 1, 1, 0, 132201, 1, 0, "この匂い…誰か\n唐揚げ食べたみたい\nうぅ…お腹空いて\nきちゃうよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8537, 4, 1, 1, 0, 132201, 1, 0, "次の新曲のタイトルは\n『恋の錬金術』！\nうーん、ちょっと\nベタ過ぎるかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8538, 5, 1, 1, 0, 132201, 1, 0, "あ、錬金の素材\n切らしてたんだ…\n彼を誘って採集に\n行ってこようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8539, 101, 1, 4, 0, 132201, 1, 0, "瞬時に着替えができる\n薬とかできないかな？\n舞台で衣装チェンジ！\nなーんて、楽しそう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8540, 102, 1, 8, 0, 132201, 1, 0, "彼が遊びに来た後は\n部屋の空気がほんのり\n彼の匂いなんだ…\nなんだか幸せだな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8541, 1, 2, 1, 0, 132201, 1, 0, "今日もバイト？\nそれならこれ飲んで\n私のお手製ポーション\nがんばってきてね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8542, 2, 2, 1, 0, 132201, 1, 0, "新しくできたカレー屋\n行ってみない？\n時々スパイスの香りが\n流れてくるんだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8543, 3, 2, 1, 0, 132201, 1, 0, "私のフィギュア\nそっくりでしょ！\nルイちゃんが作って\nくれたんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8544, 4, 2, 1, 0, 132201, 1, 0, "あれ、シャンプー\n変えた？　私と同じの\nだよ！　どうしよう\nドキドキしちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8545, 101, 2, 4, 0, 132201, 1, 0, "いらっしゃいませ♪\n何を作りますか？\nなーんてね。錬金堂で\nまた一日店長したいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8546, 102, 2, 8, 0, 132201, 1, 0, "クンクン…彼の\nハンカチ…いい匂い♪\n私だけの秘密のお守り\nにしてるんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8547, 1, 2, 1, 0, 132201, 1, 1, "ねえねえ、天気も\nいいし一緒に錬金の\n素材集めに行こうよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8548, 2, 2, 1, 0, 132201, 1, 2, "お昼ご飯、用意したよ\nあはは、さすがに\nランチは錬成しないよ\n私の手作りだよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8549, 3, 2, 1, 0, 132201, 1, 3, "今日も一日お疲れさま\nこれ飲んでゆっくり\n休んで。薬じゃないよ\nホットミルクだよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8551, 2, 3, 1, 0, 132201, 1, 0, "昨日、遅くまで\n錬金術の勉強してた\nから眠くって…\nちょっと一休みっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8552, 3, 3, 1, 0, 132201, 1, 0, "この子にちょっとだけ\n香水かけて、と…\nんー！　だっこした時\nすっごくいい匂い♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8553, 4, 3, 1, 0, 132201, 1, 0, "花みたいな、\nお菓子みたいな\nいい香り。気持ちが\n穏やかになるね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8554, 5, 3, 1, 0, 132201, 1, 0, "外でもこの暖かさを\n感じられる道具、\n作れたりしないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8556, 7, 3, 1, 0, 132201, 1, 0, "素材集めに行くと\nお腹が空くんだよね\nイロハちゃんも\nこの味好きそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8557, 8, 3, 1, 0, 132201, 1, 0, "錬金術にはたくさんの\n知識が必要だからね\nさあ、今日も調合書を\n読まなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8559, 1, 1, 1, 0, 127701, 1, 0, "ここが騎士さんたちの\n住んでる場所…！\n粗相がないように\n気をつけなきゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8560, 2, 1, 1, 0, 127701, 1, 0, "ジオ・テオゴニアの\nみんな、私がいない間\nちゃんとお仕事\nしてればいいけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8561, 3, 1, 1, 0, 127701, 1, 0, "コッコロさんも\n従者として長いって\n聞いたような…\nあの年ですごい…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8562, 4, 1, 1, 0, 127701, 1, 0, "自分がもてなされる\n側になるのって\nやっぱりちょっと\n落ち着かないかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8563, 5, 1, 1, 0, 127701, 1, 0, "今度のお休みの日は\n何しよう…？\nあっ、最近できたお店\nヴルムと行こうかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8564, 101, 1, 4, 0, 127701, 1, 0, "お買い物したら\nかわいいからって\nたくさんおまけして\nもらっちゃった…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8565, 102, 1, 8, 0, 127701, 1, 0, "ここにいると、つい\nぼんやりしちゃう…\nこれも騎士さんの力…\nなのかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8566, 1, 2, 1, 0, 127701, 1, 0, "お手伝いできることは\nありませんか？\nお世話でもなんでも\n任せてくださいっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8567, 2, 2, 1, 0, 127701, 1, 0, "ランドソルに初めて\n来たときは驚きました\n砂糖の山と思ったら…\nあんなに寒いなんて！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8568, 3, 2, 1, 0, 127701, 1, 0, "あの、ヴルムを\n見ませんでしたか？\nもう…あの子ってば\nまた仕事をサボって…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8569, 4, 2, 1, 0, 127701, 1, 0, "家具や家が壊れても\n食べられないなんて\nなんだかもったいない\nですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8570, 101, 2, 4, 0, 127701, 1, 0, "とっておきの紅茶を\n手に入れたんです\n一杯いかがですか？\nその、日頃のお礼です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8571, 102, 2, 8, 0, 127701, 1, 0, "頑張ってて偉いって…\nほ、褒めてもなんにも\n出ませんからね！？\n…えへへ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8572, 1, 2, 1, 0, 127701, 1, 1, "おはようございます！\nモーニングティーは\nいかがですか？\n私、準備しますねっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8573, 2, 2, 1, 0, 127701, 1, 2, "ライラエルさまも\nお昼寝はお好きです\nけど…だからって\n寝すぎはダメですよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8574, 3, 2, 1, 0, 127701, 1, 3, "おやすみなさい\nくれぐれも寝不足には\n気をつけてくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8576, 2, 3, 1, 0, 127701, 1, 0, "しっかりしないと…\nメイドの私が\n気を抜くなんて…\nそんな…ふぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8577, 3, 3, 1, 0, 127701, 1, 0, "わぁ、かわいい…♪\nってダメダメ！\nメイドなんだから\n落ち着かないと…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8578, 4, 3, 1, 0, 127701, 1, 0, "いい匂い…♪\nこの香り、\nライラエルさまも\n好きそうです！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8579, 5, 3, 1, 0, 127701, 1, 0, "ランドソルの環境に\n触れると、この光の\nありがたみが\n身に沁みますね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8581, 7, 3, 1, 0, 127701, 1, 0, "甘くない食べ物が\n一般的なのも\n慣れてきました\nあむ…おいひぃ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8582, 8, 3, 1, 0, 127701, 1, 0, "ランドソルの文字、\n私たちのところと\nちょっと違いますね…\n覚えられるかなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8584, 1, 1, 1, 0, 127801, 1, 0, "甘い匂いがしない…\nジオ・テオゴニアとは\n別の世界なんですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8585, 2, 1, 1, 0, 127801, 1, 0, "掃除めんど…\nん…このくらいで\nまー十分でしょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8586, 3, 1, 1, 0, 127801, 1, 0, "そろそろ食事の\n用意もしなきゃ…\nあーやる事多い…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8587, 4, 1, 1, 0, 127801, 1, 0, "秘密の隠れ場所、\nまた姉さんにバレた…\n次のを探さないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8588, 5, 1, 1, 0, 127801, 1, 0, "知らない間に仕事が\n終わったり…しないか\nしてくれたらいいのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8589, 101, 1, 4, 0, 127801, 1, 0, "きちんともてなすには\n騎士さんの好みも\n覚えてかないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8590, 102, 1, 8, 0, 127801, 1, 0, "ご主人サマに\nご奉仕します～♪\n…キャラじゃないか\nやめやめ、恥ずかし…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8591, 1, 2, 1, 0, 127801, 1, 0, "居心地いいっすね…\n今日からここに\n住んでもいいですか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8592, 2, 2, 1, 0, 127801, 1, 0, "あの、ちょっと姉さん\n怒らせちゃったんで\n匿ってくれません？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8593, 3, 2, 1, 0, 127801, 1, 0, "羽と尻尾が格好いい？\n意外と邪魔ですよ\n仰向けで寝にくいし");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8594, 4, 2, 1, 0, 127801, 1, 0, "ワークライフバランス\nっていい言葉ですね\nぜひライフ多めで");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8595, 101, 2, 4, 0, 127801, 1, 0, "騎士さんって\n働き者ですね\nそのままあたしの\n仕事も…いえなんでも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8596, 102, 2, 8, 0, 127801, 1, 0, "熱心に見てても\n尻尾は触らせて\nあげませんってば\n角？　角なら…まぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8597, 1, 2, 1, 0, 127801, 1, 1, "寝ても寝ても\n寝足りない…ふぁ…\nあー…眠たい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8598, 2, 2, 1, 0, 127801, 1, 2, "アフタヌーンティーの\n準備は得意ですよ\nつまみ食いとか\n…つまみ食いとか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8599, 3, 2, 1, 0, 127801, 1, 3, "よく休んでください\n布団は干しといたんで\n…姉さんが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8601, 2, 3, 1, 0, 127801, 1, 0, "ふー…\nこのままずーっと\nここに居たい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8602, 3, 3, 1, 0, 127801, 1, 0, "あんたも一緒に\nサボっちゃうか～\n…なんて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8603, 4, 3, 1, 0, 127801, 1, 0, "落ち着く匂い…\n騎士さんの好み\nなんですかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8604, 5, 3, 1, 0, 127801, 1, 0, "こういうとこの\n掃除って面倒だし…\n今度でいっか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8606, 7, 3, 1, 0, 127801, 1, 0, "ご飯の前に\nこんな食べたら\n姉さんきっと怒るな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8607, 8, 3, 1, 0, 127801, 1, 0, "食に関する本が\nやけに多い…\nお国柄ですかね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8609, 1, 1, 1, 0, 130201, 1, 0, "すんすん…\nお兄さんの匂いが\nぷんぷんする～♡\nザコくっさぁ♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8610, 2, 1, 1, 0, 130201, 1, 0, "ぴこーん！\nいひひっ、新作メカの\n面白いアイデア、\n思いついちった～♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8611, 3, 1, 1, 0, 130201, 1, 0, "メカもいじりたいし\n服もアクセもほしー…\nあ～、おこづかい\n足んないよ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8612, 4, 1, 1, 0, 130201, 1, 0, "お勉強でもしよっかな\nザコお兄さんには\n絶対わかんない\nよーなやつ♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8613, 5, 1, 1, 0, 130201, 1, 0, "お兄さんの部屋って\nどこどこぉ？\nメカの実験室に\n使えそうだよね～♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8614, 101, 1, 4, 0, 130201, 1, 0, "次のデートコースは\nどんなのかなー？\n…いや、むしろ次は\nぼくが決めちゃうっ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8615, 102, 1, 8, 0, 130201, 1, 0, "強奪計画は念入りに♡\nお兄さんのハートも\n全力でザコザコにする\n計画、立てないとね♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8616, 1, 2, 1, 0, 130201, 1, 0, "ねー、ヒマヒマヒマ～\nかまってかまってー♡\nどっか連れてけー♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8617, 2, 2, 1, 0, 130201, 1, 0, "今日はこっちで\nご飯食べたいなー♡\n…帰っても５日連続の\nバカナ姉カレーだし…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8618, 3, 2, 1, 0, 130201, 1, 0, "依頼行くならぼくも\n連れてってよー♡\nお兄さんのザコっぷり\n見ててあげる～♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8619, 4, 2, 1, 0, 130201, 1, 0, "お兄さんはぼくより\nオトナだもんね～♡\nじゃあオモテナシ、\n期待してるから～♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8620, 101, 2, 4, 0, 130201, 1, 0, "ヤマ姉になんかお土産\n持って帰ろうかなー？\nザコお兄さん、選ぶの\n付きあって～♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8621, 102, 2, 8, 0, 130201, 1, 0, "遊びにいくときは\nザコお兄さんも\n誘ってあげるよ♡\nどうせヒマでしょ～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8622, 1, 2, 1, 0, 130201, 1, 1, "ふぁ～、ねむぅ～…\n夜更かしぶん寝るから\nあとで起こして～♡\nあ、変なこと禁止～♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8623, 2, 2, 1, 0, 130201, 1, 2, "おなかすいたぁ～\nなんか食べ行こ♡\n甘いのおごって～♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8624, 3, 2, 1, 0, 130201, 1, 3, "えー、もう寝る時間？\nじゃあ…添い寝して\nあげよっか？\nなーんて、ウッソー♡");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8626, 2, 3, 1, 0, 130201, 1, 0, "おお～ふわっふわ～♪\nバンディシャーク号の\n座席に使いたーい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8627, 3, 3, 1, 0, 130201, 1, 0, "カワイイ～♡\n改造したらもっと\nカワイくなるかな～？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8628, 4, 3, 1, 0, 130201, 1, 0, "くんくん…いい匂い♡\nザコお兄さんって\nこーゆー香りが\n好きなのかなぁ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8629, 5, 3, 1, 0, 130201, 1, 0, "はー、あったかーい♡\nバンディシャーク号\nにも欲しいかもー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8631, 7, 3, 1, 0, 130201, 1, 0, "食べれるときに\n食べるのが大事って\nヤマ姉言ってたしね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8632, 8, 3, 1, 0, 130201, 1, 0, "あ、この本読んだよ♡\n参考文献リストが\nしっかりしてて\n勉強になったなー♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8634, 1, 1, 1, 0, 130001, 1, 0, "部屋は多少ゴチャつい\nてる方が落ち着くのさ\nバンディシャーク号\nみたいにね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8635, 2, 1, 1, 0, 130001, 1, 0, "呆けてるのもいいが\nちいと物足りないねぇ\n麦しゅわもブドウ朱も\n無いなんてさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8636, 3, 1, 1, 0, 130001, 1, 0, "この家セキュリティが\nなってないねぇ…\n盗賊目線でちょっくら\n指南でもしてやるか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8637, 4, 1, 1, 0, 130001, 1, 0, "不思議だねぇ\nここで飲むと、酔いが\n回るのが早い気が\nするよ…ヒック");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8638, 5, 1, 1, 0, 130001, 1, 0, "ふむ…\nクルマが壊れた時は\nアジト代わりに\n使えそうだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8639, 101, 1, 4, 0, 130001, 1, 0, "カカッ、いい部屋だ！\n妹を迎える準備は\nできてるみたいだねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8640, 102, 1, 8, 0, 130001, 1, 0, "…っと、油断したら\n落ち着いちまうね\nボーヤの甘っちょろい\n雰囲気のせいだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8641, 1, 2, 1, 0, 130001, 1, 0, "さすがにこの家から\n盗みはしないさ\nいずれは妹たちの\n共有財産になるからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8642, 2, 2, 1, 0, 130001, 1, 0, "ボーヤ、暇なら\n博打でもやるかい？\nアタシが負けたら\n掃除でもしてやるよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8643, 3, 2, 1, 0, 130001, 1, 0, "立派な家じゃないか！\n一国一城の主とは\nちょっとボーヤのこと\n見くびってたかもねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8644, 4, 2, 1, 0, 130001, 1, 0, "かわいい義弟のためだ\nアタシが盗ってきた\nお宝をくれてやるよ\n好きな場所に飾りな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8645, 101, 2, 4, 0, 130001, 1, 0, "妹と結ばれる前に\n他の女との関係は\n清算しとくように\nわかったね、ボーヤ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8646, 102, 2, 8, 0, 130001, 1, 0, "お、ヤシオーリかい？\nフフン、義弟からの\nお酌とあっちゃあ\n断れないねぇ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8647, 1, 2, 1, 0, 130001, 1, 1, "うう…清々しい朝だが\n頭がいてぇ…\nちっと昨日は\n飲みすぎたか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8648, 2, 2, 1, 0, 130001, 1, 2, "ほらこれ、ワカナに\n作らせた弁当だ\nこれで昼からも\nバリバリやりな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8649, 3, 2, 1, 0, 130001, 1, 3, "まだまだ夜はこれから\n…と言いたいとこだが\n早寝して立派に育ちな\nそれが妹たちの為だよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8651, 2, 3, 1, 0, 130001, 1, 0, "中々いい座り心地だが\n盗賊が腑抜ける訳には\nいかないね…が…\nもう少しだけ座るか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8652, 3, 3, 1, 0, 130001, 1, 0, "こういうのの中に\n実はレアなブツが\n隠されてるとか\nありがちだねぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8653, 4, 3, 1, 0, 130001, 1, 0, "ふうん、ボーヤは\nこういう匂いが\n好きなのかい？\n妹たちに教えてやろう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8654, 5, 3, 1, 0, 130001, 1, 0, "体を温めんにゃ\n酵露をカッとやるのが\n一番だが、これも存外\n悪くないねぇ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8656, 7, 3, 1, 0, 130001, 1, 0, "ガツガツ…\nん、悪くねェ味だ\nこれにヤシオーリでも\nありゃ文句はないね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8657, 8, 3, 1, 0, 130001, 1, 0, "本にも載ってない\nレアもんのお宝か…\nフッ、想像しただけで\n血沸き肉躍るねぇ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8659, 1, 1, 1, 0, 130101, 1, 0, "今日の買い物は\nいつものお野菜と…\nあっ、確か特売が\nあったはず…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8660, 2, 1, 1, 0, 130101, 1, 0, "お掃除、お掃除…♪\nきゅっきゅっ…\nよいしょ、っと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8661, 3, 1, 1, 0, 130101, 1, 0, "洗濯ものも\nたまらないうちに\nやっちゃわないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8662, 4, 1, 1, 0, 130101, 1, 0, "夕飯のメニュー…\n何にしよう？\n期限の早い食材は…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8663, 5, 1, 1, 0, 130101, 1, 0, "色々お菓子も\n作ってみたいけど…\n予算…足りるかなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8664, 101, 1, 4, 0, 130101, 1, 0, "騎士さん…どんな\n料理が好きなんだろ？\n前に作ったコロッケは\n評判よかったけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8665, 102, 1, 8, 0, 130101, 1, 0, "騎士さんと\nおしゃべりすると、\n胸があたたかくなる…\nなんでだろ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8666, 1, 2, 1, 0, 130101, 1, 0, "あっ、騎士さん\nどうかしましたか？\n御用ならいつでも…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8667, 2, 2, 1, 0, 130101, 1, 0, "削っても削っても\n家計簿は赤字…\n騎士さ～ん…\n助けてください～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8668, 3, 2, 1, 0, 130101, 1, 0, "手が空いてたら\n日用品の買い出し、\n手伝ってもらっても\nいいですか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8669, 4, 2, 1, 0, 130101, 1, 0, "やっと一息つけそう…\nあっ、わたし\nお茶を淹れてきますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8670, 101, 2, 4, 0, 130101, 1, 0, "困りごとがあったら\n言ってくださいね\nわたし…騎士さんの\n力になりたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8671, 102, 2, 8, 0, 130101, 1, 0, "助けてもらった分は\n必ず返しますから…\nそれまでわたしのこと\n見ててくださいね…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8672, 1, 2, 1, 0, 130101, 1, 1, "忘れ物はないですか？\n今日のお仕事も\n頑張りましょうね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8673, 2, 2, 1, 0, 130101, 1, 2, "お昼ご飯できてますよ\n大したものじゃなくて\n恐縮ですけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8674, 3, 2, 1, 0, 130101, 1, 3, "夜更かしはだめですよ\nわたしも家事を\n終わらせたら寝ないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8676, 2, 3, 1, 0, 130101, 1, 0, "これ…割れ物防止の\nクッションに\n使えるかも…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8677, 3, 3, 1, 0, 130101, 1, 0, "こういうのいいなぁ…\nけど…フブキちゃんに\n絶対改造されちゃう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8678, 4, 3, 1, 0, 130101, 1, 0, "いい匂い…でも\n切れかけてるかも？\nえっと補充するには…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8679, 5, 3, 1, 0, 130101, 1, 0, "あったかい…\nちょっとだけなら\n休んでも…いいよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8681, 7, 3, 1, 0, 130101, 1, 0, "これがあったら\nもうお料理を\n作らなくて済むかも？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8682, 8, 3, 1, 0, 130101, 1, 0, "新しい節約レシピは…\nあ、この草って\n食べられるんだ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8684, 1, 1, 1, 0, 132801, 1, 0, "愛溢れるランドソルの\nクリスマス…ですか\nいけませんね、つい\n胸が躍ってしまいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8685, 2, 1, 1, 0, 132801, 1, 0, "ツリーの飾りと\nわたしの髪…\nくるくるしていて\n似ているかも…くすっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8686, 3, 1, 1, 0, 132801, 1, 0, "この姿で傲慢な\nわたしになったら…\nいつもより怖がらせて\nしまうでしょうね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8687, 4, 1, 1, 0, 132801, 1, 0, "悪魔として、人を\nドキドキさせなくては\nい、イオから教わった\n…投げキスの練習を…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8688, 5, 1, 1, 0, 132801, 1, 0, "ジオ・テオゴニアの\nお菓子は、ツリーの\n飾りに向いていそう\nですね…ふふっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8689, 101, 1, 4, 0, 132801, 1, 0, "騎士のギルドハウス…\nクリスマスの時期も\n暖かいのですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8690, 102, 1, 8, 0, 132801, 1, 0, "城の皆と過ごす宴も\n楽しいですが…\n騎士と二人の宴も\n幸せです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8691, 1, 2, 1, 0, 132801, 1, 0, "騎士、あなたの\nもてなしに感謝します\nクリスマスの何たるか\n教えてくださいね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8692, 2, 2, 1, 0, 132801, 1, 0, "この黒い羽は\nどう手入れすれば？\nイオなら知っている\nでしょうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8693, 3, 2, 1, 0, 132801, 1, 0, "城の皆も連れてきたい\nほど、クリスマスは\n楽しい行事ですね\nお土産も迷います");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8694, 4, 2, 1, 0, 132801, 1, 0, "クリスマスの晩餐に\n招待されたのですが…\nその…辛いものは\nありませんよね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8695, 101, 2, 4, 0, 132801, 1, 0, "クリスマスと言わず…\nいつでも星に祈って\nいますよ？　騎士達に\n幸せがあるように、と");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8696, 102, 2, 8, 0, 132801, 1, 0, "悪魔として騎士を\nドキドキさせる…？\nそ、そのようなこと\nわたしには…うぅ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8697, 1, 2, 1, 0, 132801, 1, 1, "朝は寒いですね…\n雪…積もっている\nでしょうか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8698, 2, 2, 1, 0, 132801, 1, 2, "ふあぁ…いけません\n公務の滞在先で\nお昼寝など…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8699, 3, 2, 1, 0, 132801, 1, 3, "夜は悪魔として\n夢を見せましょう\n騎士はどんな夢が\n見たいですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8701, 2, 3, 1, 0, 132801, 1, 0, "ふぅ…落ち着きます…\n家でゆっくりと過ごす\nクリスマスも\n良いものですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8702, 3, 3, 1, 0, 132801, 1, 0, "リンドのプレゼントに\nぬいぐるみは…？\n…子ども扱いすると\n落ち込むでしょうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8703, 4, 3, 1, 0, 132801, 1, 0, "暖かいお部屋に\nこの香りを漂わせたら\nふふっ…素敵な時間を\n過ごせそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8704, 5, 3, 1, 0, 132801, 1, 0, "これがあれば、\n寒い冬も安心ですね\n暖かくて…このまま\n眠ってしまいそうです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8706, 7, 3, 1, 0, 132801, 1, 0, "悪魔の力を使ったら\nお腹が空いてきて\nしまって…\n恥ずかしいです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8707, 8, 3, 1, 0, 132801, 1, 0, "クリスマスには多くの\n伝承があるのですね…\n天使の伝承まで\nありましたし…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8709, 14, 3, 1, 0, 132803, 1, 0, "まぁ…！\nよくできていますね\nサプライズプレゼント\n…でしょうか。ふふ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8710, 15, 3, 1, 0, 132804, 1, 0, "ど、どうでしょう…？\n親善交流の催しに\nなりそうでしょうか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8711, 1, 1, 1, 0, 132901, 1, 0, "ギルドハウスって\nあったかぁ～い♪\n心がぽかぽかするの！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8712, 2, 1, 1, 0, 132901, 1, 0, "クリスマスの悪魔の\nお仕事はないわね！\nだってここのみんな\nいい子なんですもの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8713, 3, 1, 1, 0, 132901, 1, 0, "みんなちゃんと\n寝られてるかしら？\n夜更かしせずに、\nいい夢見てね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8714, 4, 1, 1, 0, 132901, 1, 0, "毎回、来年が\n楽しみになるような\n素敵なクリスマスを\n過ごしたいわね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8715, 5, 1, 1, 0, 132901, 1, 0, "訳ありケーキを見ると\n刑務作業を思い出すわ\n…あれも貴重な体験\nだったのかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8716, 101, 1, 4, 0, 132901, 1, 0, "ロマンチックな\nクリスマスに備えて\n今のうちに少女漫画で\n予習しておかないと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8717, 102, 1, 8, 0, 132901, 1, 0, "ほっぺにチューなら\nもう一回しても…\nや、やっぱり無理！\n恥ずかしいわ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8718, 1, 2, 1, 0, 132901, 1, 0, "またみんなで\nセッションしたいわね\nカラーベルの練習した\n成果を見せたいの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8719, 2, 2, 1, 0, 132901, 1, 0, "君はサンタさんに\nどんなプレゼントを\n頼んでいたのかしら？\n気になるわ～！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8720, 3, 2, 1, 0, 132901, 1, 0, "愛が壊れても、\n何度でも治してあげる\n私たちの間に、\n愛の尽きる日はないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8721, 4, 2, 1, 0, 132901, 1, 0, "冬休みって短いようで\n長く感じちゃうわよね\n学校のみんなと\n早く会いたいな～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8722, 101, 2, 4, 0, 132901, 1, 0, "愛をテーマにした\n冬休みの作文の宿題、\n君の分を読むのが\n今から楽しみね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8723, 102, 2, 8, 0, 132901, 1, 0, "よかったらまた\n私をハニーって呼んで\nほしいの。ダーリン♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8724, 1, 2, 1, 0, 132901, 1, 1, "おはよう！\n冬の朝は冷えるから\n風邪を引かないように\n対策しましょうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8725, 2, 2, 1, 0, 132901, 1, 2, "お昼ご飯は一緒に\n食べに行きましょう！\nクリスマス限定の\nランチコースよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8726, 3, 2, 1, 0, 132901, 1, 3, "ねえねえ、キャンドル\nイルミネーションを\n見に行きましょうよ！\nロマンチックよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8728, 2, 3, 1, 0, 132901, 1, 0, "暖かいクリスマスを\n過ごすのに必須よね♪\nふふ、柔らかぁい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8729, 3, 3, 1, 0, 132901, 1, 0, "どの子もかわいい～♪\nクリスマスツリーの\n下で、一緒にお祝い\nしてもらいたいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8730, 4, 3, 1, 0, 132901, 1, 0, "なんだか胸の奥が\n温かくなる匂いね～\nリラックスしちゃう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8731, 5, 3, 1, 0, 132901, 1, 0, "あったかぁい♪\nあ、でも夜になったら\nサンタさんが入れる\nように、火を消すのよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8733, 7, 3, 1, 0, 132901, 1, 0, "寒い冬だからこそ\nしっかり食べて\n備えておかなきゃ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8734, 8, 3, 1, 0, 132901, 1, 0, "『聖夜の６時間』…？\n気になる小説だけど…\n勝手に読んじゃ悪い\nわよね…ガマンよ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8736, 14, 3, 1, 0, 132901, 1, 0, "きゃっ…！\nこんな不思議な本が\nあったのね～\nちょっと面白いかも♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8737, 15, 3, 1, 0, 132901, 1, 0, "もふもふ、ふわふわで\nあったかくて\n気持ちいい～…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8738, 1, 1, 1, 0, 129501, 1, 0, "冬といえばサマー！\n…って言うけど夏は\n何をＰＲするんだろ\nメルクリゾート…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8739, 2, 1, 1, 0, 129501, 1, 0, "奨学金の道は遠いな…\nあまりに遠すぎて\n最近忘れてたまである");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8740, 3, 1, 1, 0, 129501, 1, 0, "暇だし鏡でも見よっと\nはー、今日も顔が良…\nげ、若干むくんでる？\nはー、今日終わった");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8741, 4, 1, 1, 0, 129501, 1, 0, "水着…お姉ちゃんと\n貸し借りするんだけど\nこれって少数派姉妹？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8742, 5, 1, 1, 0, 129501, 1, 0, "ちゅむ、ツムギちゃん\n今日も可愛いねデュフ\n…なんで推し語りの声\nキモくなるんだろ私…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8743, 101, 1, 4, 0, 129501, 1, 0, "あれ…なんで私\n水着のまま部屋の中\nうろついてるんだっけ\n…こわ！　てか寒っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8744, 102, 1, 8, 0, 129501, 1, 0, "先輩よく友達と海に\n行くって言ってたけど\n…え、誰とだろ？\nまあ誰でもいいけどさ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8745, 1, 2, 1, 0, 129501, 1, 0, "始まる…\nチエルの夏が始まる…\nあ冬でしたっけ？\nまどっちでもいいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8746, 2, 2, 1, 0, 129501, 1, 0, "こないだトミヱ先輩\n壁に喧嘩売ってました\n相変わらず元気ですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8747, 3, 2, 1, 0, 129501, 1, 0, "ユニ先輩にお芝居の\n出来を聞かれたんで\n可愛いって答えました\n嘘は言ってません");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8748, 4, 2, 1, 0, 129501, 1, 0, "クロエ先輩の腹筋\nかっちょいーですよね\nさりげ触りたいけど\nあいつ隙ないんですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8749, 101, 2, 4, 0, 129501, 1, 0, "先輩もうカメラ係は\nやらないんです？\nチエルはやってますよ\n最高の被写体を常に");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8750, 102, 2, 8, 0, 129501, 1, 0, "メリゾでカップル割の\n企画あるらしいんです\nちなみに先輩は…\nあ、いえ、何でも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8751, 1, 2, 1, 0, 129501, 1, 1, "朝ごはんは抜いても\n朝ちぇるだけは\n抜いちゃ駄目ですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8752, 2, 2, 1, 0, 129501, 1, 2, "お昼なに食べるか\n悩んでます？\nおごってくれるなら\nいい店教えますけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8753, 3, 2, 1, 0, 129501, 1, 3, "この時間帯になると\nユニ先輩がごそごそ\n蠢きだすんですよね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8755, 2, 3, 1, 0, 129501, 1, 0, "世界の美少女が…\nこんな格好で\nくつろいでたら…\nまずい…事案になる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8756, 3, 3, 1, 0, 129501, 1, 0, "え、この子って\nウォータープルーフ？\nメリゾにも連れて\nいけちゃうカンジ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8757, 4, 3, 1, 0, 129501, 1, 0, "はぁ～、いい香り…\nそういえばメリゾの\nスタッフルームも\n『贅』な匂いしてた…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8758, 5, 3, 1, 0, 129501, 1, 0, "薄着で暖まるとか…\n冷静になっちゃ\n駄目なやつですよね\nこれ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8760, 7, 3, 1, 0, 129501, 1, 0, "おにぎり１個は\nちぇるに換算すると…\n２５ちぇるくらい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8761, 8, 3, 1, 0, 129501, 1, 0, "あれー？　この辞書\nまだちぇるの項目\n載ってないんだ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8763, 10, 3, 1, 0, 129501, 1, 0, "何これ…地味に楽しい\nあとたぶん\nクロエ先輩が好きそう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8764, 11, 3, 1, 0, 129501, 1, 0, "これは良きですねー\n自宅でメリゾ気分とか\nユニ先輩もにっこり");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8765, 1, 1, 1, 0, 133001, 1, 0, "ここが騎士氏の\nお住まいですか\nふむ…地縛霊は\nいなさそうですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8766, 2, 1, 1, 0, 133001, 1, 0, "ここは土足厳禁では\nないみたいですね\nま、私には関係ないか\n足、透っけ透けなので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8767, 3, 1, 1, 0, 133001, 1, 0, "ランドソルの裏路地\nあそこは最高ですね\n暗くてじめじめしてて\n癒されるー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8768, 4, 1, 1, 0, 133001, 1, 0, "っ！\n今ラップ音が…？\nまさか幽霊？\nやだ、怖い");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8769, 5, 1, 1, 0, 133001, 1, 0, "獣人族にエルフ族…\nなるほど騎士氏が\n幽霊程度では驚かない\n訳です…ちぇ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8770, 101, 1, 4, 0, 133001, 1, 0, "今日の深夜\n騎士氏が起きるまで\n枕元でずーっと\n立っててみようかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8771, 102, 1, 8, 0, 133001, 1, 0, "騎士氏の驚く顔を\n見ると胸が高鳴る…\n変ですね、心臓なんて\n動いてないのに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8772, 1, 2, 1, 0, 133001, 1, 0, "安心して下さい\n勝手にすり抜けて\n騎士氏の部屋は\n覗きませんよ…多分");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8773, 2, 2, 1, 0, 133001, 1, 0, "なんですか騎士氏\n怖い話でも聞きます？\nじゃあいきますね…\n今貴方の前に幽霊がっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8774, 3, 2, 1, 0, 133001, 1, 0, "この家…幽霊が\n寄ってくる間取りに\nなってますね\nまあ、嘘ですけど");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8775, 4, 2, 1, 0, 133001, 1, 0, "料理はしませんよ\n指きったら痛いので\nえ…透ければいい？\n……天才ですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8776, 101, 2, 4, 0, 133001, 1, 0, "お散歩ですか？\n深夜なら付き合います\nあ、やっぱり断ります\n幽霊出たら怖いので");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8777, 102, 2, 8, 0, 133001, 1, 0, "騎士氏の部屋のセンス\n好きですよ…もっと\nじめじめしていれば\nなおよし、ですが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8778, 1, 2, 1, 0, 133001, 1, 1, "レイスになってから\nあまり言わなくなった\n挨拶第一位はこちら…\nおはようございます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8779, 2, 2, 1, 0, 133001, 1, 2, "騎士氏。午後からも\n頑張って下さいね\n私は日陰で休みます\nでは、おつです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8780, 3, 2, 1, 0, 133001, 1, 3, "夜も更けてきましたね\nここからがレイスの\n本領発揮…では早速\nう　ら　め　し　や～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8782, 2, 3, 1, 0, 133001, 1, 0, "中々座り心地が\nよろしいですね\nブロッケンに跨る方が\n安心はしますが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8783, 3, 3, 1, 0, 133001, 1, 0, "知ってますよ\nどうせ貴方も\n夜中になったら\n動き回るんでしょ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8784, 4, 3, 1, 0, 133001, 1, 0, "すう…はあ…\nすごく落ち着く香り\n…落ち着き過ぎて\n成仏しそうでした");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8785, 5, 3, 1, 0, 133001, 1, 0, "温度は感じませんが\nなぜかほっこり\n温かい気持ちです\nなんででしょうね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8787, 7, 3, 1, 0, 133001, 1, 0, "もぐもぐ…\n食べ物は基本好きです\n消化の方法は…\n企業秘密で");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8788, 8, 3, 1, 0, 133001, 1, 0, "苦手なんですよね\nホラー小説\nだって幽霊とか\n怖いじゃないですか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8790, 1, 1, 1, 0, 133201, 1, 0, "この得も言われぬ\n高揚感…やはり\n正月はいいものだな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8791, 2, 1, 1, 0, 133201, 1, 0, "む、いかんな\n気付くと黒豆と\n栗きんとんばかり\n食べてしまう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8792, 3, 1, 1, 0, 133201, 1, 0, "ギルドの連中にも\nお年玉を渡してみるか\n少しは士気が上がる\nかもしれないな！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8793, 4, 1, 1, 0, 133201, 1, 0, "正月くらいはのんびり\n羽を伸ばすとしよう\n適切な休暇も軍人の\n大事な責務だからな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8794, 5, 1, 1, 0, 133201, 1, 0, "正月で浮かれすぎた\n者も多いはずだ\n念のため街を見回りに\n行くとしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8795, 101, 1, 4, 0, 133201, 1, 0, "む、このおせち料理は\n絶品だな！\nあいつの分も\nとっておいてやろう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8796, 102, 1, 8, 0, 133201, 1, 0, "今年の抱負は…\nそうだな、あいつと\nさらに高みを目指す\nこれでいこう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8797, 1, 2, 1, 0, 133201, 1, 0, "えっ、お年玉！\n…い、いや、私は\n子どもではないからな\nえ、遠慮させてもらう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8798, 2, 2, 1, 0, 133201, 1, 0, "凧あげすごろく\nこま回し、たとえ遊び\nでも手は抜かんぞ\nさあ、勝負だ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8799, 3, 2, 1, 0, 133201, 1, 0, "そのきな粉餅も\nうまそうだな…\n私のあんこと交換\nしないか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8800, 4, 2, 1, 0, 133201, 1, 0, "貴公、正月料理を\n食べ過ぎてないか？\nじ、実は私も少々、な");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8801, 101, 2, 4, 0, 133201, 1, 0, "貴公、お参りに行くぞ\n何？　外が寒いだと？\n仕方ない、手ぐらいは\nつないでやろう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8802, 102, 2, 8, 0, 133201, 1, 0, "貴公と新たな年を\n迎えられてうれしいぞ\n今年も一つ\nよろしくたのむ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8803, 1, 2, 1, 0, 133201, 1, 1, "起きろ貴公。早朝なら\n参拝客も少ないはず\n今のうちにお参りを\n済ませよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8804, 2, 2, 1, 0, 133201, 1, 2, "昼食に餅を焼いたぞ\nのどに詰まらせない\nようにゆっくり噛んで\n食べるんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8805, 3, 2, 1, 0, 133201, 1, 3, "夜ふかしはあまり\n褒められたものでは\nないが…正月くらいは\n目をつむろう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8807, 2, 3, 1, 0, 133201, 1, 0, "これに座って飲む\n甘酒は格別だな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8808, 3, 3, 1, 0, 133201, 1, 0, "せっかくの正月だし\nこいつにも着物を\n着せてやりたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8809, 4, 3, 1, 0, 133201, 1, 0, "これは梅の香り…？\nふふ、なかなか\n風流ではないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8810, 5, 3, 1, 0, 133201, 1, 0, "冬の寒さが堪えるな…\nここでしっかりと\n暖をとるとしよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8812, 7, 3, 1, 0, 133201, 1, 0, "正月はのんびり\nしたいからな、勝手に\n食事が出てくるのは\n本当に助かる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8813, 8, 3, 1, 0, 133201, 1, 0, "ふむ、これが世界の\n新年のお祝いか\nなかなか興味深いな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8815, 1, 1, 1, 0, 133501, 1, 0, "一年の計は元旦にあり\n計画を立てて、\n有意義な一年を\n過ごしましょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8816, 2, 1, 1, 0, 133501, 1, 0, "年末年始はどうしても\n出費が増えちゃうし\nしばらくはきっちり\n節約しなきゃ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8817, 3, 1, 1, 0, 133501, 1, 0, "タタミにフトン、\nトーゴク文化の内装…\nランドソルでももっと\n流行らないかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8818, 4, 1, 1, 0, 133501, 1, 0, "子どもたちが凧を\n手作りして遊んでたの\n偉いわよね、みんな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8819, 5, 1, 1, 0, 133501, 1, 0, "お年玉をあげる側に\nなって、分かる苦労…\n大人になるって\nこういうことかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8820, 101, 1, 4, 0, 133501, 1, 0, "一応実家にも\n顔を出さないと…\nよかったらだけど、\nあんたも来る？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8821, 102, 1, 8, 0, 133501, 1, 0, "毎日一緒にいて、\nささやかな幸せを\n同じように感じて…\nそれだけで十分ね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8822, 1, 2, 1, 0, 133501, 1, 0, "着物姿、もっと\nじっくり見たいの？\nさすがに照れるわよ、\nもう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8823, 2, 2, 1, 0, 133501, 1, 0, "整理整頓、できてる？\nもし散らかってるなら\nお正月休みのうちに\n片づけちゃいましょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8824, 3, 2, 1, 0, 133501, 1, 0, "今年もみんなが無事に\n過ごせますように…\nほら、一緒に\nお祈りしましょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8825, 4, 2, 1, 0, 133501, 1, 0, "みんな、あんたと\n遊ぶのが楽しみだって\n子どもに好かれる\nタイプなのよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8826, 101, 2, 4, 0, 133501, 1, 0, "あんたの運勢は大吉！\nラッキーパーソンは\n金髪の幼なじみよ\n…なんてねっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8827, 102, 2, 8, 0, 133501, 1, 0, "初夢は実現するのよね\nそれじゃ、あたしは\nあんたと…んんっ\nなんでもないわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8828, 1, 2, 1, 0, 133501, 1, 1, "外が寒いと、その分\n目も冴えるわよね\nこのまま朝の散歩に\n行こうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8829, 2, 2, 1, 0, 133501, 1, 2, "お正月休みでも、\n食べてばっかじゃダメ\nしっかり動いて\n体を引き締めましょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8830, 3, 2, 1, 0, 133501, 1, 3, "ちゃんとあったかく\nして寝るのよ\nお正月から\n風邪ひかないようにね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8832, 2, 3, 1, 0, 133501, 1, 0, "着物、しわに\nなっちゃいそう…\nでもそれ以上に、\n心地よくって…はぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8833, 3, 3, 1, 0, 133501, 1, 0, "門松みたいに\nこの子も飾ってみる？\n運勢がよくなるかも♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8834, 4, 3, 1, 0, 133501, 1, 0, "この匂い、もしかして\nトーゴクのお香？\nワビサビを感じるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8835, 5, 3, 1, 0, 133501, 1, 0, "ふぅ、あったかい…\n冷えた体に\n染み渡ってくるわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8837, 7, 3, 1, 0, 133501, 1, 0, "んっ、おいしい！\nおせちばっかじゃ\nやっぱり飽きちゃう\nものね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8838, 8, 3, 1, 0, 133501, 1, 0, "験担ぎとか縁起物とか\n調べてみると\nいろいろあって\n面白いのよね～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8840, 1, 1, 1, 0, 133601, 1, 0, "ふーん、いい家ね\nアタシの巣に\nしちゃおうかしら？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8841, 2, 1, 1, 0, 133601, 1, 0, "お姉ちゃん…\n早く会いたいなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8842, 3, 1, 1, 0, 133601, 1, 0, "メドゥシアナも\n気に入るかしら？\n今度連れてこよっと！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8843, 4, 1, 1, 0, 133601, 1, 0, "お邪魔してるだけ\nなのも悪いわよね…\nお返しはしないとね\n…ネズミ退治とか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8844, 5, 1, 1, 0, 133601, 1, 0, "何か平和よね\nランドソルって…\nアタシ的にはもう少し\n荒っぽくてもいいわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8845, 101, 1, 4, 0, 133601, 1, 0, "ランドソルも\n楽しい街よね…\n案内してくれる\nアイツのおかげ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8846, 102, 1, 8, 0, 133601, 1, 0, "アタシ、アイツに\n頼りすぎてるかも…？\nで、でも！　断らない\nアイツも問題だわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8847, 1, 2, 1, 0, 133601, 1, 0, "ねぇ、つまんなーい！\nもっとアタシを\n楽しませなさいよねー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8848, 2, 2, 1, 0, 133601, 1, 0, "この家悪くないけど…\nもっとムシムシ\nジメジメにできない？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8849, 3, 2, 1, 0, 133601, 1, 0, "何よ？\n用もないのに声掛けた\n…とか言ったら\n容赦しないわよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8850, 4, 2, 1, 0, 133601, 1, 0, "少し部屋が寂しいわね\nそうだ、アンタを\n石にして家具に…\n冗談よ、ふふんっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8851, 101, 2, 4, 0, 133601, 1, 0, "ねぇ、もう少し\n話していかない？\nアンタの話なら…\n特別に聞いてあげるわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8852, 102, 2, 8, 0, 133601, 1, 0, "い、いつも\nあ、あ、ありが…\nうぅ、何でもないー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8853, 1, 2, 1, 0, 133601, 1, 1, "やっと起きたわね？\n寝ぼすけなんだから！\n尻尾でひっぱたいて\n起こそうかと思ったわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8854, 2, 2, 1, 0, 133601, 1, 2, "人捜しは日の高い\nうちに限るわ！\nさぁ、メドゥシアナ！\n全速力で出発進行よ!");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8855, 3, 2, 1, 0, 133601, 1, 3, "アタシ…\n子どもじゃないもん…\n眠くなんか…\nないんだからぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8857, 2, 3, 1, 0, 133601, 1, 0, "ふわふわであったかい\nつい、とぐろを\n巻きたくなるわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8858, 3, 3, 1, 0, 133601, 1, 0, "アンタ、こんな\nヤワな体じゃ駄目よ\nウロコくらい\n生やしたらどうなの？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8859, 4, 3, 1, 0, 133601, 1, 0, "くんくん…\n…ふん\n悪くないじゃない\n…くんくんくんくん…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8860, 5, 3, 1, 0, 133601, 1, 0, "あったかいの大好き！\nジオ・ゲヘナでも\nよく日向ぼっこ\nしたもんだわ…ふわぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8862, 7, 3, 1, 0, 133601, 1, 0, "お姉ちゃんを捜すなら\n…もぐ\n体力つけないとね\n…もぐもぐ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8863, 8, 3, 1, 0, 133601, 1, 0, "何よ？　たまには\n勉強くらいするわよ\nお姉ちゃんに\n笑われちゃうもの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8865, 1, 1, 1, 0, 133701, 1, 0, "この装いと力…\n今の世界との\n整合性を上手いこと\n合わせておかないとだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8866, 2, 1, 1, 0, 133701, 1, 0, "この格好…開発してた\n当時のまんまだ\nサイズもそのまま♪\n体型維持も完璧っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8867, 3, 1, 1, 0, 133701, 1, 0, "あとで装備の手入れも\nやっとかないと\n…剣なら研ぐだけで\n終わるんだけどなぁ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8868, 4, 1, 1, 0, 133701, 1, 0, "自分の原点を\n振り返ってみるのも\nたまには必要だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8869, 5, 1, 1, 0, 133701, 1, 0, "完璧じゃなくても\n今できる全力を尽くす\nその事に意味がある…\nそうだよね、少年");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8870, 101, 1, 4, 0, 133701, 1, 0, "始まりのあの日、\nそして向かうべき道…\nいつも忘れずにいよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8871, 102, 1, 8, 0, 133701, 1, 0, "誰かを救うために\n許容される犠牲なんて\nあっちゃいけない…\n全部、助けてやる");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8872, 1, 2, 1, 0, 133701, 1, 0, "おっと少年、\n何か御用かな？\nキミに関わる事なら\n最優先で対応するよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8873, 2, 2, 1, 0, 133701, 1, 0, "困った事があれば\n頼ってもらって\n構わないからね！\nむしろもっと頼って！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8874, 3, 2, 1, 0, 133701, 1, 0, "そうだ、時間あるなら\n武器のメンテを\n手伝ってくれないかな\n数が多くてさ～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8875, 4, 2, 1, 0, 133701, 1, 0, "遠距離戦の心得、\n少年にもレクチャー\nしてあげよっか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8876, 101, 2, 4, 0, 133701, 1, 0, "無茶しないで、って\n言ってもするだろうし\nせめてアタシの手が\n届く範囲で頼むよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8877, 102, 2, 8, 0, 133701, 1, 0, "虚実入り混じる\nこの世界でキミが…\n進むべきルートを\n照らしてくれたんだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8878, 1, 2, 1, 0, 133701, 1, 1, "グッモーニン！\n朝だよ少年、今日も\n張り切っていこう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8879, 2, 2, 1, 0, 133701, 1, 2, "クレープの代わりに\nガレットを焼いたんだ\nこの味で少年を\n唸らせてみせよう！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8880, 3, 2, 1, 0, 133701, 1, 3, "もうこんな時間だ\n遅くならないうちに\n作業を切り上げようか\n少年も早く寝なよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8882, 2, 3, 1, 0, 133701, 1, 0, "あえて緊張を解くのも\n戦いには必要だし…\nそうそう…大事大事…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8883, 3, 3, 1, 0, 133701, 1, 0, "愛着を抱かせる事を\n意図したデザインだね\n心理的効果の観点から\n分析してみようか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8884, 4, 3, 1, 0, 133701, 1, 0, "香りは記憶と密接に\n結びつく事がある…\n懐かしい匂いだね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8885, 5, 3, 1, 0, 133701, 1, 0, "癒されるな…\n何がこの感情変化を\n引き起こすんだろう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8887, 7, 3, 1, 0, 133701, 1, 0, "食の偉大さを感じるな\n戦闘糧食ってやっぱり\n味気ないしなぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8888, 8, 3, 1, 0, 133701, 1, 0, "実用ばかりじゃなく\n詩や物語ってのも\n人には必要だよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8890, 1, 1, 1, 0, 133901, 1, 0, "この場所の開発版も\n探せばあるかもな\nさて、どんなデザイン\nだったのやら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8891, 2, 1, 1, 0, 133901, 1, 0, "今まで数々の波乱に\n身を投じたが…やはり\n波乱にはこの姿が一番\n似合いだよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8892, 3, 1, 1, 0, 133901, 1, 0, "むっ…この角に羽と\n尻尾は家具とぶつかり\nやすいな。兎の時は\n気にならなかったが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8893, 4, 1, 1, 0, 133901, 1, 0, "いつもより闘争を\n求める気分になるな\n初心に帰るとは\nこのことか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8894, 5, 1, 1, 0, 133901, 1, 0, "未調整上等☆\nそれを上手く使い\nこなしてこその\nワタシだろう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8895, 101, 1, 4, 0, 133901, 1, 0, "坊やとできそうな\n愉しいことは…\nふむ、多すぎて迷うな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8896, 102, 1, 8, 0, 133901, 1, 0, "時折、坊やの居心地の\nよさに絆されそうに\nなってしまうな\nワタシらしくもない…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8897, 1, 2, 1, 0, 133901, 1, 0, "どうだ、おろした\n髪型も艶やかだろう？\nそんじょそこらの\n賞賛では満足せんぞ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8898, 2, 2, 1, 0, 133901, 1, 0, "外に出るぞ！\n共に退屈を殺しに\n行こうじゃないか☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8899, 3, 2, 1, 0, 133901, 1, 0, "角と翼も触りたい？\nワタシの虚数魔境に\n挑むというなら\n止めはせんよ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8900, 4, 2, 1, 0, 133901, 1, 0, "なんだ、困りごとか？\nクリスティーナさんが\n何でも聞いてやろう☆\n解決するかは別だがな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8901, 101, 2, 4, 0, 133901, 1, 0, "力が欲しいか？\nならば呼ぶがいい！\nワタシの名を☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8902, 102, 2, 8, 0, 133901, 1, 0, "悪魔との契約は絶対\nなのだそうだが…\nどうだ、坊や\n一つ契ってみるか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8903, 1, 2, 1, 0, 133901, 1, 1, "まだ眠い？　甘えるな\n寝首を掻かれたく\nなければ飛び起きて\nこい…☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8904, 2, 2, 1, 0, 133901, 1, 2, "昼食の準備を\nしてやろう。\n毒見はいらんぞ？\n安心するといい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8905, 3, 2, 1, 0, 133901, 1, 3, "坊やは寝る時間だ\n寝ないのならば…\n大人の時間に\n付き合ってもらうか☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8906, 1, 3, 1, 0, 133901, 1, 0, "角と翼、尻尾の\nコンディションまで\n完璧だな☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8907, 2, 3, 1, 0, 133901, 1, 0, "なかなかのフワモコ\n具合だが…ううむ…\n翼と尻尾が邪魔だな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8908, 3, 3, 1, 0, 133901, 1, 0, "うーむ、角と尻尾を\n追加して…さらに槍を\n持たせた方が見栄えが\nよさそうだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8909, 4, 3, 1, 0, 133901, 1, 0, "いい香りだな\n血と砂塵の臭いで\n上書きするまでの\n間に合わせに最適だ☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8910, 5, 3, 1, 0, 133901, 1, 0, "生温いな\nもっと焦がれるほどの\n熱量が欲しいところだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8911, 6, 3, 1, 0, 133901, 1, 0, "普段はないものが\n生えているのだから、\n運動でしっかり感覚を\n掴んでおかなければな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8912, 7, 3, 1, 0, 133901, 1, 0, "腹が減っては戦は…\nと言うからな\nしっかり食べて\nおくとしようか☆");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8913, 8, 3, 1, 0, 133901, 1, 0, "『家庭を築くための\n絶対条件』…？\nふむ…興味がある\nタイトルだ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8915, 1, 1, 1, 0, 133801, 1, 0, "奇妙な感覚です\nまるであの頃の自分に\n変装しているかのよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8916, 2, 1, 1, 0, 133801, 1, 0, "グレゴール？\nおっと、そうでした\n今は昔の姿になって\n離れていましたね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8917, 3, 1, 1, 0, 133801, 1, 0, "このアバターでいると\n妙に子どもたちからの\n視線を感じますね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8918, 4, 1, 1, 0, 133801, 1, 0, "リソースの割り振りが\n変わっただけなのに\n随分と身体が軽く\n感じますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8919, 5, 1, 1, 0, 133801, 1, 0, "普段グレゴールに\n任せている分身の管理\n自分でやるには\nいささか煩雑ですね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8920, 101, 1, 4, 0, 133801, 1, 0, "長老に頼まれて描いた\n妖精の絵…いったい\n何に使ったのでしょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8921, 102, 1, 8, 0, 133801, 1, 0, "私自身をモデルにした\n完全なるNPCたち\nそれが私の分身です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8922, 1, 2, 1, 0, 133801, 1, 0, "このアバターが\n気になるのですか？\n貴方はつくづく\n妖精に縁がありますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8923, 2, 2, 1, 0, 133801, 1, 0, "ちょうどよかった\nグレゴールを見かけ\nませんでしたか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8924, 3, 2, 1, 0, 133801, 1, 0, "あの翅は飾りでは\nありません。ただ…\nグレゴールに乗って\n飛ぶ方が楽なだけです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8925, 4, 2, 1, 0, 133801, 1, 0, "妖精とは本来神話に\nおけるトリックスター\n運命をかき回すことが\n存在意義なのです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8926, 101, 2, 4, 0, 133801, 1, 0, "変貌大妃の権能との\n相性を考えなければ\nこの姿こそが私たちの\n最強の姿です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8927, 102, 2, 8, 0, 133801, 1, 0, "変化とは一種の喪失\nだからこそ得られる物\nがある…貴方のそれも\n大切にするのですよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8928, 1, 2, 1, 0, 133801, 1, 1, "マサキからの定時連絡\nが来ませんね…心配は\n不要ですが、様子を\n見に行きましょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8929, 2, 2, 1, 0, 133801, 1, 2, "昼食の時間ですね\nグレゴールのために\nカロリーの高い物を\n食べに行きましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8930, 3, 2, 1, 0, 133801, 1, 3, "夜更かしはダメですよ\n悪いスパイが暗躍して\nいる時間帯ですからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8932, 2, 3, 1, 0, 133801, 1, 0, "ふむ、座り心地は中々\nですが…私にはやはり\n玉座の方があいますね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8933, 3, 3, 1, 0, 133801, 1, 0, "ふふ、いいでしょう\n我が配下に加えます\n存分に働きなさい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8934, 4, 3, 1, 0, 133801, 1, 0, "時折晶からしていた\nあの甘い匂いは何の\nアロマだったのか…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8935, 5, 3, 1, 0, 133801, 1, 0, "燃え盛る炎もこうして\n暖炉の中なら安全です\nクリスもあの衝動を\n管理さえできれば…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8937, 7, 3, 1, 0, 133801, 1, 0, "そういえば真那が\n獄中で手持無沙汰に\nひたすらおにぎりを\n食べていましたね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8938, 8, 3, 1, 0, 133801, 1, 0, "これは、妖精学の本…\n長老の蔵書から借りて\n読みふけったものです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8940, 1, 1, 1, 0, 134301, 1, 0, "どんな詩を\n作ろうかしら…？\n…大体、暗く\nなっちゃうけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8941, 2, 1, 1, 0, 134301, 1, 0, "唱喚術の練習…\nここでやったら\n迷惑よね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8942, 3, 1, 1, 0, 134301, 1, 0, "チカちゃんとの\nデュエット…\n足をひっぱってない…\nかしら…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8943, 4, 1, 1, 0, 134301, 1, 0, "唱喚士の修行…\n滝に打たれるとか…\n崖を登るとか…\nなくて、よかった…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8944, 5, 1, 1, 0, 134301, 1, 0, "精霊さん、肉じゃが\n食べる、かしら…？\n魔力だけだと…\n飽きちゃいそうだし…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8945, 101, 1, 4, 0, 134301, 1, 0, "精霊さんのお世話に\n慣れたぶん…\nあのひとのお世話も\n上手にできる…はず？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8946, 102, 1, 8, 0, 134301, 1, 0, "これからも、歌うわ…\nこの声が、彼の力に\nなる、限り──");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8947, 1, 2, 1, 0, 134301, 1, 0, "この服…踊り子さんに\n間違われちゃって…\nあ…お、お触りしちゃ\nだめよ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8948, 2, 2, 1, 0, 134301, 1, 0, "あなたはどんな\n精霊が…好き…？\n唱喚…してみたいわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8949, 3, 2, 1, 0, 134301, 1, 0, "あんまり白い服って…\n着ないの…その…\nこ、ころんだりして…\n汚すから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8950, 4, 2, 1, 0, 134301, 1, 0, "じ、実はね…\nこの体の模様…筆で\n書いてもらうたび…\nくすぐったい…の…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8951, 101, 2, 4, 0, 134301, 1, 0, "精霊さん…あなたと\n遊びたいみたい…\nや、やっぱり…\nパパ…だから…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8952, 102, 2, 8, 0, 134301, 1, 0, "あなたを歌にしたら…\n…ふふっ、だめね\n一曲じゃ…あなたを\n表現できない、わ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8953, 1, 2, 1, 0, 134301, 1, 1, "朝の修行は…\nうとうと…し…ちゃ…\n……（かくん）\n……あぅっ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8954, 2, 2, 1, 0, 134301, 1, 2, "せ、精霊さんと…\nかくれんぼ中なの…\nうぅ…見つからない…\n日が暮れちゃいそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8955, 3, 2, 1, 0, 134301, 1, 3, "精霊さん、寝たから…\nふふっ…ここからは\nパパとふたりの時間…\n…ね？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8957, 2, 3, 1, 0, 134301, 1, 0, "ふぅ…修行と育児は…\nちょっとだけ…\n休憩…ふぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8958, 3, 3, 1, 0, 134301, 1, 0, "あなたとも契約…\n…できる、かしら？\nふふっ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8959, 4, 3, 1, 0, 134301, 1, 0, "いい香りに包まれたら\n精神統一も\nはかどりそう…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8960, 5, 3, 1, 0, 134301, 1, 0, "あたたかい場所…\nここで作詞したら…\n穏やかな詩が\n書ける、かも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8962, 7, 3, 1, 0, 134301, 1, 0, "精霊さんのお世話を\nしていると…\nお腹、空いちゃって…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8963, 8, 3, 1, 0, 134301, 1, 0, "ふふっ…♪\n色んな楽譜…\n集めるの、楽しい…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8965, 103, 1, 12, 0, 122301, 1, 0, "けんぞくまだかな？\nはやく会いたいなー\nヴァンピィちゃん\nずっと待ってるからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8966, 103, 2, 12, 0, 122301, 1, 0, "けんぞくのこと\nずっとずっと守るよ！\nだからいつまでも\n一緒にいてね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8967, 1, 1, 1, 0, 134401, 1, 0, "私の歌や想いを\n誰かに託せる…\nこれほどうれしい\nことはありません");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8968, 2, 1, 1, 0, 134401, 1, 0, "コッコロさんの\n包容力はすごいです\nあんなふうに私も\n人を包み込めたら…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8969, 3, 1, 1, 0, 134401, 1, 0, "最近のボイトレは\nランファさんと一緒に\nやるんです。お互いに\n切磋琢磨しますよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8970, 4, 1, 1, 0, 134401, 1, 0, "先輩として相応しい\n立ち振る舞いを\n心がけたいですね\nしっかりしなきゃ…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8971, 5, 1, 1, 0, 134401, 1, 0, "ランファさんが\n踊ったら映えるかも…\nアイドルにも興味を\n持ってもらえないかな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8972, 101, 1, 4, 0, 134401, 1, 0, "支え導くために\n寄り添って考える…\nあの人からたくさん\n教わったことでしたね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8973, 102, 1, 8, 0, 134401, 1, 0, "いつだってあなたに\n恥じることのない\n姿をお見せしたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8974, 1, 2, 1, 0, 134401, 1, 0, "あなたの手は温かくて\n触れていると\n落ち着きますね…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8975, 2, 2, 1, 0, 134401, 1, 0, "里のみんなから修行の\n差し入れを頂きました\nよろしければ、一緒に\n食べましょう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8976, 3, 2, 1, 0, 134401, 1, 0, "ノゾミにもお土産を\n用意したいですね\n里のお土産選び、\n付き合ってください♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8977, 4, 2, 1, 0, 134401, 1, 0, "精霊たちも、あなたが\n大好きみたいです♪\n優しさが伝わって\nいるんでしょうね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8978, 101, 2, 4, 0, 134401, 1, 0, "特訓が終わったら、\n二人でどこかに\n出かけましょうか♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8979, 102, 2, 8, 0, 134401, 1, 0, "ひゃ…す、すみません\n肌の模様を\nなぞられると、\nくすぐったくて…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8980, 1, 2, 1, 0, 134401, 1, 1, "おはようございます\n精霊たちと一緒に、\n今日も頑張ります\n応援してくださいね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8981, 2, 2, 1, 0, 134401, 1, 2, "お昼の時間です\n今日も精いっぱい\n修行を頑張りましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8982, 3, 2, 1, 0, 134401, 1, 3, "もうすっかり夜ですね\n眠るまで子守唄を\n歌ってあげますよ？\nふふ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8983, 2, 3, 1, 0, 134401, 1, 0, "無理せず休憩するのも\n大切ですよね\nふかふか～…ふふっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8984, 3, 3, 1, 0, 134401, 1, 0, "今日はこの子に\n歌の特訓を聞いて\nもらいましょう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8985, 4, 3, 1, 0, 134401, 1, 0, "素敵な香り…\nふふ、精霊たちも\n気に入ったみたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8986, 5, 3, 1, 0, 134401, 1, 0, "あったかい…\nこの衣装、やっぱり\n少し冷えやすいものね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8987, 7, 3, 1, 0, 134401, 1, 0, "特訓の後のご飯は\n美味しいですね♪\nこれでまた頑張れます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8988, 8, 3, 1, 0, 134401, 1, 0, "唱喚士についての\n書籍はないみたい\nいつか私がここに\n楽譜を入れたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8992, 1, 1, 1, 0, 134601, 1, 0, "ギルドハウスの平和も\n任せてください\n何が来たって\n守ってみせますよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8993, 2, 1, 1, 0, 134601, 1, 0, "このギルドハウスも\nいつの間にか出撃台に\n改造されてたり\nするんでしょうか…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8994, 3, 1, 1, 0, 134601, 1, 0, "戦いを経験してこそ\n実感できますね\n平和はいいもの、\n友達は素晴らしいもの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8995, 4, 1, 1, 0, 134601, 1, 0, "次はランドソルで\n巨大ロボットが\nブームになったり？\n…さすがにないか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8996, 5, 1, 1, 0, 134601, 1, 0, "改めて見るとこの服…\nか、体の線とか\n結構目立ってるかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8997, 101, 1, 4, 0, 134601, 1, 0, "団長さんって\n知らない人とも\n話せる系ですよね\nコツはいったい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8998, 102, 1, 8, 0, 134601, 1, 0, "ＢＢ団、世界を救う！\nまだ信じられないけど\n本当にあった出来事\nなんですよね…！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8999, 1, 2, 1, 0, 134601, 1, 0, "パイロットも\n視力が大事なんです\n弓使いの経験が\n生きました！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9000, 2, 2, 1, 0, 134601, 1, 0, "ギガンティック\nマイフレンドくん、\n出撃！\nあ、ただの妄想です");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9001, 3, 2, 1, 0, 134601, 1, 0, "コクピットから\n降りたあとに残る\nふわふわ感…ちょっと\n癖になりませんか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9002, 4, 2, 1, 0, 134601, 1, 0, "ひえっ、敵襲！？\nあっすみません、\nちょっと\n寝ぼけてたかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9003, 101, 2, 4, 0, 134601, 1, 0, "共に戦場を駆け抜け\nＢＢ団の絆もより強く\nこれからも結束を\n強めましょうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9004, 102, 2, 8, 0, 134601, 1, 0, "同じコクピットに\n乗ったのに比べれば、\nスキンシップくらい…\nや、やっぱ緊張します");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9005, 1, 2, 1, 0, 134601, 1, 1, "おはようございます！\n今日もがんばりますっ\n…クローチェさんを\n見習ってみました…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9006, 2, 2, 1, 0, 134601, 1, 2, "お昼ご飯の時間ですね\nがんばって他の人\n誘ってみようかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9007, 3, 2, 1, 0, 134601, 1, 3, "夜の見張りは\n任せてください\n一人きりの夜も\n慣れてますから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9009, 2, 3, 1, 0, 134601, 1, 0, "休めるときに\n休んでおかなくちゃ\nいつ何が起こるか\n分かりませんからね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9010, 3, 3, 1, 0, 134601, 1, 0, "師匠もこういうの\n好きだったのかな…\nなんだかしんみり\nしちゃいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9011, 4, 3, 1, 0, 134601, 1, 0, "香りでリラックス…\n余裕のない時でも\nこういう安らぎは\n大切ですよね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9012, 5, 3, 1, 0, 134601, 1, 0, "あったかい…\nこれはきっと友情と\n同じぬくもり…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9014, 7, 3, 1, 0, 134601, 1, 0, "新鮮なご飯、感動…！\n師匠たちの世界だと\nご飯は保存食ばかり\nでしたからね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9015, 8, 3, 1, 0, 134601, 1, 0, "操縦マニュアル、\nしっかり読んで\n性能を引き出さなきゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9017, 1, 1, 1, 0, 134501, 1, 0, "屋内で飛べなくても\nここなら平気ですっ\n助けてくれる人が\nたくさんいますからっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9018, 2, 1, 1, 0, 134501, 1, 0, "新ボディになってから\n人や物が前より身近に\n感じられて、わたし、\n幸せですっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9019, 3, 1, 1, 0, 134501, 1, 0, "配達以外にも何か\nお仕事したいですっ！\nハグで遊覧飛行とか、\n喜んでもらえますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9020, 4, 1, 1, 0, 134501, 1, 0, "むむむ～…\n文字を書くのって\n難しいですね～っ\n練習しなくちゃっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9021, 5, 1, 1, 0, 134501, 1, 0, "簡易点検、よしっ！\nポポおじいさんに\n点検の仕方を教わって\n今日も絶好調ですっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9022, 101, 1, 4, 0, 134501, 1, 0, "明日は北の空、\n明後日は南の空っ♪\nえへへっ、見せたい\n景色がいっぱいですっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9023, 102, 1, 8, 0, 134501, 1, 0, "ついナイトさんを\n探しちゃいます…\nわたし、寂しんぼさん\nだったんでしょうかっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9024, 1, 2, 1, 0, 134501, 1, 0, "どんなところでも\nひとっ飛びっ♪\nわたしに任せて\nくださいねっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9025, 2, 2, 1, 0, 134501, 1, 0, "まだ知らない機能が\nエアリアルには\n隠されてるかもっ…\nワクワクしますねっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9026, 3, 2, 1, 0, 134501, 1, 0, "ひゃんっ！　…あはは\nエアリアルになっても\nケーブルに触られると\nくすぐったいですねっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9027, 4, 2, 1, 0, 134501, 1, 0, "ヴォルガーノさんに\nそっくりの子猫さんに\n最近触れたんですっ！\nかわいかったな～っ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9028, 101, 2, 4, 0, 134501, 1, 0, "ハグしてくれるん\nですかっ？\nえへへっ、ぎゅーっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9029, 102, 2, 8, 0, 134501, 1, 0, "ナイトさんと一緒に\nいるだけで、胸が\nぽかぽか～って\nあったかいですっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9030, 1, 2, 1, 0, 134501, 1, 1, "おはようございますっ\n目覚まし飛行は\nいかがでしょうかっ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9031, 2, 2, 1, 0, 134501, 1, 2, "お昼ですよっ！\nいっぱい補給して\nまたフルパワーで\nがんばりましょうっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9032, 3, 2, 1, 0, 134501, 1, 3, "眠れない夜はわたしに\n任せてくださいっ！\n充填さえあればずっと\n一緒にいられますよっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9034, 2, 3, 1, 0, 134501, 1, 0, "歩きづらいので\nこういう休憩ポイント\nって助かります～っ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9035, 3, 3, 1, 0, 134501, 1, 0, "スラスターを付けたら\nこの子たちも空を\n自由に飛べたり\nするんでしょうかっ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9036, 4, 3, 1, 0, 134501, 1, 0, "あっ、これに似た\n香りを近くのお店で\n検知したことが\nありますっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9037, 5, 3, 1, 0, 134501, 1, 0, "高熱源反応を検知っ\nわたしのスラスターも\n熱量の高さなら\nかなりものですよっ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9039, 7, 3, 1, 0, 134501, 1, 0, "もぐもぐもぐ…っ\n食べたぶんはあとで\n真空パックにして\nお返ししますねっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9040, 8, 3, 1, 0, 134501, 1, 0, "本を読むのって\n楽しいですねっ♪\n前はびりびりーって\nしちゃってたのでっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9042, 1, 1, 1, 0, 134701, 1, 0, "なかなかの住処ですね\nこの私の別邸にして\nあげてもいいですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9043, 2, 1, 1, 0, 134701, 1, 0, "はぁ…いつになったら\nすべての神力が\n戻るのでしょう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9044, 3, 1, 1, 0, 134701, 1, 0, "ここも悪くないですが\n昔私が作った庭園は、\nもっと良い場所でした\n焼けちゃいましたが…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9045, 4, 1, 1, 0, 134701, 1, 0, "うう…\nおなかが空きました…\nお米が食べたいです…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9046, 5, 1, 1, 0, 134701, 1, 0, "ここは平和ですねえ…\nジオ・ゲヘナも\nこのくらい穏やかなら\n住みやすいのですが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9047, 101, 1, 4, 0, 134701, 1, 0, "騎士さんのおかげで\n神力が戻ってきました\n良い働きですよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9048, 102, 1, 8, 0, 134701, 1, 0, "騎士さんのいる場所が\n今の私がいるべき場所\nなのかもしれませんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9049, 1, 2, 1, 0, 134701, 1, 0, "頭がたかーい！\n…ですよっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9050, 2, 2, 1, 0, 134701, 1, 0, "ほーちゃんと呼ぶ権利\n安売りはしませんよ？\n特別ですから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9051, 3, 2, 1, 0, 134701, 1, 0, "私とおしゃべりを？\nまあ、いいでしょう♪\n何を話しましょうか？\nこの羽の秘密とか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9052, 4, 2, 1, 0, 134701, 1, 0, "小鳥扱いは\nやめなさーい！\nこれでも神様ですよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9053, 101, 2, 4, 0, 134701, 1, 0, "き、気安く触るのは…\n…い、いえ、\n騎士さんなら…まぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9054, 102, 2, 8, 0, 134701, 1, 0, "絢爛豪華な絆！\nこの私と結べるなんて\n光栄でしょう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9055, 1, 2, 1, 0, 134701, 1, 1, "ふわぁぁ～\nおはようごじゃいます\n…んむむ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9056, 2, 2, 1, 0, 134701, 1, 2, "お昼ご飯は何を…\nえっ？　私？\nそそんな゛あ゛！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9057, 3, 2, 1, 0, 134701, 1, 3, "あの…騎士さん？\n添い寝する権利とか…\nほしくないですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9059, 2, 3, 1, 0, 134701, 1, 0, "はぁ～ふかふか…\n…へ？\n鳥の巣にいるみたい？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9060, 3, 3, 1, 0, 134701, 1, 0, "ふむ…\nそばに置いてあげても\nいいでしょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9061, 4, 3, 1, 0, 134701, 1, 0, "ほわぁ～\nいいかおり～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9062, 5, 3, 1, 0, 134701, 1, 0, "あたたかい…\nなんだか元気が\nでてきますねっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9064, 7, 3, 1, 0, 134701, 1, 0, "たくさん食べて力を\n取り戻さなくてはっ\n…んがぐぐっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9065, 8, 3, 1, 0, 134701, 1, 0, "ふむふむ…\n人の子にしては\nよく書けていますね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9067, 1, 1, 1, 0, 133101, 1, 0, "素敵なお家ですね\n温かみがあって\nどこか騎士様に\n似ております。ふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9068, 2, 1, 1, 0, 133101, 1, 0, "賑やかな街ですね\nこれほど活気豊かだと\nつい外に出てみたく\nなってしまいます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9069, 3, 1, 1, 0, 133101, 1, 0, "別世界の存在は知って\nおりましたが、いざ\n目の当たりにすると\n驚きの連続ですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9070, 4, 1, 1, 0, 133101, 1, 0, "この街は様々な種族が\nなにはばかることなく\n混在しているのですね\n…我々も、いつかは…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9071, 5, 1, 1, 0, 133101, 1, 0, "ランドソルにも香水の\nお店があるのですね\nどんな香りが揃って\nいるのでしょうか…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9072, 101, 1, 4, 0, 133101, 1, 0, "昨日、素敵な花園を\n見つけたのです\n今日のお茶会は\nそちらでしましょうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9073, 102, 1, 8, 0, 133101, 1, 0, "気を抜いてはいけない\nとわかっていても、\nここだとつい安心して\nしまいます…ふう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9074, 1, 2, 1, 0, 133101, 1, 0, "ごきげんよう\n街で見つけた茶葉を\n試しているんです\n騎士様も一杯どうぞ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9075, 2, 2, 1, 0, 133101, 1, 0, "親切な方ばかりですね\n素敵なお友だちが\nできそうな予感で、\nワクワクしてます…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9076, 3, 2, 1, 0, 133101, 1, 0, "黄泉の食卓の皆様用に\nお土産を用意しないと\n騎士様のお知恵も\n頼りにしておりますわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9077, 4, 2, 1, 0, 133101, 1, 0, "ジオ・ニヴルヘルと\n比べると、この世界は\n本当に明るいですね\n少し眩しいくらいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9078, 101, 2, 4, 0, 133101, 1, 0, "あまり、血の巡りが\n良くなくて…\n騎士様の手は\nとても温かいですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9079, 102, 2, 8, 0, 133101, 1, 0, "今度はわたくしに\nジオ・ニヴルヘルを\n案内させてくださいね\n観光案内のお返しです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9080, 1, 2, 1, 0, 133101, 1, 1, "おはようございます\n朝の眩しい太陽には\nなかなか慣れません…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9081, 2, 2, 1, 0, 133101, 1, 2, "騎士様、お茶は\nいかがでしょうか？\n一度一休みして、\n英気を養いましょう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9082, 3, 2, 1, 0, 133101, 1, 3, "眠れないのでしょうか\nまぶたが重くなるまで\nわたくしをお話し\n相手になさって下さい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9084, 2, 3, 1, 0, 133101, 1, 0, "思わず気が抜けそうに\nなってしまいます…\nふふ、ふわふわ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9085, 3, 3, 1, 0, 133101, 1, 0, "まあ、かわいらしい\nグレイスもきっと\n気に入りそうな\nデザインですわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9086, 4, 3, 1, 0, 133101, 1, 0, "まあ、いい香り…\n心安らぐようですわ\n素敵なセンスを\nお持ちなのですね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9087, 5, 3, 1, 0, 133101, 1, 0, "燃え移りや乾燥がある\nから近づかないほうが\nいいとわかりつつも…\nああ、温かい…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9089, 7, 3, 1, 0, 133101, 1, 0, "食が細いというよりは\n消化があまりうまく\nできなくて…本当は\nまだ頂きたいのですが");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9090, 8, 3, 1, 0, 133101, 1, 0, "『薔薇の下の契り』？\nまあ、男性同士で…！\nそんな…こ、これ以上\nここで読むわけには！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9092, 1, 1, 1, 0, 132301, 1, 0, "ダーリンが帰ってくる\n前に部屋の掃除しよ♪\n…ふふ、これってもう\n新婚生活だよね…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9093, 2, 1, 1, 0, 132301, 1, 0, "家具のセンスまで\n私と同じだなんて\n運命って怖いわ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9094, 3, 1, 1, 0, 132301, 1, 0, "あの人はベッドの下に\n何か隠してるのかな…\nな、なんて全っ然\n気にならないし…っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9095, 4, 1, 1, 0, 132301, 1, 0, "うっかりして\n角引っかけないように\nしないとね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9096, 5, 1, 1, 0, 132301, 1, 0, "錬金術を使わなくても\nあなたの心を鷲掴む\n私は恋も錬金術も\n失敗しないんだから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9097, 101, 1, 4, 0, 132301, 1, 0, "あの人って破廉恥なの\n興味あるのかしら…？\n基本破廉恥禁止だけど\nあの人だけは…許す…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9098, 102, 1, 8, 0, 132301, 1, 0, "手狭になれば錬金術で\n新しい部屋作るから\nいつ家族が増えても\n安心だよね…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9099, 1, 2, 1, 0, 132301, 1, 0, "錬金術でカレーライス\n作っちゃおっかな♪\n具材を釜でグツグツ…\nま、料理とも言うわね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9100, 2, 2, 1, 0, 132301, 1, 0, "錬金術に興味がある？\nじゃあさっそく私が\n手取り足取り教えるわ\nって…やだ破廉恥っ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9101, 3, 2, 1, 0, 132301, 1, 0, "イロハちゃんとの\n虫捕りは命懸けよ！\n一万匹捕れるまで\n帰れないんだから…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9102, 4, 2, 1, 0, 132301, 1, 0, "ソノさんって\n体は小さいけど\nとっても頼れる私の\nお姉さん的存在なの♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9103, 101, 2, 4, 0, 132301, 1, 0, "はあ…部屋中に広がる\nダーリンの香り…♪\n…ってノゾミみたいに\nなっちゃってる！？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9104, 102, 2, 8, 0, 132301, 1, 0, "鹿の獣人族の特徴は\nこのエッチな角…\n違っ！　叡智よ叡智！\n噛んだだけだからっ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9105, 1, 2, 1, 0, 132301, 1, 1, "あ、おはよう！\n寝る前に飲んだ\n目覚めすっきり秘薬の\n効果はバッチリかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9106, 2, 2, 1, 0, 132301, 1, 2, "午後からも頑張る\nあなたのために\n愛妻弁当作ったの♪\n一緒に食べよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9107, 3, 2, 1, 0, 132301, 1, 3, "今日も一日お疲れさま\n眠れないなら隣で…\nじゃなかった早寝して\n明日も頑張ろうね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9109, 2, 3, 1, 0, 132301, 1, 0, "いい錬成をするには\n適度な休憩も必要よね\n…気持ち良くてたまに\n寝落ちしちゃうけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9110, 3, 3, 1, 0, 132301, 1, 0, "かわいいぬいぐるみ\n錬成じゃなくて\n手編みで作ったら\n驚いてくれるかも♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9111, 4, 3, 1, 0, 132301, 1, 0, "くん、くん…\nん～いい匂い♪\nノゾミの香水と\nいい勝負だわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9112, 5, 3, 1, 0, 132301, 1, 0, "ああ、暖かい\nでもソノさんの作った\nミートパイの方が\nもっと温かいわ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9114, 7, 3, 1, 0, 132301, 1, 0, "もぐもぐ…私も\n食べても減らない秘薬\n錬成して他の食べ物も\n作れないかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9115, 8, 3, 1, 0, 132301, 1, 0, "ふむふむ…\nこのレシピ面白いわね\n今度錬成してみよっと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9117, 1, 1, 1, 0, 132501, 1, 0, "おー、体が軽い\n腰痛も胃もたれも\nないし、最高かよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9118, 2, 1, 1, 0, 132501, 1, 0, "いっつも力入れてたら\nいざって時困るし\nやっぱ省エネだな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9119, 3, 1, 1, 0, 132501, 1, 0, "やば…なんか急に\nブドウ朱飲みたい…\nルイちゃんに頼むか？\nいや、でもなあ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9120, 4, 1, 1, 0, 132501, 1, 0, "あれ、あの材料の在庫\nまだあったっけ…\nルイちゃんに確認しよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9121, 5, 1, 1, 0, 132501, 1, 0, "イロハのやつ変な\nイタズラしてない\nといいけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9122, 101, 1, 4, 0, 132501, 1, 0, "今日のシフトは～…\nお、彼と一緒じゃん\nふふっ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9123, 102, 1, 8, 0, 132501, 1, 0, "イロハのやつ\n不用意に私の体で\n彼に抱きつくなって\nこっちが恥ずかしい…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9124, 1, 2, 1, 0, 132501, 1, 0, "今日も元気だねえ\n若いってうらやま…\nっていや、今は私の\n方が若いじゃん");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9125, 2, 2, 1, 0, 132501, 1, 0, "ん～？　どしたん\nヒマならうちの店で\nバイトしてく？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9126, 3, 2, 1, 0, 132501, 1, 0, "イロハ見なかった？\n今日は手伝うって約束\nしてたのにさあ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9127, 4, 2, 1, 0, 132501, 1, 0, "ルイちゃん特製\nエナドリ（子ども用）\nこれ飲んで今日も\nお仕事頑張るかー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9128, 101, 2, 4, 0, 132501, 1, 0, "元の体なら\n君と目線、合うのにね\n…ってドラマかよ\nごめん、今の忘れて");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9129, 102, 2, 8, 0, 132501, 1, 0, "なんかヒマそうじゃん\n用事ないなら\nお姉さんがコーヒー\n淹れたげよっか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9130, 1, 2, 1, 0, 132501, 1, 1, "ふわあ…おはよ\n今日もお仕事\nがんばりますかー");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9131, 2, 2, 1, 0, 132501, 1, 2, "ちょうどいいや\n一緒にお昼どうよ\nお姉さんが\n奢ってあげよう");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9132, 3, 2, 1, 0, 132501, 1, 3, "ふぁぁ…ふぅ\nここからは大人の時間\nなんだけどさぁ\n眠くてかなわん…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9134, 2, 3, 1, 0, 132501, 1, 0, "おお～なんか前より\nでっかく感じるわ～\nてそりゃそうか");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9135, 3, 3, 1, 0, 132501, 1, 0, "そいえば、イロハって\nあんまこういうの\n欲しがらなかったな～\nクワガタばっかで");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9136, 4, 3, 1, 0, 132501, 1, 0, "はあ…いい匂いだね\nさすがルイちゃん特製\n錬金アロマ\n次の目玉商品だな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9137, 5, 3, 1, 0, 132501, 1, 0, "ユカリっち焚火の前で\nキメる麦しゅわに\nハマってるらしいけど\n興味あるわぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9139, 7, 3, 1, 0, 132501, 1, 0, "うわこれ…\n無限にいけちゃうわ\n子どもの胃袋\n恐るべし…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9140, 8, 3, 1, 0, 132501, 1, 0, "ふむ、こんな需要が…\n次の新商品として\nルイちゃんに試作\n頼んでみるか～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9142, 1, 1, 1, 0, 134801, 1, 0, "服はその人の個性です\n仕立て屋は\nその手伝いをする\nプロなんです♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9143, 2, 1, 1, 0, 134801, 1, 0, "糸を紡いで紡いで\n巻き巻き～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9144, 3, 1, 1, 0, 134801, 1, 0, "ふむ…あの人の衣装\nなかなか斬新ですね\n後でどうなってるのか\n見せてもらおう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9145, 4, 1, 1, 0, 134801, 1, 0, "動きやすさと\nファッション性\n両立させてみせますよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9146, 5, 1, 1, 0, 134801, 1, 0, "今度のコレクション\n新作にワイルドな\nルームウェアは\nどうかな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9147, 101, 1, 4, 0, 134801, 1, 0, "騎士さんもたまには\n衣装の感想とか言って\nくれてもいいのにな～");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9148, 102, 1, 8, 0, 134801, 1, 0, "ノゾミさんとチカさん\nにも、おそろいの服を\nプレゼントしてみよう\n二人とも似合いそう♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9149, 1, 2, 1, 0, 134801, 1, 0, "ジオ・ゲヘナでまた\n素材収集したいんです\n手伝ってくれますか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9150, 2, 2, 1, 0, 134801, 1, 0, "えっ？　薄着すぎ？\nおしゃれのためなら\nこのくらいへっちゃら\nですよ…っくしゅん！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9151, 3, 2, 1, 0, 134801, 1, 0, "穴が開いてる？\nこれはそーいう\nデザインですー！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9152, 4, 2, 1, 0, 134801, 1, 0, "ちょっとどこ\n触ってるんですかー！\n…あ、糸くず\n取ってくれたんですね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9153, 101, 2, 4, 0, 134801, 1, 0, "騎士さんに\n新しい生地の服を…\nいや、シャレじゃ\nないですよ？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9154, 102, 2, 8, 0, 134801, 1, 0, "素敵な着こなしには\n健康な体も大切！\n騎士さんに見られても\n恥ずかしくないように");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9155, 1, 2, 1, 0, 134801, 1, 1, "おはようございます！\nさあ、着替えて！\n私が見繕ってあげます");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9156, 2, 2, 1, 0, 134801, 1, 2, "お昼は激辛料理です\nジオ・ゲヘナで\nハマッちゃって…\n一緒にどうですか？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9157, 3, 2, 1, 0, 134801, 1, 3, "睡眠不足は美容の大敵\nていうかシンプルに…\nね、眠い…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9159, 2, 3, 1, 0, 134801, 1, 0, "くつろげますね～\nでももうちょっと\n生地の手触りが…\nって、職業病？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9160, 3, 3, 1, 0, 134801, 1, 0, "かわいいものって\n心を癒してくれますね\n服もそうありたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9161, 4, 3, 1, 0, 134801, 1, 0, "いい香り～♪\nこの匂いにはどんな服\nが合うかなあ…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9162, 5, 3, 1, 0, 134801, 1, 0, "この服露出が多いから\n温かいとほっとする～\nずっとこうして\nいたいかも…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9164, 7, 3, 1, 0, 134801, 1, 0, "いくらでも\n食べられちゃうから、\n自分でストップ\nかけないと…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9165, 8, 3, 1, 0, 134801, 1, 0, "しっかり勉強して\nジオ・ゲヘナに\nお洒落を伝えたいです");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9167, 1, 1, 1, 0, 134901, 1, 0, "あたくしは高貴なる\nマンティコア！\nサソリでもコウモリ\nでもありませんわよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9168, 2, 1, 1, 0, 134901, 1, 0, "なかなか居心地がいい\nお部屋ですわね～\n…さてどうやって\nあたくしのものに…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9169, 3, 1, 1, 0, 134901, 1, 0, "高貴なるお審美眼で\nあの家具の価値を\n測ってやりますわ\n…ギリ合格ですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9170, 4, 1, 1, 0, 134901, 1, 0, "高貴なる笑い声は\n一日にしてならず\nお子様の頃から練習を\n重ねてきたのですわ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9171, 5, 1, 1, 0, 134901, 1, 0, "お美しいあたくし様と\n同じ空間にいられる…\nどうぞその喜びを\n噛みしめなさいな♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9172, 101, 1, 4, 0, 134901, 1, 0, "アナタがお土下座して\n頼むなら、あたくしも\nもう少しここに残って\n構いませんわよ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9173, 102, 1, 8, 0, 134901, 1, 0, "馬ボーンをあたくしに\n振り向かせるには\nどうしたら…って、\nこの言い方は語弊が！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9174, 1, 2, 1, 0, 134901, 1, 0, "少し寒いですわね…\n…この服装のせい？\nこっちだって好きで\n着てねぇですわよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9175, 2, 2, 1, 0, 134901, 1, 0, "あのラミアが来たら\nあたくし様はお用事で\nお留守って言って\n追い返すんですのよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9176, 3, 2, 1, 0, 134901, 1, 0, "こっちの世界にも\n闘技場がありますの？\nそこもお頂点を極めて\nしまおうかしら～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9177, 4, 2, 1, 0, 134901, 1, 0, "馬ボーンって\n人畜無害そうなお面の\nわりに、時々やること\nえげつねぇですわね…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9178, 101, 2, 4, 0, 134901, 1, 0, "ねぇ馬ボーン…\nアナタあの魔札、\nまだ持ってまして？\nとっとと捨てなさい！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9179, 102, 2, 8, 0, 134901, 1, 0, "絶対にあたくし様の\nお尻尾に触るんじゃ\nねぇですわよ…？\nいえ、振りではなく！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9180, 1, 2, 1, 0, 134901, 1, 1, "ふわぁ…\n打倒ネフィのお作戦を\n夜通し考え過ぎて、\n寝不足ですわぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9181, 2, 2, 1, 0, 134901, 1, 2, "もうお昼ですの？\nあたくし様に相応しい\n優雅なおランチと\n参りますわよ～♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9182, 3, 2, 1, 0, 134901, 1, 3, "あら馬ボーンったら\nまだ起きてますの？\n…ぐぬぬ、夜の間に\n仕掛ける作戦が…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9184, 2, 3, 1, 0, 134901, 1, 0, "このおフカフカ感…♪\n剣闘士宿舎の\nゴワゴワなお寝床とは\n大違いですわね！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9185, 3, 3, 1, 0, 134901, 1, 0, "なんですの、この\n弱っちそうなお顔は…\nおかわいそうですし、\nお僕にしてあげますわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9186, 4, 3, 1, 0, 134901, 1, 0, "馬ボーンはこういう\n匂いが好みですの？\nふーん…ほーう…\nなるほどですわ…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9187, 5, 3, 1, 0, 134901, 1, 0, "あぁ～～…\nそうそう、これくらい\n暑い方が快適ですわ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9189, 7, 3, 1, 0, 134901, 1, 0, "もぐもぐ、もぐっ…\nまぁそこそこ？\n悪くないお味では\nありますわねっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9190, 8, 3, 1, 0, 134901, 1, 0, "こんな本よりも、\n華麗なるカノン様の\n活躍録でも置いた方が\n世のためになりますわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9192, 1, 1, 1, 0, 132401, 1, 0, "さっきねー、外で猫と\n木登り競争したんだよ\nなかなか手ごわい\n相手だった！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9193, 2, 1, 1, 0, 132401, 1, 0, "いっぱい食べて\n大きくなるんだ～\nあっでもこれ\nソノちゃんの体か");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9194, 3, 1, 1, 0, 132401, 1, 0, "強いおねーさんの\n気配を感じる…\nどこから？\n…そこら中から！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9195, 4, 1, 1, 0, 132401, 1, 0, "虫捕り網の手入れは\nいつもバッチリ！\nいつ何が出るか\nわからないもんね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9196, 5, 1, 1, 0, 132401, 1, 0, "うちの中で走り回ると\nソノちゃんに\n怒られちゃうけど…\nここならいける？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9197, 101, 1, 4, 0, 132401, 1, 0, "おじちゃんも\nお部屋にいろいろ\n隠してるのかな？\nルイちゃんみたいに");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9198, 102, 1, 8, 0, 132401, 1, 0, "世界一になったら\nおじちゃんにも\nいっぱい褒めて\nほしいな…約束っ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9199, 1, 2, 1, 0, 132401, 1, 0, "高いとこのものが\n取りたいときは\nイロハに言ってね\nイロハ得意だから！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9200, 2, 2, 1, 0, 132401, 1, 0, "どうも、イロハです\n剣士たるもの、\nあいさつは大事って\n教わったんだ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9201, 3, 2, 1, 0, 132401, 1, 0, "イロハと勝負だね！\n受けて立つよ～！\n…あれ、違った？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9202, 4, 2, 1, 0, 132401, 1, 0, "あっ！　ルイちゃんに\n素材集め頼まれてたの\n忘れてた…！　やばい\nおじちゃん手伝って！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9203, 101, 2, 4, 0, 132401, 1, 0, "実はイロハって\n褒めたら伸びる\nタイプなんだ\nだからよろしくね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9204, 102, 2, 8, 0, 132401, 1, 0, "このお部屋、すごく\n居心地がいいんだ～\nやっぱりおじちゃんが\nいるからかな？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9205, 1, 2, 1, 0, 132401, 1, 1, "昨日仕掛けた罠で\n虫捕れてるかな？\nあとで一緒に\n見に行こうね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9206, 2, 2, 1, 0, 132401, 1, 2, "もうお昼だよね？\nイロハのお腹が\n空いてきたから\n間違いないよ！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9207, 3, 2, 1, 0, 132401, 1, 3, "ふわぁ～…\nあ、あくびじゃないよ\nイロハ大人なんだから\n眠くなんか…ふわぁ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9209, 2, 3, 1, 0, 132401, 1, 0, "ふわふわしたものって\nつい飛び込みたく\nなっちゃうよね\n…うずうずっ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9210, 3, 3, 1, 0, 132401, 1, 0, "かわいいのもいいけど\nカッコよさも欲しいな\nそーだ、角とかもっと\nいっぱい付けてみる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9211, 4, 3, 1, 0, 132401, 1, 0, "おー、いい匂い♪\nこれもしかして\nルイちゃんの新作？\n爆売れ間違いなしだよ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9212, 5, 3, 1, 0, 132401, 1, 0, "ぬくぬくぽかぽか、\n気持ちいいー…\nでもちょっと\n暑くなってきたな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9214, 7, 3, 1, 0, 132401, 1, 0, "もぐもぐもぐ…\nこれはいい食材を\n使っておりますなぁ\nうん、三ツ星！");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9215, 8, 3, 1, 0, 132401, 1, 0, "ふむふむなるほど…\nこっ、これは…！\n…ごめん、適当に\n言ってみた");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9217, 1, 1, 1, 0, 135001, 1, 0, "また海に行く時に\n備えて…次の計画を\n練る必要がある…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9218, 2, 1, 1, 0, 135001, 1, 0, "騒がしいのも…\n以前ほど気にならない\n慣れてしまった…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9219, 3, 1, 1, 0, 135001, 1, 0, "眩暈がする暑さも\n騎士クンと同じ気温を\n感じられるなら…いい");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9220, 4, 1, 1, 0, 135001, 1, 0, "騎士クンに\n好意を抱く者は\nみんな有罪\n…わたしは例外");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9221, 5, 1, 1, 0, 135001, 1, 0, "体も心も…外の世界に\n馴染んできた気がする\n少しずつ、だけど…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9222, 101, 1, 4, 0, 135001, 1, 0, "騎士クンの手…\n大きかった…\n…また、つなぎたいな");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9223, 102, 1, 8, 0, 135001, 1, 0, "夏が終わっても…\nその先の季節も\n…その次の夏も\n騎士クンと一緒に…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9224, 1, 2, 1, 0, 135001, 1, 0, "騎士クンといるとね\n渇いてた心が…\n潤される、気がするの");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9225, 2, 2, 1, 0, 135001, 1, 0, "騎士クンは…\nしたいこと、ある？\n夏にだけ…できること\n一緒に、しようね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9226, 3, 2, 1, 0, 135001, 1, 0, "仮想領域の夢でも\n現実の海でも…\n騎士クンと一緒なら\nそこが本物の夏、だね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9227, 4, 2, 1, 0, 135001, 1, 0, "肝試しがしたい…？\n…うまく驚けるかな\n練習しなくちゃ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9228, 101, 2, 4, 0, 135001, 1, 0, "騎士クンとなら\nどんな夏でも…\nきっと楽しい…♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9229, 102, 2, 8, 0, 135001, 1, 0, "水着…どうかしら…？\n…よかった\nシミュレーションの\n成果ね。ふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9230, 1, 2, 1, 0, 135001, 1, 1, "騎士クン…眠たそう\nもうちょっと…寝る？\n後で起こしてあげるね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9231, 2, 2, 1, 0, 135001, 1, 2, "お出かけするなら\n水筒を用意するね…\n夏の水分補給は大事…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9232, 3, 2, 1, 0, 135001, 1, 3, "また…夜の海を\n見に行きたいな\n騎士クンと一緒に\n連れていってくれる？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9234, 2, 3, 1, 0, 135001, 1, 0, "騎士クンを待つには\nちょうどいい…\n…落ち着く…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9235, 3, 3, 1, 0, 135001, 1, 0, "こういう物を\n城に置いた方が\nかわいいって思って\nもらえる…かな…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9236, 4, 3, 1, 0, 135001, 1, 0, "夏に合わせた香りね…\n涼やかな風が胸を\n吹き抜けるような…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9237, 5, 3, 1, 0, 135001, 1, 0, "火は落ち着く…\n身体感覚を味わえる\n作り物の…この体でも");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9239, 7, 3, 1, 0, 135001, 1, 0, "『食』…騎士クンと\n話す共通の話題には\n悪くなさそう…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9240, 8, 3, 1, 0, 135001, 1, 0, "『好きな人と楽しめる\n夏デート特集』…？\n……ふむ…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9242, 10, 3, 1, 0, 135001, 1, 0, "わたしの趣味では\nないけれど…\n騎士クンが望むなら\n城に置いても…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9243, 11, 3, 1, 0, 135001, 1, 0, "む…悪くない\nこれなら\n騎士クンと一緒に…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9244, 1, 1, 1, 0, 135101, 1, 0, "一日中水着でいるって\n浮かれているみたいね\n夏は短いから、沢山\n楽しまなくちゃね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9245, 2, 1, 1, 0, 135101, 1, 0, "ちょっと暑いし\n氷の上を滑って\n涼もうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9246, 3, 1, 1, 0, 135101, 1, 0, "そろそろ運送ギルドの\nアルバイトの時間だわ\n準備しなきゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9247, 4, 1, 1, 0, 135101, 1, 0, "エリスさん、水着が\nすごく似合ってた…\nどこで買ったのかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9248, 5, 1, 1, 0, 135101, 1, 0, "未練が残らないように\nこの夏休みでやりたい\nことはやらなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9249, 101, 1, 4, 0, 135101, 1, 0, "かき氷を作ったら\n彼も食べるかしら？\nアイスクリームの\nほうがいいかな…");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9250, 102, 1, 8, 0, 135101, 1, 0, "水着を着ていれば\nどこにいても\nリゾート気分だわ♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9251, 1, 2, 1, 0, 135101, 1, 0, "夏はおいしいものが\nたくさんあるし\n【美食殿】の活動も\n忙しくなりそうね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9252, 2, 2, 1, 0, 135101, 1, 0, "わ、私の尻尾…\nそんなに気になる？\nつついたらダメよ\nいいわね…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9253, 3, 2, 1, 0, 135101, 1, 0, "夏は日が長いし\nまだまだたくさん\n遊べそうね♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9254, 4, 2, 1, 0, 135101, 1, 0, "今日は一緒に海に\n行かない？\nあなたも水着\n持ってきてるでしょ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9255, 101, 2, 4, 0, 135101, 1, 0, "そろそろ日焼け止めを\n塗り直さなきゃ…あの\nお願いしてもいい…？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9256, 102, 2, 8, 0, 135101, 1, 0, "私たちで最高の\n夏休みにしましょう\nね、おにーたん♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9257, 1, 2, 1, 0, 135101, 1, 1, "夏の朝は早いわね\nもうセミも鳴いてるし\nあなたも早起きだわ…\n見習わなくちゃ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9258, 2, 2, 1, 0, 135101, 1, 2, "日中は暑いだろうし\nゆっくりしましょう\nお昼寝タイムはどう？");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9259, 3, 2, 1, 0, 135101, 1, 3, "この時間のアイス\nクリームは格別よね♪\n何味にしようかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9261, 2, 3, 1, 0, 135101, 1, 0, "暑い夏はしっかり\n休むことが大切\nふぅ…いい気持ち♪");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9262, 3, 3, 1, 0, 135101, 1, 0, "ふわふわの毛並み\n暑くないのかしら\nかわいいだけじゃなく\n忍耐強くもあるのね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9263, 4, 3, 1, 0, 135101, 1, 0, "爽やかでいい匂い…♪\nジトジトしがちの夏に\nピッタリなアロマね");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9264, 5, 3, 1, 0, 135101, 1, 0, "ずっと水着でいると\n流石に冷えるわね\nうん、いい心地だわ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9266, 7, 3, 1, 0, 135101, 1, 0, "はむっはむっ…\nしっかり食べて\n夏バテ対策しないと");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9267, 8, 3, 1, 0, 135101, 1, 0, "ふむふむ…面白いわね\n今度プレシアちゃんと\n一緒に読もうかしら");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9269, 10, 3, 1, 0, 135101, 1, 0, "私のフロートと少し\n似ている気がする\nサイズ的にはこっちが\nお兄さんかしら…ふふ");
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (9270, 11, 3, 1, 0, 135101, 1, 0, "ふふ、きれい♪\nまるで\n海のステージね！");
